import{_ as g,o as t,c as n,a as i,t as u,C as h,M as _,U as k,f as p,F as w,p as b,e as f,q as D}from"./chunks/framework.B1z0IdBH.js";const v={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},B={class:"entry-container"},y={class:"entry"},A={class:"entry-image"},j=["src","alt"],C={class:"entry-content"},z={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",B,[i("div",y,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,j)]),i("div",C,[i("h2",z,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const M=g(v,[["render",x],["__scopeId","data-v-e9078b30"]]),P=JSON.parse(`[{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1986","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Entrainement_SRFC_St-Malo_2013_%2895bis%29.JPG","page_title":"Lijst van personen geboren in 1986","context_page_description":"Dit is een lijst van personen die geboren zijn in 1986.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BD%D1%82%D0%B0%D0%BD%D1%8C%D0%B5_(%D0%BA%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Montagney%2C_ancien_presbyt%C3%A8re_avec_tours-pigeonniers.jpg","page_title":"Монтанье (коммуна)","context_page_description":"Монтанье — Францин гӀала-коммуна, лаьтта Франш-Конте регионехь. Коммунан департамент — Лакха Сона. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rivieren_in_Oost-Timor","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Ainaro_cities_rivers.png","page_title":"Lijst van rivieren in Oost-Timor","context_page_description":"In deze lijst van rivieren in Oost-Timor zijn de rivieren en zijrivieren gegroepeerd naar regio: noordkust, zuidkust en de exclave Oecusse. De zijrivieren zijn ingesprongen weergegeven onder de naam van de betreffende hoofdrivier."},{"page_url":"https://it.wikipedia.org/wiki/Specie_di_Linaria","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Linaria_alpina_R0012652.JPG","page_title":"Specie di Linaria","context_page_description":"Elenco delle specie di Linaria:"},{"page_url":"https://nl.wikipedia.org/wiki/Scheepslift","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Falkirk01.jpg","page_title":"Scheepslift","context_page_description":"Een scheepslift is een mechanische constructie die een bak water waar een schip in geplaatst kan worden, verticaal kan verplaatsen. Het schip kan zo naar een hoger of lager niveau in een kanaal getild worden. Scheepsliften kunnen in één keer een veel groter verval aan dan schutsluizen, waardoor er met scheepsliften behoorlijk wat tijdwinst gemaakt kan worden. In tegenstelling tot een schepenlift en een scheepskameel verplaatst een scheepslift niet alleen het schip maar ook de bak met water waarin het schip ligt.\\nOok worden de waterverliezen van het bovenste waterpand beperkt. Het hoge gewicht van de te transporteren waterbak en de vele mechanische onderdelen van de lift zorgen ervoor dat een scheepslift heel wat onderhoud vergt."},{"page_url":"https://de.wikipedia.org/wiki/HR_Giger","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Giger_Plastik_Chur.jpg","page_title":"HR Giger","context_page_description":"HR Giger, Künstlername von Hans Rudolf Giger, in seiner Heimat mit landestypischem Hansruedi angesprochen resp. genannt, war ein Schweizer bildender Künstler, Maler und Oscarpreisträger."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D1%83%D0%B3%D0%B5%D1%80%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Testament_de_Suger%2C_abb%C3%A9_de_Saint-Denis_1_-_Archives_Nationales_-_AE-II-145.jpg","page_title":"Сугерий","context_page_description":"Сугерий или Сюже́, също Сюже́р Сен-Дени, влиятелен съветник на френските крале Луи VI и Луи VII, държавен деятел със специално място във френската история."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%B6%D9%84%D8%B9_%D8%B1%D9%88%D9%BE%D9%86%DA%AF%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Punjab_India_Dist_Rupnagar.png","page_title":"ضلع روپنگر","context_page_description":"ضلع روپنگر بھارت کے شمال مغرب میں ریاست پنجاب کے 22 اضلاع میں سے ایک ہے۔ کہا جاتا ہے کہ روپنگر شہر روکشر نامی راجا نے قائم کیا تھا اور اوکا نام اس کے بیٹے روپ سین کے نام پر ہے۔"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%99%AE%E6%B3%95%E5%B0%94%E8%8C%A8%E7%BB%9F%E6%B2%BB%E8%80%85%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/King_Max_I_Joseph_in_Coronation_Robe.jpg","page_title":"普法尔茨统治者列表","context_page_description":"这个列表是关于德国历史上的普法尔茨领地的统治者。关于普法尔茨一词的含义，请参见条目普法尔茨。"},{"page_url":"https://fr.wikipedia.org/wiki/Coubeyrac","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Coubeyrac_Limite_communale.jpg","page_title":"Coubeyrac","context_page_description":"Coubeyrac est une commune du Sud-Ouest de la France, située dans le département de la Gironde en région Nouvelle-Aquitaine."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%88%98%E6%98%93%E6%96%AF%E4%B8%8E%E5%85%8B%E6%8B%89%E5%85%8B%E8%BF%9C%E5%BE%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Mandan_and_Arikara_delegation_-_NARA_-_523669.jpg","page_title":"刘易斯与克拉克远征","context_page_description":"刘易斯与克拉克远征是美国国内首次横越大陆西抵太平洋沿岸的往返考察活动。领队为美国陆军的梅里韦瑟·刘易斯上尉和威廉·克拉克少尉，该活动是由杰弗逊总统所发起。"},{"page_url":"https://es.wikipedia.org/wiki/Religi%C3%B3n_en_Lituania","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/Karaite_Kenesa_Vilnius.jpg","page_title":"Religión en Lituania","context_page_description":"Según el censo de 2011, la \\"religión predominante en Lituania\\" es el cristianismo, con la mayor confesión de la Iglesia católica. A principios del siglo XXI, alrededor del 77% de la población es católica según el censo de 2011.​ También hay grupos más pequeños de cristianos ortodoxos, evangélicos luteranos, miembros de la iglesia reformada, otros protestantes, judíos y musulmanes, así como personas de otras religiones. Algunos elementos de la antigua religión pagana lituana sobreviven en el campo, mezclados con cristianismo.\\nDE acuerdo con ua encuesta del Eurobarómetro​ el 47% de los ciudadanos lituanos respondieron que \\"creen que hay un Dios\\", el 37% respondió que \\"creen que hay algún tipo de espíritu o fuerza vital\\", y 12% dijo que \\"no creen que haya ningún tipo de espíritu, dios o fuerza vital\\"."},{"page_url":"https://en.wikipedia.org/wiki/National_Route_7_(Argentina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Mendoza_-_Villavicencio_-_20060107a.jpg","page_title":"National Route 7 (Argentina)","context_page_description":"National Route 7 is a road in Argentina. It crosses the country from east to west, from the capital to the border with Chile, thus linking the Atlantic coast with the Andes, crossing the provinces of Buenos Aires, Santa Fe, Córdoba, San Luis and Mendoza. It has a total length of 1,224 km, of which 367 km are freeways.\\nNational Route 7 is a branch of the Pan-American Highway, continuing into Chile under the name of Route CH-60."},{"page_url":"https://en.wikipedia.org/wiki/Electric_bus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/NishiTokyoBus_B21251_Hamurun_EV_bus.jpg","page_title":"Electric bus","context_page_description":"An electric bus is a bus that is powered by electricity.\\nElectric buses can store the electricity on board, or can be fed continuously from an external source.\\nBuses storing electricity are majorly battery electric buses, in which the electric motor obtains energy from an on-board battery, although examples of other storage modes do exist, such as the gyrobus which uses flywheel energy storage.\\nWhen electricity is not stored on board, it is supplied by contact with outside power sources. For example, overhead wires, as in the trolleybus, or with non-contact conductors on the ground, as in online electric vehicles.\\nAs of 2019, 99% of the battery electric buses in the world have been deployed in China, with more than 421,000 buses on the road, which is 17% of China's total bus fleet. For comparison, the US had 300, and Europe had 2,250."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D8%A7%D8%A8%D8%B1%DB%8C%DA%A9%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Fabrika_%28musical_group%29_.jpg","page_title":"فابریکا","context_page_description":"فابریکا نام یک گروه موسیقی دخترانه روسی است که فعالیت خود را از سال ۲۰۰۲ از شهر مسکو آغاز کرد. این گروه اولین آلبوم موسیقی خود را در سال ۲۰۰۳ منتشر کرد. دومین و سومین آلبوم این گروه هم به ترتیب در سالهای ۲۰۰۸ و ۲۰۱۱ منتشر شد.\\nموفق‌ترین آلبوم این گروه Про любовь نام دارد."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AE%D8%A7%D9%88%DB%8C%D8%B1_%D8%B3%D9%88%D9%84%D8%A7%D9%86%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Javier_Solana_%282007%29.jpg","page_title":"خاویر سولانا","context_page_description":"خاویر سولانا ؛ نماینده عالی سابق سیاست امنیتی و خارجی مشترک اتحادیه اروپا، دبیرکل شورای اتحادیه اروپا و شورای اتحادیه اروپای غربی است. وی فیزیکدانی است که ۱۳ سال به عنوان سیاست‌مدار در مقام وزیر دولت حزب کارگران سوسیالیست اسپانیا به نخست‌وزیری فیلیپ گونزالز کار می‌کرد و پس از آن از سال ۱۹۹۴ تا ۱۹۹۹ دبیرکل ناتو بود. بمباران یوگسلاوی توسط ناتو در خلال جنگ کوزوو از اتفاقات مهم در دوران تصدی وی بر این سمت بود."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%95%D7%93%D7%95%D7%9C_%D7%94%D7%90%D7%9C%D7%A1%D7%98%D7%99%D7%95%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Stress_v_strain_2h.png","page_title":"מודול האלסטיות","context_page_description":"בהנדסת חומרים, מודול האלסטיות של חומר או מודול יאנג הוא היחס בין מאמץ למעוות, או בניסוח פשוט יותר ההתנגדות של החומר לשינוי קטן בצורתו באמצעות כוח המופעל עליו, בתחום האלסטי, כלומר התחום בו היחס בין מאמץ למעוות שומר על ליניאריות. בשינוי אלסטי החומר חוזר למצבו המקורי כאשר הכוח מוסר. הדיאגרמה המציגה את היחס בין המאמץ והמעוות מכונה עקומת מאמץ-מעוות, והיא מציגה את היחס ביניהם בכל תחום נתון. במודלים פשוטים של חוזק, הדיאגרמה פשוטה יחסית והחומר מתנהג בצורה עקבית. במודלים מסובכים יותר ובחומרים מורכבים הקשר בין מאמץ למעוות חדל להיות ליניארי. מודול האלסטיות הוא ערך המבטא את הגמישות של החומר."},{"page_url":"https://en.wikipedia.org/wiki/Crepedula","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Roman_Empire_-_Africa_Proconsularis_%28125_AD%29.svg","page_title":"Crepedula","context_page_description":"Crepedula was an ancient Roman–Berber civitas in the province of Byzacena in Africa Proconsularis. It was located in modern Tunisia. The town was also the seat of a Catholic diocese.\\nThere are three known bishops of this diocese.\\nThe Catholic bishop Barbarianus Creperulensis attended the Council of Carthage, he had no Donatists competitors.\\nFelix was among the Catholic bishops summoned to Carthage in 484 by the Vandal king Huneric.\\nFinally, among the signatories of a letter against monothelitism dated 646 was Speranza.\\nToday Crepedula survives as titular bishopric and the current bishop is Karl Borsch, of Aachen."},{"page_url":"https://it.wikipedia.org/wiki/Charlie_Hunnam","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/MJK34322_Charlie_Hunnam_%28The_Lost_City_Of_Z%2C_Berlinale_2017%29.jpg","page_title":"Charlie Hunnam","context_page_description":"Charles Matthew \\"Charlie\\" Hunnam è un attore britannico."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%A7%D8%A8%D9%86_%D8%B2%DB%81%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Avenzoar_%28c._1906%29_-_Veloso_Salgado.png","page_title":"ابن زہر","context_page_description":"ابن زھر خاندان طب وادب، شعر وسیاست میں اندلس کے نابغۂ روزگار خاندانوں میں سے ایک ہے، یہ خاندان ابتدا میں جفن شاطبہ کے جنوب مشرقی علاقے میں رہا اور وہاں سے مختلف علاقوں میں پھیل گیا، اس خاندان کے لوگ مختلف ادوار میں طب، فقہ، شعر، ادب، ادارت اور وزارت کے اعلی مراتب پر فائز رہے، ذیل میں ہم اس خاندان کے ان لوگوں کو زیرِ قلم لائیں گے جنہوں نے طب کے شعبہ میں کا رہائے نمایاں سر انجام دیا۔"},{"page_url":"https://sw.wikipedia.org/wiki/Great_Neck,_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Middle_Neck_Road%2C_Great_Neck%2C_New_York.jpg","page_title":"Great Neck, New York","context_page_description":"Great Neck ni mji wa Marekani katika jimbo la New York."},{"page_url":"https://it.wikipedia.org/wiki/Modello_cosmologico_bi-metrico","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Two-sided_spacetime_curvatures.png","page_title":"Modello cosmologico bi-metrico","context_page_description":"Le teorie della gravità bimetrica sono teorie alternative della gravità in cui vengono utilizzati due o più tensori invece di un solo tensore metrico. Spesso la seconda metrica viene introdotta solo ad alte energie, supponendo che la velocità della luce possa dipendere dall'energia. Gli esempi più famosi di teorie bimetriche sono la teoria di Rosen e la teoria relativistica della gravità.\\nLa gravità bimetrica, o bigravità, si riferisce a due diverse teorie. La prima serie di teorie si basa su teorie matematiche modificate della gravità in cui vengono utilizzati due tensori metrici invece di uno. Una seconda metrica può essere introdotta per stati ad alta densità di energia, il che implica che la velocità della luce può dipendere dalla densità di energia, il che permette ai modelli di utilizzare una velocità variabile della luce. In questi casi, la seconda metrica si riferisce al gravitone, particelle ipotetiche con massa, e anche in alcuni studi sullo \\"spettro di massa\\". Si tratta di una continuazione della teoria della gravità massiva. Esistono diverse teorie bimetriche con gravitoni massicci, come quelle attribuite a Nathan Rosen."},{"page_url":"https://cs.wikipedia.org/wiki/Dub_cesm%C3%ADnolist%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Quercus_ilicifolia_02.jpg","page_title":"Dub cesmínolistý","context_page_description":"Dub cesmínolistý je opadavý keř nebo strom dorůstající výšky 8 metrů. Pochází z východních oblastí USA a v Česku je zřídka pěstován jako parková dřevina."},{"page_url":"https://de.wikipedia.org/wiki/Varennes-sur-T%C3%A8che","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Eglise_Saint-L%C3%A9ger_Varennes_sur_T%C3%A8che.JPG","page_title":"Varennes-sur-Tèche","context_page_description":"Varennes-sur-Tèche ist eine französische Gemeinde mit 253 Einwohnern im Département Allier in der Region Auvergne-Rhône-Alpes; sie gehört zum Arrondissement Vichy und zum Kanton Moulins-2. Die Einwohner werden Varennois genannt."},{"page_url":"https://en.wikipedia.org/wiki/Culture_of_England","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Charles_Dickens-A_Christmas_Carol-Cloth-First_Edition_1843.jpg","page_title":"Culture of England","context_page_description":"The culture of England is defined by the cultural norms of England and the English people. Owing to England's influential position within the United Kingdom it can sometimes be difficult to differentiate English culture from the culture of the United Kingdom as a whole. However, since Anglo-Saxon times, England has had its own unique culture, apart from Welsh, Scottish or Northern Irish culture.\\nRich in history and culture and birthplace of the Industrial Revolution, many of the world's most celebrated scientists, inventions, and thinkers originated from England. England has also played an important role in cinema, literature, technology, engineering, democracy, social science and mathematics.\\nManor houses, gardens, rolling countryside, and green landscapes are common English cultural symbols. A rose and oak tree are considered national symbols of England. Humour, tradition and good manners are characteristics commonly associated with being English."},{"page_url":"https://en.wikipedia.org/wiki/Chain_boat","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Antrieb_Kettenschiff_Kettengreifrad_1.png","page_title":"Chain boat","context_page_description":"A chain boat, chain tug or chain-ship was a type of river craft, used in the second half of the 19th century and first half of the 20th century on many European rivers, that made use of a steel chain laid along the riverbed for its propulsion. The chain was hauled by a steam engine mounted on board and enabled the boat to tow a string of barges. In Germany, such a boat was variously referred to as a Kettenschleppschiff, Kettenschlepper, Kettendampfer or Kettenschiff and in France as a toueur.\\nThe chain was raised out of the water over a boom at the bow of the ship and led over the deck along the ship's axis to the chain engine amidships. The transfer of power from the steam engine to the chain was usually achieved using a drum winch. From there the chain was led over the deck to another boom at the stern and lowered once more into the river. By moving the stern boom and the two rudders, front and aft, from side to side it was possible to replace the chain in the centre of the river again, even when negotiating river bends."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E5%8F%94%E6%9C%AC%E8%8F%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Schopenhauer.jpg","page_title":"叔本華","context_page_description":"叔本華（Arthur Schopenhauer，1788年2月22號—1860年9月21號），德國哲學家。代表作 Die Welt als Wille und Vorstellung 。\\n叔本華嘅『世界係表象』繼承康德哲學對現象同自體（Ding an sich）嘅分野，但係佢只同意康德分類之中嘅因果，康德認為我哋係冇法理解自體。叔本華以為我哋係冇法喺理性上認識自體，不過，可以用直覺得知，而自體就係意志（Wille），亦即係叔本華講嘅『世界係意志』。意志就係生存嘅意志（Will-to-live），意志支配一切，導致慾望、虛無、最後痛苦。叔本華認為淨係通過藝術先可以走得甩一陣間。佢嘅哲學同一啲東方哲學、佛教有相似嘅地方。"},{"page_url":"https://ceb.wikipedia.org/wiki/Manderson","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/WYMap-doton-Manderson.PNG","page_title":"Manderson","context_page_description":"Lungsod ang Manderson sa Tinipong Bansa. Ang Manderson nahimutang sa kondado sa Big Horn County ug estado sa Wyoming, sa sentro nga bahin sa nasod, 2,600 km sa kasadpan sa ulohang dakbayan Washington, D.C. 1,186 metros ibabaw sa dagat kahaboga ang nahimutangan sa Manderson, ug adunay 114 ka molupyo.\\nAng yuta palibot sa Manderson kay kasagaran patag. Manderson nahimutang sa usa ka walog. Ang kinahabogang dapit sa palibot dunay gihabogon nga 1,263 ka metro ug 2.6 km sa habagatan-sidlakan sa Manderson. Kunhod pa sa 2 ka tawo kada kilometro kwadrado sa palibot sa Manderson. Ang kinadul-ang mas dakong lungsod mao ang Basin, 13.6 km sa amihanan sa Manderson. Hapit nalukop sa kasagbotan ang palibot sa Manderson. Sa rehiyon palibot sa Manderson, mga walog, mga kanal, ug mga kapanguhaan talagsaon komon.\\nAng klima bugnaw nga ugahon. Ang kasarangang giiniton 10 °C. Ang kinainitan nga bulan Hulyo, sa 29 °C, ug ang kinabugnawan Disyembre, sa -10 °C. Ang kasarangang pag-ulan 386 milimetro matag tuig. Ang kinabasaan nga bulan Septiyembre, sa 56 milimetro nga ulan, ug ang kinaugahan Enero, sa 19 milimetro."},{"page_url":"https://nl.wikipedia.org/wiki/Sammeron","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Sammeron_%C3%A9glise.jpg","page_title":"Sammeron","context_page_description":"Sammeron is een gemeente in het Franse departement Seine-et-Marne en telt 956 inwoners. De plaats maakt deel uit van het arrondissement Meaux."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%8A%9A%E9%A1%BA%E7%A5%9E%E7%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/%E6%8A%9A%E9%A1%BA%E7%A5%9E%E7%A4%BE%E7%A4%BE%E5%8A%A1%E6%89%80.jpg","page_title":"抚顺神社","context_page_description":"抚顺神社是一座于清末至第二次世界大战结束期间存在于中国抚顺满铁附属地的神社。主祭神为天照大神，配祀大国主神、金山比古命、金山比命。\\n该神社位于抚顺炭矿的日本员工住宅区域，仅供日本人参拜。神社建立于1909年，而在1926年时随着日本员工住宅的搬迁而迁移社址。1950年代至1970年代由公安局作为拘留所使用，1980年代拆除。社址位于今抚顺市新抚区迎宾四路2-6号附近。"},{"page_url":"https://ro.wikipedia.org/wiki/Ernea,_Sibiu","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/ROU_SB_Dumbraveni_CoA1.jpg","page_title":"Ernea, Sibiu","context_page_description":"Ernea, mai demult Ernea Săsească, Iernea, Iernei este o localitate componentă a orașului Dumbrăveni din județul Sibiu, Transilvania, România."},{"page_url":"https://pl.wikipedia.org/wiki/Nothofagus_alessandrii","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Nothofagus_alessandrii_001_%28pabloendemico%29.jpg","page_title":"Nothofagus alessandrii","context_page_description":"Nothofagus alessandrii Espinosa – gatunek rośliny z rodziny bukanowatych. Występuje naturalnie w środkowej części Chile. Jest rzadko spotykany."},{"page_url":"https://nl.wikipedia.org/wiki/Ctenognathus_adamsi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Ctenognathus_adamsi.jpg","page_title":"Ctenognathus adamsi","context_page_description":"Ctenognathus adamsi is een keversoort uit de familie van de loopkevers. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1886 door Broun."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%8B%8F%E6%89%93%E6%B9%96_(%E5%9C%A3%E8%B4%9D%E7%BA%B3%E8%BF%AA%E8%AF%BA%E5%8E%BF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Soda_Lake_%28San_Bernardino_County%29.jpg","page_title":"苏打湖 (圣贝纳迪诺县)","context_page_description":"苏打湖是美国加利福尼亚州南部圣贝纳迪诺县莫哈韦沙漠中的一座干湖，是莫哈韦河的尾闾湖。苏打湖属于古冰川时期莫哈韦湖的残迹。莫哈韦河水流到苏打湖后被迅速蒸发，湖床留有大量的碳酸钠和碳酸氢钠等碱性盐类。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D9%86%D9%8A%D9%86_%D8%B5%D9%88%D8%AA%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/OpenCylinderResonance.svg","page_title":"رنين صوتي","context_page_description":"الرنين الصوتي في الفيزياء ‏ هو ميل نظام صوتي لامتصاص طاقة بإسهاب عند تردد يوافق أحد تردداته الطبيعية. بذلك يعتبر الرنين الصوتي نوع من الرنين الميكانيكي الذي ينشأ عن الاهتزازت الحركية في نطاق ترددات السمع عند الإنسان أو بمعني آخر الصوت. وبالنسبة إلى سمع الإنسان فإن تردد الصوت محصور بين نحو 20 هرتز و 20.000 هرتز.\\n، إلا أن تلك الحدود تختلف من شخص إلى شخص، كما تتغير مع تقدم العمر.\\nوأي جسم ذو رنين صوتي يتسم بأن له عدة من الترددات الرنينية، وخصوصا إذا كان هناك توافق مع تردده الرنيني الأقوى. ويهتز الجسم بسهولة عند تلك الترددات، ويقل اهتزازه عند ترددات أخرى. ويستطيع الجسم التقاط رنينه الذاتي من مجموعة إثارات صوتية مثل الشوشرة. أي أن الجسم الرنان يرشح رنينه الذاتي من بين كل ترددات أخرى."},{"page_url":"https://pl.wikipedia.org/wiki/Rejon_starokonstantynowski","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Starokostyantynivskyi-Raion.png","page_title":"Rejon starokonstantynowski","context_page_description":"Rejon starokonstantynowski – jednostka administracyjna wchodząca w skład obwodu chmielnickiego Ukrainy.\\nRejon utworzony w 1923 z części powierzchni dawnych powiatów powiatu starokonstantynowskiego i zasławskiego, ma powierzchnię 1210 km² i liczy około 29 tysięcy mieszkańców. Siedzibą władz rejonu jest Starokonstantynów.\\nNa terenie rejonu znajdują się 1 miejska rada i 30 silskich rad, obejmujących w sumie 97 miejscowości."},{"page_url":"https://ur.wikipedia.org/wiki/%DA%86%D9%BE%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Boy%27s_Slippers_Berlin_Wool_Work.jpg","page_title":"چپل","context_page_description":"چپل ایک ہلکا پھلکا پاؤں کا پہناوا ہے جسے بہت ہی آسانی سے پاؤں میں ڈالا بھی جا سکتا ہے اور اتارا بھی جا سکتا ہے۔ دنیا بھر میں اسے ایک غیر رسمی پہناوا سمجھا جاتا ہے، اس لیے لوگ اکثر اسے گھروں میں نجی مقامات پر پہنتے ہیں۔ چپل ایک ہوا دار پہناوا بھی ہے۔ جوتوں کے بر عکس، جو بڑی حد تک بند ہوتے ہیں، چپلیں کافی کھلی اور کشادہ ہوا کرتی ہیں۔ چپل میں پکڑ صرف اس کی پٹیوں سے ہوتی ہے۔ چونکہ یہ ایک ہلکے پھلکے پہناوے کے زمرے میں آتی ہے، اس لیے یہ عام چلنے پھرنے میں تو معاون ہے، تاہم یہ دوڑنے اور بھاگنے میں کم معاون ہے کیوں کہ چپلیں زیادہ زور نہیں جھیل پاتی ہیں اور اندیشہ ہوتا ہے وہ زور سے چلنے کی وجہ سے ٹوٹ جائیں۔ چپل پہن کر چلنے اور جوتے پہن کر چلنے کی رفتار میں ایک بہت بڑا فرق رفتار کا بھی ہوتا ہے۔ جوتوں سے عام طور سے تیز چلا جا سکتا ہے۔ اس کے علاوہ دھول، گرد اور کیچڑ سے چپل میں جوتوں کے مقابلے کوئی تحفظ فراہم نہیں کرتی۔\\nحالاں کہ چپل کے غیر رسمی پہناوا ہے۔ تاہم بھارت میں کچھ مصور، موسیقار، سماجی کارکن اور کچھ دیگر مشاہیر اس کو عام کرتے پاجامے کے ساتھ پہن کر عوام میں سادگی اور اپنے عامی ہونے کا ثبوت دینے کی کوشش کرتے ہیں۔ یہ لوگ ہمیشہ چپل ہی پہنتے ہیں۔"},{"page_url":"https://fr.wikipedia.org/wiki/Colonne_de_justice_de_Tr%C3%A9granteur","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Colonne_de_justice_de_Tr%C3%A9granteur.JPG","page_title":"Colonne de justice de Trégranteur","context_page_description":"La colonne de justice de Trégranteur constitue probablement le reste de fourches patibulaires, à Guégon dans le Morbihan."},{"page_url":"https://uz.wikipedia.org/wiki/Kremmen","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Staffelde_Wolfslaker_Weg_1.jpg","page_title":"Kremmen","context_page_description":"Kremmen Olmoniyaning Brandenburg yerida joylashgan shahardir. Oberhavel tumani tarkibiga kiradi. Maydoni – 208,43 km². 7102 nafar aholi istiqomat qiladi."},{"page_url":"https://fy.wikipedia.org/wiki/The_Dalles_(Oregon)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e9/1880_The_Dalles%2C_Oregon.jpeg","page_title":"The Dalles (Oregon)","context_page_description":"The Dalles /dælz/ is de haadstêd en grutste stêd fan Wasco County yn Oregon, Feriene Steaten. It hat 15.158 ynwenners en is nei de stêdekloft fan Portland de grutste stêd oan de Oregonkant fan de rivier de Kolumbia. It leit 129 km beëasten Portland en leit eastlik fan it Cascades berchtme dat in reinskaad foarmet"},{"page_url":"https://it.wikipedia.org/wiki/Numbered_Air_Force","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Ww2-add.jpg","page_title":"Numbered Air Force","context_page_description":"Una Numbered Air Force, in italiano \\"forza aerea numerata\\", è un tipo di organizzazione adottato dalla United States Space Force e dalla United States Air Force subordinato al Major Command che ha il compito di assegnare un numero ad unità operative come wing, squadron, e group. Un Component Numbered Air Force ricopre inoltre il compito di Air Force Component Command esercitando il comando e controllo dello spazio aereo delle forze armate di supporto a un Unified Combatant Command. A differenza dei MAJCOM, che ricoprono un ruolo di gestione delle risorse, una NAF è un'organizzazione tattica con obiettivo operativo e può non essere formata dallo stesso staff di una MAJCOM. Una NAF è normalmente posta sotto il comando di un major general o un lieutenant general.\\nLa convenzione di designazione delle Numbered Air Force prevede la scrittura in esteso del numero ordinale, tuttavia il sistema di numerazione arabo viene utilizzato nelle abbreviazioni. Le unità direttamente subordinate ad una NAF sono generalmente indicate con il numero dell'unità stessa seguito da quello della NAF. Ad esempio, la 618th Air and Space Operations Center è un'unità subordinata alla Eighteenth Air Force."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D1%83%D0%BB%D0%B8%D1%86%D1%8F_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%B0_(%D0%A5%D0%B5%D1%80%D1%81%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/%D0%92._%D0%9F%D0%B5%D1%82%D1%80%D0%B5%D0%BD%D0%BA%D0%B0_%D0%B2%D1%83%D0%BB.%2C6.JPG","page_title":"Вулиця Михайлівська (Херсон)","context_page_description":"Вулиця Михайлівська — вулиця в Херсоні, розташована в Суворовському та Корабельному районах, з'єднує провулок Сестер Гозадінових із Кошовим узвозом.\\nУ східній частині майбутньої вулиці в кінці XVIII ст. стихійно виникли «обивательські будівлі різного призначення». Формування цієї частини вулиці завершилося у першій половині XIX ст. Розташовувалася вона між нинішніми просп. Ушакова та вул. Воронцовською та отримала назву «Михайлівської».\\nУ той самий час її західна частина мала забудову лише з півночі і називалася «Насипна»; остаточно сформувалася у другій половині XIX ст.\\nУ 1927 році Михайлівську вулицю перейменували в «Інтернаціональну», а в 30-і роки вона об'єдналася з вулицею Насипною. Після Другої світової війни в результаті перепланування вона починається від провулку Д. Любарської.\\nІсторичну назву повернуто в 2016 році."},{"page_url":"https://lv.wikipedia.org/wiki/Slivena","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/BUL_%D0%A1%D0%BB%D0%B8%D0%B2%D0%B5%D0%BD_COA.png","page_title":"Slivena","context_page_description":"Slivena ir pilsēta Bulgārijā. Pilsēta atrodas Bulgārijas centrālās daļas austrumos. Slivena ir Slivenas apgabala administratīvais centrs. 2016. gadā pilsētā dzīvoja 87,3 tūkstoši iedzīvotāju, no kuriem aptuveni 87% ir bulgāri. 7% no iedzīvotājiem ir čigāni, bet 3% ir turki."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Berlin-Gesundbrunnen","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/79/Stolperstein_Marta_Finkelstein_Hussitenstra%C3%9Fe_6_0126.jpg","page_title":"Liste der Stolpersteine in Berlin-Gesundbrunnen","context_page_description":"Die Liste der Stolpersteine in Berlin-Gesundbrunnen enthält die Stolpersteine im Berliner Ortsteil Gesundbrunnen im Bezirk Mitte, die an das Schicksal der Menschen erinnern, die im Nationalsozialismus ermordet, deportiert, vertrieben oder in den Suizid getrieben wurden. Die Spalten der Tabelle sind selbsterklärend. Die Tabelle erfasst insgesamt 83 Stolpersteine und ist teilweise sortierbar; die Grundsortierung erfolgt alphabetisch nach dem Familiennamen."},{"page_url":"https://no.wikipedia.org/wiki/Tid","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/MontreGousset001.jpg","page_title":"Tid","context_page_description":"Tid er et abstrakt begrep hovedsakelig benyttet som en betegnelse for hendelsers konstante bevegelse fra fremtid til nåtid til fortid. Hvis tid menes som tidspunkt måles den i år, måneder, uker, dager, timer, minutter og sekunder, og kan angis ved klokkeslett, avhengig av hvilken tidsberegning som blir brukt. Tid kan også bety intervallet mellom to hendelser. SI-enheten for tid er sekund. Tid kan også vise til et spesifikt øyeblikk i tiden, et større tidsintervall i fortid, nåtid eller fremtid eller betegne en særegen periode som gjentar seg.\\nTid er et omdiskutert abstrakt begrep og har vært og er gjenstand for diskusjon innenfor religion, filosofi og vitenskap. I moderne fysikk går man bort fra konseptet om absolutt tid; ifølge relativitetsteorien er samtidighet et relativt begrep. Tid kan også beskrives som det som setter det energi påvirker i rekkefølge."},{"page_url":"https://es.wikipedia.org/wiki/Gy%C3%B6rgy_Golom%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Becton42019bcor.jpg","page_title":"György Golomán","context_page_description":"György Golomán es un baloncestista húngaro que pertenece a la plantilla de los Passlab Yamagata Wyverns de la B.League japonesa. Con 2,11 metros de estatura, juega en la posición de ala-pívot."},{"page_url":"https://ru.wikipedia.org/wiki/LADA_Largus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Lada_Largus_in_Tomsk.JPG","page_title":"LADA Largus","context_page_description":"LADA Largus — российский автомобиль малого класса, представляющий собой приспособленный под российский рынок автомобиль Dacia Logan MCV первого поколения 2006 года, выпускавшийся в Румынии. Совместный проект Renault и «АвтоВАЗ» на платформе В0 переименована в global access platform.\\nПервый автомобиль LADA Largus сошёл с конвейера «АвтоВАЗ» 17 июня 2011 года. Причём первые собранные экземпляры данной модели предназначались для заводских испытаний. Серийное производство Largus началось 4 апреля 2012 года на новой линии B0, первом совместном проекте «АвтоВАЗа» и альянса Renault-Nissan. Линия рассчитана на выпуск 70 тыс. LADA Largus, 70 тыс. Nissan Almera и 140 тыс. машин марки Renault, инвестиции в её создание составили около 400 млн евро. В 2019 году выпуск первого поколения в исходном виде завершён.\\nЛокализация производства, на момент запуска составлявшая более 50 %, по состоянию на июнь 2012 года составляет 62 % и, как предполагается, в будущем будет доведена до 72 %."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CE%B5%CE%BB%CF%87%CE%B9%CF%8E%CF%81_%CE%9B%CE%BF%CF%81%CE%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Melchior_Lorck_001.jpg","page_title":"Μελχιώρ Λορκ","context_page_description":"Ο Μελχιώρ Λορκ ήταν χαράκτης της Αναγέννησης δανογερμανικής καταγωγής.\\nΕίναι κυρίως γνωστός για τη λεπτομερή καταγραφή και αποτύπωση της ζωής στην Οθωμανική Αυτοκρατορία κατά τον 16ο αιώνα, όταν βρισκόταν στο απόγειο της δύναμης της αλλά υπήρχαν μόνο λίγες διαθέσιμες πληροφορίες στην Ευρώπη για την καθημερινή ζωή της περιοχής. Τα πλέον διάσημα έργα του είναι η Τουρκική δημοσίευση, συλλογή 128 χαρακτικών με οθωμανικές ενδυμασίες αλλά και διάφορες λεπτομέρειες βυζαντινών μνημείων της πόλης τα οποία δεν διασώζονται πια, καθώς και το έργο με τίτλο Θέα της Κωνσταντινούπολης, μια εξαιρετικά λεπτομερής πανοραμική απεικόνιση της πόλης κατά τον 16ο αιώνα. Αρκετά σημαντικός είναι επίσης ο πανοραμικός χάρτης του ποταμού Έλβα τον οποίο δημιούργησε κατά την περίοδο όπου ζούσε στο Αμβούργο.\\nΩς καλλιτέχνης δεν έγινε ποτέ ιδιαίτερα διάσημος, καθώς πολλά από τα έργα του δημοσιεύτηκαν δεκαετίες μετά τον θάνατο του. Δημιούργησε συνολικά 274 έργα, εκ των οποίων τα 242 είναι υπογεγραμμένα και τα 218 διαθέτουν ημερομηνίες."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%86%E0%B5%BC%E0%B4%9F%E0%B5%8D%E0%B4%9F%E0%B5%80%E0%B4%B8%E0%B4%BF%E0%B4%AF%E0%B5%BB_%E0%B4%95%E0%B4%BF%E0%B4%A3%E0%B5%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Artesian_Well_%28PSF%29.png","page_title":"ആർട്ടീസിയൻ കിണർ","context_page_description":"പ്രകൃതിദത്തമോ മനുഷ്യനിർമ്മിതമോ ആയ ഒരു സുഷിരത്തിലൂടെ ഭൂഗർഭ ജലം തനിയേ ഭൂതലത്തിലേക്ക് ഉയർന്നു വരുന്ന തരത്തിലുള്ള പ്രത്യേകതരം കിണറാണ് കുഴൽക്കിണർ അഥവാ ആർട്ടീസിയൻ കിണർ. ഫ്രാൻസിലെ ആർട്ടോയിസ് എന്ന പ്രവിശ്യയിലാണ് ഈ കിണർ ആദ്യമായി ഉണ്ടായതെന്നതുകൊണ്ടാണ് ഇതിന് ആർട്ടീസിയൻ കിണർ എന്ന പേരു വന്നത്. വെള്ളത്തിന്റെ നൈസർഗിക സമ്മർദ്ദം കാരണം ഭൂതലത്തിൽ ഉറവ ദൃശ്യമാകുകയാണെങ്കിൽ ഇതിന്റെ ഒഴുകുന്ന ആർട്ടീസിയൻ കിണർ എന്നു വിളിക്കുന്നു."},{"page_url":"https://fi.wikipedia.org/wiki/Medinet_Habu","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/SFEC_AEH_-ThebesNecropolis-2010-RamsesIII036.jpg","page_title":"Medinet Habu","context_page_description":"Medinet Habu voi paikannimenä viitata joko Ramses III:n kuolintemppeliin tai laajempaan temppelialueeseen sen ympärillä."},{"page_url":"https://ro.wikipedia.org/wiki/Umbuzeiro","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Bandeira_umbuzeiro.JPG","page_title":"Umbuzeiro","context_page_description":"Umbuzeiro este un oraș în Paraíba, Brazilia."},{"page_url":"https://de.wikipedia.org/wiki/Bahnstrecke_Bayreuth%E2%80%93Warmensteinach","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/D%C3%B6hlau_Bahn%C3%BCbergang_20120610.JPG","page_title":"Bahnstrecke Bayreuth–Warmensteinach","context_page_description":"Die Bahnstrecke Bayreuth–Warmensteinach ist eine Nebenbahn in Bayern. Von den sieben Nebenbahnen, die früher das Fichtelgebirge erschlossen, ist sie die letzte Strecke, die zumindest noch teilweise in Betrieb ist."},{"page_url":"https://de.wikipedia.org/wiki/Tadeusz_Stefan_Zieli%C5%84ski","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Tadeusz_Zieli%C5%84ski_poczt%C3%B3wka_%28cropped%29.jpg","page_title":"Tadeusz Stefan Zieliński","context_page_description":"Tadeusz Stefan Zieliński, auch Theodor Zielinski, Pseudonym Eheu war ein polnischer Kulturhistoriker, klassischer Philologe, Professor der Universitäten in Petersburg und Warschau sowie Mitglied der Polska Akademia Umiejętności."},{"page_url":"https://es.wikipedia.org/wiki/Queen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/John_Deacon_%281977%29.jpg","page_title":"Queen","context_page_description":"Queen es una banda británica de rock formada en 1970 en Londres por el cantante y pianista Freddie Mercury, el guitarrista Brian May, el baterista Roger Taylor y el bajista John Deacon. Si bien el grupo ha presentado bajas de dos de sus miembros, los integrantes restantes, May y Taylor, continúan trabajando bajo el nombre Queen, por lo que la banda aún se considera activa.​\\nEl grupo gozó de un gran éxito en el Reino Unido con álbumes como Sheer Heart Attack y A Night at the Opera. Este último llamó la atención internacionalmente, en especial por el sencillo \\"Bohemian Rhapsody\\", y colocó a Queen en un primer plano de la escena musical. Tuvieron una significativa repercusión en Estados Unidos a finales de los años 1970, ya con un numeroso repertorio de éxitos.​ A nivel artístico, se ha destacado su diversidad musical, sus arreglos en múltiples capas y sus armonías vocales. Es considerada una banda de gran influencia en el desarrollo del hard rock y el heavy metal, incorporando elementos del glam rock, rock progresivo, folk, ópera, blues y pop."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%80%D5%B5%D5%B8%D6%82%D5%BD%D5%AB%D5%BD%D5%A1%D6%80%D6%87%D5%A5%D5%AC%D5%B5%D5%A1%D5%B6_%D5%80%D5%B6%D5%A4%D5%AF%D5%A1%D5%BD%D5%BF%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Shillong_Town%2C_Meghalaya.jpg","page_title":"Հյուսիսարևելյան Հնդկաստան","context_page_description":"Հյուսիսարևելյան Հնդկաստան կամ Հյուսիսարևելյան շրջան, Հնդկաստանի ամենաարևելյան շրջանը, որը երկրի մնացած տարածքի հետ կապված է Սիլիգուրի նեղ միջանցքով։"},{"page_url":"https://it.wikipedia.org/wiki/Parmigianino","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Girolamo_Francesco_Maria_Mazzola_-_Madonna_with_the_Long_Neck.jpg","page_title":"Parmigianino","context_page_description":"Parmigianino, pseudonimo di Girolamo Francesco Maria Mazzola, è stato un pittore italiano, fondamentale esponente della corrente manierista e della pittura emiliana in generale.\\nL'appellativo \\"il Parmigianino\\", oltre che dalle origini, gli derivò dalla corporatura minuta e dall'aspetto gentile."},{"page_url":"https://it.wikipedia.org/wiki/Cadillac_CTS","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Cadillac_CTS_front.JPG","page_title":"Cadillac CTS","context_page_description":"La Cadillac CTS è un'automobile di Segmento E, prodotta dalla General Motors con il marchio Cadillac, introdotta sul mercato nel 2002 per rimpiazzare la Catera.\\nOriginariamente è stata creata per competere direttamente con la Lincoln LS del gruppo Ford, ma la produzione della LS è cessata nel 2006 per far posto al modello più piccolo, ma simile, Lincoln Zephyr.\\nDisegnata da Wayne Cherry, la CTS utilizza una linea accattivante che Cadillac chiama \\"Art & Science\\", e vista la prima volta sul prototipo Evoq.\\nIl lancio della CTS mirava al ringiovanimento del marchio Cadillac nell'ottica del salvataggio dall'estinzione della casa automobilistica, dopo che le vendite di Cadillac erano scese a favore di importanti marchi di lusso come Lexus e Mercedes-Benz. Dagli anni novanta, la Cadillac cercava di attrarre giovani acquirenti, il CTS è stato il primo di questi nuovi modelli ad avere successo, a differenza di altri modelli come la Catera e la Allanté.\\nLa seconda generazione della CTS è stata presentata al North American International Auto Show.\\nLa linea prende spunto dal prototipo Sixteen, ed è in vendita dalla fine di agosto 2007, come modello 2008."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%86%88%EC%A7%84_%EC%97%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/DF11_0419%40TJI_%2820160308130412%29.jpg","page_title":"톈진 역","context_page_description":"톈진 역은 중화인민공화국 톈진시 허베이구에 위치한 중국 국철, 베이징-톈진 고속철도의 역이다. 1888년에 문을 열어, 지금은 톈진시의 중심역이 되어 있다. 2012년부터 톈진 지하철 2호선, 3호선, 9호선이 톈진 역과 연결되었다."},{"page_url":"https://war.wikipedia.org/wiki/Gnathophyllum","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Bumblebee_Shrimp.jpg","page_title":"Gnathophyllum","context_page_description":"An Gnathophyllum in uska genus han Malacostraca. An Gnathophyllum in nahilalakip ha familia nga Gnathophyllidae.\\nAn kladograma hini sumala ha Catalogue of Life:"},{"page_url":"https://fi.wikipedia.org/wiki/Raymond_Roche","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Ducati_851_SBK90_DM.JPG","page_title":"Raymond Roche","context_page_description":"Raymond Roche on ranskalainen uransa lopettanut ratamoottoripyöräilijä. Hän voitti Superbiken maailmanmestaruuden 1990. Roche oli sitä ennen kilpaillut moottoripyöräilyn Grand Prix'ssa 1980-luvulla, jossa sijoittui parhaimmillaan kolmanneksi kaudella 1984."},{"page_url":"https://tr.wikipedia.org/wiki/Hayvan_zehri","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Waspstinger1658-2.jpg","page_title":"Hayvan zehri","context_page_description":"Hayvan zehri ya da venom, bir hayvanın bir diğerine zarar vermek için ürettiği bir veya daha fazla toksin içeren bir salgıdır. Venom, hem avcılarda hem de avlarda, hem omurgalılarda hem de omurgasızlarda olmak üzere çeşitli hayvanlar arasında ortaya çıkmıştır.\\nVenomlar, hücreleri öldüren en az dört ana toksin sınıfının yani nekrotoksin ve sitotoksin etkisiyle öldürür: sinir sistemlerini etkileyen nörotoksinler; kaslara zarar veren miyotoksinler.\\nZehirli hayvanlar yılda on binlerce insanın ölümüne sebep olmaktadır. Bununla birlikte birçok zehirdeki toksin, çok çeşitli hastalıkları tedavi etme potansiyeline sahiptir."},{"page_url":"https://is.wikipedia.org/wiki/Rifl%C3%A1s","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Velcro.jpg","page_title":"Riflás","context_page_description":"Riflás eða franskur rennilás er aðferð við að tengja saman tvo fleti. Á öðrum fletinum er efni með litlum krókum og á hinum fletinum eru þræðir sem krókarnir festast í. Þessi tegund af festingu er notuð þar sem annars væru tölur, reimar eða bönd. Algengt er að franskur rennilás sé á íþróttaskóm, barnaskóm og sandölum og á festingum á töskum og veskjum. Hlutir eins og verkfæri eru stundum festir upp vegg eða þil með frönskum rennilás.\\nHugmynd að franska rennilásnum kom árið 1948 frá manni að nafni George de Mestral. Hann tók eftir að fræ með örsmáum krókum festust við buxnaskálmar og dýrafeldi. Hann kallaði franska rennilásinn velcro en það er dregið af frönskum orðum fyrir velúr og fyrir krók."},{"page_url":"https://fr.wikipedia.org/wiki/Nov%C3%A1_Pl%C3%A1%C5%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Nov%C3%A1_Pl%C3%A1%C5%88_-_rybn%C3%ADk.jpg","page_title":"Nová Pláň","context_page_description":"Nová Pláň est une commune du district de Bruntál, dans la région de Moravie-Silésie, en République tchèque. Sa population s'élevait à 54 habitants en 2018."},{"page_url":"https://la.wikipedia.org/wiki/Navis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Trireme_1.jpg","page_title":"Navis","context_page_description":"Vide etiam paginam discretivam: Navis\\nNavis est vehiculum aquaticum, plerumque magna res constructa ut aquas innare potest, et praesertim mare navigare. Naves a rectionibus, societatibus lucrativis et institutionibus privatis, et hominibus singulis exerceri possunt."},{"page_url":"https://en.wikipedia.org/wiki/TR_RV_class","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/TR_RV_252_works_photo.jpg","page_title":"TR RV class","context_page_description":"The TR RV class, later known as the EAR 21 class, was a class of 1,000 mm gauge steam locomotives designed and built for the Tanganyika Railway as a 4-8-2 development of the 2-8-2 TR MK class. The eight members of the RV class were built by Vulcan Foundry, in Newton-le-Willows, Lancashire, England.\\nThe \\"RV\\" class designation was short for \\"River\\", as each RV class locomotive was named after a river in the Tanganyika Territory. The class entered service on the TR between 1928 and 1930, and its members were later operated by the TR's successor, the East African Railways."},{"page_url":"https://et.wikipedia.org/wiki/Vesikatk_(perekond)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/482_Elodea_canadensis.jpg","page_title":"Vesikatk (perekond)","context_page_description":"Vesikatk on veetaimede perekond kilbukaliste sugukonnast."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BE%D0%BA%D0%BE%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D0%B8%D0%B9_%D0%94%D0%B0%D0%BD%D0%B8%D0%BB%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/%D0%9D%D0%B0%D0%B3%D1%80%D0%B0%D0%B4%D1%8B_%D0%B3%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB%D0%B0_%D0%B0%D1%80%D0%BC%D0%B8%D0%B8_%D0%A1%D0%BE%D0%BA%D0%BE%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B3%D0%BE.jpg","page_title":"Соколовский, Василий Данилович","context_page_description":"Васи́лий Дани́лович Соколо́вский — советский военачальник, Маршал Советского Союза, Герой Советского Союза. Член ЦК КПСС.\\nВо время Великой Отечественной войны — начальник штаба и командующий фронтами. После войны известен как теоретик, автор труда «Военная стратегия».\\nСват советских военачальников Захаркина И. Г. и Пронина А. М.."},{"page_url":"https://eo.wikipedia.org/wiki/Filologio","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Rosetta_Stone.jpg","page_title":"Filologio","context_page_description":"Filologio estas unuiĝo de kelkaj sciencoj, kiuj esploras la homan kulturon per analizo de teksto. Alivorte, per filologio oni indikas la studon, kiu serĉas la interpretadon de tekstoj en ilia socia kunteksto.\\nKvankam kelkaj antikvaj aŭtoroj, kiel Platono, jam uzis la vorton, estis Friedrich August Wolf, en la 18-a jarcento kiu uzis unue la vorton en moderna senco. Vere, Wolf faris vortludon, ĉar kiam li publikigis sian verkon \\"Prolegomena ad Homerum\\", oni demandis lin, al kiu studobjekto tiu libro apartenas, laŭdire, li respondis \\"Filologio\\", kiu povas signifi \\"amo al lingvo\\", sed ankaŭ \\"mia propra scienco\\".\\nEn la tradicio de kelkaj landoj la filologio estas komprenata nur kiel la studo de antikvaj lingvoj kaj tekstoj, dum la studo de modernaj tekstoj estas nomata tekstlingvistiko. En aliaj landoj oni povas paroli pri la historilingvistiko kiel la studo de malnovaj lingvoj.\\nEn siaj unuaj tempoj la historilingvistiko ankaŭ estis nomita \\"kompara filologio\\", ĉar ĝi estis, pleje, komparo inter malnovaj skribaj lingvoj."},{"page_url":"https://en.wikipedia.org/wiki/Attack-class_submarine","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/HMAS_Rankin_2006.jpg","page_title":"Attack-class submarine","context_page_description":"The Attack-class submarine is a future class of submarines for the Royal Australian Navy based on the Shortfin Barracuda proposal by French shipbuilder Naval Group to replace the Collins-class submarines. The class will enter service in the early 2030s with construction extending into the late 2040s to 2050. The Program is estimated to cost $50 billion and will be the largest, and most complex, defence acquisition project in Australian history.\\nThe Program to replace the Collins class began in 2007 with the commencement of the Defence Department acquisition project SEA 1000. Australia's unique operating environment and rejection of nuclear marine propulsion had previously driven it to operate in the Collins class the world's largest diesel-electric submarines, capable of transiting the long distances from HMAS Stirling to their deployment areas.\\nIn the early phases of the replacement project, four design options were identified: purchase a Military-Off-The-Shelf design, modify a MOTS design for Australian conditions, design an evolution of the Collins-class, or create a new design."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D1%81%D1%91%D0%BB%D0%BE%D0%BA_%D1%80%D0%B0%D0%B7%D1%8A%D0%B5%D0%B7%D0%B4%D0%B0_%D0%9F%D0%BE%D0%B6%D0%B8%D1%82%D0%BA%D0%BE%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Posyolok_Raz%27ezda_Pozhitkovo_%28turn_to_road_to_posyolok%29.jpg","page_title":"Посёлок разъезда Пожитково","context_page_description":"Посёлок разъезда Пожитково — посёлок в Троицком административном округе Москвы. Входит в состав поселения Киевский."},{"page_url":"https://en.wikipedia.org/wiki/Lysippos","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9e/0002MAN-Hermes.jpg","page_title":"Lysippos","context_page_description":"Lysippos was a Greek sculptor of the 4th century BC. Together with Scopas and Praxiteles, he is considered one of the three greatest sculptors of the Classical Greek era, bringing transition into the Hellenistic period. Problems confront the study of Lysippos because of the difficulty of identifying his style among the copies which survive. Not only did he have a large workshop and many disciples in his immediate circle, but there is understood to have been a market for replicas of his work, supplied from outside his circle, both in his lifetime and later in the Hellenistic and Roman periods. The Victorious Youth or Getty bronze, which resurfaced around 1972, has been associated with him."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%DB%8C%D8%AA%D9%88%D9%86%D8%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/Two_pitons.jpg","page_title":"پیتونز","context_page_description":"پیتونز دو درپوش آتشفشانی کوهستانی است که در سنت لوسیا در دریای کارائیب و در نزدیکی شهر سوفریه ره قرار دارند. این درپوش‌های آتشفشانی شامل گراس پیتون با بلندای ۷۷۱ متر و پتی پیتون با بلندای ۷۴۳ متر است که توسط یال پیتون میتان به یکدیگر می‌پیوندند.\\nپیتون‌ها با مساحت ۲٬۹۰۹ هکتار به عنوان میراث جهانی یونسکو ثبت شده‌اند."},{"page_url":"https://fr.wikipedia.org/wiki/Marie-Joseph_Le_Guillou","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Blason_de_la_ville_de_Lannion_%28C%C3%B4tes-d%27Armor%29.svg","page_title":"Marie-Joseph Le Guillou","context_page_description":"Marie-Joseph Le Guillou O.P. est un dominicain, théologien et contemplatif français, qui a consacré la première partie de sa vie à la recherche de l'unité entre les chrétiens et la seconde partie à aider la congrégation des Bénédictines du Sacré-Cœur de Montmartre à se structurer spirituellement et théologiquement."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%B9%D8%A7%D8%AF%D9%84%D8%A9_%D8%B1%D9%8A%D9%86%D9%88%D9%84%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Ggstokes.jpg","page_title":"معادلة رينولد","context_page_description":"معادلة رينولد هي معادلة تفاضلية جزئية تصف توزيع تأثير الضغط علي الطبقات الرقيقة للزوجة المائع الذي يتم دراسته مثل موائع التزييت.\\nولا ينبغي الخلط بين المفاهيم المختلفة للمسيات المُلحق بها اسم رينولد مثل عدد رينولد أو معادلات نافييه ستوكس ورينولد المتوسطة حيث أنها كلها من كتابة العالم أوبسورن رينولد.\\nومعادلة رينولد تم إيجادها للمرة الأولي في عام 1886 بواسطة العالم أوبسورن رينولد، ومعادلة رينولد الكلاسيكية يُمكن إستخدامها لوصف توزيع الضغط علي الطبقات الرقيقة للمائع خصوصًا في التزييت عندما يكون هناك جسمين صلبين يفصل بينهما فقط بطبقة رقيقة من المائع أو الغاز هنالك يتم استخدام المعادلة للتعبير عن توزيع الضغط الناشئ من الجسمين علي طبقة المائع."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A8%D9%88_%D8%B3%D8%B9%D8%AF%D9%87%D8%8C_%D8%A7%D9%84%D8%AC%D8%B2%D8%A7%DB%8C%D8%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/Bousaayel.jpg","page_title":"بو سعده، الجزایر","context_page_description":"بو سعده شهری در استان المسیله واقع در کشور الجزایر است که در سال ۱۹۹۸ میلادی ۹۷٫۰۳۱ نفر جمعیت داشته و جمعیت آن در سال ۲۰۰۵ میلادی به ۱۲۱٫۳۰۱ نفر رسیده‌است."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BC%D0%B1%D1%83%D1%80%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Kloster_Komburg_HS.jpg","page_title":"Комбург","context_page_description":"Комбург або Ґросскомбург — колишній бенедиктинський монастир поблизу міста Швабіш-Халль, на півночі землі Баден-Вюртемберг."},{"page_url":"https://no.wikipedia.org/wiki/Pang_Fengyue","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Pang_Fengyue_-_Rio_2016.jpg","page_title":"Pang Fengyue","context_page_description":"Pang Fengyue er en kinesisk fotballspiller.\\nHun representerte Kina under Sommer-OL 2016 i Rio de Janeiro, der hun ble utslått i kvartfinalen med det kinesiske kvinnelandslaget."},{"page_url":"https://ro.wikipedia.org/wiki/Bujalance","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Mapa_Bujalance.png","page_title":"Bujalance","context_page_description":"Bujalance este un oraș din Spania, situat în provincia Cordoba din comunitatea autonomă Andaluzia. Are o populație de 7.832 de locuitori."},{"page_url":"https://eo.wikipedia.org/wiki/Granda_Eskarpo_(Suda_Afriko)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Great_Escarpment%2C_South_Africa.jpg","page_title":"Granda Eskarpo (Suda Afriko)","context_page_description":"Granda Eskarpo, montara eskarpo en suda Afriko, estas ĉefa geologia formacio en Afriko. Dum ĝi ĉefe situas ene de la limoj de Lesoto kaj Sud-Afriko, ĝi ankaŭ etendiĝas orienten en Svazilandon, Mozambikon, kaj Zimbabvon, kaj konstituas mallarĝan zonon norden en Namibio kaj Angolo.\\nPluraj pli malgrandaj pejzaĝaj formacioj estas parto de Granda Eskarpo, ekzemple Drakensbergoj en Lesoto kaj Sud-Afriko, Khomas-Altebenaĵo en Namibio, kaj Serra da Chela en Angolo."},{"page_url":"https://lv.wikipedia.org/wiki/Austr%C4%81l%C4%81zijas_sarkanr%C4%ABkl%C4%ABtes","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Petroica_phoenicea_2_-_Goat%27s_Beach.jpg","page_title":"Austrālāzijas sarkanrīklītes","context_page_description":"Austrālāzijas sarkanrīklītes, Austrālāzijas sarkanrīklīšu ģints ir Austrālāzijas mušķērāju dzimtas ģints, kas apvieno 13 mūsdienās dzīvojošas putnu sugas. Lai arī ārēji šīs grupas sugas atgādina Eiropā dzīvojošās sarkanrīklītes, putni nav sasvstarpēji radniecīgi. Tās visas ir endēmas Austrālāzijas reģionam un ir sastopamas Jaungvinejā, Austrālijā un Jaunzēlandē, kā arī daudzās citās šī reģiona mazajās Klusā okeāna salās.\\nĢints zinātniskais vārds Petroica cēlies no grieķu valodas diviem vārdiem: petros — akmens, oikos — mājas jeb apmešānās vieta, tādējādi atspoguļojot putna ieradumu apkārtni vērot, atrodoties uz akmens muguras."},{"page_url":"https://de.wikipedia.org/wiki/Dorf_Wehlen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Vorwerkstra%C3%9Fe_Dorf_Wehlen.JPG","page_title":"Dorf Wehlen","context_page_description":"Dorf Wehlen ist ein Ortsteil der Stadt Stadt Wehlen im Landkreis Sächsische Schweiz-Osterzgebirge in Sachsen."},{"page_url":"https://en.wikipedia.org/wiki/Ramkumar_Mukhopadhyay","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Ramkumar_Mukhopadhyay_Signature.jpg","page_title":"Ramkumar Mukhopadhyay","context_page_description":"Ramkumar Mukhopadhyay is a Bengali writer from India. He has written novels and short stories for both adults and children."},{"page_url":"https://hr.wikipedia.org/wiki/Commedia_dell%27arte","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/SAND_Maurice_Masques_et_bouffons_08.jpg","page_title":"Commedia dell'arte","context_page_description":"Commedia dell'arte je teatarski stil nastao po gradovima Apeninskog poluotoka sredinom 16. st. koji se nakon tog proširio po Europi i postojao do kasnog 18. st.\\nIzvan Apenina commedia dell'arte doživjela je veliki uspjeh u Francuskoj kao Comédie-Italienne. U Engleskoj su njeni elementi naturalizirani u lakrdijašku pantomimu i u Punch & Judy-show, lutkarsku igru, a u Njemačkoj je komični narodni lik Hanswurst, nastao pod uticajem commedie dell'arte.\\nGlavna karakteristika tog stila bili su - glumci koji su igrajući stripovski tipizirane likove improvizirali dijaloge na sceni i na taj način nasmijavali publiku. Neki od tih likova bili su uvijek pod maskom, a neki govorili naglašenim dijalektima a neki stranim jezicima.\\nCommedia dell'arte doslovno prevedeno sa talijanskog onog vremena zapravo znači - Komedija koju izvode znalci, jer je arte u tom vremenu značio i umješnost - zanat."},{"page_url":"https://de.wikipedia.org/wiki/San_Juli%C3%A1n_de_los_Prados","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Church_of_San_Juli%C3%A1n_de_los_Prados_04.JPG","page_title":"San Julián de los Prados","context_page_description":"San Julián de los Prados, auch Santullano genannt, ist eine vorromanische Kirche aus dem frühen 9. Jahrhundert. Sie steht am nordwestlichen Stadtrand von Oviedo, der Hauptstadt der spanischen autonomen Gemeinschaft Asturien. 1917 wurde die Kirche zum Monumento Nacional erklärt und 1998 zusammen mit der Cámara Santa der Kathedrale San Salvador und dem Brunnenhaus La Foncalada in Oviedo als Monumentos de Oviedo y del Reino de Asturias in die Liste der UNESCO-Kulturdenkmäler aufgenommen, in der bereits seit 1985 die asturischen Kirchen Santa María del Naranco, San Miguel de Lillo und Santa Cristina de Lena verzeichnet sind."},{"page_url":"https://ceb.wikipedia.org/wiki/Corallium_elatius","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Corallium_elatius.jpg","page_title":"Corallium elatius","context_page_description":"Espesye sa kagaangan ang Corallium elatius. Una ning gihulagway ni Ridley ni adtong 1882. Ang Corallium elatius sakop sa kahenera nga Corallium sa kabanay nga Coralliidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%BE%D0%BC%D1%83%D1%82%D0%BE%D0%B2%D0%BA%D0%B0_(%D0%9A%D1%83%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/%D0%A5%D0%BE%D0%BC%D1%83%D1%82%D0%BE%D0%B2%D0%BA%D0%B08.jpg","page_title":"Хомутовка (Курская область)","context_page_description":"Хомутовка — посёлок городского типа, административный центр Хомутовского района Курской области России."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Burgen_und_Schl%C3%B6ssern_in_Hessen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Schloss_Waldeck_Gesamtansicht_2008.jpg","page_title":"Liste von Burgen und Schlössern in Hessen","context_page_description":"Auf dem Gebiet des deutschen Bundeslandes Hessen befindet sich eine Vielzahl von Schlössern und Burgen. Diese zum Teil auf eine 1000-jährige oder gar längere Geschichte zurückblickenden Bauten, aus der Zeit vom Beginn des Frühmittelalters bis in die Neuzeit, waren Schauplatz historischer Ereignisse und Wirkungsstätte bekannter Persönlichkeiten und sind häufig noch heute eindrucksvolle Anlagen."},{"page_url":"https://ro.wikipedia.org/wiki/Montferrat,_Var","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Mairie_de_Montferrat_%2883%29.jpg","page_title":"Montferrat, Var","context_page_description":"Montferrat este o comună în departamentul Var din sud-estul Franței. În 2009 avea o populație de 1.180 de locuitori."},{"page_url":"https://de.wikipedia.org/wiki/Libenice","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Pam%C3%A1tn%C3%BD_dub_v_Libenic%C3%ADch.jpg","page_title":"Libenice","context_page_description":"Libenice ist eine Gemeinde in Tschechien. Sie liegt vier Kilometer nördlich des Stadtzentrums von Kutná Hora und gehört zum Okres Kolín."},{"page_url":"https://es.wikipedia.org/wiki/Bel%C3%A9n","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Bethlehem_woman_edited.jpg","page_title":"Belén","context_page_description":"Belén es una ciudad palestina en la región conocida como Cisjordania, situada a unos 9 km al sur de Jerusalén y enclavada en los montes de Judea. Desde diciembre de 1995, se encuentra administrada por la Autoridad Palestina, que adoptó el nombre de Estado de Palestina en 2013. Su población era de 25 266 habitantes en 2007, ​ siendo la mitad musulmanes y la otra mitad cristianos, en su mayoría ortodoxos.​\\nLa ciudad tiene gran significado religioso para los cristianos al ser, de acuerdo con la Biblia, el lugar de nacimiento de Jesús de Nazaret, según los evangelios de Lucas y Mateo. Es también un importante lugar de peregrinación para los judíos, que veneran la tumba de Raquel situada a la entrada de la ciudad y para los que la ciudad es lugar de nacimiento y de coronación del rey David.\\nEl gobierno de Israel ha rodeado la ciudad de murallas y pasos de control, lo cual impide el libre tránsito de los habitantes y limita los intercambios comerciales. Esto ha provocado una gran disminución del turismo, una de las principales fuentes de ingreso de la ciudad."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A4%CE%BF%CF%85%CF%81%CE%BA%CE%AF%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Ephesus_Celsus_Library_Fa%C3%A7ade.jpg","page_title":"Τουρκία","context_page_description":"Η Τουρκία επίσημα γνωστή ως Δημοκρατία της Τουρκίας ή Τουρκική Δημοκρατία, είναι μια χώρα που βρίσκεται στη νοτιοδυτική Ασία, με ένα μικρό τμήμα της επικράτειάς της στη νοτιοανατολική Ευρώπη. Μέχρι το 1922, η χώρα ήταν το κέντρο της Οθωμανικής Αυτοκρατορίας. Η χερσόνησος της Μικράς Ασίας, που βρίσκεται ανάμεσα στον Εύξεινο Πόντο και τη Μεσόγειο Θάλασσα, συγκροτεί το βασικό τμήμα της χώρας. Η Τουρκία συνορεύει με οκτώ χώρες: δυτικά με την Ελλάδα, βορειοδυτικά με τη Βουλγαρία, ανατολικά με τη Γεωργία, την Αρμενία, το Ιράν και το θύλακα Ναχιτσεβάν του Αζερμπαϊτζάν και νοτιοανατολικά με το Ιράκ και τη Συρία. Νότια είναι η Μεσόγειος Θάλασσα, δυτικά το Αιγαίο Πέλαγος και βόρεια ο Εύξεινος Πόντος. Η Θάλασσα του Μαρμαρά, ο Βόσπορος και ο Ελλήσποντος οριοθετούν το σύνορο μεταξύ Θράκης και Μικράς Ασίας, ενώ επίσης χωρίζουν την Ευρώπη από την Ασία. Η θέση της Τουρκίας στο σταυροδρόμι Ευρώπης και Ασίας την καθιστούν χώρα σημαντικής γεωστρατηγικής σημασίας.\\nΗ περιοχή που σήμερα ονομάζεται Τουρκία έχει κατοικηθεί από την Παλαιολιθική περίοδο, μεταξύ άλλων από διάφορους Αρχαιομικρασιατικούς πολιτισμούς και Θρακικούς λαούς καθώς και από Ίωνες, που ίδρυσαν εκεί δώδεκα μεγάλες πόλεις."},{"page_url":"https://sv.wikipedia.org/wiki/Pr%C3%A4stg%C3%A5rden,_Bromma","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Bromma_pr%C3%A4stg%C3%A5rd_%28nya_pr%C3%A4stg%C3%A5rden%29_vid_Bromma_kyrka%2C_2013a%2C_vy_fr%C3%A5n_g%C3%A5rdssidan.jpg","page_title":"Prästgården, Bromma","context_page_description":"Prästgården, Bromma är en prästgård i Bromma församling som ligger vid Bromma kyrka i stadsdelen Bromma Kyrka väster om Stockholm. Prästgården, Klockargården och Bromma kyrkskola eller Kyrkskolan var alla byggda under 1800-talet. Prästgårdsflygeln, den röda stugan öster om prästgården, från 1600-talet användes fram till 1850 som kyrkoherdebostad, och kallas idag Sockenstugan. En tiondelada, Tiondeladan, Bromma kyrka, där prästen kunde samla Bromma-böndernas naturaskatter finns också på prästgårdstomten. Den nuvarande prästgården ligger i vinkel med den gamla prästgården, alltså Sockenstugan. På andra sidan prästgården ligger tiondeladan, också den i vinkel. Nya prästgården vid Bromma kyrka byggdes 1848-1850."},{"page_url":"https://en.wikipedia.org/wiki/Houston_City_Council","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Houston_City_Council_Chambers%2C_February_2016.jpg","page_title":"Houston City Council","context_page_description":"The Houston City Council is a city council for the city of Houston in the U.S. state of Texas.\\nCurrently, there are sixteen members, 11 elected from council districts and five at-large. The members of the Council are elected every four years, with the most recent election being held in 2015 and the next being held in 2019. Council Members are limited to two terms of four years. Under the current city charter, if the population in the city limits went past 2.1 million residents, the previous nine-member city council districts would be expanded with the addition of two city council districts. Since the threshold was passed, the city created two new districts.\\nThe Council works with the mayor in a strong mayor-council model. The City Council monitors the performance of city agencies, confirm the mayor's appointments, and makes land use decisions as well as legislating on a variety of other issues.\\nThe Mayor chairs meetings of City Council and has a vote in the proceedings in all cases. In the event of the Mayor's absence, the Mayor Pro-Tem, a member of the Council chosen for the position by the mayor, presides over Council meetings."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%94%9F%E5%91%BD%E9%BA%B5%E5%8C%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Protester_show_Life_Bread_to_police_20191201.jpg","page_title":"生命麵包","context_page_description":"生命麵包是香港的一種麵包，於1960年由嘉頓出品，是一款加入維他命及礦物質的麵包。這款麵包在推出時售價低廉，能夠為收入不高的基層市民補充所須的營養，香港政府亦曾於1970年代以「生命麵包」作為政府賑災糧食。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B0%D1%85%D1%87%D0%B8%D1%81%D0%B0%D1%80%D0%B0%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/%D0%A1%D1%84%D0%B8%D0%BD%D0%BA%D1%81%D1%8B_%D0%A7%D1%83%D1%80%D1%83%D0%BA-%D0%A1%D1%83.jpg","page_title":"Бахчисарай","context_page_description":"Бахчисара́й — місто в Україні, адміністративний центр Бахчисарайського району Автономної Республіки Крим. Назва в перекладі з кримськотатарської мови означає «сад-палац».\\nМісто розташоване у внутрішньому пасмі Кримських гір, у долині річки Чурук-Су, за 30 км від Сімферополя."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%AC%D8%B2%D8%B1%D8%A9_%D9%83%D8%A7%D8%AA%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Katyn_massacre_1.jpg","page_title":"مجزرة كاتين","context_page_description":"تعد مجزرة كاتين، أو كما تعرف باسم مجزرة في غابة كاتين عملية إعدام جماعي لآلاف البولنديين نفذتها المفوضية الشعبية للشؤون الداخلية تلك المؤسسة السوفيتية التي ضمت الشرطة السرية، وذلك على مدار شهري أبريل ومايو عام1940. وقد دفع إلى هذه المجزرة اقتراح لافرينتي بيريا رئيس المؤسسة آنذاك بأن يتم إعدام الأعضاء المقيدين بجهاز الضباط البولنديين جميعهم، وذلك في 5 مارس 1940. قوبلت تلك الوثيقة الرسمية بالموافقة حيث وقع عليها المكتب السوفيتي بقيادة جوزيف ستالين. تم تنفيذ المجزرة في ثلاثة أماكن مختلفة في روسيا مثل: غابة كاتين، وسجني تفير وخاركيف، ومن دونهم أماكن أخرى. ويقدر عدد الضحايا بحوالي 22000 ضحية، و21768 ضحية حد أدنى. وكان من بين الذين تم إعدامهم 8000 ضابطًا تم أخذهم كأسرى حرب أثناء الغزو السوفيتي لبولندا عام 1939، إضافة إلى 6000 ضابطًا شرطيًا، أما عن البقية فهم يمثلون طبقة النخبة المثقفة ببولندا، وقد زُعم أنهم: \\"عملاء للمخابرات، وحرس، وملاك أراضٍ، ومخربون، وملاك مصانع، وقضاة، ومسؤولون، وأخيرًا كهنة.\\"\\nيشير المصطلح المستخدم \\"مجزرة كاتين\\" في الأصل إلى المجزرة التي تم ارتكابها، ضد ضباط الجيش البولندي بمعسكر كوزلسك لأسرى الحرب، بغابة كاتين على وجه التحديد، تلك الغابة التي تقع على مقربة من قرى كاتين والمجمع الأثري Gnezdovo."},{"page_url":"https://fr.wikipedia.org/wiki/Botafogo_de_Futebol_e_Regatas","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/General_Severiano.JPG","page_title":"Botafogo de Futebol e Regatas","context_page_description":"Le Botafogo de Futebol e Regatas est un club omnisports brésilien, basé à Rio de Janeiro, dans le quartier du même nom, Botafogo. Il est principalement reconnu pour sa section de football, mais comporte également des sections de football de plage, d'aviron, de volley-ball, de basket-ball, de natation et d'autres. Fondé en tant que club de football le 12 août 1904, sous le nom de Botafogo Football Club, il fusionne avec le Club de Regatas Botafogo, un autre club du même quartier, fondé lui le 1ᵉʳ juillet 1894, pour former le Botafogo de Futebol e Regatas le 8 décembre 1942, jour de la fête de la sainte patronne du club, Nossa Senhora da Conceição.\\nSurnommé o Glorioso pour ses larges victoires du début du XXᵉ siècle, le Botafogo détient le record du plus grand écart lors d'un match de football au Brésil, 24 à 0 contre le Sport Club Mangueira. Le club prospère rapidement après sa fondation et domine ensuite le football de l'État de Rio de Janeiro dans les années 1930. Il vit son apogée dans les années 1950 et 1960 avec de nombreux titres."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D8%A7%D8%B2%D9%84%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Vaseline_Logo.svg","page_title":"فازلين","context_page_description":"في عام 1859 سافر روبرت تشييزيبرو، وهو كيميائي من بروكلين في الثانية والعشرين من العمر، إلى بنسلفانيا لمشاهدة حقول النفط المكتشفة حديثاً. فسمع هناك عمال النفط يشتكون من شمع شبيه بترسب البارافين سمي \\" شمع القضبان \\"، يضطرون إلى إزالته في الغالب عن قضبان المضخات الفولاذية إلا أنّ هؤلاء وجدوا في تلك المادة المزعجة مرهماً مسكناً وشافياً للحروق والجروح. أثار ذلك اهتمام تشييزيبرو فجمع عينات من شمع القضبان وحملها إلى منزله وباشر فحصها.\\nمرت 11 سنة وهو يعمل في تصفية الراسب وتنقيته. وكانت أكثرية المراهم تصنع آنذاك من الشحوم الحيوانية والزيووت النباتية، وتعرض للتلف إذا حفظت لمدة طويلة. ففكر تشييزيبرو بأن هذه المادة النفطية المنشأ والخالية من الزنخ والرائحة الكريهة قد تصبح مرهماً يكثر طلبه. ولكي يختبر فعاليته أحدث جروحاً و خدوشاً وحروقاً في جلده وعالجها بشمع القضبان. لما تأكدت له فعالية هذا المرهم، أنشأ تشييزيبرو في العام 1870 المعمل الأول لصنع البلسم الجديد الذي سمـّـاه فازلين.\\nاليوم يباع فازلين النفط الهلامي، المميّز بملصقه الأزرق و الأبيض في 140 بلداً. وقد وجد المستهلكون آلاف الطرق لاستخدامه."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8A%A0%E7%9B%9F%E9%80%A3%E9%8E%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/McDonalds_in_Moncton.jpg","page_title":"加盟連鎖","context_page_description":"加盟連鎖，又稱為加盟，是指由許多個別店鋪經營者透過總部的指導，經營相同品牌連鎖店的一種商業模式；透過這樣的經營方式，個別經營者可以迅速取得經營的知識，減少自我學習的時間；企業總部也可以藉此方式，無需投入較高資金開設直營分店，但又能快速擴張經營版圖。\\n也指投權人將其商號、商標、服務標誌商業秘密等在一定條件下許可給國外經營者，允許他在一定區域內從事與授權人相同的經營業務。\\n作為一種商業經營模式，在其經營過程和方法中有以下四個共同特點：\\n個人對商標、服務標誌、獨特概念、專利、經營訣竅等擁有所有權。\\n權利所有者授權其他人使用上述權利。\\n在授權合同中包含一些調整和控制條款，以指導受許人的經營活動。\\n加盟主需要支付加盟金。\\n中國政府對加盟連鎖的法律定義：加盟連鎖指特許者將自己所擁有的商標、商號、產品、專利和專有技術、經營模式等以加盟連鎖合同的形式授予被特許者使用，被特許者按合同規定，在特許者統一的業務模式下從事經營活動，並向特許者支付相應的費用。\\n直接特許：即特許者將加盟連鎖權直接授予加盟連鎖申請者，獲得加盟連鎖權的被特許者按照加盟連鎖合同設立特許點，開展經營活動，不得再行轉讓特許權。\\n區域特許：即由特許者將在指定區域內的獨家加盟連鎖權授予被特許者，該被特許者可將加盟連鎖權再授予其他申請者，也可由自己在該地區開設特許點，從事經營活動。\\n國際加盟連鎖協會對加盟連鎖的定義：加盟連鎖是特許人和受許人之間的契約關係，對受許人經營中的如下領域，經營訣竅和培訓，特許人有義務提供或保持持續的興趣；受許人的經營是在由特許人所有的控制下的一個共同標記、經營模式和過程之下進行的，並且受許人從自己的資源中對其業務進行投資。\\n歐洲加盟連鎖聯合會對加盟連鎖的定義：加盟連鎖是一種營銷產品和服務和技術的體系基於在法律和財務上分離和獨立的當事人--特許人和他的單個受許人--之間緊密和持續的合作，依靠特許人授予其單個受許人權利，並附加義務，以便根據特許人的概念進行經營。其項權利——經由直接或間接財務上的交換--給予並迫使單個受許人商號，和商標，和服務標記，經營訣竅，商業和技術方法，持續體系，和其他工業和智慧財產權，在雙方一致同意而制定的書面特許合同的框架和務款之內。"},{"page_url":"https://es.wikipedia.org/wiki/Amplificador_operacional","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Opampdifferencing.png","page_title":"Amplificador operacional","context_page_description":"Un amplificador operacional, a menudo conocido op-amp por sus siglas en inglés es un dispositivo amplificador electrónico de alta ganancia acoplado en corriente continua que tiene dos entradas y una salida. En esta configuración, la salida del dispositivo es, generalmente, de cientos de miles de veces mayor que la diferencia de potencial entre sus entradas."},{"page_url":"https://en.wikipedia.org/wiki/Origin_of_replication","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Origins_of_DNA_replication_Figure_1.jpg","page_title":"Origin of replication","context_page_description":"The origin of replication is a particular sequence in a genome at which replication is initiated. Propagation of the genetic material between generations requires timely and accurate duplication of DNA by semiconservative replication prior to cell division to ensure each daughter cell receives the full complement of chromosomes. This can either involve the replication of DNA in living organisms such as prokaryotes and eukaryotes, or that of DNA or RNA in viruses, such as double-stranded RNA viruses. Synthesis of daughter strands starts at discrete sites, termed replication origins, and proceeds in a bidirectional manner until all genomic DNA is replicated. Despite the fundamental nature of these events, organisms have evolved surprisingly divergent strategies that control replication onset. Although the specific replication origin organization structure and recognition varies from species to species, some common characteristics are shared."},{"page_url":"https://es.wikipedia.org/wiki/Mikulovice","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Mikulovice_%28Niklasdorf%29_-_B%C4%9Bl%C3%A1.jpg","page_title":"Mikulovice","context_page_description":"Mikulovice es una localidad del distrito de Jeseník en la región de Olomouc, República Checa, con una población estimada a principio del año 2018 de 2560 habitantes.\\nSe encuentra ubicada al norte de la región, sobre la parte oriental de los montes Sudetes, a poca distancia de la frontera con Polonia y con la región de Moravia-Silesia.​"},{"page_url":"https://en.wikipedia.org/wiki/Fjord_Line","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Fjord_line_bergensfjord.jpg","page_title":"Fjord Line","context_page_description":"Fjord Line is a Norwegian ferry operator offering services between Norway, Denmark and Sweden. In addition to passenger transport, Fjord line operates cargo transport through its cargo division in Norway and Denmark."},{"page_url":"https://da.wikipedia.org/wiki/Regeringen_Donald_Trump","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Kevin_McAleenan_official_photo.jpg","page_title":"Regeringen Donald Trump","context_page_description":"Regeringen Donald Trump tiltrådte som USA's regering den 20. januar 2017."},{"page_url":"https://en.wikipedia.org/wiki/List_of_prime_ministers_of_Italy","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Lamberto_Dini_1996.jpg","page_title":"List of prime ministers of Italy","context_page_description":"The Prime Minister of Italy, officially President of the Council of Ministers, is the political leader of Italy since 1861. The Chigi Palace in Rome is the official residence of the Prime Minister.\\nThe Prime Minister is the President of the Council of Ministers and must receive a vote of approval from it to execute most political activities. The office is similar to those in most other parliamentary systems, but the leader of the Italian government is not authorized to request the dissolution of the Parliament or to dismiss ministers.\\nThe office was established by Articles 92 through to 96 of the current Constitution of Italy. The Prime Minister is appointed by the President of the Republic after each general election. Commonly referred to in Italy as Premier, the right title of the office holder is President of the Council of Ministers, or just President of the Council. The formal Italian order of precedence lists the office as being ceremonially the fourth most important Italian state office."},{"page_url":"https://en.wikipedia.org/wiki/Erin_Phillips","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Erin_Phillips_19.03.17.jpg","page_title":"Erin Phillips","context_page_description":"Erin Victoria Phillips is an Australian former professional basketball player and an Australian rules footballer for Adelaide. She played nine seasons in the Women's National Basketball Association for five different teams and is a two-time WNBA champion. She also represented Australia on the women's national basketball team, winning a gold medal at the 2006 FIBA World Championship for Women and serving as a co-vice captain at the 2016 Summer Olympics. Additionally, Phillips has played four seasons in the AFL Women's competition, in which she is a two-time premiership player and two-time league best and fairest.\\nPhillips's father Greg played professional Australian rules football for Port Adelaide, where he won eight premierships and earned an induction into the Australian Football Hall of Fame. Phillips only played Australian rules football up until age 13 before switching to basketball because of the lack of professional opportunities for female footballers at the time."},{"page_url":"https://en.wikipedia.org/wiki/Dzhankoy","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/%D0%94%D0%B6%D0%B0%D0%BD%D0%BA%D0%BE%D0%B9.%D0%9F%D1%80%D0%B8%D0%B2%D0%BE%D0%BA%D0%B7%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%BF%D0%BB%D0%BE%D1%89%D0%B0%D0%B4%D1%8C.JPG","page_title":"Dzhankoy","context_page_description":"Dzhankoy or Jankoy is a town of regional significance in the north of the Crimea. It also serves as administrative center of Dzhankoy Raion although it is not a part of the raion. Population: 38,622.\\nThe name Dzhankoy is often translated into English from Crimean Tatar as \\"spirit-village\\" -Canköy. But the real meaning of this name is \\"new village\\": canköy < cañı köy.\\nIn the city there are many types of industrial factories, some of which are: automobile, reinforced concrete, fabric, meat, and others. Dzhankoy also contains professional technical schools."},{"page_url":"https://en.wikipedia.org/wiki/March_of_the_Iron_Will","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Horn_of_Africa_and_Southwest_Arabia_-_Mid-1930s.jpg","page_title":"March of the Iron Will","context_page_description":"The March of the Iron Will was an Italian Fascist propaganda event staged from 26 April to 5 May 1936, during the final days of the Second Italo-Ethiopian War. The goal of the march was to capture the Ethiopian capital in a show of force. An Italian mechanized column under the command of Pietro Badoglio, Marshal of Italy, advanced from the town of Dessie to take Addis Ababa. The march covered a distance of approximately 200 miles."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Cultural_Properties_of_Japan_-_paintings_(Kanagawa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Small_bird_and_loquats_%28Sounji_Hakone%29.png","page_title":"List of Cultural Properties of Japan - paintings (Kanagawa)","context_page_description":"This list is of the Cultural Properties of Japan designated in the category of paintings for the Prefecture of Kanagawa."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_Henry_County_(Alabama)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Bethune-Kennedy_House_Abbeville%2C_Alabama.JPG","page_title":"Liste der Einträge im National Register of Historic Places im Henry County (Alabama)","context_page_description":"Die Liste der Registered Historic Places im Henry County in Alabama führt alle Bauwerke und historischen Stätten im Henry County auf, die in das National Register of Historic Places aufgenommen wurden."},{"page_url":"https://af.wikipedia.org/wiki/Warskou","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Opera_Narodowa_zwloki.jpg","page_title":"Warskou","context_page_description":"Warskou is die hoofstad van die Republiek Pole en die administratiewe sentrum van die woiwodskap Mazowieckie. Dit is ook die grootste stad van Pole met 'n bevolking van 1,76 miljoen in die stad self en sowat 3,5 miljoen in die metropolitaanse gebied. Warskou is die agste grootste stad in die Europese Unie.\\nWarskou is aan die Weichsel- rivier geleë en tans een van die belangrikste ekonomiese, kulturele en politieke sentra in Sentraal- en Oos-Europa. Die stad is die setel van 'n Rooms-Katolieke aartsbiskop, beskik oor talle universiteite, die Poolse Akademie van Wetenskappe, 'n operahuis, teaters, musea, biblioteke en monumente. Die historiese stadskern van Warskou is in 1980 deur Unesco as wêrelderfenisgebied gelys. Die belangrikste argitektoniese besienswaardighede sluit die Kasteelplein met die koninklike kasteel en die Sigismund-monument, die Sint-Johannes-katedraal, die Jesuïetekerk en die markplein in die historiese stadsentrum met sy geboue in die Renaissance- en Barokstyl in."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D9%84_%D8%B1%D8%A7%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Paul_Rudd_%28cropped%29.jpg","page_title":"پل راد","context_page_description":"پل استیون راد هنرپیشه سینما، فیلم‌نامه‌نویس و تهیه‌کننده آمریکایی است. از فیلم‌های او می‌توان به کاپیتان آمریکا:جنگ داخلی و انتقام جویان:پایان بازی اشاره نمود."},{"page_url":"https://eo.wikipedia.org/wiki/Beremend","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Beremend_%C3%A9szaki_v%C3%A9ge.JPG","page_title":"Beremend","context_page_description":"Beremend estas grandvilaĝo en Hungario, en regiono Suda Transdanubio, en departemento Baranya, en Distrikto Siklós."},{"page_url":"https://nn.wikipedia.org/wiki/Det_milit%C3%A6re_skarpskyttarmerke","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/SkarpssmerketFjeldBronse.jpg","page_title":"Det militære skarpskyttarmerke","context_page_description":"Det militære skarpskyttarmerket er eit dugleiksmerke for skyting med personleg våpen. Skyttarmerket vart stifta i 1861 som ein «Skydepremie». Merket har som føremål å stimulere skyteinteressa mellom militære og sivile skyttarar, og gjennom årlege skyteprøver å halde skytedugleiken oppe hjå befal og mannskap i dei ståande styrkane, Heimevernet og mobiliseringsstyrkane.\\nMerket er utforma med to krosslagde gevær over ein bunden laurbærkrans med eit raudt felt innanfor kransen. I toppen er riksvåpenet. Merket finst i valørane gull, sølv og bronse i tillegg til ein medalje i gull. Medaljen har same utforming som merket, men er større og heng i eit raudt og gult band. Det er spesifikke krav til alle valørane både når det gjeld dugleik og tal på år ein må gjennomføre prøver for kvalifisere seg."},{"page_url":"https://fr.wikipedia.org/wiki/Bernard_Picart","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Left%2C_a_man_convicted_of_heresy_in_the_Spanish_Inquisition%3B_Wellcome_V0041637.jpg","page_title":"Bernard Picart","context_page_description":"Bernard Picart, né le 11 juin 1673 à Paris où il vécut rue Saint-Jacques, installé en 1711 à Amsterdam où il vécut dans la Kalverstraat et où il est mort le 8 mai 1733, est un dessinateur et graveur français."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D1%83%D0%B4%D0%B8%D0%BD%D0%BE%D0%BA_%D0%9A%D1%80%D0%B0%D0%B9%D0%BE%D0%B2%D0%BE%D0%B3%D0%BE_%D1%83%D1%80%D1%8F%D0%B4%D1%83_%D0%91%D1%83%D0%BA%D0%BE%D0%B2%D0%B8%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/%D0%91%D1%83%D0%B4%D0%B8%D0%BD%D0%BE%D0%BA_%D0%BA%D1%80%D0%B0%D0%B9%D0%BE%D0%B2%D0%BE%D0%B3%D0%BE_%D1%83%D1%80%D1%8F%D0%B4%D1%83_%D0%91%D1%83%D0%BA%D0%BE%D0%B2%D0%B8%D0%BD%D0%B8_%D0%A7%D0%B5%D1%80%D0%BD%D1%96%D0%B2%D1%86%D1%96_%D0%9F%D0%BE%D0%BF%D0%BE%D0%B2%D0%B8%D1%87%D0%B0_%D0%9E%D0%BC%D0%B5%D0%BB%D1%8F%D0%BD%D0%B0%2C_2_%D0%9A%D0%B0%D1%84%D0%B5%D0%B4%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%2C_2.JPG","page_title":"Будинок Крайового уряду Буковини","context_page_description":"Будинок крайового уряду Буковини — адміністративна будівля в Чернівцях, споруджена у XIX ст. як резиденція президента Герцогства Буковина та офіс крайового уряду."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D1%80%D1%82%D0%B8%D0%B7%D0%B0%D0%BD%D1%81%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Recreation_center_of_Partizansk.JPG","page_title":"Партизанск","context_page_description":"Партиза́нск — город в Приморском крае России. Административный центр Партизанского городского округа.\\nНаселение — 36 992 чел., 8-й по величине город Приморья. Входит в Находкинскую агломерацию. Расположен в долине реки Партизанской, в 154 км от Владивостока.\\nУгольная промышленность как градообразующая отрасль была ликвидирована в 2004 году. Среди работающих предприятий: Партизанская ГРЭС, локомотивное и вагонное ремонтное депо станции Партизанск, цех по изготовлению металлоконструкций «Ураган» и пивоваренный завод. Бюджет города на 70 % финансируется государством.\\nОснован в 1896 году как Сучанский Рудник, с 1932 по 1972 год носил название Сучан. Один из центров партизанского движения Приморья в 1920-е годы."},{"page_url":"https://bs.wikipedia.org/wiki/Maje","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Nakbe_str.JPG","page_title":"Maje","context_page_description":"Maje su bile jedan od od najdominantnijih autohtonih društava Mezoamerike. Bili su nastanjeni na poluostrvu Yucatan u Meksiku, Belizeu, Gvatemali, dijelovima meksičkih država Tabasco i Chiapas, te zapadnim dijelovima Hondurasa i El Salvadora.\\nNekoliko miliona potomaka i danas živi na ovim područjima, a njihovi preci su stvorili veliku civilizaciju koja je trajala više od 2000 godina sve do 1524. godine kad su Španci počeli sa brutalnim osvajanjem njihovih zemalja.\\nTokom ovog vremenskog perioda niz nezavisnih majanskih kraljevstava doživjelo je svoje uspone i padove širom raznovrsnih geografskih područja majanske domovine. Maje su živjele u selima i gradovima koji su se izdržavali od velikog bogatstva raznih usjeva kao i obilatog plijena iz šuma, rijeka, jezera i morskih obala. Najveći gradovi su bili glavni gradovi mnogih majanskih kraljevstava. U svakom od ovih gradova nalazili su se predivni hramovi, palate, isklesani spomenici, putevi, trgovi, pijace i kuće njihovih stanovnika. U mirnim vremenima ovi gradovi su uživali u blagostanju od trgovinske mreže koja je povezivala majanska kraljevstva."},{"page_url":"https://it.wikipedia.org/wiki/Teodoro_Sampaio_(San_Paolo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Bras%C3%A3o_de_Teodoro_Sampaio-SP%2C_Brasil.jpg","page_title":"Teodoro Sampaio (San Paolo)","context_page_description":"Teodoro Sampaio è un comune del Brasile nello Stato di San Paolo, parte della mesoregione di Presidente Prudente e della microregione omonima."},{"page_url":"https://en.wikipedia.org/wiki/Timeline_of_the_evolutionary_history_of_life","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Grassflowers.jpg","page_title":"Timeline of the evolutionary history of life","context_page_description":"This timeline of the evolutionary history of life represents the current scientific theory outlining the major events during the development of life on planet Earth. In biology, evolution is any change across successive generations in the heritable characteristics of biological populations. Evolutionary processes give rise to diversity at every level of biological organization, from kingdoms to species, and individual organisms and molecules, such as DNA and proteins. The similarities between all present day organisms indicate the presence of a common ancestor from which all known species, living and extinct, have diverged through the process of evolution. More than 99 percent of all species, amounting to over five billion species, that ever lived on Earth are estimated to be extinct. Estimates on the number of Earth's current species range from 10 million to 14 million, of which about 1.2 million have been documented and over 86 percent have not yet been described. However, a May 2016 scientific report estimates that 1 trillion species are currently on Earth, with only one-thousandth of one percent described."},{"page_url":"https://es.wikipedia.org/wiki/Puca_Pucara","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Puca_Pucara%2C_Cuzco%2C_Per%C3%BA%2C_2015-07-31%2C_DD_81.JPG","page_title":"Puca Pucara","context_page_description":"Puca Pucara es una construcción militar ubicada cerca del Cusco, en el Perú. Esta fortaleza está compuesta de grandes muros, terrazas y escalinatas y era parte del conjunto defensivo del Cusco en particular y del Imperio inca en general.\\nEn el ámbito de las construcciones arqueológicas cercanas a la capital del extinto imperio, se visita esta localidad. Puca Pucara recibe su nombre en quechua de \\"Fortaleza Roja\\", debido al color rojo que adquieren las rocas durante el crepúsculo. Puca Pucara es otra muestra de arquitectura militar que además funcionó como centro administrativo, cuenta con andenes, terrazas superpuestas, escalinatas y pasajes."},{"page_url":"https://en.wikipedia.org/wiki/Postage_stamps_and_postal_history_of_the_Canal_Zone","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/CZ_Airmail_cover%2C_25c_Goethals%2C_1931.jpg","page_title":"Postage stamps and postal history of the Canal Zone","context_page_description":"Postage stamps and postal history of the Canal Zone is a subject that covers the postal system, postage stamps used and mail sent to and from the Panama Canal Zone from 1904 up until October 1978, after the United States relinquished its authority of the Zone in compliance with the treaty it reached with Panama.\\nThe Canal Zone was a strip of territory 50 miles long and 10 miles wide across the Isthmus of Panama, and was ceded to the United States for the purpose of constructing and operating the canal which connected the Atlantic and Pacific Oceans. Upon the establishment of the Canal Zone in 1903, seventeen Post Offices had also been established and were operated by the U.S. Government. The Canal Zone and its post offices, with the main distributing office in Cristobal, operated as an independent government agency under the direct authority of the President of the United States. In the towns where there were railroad stations, the station agents of the Panama Railroad functioned as postmasters. Along with ships and freight, domestic mail and mail from around the world moved through the canal."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%94%D1%8A%D1%80%D0%B6%D0%B0%D0%B2%D0%BD%D0%BE_%D1%83%D1%81%D1%82%D1%80%D0%BE%D0%B9%D1%81%D1%82%D0%B2%D0%BE_%D0%BD%D0%B0_%D0%9A%D1%80%D0%B0%D0%BB%D1%81%D1%82%D0%B2%D0%BE_%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Daoiz_o_Velarde.jpg","page_title":"Държавно устройство на Кралство Испания","context_page_description":"Испания e парламентарна монархия. Държавен глава е кралят."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9F%D1%80%D0%B0%D1%8F%D0%B3%D1%80%D0%B0%D0%B4%D0%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/On_the_banks_of_New_Yamuna_bridge%2C_Allahabad.jpg","page_title":"Праяградж","context_page_description":"Прая̀градж, до октомври 2018 г. официално известен като Аллахабад, е град в североизточната част на Индия, щат Утар Прадеш с дълбоки индуистки корени. Тук се сливат 3 свещени за индуистите реки: митичната Сарашвати и реалните Ганг и Ямуна. Население 1 168 385 жители от преброяването през 2011 г."},{"page_url":"https://en.wikipedia.org/wiki/Medieval_India","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/India_7th_century_AD.jpg","page_title":"Medieval India","context_page_description":"Medieval India refers to a long period of the history of the Indian subcontinent between the \\"ancient period\\" and \\"modern period\\". It encompasses the 6th to the 18th centuries A.D."},{"page_url":"https://si.wikipedia.org/wiki/%E0%B6%A2%E0%B7%99%E0%B6%A7%E0%B7%8A_%E0%B6%91%E0%B6%B1%E0%B7%8A%E0%B6%A2%E0%B7%92%E0%B6%B1%E0%B7%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Engine.f15.arp.750pix.jpg","page_title":"ජෙට් එන්ජින්","context_page_description":"ජෙට් එන්ජිමක් යනු නිව්ටන්ගේ චලිතය පිළිබඳ තෙවැනි නියමයට අනුව තෙරපුම ජනනය කිරීමට වේගයෙන් චලනය වන තරල ක්ෂේපයක් මුදාහරින ප්‍රතික්‍රියා එන්ජිමකි. ජෙට් එන්ජින් පිළිබඳ මෙම මූලික අර්ථ දැක්වීම turbojets, turbofans, rockets, ramjets, pulse jets and pump.jets සදහා ද අදාල වේ. නමුත් පොදු භාවිතයේදී මෙම පදය සාමාන්‍යයෙන් ගෑස් ට’බයින, බ්‍රේට්න් චක්‍ර එන්ජින්, ඉතිරි බලය මගින් තෙරපුම ලබාදෙන, ට’බයිනයක් මගින් ශක්තිය ලබාදෙන භ්‍රමක සම්පින්ඩනයක් සහිත එන්ජින් හැදින්වීමට භාවිතා කරයි. නූතන ලෝකයට ජෙට් එන්ජින් කොතරම් සමීපවී ද යත් ඇතැම් අවස්ථාවලදී අත්වැරදීමකින් ගෑස් ට’බයිනය වෙනත් ක්‍රමවලට වඩා වැඩියෙන් ජෙට් ඉන්ජින්වල විශේෂ භාවිතයන් ලෙස හැඳින්වේ. බොහෝමයක් ජෙට් එන්ජින් අභ්‍යන්තර දහන එන්ජින් වුවද ගින්නෙන් නොදැවෙන ආකාර පවා පවතී.\\nදුර ධාවනය කරන චාරිකා සඳහා ජෙට් ගුවන් යානාවලට ජෙට් එන්ජින් මූලික වශයන් භාවිතා කරයි. මුල් කාලයේදී ජෙට් ගුවන් යානාවලට අකාර්යක්ෂම වූ ට’බොජෙට් එන්ජිමක් භාවිතා කරන ලදී. නූතන ජෙට් ගුවන් යානා සාමාන්‍යයෙන් ඉතා ඉහළ වේගයක් ලබාදීමට උදව් වන වඩාත් දුර ධාවනය කළ හැකි මෙන්ම වෙනත් ප්‍රවාහන ක්‍රමවලට වඩා හොඳ ඉන්ධන කාර්යෂමතාවයක් ඇති high-bypass turbofan engines භාවිතා කරයි. 2004 දී ලෝක ඉන්ධන ප්‍රමාණයෙන් 7.2% පමණ මූලික වශයෙන් ජෙට් එන්ජින් මගින් පරිභෝජනය කරන ලදී."},{"page_url":"https://sv.wikipedia.org/wiki/Jakov_Fjodorovitj_Dolgorukov","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Dolgorukov_Yakov_Fyodorovich.jpg","page_title":"Jakov Fjodorovitj Dolgorukov","context_page_description":"Jakov Fjodorovitj Dolgorukov, född 1639, död 1720, var en rysk militär.\\nDolgorukov utmärkte sig under de turkiska fälttågen 1695–96. Han blev general 1697, råkade i slaget vid Narva i svensk krigsfångenskap, men lyckades fly 1711. Han inträdde därefter i senaten där han stödd på tsar Peters gunst hade stort inflytande."},{"page_url":"https://id.wikipedia.org/wiki/Rudini","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Jenderal_TNI_Rudini.png","page_title":"Rudini","context_page_description":"Jenderal TNI Rudini adalah seorang jenderal berbintang empat dan politikus Indonesia. Ia adalah Menteri Dalam Negeri dalam Kabinet Pembangunan V."},{"page_url":"https://gl.wikipedia.org/wiki/Li%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Lyon_paysages.jpg","page_title":"Lión","context_page_description":"«Lion» redirixe aquí. Para diversas moedas denominadas así, véxase lion.\\nLión é unha cidade francesa, capital da rexión Auvernia-Ródano-Alpes, na confluencia dos ríos Ródano e Saona. En 2008 tiña 474 946 habitantes, e conformaba a segunda maior área urbana francesa, con 1 757 180 persoas."},{"page_url":"https://pt.wikipedia.org/wiki/Sistema_de_Raunki%C3%A6r","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Posidonia_oceanica.jpg","page_title":"Sistema de Raunkiær","context_page_description":"Sistema de Raunkiær é uma forma de categorização utilizada para classificar as plantas com base na posição das gemas de renovo durante a estação do ano mais desfavorável e outras características do hábito da planta.\\nO sistema foi inicialmente proposto em 1904 pelo pioneiro da ecologia Christen Christiansen Raunkiær, e posteriormente alargado por diversos autores."},{"page_url":"https://fr.wikipedia.org/wiki/Cam%C3%A9ra_Path%C3%A9_Webo_M16","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Cam%C3%A9ra_Path%C3%A9_Webo_M16.jpg","page_title":"Caméra Pathé Webo M16","context_page_description":"La Pathé Webo est une caméra argentique 16 mm pour amateurs, puis pour professionnels, fabriquée par Pathé dès 1950. Les différents modèles existent également pour le film 9,5 mm. Son succès a été plutôt mitigé par rapport à celui de ses deux principaux concurrents : la caméra Paillard-Bolex H16 et la caméra Beaulieu R16."},{"page_url":"https://en.wikipedia.org/wiki/Nashville_Vols_awards_and_league_leaders","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Lance_Richbourg.png","page_title":"Nashville Vols awards and league leaders","context_page_description":"The Nashville Vols minor league baseball team played 62 seasons from its creation in Nashville, Tennessee, in 1901 through its final season of 1963. The club played in 9,019 regular season games and compiled a win–loss record of 4,571–4,448. They had a post-season record of 110–77–1. This list documents top players in particular statistical areas.\\nThe Nashville Baseball Club was formed as a charter member of the newly organized Class B Southern Association in 1901. The team did not receive their official moniker, the Nashville Volunteers, until 1908. However, the team was, and is, commonly referred to as the Vols. Their last season in the Southern Association was 1961. After sitting out the 1962 season, the Vols returned for a final season as a part of the South Atlantic League in 1963.\\nEight Vols players won the Southern Association Most Valuable Player Award, the league's only award. Of the 1,215 players to have played for the Vols, 103 players distinguished themselves by leading the league in statistical categories during a season. Bob Lennon led the Southern Association in five areas in 1954: batting average, hits, runs, RBI, and home runs."},{"page_url":"https://fr.wikipedia.org/wiki/Rallye_Monte-Carlo_1973","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Sommet_corobin_par_Bvalentin.jpg","page_title":"Rallye Monte-Carlo 1973","context_page_description":"Le Rallye Monte-Carlo 1973, disputé du 19 au 26 janvier 1973, est la première manche du championnat du monde des rallyes 1973. C'est la toute première épreuve du championnat du monde des rallyes, inauguré en 1973."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A0%88%EC%9A%B0%ED%81%AC%ED%8A%B8%EB%9D%BC_%EC%A0%84%ED%88%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Battle_of_Leuctra%2C_371_BC_-_Decisive_action.svg","page_title":"레우크트라 전투","context_page_description":"레우크트라 전투 또는 레욱트라 전투는 코린토스 전쟁 이후 기원전 371년 7월 6일, 테스피아이의 마을인 레우크트라에서 테바이가 이끈 보이오티아 동맹과 스파르타 사이에 벌어진 전투다. 테바이가 승리했고, 스파르타는 펠로폰네소스 전쟁 승리 이후 그리스 반도 전역에 행사하던 영향력을 잃었다."},{"page_url":"https://es.wikipedia.org/wiki/M%C3%BCller_(cr%C3%A1ter)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Near_side_77.jpg","page_title":"Müller (cráter)","context_page_description":"Müller es un cráter de impacto lunar. Se encuentra en las tierras altas cerca del origen del punto medio de la Luna, en el centro del triángulo formado por los cráteres mucho más grandes Albategnius, Ptolemaeus e Hipparchus. Al este se encuentra Halley, mientras que al noroeste aparece Gyldén.\\nEl borde de este cráter es irregular y ligeramente oblongo, con la dimensión larga orientada en un eje norte-sur. El borde sureste está marcado por dos cráteres satélite más pequeños, identificados como Müller A y Müller O.\\nQuizás la característica más distintiva de este cráter es la peculiar formación lineal de pequeños cráteres que comienza en el borde sur del brocal de Müller, que describen una línea hacia el noroeste tangente al borde de Ptolemaeus."},{"page_url":"https://en.wikipedia.org/wiki/Marlyn_Mason","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Marlyn_Mason_1976.JPG","page_title":"Marlyn Mason","context_page_description":"Marlyn Mason is an American actress, producer, and screenwriter.\\nMason played the role of Nikki Bell in the television series Longstreet, which starred James Franciscus. Her other acting credits include roles in Hogan's Heroes, My Three Sons, Burke's Law, The Invaders, Kentucky Jones, Bonanza, The Big Valley, Ben Casey, Dr. Kildare, Laredo, Occasional Wife, The Big Valley, The Man from U.N.C.L.E., I Spy, Laredo, Hogan's Heroes, The F.B.I., Mission Impossible, The Fugitive, Mannix, The Invaders, The Odd Couple, Love, American Style, Marcus Welby, M.D., Cannon, Barnaby Jones, Gomer Pyle, U.S.M.C., Boone, The Bronx Zoo, Charles in Charge, Ironside, and Jake and the Fatman, and in the episode \\"The Mask of Adonis\\" from the 1977 series Quinn Martin's Tales of the Unexpected. She guest-starred on the final Perry Mason episode, \\"The Case of the Final Fadeout,\\" portraying Erna Landry, a 'nice-girl' actress of a television show. She played Sgt. Margo Demarest in Twelve O'Clock High Season 3, Episode 9 \\"The Fighter Pilot\\"\\nMason played a principal role in the original 1967-68 Broadway production of How Now, Dow Jones."},{"page_url":"https://de.wikipedia.org/wiki/Burgkirche_(Bad_D%C3%BCrkheim)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Burgkirche_Bad-Duerkheim_02.jpg","page_title":"Burgkirche (Bad Dürkheim)","context_page_description":"Die Burgkirche ist eine ehemalige protestantische Pfarrkirche in Bad Dürkheim, die unter Denkmalschutz steht."},{"page_url":"https://it.wikipedia.org/wiki/Louise_de_Coligny","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Portrait_of_Louise_de_Coligny_Mauritshuis_97.jpg","page_title":"Louise de Coligny","context_page_description":"Louise de Coligny, figlia di Gaspard de Coligny e Charlotte de Laval, fu la quarta moglie del principe Guglielmo I d'Orange.\\nIl 26 maggio 1572, a 17 anni, sposò Charles de Teligny. Dopo che sia il marito che il padre furono uccisi nel massacro della Notte di San Bartolomeo, si rifugiò in Svizzera.\\nIl 12 aprile 1583 si sposò con il Guglielmo I d'Orange-Nassau ad Anversa. Il matrimonio di Guglielmo e Louise ebbe una forte valenza politica, perciò a causa della sua origine francese Louise non fu molto popolare nei Paesi Bassi. Il loro unico figlio Federico Enrico d'Orange nacque il 29 gennaio 1584 ed il 10 luglio dello stesso anno Guglielmo d'Orange morì a seguito dell'attentato di Balthasar Gérard.\\nDopo aver tentato, senza successo, nel 1619 di fermare l'esecuzione di Johan van Oldenbarnevelt, partì definitivamente per la Francia, dove morì a Fontainebleau nel 1620 presso la corte della Regina Madre Maria de' Medici. Fu tumulata il 24 maggio 1621 accanto al marito nella cappella della famiglia d'Orange-Nassau nella Nieuwe Kerk di Delft."},{"page_url":"https://ceb.wikipedia.org/wiki/Colaptes_punctigula","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Spot-breasted_Woodpecker_700.jpg","page_title":"Colaptes punctigula","context_page_description":"Espesye sa langgam nga una nga gihulagway ni Pieter Boddaert ni adtong 1783 ang Colaptes punctigula. Ang Colaptes punctigula sakop sa kahenera nga Colaptes sa kabanay nga Picidae. Giklaseklase sa IUCN ang espesye sa kinaminosang kalabotan."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%85%E0%A4%A8%E0%A5%8D%E0%A4%A8%E0%A4%AA%E0%A5%82%E0%A4%B0%E0%A5%8D%E0%A4%A3_%E0%A4%AA%E0%A4%A6%E0%A4%AE%E0%A4%BE%E0%A4%B0%E0%A5%8D%E0%A4%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Marsyangdi_river_valley_near_Pisang.jpg","page_title":"अन्नपूर्ण पदमार्ग","context_page_description":"अन्नपूर्ण पदमार्ग नेपालको अन्नपूर्ण हिमाल क्षेत्रमा अवस्थित पर्यटकीय पैदलमार्ग हो । यो पदमार्गको लम्बाई लगभग १६०-२३० किलोमिटर रहेको छ । यो पदमार्ग ५, ४१६ मी उचाईमा रहेको थोरोङ ला सम्म पुग्छ । यस पदमार्गको यात्राको क्रममा ६०००-८०००० मिटर सम्मका अग्ला हिमालहरू अन्नपूर्ण दोस्रो, तेस्रो र चौथोलगायत धौलागिरी, माछापुच्छ्रे हिमाल जूलू पिक, पिसाङ पिक, निलगिरी हिमाल र तिलिचो पिक आदी देख्न सकिन्छ ।\\nव्यावहारिक रूपमा सबै ट्रेकरहरूले एन्टिकलोकमार्गको मार्ग बढाउँछन्, किनकि यसरी दैनिक उचाइ लाभ ढिलो छ, र उच्च थोरोङ ला पास पार गर्न सजिलो र सुरक्षित छ। हिमाली दृश्यहरु, करीव क्वार्टरमा देखिएको अन्नपूर्णा मासिफ, धौलागिरि, मच्छपुच्छे, मानसलु, गंगापूर्णा, तिलिच शिखर, पिसांग शिखर र पौङ्दा डण्डाहरू सामेल छन्। ६०००- ८००० मीटर उचाई को असंख्य अन्य चुचुराहरु। अन्नपूर्णा दायराबाट उठ्नुहोस्"},{"page_url":"https://sv.wikipedia.org/wiki/Hannah_Simone","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Hannah_Simone%283%29.jpg","page_title":"Hannah Simone","context_page_description":"Hannah Simone, född 3 augusti 1980 i London, är en brittisk-kanadensisk programledare, skådespelare och modell.\\nFrån maj 2006 till november 2008 arbetade hon som VJ på den kanadensiska musikkanalen MuchMusic. Sedan 2011 spelar hon rollen som Cece Parikh i TV-serien New Girl.\\nSimone föddes i London, hennes far är av indiskt ursprung och hennes mor av tysk, italiensk och grekisk-cypriotisk härkomst. Simone tillbringade delar av sin tidiga barndom i Calgary i Kanada men bodde även i Saudiarabien, Indien och Grekland under sin uppväxt.\\nHannah Simone tog en Bachelor of Arts i internationella relationer och statsvetenskap vid University of British Columbia. År 2004 tog hon en BA i radio- och TV-vetenskap från Ryerson University. Under två år gjorde hon research för en bok skriven av tidigare utrikesminister Lloyd Axworthy. Efter detta flyttade hon till England och arbetade under en tid för FN."},{"page_url":"https://ga.wikipedia.org/wiki/P%C3%A1pa_Pius_IX","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Pius_IX.jpg","page_title":"Pápa Pius IX","context_page_description":"Bhí Pius IX Beannaithe mar dhuine de na pápaí ar an Eaglais Chaitliceach is conspóidí riamh. Chaill sé an flaitheas saolta nuair a ghabh Giuseppe Garibaldi na Stáit Pápúil i 1870, tar éis don Chéad Comhairle Vatacáine a fhógairt nach ndéanfadh an Pápa faillí agus é ag labhairt ex cathedra ar ábhar creidimh."},{"page_url":"https://pl.wikipedia.org/wiki/Calver","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Calver_Mill_346670_ac4f6a9e.jpg","page_title":"Calver","context_page_description":"Calver – wieś w Anglii, w hrabstwie Derbyshire, w dystrykcie Derbyshire Dales. Leży 40 km na północ od miasta Derby i 220 km na północny zachód od Londynu."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BA%BA%E5%8A%9B%E9%A3%9B%E8%A1%8C%E6%A9%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Daedalus_Project%27s_Light_Eagle.jpg","page_title":"人力飛行機","context_page_description":"人力飛行機は、人間の筋力のみを動力源とし飛行する飛行機のことである。純粋な人力飛行機においては推進力としてのモーター等の併用は認められないが、操縦系統などでサーボモータ等を使うことがある。人力飛行機という言葉は固定翼機の形態を指すことが多いが、広義には人力ヘリコプターや人力オーニソプターを含める場合もある。\\n英語では Human powered aircraft が用いられることが多いが、国際航空連盟の分類では Humanpowered Aircraft は固定翼機である人力飛行機の他に人力ヘリコプターや人力オーニソプターも含む人力航空機を意味し、人力飛行機は Humanpowered Airplanes に分類される。また英語の頭文字をとって、しばしばHPAと略される。かつてはMan powered aircraft/MPAも用いられていた。また、自転車のように足でペダルを回して動力を得る足漕ぎ式の人力飛行機を特にPedal powered airplaneのように称することもある。\\n本項では主に固定翼機について述べる。"},{"page_url":"https://es.wikipedia.org/wiki/Gat%C3%B3n_de_Campos","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/HPIM0645.JPG","page_title":"Gatón de Campos","context_page_description":"Gatón de Campos es un municipio de España, en la comarca de Tierra de Campos, dentro de la provincia de Valladolid, comunidad autónoma de Castilla y León. Tiene una superficie de 20,43 km² con una población de 39 habitantes y una densidad de 1,91 hab/km². Situado en la ribera del río Sequillo en su curso medio."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A3%D1%80%D0%B0%D1%80%D1%82%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Sargon_II%2C_Iraq_Museum_in_Baghdad.jpg","page_title":"Урарту","context_page_description":"Урарту, известно и под имената Арарат или Царство Ван е царство от желязната епоха с център езерото Ван и Арменската планинска земя.\\nКато историко-географско понятие Урарту се отнася за планинската област между Мала Азия, Кавказ и Месопотамия, днес известна като Арменска планинска земя. Царството се появява през ІХ век пр.н.е. и е завладяно от Мидия в началото на VI век пр.н.е."},{"page_url":"https://de.wikipedia.org/wiki/Briefmarken-Jahrgang_1963_der_Deutschen_Post_der_DDR","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/DDR_1963_Michel_980.JPG","page_title":"Briefmarken-Jahrgang 1963 der Deutschen Post der DDR","context_page_description":"Der Briefmarken-Jahrgang 1963 der Deutschen Post der DDR wurde 1963 durch die Deutsche Post emittiert. Wie im Briefmarken-Jahrgang 1962 wurde 1963 ein Block ausgegeben. Vier Briefmarken gelangten in zwei waagerechten Zusammendrucken sowie zehn Werte mit einem thematisch gestalteten Nebenfeld an die Postschalter. Einen weiteren Kleinbogen gab es erst im nächsten Markenjahr.\\nZum Jahrgang gehören 61 Sondermarken und ein Block mit insgesamt 63 Motiven sowie sieben Dauermarken in zwei Zeichnungen. Der Ausgabeumfang entsprach damit in etwa dem Vorjahr. Bei 14 Sondermarken musste ein Zuschlag zwischen 5 und 20 Pfennigen bezahlt werden. Der Nominalwert der Ausgaben betrug 19,45 Mark.\\nSeit 1955 wurden bei den meisten Sonderbriefmarkensätzen in der Regel ein Wert sowie fast alle Blocks und die ab 1962 erschienenen Kleinbogenausgaben in deutlich reduzierter Auflage gedruckt."},{"page_url":"https://gl.wikipedia.org/wiki/Poncho_S%C3%A1nchez","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Poncho_Sanchez_performing_at_Jazz_Cruise_2014.jpg","page_title":"Poncho Sánchez","context_page_description":"Poncho Sánchez, nado o 30 de outubro de 1951, é un musico de jazz latino, intérprete de conga e cantante de salsa nado nos Estados Unidos e de ascendencia mexicana."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BD%D0%BA%D1%83%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Ganesha_Nurpur_miniature_circa_1810_Dubost_p64.jpg","page_title":"Анкус","context_page_description":"А́нкуc или а́нкуша, стрека́ло — инструмент дрессировщика и погонщика слона. Представляет собой короткое, чуть более полуметра, копьё с толстой рукояткой и багром."},{"page_url":"https://pt.wikipedia.org/wiki/Partido_Comunista_dos_Trabalhadores_Portugueses","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Mao_Zedong_and_Enver_Hoxha.jpg","page_title":"Partido Comunista dos Trabalhadores Portugueses","context_page_description":"O Partido Comunista dos Trabalhadores Portugueses, é um partido político de Portugal, de inspiração maoísta, fundado em 26 de Dezembro de 1976 a partir do Movimento Reorganizativo do Partido do Proletariado."},{"page_url":"https://fr.wikipedia.org/wiki/Aerocomp_Comp_Air_7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/AeroComp7SLC-GTOD02.jpg","page_title":"Aerocomp Comp Air 7","context_page_description":"L'Aerocomp Comp Air 7 est un avion utilitaire léger turbopropulsé commercialisé en kit pour la construction amateur par la société américaine Aerocomp.\\nCe monoplan à aile haute contreventée et train fixe est une évolution aérodynamique du Comp Air 6 « fuselage large », pour 1 pilote et 6 passagers.\\nLe prototype [N4115J] a volé le 14 janvier 1999. Depuis Aerocomp a développé le modèle Comp Air 7 SLX avec un fuselage allongé de 30 cm juste derrière le siège du pilote avec un allongement correspondant de la corde d’aile à l’emplanture, donnant plus de place aux passagers. On trouvait 15 Comp Air 7 sur le registre des immatriculations aéronautiques aux États-Unis début 2006 et 1 au Canada.\\nLe 13 novembre 2004 les Émirats arabes unis ont fait livrer à Bassorah 5 Comp Air 7 SLX à train tricycle destinés à la reconstitution d'une armée de l'Air en Irak. Ces avions ont été initialement basés à Al Muthana, Bagdad, mais le 30 mai 2005 un de ces appareils s'est écrasé, tuant 1 Irakien et 4 Américains. Le 412th Maintenance Group de l’USAF a donc été chargé d’étudier en détail l’avion et les appareils ont été immobilisés en janvier 2006."},{"page_url":"https://es.wikipedia.org/wiki/James_Joyce","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cf/Joyce_oconnell_dublin.jpg","page_title":"James Joyce","context_page_description":"James Augustine Aloysius Joyce fue un escritor irlandés, mundialmente reconocido como uno de los más importantes e influyentes del siglo XX. Joyce es aclamado por su obra maestra, Ulises, y por su controvertida novela posterior, Finnegans Wake. Igualmente ha sido muy valorada la serie de historias breves titulada Dublineses, así como su novela semiautobiográfica Retrato del artista adolescente. Joyce es representante destacado de la corriente literaria de vanguardia denominada modernismo anglosajón, junto a autores como T. S. Eliot, Virginia Woolf, Ezra Pound o Wallace Stevens.\\nAunque pasó la mayor parte de su vida adulta fuera de Irlanda, el universo literario de este autor se encuentra fuertemente enraizado en su nativa Dublín, la ciudad que provee a sus obras de los escenarios, ambientes, personajes y demás materia narrativa.​ Más en particular, su problemática relación primera con la iglesia católica de Irlanda se refleja muy bien a través de los conflictos interiores que atormentan a su álter ego en la ficción, representado por el personaje de Stephen Dedalus."},{"page_url":"https://hu.wikipedia.org/wiki/Bermuda-h%C3%A1romsz%C3%B6g","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Douglas_DC-3%2C_SE-CFP.jpg","page_title":"Bermuda-háromszög","context_page_description":"A Bermuda-háromszög, vagy más néven az Ördög-háromszöge egy terület neve az Atlanti-óceánon, amely repülőgépek és hajók különös eltűnéséről vált ismertté. Az eltűnésekkel kapcsolatos dokumentációk hiányossága miatt sokan paranormális és természetfeletti jelenségekben, vagy éppen földönkívüliek jelenlétével magyarázzák az eseteket, de született számos tudományos alapokon nyugvó magyarázat is. A legkevésbé ismert, de legracionálisabb alapokon álló elmélet szerint maga a rejtély nem létezik, a Bermuda-háromszög csupán a tengerész legendák megszokott változatainak egyike, melyet néhány író fantáziája nagyított fel és tett ismertté világszerte.\\nFöldrajzilag a háromszöget Bermuda szigete, Puerto Rico és Miami rajzolja ki."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%86%D8%AF%D8%B1%D8%B3%D9%88%D9%86_%D9%84%D8%A7%D9%8A%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Anderson_Leite_2017.jpg","page_title":"اندرسون لايت","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nاندرسون لايت لاعب كورة قدم من برازيل."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A6%CF%81%CE%BF%CF%8D%CF%81%CE%B9%CE%BF_%CF%84%CE%BF%CF%85_%CE%93%CE%BA%CF%8C%CF%81%CE%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Goristsikhe_fortress%2C_Georgia.jpg","page_title":"Φρούριο του Γκόρι","context_page_description":"Το Φρούριο του Γκόρι είναι μια μεσαιωνική ακρόπολη που είναι χτισμένη σε ένα βραχώδη λόφο στο κέντρο της ομώνυμης πόλης, στο δήμο Γκόρι του μχάρε Σίντα Κάρτλι στη Γεωργία. Πρόκειται για στρατηγικά πλεονεκτική θέση στη συμβολή 3 ποταμών, των Λιάχβι, Μετζούντα και Κύρος."},{"page_url":"https://sv.wikipedia.org/wiki/Chunjiang","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/China_edcp_relief_location_map.jpg","page_title":"Chunjiang","context_page_description":"Chunjiang är en socken i Kina. Den ligger i provinsen Sichuan, i den sydvästra delen av landet, omkring 370 kilometer söder om provinshuvudstaden Chengdu. Antalet invånare är 4 036. Befolkningen består av 1 902 kvinnor och 2 134 män. Barn under 15 år utgör 29,0 %, vuxna 15-64 år 65 %, och äldre över 65 år 5,0 %.\\nGenomsnittlig årsnederbörd är 1 022 millimeter. Den regnigaste månaden är juli, med i genomsnitt 230 mm nederbörd, och den torraste är december, med 5 mm nederbörd."},{"page_url":"https://fr.wikipedia.org/wiki/Monuments_nationaux_de_Mostar","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Music_school_musala_1024x768.jpg","page_title":"Monuments nationaux de Mostar","context_page_description":"Cet article recense les monuments nationaux situés sur le territoire de la Ville de Mostar en Bosnie-Herzégovine et dans la Fédération de Bosnie-et-Herzégovine. La liste établie par la Commission pour la protection des monuments nationaux compte 42 monuments nationaux inscrits sur la liste principale et 24 monuments inscrits sur une liste provisoire."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%92%E1%83%A0%E1%83%98%E1%83%92%E1%83%9D%E1%83%9A_I_(%E1%83%9E%E1%83%90%E1%83%9E%E1%83%98)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Gregorythegreat.jpg","page_title":"გრიგოლ I (პაპი)","context_page_description":"გრიგოლ I დიდი — რომის პაპი 590 604 წლებში მართლმადიდებელი და კათოლიკური ეკლესიების წმინდანი."},{"page_url":"https://simple.wikipedia.org/wiki/Beers,_North_Brabant","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Beers%2C_l%27ancienne_mairie.JPG","page_title":"Beers, North Brabant","context_page_description":"Beers is a village in the province of North Brabant, the Netherlands. It is part of the municipality of Cuijk and is in the very northeastern part of the province, close to the Meuse River.\\nAs of 2016, about 1,700 people were living in Beers.\\nTill 1994 Beers was also a municipality."},{"page_url":"https://nv.wikipedia.org/wiki/Ch%CA%BCa%C5%82_bibid_yilzh%C3%B3l%C3%AD_%C5%82itsxoo%C3%ADg%C3%AD%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Craugastor_megacephalus.jpg","page_title":"Chʼał bibid yilzhólí łitsxooígíí","context_page_description":"Chʼał bibid yilzhólí łitsxooígíí éí tsinlátah chʼał dah yikahjí atah yisdzoh, áádóó éí kéyah dah siʼánígíí beʼałníiʼdi hólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Craugastor megacephalus\\" deiłníigo dayózhí."},{"page_url":"https://ceb.wikipedia.org/wiki/Op%C5%A1tina_Prijepolje","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Grb-Prijepolje.jpg","page_title":"Opština Prijepolje","context_page_description":"Munisipyo ang Opština Prijepolje sa Serbiya. Nahimutang ni sa distrito sa Zlatiborski Okrug ug lalawigan sa Central Serbia, sa habagatan-kasadpang bahin sa nasod, 170 km sa habagatan sa Belgrade ang ulohan sa nasod. Adunay 13,068 ka molupyo.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 10 °C. Ang kinainitan nga bulan Hulyo, sa 22 °C, ug ang kinabugnawan Enero, sa -4 °C. Ang kasarangang pag-ulan 1,500 milimetro matag tuig. Ang kinabasaan nga bulan Mayo, sa 166 milimetro nga ulan, ug ang kinaugahan Agosto, sa 59 milimetro."},{"page_url":"https://nl.wikipedia.org/wiki/Mark_Strong","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Mark_Strong_by_Gage_Skidmore.jpg","page_title":"Mark Strong","context_page_description":"Mark Strong is een Engelse acteur."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BB%D0%BE%D1%81%D1%8B_%D0%91%D0%B0%D0%BA%D0%B0%D0%B1%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Titan_%28Mond%29_%288621291%29.jpg","page_title":"Полосы Бакаба","context_page_description":"Полосы Бакаба — яркие полосы, находящиеся на поверхности самого крупного спутника Сатурна — Титана, по координатам 19° ю. ш. 151° з. д.19° ю. ш. 151° з. д.. Находятся в юго-восточной части местности Шангри-ла. Под термином полосы понимаются яркие полосы на поверхности тела.\\nМаксимальный размер структур составляет 485 км. Полосы Бакаба были обнаружены на радиолокационных снимках космического аппарата Кассини. Название получило официальное утверждение в 2006 году.\\nНазваны в честь Бакаба, бога дождя у майя."},{"page_url":"https://cs.wikipedia.org/wiki/Maseru","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Mantsopa_Cave.jpeg","page_title":"Maseru","context_page_description":"Maseru je hlavní město Lesotha, leží na západě země u hranic Jihoafrické republiky, na řece Caledon. Je největším městem celé země, v roce 2016 mělo 330 760 obyvatel."},{"page_url":"https://fr.wikipedia.org/wiki/Jean-Baptiste_Carpeaux","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Jean-baptiste_carpeaux%2C_piscatoriello%2C_1857-61_circa%2C_01.JPG","page_title":"Jean-Baptiste Carpeaux","context_page_description":"Jean-Baptiste Carpeaux, né le 11 mai 1827 à Valenciennes et mort le 12 octobre 1875 à Courbevoie, est un sculpteur, peintre et dessinateur français."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B9%D9%84%D9%88%D9%85_%D9%88_%D9%81%D9%86%D8%A7%D9%88%D8%B1%DB%8C_%D8%AF%D8%B1_%D8%A7%D8%B3%D8%B1%D8%A7%D8%A6%DB%8C%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Robert_Aumann.jpg","page_title":"علوم و فناوری در اسرائیل","context_page_description":"اسرائیل دارای درصد تعداد افراد شرکت‌کنندهٔ بالایی در تحقیقات علمی در جهان است. از هر ۱۰۰۰ اسرائیلی شاغل ۱۳۵ نفر مهندس هستند که دوبرابر درصد مهندسان در ایالات متحده آمریکا است. صنایع فناوری پیشرفته اسراییل بیش از ۴۲ درصد صادرات این کشور را تشکیل می‌دهند.\\nبسیاری از فناوریهای پیشرفته جهان در اسراییل منشأ و سرآغاز داشته‌اند از جمله ریزپردازنده Core ۲ Duo متعلق به شرکت اینتل، فناوری فایل‌های Zip، و صنایع کشاورزی و فضایی. اسراییل موفقیت خود در فناوری پیشرفته را مدیون نیروی کار با دانش بالای فنی و بودجه تحقیق و توسعه کلانیست که هر ساله این کشور را در صدر کشورهای برتر جهان قرار داده‌است."},{"page_url":"https://es.wikipedia.org/wiki/Historia_econ%C3%B3mica_de_China_antes_de_1912","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Dai_Jin-Landscape_in_the_Style_of_Yan_Wengui.jpg","page_title":"Historia económica de China antes de 1912","context_page_description":"La historia económica de China cubre miles de años, y la región ha experimentado la alternancia de ciclos de prosperidad y decadencia. China, durante los dos últimos milenios, fue una de las economías más avanzadas del mundo.​​ Los historiadores Económicos suelen dividir la historia de China en tres periodos: el pre-imperial corresponde a la época de antes de la subida de la dinastía Qin; el imperial temprano desde Qin hasta la dinastía Song; y el imperial final,\\nde Song a la caída de la dinastía Qing.​"},{"page_url":"https://fr.wikipedia.org/wiki/Mus%C3%A9e_Autrefois","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Champ_-_Mus%C3%A9e_Autrefois_-_19.06.2014.JPG","page_title":"Musée Autrefois","context_page_description":"Le musée Autrefois est un musée situé à Champ-sur-Drac dans le sud de l'agglomération grenobloise, dans le département de l'Isère et la région Auvergne-Rhône-Alpes."},{"page_url":"https://pl.wikipedia.org/wiki/Saurer","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Saurer-Bus_Salzburg_Seitenansicht.JPG","page_title":"Saurer","context_page_description":"Saurer – dawne szwajcarskie przedsiębiorstwo produkujące autobusy, trolejbusy i samochody ciężarowe, które miało swoją siedzibę w mieście Arbon w Szwajcarii."},{"page_url":"https://sv.wikipedia.org/wiki/Moffans-et-Vacheresse","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/2016-04_-_Moffans-et-Vacheresse_-_02.JPG","page_title":"Moffans-et-Vacheresse","context_page_description":"Moffans-et-Vacheresse är en kommun i departementet Haute-Saône i regionen Bourgogne-Franche-Comté i östra Frankrike. Kommunen ligger i kantonen Lure-Sud som tillhör arrondissementet Lure. År 2009 hade Moffans-et-Vacheresse 625 invånare."},{"page_url":"https://fi.wikipedia.org/wiki/Kalkkik%C3%A4%C3%A4p%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Antrodia_crassa_kalkkik%C3%A4%C3%A4p%C3%A4_kritporing.jpg","page_title":"Kalkkikääpä","context_page_description":"Kalkkikääpä pohjoinen kääpälaji, joka on luokiteltu erittäin uhanalaiseksi.\\nKalkkikääpä kasvaa resupinaattisesti ja on monivuotinen. Itiöemä on noin kämmenen kokoinen ja yleensä ellipsin muotoinen. Tuoreena sen rakenne on hauraan juustomainen, pinta sileä ja väri kalkinvalkoinen, kuivuessaan se ei halkeile ja siitä tulee liitumaisen kova ja väri pysyy joko ennallaan tai hieman kellertyy. Tuoksu makean hedelmäinen ja hyvä, mutta maku kitkerä. Vanhoissa itiöemissä reuna vetäytyy ja muuttuu harmaaksi. Kalkkikääpä ei muodosta portaita tai pseudopileuksia kuten sitä muistuttava kalvaskääpä. Pillit säännöllisen pyöreitä ja niitä 6–7 millimetrillä.\\nKalkkikäävän vanhimmat tyviosat rappeutuvat murenevaksi valkeaksi massaksi, joten kääpä irtoaa helposti alustastaan. Isäntäpuuna kangasmetsissä kauan maassa maanneet männyt, joissa kalkkikääpä kasvaa lähellä maakosketusta. Ruskolahottaja."},{"page_url":"https://hu.wikipedia.org/wiki/Soros_port","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/BD-9.PNG","page_title":"Soros port","context_page_description":"Figyelem: ez a szócikk a hétköznapi PC-k és laptopok soros csatlakozójáról szól, nem keverendő az elektronikában és az iparban használatos RS232, RS422, RS485 alapú, az ipari alkalmazásokban igen népszerű soros adatátvitellel.\\nA soros port, ismertebb nevén COM-port vagy kommunikációs port egy soros adatátvitelű PC csatlakozó. Mára már elavult, régebben rengeteg különféle eszközt lehetett rá csatlakoztatni. Általában két darab volt egy számítógépben, nagyok sok modellnél csak az egyik port volt kivezetve, a másik egy alaplapi tüskesor volt, amire a felhasználó saját belátása szerint köthetett COM-port kivezetést, vagy infravörös vevőegységet. A port főképp alacsony sebessége és az USB portok térhódításának köszönhetően veszített népszerűségéből. A csatlakozó az RS-232 kommunikációs szabványt használja."},{"page_url":"https://es.wikipedia.org/wiki/Parque_de_los_Pr%C3%ADncipes_(Sevilla)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Jacarandas_en_el_Parque_de_los_Pr%C3%ADncipes_2.JPG","page_title":"Parque de los Príncipes (Sevilla)","context_page_description":"El parque de los Príncipes está ubicado en Sevilla. Se encuentra en la zona occidental del barrio de Los Remedios. Abrió en 1973."},{"page_url":"https://ro.wikipedia.org/wiki/P%C4%83s%C4%83rile_Republicii_Moldova","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/%C4%8Cajka_mal%C3%A1_%28Larus_minutus%29_a_%284834254958%29.jpg","page_title":"Păsările Republicii Moldova","context_page_description":"Avifauna Republicii Moldova include 343 specii de păsări, dintre care 314 specii cu prezență certă, 19 specii cu prezență incertă și 10 specii cu prezență dubioasă. După monografia lui Averin și Ganea în 2 volume avifauna Republicii Moldova conținea 285 de specii și subspecii de păsări, inclusiv 10 specii prezente cu câte două sau trei subspecii. După 1970 au fost semnalate specii noi de păsări în Republica Moldova. După monografia lui Andrei Munteanu și Nicolai Zubcov Atlasul păsărilor clocitoare din Republica Moldova, 2010, 173 specii sunt cuibăritoare, dintre care 127 specii migratoare și 46 specii sedentare. Koblik în 2014 menționează 332 de specii în Republica Moldova, dintre care 14 cu prezență dubioasă și 318 cu prezență certă. În lista păsărilor din Republica Moldova din 2018 a Avibase figurează 318 specii, în cea a eBird 230 specii, în cea a BirdLife International 237 specii, în cea a Universității de Stat din Moscova din 2018 figurează 317 specii. Vitalie Ajder menționează că în Republica Moldova până în 2014 au fost înregistrate 296 specii. Silvia Ursul în 2016 include în lista păsărilor din Moldova 279 specii."},{"page_url":"https://cy.wikipedia.org/wiki/John_Ingleby","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Anchoritage_in_St._John%27s_Church_yard%2C_Chester%3B_Remains_of_the_monastery_in_St_John%27s_Church_yard.%2C_1793.jpg","page_title":"John Ingleby","context_page_description":"Arlunydd topograffyddol a arbenigai mewn cynhyrchu golygfeydd bychain mewn dyfrlliw oedd John Ingleby. Brodor o Helygain, Sir y Fflint, ydoedd a chyhoeddwyd ei waith fel darluniau yng nghyfrolau Thomas Pennant. Bu farw yn 1808 yn ei fro enedigol a noda cofnodion y plwyf ei alwedigaeth fel 'limner'. Roedd 'limner' yn enw a roid ar grefftwyr oedd yn gweithio ar raddfa fechan, efallai ar ddarluniau miniatur, ac yn dynodi arlunydd-grefftwr oedd wedi sefydlu enw iddo'i hun.\\nGwelir crefft Ingleby ar ei orau yn ei drefluniau bychain lle mae ei allu i nodi manylion pitw wedi rhoi inni gofnodion unigryw a phwysig o fywyd trefol Gogledd Cymru. Nodweddir ei ddarluniau gan liwio gwastad mewn dyfrlliw ysgafn tryloyw."},{"page_url":"https://en.wikipedia.org/wiki/Dhamrai_Upazila","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Guti_Urea-Demo_plot.jpg","page_title":"Dhamrai Upazila","context_page_description":"Dhamrai is an Upazila of Dhaka District in the Division of Dhaka, Bangladesh."},{"page_url":"https://ms.wikipedia.org/wiki/China_(kawasan)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Pekingoper2.jpg","page_title":"China (kawasan)","context_page_description":"China atau Tionghua merujuk kepada beberapa negeri, negara dan budaya yang telah wujud selama kira-kira 3,500 tahun di Asia Timur. China yang wujud pada hari ini dikenalpasti wujud sebagai suatu tamadun, negeri atau negara mahupun beberapa tamadun, negeri atau negara yang berkecempung di tempat yang sama.\\nDengan kewujudannya sebagai salah suatu entiti yang paling lama wujud di permukaan dunia ini dan pengamalan salah satu daripada sistem tulisan paling lama di dunia. Sejarah China seringkali dicirikan sebagai satu yang dipenuhi nostalgia divisi dan penggabungan semula diantara masa-masa peperangan atau keamanan, dan pertukaran dinasti yang ganas. Keluasan kawasan negara ini berkembang daripada satu titik tolak punca di Kawasan Rata Utara China, dan keberkesanan/kelajuannya bergantung kepada nasibnya untuk menelan kawasan-kawasan timur, timur laut dan Asia Tengah. Selama beberapa abad lamanya, Empayar China juga merupakan antara tamadun yang termaju di dunia dan pusat pengaruh Asia timur dengan kesan kuat yang masih dirasai pada hari ini."},{"page_url":"https://sk.wikipedia.org/wiki/%C4%8Cesk%C3%A1_kuchy%C5%88a","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Vegetable_beef_barley_soup.jpg","page_title":"Česká kuchyňa","context_page_description":"Česká kuchyňa je spriaznená s nemeckou a rakúskou kuchyňou. Oproti talianskej kuchyni nie je natoľko zdravá a na trávenie dosť ťažká. Česká kuchyňa je veľmi výrazne ovplyvnená polohou Česka. Česko má bohatú ponuku poľných plodín, ovocia, zeleniny, bobulí, rýb aj zveriny. Podľa toho je tiež pestrý český jedálny lístok."},{"page_url":"https://et.wikipedia.org/wiki/J%C3%A4rvakandi_m%C3%B5is","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d8/Jarvakandi_Peetri_kirik_31.05.2008.jpg","page_title":"Järvakandi mõis","context_page_description":"Järvakandi mõis oli rüütlimõis Rapla kihelkonnas Harjumaal. Nüüdisajal jääb kunagine mõis Rapla valla Valli külla Rapla maakonnas."},{"page_url":"https://fr.wikipedia.org/wiki/Andr%C3%A9_Bouquet","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Andr%C3%A9_Bouquet.jpg","page_title":"André Bouquet","context_page_description":"André Bouquet est un peintre naïf français né le 19 septembre 1897 à Saint-Maur-des-Fossés et mort le 2 mai 1987 à Draveil."},{"page_url":"https://de.wikipedia.org/wiki/Charlotte_Niese","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Charlotte_Niese.jpg","page_title":"Charlotte Niese","context_page_description":"Charlotte Niese war eine deutsche Schriftstellerin, Heimatdichterin und Lehrerin."},{"page_url":"https://de.wikipedia.org/wiki/Franz-Sch%C3%BCtte-Allee","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/A_Million_Crocuses_%2863116711%29.jpeg","page_title":"Franz-Schütte-Allee","context_page_description":"Die Franz-Schütte-Allee ist eine wichtige Durchgangsstraße in Bremen, Stadtteil Oberneuland. Sie führt auch als Autobahnzubringer überwiegend in West-Ost-Richtung von der Richard-Boljahn-Allee in der Vahr und von der Bundesautobahn 27 bis zur Rockwinkeler Heerstraße in Oberneuland.\\nDie Querstraßen und Anschlussstraßen wurden benannt u. a. als Richard-Boljahn-Allee nach dem Politiker, Gewerkschafter als Bremer DGB-Vorsitzenden, Fraktionsvorsitzenden der SPD in der Bremischen Bürgerschaft und Aufsichtsratsvorsitzenden der Gewoba Richard Boljahn, Bundesautobahn 27, Louis-Leitz-Straße 1999 nach dem Unternehmer und Erfinder des Leitz-Ordners, unbenannter Weg, Rockwinkler Landstraße und Rockwinkeler Heerstraße nach dem Dorf Rockwinkel; ansonsten siehe beim Link zu den Straßen."},{"page_url":"https://gl.wikipedia.org/wiki/Ugly_Kid_Joe","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Ugly_Kid_Joe.jpg","page_title":"Ugly Kid Joe","context_page_description":"Ugly Kid Joe é unha banda estadounidense de hard rock procedente de Isla Vista, California. O seu nome é unha parodia do nome do grupo Pretty Boy Floyd. O son de Ugly Kid Joe abrangue un rango de estilos que pasa polo rock, o glam metal, o hard rock e o heavy metal.\\nDespois de editar tres álbum e de xirar extensamente durante os anos 90, Ugly Kid Joe separouse en 1997, e posteriormente reformouse no ano 2010."},{"page_url":"https://cs.wikipedia.org/wiki/Mistrovstv%C3%AD_Evropy_v_h%C3%A1zen%C3%A9_mu%C5%BE%C5%AF_2012","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Vrsac%2C_Centar_Milenjum.jpg","page_title":"Mistrovství Evropy v házené mužů 2012","context_page_description":"10. mistrovství Evropy v házené se konalo od 15. do 29. ledna 2012 v Srbsku.\\nMistrovství se zúčastnilo 16 mužstev, rozdělených do čtyř čtyřčlenných skupin, z nichž první tři týmy postoupily do dvou čtvrtfinálových skupin. První dva týmy z čtvrtfinálových skupin postoupily do semifinále, týmy na třetím místě hrály o páté místo.\\nFrancie jako obhájce titulu měla účast na letních olympijských hrách zajištěnu. Přímou účast na LOH 2012 si také vybojoval vítěz tohoto mistrovství Evropy. Pokud by zvítězila Francie, účast v Londýně si zajistí poražený finalista.\\nŠampionát byl zároveň poslední možností postoupit do jarní kvalifikace o postup na Olympijské hry 2012 v Londýně. Poslední dvě místa obsadily nejlépe umístěné týmy v konečném pořadí – v boji o postup se utkalo Polsko, Srbsko, Slovensko, Německo, Česko, Makedonie, Rusko, Norsko a Slovinsko. Jistou účast v kvalifikaci mělo Dánsko, Španělsko, Švédsko, Chorvatsko, Island a Maďarsko. Pokud by si některý z těchto 6 týmů vybojoval přímou účast na olympiádě, pak jej v kvalifikačním turnaji o postup na OH nahradí Polsko, které obsadilo na MS 2011 sedmé místo."},{"page_url":"https://de.wikipedia.org/wiki/Dipsea_Race","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Dipsea_Race_2013-04.jpg","page_title":"Dipsea Race","context_page_description":"Das Dipsea Race ist der älteste Traillauf und nach dem Boston-Marathon die zweitälteste Laufveranstaltung in den Vereinigten Staaten. Das Rennen wird – mit Unterbrechungen – seit 1905 ausgetragen und erstreckt sich über eine Länge von 7,44 Meilen. Es führt ab dem Stadtzentrum von Mill Valley hinauf zu den Hängen des Mount Tamalpais, weiter durch das Schutzgebiet Muir Woods National Monument und durch den Mount Tamalpais State Park nach Stinson Beach an der Küste des Pazifiks.\\nZu den Besonderheiten des Rennens gehört, dass insgesamt 1219 Höhenmeter überwunden werden müssen, wobei die ersten Streckenabschnitte über das für Mill Valley typische Labyrinth von Treppen und Pfaden am Fuße des Mount Tamalpais führen. Eine weitere Besonderheit ist, dass das Ziel über verschiedene, von den Läufern unter strategischen Gesichtspunkten ausgewählte Routen erreicht werden kann. Um eine Chancengleichheit der Läufer zu gewährleisten, wird in einem Handicap-System gestartet, bei dem Teilnehmer – gemäß ihrem Alter und Geschlecht – zu unterschiedlichen Startzeitpunkten ins Rennen gehen."},{"page_url":"https://fi.wikipedia.org/wiki/Rovaniemen_vaakuna","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Rovaniemi.vaakuna.svg","page_title":"Rovaniemen vaakuna","context_page_description":"Rovaniemen vaakuna on Rovaniemen kaupungin tunnus. Vaakuna on Toivo Vuorelan suunnittelema. Sen selitys on ”vihreässä kentässä hopeinen haaruristi, jonka ylähaarat salamakoroiset; saatteena yläkulmassa kultainen liekki”. Se on alun perin hyväksytty 15. elokuuta 1956 Rovaniemen maalaiskunnan kunnanvaltuustossa ja vahvistettu 26. lokakuuta Sisäasiainministeriössä Rovaniemen maalaiskunnan vaakunaksi. Kun Rovaniemen kaupunki ja maalaiskunta yhdistyivät 2006, vaakuna valittiin yhdistyneen kaupungin vaakunaksi. Aiheen haaruristi symboloi Kemi- ja Ounasjokien risteystä, ylähaarojen salamakorot viittaavat valjastettujen jokien sähköntuotantoon ja liekki kuvastaa muinoin jokien varsilla vihollisista varoittaneita merkkitulia, tottoja.\\nAlkuperäinen Rovaniemen kauppalalle 14. huhtikuuta 1930 tasavallan presidentti Lauri Kristian Relanderin asetuksella vahvistama vaakuna oli Väinö Tigerin suunnittelema. Vaakunan aiheen tunturi viittaa Ounasvaaraan ja revontulet pohjoiseen sijaintiin napapiirillä. Vaakunan selitys on ”kilpi, jossa on sinisellä pohjalla hopeinen tunturi, sen yläpuolella hopeinen goottilainen kirjain R ja ylimpänä revontulien säteistä muodostettu kruunu, sekin hopeinen.”"},{"page_url":"https://fr.wikipedia.org/wiki/Sigurd_Lewerentz","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Lew_lores.jpg","page_title":"Sigurd Lewerentz","context_page_description":"Sigurd Lewerentz fut un architecte moderne suédois, surtout connu pour son travail sur les églises et les cimetières."},{"page_url":"https://fr.wikipedia.org/wiki/L%27Islet_(municipalit%C3%A9_r%C3%A9gionale_de_comt%C3%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/St-Roch-des-Aulnaies.jpg","page_title":"L'Islet (municipalité régionale de comté)","context_page_description":"L'Islet est une municipalité régionale de comté dans la Côte-du-Sud de la région de Chaudière-Appalaches. Elle a été créée le 1ᵉʳ janvier 1982. Son préfet actuel est Jean-Pierre Dubé. Son chef-lieu est Saint-Jean-Port-Joli. Elle est composée de 14 municipalités.\\nLe recensement de 2016 y dénombre 17 798 habitants. Elle a une superficie de 2 099,58 km²."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1956","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Bruno_Giordano.jpg","page_title":"Lijst van personen geboren in 1956","context_page_description":"Dit is een lijst van personen die geboren zijn in 1956.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://fr.wikipedia.org/wiki/S%C3%A9gus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Menhir_de_S%C3%A9gus_%28Hautes-Pyr%C3%A9n%C3%A9es%29_1.jpg","page_title":"Ségus","context_page_description":"Ségus est une commune française située dans le département des Hautes-Pyrénées, en région Occitanie.\\nSes habitants sont appelés les Ségusiens."},{"page_url":"https://pl.wikipedia.org/wiki/Pozna%C5%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/WIG_Mapa_Operacyjna_Polski_-_53_Pozna%C5%84_1935_%28Pozna%C5%84%29.jpg","page_title":"Poznań","context_page_description":"Poznań – miasto na prawach powiatu w zachodniej Polsce, położone na Pojezierzu Wielkopolskim, nad rzeką Wartą, u ujścia Cybiny. Historyczna stolica Wielkopolski, od 1999 r. siedziba władz województwa wielkopolskiego i powiatu poznańskiego.\\nPiąte pod względem liczby ludności miasto w Polsce i szóste pod względem powierzchni. Poznań wraz z powiatem poznańskim i gminami Oborniki, Skoki, Szamotuły i Śrem tworzy aglomerację poznańską, zamieszkałą przez ponad 1,2 mln osób. W 2018 think tank Globalization and World Cities, badający wzajemne stosunki pomiędzy miastami świata w kontekście globalizacji, uznał Poznań za metropolię globalną. Poznań często plasuje się w czołówce miast o bardzo wysokiej jakości edukacji i bardzo wysokim standardzie życia. Zajmuje również wysokie miejsce pod względem bezpieczeństwa i jakości opieki zdrowotnej. Miasto Poznań wielokrotnie zdobyło także nagrodę „Superbrands” za markę miasta bardzo wysokiej jakości.\\nMiasto jest istotnym węzłem drogowym i kolejowym, funkcjonuje tu również międzynarodowy port lotniczy Poznań-Ławica. Poznań jest ośrodkiem przemysłu, handlu, logistyki i turystyki."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%96%E3%83%A9%E3%82%A4%E3%82%A2%E3%83%B3%E3%83%BB%E3%82%AB%E3%82%A6%E3%82%A8%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Brian_Cowen_on_Morning_Ireland.jpg","page_title":"ブライアン・カウエン","context_page_description":"ブライアン・カウエンは、アイルランドの政治家。フィアナ・フォイル - 共和党所属の国会議員、共和党党首、労働大臣、エネルギー大臣、運輸・エネルギー・通信大臣、保健・児童大臣、外務大臣、財務大臣、アイルランド副首相、アイルランド首相を努めた。"},{"page_url":"https://en.wikipedia.org/wiki/Bonnie,_Bonnie_Lassie","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Bonnie_Bonnie_Lassie_-_newspaper_ad_-_April_1920.jpg","page_title":"Bonnie, Bonnie Lassie","context_page_description":"Bonnie, Bonnie Lassie is a lost 1919 American comedy film directed by Tod Browning."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D1%82%D1%87_%D0%B2%D1%81%D0%B5%D1%85_%D0%B7%D0%B2%D1%91%D0%B7%D0%B4_%D0%9D%D0%A5%D0%9B_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Jonathan_Toews_-_Chicago_Blackhawks.jpg","page_title":"Матч всех звёзд НХЛ 2015","context_page_description":"60-й матч всех звёзд НХЛ состоялся 25 января 2015 года в городе Колумбус, штат Огайо на Нэшнуайд-арене, которая является домашней для клуба «Коламбус Блю Джекетс». Для Колумбуса это был первый матч всех звёзд НХЛ.\\nПланировалось что данный матч состоится 27 января 2013 года, однако он был отменён из-за локаута, а в сезоне 2013/2014 матч всех звёзд не проводился из-за участия игроков в хоккейном турнире на Олимпийских играх 2014.\\nВ матче Команда Тэйвза обыграла Команду Фолиньо со счётом 17—12, а самым полезным игроком матча стал Райан Джохансен из Команды Фолиньо."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%83%D9%88%D8%A8%D9%8A%D9%86%D9%87%D8%A7%D8%AC%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/K%C3%B8benhavns_byv%C3%A5ben_1894.png","page_title":"كوبينهاجين","context_page_description":"كوپينهاجين هى العاصمة واكبر مدينة فى الدنمارك. و كوبينهاجين مبنية على جزر زيلندا و Amager و بيفصلها مضيق Øresund من مالمو فى السويد.\\nفى مؤشر مراكز التجارة على الصعيد العالمى فى عام 2008، اللى نشرته ماستر كارد، كوپينهاجين جت فى المرتبة 14 فى العالم و المرتبة الاولى فى الدول الاسكندنافية.\\nاتوصفت مدينة كوپينهاجين بأنها \\"پاريس الشمال\\" بسبب تصميمها و جمالها.\\nو تعداد سكان مدينة كوپينهاجين 656582 فى بداية 2008."},{"page_url":"https://qu.wikipedia.org/wiki/San_Pablo_(San_Mart%C3%ADn)_distritu","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Location_of_the_province_Bella_Vista_in_San_Mart%C3%ADn.PNG","page_title":"San Pablo (San Martín) distritu","context_page_description":"San Pablo distritu; nisqaqa huk distritum Sumaq qhaway pruwinsyapi, Piruw mama llaqtapi."},{"page_url":"https://en.wikipedia.org/wiki/Listed_buildings_in_Tatenhill","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Entrance_Gates%2C_Rangemore_Hall.jpg","page_title":"Listed buildings in Tatenhill","context_page_description":"Tatenhill is a civil parish in the district of East Staffordshire, Staffordshire, England. It contains 29 buildings that are recorded in the National Heritage List for England. Of these, three are listed at Grade II*, the middle grade, and the others are at Grade II, the lowest grade. The parish contains the villages of Tatenhill and Rangemore, and is otherwise rural. The listed buildings include a country house and associated structures, houses and associated buildings, cottages, farmhouses and farm buildings, two churches and associated structures, a public house, two mileposts, and a school."},{"page_url":"https://de.wikipedia.org/wiki/Wirtschaft_Japans","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/JapanPreise.PNG","page_title":"Wirtschaft Japans","context_page_description":"Japan hat eine industrialisierte, freie Marktwirtschaft. Einige Elemente weisen immer noch auf Japans Vergangenheit als gelenkte Volkswirtschaft hin, in den letzten Jahren wurde allerdings zunehmend dereguliert und privatisiert, ein umstrittener Schritt wurde im Oktober 2007 mit der Privatisierung der Japanischen Post vollzogen."},{"page_url":"https://simple.wikipedia.org/wiki/Bunsh%C5%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d5/Kinpusenji_niomon2.jpg","page_title":"Bunshō","context_page_description":"Bunshō was a Japanese era name after Kanshō and before Ōnin. The period started in February 1466 and ended in March 1467. During this time, the emperor during this period was Go-Tsuchimikado-tennō."},{"page_url":"https://pl.wikipedia.org/wiki/Franz_Marc","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/FranzMarc.jpg","page_title":"Franz Marc","context_page_description":"Franz Marc – niemiecki malarz i współzałożyciel ugrupowania artystów-ekspresjonistów „Błękitny Jeździec”."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BC%D1%83%D1%80%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D1%85_%D1%84%D0%BE%D1%80%D1%82%D0%B5%D1%86%D1%8C_%D0%A0%D0%BE%D1%81%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Rostov_Kremlin_9674.jpg","page_title":"Список мурованих фортець Росії","context_page_description":"У цьому переліку наведено муровані твердині, що розташовані на теренах Росії — кам'яні фортеці, кремлі, замки, укріплені монастирі. Список побудовано за географічним принципом. У ньому наведено як збережені до нашого часу, так і втрачені споруди. Споруди, що вціліли більш або менш фрагментарно, позначено рожевим кольором. Об'єкти, що не збереглись повністю або не зберегли мурованих частин виділено сірим кольором. Для кожного об'єкта дається назва, місце розташування, дата спорудження мурів, примітки, фото."},{"page_url":"https://simple.wikipedia.org/wiki/Union_for_a_Popular_Movement","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Sarkozy-congres-ump.jpg","page_title":"Union for a Popular Movement","context_page_description":"The Union for a Popular Movement, was the main French centre-right political party. It was formed in 2002. On 30 May 2015, it was replaced by The Republicans.\\nThe party had an absolute majority in the National Assembly but lost its majority in the Senate in September 2011. The UMP is a member of the European People's Party, of the Christian Democrat International and of the International Democrat Union."},{"page_url":"https://es.wikipedia.org/wiki/Amandava_formosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Amandava_formosa.jpg","page_title":"Amandava formosa","context_page_description":"El bengalí verde ​ es una especie de ave paseriforme de la familia Estrildidae endémica del subcontinente indio. Se caracteriza por su cuerpo verdoso y amarillento, pico rojo brillante y «rayas de cebra» en los flancos. Anteriormente eran aves de jaula muy comunes. La denominación del género es una corrupción del nombre de la ciudad de Ahmedabad, la cual era el centro del comercio de aves en la India.​ Tienen una distribución restringida y las poblaciones están amenazadas por el comercio de aves."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D1%80%D0%B0%D0%B6%D0%B8%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%AE%D1%80%D1%96%D0%B9_%D0%86%D1%81%D0%B0%D0%BA%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/uk/f/ff/%D0%9C%D0%94_%D0%94%D1%80%D0%B0%D0%B6%D0%B8%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9.JPG","page_title":"Дражинський Юрій Ісакович","context_page_description":"Юрій Ісакович Дражинський — активний учасник революційної боротьби за встановлення Радянської влади в Криму в 1917—1920 роках, член Кримського підпільного комітету."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%BE%D1%83%D0%BF%D0%B2%D0%B5%D0%BB%D0%BB%D1%81%D0%BA%D0%B0%D1%8F_%D1%82%D1%80%D0%B0%D0%B4%D0%B8%D1%86%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Hand_Hopewell_mica.jpg","page_title":"Хоупвеллская традиция","context_page_description":"Хоупвеллская традиция или Традиция Хоупвелл — комплекс сходных индейских археологических культур, существовавших вдоль рек северо-восточной и центрально-восточной части будущих США в период 200 гг до н. э. — 500 гг. н. э. Хоупвеллская традиция состояла из раздробленных племён, связанных общей сетью торговых путей, известной как Хоупвеллская система обмена.\\nВ период своего расцвета Хоупвеллская система обмена распространялась с юго-востока современных США до юго-востока канадского побережья озера Онтарио. На этой территории процветала активная торговля и деятельность вдоль речных путей. Хоупвеллская система получала материалы со всей территории современных США. Среди предметов торговли большинство составляли экзотические материалы, в обмен на которые экспортировались продукты питания и местные изделия. Хоупвеллские изделия обнаружены далеко за пределами данной системы, в частности, во многих погребениях за пределами среднего Запада."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BD%D0%B8%D0%B3%D0%B0_%D1%86%D0%B2%D0%B5%D1%82%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Edward-Burne-Jones-Wake-Dearest.jpg","page_title":"Книга цветов","context_page_description":"Книга цветов — серия из 38 круглых акварелей английского художника Эдварда Бёрн-Джонса, создававшаяся с 1882 по 1898 год. На картинах не изображаются сами цветы, но они вдохновлены названиями цветов; сам художник охарактеризовал их как «серию иллюстраций к названиям цветов»; по словам супруги художника Джорджианы, на картинах не изображено ни одного цветка. Художник создавал эти акварели не по заказу, а для собственного удовольствия. В 1905 году Джорджиана Бёрн-Джонс издала ограниченный тираж факсимиле «Книги цветов»."},{"page_url":"https://nl.wikipedia.org/wiki/Vlag_van_La_Pampa","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Flag_of_La_Pampa_province.png","page_title":"Vlag van La Pampa","context_page_description":"De vlag van La Pampa is in gebruik sinds 1993 en toont drie horizontale banen in de kleuren van de Argentijnse vlag, met het wapen van La Pampa in het midden van de witte baan. De vlag werd ontworpen door Luis Alberto Galceran."},{"page_url":"https://vi.wikipedia.org/wiki/Savoia-Marchetti_SM.82","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Savoia_Marchetti_SM_82_Vigna_di_Valle.jpg","page_title":"Savoia-Marchetti SM.82","context_page_description":"Savoia-Marchetti SM.82 là một loại máy bay vận tải/ném bom của Ý trong Chiến tranh thế giới II. Khoảng 700 chiếc được chế tạo, đưa vào trang bị năm 1940, nó có thể hoạt động như một máy bay ném bom với tải trọng bom lên tới 8.818 lb, nhưng SM.82 được sử dụng rất ít làm máy bay ném bom."},{"page_url":"https://fr.wikipedia.org/wiki/Embl%C3%A8me_de_l%27Inde","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Lilium_candidum_1.jpg","page_title":"Emblème de l'Inde","context_page_description":"L'emblème de l'Inde est composé de trois lions sur un chapiteau orné d'une roue au centre, d'un buffle à droite et d'un cheval galopant à gauche."},{"page_url":"https://sv.wikipedia.org/wiki/St%C3%B6de_kyrka","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/St%C3%B6de_kyrka_interior_08.jpg","page_title":"Stöde kyrka","context_page_description":"Stöde kyrka är en kyrkobyggnad i Stöde. Den är församlingskyrka i Stöde församling i Härnösands stift."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD_%D0%90%D1%81%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/KonstantinTih.jpg","page_title":"Константин Асен","context_page_description":"Константѝн Тих – Асѐн е български цар, управлявал Второто българско царство от 1257 до 1277 година. След възкачването му в Търновград, Константин Тих сключва брак с Ирина, дъщеря на никейския император Теодор II Ласкарис и внучка на Иван Асен II. С това Константин придобива правото на фамилното име Асен и установява задължителната за времето си династична връзка и с династията Асеневци."},{"page_url":"https://sv.wikipedia.org/wiki/Marnay,_Haute-Sa%C3%B4ne","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/%C3%89glise_Saint-Symphorien_de_Marnay_-_ch%C5%93ur.jpg","page_title":"Marnay, Haute-Saône","context_page_description":"Marnay är en kommun i departementet Haute-Saône i regionen Bourgogne-Franche-Comté i östra Frankrike. Kommunen ligger i kantonen Marnay som tillhör arrondissementet Vesoul. År 2009 hade Marnay 1 398 invånare."},{"page_url":"https://fr.wikipedia.org/wiki/Gez","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Cimeti%C3%A8re_de_Gez_%28Hautes-Pyr%C3%A9n%C3%A9es%29_1.jpg","page_title":"Gez","context_page_description":"Gez est une commune française située dans le département des Hautes-Pyrénées, en région Occitanie.\\nSes habitants sont appelés les Gézois."},{"page_url":"https://es.wikipedia.org/wiki/Valdastillas","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Valdastillas_desde_El_Torno.JPG","page_title":"Valdastillas","context_page_description":"Valdastillas es un municipio de España, en la provincia de Cáceres, Comunidad Autónoma de Extremadura.\\nEstá ubicado en las estribaciones de la Sierra de Tormantos, en la comarca del Valle del Jerte.\\nTiene un área de 8,1 km², con una población de 334 habitantes y una densidad de 45,43 hab/km²."},{"page_url":"https://en.wikipedia.org/wiki/Bangalore_Fort","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/%27Square_at_Bangalore%27_and_on_reverse_%27The_Entrance_of_Tippoo%27s_Palace%2C_Bangalore_Feby._92%27.jpg","page_title":"Bangalore Fort","context_page_description":"Bangalore Fort began in 1537 as a mud fort. The builder was Kempe Gowda I, a vassal of the Vijaynagar Empire and the founder of Bangalore. Hyder Ali in 1761 replaced the mud fort with a stone fort and it was further improved by his son Tipu Sultan in the late 18th century. It was damaged during an Anglo-Mysore war in 1791. It still remains a good example of 18th-century military fortification. The army of the British East India Company, led by Lord Cornwallis on 21 March 1791 captured the fort in the siege of Bangalore during the Third Mysore War. At the time the fort was a stronghold for Tipu Sultan. Today, the fort's Delhi gate, on Krishnarajendra Road, and two bastions are the primary remains of the fort. A marble plaque commemorates the spot where the British breached fort's wall, leading to its capture. The old fort area also includes Tipu Sultan's Summer Palace, and his armoury. The fort has provided the setting for the treasure hunt in the book Riddle of the Seventh Stone."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BB%D1%96%D1%82%D0%B0%D0%BA%D1%96%D0%B2_%D0%94%D1%80%D1%83%D0%B3%D0%BE%D1%97_%D1%81%D0%B2%D1%96%D1%82%D0%BE%D0%B2%D0%BE%D1%97_%D0%B2%D1%96%D0%B9%D0%BD%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/A-38_Grizzly.jpg","page_title":"Список літаків Другої світової війни","context_page_description":"Список літаків Другої світової війни — список, який містить перелік усіх літальних апаратів, які використовувались країнами-учасницями Другої світової війни. В даний перелік також входять дрони, вертольоти, автожири та дирижаблі."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%BA%D0%B0_(%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D0%B8%D0%BB%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/SeAZ-11116-50.jpg","page_title":"Ока (автомобиль)","context_page_description":"«Ока» — советский и российский легковой автомобиль первой группы особо малого класса. Автомобиль был разработан на Волжском автомобильном заводе, выпускался на ВАЗе, ЗМА и СеАЗе в 1987—2008 годах. Выпущено 700 тысяч машин со всех заводов."},{"page_url":"https://es.wikipedia.org/wiki/Ciudad_de_Osma","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/El_Burgo_de_Osma_-_Ruinas_de_Uxama_-_8170433.jpg","page_title":"Ciudad de Osma","context_page_description":"La Ciudad de Osma es una localidad española de la provincia de Soria. Junto con el vecino Burgo de Osma forma el municipio de El Burgo de Osma-Ciudad de Osma, partido judicial de Burgo de Osma."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%97%90%EB%B0%80%EB%A6%AC%EC%98%A4_%EB%A7%88%EC%84%B8%EC%95%84%EC%B2%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Emilio_MacEachen.jpg","page_title":"에밀리오 마세아첸","context_page_description":"와싱그톤 에밀리오 마세아첸 바스케스는 우루과이 출신의 축구 선수이다. 현재 이탈리아 세리에 A의 파르마 FC에서 뛰고 있으며 포지션은 수비수이다."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Jean-Baptiste_de_Chaource","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Chaource_%2810%29_%C3%89glise_Saint-Jean-Baptiste_-_Int%C3%A9rieur_-_Statue_de_Saint-Jean-Baptiste.jpg","page_title":"Église Saint-Jean-Baptiste de Chaource","context_page_description":"L'église Saint-Jean-Baptiste est une église de rite catholique romain, de style gothique, située place de l'Église à Chaource, en France.L'édifice est classé au titre des monuments historiques en 1840."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%89%E0%A4%B7%E0%A5%8D%E0%A4%A3%E0%A5%8B%E0%A4%A4%E0%A5%8D%E0%A4%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Steam_Phase_eruption_of_Castle_geyser_with_double_rainbow.jpg","page_title":"उष्णोत्स","context_page_description":"उष्णोत्स एक प्रकार का पानी का चश्मा होता है जिसमें समय-समय पर पानी ज़ोरों से धरती से शक्तिशाली फव्वारे की भांति फूटता है और साथ में भाप निकलती है। यह पृथ्वी पर कम स्थानों में ही मिलते हैं क्योंकि इनके निर्माण के लिए विशेष भूतापीय व अन्य भूवैज्ञानिक परिस्थितियों की ज़रूरत होती है।"},{"page_url":"https://et.wikipedia.org/wiki/Alberto_Lovell","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Santiago_Lovell.jpg","page_title":"Alberto Lovell","context_page_description":"Santiago Alberto Lovell sen oli Argentina poksija.\\nLovell võitis raskekaalus 1932. aasta Los Angelese olümpiamängude poksivõistlustel kuldmedali ja tuli olümpiavõitjaks.\\nLovell poksis jaanuarist 1934 kuni juulini 1951 elukutselisena. Ta pidas kokku 88 kohtumist, millest võitis 76 ja kaotas 8 kohtumist ning 3 kohtumist jäi viiki. Ta on olnud elukutseliste Argentina ja Lõuna-Ameerika meister."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_pusat_perbelanjaan_di_Indonesia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Jepara_Shopping_Center.jpg","page_title":"Daftar pusat perbelanjaan di Indonesia","context_page_description":"Berikut adalah daftar pusat perbelanjaan di Indonesia."},{"page_url":"https://es.wikipedia.org/wiki/Golpe_de_Estado_en_Ir%C3%A1n_de_1953","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/1953_Iranian_coup_d%27%C3%A9tat.jpg","page_title":"Golpe de Estado en Irán de 1953","context_page_description":"El golpe de estado iraní de 1953, conocido en Irán como el golpe de estado 28 de Mordad, fue el derrocamiento del primer ministro elegido democráticamente, Mohammad Mosaddegh, en favor del fortalecido gobierno monárquico de Mohammad Reza Pahlavi el 19 de agosto de 1953, ​ orquestado por los Estados Unidos y el Reino Unido.​​​​ Fue la primera acción encubierta de los Estados Unidos para derrocar a un gobierno extranjero en tiempos de paz.​\\nMosaddegh había intentado auditar los documentos de la Anglo-Iranian Oil Company, una corporación británica y limitar el control de la compañía sobre las reservas de petróleo iraníes.​ Ante la negativa de la AIOC a cooperar con el gobierno iraní, el parlamento votó para nacionalizar la industria petrolera de Irán y expulsar a los representantes corporativos extranjeros del país.​​​ Después de esta votación, Gran Bretaña instigó un boicot mundial al petróleo iraní para presionar económicamente a Irán.​"},{"page_url":"https://de.wikipedia.org/wiki/Kloster_Marienthal_(Haguenau)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Hagenau-Marienthal-Notre-Dame-48-zur_Empore-2019-gje.jpg","page_title":"Kloster Marienthal (Haguenau)","context_page_description":"Das Kloster Marienthal geht auf eine 1240 durch Albert von Hagenau gegründete Einsiedelei zurück. Um 1250 kam eine Klosteranlage hinzu, die ersten Mönche gehörten dem im 13. Jahrhundert gegründeten Orden der Wilhelmiten an. Es liegt im zur französischen Stadt Haguenau gehörenden Teil des Ortes Marienthal, etwa 4 km in südöstlicher Richtung von dieser entfernt.\\nIm Jahr 1375 während des Hundertjährigen Krieges wurde die im Kloster verehrte Marienstatue zerstört und im Jahr 1420 durch eine vom Markgraf Bernhard von Baden gestiftete Madonna mit Kind ersetzt. Diese hölzerne Madonnenstatue und eine etwa zeitgleich entstandene, ebenfalls hölzerne Pietà wurden Wallfahrtsziele.\\nIm Jahr 1460 begann man mit einem Kirchenneubau, der 1520 abgeschlossen werden konnte und während der Bauernkriege im Jahr 1525 bis auf Teile des Chores und der Sakristei verwüstet wurde. Aus dieser Zeit sind zahlreiche, heute denkmalgeschützte nachgotische Skulpturen von Friedrich Hammer erhalten. Der seit dem Jahre 1520 im Amt befindliche Prior schloss sich der Reformation an und verkaufte das Kloster an die Stadt Haguenau."},{"page_url":"https://de.wikipedia.org/wiki/Oberahnesche_Felder","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/Jadebusen_1805-1814.png","page_title":"Oberahnesche Felder","context_page_description":"Die Oberahneschen Felder sind eine Gruppe untergegangener Marscheninseln im nordöstlichen Jadebusen südlich von Eckwarden. Sie sind nach dem Flussarm Ahne des ehemaligen Weserdeltas benannt; heute wird ein Priel des Jadebusens als Ahne bezeichnet.\\nIhr Namen bedeutet \\"unbedeichte Flächen jenseits der Ahne\\", ist also von Butjadingen aus betrachtet."},{"page_url":"https://ca.wikipedia.org/wiki/Cinc_nafres_de_Jesucrist","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e8/USA-San_Jose-Church_of_the_Five_Wounds-12.jpg","page_title":"Cinc nafres de Jesucrist","context_page_description":"Les Cinc nafres de Jesucrist és una expressió devocional que fa referència a les cinc ferides que va rebre Jesús a la seva crucifixió. Quan encara estava viu li van ser infligides les perforacions d'ambdues mans i peus practicades pels claus que el subjectaven a la creu; i una vegada mort i com a forma d'assegurar-se de la seva defunció, va rebre una ferida en el costat dret, practicada amb una llança que li va travessar el tòrax fins a arribar al cor.\\nLa devoció per les cinc nafres va ser iniciada per Sant Francesc d'Assís que, segons la tradició, quan estava en èxtasi va rebre directament del Crucificat aquests estigmes al seu propi cos. D'aquí que l'orde dels Frares Menors hagi estat una de les grans impulsores de la devoció, i que fins i tot faci servir com a emblemes propis diferents símbols que les representen:\\nL'escut de les cinc nafres: sobre camp d'or cinc nafres o ferides sagnants en sautor;\\nEl cordó franciscà de cinc nusos;\\nL'abraçada franciscana: envoltant una creu sumada a un núvol, dos braços creuats amb els palmells estesos mostrant sengles nafres; un dels braços apareix nu i l'altre vestint el saial franciscà."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9C%D7%99%D7%99%D7%9C%D7%A0%D7%93_15/20","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/1967_Leyland_15_Minibus_%288271086383%29.jpg","page_title":"ליילנד 15/20","context_page_description":"ליילנד 15/20 היא מכונית בתצורת מסחרית ובתצורת מיניבוס, אשר יוצרה בבריטניה על ידי יצרנית המכוניות הבריטית \\"British Motor Corporation\\" בין השנים 1958-1962, ובהמשך על ידי יצרנית המכוניות \\"ליילנד\\" הבריטית בין השנים 1962–1968.\\nדגם ה\\"ליילנד 15/20\\" יוצר בהודו על ידי חברת המכוניות ההודית \\"Standard Motor\\", בין השנים 1970–1980."},{"page_url":"https://en.wikipedia.org/wiki/William_Monroe_Trotter","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/WEB_Du_Bois.jpg","page_title":"William Monroe Trotter","context_page_description":"William Monroe Trotter, sometimes just Monroe Trotter, was a newspaper editor and real estate businessman based in Boston, Massachusetts, and an activist for African-American civil rights. He was an early opponent of the accommodationist race policies of Booker T. Washington, and in 1901 founded the Boston Guardian, an independent African-American newspaper he used to express that opposition. Active in protest movements for civil rights throughout the 1900s and 1910s, he also revealed some of the differences within the African-American community. He contributed to the formation of the National Association for the Advancement of Colored People.\\nTrotter was born into a well-to-do family and raised in Hyde Park, Massachusetts. He earned his graduate and post-graduate degrees at Harvard University, and was the first man of color to earn a Phi Beta Kappa key there. Seeing an increase in segregation in northern facilities, he began to engage in a life of activism, to which he devoted his assets. He joined with W. E. B. Du Bois in founding the Niagara Movement in 1905, a forerunner of the NAACP."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%9B%D0%BE%D0%BC%D0%BE%D0%BD%D0%BE%D1%81%D0%BE%D0%B2%D1%83_(%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0,_%D0%9C%D0%BE%D1%85%D0%BE%D0%B2%D0%B0%D1%8F_%D1%83%D0%BB%D0%B8%D1%86%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Shubin_Mikhail_Lomonosov.jpg","page_title":"Памятник Ломоносову (Москва, Моховая улица)","context_page_description":"Памятник М. В. Ломоносову на Моховой улице Москвы установлен рядом со зданием факультета журналистики Московского университета в районе Арбат. Нынешний памятник Ломоносову — третий по счёту из стоявших на этом месте."},{"page_url":"https://de.wikipedia.org/wiki/Liste_italienischer_Regimenter","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/CoA_mil_ITA_rgt_paracadutisti_185.png","page_title":"Liste italienischer Regimenter","context_page_description":"Diese Liste italienischer Regimenter ist nicht vollständig. Sie wird jedoch nach und nach verbessert."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%93%A5%E6%96%AF%E5%A4%A7%E9%BB%8E%E5%8A%A0%E9%83%A1%E7%B4%9A%E8%A1%8C%E6%94%BF%E5%8D%80%E5%88%97%E8%A1%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/86/Escudo_Cantonal_Upala.jpg","page_title":"哥斯大黎加郡級行政區列表","context_page_description":"哥斯大黎加郡級行政區列表列出哥斯大黎加共和國下轄的郡級行政區。哥斯大黎加全國共有7個省，下轄共82個郡，再下面則是區。郡級行政區是哥斯大黎加唯一以基層政權形式存在的地方政府，擁有民選的行政首長及民意代表，每四年選舉一次。\\n哥斯大黎加於1848年建立郡級行政區建制的時候共有14個郡，之後數量隨著最初的14個郡多次拆分而增加；自《4366號法令》於1969年8月頒布後，只有人口佔哥斯大黎加全國人口超過1%的地區才能建立新的郡級行政區，而最近成立的郡級行政區是里奧夸爾托德格雷西亞區，於2017年3月成立。\\n目前哥斯大黎加最大和最小的郡級行政區分別為阿拉胡埃拉省的聖卡洛斯郡和埃雷迪亞省的弗洛雷斯郡，面積分別為3,348.98平方公里和6.96平方公里；人口數最多和最少的郡級行政區則分別為聖荷西省的聖荷西郡和圖魯巴雷斯郡，人口數分別為288,054人和5,512人。"},{"page_url":"https://pl.wikipedia.org/wiki/Christopher_Coyne","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Most_Rev_Christopher_Coyne.jpg","page_title":"Christopher Coyne","context_page_description":"Christopher James Coyne – amerykański duchowny katolicki, biskup diecezjalny Burlington od 2014.\\nJest jednym z siódemki rodzeństwa. Święcenia kapłańskie otrzymał 7 czerwca 1986 roku z rąk kardynała Bernarda Law. Podjął dalsze studia w St. John’s Seminary w Brighton, a także w Rzymie w Pontyfikalnym Instytucie Liturgicznym, gdzie uzyskał doktorat z liturgiki. Jako wykładowca liturgiki i homiletyki pracował na swej alma mater w Brighton. Oprócz tego był dyrektorem Wydziału ds. Kultu Bożego, a także Biura ds. Komunikacji i rzecznikiem prasowym archidiecezji Boston. Przez cztery lata sprawował też funkcję proboszcza parafii w Westwood.\\n14 stycznia 2011 otrzymał nominację na pomocniczego biskupa Indianapolis ze stolicą tytularną Mopta. Sakry udzielił mu abp Daniel Buechlein OSB, metropolita Indianapolis. Z powodu coraz słabszego stanu zdrowia zwierzchnika archidiecezji przejął on wkrótce większość obowiązków, szczególnie szafowanie sakramentami i inne funkcje reprezentacyjne i liturgiczne. 21 września 2011 papież oficjalnie przyjął rezygnację abpa Buechleina z powodu stanu zdrowia. Od tego dnia, aż do wyboru jego następcy, Benedykt XVI powierzył bp."},{"page_url":"https://en.wikipedia.org/wiki/PS_Eliza_Anderson","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Eliza_Anderson_at_pier.jpg","page_title":"PS Eliza Anderson","context_page_description":"The PS Eliza Anderson operated from 1858 to 1898 mainly on Puget Sound, the Strait of Georgia, and the Fraser River but also for short periods in Alaska. She was generally known as the Old Anderson and was considered slow and underpowered even for the time. Even so, it was said of her that \\"no steamboat ever went slower and made money faster.\\" She played a role in the Underground Railroad and had a desperate last voyage to Alaska as part of the Klondike Gold Rush."},{"page_url":"https://de.wikipedia.org/wiki/Berra_(Berg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Schweiz_Berra.jpg","page_title":"Berra (Berg)","context_page_description":"Die Berra, auch in der Deutschschweiz oft als La Berra bezeichnet, ist ein 1719 m hoher Berggipfel in den Freiburger Voralpen in der Schweiz, rund 15 km südlich der Stadt Freiburg."},{"page_url":"https://zh.wikipedia.org/wiki/Whiting%E5%8F%8D%E5%BA%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/WhitingReactionGeneral.png","page_title":"Whiting反应","context_page_description":"Whiting反应\\n丁炔二醇类用氢化铝锂处理时转变为相应的二烯烃。"},{"page_url":"https://sv.wikipedia.org/wiki/Pelina_nitens","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Pelina.nitens.-.lindsey.jpg","page_title":"Pelina nitens","context_page_description":"Pelina nitens är en tvåvingeart som beskrevs av Friedrich Hermann Loew 1873. Pelina nitens ingår i släktet Pelina och familjen vattenflugor. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://cs.wikipedia.org/wiki/Paolo_Monti","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Paolo_Monti_-_Serie_fotografica_%28Italia%2C_1954%29_-_BEIC_6340859.jpg","page_title":"Paolo Monti","context_page_description":"Paolo Monti byl italský fotograf, považovaný za jednoho z největších v Itálii. Je známý svou fotografií architektury.\\nV počátcích své tvorby experimentoval s abstrakcionismem a s účinky rozmazání a difrakce. V roce 1953 se stal profesionálním fotografem. Pracoval hlavně s fotografiemi architektury, které byly jako ilustrace používány v časopisech a knihách. Od roku 1966 Monti katalogizoval historická centra italských měst."},{"page_url":"https://en.wikipedia.org/wiki/HMS_Hythe_(J194)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/HMS_Hythe.jpg","page_title":"HMS Hythe (J194)","context_page_description":"HMS Hythe was a Bangor-class minesweeper built for the Royal Navy during the Second World War."},{"page_url":"https://gl.wikipedia.org/wiki/China_Central_Television","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Chromatic_Television_Center%2C_CCTV%2C_Beijing.jpg","page_title":"China Central Television","context_page_description":"China Central Television é unha cadea de televisión chinesa de titularidade pública administrada pola State Administration of Radio, Film, and Television e que abrangue 19 canles."},{"page_url":"https://mg.wikipedia.org/wiki/Champhai","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Champhai%2C_Mizoram%2C_from_south%2C_with_Zotlang_in_the_foreground.jpg","page_title":"Champhai","context_page_description":"\uFEFF23.3°N 92.83°E\\nI Champhai dia tanàna ao amin'ny faritanin'i Mizoram, ao India. Ny kaodim-paositra dia 796321."},{"page_url":"https://vi.wikipedia.org/wiki/Conus_acutangulus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Conus_acutangulus_1.jpg","page_title":"Conus acutangulus","context_page_description":"Conus acutangulus là một loài ốc biển, là động vật thân mềm chân bụng sống ở biển trong họ Conidae, họ ốc cối.\\nGiống như tất cả các loài thuộc chi Conus, chúng là loài săn mồi và có nọc độc. Chúng có khả năng \\"đốt\\" con người, do vậy khi cầm chúng phải hết sức cẩn thận."},{"page_url":"https://pt.wikipedia.org/wiki/Sam_Bush","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Sam_Bush_%282006%29.jpg","page_title":"Sam Bush","context_page_description":"Sam Bush é um bandolinista e violinista de bluegrass americano considerado o originador do estilo Newgrass."},{"page_url":"https://eu.wikipedia.org/wiki/Hospizio","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/St._Christopher%27s_Hospice.jpg","page_title":"Hospizio","context_page_description":"Hospizioa medikuntza paliatiboak eskaintzen duen baliabide bat da, gaur egun bereziki herrialde anglofonoetan zabalduta dagoena. Historikoki, kontzeptua aldatzen joan da XI. mendetik: hasieran babesetxe moduan funtzionatzen zuten gaixo, zauritu eta hiltzear zeudenentzat, baina baita bidaiari eta erromesentzat ere. Kontzeptu modernoa ordea zainketa aringarriak edo paliatiboak barne hartzen ditu, hala ospitale berezi edo bestelako zentroetan nola gaixoen etxeetan ere, XVII. mendetik aurrera baina batik bat 1950eko hamarkadan garatu da Cicely Saundersen eskutik, Erresuma Batuan, Ameriketako Estatu Batuetan, Kanadan eta Australian baina baita munduko beste herrialde batzuetan ere.\\nSaint Christopher Hospizioa erreferentziazko zentroa Londresen zabaldu zuten 1967an."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D1%8D%D1%82%D0%B5%D1%81%D1%81%D1%8B_%D0%A1%D0%B5%D1%80%D0%B5%D0%B1%D1%80%D1%8F%D0%BD%D0%BE%D0%B3%D0%BE_%D0%B2%D0%B5%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Isabella_Grinevskaya.jpg","page_title":"Поэтессы Серебряного века","context_page_description":"Поэтессы Серебряного века\\nПоэтесс, публиковавших свои стихи с конца XIX века до 1920-х, много. О многих поэтессах совершенно отсутствуют биографические сведения: «Это и Наталия Бернар, которую с удовольствием цитировал Крученых, и Елена Шварцбах-Молчанова, издававшаяся под псевдонимом Графиня Мария, и Лидия Кологривова, от которой в архивах осталась только переписка с начальником её мужа, А. В. Половцевым, и многие другие».\\n«Расцвет женской поэзии в начале века был синхронен тому слишком хорошо известному процессу, который назван борьбой женщин за равноправие во всех областях жизни. С 1900-х годов женщины рекрутируются не только поэзией, но и различными женскими организациями нового типа, от Лиги равноправия женщин до Женской прогрессивной партии. Феминизм, родившийся ещё в XVIII веке, пришел в Россию вместе с такими словами, как „эмансипэ“, суфражизм, „женщина-танго“, и проявлялся в диспутах и докладах на женскую тему, вроде „Вершины и бездны женской души“, „Бог женщины и мировое зло“, а также в многочисленных газетных и журнальных публикациях."},{"page_url":"https://de.wikipedia.org/wiki/Erminio_De_Scalzi","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Erminio_De_Scalzi_01.jpg","page_title":"Erminio De Scalzi","context_page_description":"Erminio De Scalzi ist ein italienischer römisch-katholischer Geistlicher und emeritierter Weihbischof in Mailand."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%84%D9%88%D8%B1%D9%8A%D9%86_%D8%B3%D8%A7%D9%86%D8%B4%D9%8A%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Lauren_Sanchez_adjusted.jpg","page_title":"لورين سانشيز","context_page_description":"لورين سانشيز صحفيه من امريكا."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B8%D0%BF%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%8F_%D1%84%D0%BE%D1%80%D0%BC_%D0%B4%D1%80%D0%B5%D0%B2%D0%BD%D0%B5%D0%B3%D1%80%D0%B5%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D1%85_%D1%81%D0%BE%D1%81%D1%83%D0%B4%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Attic_red-figure_Epinetron_Antikensammlung_Berlin_1.jpg","page_title":"Типология форм древнегреческих сосудов","context_page_description":"Типология форм древнегреческих сосудов представляет большое разнообразие. Форма древнегреческих сосудов соответствовала прикладному назначению и менялась почти до бесконечности, в зависимости от места и времени производства и личного вкуса производителя. Тем не менее некоторые формы были особенно распространёнными и любимыми и составляли особые разряды, имевшие каждый своё особое наименование. Античные писатели сохранили номенклатуру греческих сосудов, однако показания этих авторов столь неопределённые и путаные, что, основываясь на них и проверяя их по сохранившимся экземплярам, нельзя было прояснить многие детали. Несмотря на все это, благодаря трудам Панофки и работам других исследователей, названия большинства форм определены окончательно."},{"page_url":"https://fr.wikipedia.org/wiki/R%C3%A9seau_de_bus_RATP","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/RATP395_AntonyRER.JPG","page_title":"Réseau de bus RATP","context_page_description":"Le réseau de bus RATP couvre l'ensemble du territoire de la ville de Paris et la partie centrale de l'unité urbaine de Paris. Il constitue un réseau dense de transports en commun complémentaire des réseaux ferrés, organisé et financé par Île-de-France Mobilités.\\nLes lignes de bus de Paris et de la proche banlieue sont exploitées pour l'essentiel par la Régie autonome des transports parisiens. Un premier réseau apparaît dès 1662 avec les carrosses à cinq sols expérimentés par Blaise Pascal. Mais ce n'est qu'en 1828 que des lignes régulières d'omnibus refont leur apparition et rencontrent un vif succès. Les premiers autobus sont mis en service en 1906 et remplacent rapidement les omnibus hippomobiles, qui disparaissent en 1913. Après une phase de déclin après la Seconde Guerre mondiale consécutive au développement des transports individuels, le trafic est en augmentation continue depuis les années 1970.\\nEn 2010, le réseau RATP est constitué de 353 lignes totalisant 3 890 km et transporte plus d'un milliard de voyageurs par an."},{"page_url":"https://en.wikipedia.org/wiki/Trixie%27s_Big_Red_Motorbike","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Wally%27s_Dog_Fanzine.jpg","page_title":"Trixie's Big Red Motorbike","context_page_description":"Trixie's Big Red Motorbike are an indie pop band formed on the Isle of Wight, United Kingdom, in 1981. They released two singles, one EP and one flexidisc. A vinyl compilation album of their music was released by Accident Records in 1995. A retrospective album was released on Lobby Lud Records in February 2012."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%96%D1%83%D0%BA-%D0%BE%D0%BB%D0%B5%D0%BD%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Hirschkaefer_angefressen.JPG","page_title":"Жук-олень","context_page_description":"Жук-олень — крупный жук из рода Lucanus в составе семейства рогачей. Является самым крупным жуком, обитающим на территории Европы: отдельные особи самцов номинативного подвида могут достигать длины до 86—91 мм при средней длине самцов 70—74 мм. Также является вторым по величине жуком, обитающим на территории России.\\nЖук-олень встречается в дубравах и широколиственных лесах с примесью дуба в Европе, Передней Азии, Турции, Иране и Северной Африке. Самцы отличаются хорошо развитыми и увеличенными мандибулами, которые превращены в т. н. «рога». Личинки развиваются в древесине мёртвых лиственных деревьев, преимущественно в древесине дуба, на протяжении 4—6 лет.\\nЖуки-олени встречаются преимущественно редко и локально. Ареал вида сокращается, в связи с чем он занесён в охранные документы и Красные книги многих стран Европы, включая Украину, Российскую Федерацию, Казахстан и Белоруссию, также с 1982 года жук-олень занесён во второе приложение Бернской конвенции. Основными причинами сокращения популяции жука-оленя являются массовые вырубки лесов, санитарные «чистки» лесных угодий, неконтролируемый сбор жуков коллекционерами и случайными лицами."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%85%90%E5%B3%B6%E7%9C%9F%E7%90%86%E5%A5%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Marina_Kojima_on_Ichiban_Japan_stage_20190804c.jpg","page_title":"児島真理奈","context_page_description":"児島 真理奈は、日本のアイドルで、女性アイドルグループミライスカートの研修生、グループのリーダーを務める。愛称は「まりちゃん」。京都府出身。キャレスボーカル&ダンススクールアーティストコース出身。ミライスカート加入前は、ハチハチ北Girlsのセンターとして活動。"},{"page_url":"https://en.wikipedia.org/wiki/1970_United_States_Senate_election_in_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Independent_Alliance_Party_emblem.png","page_title":"1970 United States Senate election in New York","context_page_description":"The 1970 United States Senate election in New York was held on November 3, 1970, to elect New York's Class I Senator in its delegation. Representative Charles Goodell had been appointed by Governor Nelson Rockefeller to serve the remainder of Robert F. Kennedy's senatorial term following Kennedy's assassination.\\nGoodell attempted to win election to a full term in the Senate with the Republican and Liberal nominations, but faced opposition from Democratic nominee Richard Ottinger and Conservative nominee James L. Buckley. Buckley was able to win with a plurality of the popular vote due to the left-wing vote being split between Ottinger and Goodell.\\nBuckley would serve in the Senate until his reelection bid was defeated by Daniel Patrick Moynihan in 1976. Buckley's victory in the 1970 election would remain the last time a third party candidate won election to the Senate until Connecticut Senator Joe Lieberman won reelection with the Connecticut for Lieberman nomination in 2006."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Cornell_University_buildings","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Rockefeller_Hall_at_Cornell_University_%28cropped%29.jpg","page_title":"List of Cornell University buildings","context_page_description":"A list of buildings, existing or demolished, owned by or closely associated with Cornell University in Ithaca, New York. Several buildings were on the National Register of Historic Places, including Bailey Hall, Caldwell Hall, Computing and Communications Center, East Roberts Hall, Fernow Hall, Morrill Hall, Rice Hall, Roberts Hall, and Stone Hall. Also Telluride House, Deke House, and Llenroc.\\nArchitects who are Cornell alumni are listed with their class year."},{"page_url":"https://ro.wikipedia.org/wiki/Protestele_anticorup%C8%9Bie_din_Rom%C3%A2nia_din_2017%E2%80%932019","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Rezist.jpg","page_title":"Protestele anticorupție din România din 2017–2019","context_page_description":"În ianuarie 2017, la două săptămâni după învestirea guvernului PSD–ALDE condus de Sorin Grindeanu, au început în România o serie de proteste de stradă față de intențiile guvernului de a modifica legea grațierii și de a amenda Codul penal. În prima zi, în 18 ianuarie, au manifestat în jur de 5.000 de oameni, din care aproape 4.000 în București.\\nÎn următoarele zile protestele au luat amploare în toată România și în diaspora, mai ales după ce ministrul de Justiție, Florin Iordache, a anunțat prin mass-media, în jurul orei 24 din noaptea de 31 ianuarie, publicarea de către guvern în Monitorul Oficial a ordonanțelor privind grațierea unor fapte de corupție și modificarea Codului penal prin dezincriminarea abuzului în serviciu. Protestele au atins apogeul în seara de duminică, 5 februarie, când peste 600.000 de manifestanți au protestat în toată țara, în ciuda faptului că în aceeași zi, guvernul anunțase abrogarea OUG 13. Protestele au devenit cunoscute, neoficial, și sub numele de Tineriada sau protestele #rezist, hashtag devenit simbolul mișcărilor de protest. Protestele s-au bucurat și de susținerea unor personalități autohtone."},{"page_url":"https://de.wikipedia.org/wiki/Digitalradio","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Digital_Radio_Logo.svg","page_title":"Digitalradio","context_page_description":"Unter Digitalradio versteht man die Übertragung von Hörfunkprogrammen mit digitalen Sendeverfahren. In den kommenden Jahren sollen analoge Verfahren weitgehend durch digitale ersetzt werden. Prinzipiell könnte Digitalradio deutlich mehr Programme, störungsfreien Empfang und eine verbesserte Wiedergabequalität ermöglichen.\\nDie Bezeichnung „Digital Radio“ ist seit 2001, zusammen mit einem Logo, für den technischen Standard Digital Audio Broadcasting eingetragen. Die Bezeichnungen „DAB“ und „Digital Radio“ werden in Deutschland und der Schweiz oft synonym verwendet. Sie werden aber je nach Land in der Praxis etwas unterschiedlich benutzt. In diesem Artikel geht es jedoch allgemeiner um verschiedene Arten des digitalen Hörfunks, zu dem unter anderem auch DAB gehört.\\nDie EU-Kommission schlug vor, den analogen Rundfunk bis spätestens 2012 abzuschalten. Deutschland hatte zunächst geplant, bis 2010 den analogen Rundfunk abzuschalten. Dabei sollten alle Sender zum selben Zeitpunkt die analoge Frequenzmodulation im UKW-Band durch DAB ersetzen. Dieser Zeitpunkt ist verstrichen, ein neuer Termin ist noch nicht festgelegt."},{"page_url":"https://sv.wikipedia.org/wiki/Gargaphia_solani","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Gargaphia_solani_%28cropped%29.jpg","page_title":"Gargaphia solani","context_page_description":"Gargaphia solani är en insektsart som beskrevs av Heidemann 1914. Gargaphia solani ingår i släktet Gargaphia och familjen nätskinnbaggar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://it.wikipedia.org/wiki/Dackscheid","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Wappen_Dackscheid.png","page_title":"Dackscheid","context_page_description":"Dackscheid è un comune di 150 abitanti della Renania-Palatinato, in Germania.\\nAppartiene al circondario dell'Eifelkreis Bitburg-Prüm ed è parte della comunità amministrativa di Arzfeld."},{"page_url":"https://pl.wikipedia.org/wiki/Barwy_jednostek_Polskich_Si%C5%82_Zbrojnych","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Otok_%C5%BC%C3%B3%C5%82ty.png","page_title":"Barwy jednostek Polskich Sił Zbrojnych","context_page_description":"Barwy jednostek Polskich Sił Zbrojnych - opis bagnetów i proporczyków jednostek Polskich Sił Zbrojnych."},{"page_url":"https://ceb.wikipedia.org/wiki/Stefansson_Island_(pulo_sa_Nunavut)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/Stefansson_Island.png","page_title":"Stefansson Island (pulo sa Nunavut)","context_page_description":"Pulo ang Stefansson Island sa Kanada. Nahimutang ni sa lalawigan sa Nunavut, sa amihanang bahin sa nasod, 3,500 km sa amihanan-kasadpan sa Ottawa ang ulohan sa nasod. Naglangkob kin og 4.0 ka kilometro kwadrado. Hapit nalukop sa hyelo ang palibot sa Stefansson Island.\\nAng klima tundra. Ang kasarangang giiniton -16 °C. Ang kinainitan nga bulan Hulyo, sa 3 °C, ug ang kinabugnawan Nobiyembre, sa -24 °C."},{"page_url":"https://cs.wikipedia.org/wiki/Edgars_Masa%C4%BCskis","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Edgars_Masalskis_Latvia_2015.jpg","page_title":"Edgars Masaļskis","context_page_description":"Edgars Masaļskis je lotyšský lední hokejista, brankář s levým držením hole. Čtyřikrát reprezentoval Lotyšsko na zimních olympijských hrách a patnáctkrát na mistrovstvích světa. Je hráčem ruského klubu Lada Toljatti působícího v KHL."},{"page_url":"https://hu.wikipedia.org/wiki/Stomiopera","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Lichenostromus_falvus.jpg","page_title":"Stomiopera","context_page_description":"A Stomiopera a madarak osztályának a verébalakúak rendjébe, ezen belül a mézevőfélék családjába tartozó nem. Besorolásuk vitatott, egyes szervezetek a Lichenostomus nembe sorolják ezeket a fajokat is."},{"page_url":"https://en.wikipedia.org/wiki/Manizales","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7c/Estadio_Palogrande_CRC_-_ESP_2011.jpg","page_title":"Manizales","context_page_description":"Manizales is a city and municipality in central Colombia. It is the capital of the Department of Caldas, and lies near the Nevado del Ruiz volcano.\\nCurrently, the city is the main center for the production of Colombian coffee and an important hub for higher educational institutions."},{"page_url":"https://sv.wikipedia.org/wiki/Ambulansflyg","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Eurocopter_EC-135_T1_SAMU_Lorraine_%284155360502%29.jpg","page_title":"Ambulansflyg","context_page_description":"Ambulansflyg är transporter av skadade och sjuka med en luftfarkost.\\nFör primärtransporter, till sjukhus från olycksplats eller hemmet eller annan plats där vårdbehövande finns, används normalt helikoptrar av olika storleksklass. För sekundärtransporter, det vill säga transporter av patienter som redan har kommit under vård och är medicinskt stabiliserade, i regel mellan sjukhus, används antingen helikopter eller ambulansflygplan beroende på transportavstånd, transporttider och andra omständigheter.\\nFör stora transportbehov, eller transport över långa avstånd, av svårt skadade vid till exempel krigshändelser, terroristdåd eller andra katastrofer, används specialiserade stora transportflygplan eller konverterade passagerarflygplan med intensivvårdskapacitet för flera patienter.\\nAnvändning av flygande ambulanser utvecklades först inom militärväsendet. Inom detta, och ibland också civilt, används begreppet Medevac, vilket som militärt begrepp omfattar avtransport av sårade med alla slags specialiserade sjuktransportfordon."},{"page_url":"https://es.wikipedia.org/wiki/Viena","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Albertina1.JPG","page_title":"Viena","context_page_description":"Viena es una ciudad austriaca situada a orillas del Danubio, en el valle de los Bosques de Viena, al pie de las primeras estribaciones de los Alpes. Es la capital del país y uno de sus nueve estados federados.\\nEstá rodeada por el Estado federado de Baja Austria. Viena es la mayor ciudad, centro cultural. Además es la segunda ciudad más poblada de Europa Central y la sexta ciudad en población de la Unión Europea. Su población supera el 1 800 000 de habitantes y su área metropolitana cuenta con 2,4 millones, población similar a la que tenía la ciudad en 1914. El idioma oficial es el alemán austríaco estándar; se habla también el alemán vienés, un dialecto bávaro.\\nLa ciudad tiene una larga historia, ya que es una de las más antiguas capitales de Europa, por lo que cuenta con un importante patrimonio artístico. Durante el siglo XIX fue una de las grandes capitales musicales del mundo y a principios del siglo XX meca de la filosofía y el debate político de Occidente, así como uno de los principales centros culturales mundiales."},{"page_url":"https://en.wikipedia.org/wiki/946_eruption_of_Paektu_Mountain","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Millenium-Eruption-map.jpg","page_title":"946 eruption of Paektu Mountain","context_page_description":"The 946 eruption of Paektu Mountain in Korea and China, also known as the Millennium Eruption or Tianchi eruption, was one of the most powerful volcanic eruptions in recorded history and is classified as a VEI 7 event. The eruption resulted in a brief period of significant climate change in Manchuria. The year of the eruption has not been precisely determined, but a possible year is A.D. 946.\\nThe eruption ejected about 100–120 cubic kilometers of tephra and collapsed the mountain into a caldera, which now contains the crater lake Heaven Lake. The eruption began with a strong Plinian column, and ended with voluminous pyroclastic flows. An average of 5 cm of Plinian ashfall and coignimbrite ashfall covered about 1,500,000 km² of the Sea of Japan and northern Japan. This ash layer has been named the \\"Baegdusan-Tomakomai ash\\". It probably occurred in winter in late A.D. 946. This was one of the largest and most violent eruptions in the last 5000 years, along with the Hatepe eruption of Lake Taupo, the 1257 eruption of Mount Samalas near Mount Rinjani, and the 1815 eruption of Mount Tambora."},{"page_url":"https://en.wikipedia.org/wiki/Diospyros_mespiliformis","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Diospyros_mespiliformis%2C_blare%2C_Jan_Celliers_Park.jpg","page_title":"Diospyros mespiliformis","context_page_description":"Diospyros mespiliformis, the jackalberry, is a large dioecious evergreen tree found mostly in the savannas of Africa. Jackals are fond of the fruit, hence the common names. It is a member of the family Ebenaceae, and is related to the true ebony and edible persimmon."},{"page_url":"https://no.wikipedia.org/wiki/Thomas_Allom","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Bourges_cathedral_c1840.jpg","page_title":"Thomas Allom","context_page_description":"Thomas Allom var en britisk arkitekt, kunstner og illustratør av geografiske skildringer. Han var blant grunnleggerne av det som senere ble Royal Institute of British Architects. Han tegnet mange bygninger i London, som St Peters kirke i Notting Hill og deler av herskapshusene Ladbroke Estate i Notting Hill. Sammen med Charles Barry sto han for mange staselige bygg, hvor Houses of Parliament er mest velkjent.\\nSom illustratør er han mest kjent for Constantinople and the Scenery of the Seven Churches of Asia Minor, utgitt i 1838, og China Illustrated, fra 1845.\\nHan var lærling hos arkitekten Francis Goodwin fra 1819 til 1826, og studerte deretter ved Royal Academy, hvor spesielt kirkedesignen vekket interesse. Han fikk så oppdrag som Church of Christ i Highbury i 1850, St Peters kirke i Notting Hill i 1856, samt flere andre både i og utenfor London."},{"page_url":"https://es.wikipedia.org/wiki/Estadio_Presidente_Per%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Avellaneda_Futbol_-_aerial_%28cropped%29.jpg","page_title":"Estadio Presidente Perón","context_page_description":"El Estadio Presidente Perón, conocido popularmente como El Cilindro de Avellaneda, o el Coliseo, es un estadio de fútbol ubicado en la Ciudad de Avellaneda, Argentina. Es propiedad de Racing Club y está situado sobre los pasajes Mozart y Corbatta, siendo lindante con las calles Colón y Diego A. Milito.\\nFue diseñado por ingenieros alemanes, algunos de ellos con experiencia en la obra de reconstrucción de ciudades destruidas durante la Segunda Guerra Mundial.​\\nEste estadio cuenta con uno de los récord de espectadores, ya que en el partido de vuelta por la final de la Copa Intercontinental 1967 asistieron más de 120 000 personas. Fue el primer estadio de Argentina en tener la totalidad de las plateas techadas, luego de las reformas hechas en la década de 1990 en el sistema de iluminación.​"},{"page_url":"https://cs.wikipedia.org/wiki/Krokod%C3%BDl_mo%C5%99sk%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/SaltwaterCrocodile%28%27Maximo%27%29.jpg","page_title":"Krokodýl mořský","context_page_description":"Krokodýl mořský, známý také jako krokodýl pobřežní, je největší z dnes žijících krokodýlů a zároveň je dnes největším a nejmohutnějším plazem na světě. Dosahuje délky přes šest metrů a hmotnosti více než jedné tuny. Největší řádně změřený jedinec dosahoval délky 6,3 metru a hmotnosti asi 1,2 tuny, předpokládá se, že výjimečně může dorůst až 7 metrů a vážit okolo 2 tun.\\nObývá jižní a jihovýchodní Asii včetně Indonésie a objevuje se až u pobřeží severní Austrálie. Libuje si v mořích s teplejší vodou, nejraději ve vodách Indického a Tichého oceánu mezi Indií a Austrálii. Některé exempláře byly pozorovány na širém moři až tisíc kilometrů od břehů."},{"page_url":"https://en.wikipedia.org/wiki/Huoqiu_County","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Location_of_Lu%27an_Prefecture_within_Anhui_%28China%29.png","page_title":"Huoqiu County","context_page_description":"Huoqiu County is a county in the west of Anhui Province, People's Republic of China, under the jurisdiction of Lu'an City and bordering Henan province to the west. It has a population of 1,640,000 and an area of 3,483 square kilometres. The government of Huoqiu County is located in Chengguan Town.\\nHuoqiu County has jurisdiction over 19 towns and 10 townships."},{"page_url":"https://nl.wikipedia.org/wiki/Zestienhoven_(wijk)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Laanvilla%27s_Zestienhoven_-_EGM_architecten.jpg","page_title":"Zestienhoven (wijk)","context_page_description":"Zestienhoven is een wijk in het Rotterdamse stadsdeel Overschie. De Polder Zestienhoven ligt binnen de deelgemeente ten oosten van het stedelijk gebied van de wijk Overschie. Aan de oostzijde ligt Schiebroek en aan de noordzijde de luchthaven Rotterdam The Hague Airport."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AD%E0%B8%94%E0%B8%B4%E0%B8%AA%E0%B8%A3%E0%B8%93%E0%B9%8C_%E0%B8%9E%E0%B8%B6%E0%B9%88%E0%B8%87%E0%B8%A2%E0%B8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Adisorn_Pueng-ya.jpg","page_title":"อดิสรณ์ พึ่งยา","context_page_description":"อดิสรณ์ พึ่งยา หรือที่รู้จักกันดีในนามปากกาว่า JACKIE เกิดเมื่อวันที่ 25 สิงหาคม พ.ศ. 2512 ที่โรงพยาบาลศิริราช กรุงเทพฯ ใช้ชีวิตจนถึง 7 ขวบจึงกลับไปอยู่ที่บ้านเกิดของบิดามารดาที่ บ้านโพธิ์ ต.บ้านกุ่ม อ.สองพี่น้อง จ.สุพรรณบุรี จบการศึกษาระดับมัธยมจากโรงเรียนสองพี่น้องวิทยา ปริญญาตรีจากคณะครุศาสตร์ จุฬาลงกรณ์มหาวิทยาลัย เมื่อปี พ.ศ. 2535\\nจากนั้นจึงเริ่มทำงานที่สยามสปอร์ตซินดิเคท ด้วยการแปลข่าวภาษาอังกฤษจากสำนักข่าวรอยเตอร์และเอเอฟพี โดยใช้นามปากกาว่า JACKIE รวมทั้งเขียนคอลัมน์เกี่ยวกับฟุตบอลสเปนด้วย ซึ่งยังไม่เป็นที่คุ้นเคยของคนไทยในขณะนั้น ซึ่งทางสยามสปอร์ตฯต้นสังกัดได้ส่งไปเรียนภาษาสเปนที่จุฬาลงกรณ์มหาวิทยาลัย\\nจนกระทั่งผ่านไป 4 ปี ทางต้นสังกัดได้ส่งไปเป็นผู้สื่อข่าวประจำกรุงลอนดอน ประเทศอังกฤษ เป็นเวลา 2 ปี ตามนโยบายของบริษัท โดยทำหน้าที่เป็นผู้สื่อข่าวตามติดวงการฟุตบอลอังกฤษอย่างใกล้ชิด จากนั้นจึงทำหน้าที่ผู้พากย์ที่ UBC ก่อนเปลี่ยนTrue Visions ในปี 1998 บรรยายคู่กับไพโรจน์ กิ่งแก้ว ก่อนจะเป็นวีรศักดิ์ นิลกลัด\\nปัจจุบัน อดิสรณ์ มีตำแหน่งเป็นรองกรรมการผู้จัดการ บริษัท สยามสปอร์ต บุ๊คส์ จำกัด ในเครือสยามสปอร์ตฯ เป็นผู้ประกาศข่าวกีฬาของทางช่อง 7 ผู้พากษ์ฟุตบอลทางช่อง 7, พิธีกรรายการเจาะสนาม, รายการสปอร์ตแฟน แฟนซ่า กีฬามัน ร่วมกับ บอ."},{"page_url":"https://sh.wikipedia.org/wiki/Njedo%C5%BEeri-Brezani","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Brezany-church.JPG","page_title":"Njedožeri-Brezani","context_page_description":"Njedožeri-Brezani je naseljeno mjesto u okrugu Prjevidza, u Trenčinskom kraju, Republika Slovačka."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B1%D9%88%DA%A9%DB%8C_%D8%A2%D8%AF%DA%A9%DB%8C%D9%86%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Rocky_Adkins.png","page_title":"روکی آدکینز","context_page_description":"روکی آدکینز آمریکالی سیاستچی و دموکرات حزبینین عوضوو. سندی هوک شهرینده دۆنیایا گؤز آچیب."},{"page_url":"https://fr.wikipedia.org/wiki/Fran%C3%A7ois_Emmanuel_Toulongeon","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Fran%C3%A7ois_Emmanuel_Toulongeon.jpg","page_title":"François Emmanuel Toulongeon","context_page_description":"François-Emmanuel Toulongeon, ou François Emmanuel d'Emskerque, vicomte de Toulongeon, né le 3 décembre 1748, mort le 23 décembre 1812, est un historien et homme politique français, député aux États généraux de 1789, membre de l'Institut national et auteur d'une Histoire de la Révolution de 1789."},{"page_url":"https://nl.wikipedia.org/wiki/Kamping_Kitsch_Club","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Wiki_Kamping_Kitsch-7.jpg","page_title":"Kamping Kitsch Club","context_page_description":"Kamping Kitsch Club is sinds 2011 een jaarlijks evenement in West-Vlaanderen. Het gaat door in het laatste weekend van augustus. Het evenement draagt de naam \\"Het marginaalste festival van het land\\". Volgens de officiële website is het misschien wel het grootste verkleedfeest van België. De editie van 2017 in Zwevegem trok ongeveer 15 000 bezoekers. Kamping Kitsch Club wordt georganiseerd door Johnny Overdrive en MC Drummer."},{"page_url":"https://en.wikipedia.org/wiki/John_Neal_(writer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/First_Parish_Church_Portland_Maine.jpg","page_title":"John Neal (writer)","context_page_description":"John Neal was an American writer, critic, editor, lecturer, and activist. Considered both eccentric and influential, he delivered speeches and wrote magazine essays, novels, poems, and short stories between the 1810s and 1870s in the US and Great Britain, championing American literary nationalism and regionalism in their earliest stages. Neal advanced the development of American art, advocated for early feminist causes, advocated the end of slavery and racism, and helped establish the gymnastics movement in the US.\\nA pioneer of colloquialism and natural diction, John Neal is the first author to use \\"son-of-a-bitch\\" in a work of fiction. He attained his greatest literary achievements between 1817 and 1835, during which time he was central to American literature's evolution from the British influences dominant in works of founding American authors James Fenimore Cooper and Washington Irving, whom he derided, to the new voices of American Renaissance authors Edgar Allan Poe, Nathaniel Hawthorne, and Walt Whitman, all of whom he influenced."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Berlin-Lankwitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Stolperstein_Waldmannstr_1_%28Lankw%29_Charlotte_Kobrak.jpg","page_title":"Liste der Stolpersteine in Berlin-Lankwitz","context_page_description":"Die Liste der Stolpersteine in Berlin-Lankwitz enthält die Stolpersteine im Berliner Ortsteil Lankwitz im Bezirk Steglitz-Zehlendorf, die an das Schicksal der Menschen erinnern, die im Nationalsozialismus ermordet, deportiert, vertrieben oder in den Suizid getrieben wurden. Die Spalten der Tabelle sind selbsterklärend. Die Tabelle erfasst insgesamt 20 Stolpersteine und ist teilweise sortierbar; die Grundsortierung erfolgt alphabetisch nach dem Familiennamen."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%9F%AD%E9%9B%99%E8%83%8C%E9%B0%AD%E9%B1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Mochokus_brevis.jpg","page_title":"短雙背鰭鱨","context_page_description":"短雙背鰭鱨，為輻鰭魚綱鯰形目倒立鯰科的其中一種，為熱帶淡水魚，分布於非洲尼羅河及查德湖流域，體長可達3.1公分，棲息在底中層水域，生活習性不明。"},{"page_url":"https://fr.wikipedia.org/wiki/Alexandre_Millerand","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/09-1920_French_presidential_election.svg","page_title":"Alexandre Millerand","context_page_description":"Alexandre Millerand, né le 10 février 1859 à Paris et mort le 6 avril 1943 à Versailles, est un homme d'État français. Il est président du Conseil du 20 janvier au 23 septembre 1920, puis président de la République du 23 septembre 1920 au 11 juin 1924.\\nAvocat et journaliste au quotidien La Justice de Georges Clemenceau, il s’engage d’abord au sein des radicaux. Il est élu conseiller municipal de Paris en 1884 et député de la Seine en 1885 ; constamment réélu, il siège pendant 35 ans à la Chambre des députés. Durant la crise boulangiste, il s'éloigne des radicaux, maintenant sa volonté de réviser les lois constitutionnelles de 1875 et ses revendications sociales.\\nDans les années 1890, devenu la principale figure des socialistes indépendants, il prône un socialisme réformiste. De 1899 à 1902, dans le gouvernement Waldeck-Rousseau, il est ministre du Commerce, de l’Industrie, des Postes et Télégraphes : premier ministre socialiste en France, il réglemente et réduit le temps de travail, garantit un repos hebdomadaire dans les établissements dépendants de l'État et fait voter un projet sur les retraites ouvrières."},{"page_url":"https://es.wikipedia.org/wiki/Ernesto_Nazareth","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Ernestonazareth2.jpg","page_title":"Ernesto Nazareth","context_page_description":"Ernesto Júlio de Nazareth fue un compositor y pianista brasileño.\\nConsiderado uno de los grandes nombres del choro, “el Scott Joplin de Brasil”, el carioca que creó y fijó el “tango brasilero” y otros géneros musicales en el Río de su tiempo. Combinaba diversas influencias, no solo brasileñas sino también de la música académica de Europa, África y hasta ragtime. Muchas de sus composiciones se siguen ejecutando regularmente en la actualidad. Los cariocas le decían “Nazaré”."},{"page_url":"https://pt.wikipedia.org/wiki/Francisco_de_Assis_Couto_dos_Reis","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Assis_Reis_01.JPG","page_title":"Francisco de Assis Couto dos Reis","context_page_description":"Francisco de Assis Couto dos Reis, filho de Mário Reis e de Joana Angélica de Lima Couto dos Reis, com raízes em Parnaíba e em Salvador, foi um arquiteto e professor brasileiro. Assis Reis, como era mais conhecido, foi considerado um dos primeiros arquitetos da segunda geração da arquitetura moderna na Bahia, tendo sido agraciado com o \\"Colar de Ouro\\", maior prêmio outorgado pelo Instituto de Arquitetos do Brasil."},{"page_url":"https://da.wikipedia.org/wiki/Sol_(%C3%B8l)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Cerveza_sol.jpg","page_title":"Sol (øl)","context_page_description":"Sol er et øl mærke fra det mexicanske bryggeri Cervecería Cuauhtémoc Moctezuma. Øllet kommer fra El Sol. Legender siger at bryggerimesteren ved Salto del Agua opdagede solstråler i beholderen øllet blev brygget i. Derfor fik det navnet El Sol. I 1912 overtog Moctezuma-bryggeriet Salto del Agua. El Sol skiftede navn til Sol i 1924, og begyndte slå igennem nationalt. Senere overtog Cervecería Cuauhtémoc Moctezuma Moctezuma-bryggeriet, og Sol var et lille regionalt øl mærke frem til starten af 1900-tallet. Senere i 90-tallet blev Sol introducert på det internationale marked.\\nI dag bliver Sol producert både i bokse og glasflasker i mange forskellige størrelser. Sol-serien består af:\\nSol Clara\\nSol Brava\\nSol Light\\nSol Cero\\nSol Limón y Sal\\nSol Cero Limón y Sal\\nSol distribueres og markedsføres i Danmark af Royal Unibrew A/S."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%8C%87%E8%BC%AA%E7%89%A9%E8%AA%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/EN-Hobbiton-Matamata-NZ-Attribution-Share-Alike25.jpg","page_title":"指輪物語","context_page_description":"『指輪物語』は、イギリスのJ・R・R・トールキンによる長編小説。エルフや人間が国家を築き、戦争を繰り広げる架空の世界を舞台としたハイ・ファンタジー作品である。初期作品『ホビットの冒険』の続編として始まるが、より大きな物語になった。1937年から1949年にかけて少しずつ書かれたが、執筆期間の大部分は第二次世界大戦中であった。最初の版は1954年から1955年にかけて3巻本として出版された。以来多くの言語に翻訳され、増刷を重ね、20世紀の文学で最もポピュラーな作品の一つになった。"},{"page_url":"https://pl.wikipedia.org/wiki/Bridekirk","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/St_Bridgets_Church_Bridekirk._-_geograph.org.uk_-_80879.jpg","page_title":"Bridekirk","context_page_description":"Bridekirk – wieś i civil parish w Anglii, w Kumbrii, w dystrykcie Allerdale. W 2001 civil parish liczyła 636 mieszkańców. Znajdują się tam wsie Tallentire i Dovenby. W civil parish znajduje się 30 zabytkowych budynków."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D0%BD%D0%BE%D0%B7%D0%B5%D0%BC%D0%BD%D0%B0_%D0%B2%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%BE%D0%B2%D0%B0_%D1%96%D0%BD%D1%82%D0%B5%D1%80%D0%B2%D0%B5%D0%BD%D1%86%D1%96%D1%8F_%D0%B2_%D0%A0%D0%BE%D1%81%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Canadian_Siberian_Expeditionary_Force_in_Vladivostok_1919.jpg","page_title":"Іноземна військова інтервенція в Росії","context_page_description":"Іноземна військова інтервенція в Росії — військове втручання країн Антанти та Четверного союзу у Громадянську війну в Росії. Всього в інтервенції взяли участь 14 держав."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%A7%E5%90%8C%E5%8C%BA_(%E5%A4%A7%E6%85%B6%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Taiyangsheng_Railway_Station.jpg","page_title":"大同区 (大慶市)","context_page_description":"大同区は中華人民共和国黒竜江省大慶市南西部に位置する市轄区。"},{"page_url":"https://nl.wikipedia.org/wiki/Veiligheidspapier","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Fuenfzigrp.jpg","page_title":"Veiligheidspapier","context_page_description":"Veiligheidspapier is papier met veiligheidsaspecten erin verwerkt. Papier voor bankbiljetten of voor paspoorten vormen voorbeelden."},{"page_url":"https://en.wikipedia.org/wiki/Embioptera","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Osaundersii_larva.jpg","page_title":"Embioptera","context_page_description":"The order Embioptera, commonly known as webspinners or footspinners, are a small group of mostly tropical and subtropical insects, classified under the subclass Pterygota. The order has also been called Embiodea or Embiidina. More than 400 species in 11 families have been described, the oldest known fossils of the group being from the mid-Jurassic. Species are very similar in appearance, having long, flexible bodies, short legs, and only males having wings.\\nWebspinners are gregarious, living subsocially in galleries of fine silk which they spin from glands on their forelegs. Members of these colonies are often related females and their offspring; adult males do not feed and die soon after mating. Males of some species have wings and are able to disperse, whereas the females remain near where they were hatched. Newly-mated females may vacate the colony and found a new one nearby. Others may emerge to search for a new food source to which the galleries can be extended, but in general, the insects rarely venture from their galleries."},{"page_url":"https://it.wikipedia.org/wiki/Collina_di_Tara","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Collinaditara.jpg","page_title":"Collina di Tara","context_page_description":"La Collina di Tara era uno dei luoghi più venerati e importanti dei primi secoli della storia d'Irlanda.\\nÈ situata nel Meath, nella zona centro-orientale dell'isola."},{"page_url":"https://nds.wikipedia.org/wiki/Samuel_White_Baker","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4c/ST-Sbaker.jpg","page_title":"Samuel White Baker","context_page_description":"Sir Samuel White Baker weer en britisch Afrikaopdecker."},{"page_url":"https://no.wikipedia.org/wiki/Desmond_Hoyte","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Desmond_Hoyte.jpg","page_title":"Desmond Hoyte","context_page_description":"Hugh Desmond Hoyte var en guyansk politiker. Han var Guyanas statsminister 1984–1985 og deretter landets president fra 6. august 1985 til 6. oktober 1992.\\nHoyte ble innvalgt i Guyanas parlament i 1968 som kandidat for People's Democratic Congress. Han hadde flere ulike ministerposter i sin politiske karriere og etterfulgte Ptolemy Reid som statsminister i 1983.\\nGuyanas president Forbes Burnham døde i 1985 i embetet og ble etterfulgt av Hoyte. Tre måneder seinere omkom Hoytes to døtre i en bilulykke.\\nHoyte tapte presidentvalget for Cheddi Jagan i 1992. Han var presidentkandidat på nytt 1996 og 2001; han kom på andreplass begge gangene."},{"page_url":"https://ca.wikipedia.org/wiki/Introducci%C3%B3_a_l%27evoluci%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Big_and_little_dog_1.jpg","page_title":"Introducció a l'evolució","context_page_description":"Aquest article està concebut com una introducció accessible i no tècnica al tema del qual tracta. L'article principal és Evolució.\\nL'evolució és el procés de canvi en totes les formes de vida al llarg de les generacions, i la biologia evolutiva és l'estudi de com i per què té lloc l'evolució. Un organisme hereta caràcters dels seus pares a través dels gens. Canvis en aquests gens poden produir un nou caràcter en el descendent d'un organisme. Si el nou caràcter fa que aquest descendent s'adapti millor al seu ambient, tindrà més èxit a l'hora de sobreviure i reproduir-se. Aquest procés rep el nom de selecció natural, i fa que els caràcters útils esdevinguin més comuns. Després de moltes generacions, una població pot adquirir tants caràcters nous que es converteix en una nova espècie.\\nLa comprensió de la biologia evolutiva comença amb la publicació l'any 1859 de l'obra de Charles Darwin L'origen de les espècies. A més, el treball de Gregor Mendel amb les plantes contribuí a entendre els patrons hereditaris de la genètica. Això portà a una comprensió dels mecanismes de l'herència."},{"page_url":"https://es.wikipedia.org/wiki/ARP_2600","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Arp2600bluemarvin.jpg","page_title":"ARP 2600","context_page_description":"El ARP 2600 es un sintetizador semi-modular de audio analógico sustractivo, diseñado por Alan R. Pearlman con Dennis Colin, y fabricado por su empresa, ARP Instruments, Inc. como la versión de continuación de la ARP 2500. A diferencia de otros sistemas modulares del tiempo, lo que requería módulos para ser comprados individualmente y cableado por el usuario, el 2600 era semimodular con una selección fija de los componentes básicos del sintetizador internamente precableado. El 2600 fue lo que resulta ideal para los nuevos músicos a la síntesis, debido a su capacidad para operar ya sea con o sin cables de conexión, y fue, en su lanzamiento inicial, fuertemente comercializado a las escuelas secundarias, universidades y otros centros educativos.​\\nEl Modelo 2600 se produjo a principios de 1971 y se conoce como el \\"Marvin Blue\\". Ha sido erróneamente llamado el \\"Blue Meanie\\", pero de acuerdo con Alan R. Pearlman, el \\"Blue Marvin\\" se llama así por Marvin Cohen, director financiero de ARP en el momento. Sus componentes electrónicos venían integrados en una caja metálica de color gris azulado claro junto con su teclado."},{"page_url":"https://de.wikipedia.org/wiki/Hermannstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Sibiu_Coposu_Boulevard.jpg","page_title":"Hermannstadt","context_page_description":"Hermannstadt ist eine Stadt im Kreis Sibiu in der Region Siebenbürgen in Rumänien und war 2007 zusammen mit der Stadt Luxemburg Kulturhauptstadt Europas."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%99%AE%E5%B8%8C%E9%87%91%E6%95%85%E5%B1%85%E5%8D%9A%E7%89%A9%E9%A6%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Pushkin_Apartment_Museum_SPB_09.jpg","page_title":"普希金故居博物馆","context_page_description":"普希金故居博物馆是国家普希金博物馆的一个分馆，成立于1927年，位于俄罗斯圣彼得堡中区莫伊卡河滨河路12号，专注于诗人亚历山大·谢尔盖耶维奇·普希金生命的最后几个月。\\n1836年9月初，普希金一家租了莫伊卡河边马厩桥附近索菲亚·格里戈里耶夫娜公主的一套公寓。次年2月10日诗人死后，公寓进行了彻底改建，风貌发生变化。1924年秋天，公寓由普希金的老彼得堡协会接管，重建工作开始，并持续了好几年。1925年2月10日，在修复的诗人办公室，举行了纪念普希金逝世88周年的会议。1927年2月13日，第一个博物馆开放。1937年2月10日，在庆祝“1937年普希金禧年，诗人逝世100周年”活动之际，普希金故居博物馆以新风格重新开放。\\n在普希金的遗物中，有诗人本人和家人的肖像。博物馆还保存了与普希金决斗和死亡有关的物品——一件在战斗当天的背心，一头卷发，以及死后面具。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_mosques_in_Cairo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Sayeda_Nafisa_Mosque_005.jpg","page_title":"List of mosques in Cairo","context_page_description":"Cairo holds one of the greatest concentrations of historical monuments of Islamic architecture in the world, and includes mosques and Islamic religious complexes from diverse historical periods. Many buildings were primarily designated as madrasas, khanqahs or even mausoleums rather than mosques, but have nonetheless served as places of worship or prayer at some time or another, if not today."},{"page_url":"https://sv.wikipedia.org/wiki/Ett_segelfartyg_sover_i_hamnen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Ett_segelfartyg_sover_i_hamnen.jpg","page_title":"Ett segelfartyg sover i hamnen","context_page_description":"Ett segelfartyg sover i hamnen är en skulpturgrupp i brons av Bianca Maria Barmen som finns på Stigbergstorget i Göteborg. De tre skulpturerna föreställer en skeppshund på en livflotte, en sjömansgosse formad efter en porslinsfigur och en rykande vulkan."},{"page_url":"https://de.wikipedia.org/wiki/Henri_Matisse","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Henri_Matisse_photo_taken_by_Carl_Van_Vechten.jpg","page_title":"Henri Matisse","context_page_description":"Henri Matisse, vollständiger Name: Henri Émile Benoît Matisse, war ein französischer Maler, Grafiker, Zeichner und Bildhauer.\\nEr zählt mit Pablo Picasso zu den bedeutendsten Künstlern der Klassischen Moderne. Neben André Derain gilt er als Wegbereiter und Hauptvertreter des Fauvismus, der die Loslösung vom Impressionismus propagierte und die erste künstlerische Bewegung des 20. Jahrhunderts darstellt.\\nMatisse’ Werk ist getragen von einer flächenhaften Farbgebung und spannungsgeladenen Linien. In seinen Gemälden sind die Farbgebung, der spielerische Bildaufbau und die Leichtigkeit seiner Bildthemen das Ergebnis langer Studien.\\nMit seinen in den 1940er Jahren entstandenen Scherenschnitten – ein Beispiel ist das Künstlerbuch Jazz – schuf Matisse, der schwer erkrankt war, ein Spätwerk, das seine Reduktionsbestrebungen zum Abschluss bringt und mit seiner Farbigkeit und Ornamentik als Höhepunkt seiner künstlerischen Laufbahn gilt. Die von ihm geplante und ausgestattete Rosenkranzkapelle in Vence, eingeweiht im Jahr 1951, hielt der Künstler für sein Meisterwerk.\\nSeine stilistischen Neuerungen beeinflussten die Moderne Kunst."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%85%8B%E9%87%8C%E6%B2%83%E7%BD%97%E6%A0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/KR_City_collage.png","page_title":"克里沃罗格","context_page_description":"克里沃罗格是乌克兰第聂伯罗彼得罗夫斯克州的一座城市，位于州首府第聂伯罗彼得罗夫斯克西南，人口约69万。"},{"page_url":"https://id.wikipedia.org/wiki/Impasug-ong,_Bukidnon","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/95/Ph_locator_bukidnon_impasug-ong.png","page_title":"Impasug-ong, Bukidnon","context_page_description":"Impasug-ong adalah munisipalitas yang terletak di provinsi Bukidnon, Filipina.\\nPada tahun 2000, munisipalitas ini memiliki populasi sebesar 31.173 jiwa atau 5.718 rumah tangga."},{"page_url":"https://en.wikipedia.org/wiki/List_of_heads_of_state_of_Bolivia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Bolivar_Arturo_Michelena.jpg","page_title":"List of heads of state of Bolivia","context_page_description":"The following table contains a list of the individuals who have served as President of Bolivia."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BF%D5%B8%D5%B4%D5%BD%D5%B8%D5%B4%D5%B8%D5%AC%D5%BD%D5%AF%D5%AB_%D5%B7%D6%80%D5%BB%D5%A1%D5%B6_(%D4%BB%D5%BE%D5%A1%D5%B6%D5%B8%D5%BE%D5%B8%D5%B5%D5%AB_%D5%B4%D5%A1%D6%80%D5%A6)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Flag_of_Komsomolsky_rayon_%28Ivanovo_oblast%29.png","page_title":"Կոմսոմոլսկի շրջան (Իվանովոյի մարզ)","context_page_description":"Անվան այլ կիրառումների համար տե՛ս՝ Կոմսոմոլսկի շրջան\\nԿոմսոմոլսկի շրջան, մունիցիպալ շրջան Ռուսաստանի Դաշնության Իվանովոյի մարզում։\\nՍտեղծվել է 1929 թվականին։ Վարչական կենտրոնը՝ Կոմսոմոլսկ։"},{"page_url":"https://en.wikipedia.org/wiki/List_of_presidents_of_the_Republic_of_the_Congo","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Flag_of_the_Republic_of_the_Congo.svg","page_title":"List of presidents of the Republic of the Congo","context_page_description":"This is a list of presidents of the Republic of the Congo since the formation of the post of president in 1960, to the present day.\\nA total of six people have served as President of the Republic of the Congo. Additionally, one person, Denis Sassou Nguesso, has served on two non-consecutive occasions."},{"page_url":"https://sr.wikipedia.org/wiki/Radmila_Karaklaji%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/sr/8/8a/Stevan_Kragujevic%2C_Radmila_Karaklajic%2C_jugoslovenska_i_srpska_zvezda_pop_i_pop_rok_muzike%2C_snimanje_Tv_emisije%2C_1963.JPG","page_title":"Radmila Karaklajić","context_page_description":"Radmila Karaklajić je srpska pop i pop-rok pevačica, rođena u Beogradu 1939. pred početak Drugog svetskog rata. Proslavila se muzičkim hitom Anđelina zumba zumba iz 1964. koji je dostigao tiraž od gotovo milion i po prodatih primeraka. Glumila je u filmu Dobar vetar 'Plava ptico' i seriji Obraz uz obraz.\\nIzrazito je popularna u bivšem Sovjetskom Savezu gde se čak dešavalo da su devojčicama davana imena po njoj."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%83%AA%E3%83%95%E3%82%A9%E3%83%AB%E3%83%8B%E3%82%A2%E5%B7%9E%E4%BC%9A%E8%AD%B0%E4%BA%8B%E5%A0%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/California_Senate_chamber_p1080899.jpg","page_title":"カリフォルニア州会議事堂","context_page_description":"カリフォルニア州会議事堂は、アメリカ合衆国カリフォルニア州の州都サクラメントに立地する同州議会の議事堂。庁舎はサクラメントのダウンタウン、北をLストリート、南をNストリート、西を10thストリート、および東を15thストリートに囲まれたキャピトル・パークの西側に立地している。庁舎内にはカリフォルニア州議会の上下両院の議場のほか、州知事室が置かれている。\\nカリフォルニア州会議事堂は1860-74年にかけて、ワシントンD.C.の連邦議会議事堂に倣って新古典主義建築様式で設計・建設された。庁舎および敷地は1973年に国家歴史登録財に指定された。\\nファサードは庁舎の西側に設けられており、建物の中央からポルチコが突き出ている。ポルチコの下には7つの御影石のアーチが連なり、上部のポーチを支えている。ポルチコには縦溝の彫られた8本のコリント式の柱が立て並べられている。コーニスに支えられた上部のペディメントには、教育、正義、および鉱業をそれぞれ象徴するものに囲まれたミネルウァが彫られている。欄干が設けられた陸屋根の中央は二重の円筒状に突き出た構造となっており、ドームを支えている。ドームを含めた庁舎の高さは210フィートである。ドームの上には小型のドームを有するランタンが立っており、その上には球状のフィニアルが据えられている。\\nカリフォルニア州上院の本会議場は2階の回廊の先に置かれている。内装は赤色を基調としてまとめられ、天井からはオリジナルのガス灯のシャンデリアを復元した電灯が吊り下げられている。手彫りの施された台座は、コリント式の柱に囲まれた、議長席奥の凹みに置かれている。台座の左右には赤のベルベットのクッションが置かれた席が設けられているが、実際に使われたことは無い。上部のコーニスにはラテン語でSenatoris est civitatis libertatem tueriと彫られている。その上部の壁面にはギルバート・ステュアートの娘、ジェーン・スチュアートの手によるジョージ・ワシントンの肖像画が飾られ、鋼鉄製の州章が吊り下げられている。\\n州下院の本会議場は上院本会議場とは反対側に置かれている。内装は緑色を基調としてまとめられ、台座は壁に対してEの字上に並んでいる。しかしそれ以外は、ほとんど全ての装飾は上院本会議場のものと同様である。"},{"page_url":"https://de.wikipedia.org/wiki/Nemirseta","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Kurlandyja-%C5%BDamoj%C4%87._%D0%9A%D1%83%D1%80%D0%BB%D1%8F%D0%BD%D0%B4%D1%8B%D1%8F-%D0%96%D0%B0%D0%BC%D0%BE%D0%B9%D1%86%D1%8C_%281659%29.jpg","page_title":"Nemirseta","context_page_description":"Nemirseta ist ein Ortsteil des litauischen Kurortes Palanga an der Ostseeküste nördlich von Klaipėda.\\nDer Ort liegt in der kurischen Landschaft Megowe und bedeutet frei übersetzt „Gehöft, auf dem Unfrieden herrscht“. Möglich wäre auch ein Hinweis auf sumpfiges Gelände: „nemiršele“: = Sumpfvergissmeinnicht"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%AD%A3%E6%B3%95%E5%AF%BA_(%E4%BA%AC%E9%83%BD%E5%BA%9C%E5%92%8C%E6%9D%9F%E7%94%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/%E8%A1%A8%E9%96%80%28%E8%A3%8F%E9%9D%A2%29.jpg","page_title":"正法寺 (京都府和束町)","context_page_description":"正法寺は、京都府相楽郡和束町にある臨済宗永源寺派の寺。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_defunct_airlines_of_New_Zealand","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Union_Airways_aircraft%2C_Milson_1939.jpg","page_title":"List of defunct airlines of New Zealand","context_page_description":"This is a list of defunct airlines of New Zealand."},{"page_url":"https://sv.wikipedia.org/wiki/Rune_Ottoson","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Rune_Ottosson_-_GTM-4674-1.jpg","page_title":"Rune Ottoson","context_page_description":"Karl Rune Ottoson, född 2 november 1923 i Fagerdal i Hammerdals socken i Jämtland, död 7 augusti 1975 i Mölndal, var en svensk skådespelare."},{"page_url":"https://nl.wikipedia.org/wiki/Luisa_Casati","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Giovanni_Boldini_-_La_marchesa_Luisa_Casati_con_penne_di_pavone_%28Portrait_of_the_Marquise%29.jpg","page_title":"Luisa Casati","context_page_description":"Luisa Casati Stampa di Soncino, Marchesa di Roma, geboren Aman was een excentrieke rijke Italiaanse erfgename, mecenas en mode-icoon. Ze behoorde tot de bekendste vrouwen uit de Europese High Society uit het begin van de twintigste eeuw."},{"page_url":"https://no.wikipedia.org/wiki/Halden_fengsel","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Interior_in_Halden_prison.jpg","page_title":"Halden fengsel","context_page_description":"Halden fengsel i Viken ble da det var ferdigstilt betegnet som Europas mest moderne. Fengselet tok i mot de første innsatte 1. mars 2010, men åpnet ikke offisielt før den 8. april 2010. Under denne åpningen var det norske kongehuset ved kong Harald V representert. Dette var første gang i norsk historie at noen fra kongehuset har deltatt på åpningen av et nytt fengsel. Halden fengsel ligger under Kriminalomsorgens region øst, og har en kapasitet på 248 innsatte.\\nPer 1. september 2010 hadde Halden fengsel 224 plasser i bruk fordelt på avdelingene A, B og C. Avdeling A er en mottaksavdeling, mens avdelingene B og C er boenhetsavdelinger med henholdsvis 10 eller 12 innsatte. Her har de innsatte felles stue/kjøkken/oppholdsrom.\\nFengselet ble i mai 2010 omtalt i det amerikanske tidsskriftet Time som «verdens mest humane fengsel».\\nHalden fengsel ble tildelt Arnstein Arneberg pris for arkitekturen i 2010."},{"page_url":"https://tr.wikipedia.org/wiki/%C3%87%C4%B1kr%C4%B1k","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/098_Etnografya.05.2006_resize.JPG","page_title":"Çıkrık","context_page_description":"Çıkrık, doğal ya da yapay liflerden iplik eğirmek için kullanılan bir araçtır."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AD%E0%A4%BE%E0%A4%B2%E0%A4%9A%E0%A4%82%E0%A4%A6%E0%A5%8D%E0%A4%B0_%E0%A4%A8%E0%A5%87%E0%A4%AE%E0%A4%BE%E0%A4%A1%E0%A5%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Bhalachandra_Nemade.jpg","page_title":"भालचंद्र नेमाडे","context_page_description":"भालचंद्र नेमाडे भारतीय मराठी लेखक, उपन्यासकार, कवि, समीक्षक तथा शिक्षाविद हैं। १९६३ में केवल २५ वर्ष की आयु में प्रकाशित 'कोसला' नामक उपन्यास से उन्हें अपार सफलता मिली। सन १९९१ में उनकी टीकास्वयंवर इस कृति के लिए उन्हें साहित्य अकादमी पुरस्कार से सम्मानित किया गया। उन्हें वर्ष २०१४ का प्रतिष्ठित ज्ञानपीठ पुरस्कार दिया जाएगा।श्री नेमाडे की प्रमुख कृतियों में 'कोसला' और 'हिन्‍दू' उपन्‍यास शामिल हैं। उनके साहित्य में 'देशीवाद' पर बल दिया गया है। वह 60के दशक के लघु पत्रिका आंदोलन के प्रमुख हस्ताक्षर थे।\\nप्राध्यापक भालचंद्र नेमाडे मराठी के प्रसिद्ध लेखक वी.स. खांडेकर, वि.वा. शिरवाडकर, विं.दा. करंदीकर के बाद यह पुरस्कार प्राप्त करने वाले चौथे मराठी लेखक हैं। प्रो. भालचन्द्र नेमाडे मराठी साहित्य में सर्वस्पर्शी तथा सर्वप्रतिष्ठित नाम है। उपन्यास, कविता एवं आलोचना में उनकी विरल ख्याति है। श्री नेमाड़े मराठी आलोचना में 'देसीवाद' के प्रवर्तक हैं। 1963 में प्रकाशित 'कोसला' उपन्यास ने मराठी उपन्यास लेखन में दिशा प्रवर्तन का काम किया। इस उपन्यास ने मराठी गद्य लेखन को पिछली आधी शताब्दी में लगातार चेतना और फॉर्म के स्तर पर उद्वेलित किया। उनके अन्य उपन्यास 'हिन्दू' में सभ्यता विमर्श उपस्थित है। यह कृति काल की आवधारणा की वैज्ञानिक दृष्टि से भाष्य करती है।"},{"page_url":"https://fr.wikipedia.org/wiki/Louis-Marie_de_Belleyme","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Louis_Marie_de_Belleyme_%281787-1862%29.jpg","page_title":"Louis-Marie de Belleyme","context_page_description":"Louis-Marie de Belleyme est un juriste et homme politique français né à Paris le 16 janvier 1787 et mort dans la même ville le 25 février 1862. Il fut l'avant-dernier préfet de police de Charles X."},{"page_url":"https://pt.wikipedia.org/wiki/Clidenor_de_Freitas_Santos","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Clidenor_Freitas_signature.png","page_title":"Clidenor de Freitas Santos","context_page_description":"Clidenor de Freitas Santos foi um médico, professor e político brasileiro que representou o Piauí na Câmara dos Deputados."},{"page_url":"https://pl.wikipedia.org/wiki/Diecezja_Sacramento","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/CathBSlow.jpg","page_title":"Diecezja Sacramento","context_page_description":"Diecezja Sacramento jest diecezją Kościoła rzymskokatolickiego w metropolii San Francisco w Stanach Zjednoczonych w północnej części stanu Kalifornia."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%B4%D0%BE%D0%BD%D1%86%D0%BE%D0%B2%D1%8C%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Seversky_Donets.png","page_title":"Подонцовье","context_page_description":"Подонцовье — историко-географический регион, примерно соответствующий бассейну реки Северский Донец. Регион находится на юге Восточно-Европейской равнины, на территории двух государств: Украина и Россия."},{"page_url":"https://fr.wikipedia.org/wiki/Edward_Smith","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Hawke_-_Olympic_collision.JPG","page_title":"Edward Smith","context_page_description":"Edward John Smith, né le 27 janvier 1850 à Hanley et mort le 15 avril 1912 dans l'Océan Atlantique, est un marin britannique. Élevé dans un milieu populaire, il quitte tôt l'école pour s'engager dans la marine marchande. Après avoir obtenu son brevet de capitaine au long cours, il entre au service de la White Star Line, prestigieuse compagnie britannique. Il gravit rapidement les échelons, et obtient en 1887 son premier commandement à bord du Celtic. Il commande par la suite de nombreux navires de la compagnie, notamment le Majestic, qu'il commande pendant plus de sept ans.\\nSmith acquiert progressivement une forte popularité de par son caractère agréable et imposant, qui lui vaut l'affection de nombreux passagers. En 1904, il devient le commodore de la compagnie, et est désormais chargé de commander ses navires amiraux. Il commande ainsi successivement le Baltic, l’Adriatic, l’Olympic et le Titanic. Il est à cette époque le marin le mieux payé, et sa popularité est telle que certains n'acceptent de voyager qu'avec lui. Jusqu'en 1911, sa carrière n'est troublée que par deux missions de transport de troupes lors de la guerre des Boers.\\nLa situation change en 1911."},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B5%AC%EB%8B%A4%EB%A7%88%EC%93%B0%EC%8B%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Flag_of_Kudamatsu_Yamaguchi.JPG","page_title":"구다마쓰시","context_page_description":"구다마쓰 시는 야마구치현의 남동부에 위치하는 시이다."},{"page_url":"https://sr.wikipedia.org/wiki/IC_480","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/IC480_-_SDSS_DR14.jpg","page_title":"IC 480","context_page_description":"IC 480 је спирална галаксија у сазвјежђу Близанци која се налази на листи објеката дубоког неба у Индекс каталогу.\\nДеклинација објекта је + 26° 44' 32\\" а ректасцензија 7h 55m 23,1s. Привидна величина објекта IC 480 износи 14,3 а фотографска магнитуда 15,1. IC 480 је још познат и под ознакама UGC 4096, CGCG 148-62, IRAS 07523+2652, PGC 22188."},{"page_url":"https://en.wikipedia.org/wiki/Calamus,_Iowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Our_Savior%E2%80%99s_Kvindherred_Cemetery_02.JPG","page_title":"Calamus, Iowa","context_page_description":"Calamus is a small town in Clinton County, Iowa, United States, located on the historical Lincoln Highway, which was the first transcontinental highway for automobiles across the U.S..\\nCalamus is the only town in Olive Township and had a population of 439 at the 2010 census, which was an 11.4% increase from 2000. Calamus was named after Calamus Creek, which received its name from the great quantities of sweet flag growing in it, derived from the botanical name Acorus calamus, commonly called Sweet Flag or Calamus."},{"page_url":"https://fr.wikipedia.org/wiki/Finale_de_la_Ligue_des_champions_de_l%27UEFA_2000-2001","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Oliver_Kahn_06-2004.jpg","page_title":"Finale de la Ligue des champions de l'UEFA 2000-2001","context_page_description":"La finale de la Ligue des champions de l'UEFA 2000-2001 est la 46ᵉ finale de la Ligue des champions de l'UEFA. Le Bayern Munich remporte un quatrième titre de champion d'Europe après 25 ans d'attente, après avoir échoué deux ans auparavant en finale contre Manchester United, et la saison d'avant en demi-finale contre le Real Madrid. Le Valence CF perd quant à lui sa deuxième finale d'affilée."},{"page_url":"https://ceb.wikipedia.org/wiki/Poggio_Lecceta","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Poggio_Leccetta_-_Pallone_Meteo-Radar_di_Livorno.jpg","page_title":"Poggio Lecceta","context_page_description":"Bungtod ang Poggio Lecceta sa Italya. Nahimutang ni sa lalawigan sa Provincia di Livorno ug rehiyon sa Toscana, sa kasadpang bahin sa nasod, 250 km sa amihanan-kasadpan sa Rome ang ulohan sa nasod. 462 metros ibabaw sa dagat kahaboga ang nahimutangan sa Poggio Lecceta, o 385 ka metros sa ibabaw sa naglibot nga tereyn. Mga 19.6 ka kilometro ang gilapdon sa tiilan niini.\\nAng yuta palibot sa Poggio Lecceta kay lain-lain. Ang kinahabogang dapit sa palibot dunay gihabogon nga 671 ka metro ug 18.9 km sa habagatan-sidlakan sa Poggio Lecceta. Dunay mga 248 ka tawo kada kilometro kwadrado sa palibot sa Poggio Lecceta medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Livorno, 7.7 km sa kasadpan sa Poggio Lecceta. Hapit nalukop sa lasang nga sagolsagol ang palibot sa Poggio Lecceta. Sa rehiyon palibot sa Poggio Lecceta, mga lapyahan talagsaon komon.\\nAng klima mediteranyo. Ang kasarangang giiniton 14 °C. Ang kinainitan nga bulan Hulyo, sa 25 °C, ug ang kinabugnawan Disyembre, sa 4 °C. Ang kasarangang pag-ulan 1,133 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 193 milimetro nga ulan, ug ang kinaugahan Agosto, sa 24 milimetro."},{"page_url":"https://it.wikipedia.org/wiki/Shenyang","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Location_of_Shenyang_Prefecture_within_Liaoning_%28China%29.png","page_title":"Shenyang","context_page_description":"Shenyang è il capoluogo della provincia del Liaoning, e la più popolosa città della Cina nord-orientale.\\nShenyang si chiamava Mukden durante l'epoca Mancese."},{"page_url":"https://en.wikipedia.org/wiki/Erlspitze","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Solsteinhaus_mit_Erlspitze.jpg","page_title":"Erlspitze","context_page_description":"The Erlspitze, at 2,405 m, is the highest mountain of the range to which it gives its name in the southeastern corner of the Karwendel Alps. Its pyramid-shaped summit makes it a good observation peak north of the Erl Saddle and the Solsteinhaus mountain hut."},{"page_url":"https://hu.wikipedia.org/wiki/TER_Bretagne","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Guichen_-_Bourg-des-Comptes_gare.jpg","page_title":"TER Bretagne","context_page_description":"A TER Bourgogne egy regionális vasúthálózat Franciaországban, a Burgundia régióban. Az összesen 39 vonalat alkotó hálózat 126 állomást szolgál ki, hossza 1381 km."},{"page_url":"https://ca.wikipedia.org/wiki/Dreta_cristiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Focus_on_the_Family_Welcome_Center_by_David_Shankbone.jpg","page_title":"Dreta cristiana","context_page_description":"La dreta cristiana o dreta religiosa és un terme usat principalment als Estats Units per a etiquetar les faccions polítiques cristianes conservadores que es caracteritzen pel seu fort suport a les polítiques socialment conservadores. Els conservadors cristians busquen principalment d'aplicar la seva comprensió de les ensenyances del cristianisme a la política i a les polítiques públiques proclamant el valor d'aquestes ensenyances o cercant utilitzar-les per a influir en les lleis i les polítiques públiques.\\nAls Estats Units, la dreta cristiana és una coalició informal formada prop d'un nucli de protestants evangèlics i catòlics romans. La dreta cristiana obté suport addicional dels protestants, jueus i mormons de la línia principal conservadora. El moviment va tenir les seves arrels en la política dels Estats Units que es remunta a la dècada de 1940 i que ha estat especialment influent des de la dècada de 1970. Parcialment, té el suport en l'activisme de base, així com a l'enfocament en qüestions socials i en la capacitat de motivar l'electorat al voltant d'aquests temes."},{"page_url":"https://cy.wikipedia.org/wiki/Blackpool","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Blackpool_Illuminations_and_Tower.jpg","page_title":"Blackpool","context_page_description":"Tref ger y môr yn Swydd Gaerhirfryn, Gogledd-orllewin Lloegr, yw Blackpool. Mae'n gorwedd 40 milltir i'r gogledd-orllewin o Fanceinion, a llai na 30 milltir o Lerpwl.\\nMae wedi dod yn ganolfan twristiaeth yn ystod yr 19eg ganrif, yn enwedig ar gyfer pobl o drefi melinoedd y gogledd. Mae Caerdydd 260.3 km i ffwrdd o Blackpool ac mae Llundain yn 324 km. Y ddinas agosaf ydy Preston sy'n 23 km i ffwrdd.\\nTyfodd ar ôl 1864, wedi i'r rheilffyrdd cael eu adeiladu. Yn 1851, roedd y boblogaeth dros 2,500. Cafodd drydan yn y 1870au. Yn 1930, cafodd 7 miliwn o ymwelwyr mewn blwyddyn. Osgodd y dref ddifrod mawr yn ystod yr Ail Ryfel Byd, oherwydd fod Hitler wedi cynllunio i'w ddefnyddio ar ôl goresgyrn Prydain.\\nTŵr mawr haearn yw'r Twr Blackpool. Cwblheuwyd y tŵr yn 1894."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BC%8A%E5%A4%9A%E6%B3%A2%E5%88%80%E7%A5%9E%E7%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Itahato3.JPG","page_title":"伊多波刀神社","context_page_description":"伊多波刀神社は、愛知県春日井市上田楽町に鎮座する神社。"},{"page_url":"https://en.wikipedia.org/wiki/Our_Lady_of_Compassion_Church,_Upton_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Our_Lady_of_Compassion_Catholic_Church%2C_Green_Street_-_geograph.org.uk_-_445551.jpg","page_title":"Our Lady of Compassion Church, Upton Park","context_page_description":"Our Lady of Compassion Church is a Roman Catholic parish church in the Upton Park area of east London, dedicated to Our Lady of Compassion. Catholics in the area had previously worshipped at chapels attached to schools in the area until the church and its parish were both established in 1911."},{"page_url":"https://fi.wikipedia.org/wiki/Rikky_von_Opel","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Ensign_at_Silverstone_Classic_2012.jpg","page_title":"Rikky von Opel","context_page_description":"Frederick ”Rikky” von Opel on liechtensteinilainen kilpa-autoilija. Hän voitti Lombard North British Formula 3 -sarjan mestaruuden vuonna 1972. Formula 1 -sarjassa von Opel osallistui 14 Grand Prix -viikonloppuun ajaen ensin Ensignillä ja sitten Brabhamilla. Hän ei saavuttanut F1-urallaan yhtään MM-pistettä. Von Opel oli kahdesti yhdeksäs. Hän käytti kilpauransa alkuvaiheilla salanimeä Antonio Bronco.\\nVon Opel oli ensimmäinen ja toistaiseksi ainoa liechtensteinilainen Formula 1 -sarjassa ajanut kuljettaja.\\nRikky von Opel on Opel-autoyhtiön perustajan Adam Opelin lapsenlapsen lapsi."},{"page_url":"https://an.wikipedia.org/wiki/Queensland","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Coa_Queensland.png","page_title":"Queensland","context_page_description":"Queensland ye un estau d'Australia situau a o noreste d'a isla. Muga a o sud con Nueva Galas d'o Sud, a o sudueste con Australia Meridional y a l'ueste con o Territorio d'o Norte, mientres que a l'este i tién a Mar de Coral.\\nYe o segundo estau d'a federación por superficie y o tercero por población. A suya población se concentra a o sudeste d'o estau, a on se troba a capital Brisbane asinas como nuclios toristicos importants como Gold Coast. A economía d'o estau ye dominada por a minería y o torismo.\\nEn primeras, y dica 1851, o territorio feba parti d'a colonia de Nueva Galas d'o Sud."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B0%D0%B1%D0%B5%D0%B1%D1%83%D0%B9%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Tabebuia_impetiginosa_inflorescencias.jpeg","page_title":"Табебуйя","context_page_description":"Табебу́йя — род произрастающих в тропиках Центральной и Южной Америки растений семейства Бигнониевые, включающий в себя около ста видов.\\nАреал рода простирается от северной Мексики и Антильских островов на юг до северной Аргентины и центральной Венесуэлы, включая карибские острова Эспаньола и Кубу. Хорошо известны такие бытовые названия этих деревьев как ипе́, поуи и пау д’арко."},{"page_url":"https://it.wikipedia.org/wiki/Groat_scozzese","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/James_III_of_Scotland_groat_1482_692196.jpg","page_title":"Groat scozzese","context_page_description":"Groat è una moneta d'argento inizialmente dal valore di quattro penny. In Inghilterra fu coniato forse sotto Edoardo I ma sicuramente era coniato da Edoardo III dopo il 1351.\\nIn Scozia questa monete fu coniata dal 1357 fino al 1558."},{"page_url":"https://es.wikipedia.org/wiki/Empaquetamiento_de_c%C3%ADrculos","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/Empilement_compact_plan.svg","page_title":"Empaquetamiento de círculos","context_page_description":"En geometría, el empaquetamiento de círculos se refiere al estudio de la disposición de círculos de tamaños iguales o diversos en una superficie, de tal manera que no se produzcan solapamientos y de modo que todos los círculos se toquen entre sí. La \\"densidad de empaquetado\\" asociada, η de una disposición dada es la proporción de la superficie cubierta por los círculos. Se pueden hacer generalizaciones a dimensiones más altas - esto se llama empaquetamiento de esferas, que generalmente trata solo con esferas idénticas.\\nLa rama de las matemáticas conocida generalmente como \\"empaquetamiento de círculos\\", sin embargo, no se refiere exclusivamente al empaquetado denso de círculos de igual tamaño sino a la geometría y a la combinatoria del empaquetado de círculos de tamaño arbitrario, que dan lugar a los análogos discretos de la transformación conforme, superficies de Riemann y similares.\\nMientras que el círculo tiene una densidad máxima de empaquetado relativamente baja, no es la más baja posible. La \\"peor\\" forma a empaquetar sobre un plano no es conocida, pero el octágono alisado tiene la menor densidad máxima de empaquetado actualmente conocida.​"},{"page_url":"https://hr.wikipedia.org/wiki/Almoravidi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Almoravid_map_reconquest_loc.jpg","page_title":"Almoravidi","context_page_description":"Almoravidi ili Murabiti su berberska i maursko-španjolska dinastija podrijetlom iz Sahare. U 11. stoljeću su vladali širim područjem sjeverozapadne Afrike i Pirinejskim poluotokom. Pod tom dinastijom carstvo Maura je zauzimalo današnji Maroko, Zapadnu Saharu, Mauretaniju, Gibraltar, Tlemsen u Alžiru, veliki dio Senegala, Malija, Španjolske i Portugala. Njihovo carstvo se raspalo pod invazijom Almohada."},{"page_url":"https://de.wikipedia.org/wiki/Indigene_V%C3%B6lker_S%C3%BCdamerikas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Xidea_Aug_1997_13.jpg","page_title":"Indigene Völker Südamerikas","context_page_description":"Indigene Völker Südamerikas werden in Völker des Tieflandes und Völker der Anden unterschieden. Die Bezeichnungen Indianer oder Indios für alle diese Völker sind weit verbreitet, können aber von derart bezeichneten Menschen als beleidigend empfunden werden. Die indigene Bevölkerung Südamerikas wird häufig in Sprachfamilien eingeteilt, wie zum Beispiel Quechua, Aymara, Tupi oder Mapuche, die Angehörigen dieser Sprachfamilien betrachten sich jedoch selbst nicht unbedingt als zusammengehörige Gruppe."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%85%E0%A6%A4%E0%A6%BF%E0%A6%AC%E0%A7%87%E0%A6%97%E0%A7%81%E0%A6%A8%E0%A7%80_%E0%A6%AC%E0%A6%BF%E0%A6%AA%E0%A6%B0%E0%A7%8D%E0%A6%AF%E0%A6%AF%E0%A6%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Black_body.svg","page_title":"অতিবেগুনী বিপর্যয়","context_page_description":"অতিবেগুনী বিপর্যয় বা আলট্রাভায়োলেট ক্যাটাস্ট্রফি হল উনিশ শতকের শেষ দিকে বা বিশ শতকের প্রথম দিককার ক্ল্যাসিকাল পদার্থবিজ্ঞানের একটি ঘটনা। ক্ল্যাসিকাল পদার্থবিজ্ঞান মতে আদর্শ কৃষ্ণবস্তু তাপীয় সাম্যাবস্থায় থেকে সকল কম্পাঙ্কের বিকিরণ ঘটায় এবং কম্পাঙ্ক বৃদ্ধির সাথে সাথে শক্তির বিকিরণ বৃদ্ধি পায়। মোট বিকিরিত শক্তি পরিমাপ করে দেখানো যায় যে কৃষ্ণবস্তু অসীম পরিমাণ শক্তির নির্গমন ঘটাবে যা কিনা শক্তির নিত্যতার নীতির সুস্পষ্ট লঙ্ঘন। তখনই এ সম্পর্কিত নতুন কোনো তত্ত্বের প্রয়োজনীয়তা অনুভূত হয়।\\n১৯১১ সালে পল হেরেনফেস্ট সর্বপ্রথম \\"আলট্রাভায়োলেট ক্যাটাস্ট্রফি\\" শব্দদ্বয় ব্যবহার করেন, তবে মূলত ১৯০০ সালের দিকে র‍্যালে-জিনস সূত্র আবিষ্কারের সময়ই এ ধারণার উৎপত্তি হয়। ১০৫ গিগাহার্জের চেয়ে কম বিকিরিত কম্পাঙ্কের মধ্যের সবধরনের পরীক্ষামূলক ফলাফলের ব্যাখ্যা এ সূত্র নিখুঁতভাবে দিতে পারলেও এ সীমার বাইরের পরীক্ষামূলক ব্যাখ্যার ফলাফল দিতে এ সূত্র ব্যর্থ হয়। তখন তাত্ত্বিক আর পরীক্ষামূলক ফলাফল ভিন্ন হয়ে পড়ে। এই ভিন্নতার সৃষ্টি তড়িতচুম্বকীয় বর্ণালীর অতিবেগুনী রশ্মির সীমা থেকে শুরু হওয়ায় এ ঘটনাকে \\"অতিবেগুনী বিপর্যয়\\" বলে অভিহিত করা হয়।"},{"page_url":"https://de.wikipedia.org/wiki/Camposanto_Monumentale","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Camposanto_Pisa_100.JPG","page_title":"Camposanto Monumentale","context_page_description":"Der Camposanto Monumentale ist eine Friedhofsanlage in Pisa.\\nDer Camposanto ist der nördliche Abschluss der Piazza dei Miracoli mit dem Dom, dem Baptisterium und dem berühmten Schiefen Turm. Die gotische Fassade mit Marmorblendarkaden wirkt wie eine Kulisse."},{"page_url":"https://hu.wikipedia.org/wiki/Palenciana","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/36/Tejados_de_Palenciana.jpg","page_title":"Palenciana","context_page_description":"Palenciana település Spanyolországban, Córdoba tartományban. Palenciana Alameda községekkel határos. Lakosainak száma 1589 fő."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D1%80%D0%BE%D0%B4%D1%81%D0%BA%D0%BE%D0%B9_%D1%81%D0%BA%D0%B2%D0%B5%D1%80_(%D0%9C%D0%B0%D1%80%D0%B8%D1%83%D0%BF%D0%BE%D0%BB%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/MariupolPlayground.jpg","page_title":"Городской сквер (Мариуполь)","context_page_description":"Городско́й сквер — излюбленное место отдыха жителей и гостей Мариуполя, расположен в центре города, окружён со всех сторон проезжей частью проспекта Мира. К западу от сквера находится Донецкий областной русский драматический театр. В центре сквера расположен фонтан. На территории сквера произрастают несколько видов акаций и клёнов, вязы, крымские сосны, голубые ели, казацкий можжевельник, спирея, вечнозелёный самшит, колючая гледичия, берёзы, липы, дубы, сирень и шелковица.\\nТерритория современного сквера была оставлена незастроенной специально для отдыха жителей ещё со времён основания города. Назывался ранее Александровской площадью, позже — Площадью Свободы, Центральным сквером, Театральным сквером. В 1862 году здесь была заложена большая трёхпрестольная церковь Св. Марии Магдалины, Св. Иоанна Крестителя и Покрова Пресвятой Богородицы. Церковь достроена и освящена лишь к 1897 году. Построенный храм можно было увидеть далеко с моря и служил своеобразным маяком для рыбаков и моряков. В начале XX века в центре сквера появился фонтан. Первый фонтан сквера был вывезен фашистами на второй день оккупации."},{"page_url":"https://nl.wikipedia.org/wiki/Ferro_(Canarische_Eilanden)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Valverde2009.jpg","page_title":"Ferro (Canarische Eilanden)","context_page_description":"Ferro is het meest zuidwestelijke eiland van de Canarische Eilanden, een archipel in de Atlantische Oceaan. Het behoort tot Spanje. Het eiland wordt ook wel La Isla Chiquita, oftewel het kleine eiland, genoemd en deze naam dankt het aan het feit dat Ferro het kleinste van de bewoonde Canarische Eilanden is."},{"page_url":"https://es.wikipedia.org/wiki/Cl%C3%A1sico_Chacabuco","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/STUD_RED_RAFA_%28BRZ%29.png","page_title":"Clásico Chacabuco","context_page_description":"El Clásico Chacabuco es una carrera clásica para caballos fondistas que se disputa en el Hipódromo Argentino de Palermo, sobre 2400 metros de pista de césped y convoca a machos y hembras de 4 años y más edad, a peso por edad. Está catalogado como un certamen de Grupo 2 en la escala internacional. Hasta el año 2011 inclusive, este premio se disputó sobre pista de arena con 2500 metros de recorrido.\\nEl nombre de esta competencia hace referencia a la Batalla de Chacabuco, una contienda de la Independencia de Chile, en la que se impuso el Ejército de los Andes liderado por el General San Martín, sobre el Ejército Realista de España. Se realiza tradicionalmente en el mes de julio."},{"page_url":"https://vi.wikipedia.org/wiki/R%E1%BB%ABng_tr%C3%A0m_Tr%C3%A0_S%C6%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Tham_quan_Tr%C3%A0_S%C6%B0.jpg","page_title":"Rừng tràm Trà Sư","context_page_description":"Rừng tràm Trà Sư là một khu rừng và khu du lịch sinh thái nằm trên địa bàn xã Văn Giáo, huyện Tịnh Biên và một phần trên xã Ô Long Vỹ, huyện Châu Phú, tỉnh An Giang. Đây là rừng ngập nước tiêu biểu cho vùng Tây sông Hậu, là nơi sinh sống của nhiều loài động vật và thực vật thuộc hệ thống rừng đặc dụng Việt Nam."},{"page_url":"https://en.wikipedia.org/wiki/Austrian_walled_towns","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Teile_der_stadtmauer_klingergasse_schlaining.JPG","page_title":"Austrian walled towns","context_page_description":"Walled towns in Austria started to appear in the 11th century. Their establishment was closely connected with the development of Austria as a march of the Holy Roman Empire and in particular by the Stauffenberg Emperors and their Marcher Lords, the Babenbergs. In present-day Austria, there are 106 towns or cities that were walled. The walls of Radstadt, Freiburg, Hainburg and Drosendorf survive almost intact, and Austria has some of the most impressive walled towns in Europe.\\nOther cities or towns such as Vienna, Salzburg and St Pölten have had their defences almost completely obliterated. In Austria, the procedure for granting civic status or creating a Stadt was relatively simple. Initially, a local lord or official ministerialis could petition for market rights or Marktrect. At that point, the town would be laid out by a surveyor and it would have been surrounded by an earthen-banked enclosure surmounted with a vertical wooden palisade. Often a stone gatehouse or Tor would be built for the collection of custom dues from traders coming to the market."},{"page_url":"https://tr.wikipedia.org/wiki/Asya_ekonomisi","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/4758976353_tehran_b.jpg","page_title":"Asya ekonomisi","context_page_description":"Asya ekonomisi, 49 farklı devlette yaşayan 4.4 milyardan fazla insandan oluşur. Altı devletin kısmen Asya'da olmakla birlikte, ekonomik ve siyasi açıdan başka bir bölgeye ait olduğu düşünülmektedir. Asya dünyadaki en hızlı büyüyen ekonomik bölge ve SAGP'ye göre GSYİH bakımından en büyük kıtasal ekonomidir. Çin, Japonya ve Hindistan dünyanın en büyük on ekonomisi arasındadır. Dahası, Asya, Japon ekonomik mucizesinden başlayarak, Güney Kore'deki Han Nehri Mucizesi ve Çin'deki ekonomik patlama ile dünyanın en uzun ekonomik patlamasının merkezidir.\\nTüm dünya bölgelerinde olduğu gibi, Asya'nın zenginliği de ülkeler arasında ve içerisinde farklılık göstermektedir. Bunun nedeni, büyük kültür çeşitlilikleri, ortamlar, tarihi bağlar anlamına gelen ve hükûmet sistemleri gibi geniş bir boyuta sahip olmasıdır."},{"page_url":"https://en.wikipedia.org/wiki/Navy_Precision_Optical_Interferometer","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/NPOI.Usic.jpg","page_title":"Navy Precision Optical Interferometer","context_page_description":"The Navy Precision Optical Interferometer is an American astronomical interferometer, with the world's largest baselines, operated by the Naval Observatory Flagstaff Station in collaboration with the Naval Research Laboratory and Lowell Observatory. The NPOI primarily produces space imagery and astrometry, the latter a major component required for the safe position and navigation of all manner of vehicles for the DoD. The facility is located at Lowell's Anderson Mesa Station on Anderson Mesa about 25 kilometers southeast of Flagstaff, Arizona. Until November 2011, the facility was known as the Navy Prototype Optical Interferometer. Subsequently, the instrument was temporarily renamed the Navy Optical Interferometer, and now permanently, the Kenneth J. Johnston Navy Precision Optical Interferometer – reflecting both the operational maturity of the facility, and paying tribute to its principal driver and retired founder, Kenneth J. Johnston.\\nThe NPOI project was initiated by the United States Naval Observatory in 1987. Lowell joined the project the following year when the USNO decided to build the NPOI at Anderson Mesa."},{"page_url":"https://es.wikipedia.org/wiki/Str%C4%97va","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Streva.jpg","page_title":"Strėva","context_page_description":"El Strėva es un río que atraviesa los municipios lituanos de Trakai y Kaunas. Sobre sus aguas congeladas libraron en 1348 la batalla homónima el Gran Ducado de Lituania y los caballeros teutones. En 1962, el río fue represado para crear el embalse de Elektrėnai, el tercer lago artificial más grande de Lituania. El Strėva atraviesa Elektrėnai, Žiežmariai y Semeliškės. Según un estudio de 2001, era uno de los ríos más limpios de la parte lituana de la cuenca del Neman.\\nEl río recibe otros nombres en otros idiomas: Reka Strava, Strava y Streva.​"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%B5%D0%BE%D1%80%D1%96%D1%8F_%D0%BA%D0%B5%D1%80%D1%83%D0%B2%D0%B0%D0%BD%D0%BD%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/PID_en.svg","page_title":"Теорія керування","context_page_description":"Теорія керування — наука про принципи і методи керування різними системами, процесами і об'єктами.\\nТеоретичним підґрунтям теорії керування є кібернетика і теорія інформації.\\nСуть теорії керування: на основі системного аналізу об'єкта керування складається його математична модель, після чого розробляється алгоритм керування для отримання бажаних характеристик плину процесу або досягнення цілей керування.\\nДана галузь знань добре розвинена і знаходить широке застосування в сучасній техніці у вигляді такої дисципліни, як теорія автоматичного керування. У соціально-економічних системах теорію керування присвячено способам і методам аналізу, прогнозу і можливостям регулювання діяльності різних людських спільнот. Теорія керування, як будь-яка наука, має свою методологію і методичне забезпечення. Проте в області природничих наук і техніки, теорія керування має значно більше успіхів, ніж в соціально-економічній сфері, де, очевидно, діє обмеження, що випливає з принципу, — «система не може пояснити саму себе»."},{"page_url":"https://af.wikipedia.org/wiki/Abel_Azcona","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/El_artista_Abel_Azcona%2C_retratado_en_el_C%C3%ADrculo_de_Bellas_Artes_de_Madrid.jpg","page_title":"Abel Azcona","context_page_description":"Abel Azcona is 'n kunstenaar wat bekend staan as die enfant terrible van Spaanse kontemporêre kuns. Sy werk, met duidelike outobiografiese en politieke aspekte druk 'n diepliggende opstand teen die samelewing uit. Dit word gemanifesteer in artistieke media wat gebore is in opvoerings en ontwikkel word tot uitstallings, beeldhouwerke, videokuns, skilderkuns of skryfwerk, met letterkundige werke van opstelle tot literêre of gedenktekste. Sy eerste werke het gehandel oor persoonlike identiteit, geweld en die grense van pyn, wat ontwikkel het tot werke van kritiese, politieke en maatskaplike aard.\\nSy werk is te sien in galerye en uitstallings regoor die wêreld en het internasionale aandag getrek, insluitende die Arsenaal van Venesië, die Asian Art Biennale in Dhaka en Taipei, en die tweejaarlikse uitstalling in Lyon, die International Miami Performance festival en die tweejaarlikse Bangladesh Live Art Biennial."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%96%B0%E7%95%8C%E5%95%86%E5%A0%B4%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/WaldorfShoppingCtr.JPG","page_title":"新界商場列表","context_page_description":"本条目为香港商场列表之分条目。粗体即表示该区大型商场。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%91%D7%99%D7%AA_%D7%A0%D7%98%D7%99%D7%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/NMMI_IMG_8842.JPG","page_title":"בית נטיף","context_page_description":"בֵּית נָטִיף או בית נתיף היה כפר ערבי גדול בעמק האלה, בגבול הרי יהודה ושפלת יהודה, כ־20 קילומטרים מערבית לבית לחם וכ־7 קילומטרים דרומית להר־טוב, בגובה 420 מטר מעל פני הים. במלחמת העצמאות נכבש הכפר ותושביו נמלטו. במפה המקום מכונה חָרְבַּת בֵּית־נָטִיף."},{"page_url":"https://sv.wikipedia.org/wiki/Formica_mucescens","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/Formica_mucescens_casent0103491_dorsal_1.jpg","page_title":"Formica mucescens","context_page_description":"Formica mucescens är en myrart som beskrevs av Wheeler 1913. Formica mucescens ingår i släktet Formica och familjen myror. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D1%96%D0%B0%D0%B3%D1%96%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/97/Giaginski_Raion_Coat_of_Arms.png","page_title":"Гіагінський район","context_page_description":"Гіагі́нський райо́н; з семи районів Адигеї займає 2-е місце з території і 3-є місце з населення. Все населення проживає в сільській місцевості: 5 сільських адміністраціях і 30 сільських населених пунктах. Щільність населення — 42,0 осіб/км².\\nАдміністративний центр — станиця Гіагінська, розташована за 35 км від столиці республіки міста Майкоп. Залізнична станція. Найбільший за чисельністю населення райцентр Адигеї — 15,2 тис. жителів, що становить 46% всього населення району."},{"page_url":"https://fr.wikipedia.org/wiki/Runabout_(automobile)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Bertone167_%2827092065667%29.jpg","page_title":"Runabout (automobile)","context_page_description":"Un runabout est un style de carrosserie de voiture répandu avant la première guerre mondiale. C'était une plateforme légère, sans pare-brise ni toit ni portes et une seule rangée de sièges. La forme devint indiscernable des roadsters et le terme est tombé dans l'oubli. L'approche a évolué vers la moderne \\"voiture de ville\\" ou citadine."},{"page_url":"https://nl.wikipedia.org/wiki/African_Championship_of_Nations_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Mokaba_stadium_%284739619696%29.jpg","page_title":"African Championship of Nations 2014","context_page_description":"De African Championship of Nations 2014 was de derde editie van dit voetbaltoernooi van de CAF voor landenteams. Bij deze toernooien mogen de landen alleen spelers uit de eigen competitie opstellen. Het toernooi werd gehouden van 11 januari tot en met 1 februari 2014 in Zuid-Afrika. Het toernooi werd gewonnen door Libië dat in de finale Ghana versloeg na strafschoppen. Nigeria werd derde."},{"page_url":"https://az.wikipedia.org/wiki/Makartur_evkalipti","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Eucalyptus_macarthurii_Bowral.jpg","page_title":"Makartur evkalipti","context_page_description":"Makartur evkalipti — mərsinkimilər fəsiləsinin evkalipt cinsinə aid bitki növü."},{"page_url":"https://fr.wikipedia.org/wiki/Pierre-Andr%C3%A9_Latreille","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Latreille_%28Louis_Figuier%2C_1875%29.jpg","page_title":"Pierre-André Latreille","context_page_description":"Pierre André Latreille, né le 20 novembre 1762 à Brive-la-Gaillarde et mort le 6 février 1833 à Paris, est un entomologiste français.\\nIl publie son premier ouvrage important en 1796 et travaille au Muséum National d'Histoire Naturelle. Son travail sur la systématique et la taxonomie des arthropodes lui vaut le respect et de nombreux éloges, et notamment le fait que Georges Cuvier lui demande d'écrire le volume sur les arthropodes de son œuvre monumentale Le Règne Animal, seule partie qui ne soit pas écrite par Cuvier.\\nLatreille est considéré comme l'entomologiste le plus important de son temps et est décrit par l'un de ses élèves comme « le prince des entomologistes »."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%BD%D0%B5%D0%B6%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D1%80%D0%B0%D0%BA%D1%82%D0%BE%D1%80%D0%BD%D1%8B%D0%B9_%D0%B7%D0%B0%D0%B2%D0%BE%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Firefighting_vehicle_Onegec310.JPG","page_title":"Онежский тракторный завод","context_page_description":"ООО «Амкодор-Онего» — российский производитель тракторов, входящий в структуру машиностроительной компании «Амкодор». Предприятие находится в городе Петрозаводске. Завод основан 1 сентября 1703 года."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%B3%D9%8A%D8%A7%D8%AD%D8%A9_%D9%81%D9%8A_%D9%85%D8%B5%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Pyramid_at_Lahun.jpg","page_title":"السياحة في مصر","context_page_description":"تعدّ السياحة في مصر أحد أهم مصادر الدخل القومي بما توفره من عائدات دولارية سنوية، وعوائد العملة الأجنبية التي مكنتها من المشاركة بشكل كبير بالناتج الإجمالي المحلي، ومكافحة البطالة عن طريق توظيف شريحة واسعة من القوى العاملة في مصر. وتعد مصر من أبرز الدول السياحية في العالم بما تستحوذ عليه من أعداد السائحين الوافدين في العالم، وتميزها بوفرة المزارات السياحية على اختلاف أنواعها، وانتشار المعابد والمتاحف والآثار والمباني التاريخية والفنية والحدائق الشاسعة على أرضها، وامتلاكها لبنية تحتية قوية تقوم على خدمة قطاع السياحة بما في ذلك الغرف الفندقية والقرى والمنتجعات السياحية وشركات السياحة ومكاتب الطيران. وتعد مناطق الأقصر،و أسوان،و القاهرة،و الإسكندرية،و الساحل الشمالي،و البحر الأحمر،و جنوب سيناء من أكثر المناطق جذباً للسياح بشكل عام. ويعود تاريخ السياحة في مصر إلى المصريين القدماء، واستمرت كوجهة ومقصد سياحي مرغوب على مدار القرون الماضية وخلال التاريخ المعاصر. واختارت منظمة اليونسكو ست مواقع تراثية ثقافية مصرية متنوعة ما بين مصرية قديمة وقبطية وإسلامية بالإضافة إلى موقع للتراث الطبيعي وذلك ضمن قائمة مواقع التراث العالمي."},{"page_url":"https://sv.wikipedia.org/wiki/Morpho_hecuba","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Morpho_hecuba_hecuba_MHNT_dos.jpg","page_title":"Morpho hecuba","context_page_description":"Morpho hecuba är en fjärilsart som beskrevs av Carl von Linné 1771. Morpho hecuba ingår i släktet Morpho och familjen praktfjärilar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://nl.wikipedia.org/wiki/Neolucanus_castanopterus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Neolucanus_castanopterus_sjh.jpg","page_title":"Neolucanus castanopterus","context_page_description":"Neolucanus castanopterus is een keversoort uit de familie vliegende herten. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1831 door Hope."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9C%D7%90%D7%95_%D7%92%D7%99%D7%99%D7%A8_%D7%A4%D7%95%D7%9F_%D7%A9%D7%95%D7%95%D7%A4%D7%A0%D7%91%D7%95%D7%A8%D7%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/GeyrvonSchweppenburgLondon.jpg","page_title":"לאו גייר פון שוופנבורג","context_page_description":"לאו גייר פון שוופנבורג היה מפקד שריון בכיר בוורמאכט במלחמת העולם השנייה."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Washington_County,_Vermont","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/21Athen01.jpg","page_title":"National Register of Historic Places listings in Washington County, Vermont","context_page_description":"This is a list of the National Register of Historic Places listings in Washington County, Vermont.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Washington County, Vermont, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in a map.\\nThere are 69 properties and districts listed on the National Register in the county, including 2 National Historic Landmarks.\\nThis National Park Service list is complete through NPS recent listings posted July 31, 2020."},{"page_url":"https://pnb.wikipedia.org/wiki/%DA%86%DA%A9_319_%DA%88%D8%A8%D9%84%DB%8C%D9%88_%D8%A8%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/District_Map_Lodhran.jpg","page_title":"چک 319 ڈبلیو بی","context_page_description":"چک 319 ڈبلیو بی ضلع لودھراں دی تصیل دنیاپور دا اک پنڈ اے ۔ اس پنڈ دی زمیناں نوں پاکپتن نہر سسٹم دے اک حصے لوئر پاکپتن نہر دا پانی لگدا اے ۔اس نہری پربندھ نوں ویسٹرن بار ڈویژن دا ناں دتا گیا اے تے اس پنڈ دے نال ڈبلیو بی ایسے لئی لگدا اے ۔"},{"page_url":"https://ceb.wikipedia.org/wiki/Hellerau","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Dresden_Hellerau_Festspielhaus_0906.jpg","page_title":"Hellerau","context_page_description":"Bahin nga lungsod ang Hellerau sa Alemanya. Nahimutang ni sa estado pederal sa Saxony, sa sidlakang bahin sa nasod, 160 km sa habagatan sa Berlin ang ulohan sa nasod. 212 metros ibabaw sa dagat kahaboga ang nahimutangan sa Hellerau, ug adunay 6,275 ka molupyo.\\nAng yuta palibot sa Hellerau kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 233 ka metro ug 1.0 km sa amihanan-sidlakan sa Hellerau. Dunay mga 762 ka tawo kada kilometro kwadrado sa palibot sa Hellerau nga hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Dresden, 7.3 km sa habagatan sa Hellerau. Sa rehiyon palibot sa Hellerau, mga bungtod, ug mga lasang talagsaon komon.\\nHapit nalukop sa lasang nga sagolsagol ang palibot sa Hellerau. Ang klima baybayon. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Hulyo, sa 21 °C, ug ang kinabugnawan Disyembre, sa -4 °C."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BD%D0%B4%D0%B5%D0%B9_%D0%90%D0%B4%D0%B5%D0%BB%D0%B0%D0%B4%D0%B6%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Sunday_photo.jpg","page_title":"Сандей Аделаджа","context_page_description":"Са́ндей Сунка́нмі Адела́джа — засновник і керівник релігійної організації «Посольство боже»."},{"page_url":"https://ast.wikipedia.org/wiki/Lemuroidea","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Katta_Lemur_catta.jpg","page_title":"Lemuroidea","context_page_description":"Los lémures son unos primates estrepsirrinos endémicos de la isla de Madagascar. Reciben el so nome polos lémur, pantasmes o espíritos de la mitoloxía romana, por cuenta de les estrueldoses vocalizaciones qu'emiten, los sos güeyos brillosos y los vezos nocherniegos de delles de les sos especies. Anque de cutiu confundense con primates acentrales, los primates antropoides nun evolucionaron de los lémures, anque comparten traces morfolóxiques y de comportamientu con primates basales.\\nCon un pesu que va dende los trenta gramos hasta los nueve kilogramos nes especies actuales, los lémures comparten munchos de les traces básiques de los primates, como manes y pies con cinco deos y pulgar oponible, y uñes en llugar de garres. Sicasí, la so proporción cerebru-masa corporal ye menor que nos primates antropoides, y, al igual que los demás primates estrepsirrinos, tienen la ñariz húmeda». Los lémures son xeneralmente los estrepsirrinos más sociales y comuníquense más con golores y vocalizaciones que con señales visuales. Tienen un metabolismu basal relativamente baxu, munchos reprodúcense estacionalmente, tienen periodos de dormancia, y dalgunos amuesen un dominiu social de les femes."},{"page_url":"https://ca.wikipedia.org/wiki/Menachem_Mendel_Schneerson","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Signature_of_the_Rebbe_-_Menachem_M._Schneerson.png","page_title":"Menachem Mendel Schneerson","context_page_description":"El darrer Rebe de Lubavitx, Rabbi Menahem Mendel Schneerson, setè líder de la dinastia jasídica de Habad Lubavitx. Conegut també com el Rebe, és apreciat per la seva aportació al desenvolupament i fortificació del judaisme posterior a l'Holocaust. Per als seus centenars de milers de seguidors, simpatitzants i admiradors arreu del món, el Rebe és una de les figures jueves més importants del segle xx, i el responsable de despertar la consciència del judaisme mundial."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8F%8C%E6%8B%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Pinyin_PlusPlus_Double_Pinyin_Scheme.png","page_title":"双拼","context_page_description":"双拼是汉语拼音输入法的一种编码方案。相对于全拼而言，使用双拼输入汉字时只需输入一个代表声母的字母，一个代表韵母的字母，就可以打出任意一个中文单字了。\\n目前Windows、Android、macOS、iOS平台上都有输入法支持双拼，包括iOS系统自带输入法、QQ输入法、百度输入法、搜狗输入法、谷歌输入法和微软必应输入法等。"},{"page_url":"https://en.wikipedia.org/wiki/Ford_Falcon_(XA)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6b/Ford_XA_Falcon_GT_Hardtop.JPG","page_title":"Ford Falcon (XA)","context_page_description":"The Ford Falcon (XA) is a full-size car that was produced by Ford Australia from 1972 to 1973. It was the first iteration of the third generation of this Australian-made model and also included the Ford Fairmont (XA)—the luxury-oriented version of the Falcon."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AE%E0%A6%BE%E0%A6%B0%E0%A6%BF%E0%A6%AF%E0%A6%BC%E0%A6%BE_%E0%A6%B6%E0%A6%BE%E0%A6%B0%E0%A6%BE%E0%A6%AA%E0%A7%8B%E0%A6%AD%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Maria_Sharapova_UNDP.jpg","page_title":"মারিয়া শারাপোভা","context_page_description":"মারিয়া ইয়ুরেভনা শারাপোভা সাবেক ১নং রাশিয়ান পেশাদার টেনিস খেলোয়াড় এবং চারবারের গ্র্যান্ড স্ল্যাম সিঙ্গেলস চ্যাম্পিয়ন ও তিনবারের রানার আপ। ২১ মে, ২০১২ এর হালনাগাদ অনুসারে, তার র‌্যাংকিং ২ নম্বরে ছিল।"},{"page_url":"https://pl.wikipedia.org/wiki/Asnan","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Asnan_vue_g%C3%A9n%C3%A9rale.jpg","page_title":"Asnan","context_page_description":"Asnan – miejscowość i gmina we Francji, w regionie Burgundia-Franche-Comté, w departamencie Nièvre.\\nWedług danych na rok 1990 gminę zamieszkiwało 145 osób, a gęstość zaludnienia wynosiła 30 osób/km²."},{"page_url":"https://en.wikipedia.org/wiki/F55_(classification)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Cycling_athletics_and_muscle_profile_disability_sports.png","page_title":"F55 (classification)","context_page_description":"F55 is a disability sport classification for disability athletics for people who compete in field events from a seated position. Sportspeople in this class have full arm function, partial trunk function and no lower limb function. Different disability groups compete in this class, including people with spinal cord injuries. The classification was previously known as lower 3, upper 4."},{"page_url":"https://es.wikipedia.org/wiki/Langhirano","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Torrechiara_-_Castello.JPG","page_title":"Langhirano","context_page_description":"Langhirano es un municipio situado en el territorio de la provincia de Parma, en Emilia-Romaña, .​"},{"page_url":"https://sv.wikipedia.org/wiki/Mikojan-Gurevitj_MiG-17","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/MiG-17_landing_by_StuSeeger.jpeg","page_title":"Mikojan-Gurevitj MiG-17","context_page_description":"Mikojan-Gurevitj MiG-17, NATO-rapporteringsnamn \\"Fresco\\", är ett enmotorigt jetflygplan som konstruerades av Mikojan-Gurevitj 1950–1952 och fanns ute på förband i Sovjetunionen 1953. Planet är mid- och pilvingat. Totalt tillverkades det i fem olika versioner, A till E.\\nUtöver den sovjetiska produktionen, förekom tillverkning i Polen, Kina och Tjeckoslovakien."},{"page_url":"https://en.wikipedia.org/wiki/Sport_in_Nur-Sultan","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/BC_Astana_-_BC_Azovmash_2014-02-02.JPG","page_title":"Sport in Nur-Sultan","context_page_description":"Nur-Sultan is home to many sports teams."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_op_7_augustus","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Scamozzi_portrait_by_Veronese.jpg","page_title":"Lijst van personen overleden op 7 augustus","context_page_description":"Dit is een lijst van personen die overleden zijn op 7 augustus.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina.\\n461 - Majorianus, Romeinse keizer en Romeins senator uit het Oude Rome bewerken\\n742 - Balj ibn Bishr al-Qushayri, heerser en militair leider van de Omajjaden bewerken\\n1028 - Alfons V van León, soeverein uit het Koninkrijk León bewerken\\n1106 - Keizer Hendrik IV, keizer, Keizer van het Heilige Roomse Rijk en hertog van Beieren uit het Heilige Roomse Rijk bewerken\\n1218 - Adolf III van Berg, Duitse graaf, kruisvaarder bewerken\\n1385 - Johanna van Kent, Britse hertogin, politicus bewerken\\n1391 - Ocko I tom Brok, Duitse hoofdeling bewerken\\n1437 - Maria I van Auvergne, gravin van Auvergne, politicus bewerken\\n1485 - Alexander Stewart, Britse hertog, condottiero bewerken\\n1491 - Jacobus Barbireau, Belgische componist bewerken"},{"page_url":"https://nl.wikipedia.org/wiki/Toxopneustes_pileolus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Toxopneustes_pileolus_distribution_range.jpg","page_title":"Toxopneustes pileolus","context_page_description":"Toxopneustes pileolus is een zee-egel uit de familie Toxopneustidae.\\nDe wetenschappelijke naam van de soort werd in 1816 gepubliceerd door Jean-Baptiste de Lamarck."},{"page_url":"https://br.wikipedia.org/wiki/Fazan_lost_melen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Lophura_erythrophthalma1.jpg","page_title":"Fazan lost melen","context_page_description":"Ar fazan lost melen a zo ur spesad evned eus kerentiad ar Phasianidae."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%B3%D8%AC%D8%AF_%D8%AC%D8%A7%D9%85%D8%B9_%D8%A7%D9%87%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/%D9%85%D8%B3%D8%AC%D8%AF_%D8%AC%D8%A7%D9%85%D8%B9_%D8%A7%D9%87%D8%B1.jpg","page_title":"مسجد جامع اهر","context_page_description":"مسجد جامع اهر مربوط به دوره ایلخانی - دوره صفوی است و در اهر، خیابان قدس واقع شده و این اثر در تاریخ ۷ مهر ۱۳۸۱ با شمارهٔ ثبت ۶۱۵۳ به‌عنوان یکی از آثار ملی ایران به ثبت رسیده است."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9A%B0%EC%8B%9C%EC%95%BC%EB%A7%88_%EC%97%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Ushiyama_Station_02.JPG","page_title":"우시야마 역","context_page_description":"우시야마 역은 일본 아이치현 가스가이시에 있는 나고야 철도 고마키 선의 역이다. 역 번호는 KM09이다."},{"page_url":"https://la.wikipedia.org/wiki/Bibliotheca_Bodleiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Bodleian_Library.jpg","page_title":"Bibliotheca Bodleiana","context_page_description":"Bibliotheca Bodleiana, ante 1602 condita, est bibliotheca communis universitatis Oxoniensis, quae omnes libros in Britanniarum Regno divulgatos tenere debet. Bibliotheca nomen Thomas Bodley fert, qui ab anno 1597 vitam restitutioni et amplificationi bibliothecae Universitatis Oxoniensis dicavit."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E6%B0%91%E5%9C%92%E9%BA%B5%E5%AE%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Elgin_Street_Hong_Kong2.jpg","page_title":"民園麵家","context_page_description":"民園麵家（Man Yuen Noodles），係香港一間執咗笠嘅麵檔，喺香港島中環荷李活道68至70號A，出名菜式有牛腩、豬手同水餃。"},{"page_url":"https://de.wikipedia.org/wiki/Petersaue","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Chemische_Fabrik_Kalle_fg01.JPG","page_title":"Petersaue","context_page_description":"Die Petersaue ist eine große Binneninsel im Rhein und übertrifft mit einer Fläche von 50 Hektar die Größe der Insel Mainau im Bodensee. Sie ist die oberste Insel in der Kette der Rheinauen. Sie gehört zum Wiesbadener Stadtteil Mainz-Kastel und erstreckt sich über eine Länge von 2,98 Kilometern zwischen den Ländern Hessen und Rheinland-Pfalz bis hin zur ehemaligen preußisch-hessischen Landesgrenze bei Mainz-Amöneburg von Stromkilometer 499 bis 501,9."},{"page_url":"https://it.wikipedia.org/wiki/Cornuti","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1b/Cornuti_scutum.svg","page_title":"Cornuti","context_page_description":"I Cornuti erano una unità di auxilia palatina del tardo Impero romano, da cui ebbero probabilmente ebbero origine le unità dei Cornuti iuniores e dei Cornuti seniores."},{"page_url":"https://cs.wikipedia.org/wiki/Jaroslav_Eduard_Dvo%C5%99%C3%A1k","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/01._Jaroslav_Eduard_Dvo%C5%99%C3%A1k%2C_Exteri%C3%A9r%2C_olej_na_pl%C3%A1tn%C4%9B_150_x_100_cm%2C_1979.jpg","page_title":"Jaroslav Eduard Dvořák","context_page_description":"Jaroslav Eduard Dvořák je český malíř a sochař, vysokoškolský pedagog, zakládající člen Volného seskupení 12/15 Pozdě, ale přece."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9E%E1%83%90%E1%83%98%E1%83%A0%E1%83%98_%E1%83%93%E1%83%90%E1%83%98%E1%83%96%E1%83%90","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/de/Paradisio_manchot.jpg","page_title":"პაირი დაიზა","context_page_description":"პაირი დაიზა — ყველაზე დიდი ზოოპარკი ბელგიაში, რომელიც კერძო საკუთრებაა და მდებარეობს სოფელ ბრიუჟლეტში. მოიცავს 65 ჰექტარზე გაშლილ პარკს, სადაც 5,000-ზე მეტი ცხოველი ბინადრობს. აღსანიშნავია ის, რომ არსებობს ზოოპარკის განსაკუთრებული განაწესი, რაც ითვალისწინებს ადამიანისთვის უსაფრთხო ცხოველის მნახველთა ტერიტორიაზე შეშვებას, სადაც ადამიანებს საშუალება აქვთ ნორმის ფარგლებში მოეფერონ მათ და გამოკვებონ ისინი. პარკს სანახავად წელიწადში საშუალოდ 2 მილიონი ადამიანი სტუმრობს. სახელი „პაირი დაიზა“ აღებულია ძველი სპარსული სიტყვიდან pairi daēza რაც ნიშნავს „სამოთხეს“.\\nზოოპარკი გაიხსნა 1994 წლის 11 მაისს და თავიდან ერქვა „პარადისიო“. 2006 წელს ზოოპარკში აშენდა ევროპაში სიდიდით პირველი ჩინური ბაღი, სადაც შეხვდებით ბუდას ტაძარს, ტრადიციულ სახლებს, ჩანჩქერებს, ძვირფას ქვებს, მცენარეებს და ცხოველებს: ყანჩას, წითელ პანდას, მუნჯაკს. ოდნავ მოგვიანებით 2009 წელს აშენდა ინდონეზიური ბაღიც, სახელად „განეშას სამეფო“. ის ოთხ ჰექტარს მოიცავს და ასევე ევროპაში სიდიდით პირველი ინდონეზიური ბაღია. აქ შეგიძლიათ მოინახულოთ სახლები ტრადიციულ სტილში, რომლის სიახლოვესაც უამრავი იშვიათი სახეობის მცენარე და ქვა შეგხვდებათ. აღსანიშნავია აგრეთვე ანდალუზიური ბაღი, ზეთისხილისა და ვარდის ბაღებიც."},{"page_url":"https://id.wikipedia.org/wiki/Resolusi_1407_Dewan_Keamanan_Perserikatan_Bangsa-Bangsa","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/af/Un-somalia.png","page_title":"Resolusi 1407 Dewan Keamanan Perserikatan Bangsa-Bangsa","context_page_description":"Resolusi 1407 Dewan Keamanan Perserikatan Bangsa-Bangsa, diadopsi pada 3 Mei 2002. Usai mengulang resolusi-resolusi seputar situasi di Somalia, DKPBB meminta Sekjen untuk membentuk tim untuk menulai kewajiban panel pakar untuk memantau pelanggaran embargo senjata terhadap negara tersebut."},{"page_url":"https://en.wikipedia.org/wiki/Ole_Frimer","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/OleFrimer-Aarhus-2012-mbn.jpg","page_title":"Ole Frimer","context_page_description":"Ole Erik Frimer is a Danish blues guitarist, singer and songwriter."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BD%D0%B3%D0%B1%D0%B2%D0%B0,_%D0%91%D0%B5%D0%BD%D1%83%D0%B0_%D0%9A%D1%80%D0%B8%D1%81%D1%82%D0%B8%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Beno%C3%AEt_Angbwa_3336.jpg","page_title":"Ангбва, Бенуа Кристиан","context_page_description":"Оссоемея́нг Бенуа́ Кристиа́н Ангбва́ — камерунский футболист, защитник национальной сборной Камеруна.\\nПо правилам русского языка, фамилия «Ангбва» не склоняется, поскольку является французской и оканчивается на -а ударное."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%97%E0%A7%8D%E0%A6%B0%E0%A6%BE%E0%A6%AB%E0%A6%BF%E0%A6%A4%E0%A6%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Graffiti_in_Bangkok_12.jpg","page_title":"গ্রাফিতি","context_page_description":"গ্রাফিতি হল অনুমতি ব্যতিরেকে জনসাধারণের অভিমতকে শিল্পীয় উপায়ে দেয়ালের উপরে লেখনী কিংবা অঙ্কনের মাধ্যমে তুলে ধরা। স্প্রে পেইন্ট বা মার্কার পেন সাধারণত গ্রাফিতি তৈরির উপকরণ হিসেবে ব্যবহার করা হয়।\\nগ্রাফিতি একটি বিতর্কিত বিষয়। অধিকাংশ দেশে গ্রাফিতিকে বিকৃত ও ধ্বংসাত্মক শিল্প হিসেবে গণ্য করা হয় কারণ অনেক সময় সন্ত্রাসী গোষ্ঠী তাদের সক্রিয়তা গ্রাফিতির মাধ্যমে প্রচার করে। জেন মিচেল বাস্কুইট যার গ্রাফিতি জনসাধারণের মনে ব্যাপক প্রতিক্রিয়ার সৃষ্টি করেছিল। তার তৈরি একটি গ্রাফিতি ১০ কোটি মার্কিন ডলারে বিক্রি হয়েছিল।"},{"page_url":"https://cs.wikipedia.org/wiki/Ferdinand_Maxmili%C3%A1n_Brokoff","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Lapidarium_NM_sv.Frantisek_X_autoportret.JPG","page_title":"Ferdinand Maxmilián Brokoff","context_page_description":"Ferdinand Maxmilián Brokoff byl český sochař a řezbář, syn sochaře a řezbáře Jana Brokoffa a bratr sochaře a řezbáře Michala Jana Josefa Brokoffa.\\nPůsobil hlavně v Praze, kde k nejznámějším dílům patří řada soch na Karlově mostě a náhrobek J. V. Vratislava z Mitrovic, vytvořený za účasti architekta J. B. Fischera z Erlachu. Působil i jinde v Čechách a ve spolupráci s Fischerem také ve Vídni a Slezsku. Spolu s Matyášem Bernardem Braunem je nejvýznamnějším představitelem vrcholného českého barokního sochařství a patří k nejpřednějším českým sochařům vůbec."},{"page_url":"https://nl.wikipedia.org/wiki/Christian_Streich","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/SC_Freiburg_vs_FSVMainz_17_ao%C3%BBt_2013_53.jpg","page_title":"Christian Streich","context_page_description":"Christian Streich is een Duits voetbalcoach. Hij werd in 2011 aangesteld als trainer van SC Freiburg."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%B9%D8%A8%DB%8C%D8%AF_%D8%A7%D9%84%D8%B1%D8%AD%D9%85%D9%B0%D9%86_%D8%B5%D8%AF%DB%8C%D9%82%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Obaidur_Rahman_Siddiqui_with_Moin_Ahsan_jazbi.jpg","page_title":"عبید الرحمٰن صدیقی","context_page_description":"عبید الرحمٰن صدیقی کی پیدائش بھارت کے صوبہ اتر پردیش کے ضلع غازی پور میں 5 جون 1964ء کو محلہ مچھرہٹہ میں ہوئی۔ اس وقت بھارت کے اہم مؤرخین اور ادیبوں میں ان کا شمار ہوتا ہے۔ غازی پور کے واحد تاریخ دان جنھوں نے عہد وار قدیم دور سے دہلی سلطنت دور اور مغلیہ سلطنت دور کی گمشدہ تاریخ کو قلمبند کرکے منظرعام پر لانے کا کام کیا ہے۔ اس کی بنا پر ہندوستان کے سمراٹ اشوک کلب نے ان کو \\"غازی پور کا فاہیان\\" لقب سے نوازا ہے۔ نیز ان کی ایک اہم کاوش 'غازی پور والا عبید ' نامی بلاگ ہے جو ادبی، سماجی اور سیاسی حلقوں میں خاصا مقبول ہے۔"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%BB%A3%E8%8A%AC%E7%89%B9%E5%B0%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Deventer%2C_treinstation_foto8_2012-02-05_11.25.JPG","page_title":"代芬特尔","context_page_description":"代芬特爾是荷蘭上艾瑟爾省的一座城市和市鎮。"},{"page_url":"https://lv.wikipedia.org/wiki/Nobela_miera_pr%C4%93mijas_laure%C4%81ti","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Bundesarchiv_Bild_146-1989-040-27%2C_Gustav_Stresemann.jpg","page_title":"Nobela miera prēmijas laureāti","context_page_description":"Nobela miera prēmiju katru gadu piešķir Norvēģijas Nobela komiteja. Prēmija tiek piešķirta par nopelniem, kas veicinājuši valstu, tautu un citu organizāciju mieru un savstarpējo sadarbību, kā arī personām, kas kādas tautas vai valsts labā īstenojušas nozīmīgus miera pasākumus. Prēmiju pasniedz kopš 1901. gada, tā tiek pasniegta Norvēģijas galvaspilsētā Oslo 10. decembrī, kas ir arī Alfrēda Nobela nāves diena. Nobela prēmiju piešķir Norvēģijas Nobela komiteja, kuru veido 5 cilvēki, kas ir ievēlēti no Norvēģijas Parlamenta."},{"page_url":"https://en.wikipedia.org/wiki/University_of_Detroit_Mercy","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/UDMWarrenLorangerSchoolofArchitecture.jpg","page_title":"University of Detroit Mercy","context_page_description":"The University of Detroit Mercy is a private, Roman Catholic university in Detroit, Michigan, sponsored by both the Society of Jesus and the Religious Sisters of Mercy. Founded in 1877, it is the largest Catholic university in Michigan. It has three campuses, where it offers more than a hundred academic degrees and programs of study in liberal arts, clinical psychology, business, dentistry, law, engineering, architecture, nursing and allied health professions.\\nIn athletics, the university sponsors 17 NCAA Division I level varsity sports for men and women. It is a member of the Horizon League."},{"page_url":"https://ceb.wikipedia.org/wiki/Deserta_Grande","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Desertas-guardstation-2009.jpg","page_title":"Deserta Grande","context_page_description":"Pulo ang Deserta Grande sa Portugal. Nahimutang ni sa munisipyo sa Santa Cruz ug distrito sa Madeira, sa habagatan-kasadpang bahin sa nasod, 1,000 km sa habagatan-kasadpan sa Lisbon ang ulohan sa nasod. Naglangkob kin og 11.6 ka kilometro kwadrado.\\nAng yuta sa Deserta Grande kay medyo bungtoron. Ang labing taas nga punto sa pulo mao ang 450 metros ibabaw sa dagat nga lebel. Naglukop ni og 10.8 km gikan sa amihanan ngadto sa habagatan ug 4.9 km gikan sa sidlakan ngadto sa kasadpan.\\nAng klima ugahon. Ang kasarangang giiniton 17 °C. Ang kinainitan nga bulan Hulyo, sa 20 °C, ug ang kinabugnawan Pebrero, sa 11 °C. Ang kasarangang pag-ulan 305 milimetro matag tuig. Ang kinabasaan nga bulan Oktubre, sa 95 milimetro nga ulan, ug ang kinaugahan Hulyo, sa 1 milimetro."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B1%D8%A6%DB%8C%D8%B3%E2%80%8C%D8%AC%D9%85%D9%87%D9%88%D8%B1_%D9%BE%D8%B1%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Justiniano_Borgo%C3%B1o_2.jpg","page_title":"رئیس‌جمهور پرو","context_page_description":"رئیس‌جمهور پرو رئیس کشور و رئیس حکومت کشور پرو است و نمایندگی این کشور را در امور بین‌المللی بر عهده دارد. این فهرست روسای جمهوری که قدرت را به‌صورت دفاکتو از طریق کودتا به دست آوردند نیز شامل می‌شود. متاخرترین رئیس‌جمهور منتخب پرو پدرو پابلو کوچینسکی بود که از از ۲۸ ژوئیه ۲۰۱۶ تا ۲۱ مارس ۲۰۱۸ رئیس‌جمهور بود و پس از استعفایش معاون او مارتین ویسکارا در ۲۳ مارس ۲۰۱۸ جایگزین او شد. آخرین رئیس‌جمهوری که با کودتا به قدرت رسید آلبرتو فوجیموری در سال ۱۹۹۲ بود که در حال حاضر به اتهام نقض حقوق بشر و فساد در زندان است."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AE%E0%A6%BE%E0%A6%87%E0%A6%95%E0%A7%87%E0%A6%B2_%E0%A6%B6%E0%A7%8D%E0%A6%AF%E0%A6%BE%E0%A6%A8%E0%A6%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Michael_Shannon_%2822635291186%29.jpg","page_title":"মাইকেল শ্যানন","context_page_description":"মাইকেল করবেট শ্যানন হলেন একজন মার্কিন অভিনেতা ও সঙ্গীতজ্ঞ। তিনি হাস্যরসাত্মক ও নাট্যধর্মী উভয় ধরনের চলচ্চিত্রে তার বৈচিত্রধর্মী পর্দা উপস্থিতির জন্য পরিচিত। রিভলূশন্যারি রোড ও নকচার্নাল অ্যানিমেলস চলচ্চিত্রে অভিনয়ের জন্য দুইবার শ্রেষ্ঠ পার্শ্ব অভিনেতা বিভাগে একাডেমি পুরস্কারের মনোনয়ন লাভ করেন। তিনি নাইন্টি নাইন হোমস চলচ্চিত্রে অভিনয় করে শ্রেষ্ঠ পার্শ্ব অভিনেতা বিভাগে গোল্ডেন গ্লোব পুরস্কার ও স্ক্রিন অ্যাক্টরস গিল্ড পুরস্কারের মনোনয়ন লাভ করেন এবং লং ডেস জার্নি ইনটু নাইট মঞ্চনাটকে কাজের জন্য শ্রেষ্ঠ অভিনেতা বিভাগে টনি পুরস্কারের মনোনয়ন লাভ করেন।\\nশ্যানন ১৯৯৩ সালে গ্রাউন্ডহগ ডে চলচ্চিত্র দিয়ে বড় পর্দায় আত্মপ্রকাশ করেন এবং এইট মাইল চলচ্চিত্রে অভিনয় করে সকলের দৃষ্টি কাড়েন। তার অভিনীত উল্লেখযোগ্য চলচ্চিত্র হল পার্ল হারবার, ব্যাড বয়েজ টু, বাগ, বিফোর দ্য ডেভিল নোস ইউ আর ডেড, ব্যাড লেফটেন্যান্ট: পোর্ট অব কল নিউ স্টোরিজ, টেক শেলটার, মাড, মিডনাইট স্পেশাল ও লাভিং । তিনি এইচবিওর নাট্যধর্মী ধারবাহিক ব্রডওয়াক এম্পায়ার-এ নেলসন ভ্যান অ্যাল্ডেন চরিত্রে অভিনয় করে তিনটি স্ক্রিন অ্যাক্টরস গিল্ড পুরস্কারে মনোনীত হন।"},{"page_url":"https://de.wikipedia.org/wiki/%C5%8Ctsu-e","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Falkener.jpg","page_title":"Ōtsu-e","context_page_description":"Ōtsu-e sind schlichte Farbholzschnitte oder Malereien auf Papier mit buddhistischen oder humoristischen Motiven, die in der Edo-Zeit in der Stadt Ōtsu verkauft wurden.\\nŌtsu am Biwa-See war die letzte Station der Überlandstraßen Tōkaidō und Nakasendō bevor die Hauptstadt Kyōto erreicht wurde, bzw. die erste Station nach Kyōto. Daher hießen die Bilder auch „Bilder von der Straßenabzweigung“. Eine Attraktion in Ōtsu war und ist der Tempel Mii-dera, der auch in den Acht Ansichten des Biwa-Sees gewürdigt wird. Ōtsu war also entsprechend stark von Reisenden frequentiert, die die Ōtsu-e als Heiligenbilder oder einfach als Andenken mitnahmen.\\nEs ist nicht bekannt, seit wann es diese Bilder gibt, Hishikawa Moronobu weist jedenfalls in einer Beschreibung der Gegend um 1690 auf sie hin. Unter den Bildern mit buddhistischen Inhalten war der „Blaue Kongō“ populär, der von den Anhängern des Volksglaubens Kōshin verehrt wurde. Unter den weltlich-humoristischen Bildern waren der „Teufel [Oni] als Buddha“ und das „Wisterien-Fräulein“ besonders beliebt."},{"page_url":"https://uz.wikipedia.org/wiki/Frauenfeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Frauenfeld-coat_of_arms.png","page_title":"Frauenfeld","context_page_description":"Frauenfeld – Shveysariyaning Thurgau kantonida joylashgan shahardir. Frauenfeld okrugi tarkibiga kiradi. Maydoni – 27.4 km². 22 313 nafar aholi istiqomat qiladi."},{"page_url":"https://ca.wikipedia.org/wiki/Acad%C3%A8mia_d%27Artilleria_de_Seg%C3%B2via","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Simulador_de_campa%C3%B1a_en_la_Academia_de_Artiller%C3%ADa_de_Segovia_%282%29.jpg","page_title":"Acadèmia d'Artilleria de Segòvia","context_page_description":"L'Acadèmia d'Artilleria de Segòvia és una institució acadèmica militar d'Espanya fundada el 16 de maig de 1764 com a Reial Col·legi d'Artilleria a l'Alcàsser de Segòvia, en temps del rei Carles III a iniciativa de Félix Gazzola, el seu primer director. És l'acadèmia militar més antiga del món en actiu.\\nL'acte commemoratiu del 250è aniversari de l'Acadèmia, celebrat el 16 de maig de 2014, va estar presidit pel rei Joan Carles I, sent l'últim acte militar al que va assistir, abans d'anunciar la seva abdicació."},{"page_url":"https://cs.wikipedia.org/wiki/Alfred_Strej%C4%8Dek","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/91/IMGP6557_Rak_a_Strej%C4%8Dek.JPG","page_title":"Alfred Strejček","context_page_description":"Alfred Strejček je český divadelní a filmový herec, moderátor a recitátor."},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%98%87%E4%BA%9E%E5%88%A9%E6%96%AF%E5%8D%9A%E5%A3%AB%E5%A4%A7%E9%A6%AC%E8%B7%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Avenida_Doutor_M%C3%A1rio_Soares.jpg","page_title":"蘇亞利斯博士大馬路","context_page_description":"苏亚利斯博士大马路是澳门半岛南湾其中一条较宽阔的道路；全长约440米，阔约50米；它的西南端由南湾大马路近傅礼士神父街交界处起，向东南伸展与罗保博士街、约翰四世大马路、澳门商业大马路等相交至亚马喇前地止。街道名称是以葡萄牙自康乃馨革命后的第四任总统马里奥·苏亚雷斯博士来命名。在1989年前，它原是友谊大马路的其中一部分。1981年至1994年间，每年春节在此马路的东南端曾设有爆竹燃放区。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Annaberg_(A%E2%80%93K)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Annenkirche_Kirchturm.jpg","page_title":"Liste der Kulturdenkmale in Annaberg (A–K)","context_page_description":"Die Liste der Kulturdenkmale in Annaberg enthält die Kulturdenkmale des Stadtteils Annaberg der sächsischen Stadt Annaberg-Buchholz, die in der Denkmalliste vom Landesamt für Denkmalpflege Sachsen mit Stand vom 24. November 2010 erfasst wurden.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen.\\nDie Liste ist nach den Anfangsbuchstaben der Adresse aufgeteilt.\\nAufgrund der großen Anzahl von Kulturdenkmalen ist die Liste aufgeteilt in die\\nListe der Kulturdenkmale in Annaberg (A–K)\\nListe der Kulturdenkmale in Annaberg"},{"page_url":"https://eo.wikipedia.org/wiki/Besto%C4%9Dardeno_kaj_Botanika_%C4%9Dardeno_(Budape%C5%9Dto)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5c/P%C3%A1lmah%C3%A1z.jpg","page_title":"Bestoĝardeno kaj Botanika ĝardeno (Budapeŝto)","context_page_description":"Bestoĝardeno kaj Botanika ĝardeno en Budapeŝto estas la plej granda kaj la plej malnova bestoĝardeno de Hungario.\\nJános Xántus fondis ĝin, kiel Bestoĝardeno de Pest en 1866. Tiam en la mondo nur 25 bestoĝardenoj funkciis. Ĝis tiam en Hungario nur cirkoj prezentis bestojn. En tiu loko pli frue estis bosko, tial oni konstruis diversajn domojn, kiujn oni nomumis pri la bestoj: domo de elefanto, krokodilo, simio, ĝirafo k.s. La arkitektoj plej ofte estis Kálmán Gerster, Dezső Zrumeczky kaj Károly Kós. Komence ne estis bonaj financaj statoj, en 1907 ĝi bankrotiĝis. Sekve ekde tiam ĝi apartenas al la ĉefurbo. Post la longa historio kelkaj domegoj restis, sed daŭre pli novaj kaj modernaj konstruaĵoj pretiĝis kaj evoluis ankaŭ la plantoj. Kelkaj konstruaĵoj estas Monumentoj historiaj. Dum sieĝo de Budapeŝto en 1945 la bestoj, eĉ la plantoj suferis multe pro la bombardadoj kaj kanonadoj.\\nEn la nuntempo menciindas precipe domo de elefantoj, kie loĝas ankaŭ hipopotamoj. Tiu domo estas la plej impona kaj la hipopotamoj ricevas el la proksimeco termalan kuracakvon. Eble tial, sed tiuj bestoj pli ofte naskas, ol en aliaj lokoj."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%90%D0%BB%D1%84%D0%B0_%D0%A0%D0%BE%D0%BC%D0%B5%D0%BE_%D0%A41","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/Sauber_F1.07_vr_TCE.jpg","page_title":"Алфа Ромео Ф1","context_page_description":"Алфа Ромео је швајцарски тим Формуле 1 са седиштем у градићу Хинвил у Швајцарској. Алфа Ромео је као конструктор и снабдевач моторима учествовао у Формули 1 од 1950. до 1987. Тим је освојио прва два трофеја у конкуренцији возача 1950. и 1951.године, а онда је угашен.\\nТим Заубер основан је седамдесетих година 20. века и у почетку се такмичио на тркама спортских аутомобила, да би 1993. на Великој награди Јужне Африке такође почео да учествује и у тркама Формуле 1.\\nТим је 2005. продат немачком БМВ-у, да би од 2010. опет почео да на такмичења излази самостално. Од 2018. године тим се зове Алфа Ромео Заубер, да би од почетка сезоне 2019. тим почео да се зове Алфа Ромео."},{"page_url":"https://gl.wikipedia.org/wiki/Estonia","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Riigikogu_hoone%2C_Kaupo_Kalda_foto%2C_2016.jpg","page_title":"Estonia","context_page_description":"Estonia, oficialmente República de Estonia, é un dos tres países bálticos. O país atópase na Europa do norte e está constituído por unha porción continental e un grande arquipélago de illas no mar Báltico. Estonia limita polo norte co golfo de Finlandia que o separa da veciña Finlandia. Polo leste o país fai fronteira con Rusia, ao sur con Letonia e ao oeste co mar Báltico, que o separa de Suecia. Estonia ten unha poboación de pouco máis dun millón trescentos mil habitantes, distribuídos ao longo de 45 mil quilómetros cadrados. O país é membro da Unión Europea dende o 1 de maio do ano 2004, da OTAN dende o 29 de marzo do 2004 e da Eurozona dende o 1 de xaneiro de 2011.\\nOs estonianos son un pobo fínico etnicamente vencellado aos finlandeses e aos saamis. O país ten ademais vencellos culturais e históricas cos países nórdicos, particularmente con Finlandia, a Suecia e Dinamarca.\\nA lingua estoniana forma parte das linguas ugrofinesas grupo que comparte co finés e o húngaro, aínda que difire moito deste. Xunto co finés, o húngaro e o maltés, o estoniano forma o grupo de linguas oficiais da Unión Europea que non teñen orixe indoeuropea."},{"page_url":"https://en.wikipedia.org/wiki/Camilla_Collett","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Portrait_of_Camilla_Collett%2C_1893.jpg","page_title":"Camilla Collett","context_page_description":"Jacobine Camilla Collett was a Norwegian writer, often referred to as the first Norwegian feminist. She was also the younger sister of Norwegian poet Henrik Wergeland, and is recognized as being one of the first contributors to realism in Norwegian literature. Her younger brother was Major General Joseph Frantz Oscar Wergeland."},{"page_url":"https://pl.wikipedia.org/wiki/Lista_dzie%C5%82_Rogiera_van_der_Weydena","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Johann_I_von_Kleve_%281419-1481%29.jpg","page_title":"Lista dzieł Rogiera van der Weydena","context_page_description":"Lista dzieł Rogiera van der Weydena – lista dzieł przedstawiciela szkoły niderlandzkiej – Rogiera van der Weydena.\\nDzieła Rogiera van der Weydena dzieli się na trzy podstawowe kategorie: malarstwo sakralne, malarstwo portretowe oraz miniatury. W zakresie malarstwa sakralnego należy uwzględnić malowane retabula ołtarzowe przeznaczone do kościołów i kaplic oraz obrazy i retabula mniejszego formatu służące prywatnej dewocji. W przypadku tryptyków Rogier van der Weyden nie ograniczył się do powszechnej w gotyku formuły ołtarza szafkowego z ruchomymi skrzydłami bocznymi, lecz także w oeuvre artysty były znane tryptyki składające się z trzech części ale wszystkie tworzące jednolitą całość. Ponadto artysta tworzył pojedyncze obrazy. W przypadku portretów oprócz pojedynczych portretów w ujęciu popiersiowym artysta tworzył dyptyki, zestawiając świecką postać z Maryją i Dzieciątkiem Jezus."},{"page_url":"https://en.wikipedia.org/wiki/Liposthey","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e8/Liposthey_mairie.jpg","page_title":"Liposthey","context_page_description":"Liposthey is a commune in the Landes department in Nouvelle-Aquitaine in south-western France."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%AD%E5%9C%8B%E5%9C%8B%E6%B0%91%E9%BB%A8%E4%B8%BB%E5%B8%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Lin_Junq-tzer.jpg","page_title":"中國國民黨主席","context_page_description":"中國國民黨黨主席是中華民國政黨中國國民黨的最高領導人，自2001年起由中國國民黨全體黨員直選。《黨章》第19條規定「主席之任期為四年，連選得連任一次。」從第七任黨主席開始將根據2013年中國國民黨第十九次全國代表大會修改的《中國國民黨黨章》第十七條規定「主席之選舉，應於任滿當年應召開之全國代表大會舉行之3個月前，與全國代表大會代表之選舉同時辦理」及「主席之任期為4年」。依現行《中國國民黨黨章》，黨主席也是全國代表大會、中央委員會、中央委員會常務委員會之主席。黨章曾規定中國國民黨若作為執政黨時總統兼任黨主席，後於2019年刪除此規定。最近一次選舉為2020年中國國民黨主席補選。中國國民黨將會長職位永久保留予首任會長楊衢雲，總理職位則永久保留予首任總理孫文，而總裁職位永久保留予蔣中正。"},{"page_url":"https://fr.wikipedia.org/wiki/Save_(Danube)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Sava-002.jpg","page_title":"Save (Danube)","context_page_description":"La Save est une rivière qui coule en Slovénie, en Croatie, en Bosnie-Herzégovine et en Serbie. C'est un affluent de la rive droite du Danube, qui conflue à Belgrade.\\nElle ne doit pas être confondue avec la Save qui est un affluent de la Garonne."},{"page_url":"https://es.wikipedia.org/wiki/Cl%C3%A1sico_del_Oeste","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Hinchada_de_ferro.jpg","page_title":"Clásico del Oeste","context_page_description":"El Clásico del Oeste es como habitualmente se denomina al partido del fútbol argentino que enfrenta a los clubes Ferro Carril Oeste y Vélez Sarsfield, ambos de la zona Oeste de la ciudad de Buenos Aires.\\nEn total, este clásico se disputó en 155 oportunidades, repartiendo 61 victorias para Vélez Sarsfield y 48 para Ferro Carril Oeste, mientras que empataron en 46 ocasiones. El primer encuentro se jugó en la era amateur, el 6 de junio de 1920, con resultado a favor de Vélez Sarsfield en condición de visitante por 5:0. La última vez que se enfrentaron fue el 24 de junio de 2000, en el Clausura 2000, con resultado a favor de Vélez Sarsfield por 1:0 en condición de visitante. Desde entonces, este devaluado encuentro​​ no se ha vuelto a disputar debido a que ambos clubes participan de diferentes categorías."},{"page_url":"https://vi.wikipedia.org/wiki/Marder_III","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Marder-III-Aberdeen.0004sryz.1.jpg","page_title":"Marder III","context_page_description":"Marder III là tên một loại pháo tự hành chống tăng thuộc sê-ri Marder được lắp ráp trên thân tăng Panzer 38. Chúng được sản xuất từ năm 1942 đến năm 1944 và phục vụ trên khắp các mặt trận cho đến hết cuộc chiến."},{"page_url":"https://vi.wikipedia.org/wiki/Adiantum_pedatum","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Adianthum_pedatum0.jpg","page_title":"Adiantum pedatum","context_page_description":"Adiantum pedatum là một loài thực vật có mạch trong họ Adiantaceae. Loài này được L. miêu tả khoa học đầu tiên năm 1753."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9F%83%E5%AE%89_(%E4%B8%9C%E6%AF%94%E5%88%A9%E7%89%9B%E6%96%AF%E7%9C%81)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/Eyne.jpg","page_title":"埃安 (东比利牛斯省)","context_page_description":"埃安是法國東庇里牛斯省的一個市鎮，屬於普拉德區賽拉古斯縣。該市鎮總面積20.36平方公里，2009年時的人口為124人。"},{"page_url":"https://es.wikipedia.org/wiki/Club_Estudiantes_de_La_Plata","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Museo-Estudiantes-LP-Vitrina2.jpg","page_title":"Club Estudiantes de La Plata","context_page_description":"El Club Estudiantes de La Plata es una entidad polideportiva de Argentina, ubicada en la ciudad de La Plata, provincia de Buenos Aires. Fue fundado como club de fútbol el 4 de agosto de 1905, cuenta con más de 42 000 socios y su equipo de fútbol se desempeña en la Primera División de Argentina.​\\nSu mayor logro deportivo lo obtuvo en 1968, cuando se consagró campeón del mundo​ al derrotar al Manchester United de Inglaterra en la final de la Copa Intercontinental.​Estudiantes está en el grupo de los únicos seis equipos argentinos que han ganado el máximo campeonato de clubes de fútbol a nivel mundial.​ También disputó las finales de esa copa en 1969, 1970 y 2009, en esta última bajo el nuevo formato de Mundial de Clubes de la FIFA.\\nComenzó su participación futbolística oficial en 1906, al incorporarse a los torneos de AFA, y es el único club de la ciudad de La Plata en haber obtenido títulos oficiales nacionales e internacionales, de carácter regular, en la era profesional.​ Ha ganado cinco campeonatos de Primera División del fútbol argentino en el profesionalismo​ y uno en el amateurismo​."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%93%D0%BE%D1%80%D1%8A%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Corthell_Hall%2C_University_of_Southern_Maine%2C_Gorham_ME.jpg","page_title":"Горъм","context_page_description":"Го̀ръм е град в окръг Къмбърленд, щат Мейн, Съединени американски щати. Намира се на 15 km западно от Портланд и е част от метрополиса Портланд – Саут-Портланд – Бидефорд. Основан е през 1736 г. Населението му е 17 450 души. Има площ 133 km².\\nВ Горъм са родени писателката Елън Г. Уайт и физикът Едуин Хол."},{"page_url":"https://tr.wikipedia.org/wiki/Preetika_Rao","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Preetika_Rao_Sakhiya_Skin_Clinic.jpg","page_title":"Preetika Rao","context_page_description":"Preetika Rao, Hint model, oyuncu, yazar, gazeteci aktris ve şarkıcı.\\nKariyerine model olarak başlayan Hint oyuncu Preetika Rao, daha sonra 2011 yılında aldığı dizi teklifi ile oyunculuk kariyerine başlamıştır. Hint oyuncu Amrita Rao'nun kız kardeşidir."},{"page_url":"https://fr.wikipedia.org/wiki/Edwige_Pitel","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Edwige_Pitel_Great_Ocean_Road.jpg","page_title":"Edwige Pitel","context_page_description":"Edwige Pitel, née le 4 juin 1967 à Dinan, est une coureuse cycliste et duathlète française. Elle a notamment été championne du monde de duathlon longue distance en 2000 et sur courte distance en 2003, avant de remporter plusieurs titres de championne de France de cyclisme sur route, comptant comme une importante rivale de Jeannie Longo, et de participer aux Jeux olympiques en ligne et sur contre-la-montre."},{"page_url":"https://en.wikipedia.org/wiki/Memnonia_quadrangle","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/52438cameramaparrow.jpg","page_title":"Memnonia quadrangle","context_page_description":"The Memnonia quadrangle is one of a series of 30 quadrangle maps of Mars used by the United States Geological Survey Astrogeology Research Program. The Memnonia quadrangle is also referred to as MC-16.\\nThe quadrangle is a region of Mars that covers latitude -30° to 0° and longitude 135° to 180°. The western part of Memnonia is a highly cratered highland region that exhibits a large range of crater degradation.\\nMemnonia includes these topographical regions of Mars:\\nArcadia Planitia\\nAmazonis Planitia\\nLucus Planum\\nTerra Sirenum\\nDaedalia Planum\\nTerra Cimmeria\\nRecently, evidence of water was found in the area. Layered sedimentary rocks were found in the wall and floor of Columbus Crater. These rocks could have been deposited by water or by wind. Hydrated minerals were found in some of the layers, so water may have been involved.\\nMany ancient river valleys Vallis including Mangala Vallis, have been found in the Memnonia quadrangle. Mangala appears to have begun with the formation of a graben, a set of faults that may have exposed an aquifer. Dark slope streaks and troughts are present in this quadrangle. Part of the Medusae Fossae Formation is found in the Memnonia quadrangle."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%AD%A6%E5%9C%92%E5%8C%97%E5%A4%A7%E9%80%9A%E3%82%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Kita-odori_Amakubo-1chome.jpg","page_title":"学園北大通り","context_page_description":"学園北大通りは、茨城県つくば市の都市計画道路の路線名である。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Mitglieder_des_S%C3%A4chsischen_Landtags_(7._Wahlperiode)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/2013-12-17_-_Gerald_Otto_-_S%C3%A4chsischer_Landtag_-_1561.jpg","page_title":"Liste der Mitglieder des Sächsischen Landtags (7. Wahlperiode)","context_page_description":"Die Liste bietet einen vorläufigen Überblick über alle Mitglieder des 7. Sächsischen Landtags, der in der Landtagswahl vom 1. September 2019 gewählt wurde. Die Konstituierung des Landtages erfolgte am 1. Oktober 2019."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%97%A5%E6%9C%AC%E7%87%88%E5%A1%9450%E9%81%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d0/Sata_Misaki_Lighthouse_Kagoshima_Japan.JPG","page_title":"日本燈塔50選","context_page_description":"日本灯塔50选为日本海上保安厅所搜选出。灯塔搜选活动缘起于1998年11月1日第50回灯塔记念日，依投票所选出“你所选出之日本灯塔50选”之决选灯塔。"},{"page_url":"https://en.wikipedia.org/wiki/Salford_Central_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Salford_2_railway_station_geograph-2161871.jpg","page_title":"Salford Central railway station","context_page_description":"Salford Central railway station in Salford, Greater Manchester, England, close to Spinningfields and Deansgate. It is served by trains to and from Manchester Victoria, towards Rochdale and Wigan Wallgate."},{"page_url":"https://da.wikipedia.org/wiki/Kronprinsesse_Mary","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Crown_Princess_Mary.jpg","page_title":"Kronprinsesse Mary","context_page_description":"Hendes Kongelige Højhed Kronprinsesse Mary er i sin egenskab af sit ægteskab med Kronprins Frederik Danmarks kronprinsesse og forventes således at blive landets næste dronning. Kronprinsesse Mary er ridder af Elefantordenen."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D9%BE%D8%B1%D9%85%DB%8C%D9%84%D8%A7%D8%B3%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Apremilast_molecule_ball.png","page_title":"اپرمیلاست","context_page_description":"اپرمیلاست بیر شیمیایی بیلشیک دواء. بۇ دواءنین مول جرمیسی مول/قرم ۴۶۰٫۵ دیر. نیمه عمر یا یاریلانما سۆرعتی ۶–۹ ساعات زامان آپاریر. متابولیسمی قاراجییرده باش وئریر."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B0%D0%B4%D0%B7%D0%B8%D0%B2%D1%96%D0%BB%D0%BB%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BB%D1%96%D1%82%D0%BE%D0%BF%D0%B8%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Radzivill_chronicle_333.jpg","page_title":"Радзивіллівський літопис","context_page_description":"Радзиві́ллівський літо́пис — руський лицевий літописний список кінця XV ст., що нині зберігається в Санкт-Петербурзі в Бібліотеці академії наук. Цей рукопис належав у XVII ст. польсько-литовським магнатам Радзивіллам, потім потрапив до Східної Пруссії, де з нього була знята копія. 1758 року був захоплений як трофей у Семирічній війні, відвезений до Петербурга і опублікований в 1767."},{"page_url":"https://fr.wikipedia.org/wiki/Pilier_Djed","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Abydos_Tempelrelief_Sethos_I._20.JPG","page_title":"Pilier Djed","context_page_description":"Djed signifie en égyptien « stabilité », « durée ». C'est le nom d'un motif représenté depuis la période thinite, dont la signification originelle reste discutée.\\nOn propose souvent qu'il s'agirait de la stylisation d'un arbre en fleurs ou d'un pilier constitué par des faisceaux de gerbes, ayant ultérieurement pris une signification anatomique : au Moyen Empire il est représenté dans les sarcophages à proximité de la colonne vertébrale du défunt, et au Nouvel Empire il est clairement identifié à la colonne vertébrale d'Osiris.\\nLe pilier djed était souvent offert au pharaon par les dieux. Il jouait un rôle dans les rites agricoles et c’est à Memphis que le pharaon l’érigeait en l’honneur du dieu Ptah.\\nIl servit également de modèle à de nombreux pendentifs, amulettes, talismans censés protéger les vivants, dont on trouve de nombreux exemplaires dans les musées d'Alexandrie et du Louvre."},{"page_url":"https://nl.wikipedia.org/wiki/Kraagpapegaai","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Deroptyus_accipitrinu.png","page_title":"Kraagpapegaai","context_page_description":"De kraagpapegaai is een papegaaiachtige uit de familie papegaaien van Afrika en de Nieuwe Wereld. De wetenschappelijke naam van de soort werd als Psittacus accipitrinus in 1758 gepubliceerd door Carl Linnaeus. De soort komt voor in noordelijk Zuid-Amerika. Het is de enige soort die in het geslacht Deroptyus Wagler, 1832 wordt geplaatst."},{"page_url":"https://it.wikipedia.org/wiki/Himinbj%C3%B6rg","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Heimdall_and_little_Hnossa_by_Willy_Pogany.png","page_title":"Himinbjörg","context_page_description":"Himinbjörg è la casa del dio norreno Heimdallr. Himinbjörg è attestato nella raccolta di poemi Edda poetica, scritta in base a fonti dell'antica tradizione, e in Edda in prosa e Heimskringla, entrambe scritte nel XIII secolo da Snorri Sturluson.\\nHiminbjörg è associato con Heimdallr in tutte le fonti. Secondo Edda poetica, Heimdallr vi risiede come guardiano per gli dei e vi beve del buon idromele, mentre nell'Edda in prosa Himinbjörg è definito come posto dove il ponte dell'arcobaleno Bifrǫst incontra il cielo.\\nGli studiosi hanno commentato le differenze sulle due attestazioni e collegato il nome della località mistica a vari nomi di luoghi."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%93%D0%BB%D0%BE%D0%B1%D0%BE%D1%87%D0%B8%D1%86%D0%B0_(%D0%93%D0%BE%D1%80%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Globo%C4%8Dica%2C_Glloboqic%C3%AB%2C_%D0%93%D0%BB%D0%BE%D0%B1%D0%BE%D1%87%D0%B8%D1%86%D0%B0.JPG","page_title":"Глобочица (Гора)","context_page_description":"Глобочица је горанско село у Општини Гора, на Косову и Метохији. По законима привремених институција Косова ово насеље је у саставу општине Драгаш. Глобочица је горанско село у шарпланинској жупи Гори."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AD%E3%83%B3%E3%82%AE%E3%83%A7%E3%83%8F%E3%83%8A%E3%83%80%E3%82%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Male_anthia.JPG","page_title":"キンギョハナダイ","context_page_description":"キンギョハナダイ は、スズキ目スズキ亜目ハタ科ハナダイ亜科に属する魚の一種。性転換する事が知られている。"},{"page_url":"https://az.wikipedia.org/wiki/2017_%C4%B0slam_H%C9%99mr%C9%99yliyi_Oyunlar%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Baku_Crystal_Hall_2014_1.jpg","page_title":"2017 İslam Həmrəyliyi Oyunları","context_page_description":"2017 İslam Həmrəyliyi Oyunları və ya IV İslam Həmrəyliyi Oyunları — 2017-ci ilin 12-22 may tarixləri arasında Azərbaycanın paytaxtı Bakı şəhərində keçirilən çoxmillətli, multi-idman turniri idi. Bundan öncə tunir 2005-ci ildə Səudiyyə Ərəbistanında, 2013-də isə İndoneziyada keçirilmişdir. Turnirin sayca ikinci dəfə 2009-cu ilin oktyabr ayında İranda keçirilməyi nəzərdə tutulsa da, sonradan təxirə salındı, daha sonra isə ləğv olundu."},{"page_url":"https://it.wikipedia.org/wiki/Naomie_Harris","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Naomie_Harris_2014.jpg","page_title":"Naomie Harris","context_page_description":"Naomie Melanie Harris è un'attrice britannica. È stata candidata all'Oscar alla miglior attrice non protagonista nel 2017 per il film Moonlight."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A9%E3%83%8A%E3%83%90%E3%82%A6%E3%83%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Oldsmobile_Curved_Dash_Runabout_1904_3.jpg","page_title":"ラナバウト","context_page_description":"ラナバウトとは、乗用車のボディスタイルの米国での呼称の一種で、20世紀の初頭に米国で人気のあったスタイル。小型で安価なオープンカーである。ラナバウトのほとんどは基本がシート一列のみで2人乗りである。オプションでトノーがリア部に増設できたものも多くあり、これにより4人または5人乗りとなった。1919年から1930年までのビンテージ時代では米国で生産された全車種のうち半数はラナバウトであり、これが最も生産された型であった。"},{"page_url":"https://de.wikipedia.org/wiki/Tunes_(Silves)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Tunes_Railway_Station.jpg","page_title":"Tunes (Silves)","context_page_description":"Tunes ist eine ehemalige portugiesische Gemeinde im Kreis Silves mit 12,9 km² Fläche und 2560 Einwohnern. Die Bevölkerungsdichte beträgt 199 Einwohner pro km².\\nEinige Historiker glauben, dass dieser Ort ursprünglich von Menschen aus Tunis, Tunesien, bewohnt wurde und daher auch der Name Tunes rührt.\\nDer Ort ist hauptsächlich für seinen Bahnhof bekannt.\\nHier beginnt die Linha do Sul und trifft auf die Linha do Algarve.\\nDie Station ist auch ein Halt des Alfa Pendular zwischen Faro und Lissabon."},{"page_url":"https://en.wikipedia.org/wiki/Symbols_of_the_European_Union","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Parada_Schumana_2.JPG","page_title":"Symbols of the European Union","context_page_description":"The European Union uses a number of symbols, including the European Flag, Anthem of Europe, Motto of the European Union and Europe Day.\\nThese symbols have no official status based in international treaty, but they are in de facto use by the EU institutions and are in widespread use as expressions of the political ideologies of Pan-Europeanism and European integration.\\nUse of the European Flag in particular is widespread also among pro-EU factions outside of the European Union, especially in the \\"colour revolutions\\" of Eastern Europe."},{"page_url":"https://nl.wikipedia.org/wiki/Coca-Colafabriek_Sloterdijk","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Amsterdam_Teleport_Haarlemmerweg.jpg","page_title":"Coca-Colafabriek Sloterdijk","context_page_description":"De Coca-Colafabriek te Sloterdijk was de eerste bottelarij van Coca-Cola in Nederland. Deze werd in 1930 in gebruik genomen in Sloterdijk. De fabriek was gevestigd in een opvallend laag, maar wel langgerekt gebouw van wit gepleisterde baksteen. De fabriek stond aan de Haarlemmertrekvaart, tussen de Haarlemmerweg met de tramlijn, aan de dorpsstraat en de spoorlijn naar Haarlem.\\nCoca-Cola werd in Nederland in 1928 geïntroduceerd en er bestonden tot 1940 twee fabrieken, die in Amsterdam en daarna ook in Rotterdam. In mei 1940 werd de fabriek in Rotterdam, nog geen tien jaar oud, door het bombardement volledig verwoest en bleef alleen de fabriek in Amsterdam over. Er werd daarom gewerkt in vier ploegendiensten omdat alle afnemers waren aangewezen op de fabriek in Amsterdam. Het was een voor die tijd moderne fabriek met onder meer een flessenspoelmachine. Er was nooit voorraad en de vele vrachtwagens stonden geduldig te wachten tot ze volgeladen konden worden. In 1958 was er een speciale opdracht voor de Olympische Spelen in Finland waarbij in verband met de suiker-accijns ook de douane eraan te pas kwam."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%8F_%D0%BF%D0%BE%D1%87%D1%82%D1%8B_%D0%B8_%D0%BF%D0%BE%D1%87%D1%82%D0%BE%D0%B2%D1%8B%D1%85_%D0%BC%D0%B0%D1%80%D0%BE%D0%BA_%D0%90%D0%BD%D0%B3%D0%B8%D0%BB%D1%8C%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Anguilla_%241.50_London_1980_stamp.JPG","page_title":"История почты и почтовых марок Ангильи","context_page_description":"История почты и почтовых марок Ангильи охватывает развитие почтовой связи Ангильи — британской заморской территории в Карибском море со столицей в Валли, состоящей из острова Ангилья, одного из самых северных Подветренных островов в составе Малых Антильских островов, и мелких прилегающих островков и коралловых рифов, не имеющих постоянного населения. Ангилья выпускает собственные почтовые марки с 1967 года."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B2%D0%B0_%D0%97%D0%B5%D0%BB%D0%B0%D0%BD%D0%B4%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Clark-Bush.jpg","page_title":"Нова Зеландія","context_page_description":"Нова́ Зела́ндія — суверенна острівна держава у південно-західній частині Тихого океану. Розташована на двох великих островах: Північний і Південний та близько 600 прилеглих дрібніших островів. Столиця країни — місто Веллінгтон, найбільше місто — Окленд. Населення Нової Зеландії становить близько 4 443 900 осіб. Держава побудована на принципах конституційної монархії й парламентської демократії і належить до розвинених країн світу. На чолі держави стоїть королева Нової Зеландії — Єлизавета II\\nУ XI—XIV століттях острови було заселено вихідцями з Полінезії, європейські дослідники відкрили острови 1642 року. Активне освоєння земель Великою Британією почалося з 1762 року. Однією з основних особливостей Нової Зеландії є географічна ізольованість. Найближчими сусідами країни є — на захід Австралія, відокремлена Тасмановим морем; на північ острівні території — Нової Каледонії, Тонга та Фіджі.\\nКоролівство Нової Зеландії включає в себе незалежні в державному управлінні, але вільно асоційовані з Новою Зеландією острівні держави Острови Кука, Ніуе, а також несамоврядну територію Токелау й антарктичну Територію Росса."},{"page_url":"https://de.wikipedia.org/wiki/Caherdorgan_North","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Cathair_Deargan.jpg","page_title":"Caherdorgan North","context_page_description":"Das rekonstruierte Caherdorgan North, etwa einen Kilometer südlich von Kilmalkedar, auf der Dingle-Halbinsel im County Kerry in Irland liegt an der R559 und ist ein noch mittelalterlich genutztes Dun. Vom hochgelegenen Dun überblickt man die Meeresbucht Smerwick Harbour. Caher ist die anglisierte Form der irischen Wortes \\"cathair\\".\\nDas Dun liegt auf einer eingeebneten Plattform in einer Hanglage, die nach Westen steil abfällt. Im Inneren des in etwa runden Dun mit einer Resthöhe der Außenmauer aus Trockenmauerwerk von stellenweise 2,65 m Höhe und 2,1 m Breite liegen fünf einigermaßen erhaltene Basen von Clochans. Die drei mittleren Clochans tangieren einander. Der südlichste und größte hat an der Basis der westlichen Wand ein unzugängliches Souterrain. Es handelt sich um ein System unterirdischer Gänge und Kammern bzw. Nischen. Bei Souterrains wird zwischen „earth-cut“, „rock-cut“, „mixed“, „stone built“ und „wooden“ Souterrains unterschieden, die oft mit Steinplatten oder Holzbalken abgedeckt sind."},{"page_url":"https://en.wikipedia.org/wiki/Volunteer_Speedway","image_url":"http://upload.wikimedia.org/wikipedia/en/3/3e/Bulls_gap.jpg","page_title":"Volunteer Speedway","context_page_description":"Volunteer Speedway is a 4/10 mile long dirt race track located in Greene County in the eastern part of Tennessee, in Mosheim. It was originally built in 1973 and opened during the 1974 racing season. It is known as \\"The World's Fastest Dirt Track\\". The track is banked at 32 degrees in the corners and is known for its high speed. The track record is 11.743 seconds / 122.630 mph set by Gusty Christenberry of Seymour, TN in 2003. The track is still operating on a weekly basis running local events plus holding national dirt track events for several sanctioning bodies including two events in the World of Outlaws Late Model Series."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B0%E0%A6%95_%E0%A6%AE%E0%A6%BE%E0%A6%B0%E0%A7%8D%E0%A6%9F%E0%A6%BF%E0%A6%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Ptyonoprognefuligula3.png","page_title":"রক মার্টিন","context_page_description":"পাথুরে মার্টিন, দ্বিপদ নাম Ptyonoprogne fuligula হচ্ছে সোয়ালো পরিবারের ছোট প্যাসারিন পাখি। এরা মধ্য ও দক্ষিণ আফ্রিকার দেশগুলোতে বাস করে। এরা প্রধানত পার্বত্য এলাকায় বাস করে কিন্তু নিচু এলাকাতেও দেখা যায়। এরা সর্বদা জল থেকে দূরে থাকে।"},{"page_url":"https://en.wikipedia.org/wiki/List_of_the_Pour_le_M%C3%A9rite_(military_class)_recipients","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Zwehl.jpg","page_title":"List of the Pour le Mérite (military class) recipients","context_page_description":"The list contains recipients of the Pour le Mérite military class. Since the foundation, a total of 5,430 persons received this award. The Pour le Mérite was the Kingdom of Prussia's highest military order for officers until the end of World War I. Its equivalent for non-commissioned officers and enlisted men was the Military Merit Cross."},{"page_url":"https://nl.wikipedia.org/wiki/Rijkshervorming","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Albrecht_D%C3%BCrer_-_Portrait_of_Maximilian_I_-_Google_Art_Project.jpg","page_title":"Rijkshervorming","context_page_description":"De Rijkshervorming was een poging van de Rijksdag in Worms in 1495 om het uiteenvallende Heilige Roomse Rijk een nieuwe structuur te geven.\\nHoewel deze hervorming als een succes gezien kan worden, geloven hedendaagse specialisten dat de hervorming nooit bedoeld was om een echt, modern rijk te vormen. Het zou meer bedoeld zijn om de macht binnen het rijk op bepaalde vlakken te centraliseren, en op andere vlakken tussen de deelstaten te verspreiden.\\nDe hervorming leidde tot de volgende veranderingen:\\nde Eeuwige Landvrede, die ervoor zorgde dat het Rijk zelf als enige over lokale vetes kon oordelen.\\nhet Rijkskamergerecht werd opgericht als een hoogste rechtbank. Dit was mogelijk een van de meest ingrijpende, maar zeker de meest duurzame veranderingen van de Rijkshervorming.\\nde oprichting van zes rijkskreitsen, wat zorgde voor een uniforme regering van het rijk op het vlak van belastingen.\\neen Rijksregiment werd opgericht, om de onthande Rijksdag, die toch nooit veel invloed verkregen had, te vervangen. Het Rijksregiment was echter slechts van 1500 tot 1502 en van 1521 tot 1531 actief.\\nDe hervorming was min of meer afgewerkt in 1555."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9E%D0%BF%D1%88%D1%82%D0%B8%D0%BD%D0%B0_%D0%A8%D1%82%D1%80%D0%BF%D1%86%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/Kosovski_district.gif","page_title":"Општина Штрпце","context_page_description":"Општина Штрпце налази се на крајњем југу Србије, на граници са Северном Македонијом. Површина општине је око 248 km². Обухвата територију од шеснаест села Сиринићке жупе. Седиште општине је истоимено место Штрпце. Општина Штрпце је постојала до 1965. године када је укинута, а поново је формирана 1988. године издвајањем насеља из тадашње општине Урошевац.\\nНа западу општине извире река Лепенац. На Шар планини се налази познати ски-центар „Брезовица“, а ту је и један од пет националних паркова у Републици Србији, Национални парк Шар-планина."},{"page_url":"https://de.wikipedia.org/wiki/Gerlach_Flicke","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Gerlach_Flicke%3B_Henry_Strangwish_%28or_Strangways%29_by_Gerlach_Flicke.jpg","page_title":"Gerlach Flicke","context_page_description":"Gerlach Flicke, auch Garlick oder Garlicke Flicke war ein deutscher Maler der Tudorzeit. Er hatte seine Schaffenszeit in der Generation nach Hans Holbein des Jüngeren und war wie dieser in England tätig."},{"page_url":"https://cs.wikipedia.org/wiki/Breta%C5%88sk%C3%BD_oha%C5%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/American_Brittany_standing.jpg","page_title":"Bretaňský ohař","context_page_description":"Bretaňský ohař, někdy zvaný také bretaňský ohař dlouhosrstý, je velice inteligentní pes středního vzrůstu ze skupiny ohařů. Tito psi bývají velice oddaní svému pánovi, proto hůře nesou pozdější změnu majitele. Má vynikající čich, je hbitý, mrštný, rád aportuje a dokáže vystavit zvěř. Nejčastěji se vyskytuje v barvách černo-bílá, oranžovo-bílá, hnědo-bílá či trikolorní. Pro naši kulturu může být nezvyklé, že bretaňský ohař se rodí buď ve formě bezocasé, s krátkým, nebo dlouhým ocasem. Postavou je mírně podsaditý, ideální kohoutková míra u psů 48–51 cm, u fen 47–50 cm. Hlava je špičatější, obličejová část je vůči mozkovně v poměru 2:3. Uši kratší, svěšené dolů."},{"page_url":"https://en.wikipedia.org/wiki/United_States_Armed_Forces","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5c/United_States_Coast_Guard_Reserve_emblem.png","page_title":"United States Armed Forces","context_page_description":"The United States Armed Forces are the military forces of the United States. It consists of the Army, Marine Corps, Navy, Air Force, Space Force, and Coast Guard. The president of the United States is the commander-in-chief of the Armed Forces and forms military policy with the Department of Defense and Department of Homeland Security, both federal executive departments, acting as the principal organs by which military policy is carried out. All six armed services are among the eight uniformed services of the United States.\\nFrom the time of its inception, the U.S. Armed Forces played a decisive role in the history of the United States. A sense of national unity and identity was forged as a result of victory in the First Barbary War and the Second Barbary War. It played a critical role in the American Civil War, continuing to serve as the armed forces of the United States, although a number of its officers resigned to join the separatist military of the Confederate States. The National Security Act of 1947, adopted following World War II, created the modern U.S. military framework."},{"page_url":"https://de.wikipedia.org/wiki/Sabah_State_Library","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Beaufort_Sabah_SabahStateLibraryBeaufortBranch-05.jpg","page_title":"Sabah State Library","context_page_description":"Die Sabah State Library ist der Name für die Staatsbibliothek des Bundesstaats Sabah in Malaysia. Sie hat ihren Sitz in Kota Kinabalu und unterhält vier Regionalbüchereien, 20 Zweigstellen, 13 mobile Büchereien und ein Netzwerk dörflicher Kleinbibliotheken."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D1%81%D0%BA%D0%BE%D0%BB%D1%8C%D0%B4%D0%BE%D0%B2%D0%B0_%D0%9C%D0%BE%D0%B3%D0%B8%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/uk/9/9c/%D0%9F%D0%B0%D0%BC%27%D1%8F%D1%82%D0%BD%D0%B8%D0%B9_%D0%B7%D0%BD%D0%B0%D0%BA_%D0%A8%D0%B5%D0%B2%D1%87%D0%B5%D0%BD%D0%BA%D1%83.jpg","page_title":"Аскольдова Могила","context_page_description":"Аско́льдова Моги́ла — одна з найвідоміших історичних місцевостей та урочище у Києві, де колись також містився престижний некрополь, знищений за радянських часів. У наш час — парк, пам'ятка садово-паркового мистецтва. Розташована між Дніпровським узвозом, вулицею Івана Мазепи і Маріїнським парком, охоплюючи частину Дніпровських схилів."},{"page_url":"https://tr.wikipedia.org/wiki/Bushizm","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/George-W-Bush.jpeg","page_title":"Bushizm","context_page_description":"Bushizm, Amerika Birleşik Devletleri başkanı George W. Bush'un topluluk önünde konuşurken alışılmamış kelimeler ve cümleler kullanma, gafları, sözcükleri anlamsızca ve uygunsuzca kullanması ve dilsel hatalar yapmasıdır."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D1%82%D0%B0-%D0%BE%D1%81%D1%82%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Beta-skeleton.svg","page_title":"Бета-остов","context_page_description":"-остов, бета-остов или бета-скелет — это ориентированный граф, определённый на множестве точек на евклидовой плоскости. Две точки p and q связаны ребром, когда все углы prq меньше некоторого порога, определённого параметром."},{"page_url":"https://pt.wikipedia.org/wiki/Amber_Pacific","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Amber_pacific.jpg","page_title":"Amber Pacific","context_page_description":"Amber Pacific é uma banda de Hardcore formada em Seattle, Washington em 2002.\\nA banda lançou dois álbuns de estúdio, The Possibility and the Promise em 2005 e Truth in Sincerity em 2007, bem como três EP, Fading Days em 2004, Acoustic Sessions em 2006 e Acoustic Connect Sets em 2008."},{"page_url":"https://oc.wikipedia.org/wiki/Sacramento","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/West_Sacramento%2C_CA%2C_USA_-_panoramio_%28cropped%29.jpg","page_title":"Sacramento","context_page_description":"Sacramento, oficialament la Ciutat de Sacramento, es la capitala de l'estat american de Califòrnia. Sa populacion èra estimada a 456 441 abitants, en 2004. Sa superfícia totala es 257 km²."},{"page_url":"https://de.wikipedia.org/wiki/Kunst_im_%C3%B6ffentlichen_Raum_in_Frankfurt_am_Main","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/U-Bahnhof_Bockenheimer_Warte%2C_S%C3%A4ule.jpg","page_title":"Kunst im öffentlichen Raum in Frankfurt am Main","context_page_description":"Kunst im öffentlichen Raum Frankfurt ist ein Internetportal des Kulturamtes der Stadt Frankfurt am Main. In Frankfurt am Main sind etwa 350 Skulpturen und Wandbilder im öffentlichen Raum zu sehen, zu denen das Portal kurze Steckbriefe mit Auskünften zum Kunstwerk, seinem Standort und den Künstlern bereitstellt."},{"page_url":"https://de.wikipedia.org/wiki/Blanche_(M%C3%A9tro_Paris)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Moulin_Rouge_dsc07334.jpg","page_title":"Blanche (Métro Paris)","context_page_description":"Der U-Bahnhof Blanche ist eine unterirdische Station der Linie 2 der Pariser Métro."},{"page_url":"https://de.wikipedia.org/wiki/Liste_europ%C3%A4ischer_Windkraftanlagentypen","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Wind_turbine_Oberjettingen_West_1.jpg","page_title":"Liste europäischer Windkraftanlagentypen","context_page_description":"Diese Liste gibt eine Übersicht über Windkraftanlagentypen zur Erzeugung elektrischer Energie, deren Rotordurchmesser mehr als zehn Meter beträgt und von denen mindestens ein Exemplar in Europa errichtet wurde."},{"page_url":"https://pl.wikipedia.org/wiki/Shin%E2%80%99ichir%C5%8D_Watanabe","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Shinichiro_Watanabe_20090703_Japan_Expo_01.jpg","page_title":"Shin’ichirō Watanabe","context_page_description":"Shin’ichirō Watanabe – japoński reżyser, scenarzysta i producent. Największą sławę przyniosły mu anime Cowboy Bebop, seria OAV Macross Plus, a ostatnio Samurai Champloo.\\nWatanabe znany jest z mieszania różnych gatunków, np. w Cowboyu Bebopie klasyczny kowbojski western miesza się z film noir, filmami akcji rodem z Hongkongu i jazzem. W Samurai champloo zmieszały się ze sobą: hip-hop, feudalny świat samurajów z okresu Edo oraz Japonia dnia dzisiejszego.\\nCzasami, z racji podobnego nazwiska, mylony jest z Shin’ichim Watanabe, twórcą m.in. Excel Sāgi i Puni Puni Poemi."},{"page_url":"https://en.wikipedia.org/wiki/Phineas_Gage","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/PhineasGage_BurialRecord_GageEntry.jpg","page_title":"Phineas Gage","context_page_description":"Phineas P. Gage was an American railroad construction foreman remembered for his improbable survival of an accident in which a large iron rod was driven completely through his head, destroying much of his brain's left frontal lobe, and for that injury's reported effects on his personality and behavior over the remaining 12 years of his life‍—‌effects sufficiently profound that friends saw him as \\"no longer Gage.\\"\\nLong known as the \\"American Crowbar Case\\"‍—‌once termed \\"the case which more than all others is calculated to excite our wonder, impair the value of prognosis, and even to subvert our phys­i­o­log­i­cal doctrines\\" ‍—‌Phineas Gage influenced 19th-century discussion about the mind and brain, par­tic­u­larly debate on cerebral local­i­za­tion, ​​ and was perhaps the first case to suggest the brain's role in deter­min­ing per­son­al­ity, and that damage to specific parts of the brain might induce specific mental changes."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%BB%D0%BE%D0%B2%D0%B8_(%D0%A7%D0%B5%D1%85%D0%B8%D1%8F)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/Olov%C3%AD_CoA.png","page_title":"Олови (Чехия)","context_page_description":"Олови — город на западе Чешской Республики, в районе Соколов Карловарского края."},{"page_url":"https://de.wikipedia.org/wiki/Ardbeg_Point_(Isle_of_Bute)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Port_Bannatyne%2C_Ardbeg_Point_-_geograph.org.uk_-_166731.jpg","page_title":"Ardbeg Point (Isle of Bute)","context_page_description":"Ardbeg Point ist ein Kap im Osten der schottischen Insel Bute an den Kyles of Bute und gehört somit administrativ zu der Unitary Authority Argyll and Bute. Entlang der Landspitze ziehen sich die Häuser der Ortschaften Ardbeg und Port Bannatyne, beides Vororte von Rothesay, dem Hauptort der Insel. Ardbeg Point bildet die Grenze der beiden Buchten Rothesay Bay im Süden und Kames Bay im Norden. Die benachbarten Landspitzen sind Undraynian Point im Norden und Bogany Point im Süden. Ardbeg Point ragt etwa 150 m aus der Landmasse der Insel heraus. Zusammen mit der gegenüber auf Cowal gelegenen Landspitze Ardyne Point bildet Ardbeg Point nach Süden mit einer Weite von etwa 1,6 km die letzte Engstelle der Kyles of Bute vor der Einmündung in den Firth of Clyde.\\nDie Umgebung von Ardbeg Point entwickelte sich im Viktorianischen Zeitalter, als sich die Insel einem zunehmenden Touristenstrom ausgesetzt sah, was den Bau von Hotelanlagen und Wohngelegenheiten auslöste. In diesem Zuge entstanden zahlreiche neue Bauten in Ardbeg und Port Bannatyne, wodurch auch die direkte Umgebung des Kaps besiedelt wurde."},{"page_url":"https://en.wikipedia.org/wiki/Indonesian_military_ranks","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Pdu_marsekalbesartni.png","page_title":"Indonesian military ranks","context_page_description":"The Indonesian National Armed Forces uses a simplified ranking system for the three branches of Indonesian Army, Indonesian Navy and Indonesian Air Force. Most of the ranks are similar with differences for the rank titles of the high-ranking officers. Exception exists, however, in the ranks of the service members of the Indonesian Marine Corps. While Indonesian Marine Corps is a branch of the Navy, the rank titles of the Marine Corps are the same as those of the Army, but it still uses the Navy's style insignia.\\nAs said above, all services maintain the same rank insignia and title, with the main difference for officers are that high-ranking officers use their special titles, while officers below that rank use the similar title but followed by their respective branch/corps abbreviation. For example, an Army colonel with Infantry branch use the title \\"Kolonel INF.\\", which \\"INF\\" means \\"Infanteri\\" or \\"Infantry\\"; A Navy colonel with Supply Corps background use the title \\"Kolonel Laut\\", in which \\"S\\" means \\"Suplai\\" or \\"Supply\\". Also, an Air Force Colonel with Electronical Engineering Corps background use the title \\"Kolonel\\", in which \\"Lek\\" means \\"Elektronika\\" or \\"Electronics\\"."},{"page_url":"https://nl.wikipedia.org/wiki/Toshima_(Tokio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/TokyoSpecialWardsMap.svg","page_title":"Toshima (Tokio)","context_page_description":"Toshima is een van de 23 speciale wijken van Tokio. Toshima heeft het statuut van stad en noemt zich in het Engels ook Toshima City. Op 1 januari 2010 had de stad 261.907 inwoners. De bevolkingsdichtheid bedroeg 20130 inw./km². De oppervlakte van de stad is 13,01 km². Toshima wordt begrensd door Nerima, Itabashi en Kita in het noorden; en Shinjuku en Bunkyo in het zuiden.\\nDe wijk werd opgericht op 15 maart 1947 en bereikte een inwonertal van 370.000 in 1965. Het inwonertal is echter sindsdien steeds gedaald tot 252.011 in 2005, maar blijkt sinds 2010 weer aan het stijgen te zijn. Overdag groeit de bevolking door forenzen, het bevolkingsaantal stijgt dan naar ongeveer 430.000 mensen."},{"page_url":"https://pt.wikipedia.org/wiki/Vancouver","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/MNP_Tower_2015.jpg","page_title":"Vancouver","context_page_description":"Vancouver é uma cidade portuária costeira no oeste do Canadá, localizada na região de Lower Mainland na província canadense da Colúmbia Britânica. É a cidade mais populosa da província e oitava mais populosa do Canadá, o censo de 2016 registrou 631 000 pessoas na cidade. A área da Grande Vancouver registrou uma população de 2 463 431 em 2016, tornando-se a terceira maior região metropolitana do Canadá. Vancouver tem a maior densidade populacional no Canadá com mais de 5 400 pessoas por quilômetro quadrado. De acordo com o recenseamento de 2011, Vancouver é a quarta cidade mais densamente povoada da América do Norte atrás da cidade de Nova Iorque, São Francisco, e Cidade do México. A cidade é uma das cidades mais étnicas e linguisticamente diversas do Canadá de acordo com esse recenseamento, 52% dos seus residentes têm um idioma nativo diferente do inglês. A cidade é classificada como uma cidade global Beta."},{"page_url":"https://da.wikipedia.org/wiki/Antiochos_2._af_Seleukideriget","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/AntiochusII.jpg","page_title":"Antiochos 2. af Seleukideriget","context_page_description":"Antiochos 2. Theos var konge af det hellenistiske Seleukiderige. Han efterfulgt sin fader Antiochos 1. Soter på den seleukidiske kongetrone i 261 f.Kr. Med hustruen Laodike 1. fik Antiochos bl.a. sønnerne Seleukos 2. Kallinikos og Antiochos Hierax.\\nDet lykkedes Antiochos 2. at genvinde territorier tabt under faderens regeringstid overfor arvefjenden Ptolemæerriget."},{"page_url":"https://vi.wikipedia.org/wiki/L%C3%B2_than","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Grillen_-_BBQ_-_Barbeque_-_Fleisch_auf_dem_Grill.jpg","page_title":"Lò than","context_page_description":"Lò than là vật chứa dùng để đốt than hoặc nhiên liệu rắn khác để nấu nướng, sưởi ấm hoặc nghi lễ văn hóa. Nó thường có dạng hộp kim loại hoặc bát có chân. Độ cao của lò giúp lưu thông không khí, cung cấp oxy cho lửa. Lò than đã được sử dụng từ thời cổ đại; lò than Nimrud có niên đại sớm nhất vào năm 824 trước Công nguyên."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%B0%E8%A5%BF%E8%98%AD%E7%AB%B9%E7%AD%B4%E9%AD%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Trachurus_novaezelandiae.jpg","page_title":"新西蘭竹筴魚","context_page_description":"新西兰竹䇲鱼，为辐鳍鱼纲鲈形目鲈亚目鲹科竹䇲鱼属下的一个种，为亚热带海水鱼，分布于西南太平洋澳洲及新西兰海域及半咸水域，深度22-500米，体细长且侧扁，尾鳍叉形且为黄色，背鳍2个，背鳍硬棘9枚、背鳍软条27-33枚、臀鳍硬棘3枚、臀鳍软条22-29枚，脊椎骨24个，体上半部暗色并呈波浪状纹路，腹部银白色，体长可达50公分。栖息在沿海及河口区软底质的底部，偶会出现在中层或表层水域，成群活动，属肉食性，可做为食用鱼，通常以生鲜、烟熏或制成罐头贩售。"},{"page_url":"https://en.wikipedia.org/wiki/Mercedes-Benz_GLE-Class","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/21/Mercedes-Benz_W164_ML_63_AMG_Heck_AME.jpg","page_title":"Mercedes-Benz GLE-Class","context_page_description":"The Mercedes-Benz GLE-Class, formerly Mercedes-Benz M-Class, is a mid-size luxury SUV produced by the German automaker Mercedes-Benz since 1997. In terms of size, it is slotted in between the smaller GLC-Class and the larger GLS-Class, the latter with which it shares platforms.\\nFor a short time, between 1999 and 2002, the M-Class was also built by Magna Steyr in Graz, Austria, for the European market, before all the production moved to the U.S. plant near Vance, Alabama. From late 2012, the M-Class was also assembled at new plants in India and Indonesia.\\nSince April 2015, the M-Class has been renamed to GLE-Class."},{"page_url":"https://ca.wikipedia.org/wiki/Esternopt%C3%ADquids","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Maurolicus_muelleri_%28Pearlsides%29.gif","page_title":"Esternoptíquids","context_page_description":"Els esternoptíquids constitueixen una família de peixos marins pertanyent a l'ordre dels estomiformes."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BB%D1%96%D1%80_%D0%B7%D0%BE%D0%BB%D0%BE%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Ag-Au-Cu-colours-english.svg","page_title":"Колір золота","context_page_description":"Чисте золото має жовтий колір, але його сплави з іншими металами в різних пропорціях можуть давати різні кольори та відтінки жовтого. Існують сотні можливих комбінацій золота з іншими металами. Як правило, додавання срібла фарбує золото в зелений колір, а додавання міді — в червоний. Суміш з приблизно 50 на 50 частин срібла та міді створює сплави золота широко відомі на ринку ювелірних прикрас."},{"page_url":"https://sk.wikipedia.org/wiki/La_Cr%C3%A8che","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Map_commune_FR_insee_code_79048.png","page_title":"La Crèche","context_page_description":"La Crèche je francúzska obec, ktorá sa nachádza v departemente Deux-Sèvres, v regióne Poitou-Charentes."},{"page_url":"https://en.wikipedia.org/wiki/NGC_3226","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/NGC_3227_NGC_3226_Hubble_WikiSky.jpg","page_title":"NGC 3226","context_page_description":"NGC 3226 is a dwarf elliptical galaxy that is interacting with the spiral galaxy NGC 3227. The two galaxies are one of several examples of a spiral with a dwarf elliptical companion that are listed in the Atlas of Peculiar Galaxies. Both galaxies may be found in the constellation Leo."},{"page_url":"https://war.wikipedia.org/wiki/Euthlypis_lachrymosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Fan-tailed_Warbler.jpg","page_title":"Euthlypis lachrymosa","context_page_description":"An Euthlypis lachrymosa in uska species han Aves nga syahan ginhulagway ni Bonaparte hadton 1850. An Euthlypis lachrymosa in nahilalakip ha genus nga Euthlypis, ngan familia nga Parulidae. Ginklasipika han IUCN an species komo diri gud kababarak-an."},{"page_url":"https://it.wikipedia.org/wiki/Distretto_di_Korosty%C5%A1iv","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Korostyshivskyi-Raion.png","page_title":"Distretto di Korostyšiv","context_page_description":"Il distretto di Korostyšiv è un distretto dell'Ucraina, situato nell'oblast' di Žytomyr. Il suo capoluogo è Korostyšiv."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Saalfeld/Saale","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Saalfeld_Fleischgasse_12_Wohn-_und_Gesch%C3%A4ftshaus_Bestandteil_Denkmalensemble_%22Stadtkern_Saalfeld-Saale%22.jpg","page_title":"Liste der Kulturdenkmale in Saalfeld/Saale","context_page_description":"In der Liste der Kulturdenkmale in Saalfeld/Saale sind alle Kulturdenkmale der thüringischen Kreisstadt Saalfeld/Saale und ihrer Ortsteile aufgelistet."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D1%81%D1%81%D1%82%D1%8B%D0%BA%D0%BE%D0%B2%D0%BE%D0%B9_%D0%BF%D1%83%D1%82%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/%D0%A1%D1%82%D1%8B%D0%BA_%D0%BF%D0%BB%D0%B5%D1%82%D0%B5%D0%B9.JPG","page_title":"Бесстыковой путь","context_page_description":"Бесстыковой путь — условное наименование железнодорожного пути, расстояние между рельсовыми стыками которого значительно превосходит длину стандартного рельса. В России современный бесстыковой путь в основном представляет собой чередование участков пути, где уложены сваренные рельсовые плети длиной от 350 метров до длины блок-участка, с короткими участками звеньевого пути — уравнительными пролётами. Рельсы могут свариваться в плети длиной в перегон и достигать 30 и более километров, иногда такие плети свариваются со стрелками и станционными путями в единое целое.\\nДанный вид пути рассчитан на воздействие значительных температурных напряжений, возникающих в рельсах при колебаниях температуры воздуха. Рельсовые плети изготовляются из стандартных рельсов сваркой на предприятиях или непосредственно на месте укладки. Хотя прокладка бесстыкового пути более затратна, чем звеньевого, он отличается высокими эксплуатационными качествами, обеспечивающими высокоскоростное движение поездов, комфортабельность проезда пассажиров и снижение расходов на содержание подвижного состава и пути."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%80%E4%B9%8B%E6%B1%9F%E7%94%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Ichinoecho_2019.jpg","page_title":"一之江町","context_page_description":"一之江町は、東京都江戸川区の町名。住居表示未実施。郵便番号は134-0092。"},{"page_url":"https://fr.wikipedia.org/wiki/Prison_de_La_Force","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/BerangerLaForce.jpg","page_title":"Prison de La Force","context_page_description":"La prison de La Force est un hôtel particulier qui fut transformé en maison de détention et servit de prison pour la ville de Paris entre 1780 et 1845."},{"page_url":"https://en.wikipedia.org/wiki/Church%27s","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Church%27s_Works_in_St_James_Northampton.jpg","page_title":"Church's","context_page_description":"Church’s is a high-end English footwear manufacturer founded in 1873 by Thomas Church and his three sons. During the 1990s the company came under the control of Prada which bought 83% of the company at US$170 million."},{"page_url":"https://de.wikipedia.org/wiki/Menhir_de_la_Vacherie","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/44_Donges_Le_Menhir_2.jpg","page_title":"Menhir de la Vacherie","context_page_description":"Der Menhir de la Vacherie ist ein Menhir in Carlet, südöstlich von Donges im Departement Loire-Atlantique in Frankreich.\\nUrsprünglich stand der Menhir auf einer Wiese des Bauernhofes La Vacherie, nahe dem Ästuar der Loire. Seit dem Bau der Erdölraffinerie steht er auf dem Industriegelände und ist ebenso wie der benachbarte Dolmen La Roche für die Öffentlichkeit unzugänglich.\\nEr wurde ein Christianisiertes Megalithmonument, das von einem eisernen Kreuz gekrönt wurde und zugleich als Seezeichen diente. 1770 wurde der Menhir vom Blitz getroffen und ein Teil des Steins und das Kreuz zerstört.\\nDer 4,75 m hohe Menhir wurde 1889 als Monument historique eingestuft."},{"page_url":"https://ca.wikipedia.org/wiki/Medalla_de_l%27Atl%C3%A0ntic_Sud_1982","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/South_Atlantic_Medal_obv.jpg","page_title":"Medalla de l'Atlàntic Sud 1982","context_page_description":"La Medalla de l'Atlàntic Sud és una medalla de campanya britànica concedida al personal militar i civil britànic pels seus serveis durant la Guerra de les Malvines de 1982, entre el Regne Unit i Argentina. Se'n van concedir 29.700. L' Associació de la Medalla de l'Atlàntic Sud va crear-se el 1997."},{"page_url":"https://it.wikipedia.org/wiki/Charlie_Scott","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/30/Charlie_Scott.jpeg","page_title":"Charlie Scott","context_page_description":"Charles Thomas \\"Charlie\\" Scott è un ex cestista statunitense, professionista nella ABA e nella NBA.\\nPadre di Shannon Scott, dal 2018 è fra i membri del Naismith Memorial Basketball Hall of Fame."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%BB%A3%E7%80%A8%E6%A6%AE%E7%90%86%E5%AD%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Eriko_Hirose_2011_US_Open_Badminton.jpg","page_title":"廣瀨榮理子","context_page_description":"广濑荣理子，兵库县川边郡猪名川町出生，日本女子羽毛球运动员，于2014年12月宣布退役。她毕业于兵库县中谷中学校及青森县青森山田高校，曾效力三洋电机、松下电器及尤尼克斯羽毛球部，在2004至2010年间曾五度赢得全日本综合羽毛球锦标赛女子单打冠军，更一度取得三连霸佳绩。同时，她亦为日本国家羽毛球队的重要成员，曾代表国家赢得2010年亚洲运动会羽毛球比赛女子单打铜牌，以及两度在亚洲羽毛球锦标赛拿得季军；她也是2008年北京奥运会的日本代表团成员之一。在团体赛方面，她以成员身份为日本队赢得多哈亚运女团银牌、2010年和2012年尤伯杯季军，以及2014年尤伯杯亚军。"},{"page_url":"https://eu.wikipedia.org/wiki/Mundu_islamikoko_zientzia_Erdi_Aroan","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Abbasids850.png","page_title":"Mundu islamikoko zientzia Erdi Aroan","context_page_description":"Erdi Aroko mundu islamikoko zientzia Islamiar Urrezko Aroan garatutako zientzia izan zen, VII. eta XV. mendeen artean, omeiatarren, abbastarren, samandarren, ziyaridtarren, buyidtarren eta abbastarren agintaldietan."},{"page_url":"https://sk.wikipedia.org/wiki/Saint-Aubin-Rivi%C3%A8re","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Map_commune_FR_insee_code_80699.png","page_title":"Saint-Aubin-Rivière","context_page_description":"Saint-Aubin-Rivière je francúzska obec, ktorá sa nachádza v departemente Somme, v regióne Pikardia."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%A8%E0%B0%A1%E0%B0%BF%E0%B0%AA%E0%B1%82%E0%B0%A1%E0%B0%BF_(%E0%B0%AA%E0%B1%86%E0%B0%A8%E0%B1%81%E0%B0%97%E0%B1%8A%E0%B0%82%E0%B0%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/A.P.Village_Nadipudi_Subrahmanya_Temple.JPG","page_title":"నడిపూడి (పెనుగొండ)","context_page_description":"నడిపూడి, పశ్చిమ గోదావరి జిల్లా, పెనుగొండ మండలానికి చెందిన గ్రామం. ఇక్కడ కల సుబ్రహ్మణ్యేశ్వర స్వామి వారి దేవాలయము బహుళ ప్రసిద్దం. పూర్వం ఇది నడుపూడిగా పిలవబడేది. సుప్రసిద్ధ కాంగ్రేసు నాయకుడు, స్వాతంత్రసమరయోధుడు కళా వెంకటరావు పూర్వీకులు ఈ ఊరులో ఉండేవారు. అందుకే ఆయనకి నడిపూడి అంటే బాగా మక్కువ అనేవారు. అందుకే గొదావరి పైన ఆలమూరు వంతెనకి, సిద్ధాంతం వంతెనకి ఆయన గట్టిగా మద్రాసు అస్సెంబ్లిలో పోరాడి తన రాజకీయ పలుకుబడితో నిధులు మంజూరు చేయిపించి, చివరికి ఈ రెండు వంతెనలకు శంఖుస్థాపన కూడా చేసారు. ఇప్పటికి శిలాఫలకం పైన ఆయన పేరుంటుంది."},{"page_url":"https://de.wikipedia.org/wiki/Fossillagerst%C3%A4tte_Geiseltal","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Dryophyllum_Geiseltal.jpg","page_title":"Fossillagerstätte Geiseltal","context_page_description":"Die Fossillagerstätte Geiseltal befindet sich im ehemaligen Braunkohlerevier des Geiseltales südlich der Stadt Halle in Sachsen-Anhalt. Sie ist eine bedeutende Fundstelle heute ausgestorbener Pflanzen und Tiere aus der Zeit des Mittleren Eozäns vor 48 bis 41 Millionen Jahren. Im Geiseltal wurde nachweislich seit 1698 erstmals Kohle gefördert, die ersten Fossilien kamen aber erst Anfang des 20. Jahrhunderts eher zufällig zu Tage. Planmäßige wissenschaftliche Ausgrabungen begannen 1925 seitens der Martin-Luther-Universität Halle-Wittenberg. Unterbrochen durch den Zweiten Weltkrieg, können die Untersuchungen in zwei Forschungsphasen untergliedert werden. Aufgrund der zunehmenden Auskohlung der Rohstofflager kamen die Ausgrabungen Mitte der 1980er Jahre allmählich zum Erliegen und endeten endgültig zu Beginn des dritten Jahrtausends.\\nDie Braunkohle des Geiseltales wird in vier Hauptflöze untergliedert, fossilführend waren hauptsächlich die drei unteren. Der Schwerpunkt der Fossilverteilung liegt im südlichen und zentralen Geiseltal. Die Funde umfassen Reste von Pflanzen und Tieren."},{"page_url":"https://es.wikipedia.org/wiki/United_Center","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/United_Center_Interior.jpg","page_title":"United Center","context_page_description":"El United Center es un pabellón multideportivo situado en el área de Chicago, Illinois. Su nombre proviene de su principal espónsor, United Airlines, la compañía aérea que paga alrededor de 1,8 millones de dólares anuales por dar nombre al estadio, y que tienen contrato hasta el año 2014. Es el hogar de los Chicago Blackhawks de la NHL y de los Chicago Bulls de la NBA. Sustituye al viejo Chicago Stadium, que fue demolido tras ser inaugurado el flamante United Center el 18 de agosto de 1994.\\nEn la parte este del exterior del pabellón se encuentra la famosa estatua de Michael Jordan. A menudo el pabellón es denominado la casa que construyó Jordan."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%96%D0%BE%D0%BB%D0%BC%D0%B0-%D0%B6%D0%BE%D0%BB_%D0%B1%D0%B0%D1%81%D1%8B%D0%BF_%D1%88%D1%8B%D2%93%D0%B0%D1%80%D0%B0%D1%82%D1%8B%D0%BD_%D2%9B%D2%B1%D1%80%D1%8B%D0%BB%D2%93%D1%8B_(%D0%BF%D1%80%D0%B8%D0%BD%D1%82%D0%B5%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/HP_LaserJet_4000n.jpg","page_title":"Жолма-жол басып шығаратын құрылғы (принтер)","context_page_description":"Жолма-жол басып шығаратын құрылғы (принтер) — бір қабылдауда тұтас жолды басып шығаратын шапшаң құрылғы. Негізінен ірі кәсіпорындар мен ұйымдарда пайдаланылады."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%8A%AD%E6%AF%94%E5%A1%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Kapoor_Women_%28cropped%29.jpg","page_title":"芭比塔","context_page_description":"芭比塔是一位印度寶萊塢女演員。她是印度演員、導演拉茲·卡普爾的媳婦，演員蘭迪·卡浦爾的妻子。她的兩個女兒卡麗詩瑪和卡琳娜均是寶萊塢知名女星。她的父親Hari Shivdasani是一名信德族演員，母親Barbara則是英國人。\\n自1966年出道以來，芭比塔共拍攝了19部電影。1971年結婚後在1973年息影。"},{"page_url":"https://en.wikipedia.org/wiki/Kawasaki_KZ400","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Kawasaki_KZ400_Twin.jpg","page_title":"Kawasaki KZ400","context_page_description":"The Kawasaki KZ400/Z400 is a street motorcycle that was produced by Kawasaki between 1974 and 1984. The 398cc displacement of the twin cylinder engine was increased to 443cc for the KZ440/Z440. The later KZ400-J used a 399cc four cylinder engine."},{"page_url":"https://pl.wikipedia.org/wiki/Bitwa_pod_Kisz","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Map_of_Assyria.png","page_title":"Bitwa pod Kisz","context_page_description":"Bitwa pod Kisz – starcie zbrojne pomiędzy armią asyryjskiego króla Sennacheryba i armią babilońskiego króla Marduk-apla-iddiny II, wspartą wojskami Elamitów oraz plemion aramejskich, chaldejskich i arabskich, do którego doszło w 703 r. p.n.e. pod miastem Kisz w Babilonii. O bitwie tej wspominają inskrypcje królewskie Sennacheryba i zgodnie z nimi to armia asyryjska odnieść w niej miała zwycięstwo."},{"page_url":"https://de.wikipedia.org/wiki/Italienische_Rugby-Union-Nationalmannschaft","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Italy_Rugby_ITA_-_FRA_1975.jpg","page_title":"Italienische Rugby-Union-Nationalmannschaft","context_page_description":"Die italienische Rugby-Union-Nationalmannschaft ist die offizielle italienische Nationalmannschaft im Rugby Union und repräsentiert das Land bei allen Länderspielen der Männer. Sie wird meist als Azzurri bezeichnet. Azurblau wird allgemein als Farbe der italienischen Nationalmannschaften verwendet, da dies die traditionelle Farbe des Haus Savoyen war, das von 1860 bis 1946 die Könige Italiens stellte. Die organisatorische Verantwortung trägt die Federazione Italiana Rugby. Italien ist derzeit 14. auf der World-Rugby-Weltrangliste. Ihre Heimspiele trägt die Mannschaft in der Regel im Stadio Flaminio in Rom aus.\\nItaliens erstes Länderspiel fand 1929 statt, als man gegen Spanien spielte. Italien wurde neben Rumänien jahrzehntelang als eine der stärksten Rugbymannschaften Europas außerhalb der damaligen Five Nations angesehen. Seit 2000 nimmt Italien jährlich an den Six Nations teil, zusammen mit England, Frankreich, Irland, Schottland und Wales. 2011 und 2013 konnte Italië die Giuseppe-Garibaldi-Trophäe, die jährlich zwischen Frankreich und Italien während der Six Nations ausgespielt wird, entgegen nehmen."},{"page_url":"https://pt.wikipedia.org/wiki/Impeachment_de_Fernando_Collor","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/In%C3%ADcio_da_vota%C3%A7%C3%A3o_de_impeachment_de_Fernando_Collor.jpg","page_title":"Impeachment de Fernando Collor","context_page_description":"O processo de impeachment de Fernando Collor transcorreu no final de 1992 e foi o primeiro processo de impeachment do Brasil e da América Latina, resultando no afastamento definitivo de Fernando Collor de Mello do cargo de presidente da república. O processo, antes de aprovado, fez com que Collor renunciasse ao cargo em 29 de dezembro de 1992, deixando o cargo para seu vice Itamar Franco. Mesmo assim, o processo continuou e os parlamentares se reuniram em plenário para a votação do impeachment e decidiram que o presidente não poderia evitar o processo de cassação pela apresentação tardia da carta de renúncia. Com o julgamento, Collor ficou inelegível por 8 anos. Collor foi acusado de corrupção pelo seu próprio irmão, Pedro Collor de Mello, em matéria de capa da revista Veja, em 1992.\\nO empresário Paulo César Farias, tesoureiro de campanha de Collor, foi a personalidade-chave do impeachment. Ele seria o testa de ferro em diversos esquemas de corrupção divulgados de 1992 em diante."},{"page_url":"https://pt.wikipedia.org/wiki/Il%C3%ADdio_Pinho","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Il%C3%ADdio_Pinho_Leitura.jpg","page_title":"Ilídio Pinho","context_page_description":"Ilídio da Costa Leite de Pinho é um empresário português."},{"page_url":"https://it.wikipedia.org/wiki/Cattedrali_a_Porto_Rico","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Humacao%2C_Puerto_Rico_church.JPG","page_title":"Cattedrali a Porto Rico","context_page_description":"Questa è una lista delle cattedrali in Porto Rico."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kamen%C5%AF_zmizel%C3%BDch_na_Nov%C3%A9m_M%C4%9Bst%C4%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Stolperstein_f%C3%BCr_Gideon_Klein.jpg","page_title":"Seznam kamenů zmizelých na Novém Městě","context_page_description":"Seznam kamenů zmizelých v Novém Městě obsahuje pamětní kameny obětem nacismu v Novém Městě. Jsou součástí celoevropského projektu Stolpersteine německého umělce Guntera Demniga. Kameny zmizelých jsou věnovány osudu těch, kteří byli nacisty deportováni, vyhnáni, zavražděni nebo spáchali sebevraždu.\\nKameny zmizelých se zpravidla nacházejí před posledním místem pobytu obětí. První instalace v Praze se uskutečnila 8. října 2008."},{"page_url":"https://hu.wikipedia.org/wiki/K%C3%B6zponti_V%C3%A1s%C3%A1rcsarnok","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/VasarcsarnokFotoThalerTamas15.jpg","page_title":"Központi Vásárcsarnok","context_page_description":"A Nagycsarnok Budapest legnagyobb vásárcsarnoka, amely Budapestten, a Ferencvárosban található."},{"page_url":"https://en.wikipedia.org/wiki/Walter_Allman_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Walter_Allman_House.jpg","page_title":"Walter Allman House","context_page_description":"Walter Allman House is a historic home located at Crown Point, Lake County, Indiana. It was built in 1902, and is a three-story, Shingle style frame dwelling sheathed in horizontal clapboard shingles. It sits on a limestone foundation and has a central brick chimney. It features an imposing gambrel roof and wraparound porch.\\nIt was listed in the National Register of Historic Places in 2010."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%AF%D8%A7%DA%A9%D8%B3%D9%87%DB%8C%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/All_Saints_Church_-_Goxhill_-_geograph.org.uk_-_113039.jpg","page_title":"گاکسهیل","context_page_description":"گاکسهیل یک روستا در بریتانیا است که در Goxhill واقع شده‌است. گاکسهیل ۲٬۲۹۰ نفر جمعیت دارد."},{"page_url":"https://es.wikipedia.org/wiki/V%C3%ADa_Gemina","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/ZgodnjekrscanskiCenter-Ljubljana.JPG","page_title":"Vía Gemina","context_page_description":"La Vía Gemina era la calzada romana que unía Aquilea y Emona.​ Fue construida en 14 d. C. por la Legio XIII Gemina.​ El significado de su nombre deriva del hecho que comenzara en Aquilea como el \\"Camino Gemelo\\" de la Vía Postumia.\\nEl camino, que contribuyó a una rápida romanización de Istria, partía desde Aquilea y seguía al valle de Vipava, entre la desembocadura del río Vipava, hasta el río Isonzo en Pons Sonti y desde la posterior ciudad de Vipava, a través del distrito de Karst hasta Nauporto y Emona, formando un primer itinerario de la ruta del ámbar, que dejaba el territorio romano en Carnuntum.\\nSegún Tácito, Nauporto había sido saqueada por los constructores de carreteras en el año 14 d. C.​"},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%84%D5%86-%D5%AB_%D5%A1%D5%B4%D5%A5%D5%B6%D5%A1%D5%A2%D5%A1%D6%80%D5%B1%D6%80_%D5%B7%D5%A5%D5%B6%D6%84%D5%A5%D6%80%D5%AB_%D6%81%D5%A1%D5%B6%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/One_Manhattan_Square_July_2018.jpg","page_title":"ԱՄՆ-ի ամենաբարձր շենքերի ցանկ","context_page_description":"ԱՄՆ-ի ամենաբարձր շենքերի ցանկ, ԱՄՆ-ում 1885 թվականից մինչ օրս կառուցված ամենաբարձր շենքերի ցանկ, պարունակում է նշումներ՝ տեղի, բարձրության, հարկերի քանակակի, կառուցման ավարտի վերաբերյալ։\\nԱմերիկայի Միացյալ Նահանգները հանդիսանում է երկնաքերերի պատմական հայրենիք։ Առաջին երկնաքեր համարվում է Չիկագոյում 1885 թվականին կառուցված 10 հարկանի «Home Insurance Building»-ը։ Շենքը կառուցվել է նոր պողպատե բեռադիմացկուն հենքով։ Տասնմեկ ամերիկյան երկնաքերեր իրենց ժամանակին եղել են աշխարհի ամենաբարձր շինությունները։ 20-րդ դարում ԱՄՆ-ը առաջատարն էր բարձրահարկ շենքերի շինարարությամբ, սակայն դարավերջին և 21-րդ դարում սկսեց հետ մնալ այլ երկրներից։ 20-րդ դարի վերջին բուռն թափով սկսվեց երկնաքերերի շինարարությունը Չինաստանում և Հոնկոնգում։ 21-րդ դարի սկզբին սկսվեց «շինարարական բում» Արաբական Միացյալ Էմիրություններում։ 2013 թվականի դրությամբ, աշխարհի 25 ամենաբարձր շենքերից միայն 5-ն էին տեղակայված ԱՄՆ-ում։"},{"page_url":"https://de.wikipedia.org/wiki/Stranraer","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Stranraer_Castle.jpg","page_title":"Stranraer","context_page_description":"Stranraer ist eine Stadt im Westen des im Süden Schottlands gelegenen Council Area Dumfries and Galloway. Vorher gehörte sie zur traditionellen Grafschaft Wigtownshire. Die Stadt hatte 2011 10.593 Einwohner.\\nStranraer liegt am Ufer der Bucht Loch Ryan im Norden der Landenge, die die Halbinsel Rhins of Galloway mit dem schottischen Festland verbindet. Der Name der Stadt kommt vom schottisch-gälischen An t-Sròn Reamhar, was so viel wie fette Nase bedeutet. In Bezug auf die Lage des Ortes soll es aber breite Landenge bedeuten."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_San_Giovanni_in_Ayno","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Regola_-_San_Giovanni_in_Ayno.JPG","page_title":"Chiesa di San Giovanni in Ayno","context_page_description":"La ex chiesa di San Giovanni in Ayno è un edificio del centro storico di Roma, già luogo di culto cattolico, situato nel rione Regola, all'intersezione tra via di Monserrato e piazza de' Ricci."},{"page_url":"https://en.wikipedia.org/wiki/Craft_brewery_and_microbrewery","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Brooklyn_Penant_Ale_55_%286307519558%29.jpg","page_title":"Craft brewery and microbrewery","context_page_description":"A craft brewery or microbrewery is a brewery that produces small amounts of beer, typically less than large breweries, and is often independently owned. Such breweries are generally perceived and marketed as having an emphasis on enthusiasm, new flavours, and varied brewing techniques.\\nThe microbrewing movement began in both the United States and United Kingdom in the 1970s, although traditional artisanal brewing existed in Europe for centuries and subsequently spread to other countries. As the movement grew, and some breweries expanded their production and distribution, the more encompassing concept of craft brewing emerged. A brewpub is a pub that brews its own beer for sale on the premises."},{"page_url":"https://nl.wikipedia.org/wiki/Neerbosch","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Sint_Agnetenweg_77_Neerbosch_De_Kamp_Nijmegen_1864.jpg","page_title":"Neerbosch","context_page_description":"Neerbosch is een voormalig dorp, dat sinds de 19e eeuw binnen de gemeentegrenzen van Nijmegen ligt. Neerbosch-Oost grenst aan de wijk Hees. Neerbosch-West behoort nu tot het Nijmeegse stadsdeel Lindenholt."},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%9C%E1%80%BB%E1%80%BE%E1%80%95%E1%80%BA%E1%80%85%E1%80%85%E1%80%BA%E1%80%99%E1%80%AE%E1%80%90%E1%80%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Hydro_quebec_meter.JPG","page_title":"လျှပ်စစ်မီတာ","context_page_description":"လျှပ်စစ်ဓာတ်မီးကို အသုံးပြုသည့် အိမ်တိုင်း၌ အိမ်ထောင့်\\nနံရံတစ်နေရာတွင် ကပ်ရိုက်ထားသော\\nသေတ္တာငယ်တစ်ခုကိုတွေ့မြင် နိုင်လေသည်။ ထိုသေတ္တာမှာ\\nမီတာသေတ္တာ ဖြစ်သည်။ ဓာတ်မီး ကုမ္ပဏီသည် တစ်လ\\nတစ်ကြိမ် မီတာပေါ်၌ပြနေသော ဂဏန်း အမှတ် အသားမျာကို\\nကြည့်၍ မီတာထားသောအိမ်၌ သုံးစွဲသည့် လျှပ်စစ်ဓာတ်အားကို\\nစစ်ဆေးသည် ထိုနောက် ကျသင့်သမျှတန်ဖိုးကို\\nအိမ်နေသူတို့ထံမှ တောင်းယူသည်။ ထိုမီတာမျိုးကို လျှပ်စစ်\\nမီတာဟု ခေါ်သည်။\\nလျှပ်စစ်ဓာတ်မီးမပေါ်မီ ဓာတ်ငွေ့ဖြင့်မီးထွန်းသည့်ခေတ်က\\nဓာတ်ငွေ့မီတာဟူ၍ မီတာတစ်မျိုးရှိခဲ့သည်။ ဓာတ်ငွေ့မီတာတွင်\\nအစိုမီတာ၊ အခြောက်မီတာဟူ၍ နှစ်မျိုးနှစ်စားရှိ၏။ အစိုမီတာ\\nမျိုးမှာ မီတာ၌ တစ်ဝက်သာသာမျှ ရေထည့်ထားရသဖြင့်\\nအစိုမီတာ ဟု ခေါ်ခြင်းဖြစ်သည်။ အများအားဖြင့် ထိုမီတာမျိုးကို\\nမသုံးကြဘဲ ခြောက်သွေ့သည့် မီတာမျိုးကိုသာ အသုံးများကြ\\nသည်။ ဓာတ်ငွေ့ မီတာတွင် ဓာတ်ငွေ့လုံသော အခန်းငယ်\\nနှစ်ခုပါဝင်၍ အခန်း တစ်ခုစီတွင် လေဖိုတစ်ခုစီ\\nတပ်ဆင်ထားသည်။ လေဖိုတစ်ခု ပိန်သွားသောအခါ အခြားတစ်ခု\\nဖောင်းကြွလာစေရန် စီမံထား သည်။ ဖောင်းနေသော\\nပထမလေဖိုရှိသည့် အခန်းမှ အဆို့ရှင် သည်ပွင့်နေစဉ်\\nဒုတိယအခန်းမှ အဆို့ရှင်သည် ပိတ်လျက်ရှိသည်။ ထိုအခါ\\nပထမအခန်းထဲသို့ ဓာတ်ငွေ့သည် တိုးဝင်လျက် နေသည်။\\nဓာတ်ငွေ့မီးအိမ်ကို ဖွင့်လိုက်သောအခါ ပထမအခန်း၏ လေဖိုမှ\\nဓာတ်ငွေ့ကို စုတ်ယူလိုက်သဖြင့် အခန်းတွင်းရှိ ဓာတ်ငွေ့က\\nလေဖိုကို ဖိတွန်းသည်။"},{"page_url":"https://de.wikipedia.org/wiki/Wildenstein_(Haut-Rhin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Wildenstein%2C_Mairie_et_Poste.jpg","page_title":"Wildenstein (Haut-Rhin)","context_page_description":"Wildenstein ist eine französische Gemeinde mit 180 Einwohnern im Département Haut-Rhin in der Region Grand Est. Sie ist Mitglied der Communauté de communes de la Vallée de Saint-Amarin."},{"page_url":"https://es.wikipedia.org/wiki/Historia_del_Per%C3%BA_entre_1821_y_1842","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Andr%C3%A9s_de_Santa_Cruz_2.jpg","page_title":"Historia del Perú entre 1821 y 1842","context_page_description":"Para la historiografía oficial peruana, el periodo de 1821 a 1842 constituye la primera etapa de la historia republicana del Perú.\\nSe inicia oficialmente el 28 de julio de 1821, día en el que el general rioplatense José de San Martín, jefe de la Expedición Libertadora, proclamó la Independencia del Perú en Lima, la capital del hasta entonces Virreinato del Perú. Sin embargo, para el historiador Jorge Basadre el punto de partida del nacimiento de la República del Perú, sería, sensu stricto, la instalación del Primer Congreso Constituyente del Perú, que se da el 20 de septiembre de 1822.​\\nCierra dicho periodo el año de 1842, cuando se inicia un periodo de anarquía, sucedida tras la derrota y muerte en Bolivia del presidente Agustín Gamarra.\\nA este período de veinte años, Basadre ha denominado como la Época Fundacional de la República o la Iniciación de la República, pues fue una etapa en el que el Perú no solo se libró de la dominación española y definió su sistema de gobierno, sino que consolidó su espacio territorial, repeliendo los intentos de países vecinos de fracturar su integridad:"},{"page_url":"https://fi.wikipedia.org/wiki/Sito","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/2013_SITO_logo_RGB_jpg.jpg","page_title":"Sito","context_page_description":"Sito Oy oli suomalainen suunnittelu- ja konsultointitoimisto infrastruktuuri-, liikenne-, maankäyttö- ja ympäristösuunnittelun sekä digitaalisten palveluiden aloilla. Sillä oli Suomessa yli 400 työntekijää kymmenellä paikkakunnalla. Siton palvelut kattoivat suunnittelun kaikki vaiheet ja osatehtävät sekä asiakasprosessien konsultoinnin ja tietopalvelut.\\nVuonna 2014 yrityksellä oli 421 työntekijää. Sen liikevaihto oli 44,2 miljoonaa euroa.\\nYritys yhdistyi Wise Groupin kanssa Sitowiseksi."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D0%B1%D0%B5%D0%BB%D0%B8%D1%83%D1%81_(%D0%BF%D0%BE%D0%B5%D0%B7%D0%B4)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/02/Sibelius_train.jpg","page_title":"Сибелиус (поезд)","context_page_description":"«Сибе́лиус» — пассажирский поезд Финских железных дорог, курсировавший по маршруту Хельсинки — Санкт-Петербург c 30 мая 1992 года до 11 декабря 2010 года. Заменен на фирменные скоростные поезда «Аллегро»."},{"page_url":"https://zh.wikipedia.org/wiki/K1453/1454%E6%AC%A1%E5%88%97%E8%BD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/HXD3D_0080_at_Shoupakou_%2820180302122903%29.jpg","page_title":"K1453/1454次列车","context_page_description":"K1453/1454次列车是中国铁路运行于首都北京至江西赣州之间的一对快速旅客列车，现由南昌铁路局南昌客运段京广车队负责客运任务，是赣州历史上第二班始发进京列车。列车使用25G型客车，运行纵贯京九铁路，全程运行1861公里，途经北京、河北、山东、河南、安徽、湖北、江西六省一市，其中北京西站至赣州站运行22小时34分，使用车次为K1453次；赣州站至北京西站运行23小时44分，使用车次为K1454次。该列车是全国第一班以雷锋命名的旅客列车，有“中国第一‘雷锋号’列车”之称。"},{"page_url":"https://pt.wikipedia.org/wiki/Regi%C3%A3o_Centro-Oeste_do_Brasil","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Arranha-c%C3%A9us_de_Goi%C3%A2nia.JPG","page_title":"Região Centro-Oeste do Brasil","context_page_description":"A Região Centro-Oeste é uma das cinco regiões do Brasil definidas pelo IBGE em 1969. É formada por três estados: Goiás, Mato Grosso e Mato Grosso do Sul, mais o Distrito Federal, onde se localiza Brasília, a capital do país e a cidade mais populosa da região.\\nCom uma área de 1 606 403,506 km², o Centro-Oeste é a segunda maior região do Brasil em superfície territorial, superada apenas pela Região Norte, sendo um pouco maior que a área do estado do Amazonas ou da Região Nordeste. Por outro lado, é a região menos populosa e possui a segunda menor densidade populacional. Por esse motivo, apresenta algumas concentrações urbanas e grandes vazios demográficos.\\nDas regiões brasileiras, o Centro-Oeste é a única que faz limite com todas as demais e, ao mesmo tempo, a mais interiorana do país, sendo a única que não possui litoral."},{"page_url":"https://de.wikipedia.org/wiki/Erlenzeisig","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Erlenzeisig_EO5P0671-2.jpg","page_title":"Erlenzeisig","context_page_description":"Der Erlenzeisig ist eine Vogelart aus der Unterfamilie der Stieglitzartigen. Vögel dieser Art werden zuweilen auch einfach Zeisig genannt, da sie im deutschsprachigen Raum die häufigsten und bekanntesten Stellvertreter der Gruppe kleiner Finkenvögel sind, die den Namensteil „-zeisig“ tragen."},{"page_url":"https://fr.wikipedia.org/wiki/Patsy_Ruth_Miller","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/Patsy_Ruth_Miller_Stars_of_the_Photoplay.jpg","page_title":"Patsy Ruth Miller","context_page_description":"Patsy Ruth Miller est une actrice américaine."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%87%D8%B1%D8%B3%D8%AA_%D9%85%D8%B3%D8%AC%D8%AF%D9%87%D8%A7%DB%8C_%D8%A7%DB%8C%D8%B1%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Abdolazim3.jpg","page_title":"فهرست مسجدهای ایران","context_page_description":"فهرستی از همه مسجدهای ایران؛ زیارتگاه‌ها و امامزاده‌هایی که مسجد دارند، نیز به‌حساب می‌آیند."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Haltestellen_der_Stadtbahn_Stuttgart","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Stadtbahnhaltestelle_L%C3%B6wen-Markt.jpg","page_title":"Liste der Haltestellen der Stadtbahn Stuttgart","context_page_description":"Die Liste der Haltestellen der Stadtbahn Stuttgart beinhaltet alle bestehenden Haltestellen der Stadtbahn in Stuttgart und den umliegenden Städten, die von der Stadtbahn erschlossen werden.\\nEine Besonderheit stellen zahlreiche Haltestellen dar, die sich zwar in Tieflage befinden, aber komplett oder teilweise nach oben hin offen sind. Ebenso jene Haltestellen, die sich in der Tunnelrampe befinden oder gar bereits ein Teil des Tunnelportal selbst sind. Alle Haltestellen verfügen über Hochbahnsteige, die einen stufenlosen Einstieg in die Stadtbahnen gewährleisten.\\nDie Liste ist folgendermaßen aufgebaut:\\nName: Name der Haltestelle\\nLinie: Stadtbahnlinien, die die Haltestelle bedienen\\nEröffnung: Jahr der Eröffnung des Bauwerks. Bei Haltestellen, die mit einem Stern gekennzeichnet sind, handelt es sich um das Datum, an dem der normalspurige Stadtbahnverkehr aufgenommen wurde\\nLage: Lage der Haltestelle\\nStadt: Stadt, in der sich die Haltestelle befindet\\nStadtteil: Stadtteil, in dem sich die Haltestelle befindet. In Klammern befindet sich der Stadtbezirk.\\nAnmerkungen: Anmerkungen zur Haltestelle\\nSehenswürdigkeiten: Sehenswürdigkeiten und Bauwerke in einem Umkreis von 500 Metern"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%96%D0%B7%D0%B0%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Piesau_mit_Glaswerk.jpg","page_title":"Пізау","context_page_description":"Пізау — громада в Німеччині, розташована в землі Тюрингія. Входить до складу району Заальфельд-Рудольштадт. Складова частина об'єднання громад Ліхтеталь-ам-Реннштайг.\\nПлоща — 7,86 км². Населення становить 715 ос."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_de_lemn_din_Gr%C4%83me%C8%99ti","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Gramesti_VL.bislemn.inscriptie_7173_intrare.jpg","page_title":"Biserica de lemn din Grămești","context_page_description":"Biserica de lemn din Grămești se află în cătunul Grămești din localitatea Pietreni, județul Vâlcea. Biserica poartă hramul „Adormirea Maicii Domnului” și este datată de o inscripție din anul 7173, era bizantină, adică anii 1664 de la nașterea lui Christos. Ctitorie a unui arhiereu al țării, mitropolitul Ștefan I, biserica de lemn este una dintre cele mai însemnate la sud de Carpați. Ea face parte dintr-un număr restrâns de biserici ridicate din lemn de mari boieri și dregători de seamă. Acestea se disting de celelalte biserici de lemn de sate, ctitorite de mici boieri de țară, obști de moșneni sau clăcași, prin nivelul calitativ ridicat al dulgheritului și al înzestrării interioare. Biserica se remarcă prin așezarea pe un soclu înalt de calcar, ce îi dă aerul unei case boerești, planul cu pridvor, tindă, naos și altar în retrageri succesive, prin rafinamentul îmbinărilor și decorațiilor dulgherești, prin colecția de inscripții adunate pe pereții exteriori, icoanele de o bună calitate artistică și portretul de ctitor. Biserica este înscrisă pe noua listă a monumentelor istorice, LMI 2004: VL-II-m-A-09873."},{"page_url":"https://fr.wikipedia.org/wiki/Syst%C3%A8me_immunitaire_adaptatif","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Maturation_de_la_cellule_dendritique.jpg","page_title":"Système immunitaire adaptatif","context_page_description":"Le système immunitaire adaptatif désigne les lymphocytes T, qui contribuent à l'immunité à médiation cellulaire, et les lymphocytes B qui sont responsables de l'immunité à médiation humorale. Ces deux populations cellulaires ont des propriétés et des fonctions distinctes des cellules du système immunitaire inné.\\nIl existe deux grandes caractéristiques majeures propres à l'immunité adaptative :\\nLes gènes codant les récepteurs antigéniques des lymphocytes font l'objet d'une recombinaison somatique et aléatoire de l'ADN, appelée recombinaison somatique. La nature des récepteurs antigéniques des lymphocytes n'étant pas entièrement prédéterminée génétiquement, l'immunité adaptative est également désignée immunité acquise.\\nL'activation d'un lymphocyte s'accompagne d'une expansion clonale, et de la mise en place d'une réponse mémoire, ou anamnestique. C'est en cela que l'on parle d'immunité adaptative.\\nLe système immunitaire adaptatif permet de construire au cours de la vie une immunité acquise, qui avec le système immunitaire inné constitue le phénotype immunitaire des individus.\\nLe système immunitaire adaptatif n’existe que chez les vertébrés gnathostomes."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%B0%E5%BA%A6%E9%93%81%E8%B7%AF%E8%BF%90%E8%BE%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Tanna_Village_and_Smaller_Viaduct_%2812671597053%29.jpg","page_title":"印度铁路运输","context_page_description":"印度是最早开通火车的亚洲国家，也是20世纪90年代前铁路总里程最长的亚洲国家。铁路在印度交通运输中占据重要地位。\\n印度的干线铁路网由印度铁道部下属的国有企业印度铁路公司运营。截至2017年3月，印度干线铁路网轨道总长达121,407 km，线路总长达67368公里，共有7349座车站，为世界第四大铁路网，其中49%的线路为电气化铁路，并有33%的线路有两条或以上轨道。\\n截至2018年，印度干线铁路网年客运量达91.16亿人次；截至2017年，年货运量达11.08亿吨。截至2017年3月，印度铁路公司共拥有277987辆货运车厢、70937辆客运车厢及11452台铁路机车，并在全国多处拥有铁路机车及客车制造场地。\\n印度的城市轨道交通系统则独立于印度铁路公司以外运作。截至2019年，印度共有13个运营中的城市轨道交通系统，运营总长达638公里，共有502座车站。"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9D%B4%ED%9D%AC%EC%A7%84_(%EB%B0%B0%EC%9A%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Lee_Hee-Jin.jpg","page_title":"이희진 (배우)","context_page_description":"이희진은 대한민국의 여성 5인조 걸그룹 베이비복스 전 멤버이자 배우이다.\\n10대 시절인 1997년 베이비복스 멤버로 데뷔해 뛰어난 노래와 춤 실력, 섹시한 이미지로 많은 남성팬들을 거느리며 화려한 시절을 보냈다. 베이비복스가 해체된 후 연기자의 길을 걸어 SBS 드라마 《괜찮아, 아빠딸》로 배우 생활을 시작했으며 뛰어난 동안 외모를 유지 중이다."},{"page_url":"https://en.wikipedia.org/wiki/Mitral_valve_stenosis","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Phonocardiograms_from_normal_and_abnormal_heart_sounds.png","page_title":"Mitral valve stenosis","context_page_description":"Mitral valve stenosis is a condition in which the canal between the left atrium and ventricle is narrowed due to disease of the cusps of the left atrioventricular valve. Mitral valve stenosis may remain asymptomatic for years. When clinical symptoms develop, they may be similar to those of other heart diseases.\\nMitral stenosis is a valvular heart disease characterized by the narrowing of the orifice of the mitral valve of the heart. It is almost always caused by rheumatic valvular heart disease. Normally, mitral valve is about 5 cm² during diastole. Any decrease in area below 2 cm² causes mitral stenosis. Early diagnosis of mitral stenosis in pregnancy is very important as the heart cannot tolerate increased cardiac output demand as in the case of exercise and pregnancy. Atrial fibrillation is a common complication of resulting left atrial enlargement, which can lead to systemic thromboembolic complications like stroke."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A4%E3%82%B5%E3%83%AB%E3%83%BB%E3%83%8F%E3%83%AB%E3%82%A8%E3%83%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Isser_Harel.jpg","page_title":"イサル・ハルエル","context_page_description":"イサル・ハルエルは、イスラエルの諜報実務家で1969年から1974年まで同国国会議員。建国前のイシューヴでハガナー情報局の有力者として頭角を現わす。イスラエル総保安庁創設者でイスラエル諜報特務庁長官としても活躍。ダヴィド・ベン＝グリオン首相の下で「安全保障担当」という特別の地位に就いた。また、日本のメディアではイサー・ハレルと英語読みで表記されることが多い。"},{"page_url":"https://de.wikipedia.org/wiki/Gran%E2%80%99_M%C3%A8re_du_Chimqui%C3%A8re","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Castel_statue_menhir.jpg","page_title":"Gran’ Mère du Chimquière","context_page_description":"Die Gran’ Mère du Chimquière steht auf dem Friedhof der mittelalterlichen Kirche von St Martin, etwa 2,5 km südwestlich von Saint Peter Port auf der britischen Kanalinsel Guernsey.\\nDie Granitstatue ist 1,65 Meter hoch und war ursprünglich wahrscheinlich ein Menhir, der in keltischer oder römischer Zeit in eine weibliche Figur mit Kopf und Schultern umgeformt wurde. Die Schnitzereien sind typisch für eine heidnische Fruchtbarkeitsgöttin, daher der Name La Gran Mere. Der ursprünglich heidnische Statuenmenhir wurde im 6. Jahrhundert von keltischen Missionaren christianisiert.\\nFrisch vermählte Paare schmücken die Figur immer noch mit Blumen oder legen Münzen auf den Kopf der Statue."},{"page_url":"https://no.wikipedia.org/wiki/Astrakhan_oblast","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Map_of_Russia_-_Astrakhan_Oblast.svg","page_title":"Astrakhan oblast","context_page_description":"Astrakhan oblast er en oblast i Sørvest-Russland. Den grenser til Kalmykia i vest og Volgograd oblast i nord."},{"page_url":"https://en.wikipedia.org/wiki/Mongolian_numerals","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Mongolian_numerals_2013.jpg","page_title":"Mongolian numerals","context_page_description":"Mongolian numerals are numerals developed from Tibetan numerals and used in conjunction with the Mongolian and Clear script. They are still used on Mongolian tögrög banknotes.\\nThe main sources of reference for Mongolian numerals are mathematical and philosophical works of Janj khutugtu A.Rolbiidorj and D.Injinaash. Rolbiidorj exercises with numerals of up to 10⁶⁶, the last number which he called “setgeshgui” or “unimaginable” referring to the concept of infinity. Injinaash works with numerals of up to 10⁵⁹. Of these two scholars, the Rolbiidorj’s numerals, their names and sequencing are commonly accepted and used today, for example, in the calculations and documents pertaining to the Mongolian Government budget."},{"page_url":"https://br.wikipedia.org/wiki/Karia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Map_of_Caria.svg","page_title":"Karia","context_page_description":"Karia a oa ur vro gozh, pe ur broviñs, e mervent Azia Vihanañ, etre Likia er reter, Frigia en hanternoz, Lidia er c'hornôg, ha Mor Egea er c'hreisteiz.\\nHervez Herodotos e oa Minoiz a orin e oa tud Karia. Int avat a lavare e oant tud eus Anatolia, aet da voraerien hag e oant kerent d'ar Vysianed ha da dud Lidia.\\nHellened Ionia ha Doria eo a drevadennas ar c'hornôg anezhi hag en em veskas gant tud Karia evit sevel stadoù hellen nevez, en o zouez kêrioù Knidos, pe Halikarnassos. Karianed a veze graet eus an dud orin degouezhet er vro a-raok an Hellened.\\nPa deuas ar Bersed e voe savet ur satrapiezh ganto. Ar satraped avat en em zalc'he evel rouaned, evel Mausolos pe e wreg Artemisia II. Gant an impalaeriezh roman e oa ur broviñs roman en Azia."},{"page_url":"https://de.wikipedia.org/wiki/Scharlachtrugschm%C3%A4tzer","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Crimson_Chat_Newhaven_Sep04.JPG","page_title":"Scharlachtrugschmätzer","context_page_description":"Der Scharlachtrugschmätzer ist ein australischer Singvogel aus der Familie der Honigfresser."},{"page_url":"https://de.wikipedia.org/wiki/Thomas_Thomasberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Thomas_Thomasberg_20120329.jpg","page_title":"Thomas Thomasberg","context_page_description":"Thomas Thomasberg ist ein ehemaliger dänischer Fußballspieler und heutiger Fußballtrainer. Er besitzt die Lizenz des Fachübungsleiters und trainiert gegenwärtig den Erstligisten Randers FC."},{"page_url":"https://en.wikipedia.org/wiki/Toy_gun","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Toy_Gun_being_held_in_car_with_legs_in_background.jpg","page_title":"Toy gun","context_page_description":"Toy guns are toys which imitate real guns, but are designed for children to play with. From hand-carved wooden replicas to factory-produced pop guns and cap guns, toy guns come in all sizes, prices and materials such as wood, metal, plastic or any combination thereof. Many newer toy guns are brightly colored and oddly shaped to prevent them from being mistaken for real firearms."},{"page_url":"https://hu.wikipedia.org/wiki/Stazione_di_Manarola","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Manarola_train_station_1.jpg","page_title":"Stazione di Manarola","context_page_description":"Stazione di Manarola vasútállomás Olaszországban, Manarola településen."},{"page_url":"https://it.wikipedia.org/wiki/Ipotesi_sulla_storia_della_Sindone","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Shroud_positive_negative_compare.jpg","page_title":"Ipotesi sulla storia della Sindone","context_page_description":"Gli storici sono d'accordo nel ritenere documentata con sufficiente certezza la storia della Sindone di Torino a partire dalla metà del XIV secolo. Sulla sua storia precedente e sulla sua antichità non vi è accordo.\\nQuanti credono che essa sia un falso ritengono semplicemente che essa non esistesse prima di tale epoca. Un importante elemento a sostegno di questa tesi è il risultato dell'esame del carbonio 14 eseguito nel 1988, secondo il quale il telo risale al periodo compreso tra il 1260 e il 1390.\\nQuanti invece credono che la Sindone sia l'autentico lenzuolo sepolcrale di Gesù rifiutano i risultati della datazione al carbonio 14, in quanto gli autenticisti li ritengono inattendibili da un punto di vista statistico, e ne collocano l'origine nella Palestina del I secolo. Ritengono quindi che la Sindone sia l'autentico lenzuolo funebre di Gesù e che risalga alla Terra di Israele del I secolo; essi sostengono inoltre la «suggestiva ipotesi» secondo cui la Sindone di Torino sia da identificare con il Mandylion o \\"Immagine di Edessa\\", un'immagine di Gesù molto venerata dai cristiani d'Oriente, scomparsa nel 1204."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9B%D0%BE%D0%BC%D1%81%D0%BA%D0%BE_%D1%88%D0%BE%D1%81%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Lomsko-shose-Beginning.jpg","page_title":"Ломско шосе","context_page_description":"„Ломско шосе“ е булевард в София.\\nНаречен е на основния път от столицата до Лом. На булеварда е наименувана метростанция „Ломско шосе“.\\nСтарото му име на булеварда е „Станке Димитров“. Преди началото му са главните улици в кварталите „Надежда“ и „Връбница“.\\nИзвън София продължението му е второкласният републикански път II-81, с крайни точки градовете София и Лом, преминаващ през прохода Петрохан."},{"page_url":"https://pt.wikipedia.org/wiki/Psicopictografia","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Drawing_by_H._Blavatsky.jpg","page_title":"Psicopictografia","context_page_description":"A psicopictografia, popularmente referida como pintura mediúnica, é, mais notoriamente segundo a Doutrina Espírita, uma manifestação mediúnica pela qual um espírito, através de um médium, se expressa por meio de pinturas ou desenhos.\\nAllan Kardec define médiuns pintores ou desenhistas, como sendo aqueles que pintam ou desenham sob a influência dos Espíritos.\\nNo Brasil, entre os diversos supostos médiuns que se destacam nessa área em particular, citam-se os nomes de Luiz Antonio Gasparetto, José Medrado, Marilusa Moreira Vasconcelos e Florêncio Anton, Adriano Sanchez Lauri entre outros."},{"page_url":"https://pt.wikipedia.org/wiki/Baume_et_Mercier","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Baume_et_Mercier_Classima_10324_Watch.jpg","page_title":"Baume et Mercier","context_page_description":"Baume & Mercier é uma empresa suíça relógios de luxo fundada em 1830. É uma subsidiária do conglomerado de luxo Richemont."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AC%E0%A6%A1%E0%A6%BC_%E0%A6%B6%E0%A6%BF%E0%A6%AC_%E0%A6%AE%E0%A6%A8%E0%A7%8D%E0%A6%A6%E0%A6%BF%E0%A6%B0,_%E0%A6%AA%E0%A7%81%E0%A6%A0%E0%A6%BF%E0%A6%AF%E0%A6%BC%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Pancha_Ratna_Shiva_Temple%2C_Puthia_%28front%29.jpg","page_title":"বড় শিব মন্দির, পুঠিয়া","context_page_description":"বড় শিব মন্দির পুঠিয়া রাজবাড়ির ছয়টি মন্দিরের একটি। এটি বাংলাদেশ প্রত্নতত্ত্ব অধিদপ্তর এর তালিকাভুক্ত একটি প্রত্নতাত্ত্বিক স্থাপনা।"},{"page_url":"https://da.wikipedia.org/wiki/Felber_Tauern","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Felbertauern2.JPG","page_title":"Felber Tauern","context_page_description":"Felber Tauern er et bjergpas i Østrig beliggende i 2.481 meters højde i Hohe Tauern i Alperne.\\nFelber Tauern ligger mellem Venedigergruppen og Granatspitzgruppen og forbinder delstaterne Salzburg og Tyrol. Passet er vanskeligt passabelt men var trods dette det mest benyttede Tauern-pas i romertiden. Først med bygningen af vejtunnelen Felbertauerntunnel i 1960'erne blev de to dale på hver side af Felber Tauern – Felbertal og Tauerntal – forbundet i en højde af 1.632 moh. Felbertauerntunnel er i dag den hurtigste forbindelse mellem Østtyrol og Salzburg."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%9A%E0%AF%81%E0%AE%A3%E0%AF%8D%E0%AE%A3%E0%AE%BE%E0%AE%AE%E0%AF%8D%E0%AE%AA%E0%AF%81_%E0%AE%A8%E0%AF%80%E0%AE%B0%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Limewater.jpg","page_title":"சுண்ணாம்பு நீர்","context_page_description":"சுண்ணாம்பு நீர் என்பது கால்சியம் ஐதராக்சைடின் நீர்த்த கரைசலுக்கான பொதுப்பெயர் ஆகும். கால்சியம் ஐதராக்சைடு, Ca(OH)₂, நீரில் மிக மிகக் குறைவாகக் கரையும் தன்மை பெற்றதாகும். தூய சுண்ணாம்பு நீருானது தெளிவான, நிறமற்ற, இலேசான மண்ணின் மணமுடைய, காரக்கசப்புச் சுவையுடையதாகும். சுண்ணாம்பு என்பது காரத்தன்மையுள்ள கனிமம் என்பதோடு தொடர்புடையதாகும்.\\nசுண்ணாம்பு நீரானது, நீரில் கால்சியம் ஐதராக்சைடை நன்கு கலக்கி, அதிகப்படியான, கரையாத நிலையில் உள்ள கால்சியம் ஐதராக்சைடை வடிகட்டி பிரித்தெடுப்பதன் மூலம் தயாரிக்கப்படுகிறது. அதிகப்படியான கால்சியம் ஐதராக்சைடானது கரைக்கப்படும் போது, பால் போன்ற வெண்மை நிறத்தை வெளிப்படுத்தும் தொங்கல் கரைசல் கிடைக்கிறது. இதன் காரணமாக இக்கரைசல் சுண்ணாம்புப் பால் என்ற பொதுப் பெயரைக் கொண்டுள்ளது. சுண்ணப்பால் என்பது சுண்ணாம்பின் தெவிட்டிய கரைசல் ஆகும். இதன் காரகாடித்தன்மைச் சுட்டெண் 12.4 ஆகும். இக்கரைசல் இயல்பில் காரத்தன்மை கொண்டது."},{"page_url":"https://cs.wikipedia.org/wiki/Bleskojistka","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/NBPowerTransmissionTowerMaintenance.JPG","page_title":"Bleskojistka","context_page_description":"Bleskojistka je zařízení, které chrání elektrická vedení a přístroje před bleskem, případně i před přepětím jiného původu. Nejjednodušší bleskojistka je jiskřiště se dvěma elektrodami: jedna je spojena s chráněným vodičem, druhá se zemí. Při výrazném překročení nominálního napětí vznikne mezi elektrodami elektrický výboj, který energii svede do země. U moderních bleskojistek bývá jiskřiště umístěno v ochranné atmosféře, často v keramické trubičce.\\nJako bleskojistka může sloužit i neonová trubice nebo jiná výbojka s vysokým startovacím napětím nebo polovodičový prvek."},{"page_url":"https://en.wikipedia.org/wiki/Buz%C4%83u_County","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/M%C4%83gura_sculpture_camp.jpg","page_title":"Buzău County","context_page_description":"Buzău County is a county of Romania, in the historical region Muntenia, with the capital city at Buzău."},{"page_url":"https://es.wikipedia.org/wiki/Nicolas_Escud%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Nicolas_Escud%C3%A9_RG_2012.JPG","page_title":"Nicolas Escudé","context_page_description":"Nicolas Jean-Christophe Escudé es un extenista francés que ingresó al profesionalismo en el año 1995. Ha ganado cuatro torneos en individuales, dos de los cuales se dieron en Róterdam, así como dos títulos en dobles.\\nEl diestro jugador alcanzó su mejor ubicación en el ranking del Tour de la V el 26 de junio de 2000, cuando fue el Nº 17 del mundo. De nacimiento es zurdo y fue entrenado desde niño a jugar como diestro, pero realiza todas sus demás actividades como zurdo.\\nEs hermano del exfutbolista Julien Escudé."},{"page_url":"https://de.wikipedia.org/wiki/Mari%C3%A4-Himmelfahrt-Kirche_(Auw_an_der_Kyll)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Prozes1952.jpg","page_title":"Mariä-Himmelfahrt-Kirche (Auw an der Kyll)","context_page_description":"Die Pfarrkirche Mariä Himmelfahrt in Auw an der Kyll in der Nähe von Bitburg ist eine der ältesten und schönsten Kirchen in der Südeifelregion. Seit jeher prägte sie das Bild des kleinen Ortes in der Eifel mit ihrer zentralen, hochgelegenen Position inmitten des Dorfes im Kylltal."},{"page_url":"https://es.wikipedia.org/wiki/Feira_de_Santana","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/Bairros_feira_de_santana.jpg","page_title":"Feira de Santana","context_page_description":"Feira de Santana es un municipio brasileño del estado de Bahía, situado a 115 km de su capital, Salvador de Bahía y conectado a través de la autovía BR-324.\\nSe localiza a una latitud de 12º16'00\\" sur y una longitud de 38º58'00\\" oeste, estando a una altura de 234 metros sobre el nivel del mar. Su población estimada para el año 2006 era de 535.284 habitantes.\\nLa ciudad se encuentra en uno de los principales cruces de carreteras del nordeste brasileño, funcionando como pasaje para el tráfico venido del sur y centro oeste que se dirige a Salvador de Bahía y otras importantes ciudades nordestinas. Gracias a la escasa distancia de la capital del Estado, la ciudad posee un diversifica e importante sector terciario, además de industrias y la Universidad Estadual de Feira de Santana.\\nPosee una fuerte producción agropecuaria, principalmente, tabaco, porotos, mandioca y maíz.\\nFeira de Santana es famosa también por sus fiestas típicas, como la de \\"Señora Sant'Ana\\", en la segunda quincena de enero; la \\"Micareta\\", fiesta carnavalesca celebrada 15 días antes de las Pascuas; el \\"Festival de Guitarras\\" en septiembre; y la corrida de toros en noviembre."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%96%E3%83%A9%E3%82%B8%E3%83%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Feiraliberdadesaopaulo.jpg","page_title":"ブラジル","context_page_description":"ブラジル連邦共和国、通称ブラジルは、南アメリカに位置する連邦共和制国家。首都はブラジリア。\\n南米大陸で最大の面積を占め、ウルグアイ、アルゼンチン、パラグアイ、ボリビア、ペルー、コロンビア、ベネズエラ、ガイアナ、スリナム、フランス領ギアナと国境を接している。また、大西洋上のフェルナンド・デ・ノローニャ諸島、トリンダージ島・マルティン・ヴァス島、サンペドロ・サンパウロ群島もブラジル領に属する。その国土面積は日本の22.5倍で、アメリカ合衆国よりは約110万km²小さいが、ロシアを除いたヨーロッパ全土より大きく、インド・パキスタン・バングラデシュの三国を合わせた面積の約2倍に相当する。\\n南アメリカ大陸最大の面積を擁する国家であると同時にラテンアメリカ最大の領土・人口を擁する国家で、面積は世界第5位である。南北アメリカ大陸で唯一のポルトガル語圏の国であり、同時に世界最大のポルトガル語使用人口を擁する国でもある。公用語はポルトガル語ではあるがスペイン語も比較的通じる。ラテンアメリカ最大の経済規模であり、同時に世界で7番目の経済規模でもある。\\nブラジルは北部は赤道直下で、全体的に海流等の影響もあり気候は大変温暖であり、中南米最多の人口と経済規模である。"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%91%D0%B5%D0%BD%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Atakora_Benin_Batia.jpg","page_title":"Бенин","context_page_description":"Република Бенин е държава в Западна Африка. До 1975 година държавата се нарича Дахомей. Граничи с Того на запад, с Нигерия на изток и с Буркина Фасо и Нигер на север. Разположена е на брега на Гвинейския залив и има площ 112 600 кв. км.\\nБенин е френска колония до 1960 г. и в него се говори предимно френски език. Член е на Западноафриканския валутен съюз и парична единица в страната е западноафриканския CFA франк/курс 1 евро= 656 CFA/.\\nСтолица е град Порто Ново с 230 хил. жители. Стопански център на страната обаче е пристанищният град Котону с население от около 1 милион души.\\nМеждународният туризъм е слабо развит. Престъпността е поносима. Опасност представлява къпането в морето поради силните течения, жертва на които ежегодно стават доста хора."},{"page_url":"https://de.wikipedia.org/wiki/Annenheim_(Gemeinde_Treffen_am_Ossiacher_See)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Annenheim_-_Kanzelbahn_-_Talstation.JPG","page_title":"Annenheim (Gemeinde Treffen am Ossiacher See)","context_page_description":"Annenheim ist ein Dorf in der Gemeinde Treffen am Ossiacher See mit 641 Einwohnern im Bezirk Villach-Land in Kärnten, Österreich."},{"page_url":"https://en.wikipedia.org/wiki/Grote_Kerk_(Breda)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Grote_Kerk_Interior.JPG","page_title":"Grote Kerk (Breda)","context_page_description":"The Grote Kerk or Onze-Lieve-Vrouwekerk is the most important monument and a landmark of Breda. The church is built in the Brabantine Gothic style. The tower of the church is 97 meters tall. The plan is in the shape of a Latin Cross."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A1%D1%82%D0%B5%D0%BD%D1%87%D0%B5%D0%B2%D1%81%D0%BA%D0%B0_%D1%82%D0%B2%D1%80%D0%B4%D0%B8%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/%D0%93%D1%80%D0%B0%D0%B4%D0%B8%D1%88%D1%82%D0%B5_%28%D0%A1%D1%82%D0%B5%D0%BD%D1%87%D0%B5%29_%287%29.JPG","page_title":"Стенчевска тврдина","context_page_description":"Стенчевска тврдина — археолошко наоѓалиште кое се наоѓа над селото Стенче, во подножјето на Сува Гора, на ридот Градиште — на надморска височина од 730 метри. Според проценките на археолозите наоѓалиштето е старо 8.000 години."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D1%83%D0%BB%D0%B8%D1%86%D1%8F_%D0%92%D0%B8%D1%88%D0%B5%D0%BD%D1%81%D1%8C%D0%BA%D0%BE%D0%B3%D0%BE_(%D0%9B%D1%8C%D0%B2%D1%96%D0%B2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/14_Vyshenskoho_Street%2C_Lviv_%2801%29.jpg","page_title":"Вулиця Вишенського (Львів)","context_page_description":"Вулиця Вишенського — вулиця у Личаківському районі міста Львів, у місцевості Личаків. Пролягає від вулиці Солодової до вулиці Піскової. Між будинками № 12 та № 14 є сходи, які з'єднують вулицю Вишенського з вулицею Личаківською."},{"page_url":"https://de.wikipedia.org/wiki/Mordgrundbach_(Elbe)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/20_Degelequelle.JPG","page_title":"Mordgrundbach (Elbe)","context_page_description":"Der Mordgrundbach ist ein Nebenfluss der Elbe im Osten von Dresden."},{"page_url":"https://it.wikipedia.org/wiki/Auersperg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Schloss_Wald%2C_Pyhra.jpg","page_title":"Auersperg","context_page_description":"Gli Auersperg sono una famiglia principesca austriaca. Apparsi nel secolo XI come cavalieri, assursero nel XVII secolo alla dignità di principi del Sacro Romano Impero Germanico, guadagnandosi un proprio stato con possedimenti in Austria, Baden-Württemberg meridionale, Germania, Sciaffusa settentrionale e Svizzera."},{"page_url":"https://de.wikipedia.org/wiki/Laeiszhalle","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Vier_Bildnisse_von_Johannes_Brahms_von_Th_Darboven_in_Hamburg-Neustadt.jpg","page_title":"Laeiszhalle","context_page_description":"Die Laeiszhalle, ehem. Musikhalle Hamburg, ist ein traditionsreiches Konzerthaus am Johannes-Brahms-Platz in Hamburg. Sie wurde in neobarockem Stil errichtet und 1908 eingeweiht. Ihr Großer Saal bietet 2025 Sitzplätze und eine 1951 erbaute Orgel. Der Kleine Saal hat 640 Sitzplätze.\\nGeneralintendant der Laeiszhalle ist seit 2007 Christoph Lieben-Seutter. Er ist auch für die am 11. Januar 2017 eröffnete Elbphilharmonie zuständig. Die Symphoniker Hamburg sind das Orchester der Laeiszhalle."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BF%D5%A1%D5%BA%D6%80%D5%A5%D5%A6%D5%A5_%D5%84%D5%AB%D6%84%D5%A5%D5%AC%D5%A1%D5%B6%D5%BB%D5%A5%D5%AC%D5%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Palazzo_Clusini.jpg","page_title":"Կապրեզե Միքելանջելո","context_page_description":"Կապրեզե Միքելանջելո, կոմունա Իտալիայում, գտնվում է Տոսկանա մարզի Արեցո գավառում։\\nԲնակչությունը՝ 1622 մարդ ։ Բնակչության խտությունը՝ 24 մարդ/կմ²։ Զբաղեցնում է 67 կմ² տարածք։ Փոստային ինդեքս՝ 52033։ Հեռախոսային կոդը՝ 0575։"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B5%D0%BC%D1%84%D1%96%D1%81_(%D0%A2%D0%B5%D0%BD%D0%BD%D0%B5%D1%81%D1%81%D1%96)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/97/Memphis_Brooks_Museum_of_Art.jpg","page_title":"Мемфіс (Теннессі)","context_page_description":"Мемфіс — місто в США, в окрузі Шелбі розміщене в південно-західному районі штату Теннессі, порт на річці Міссісіпі. Населення — 646 889 осіб, що робить місто найбільш населеним у штаті Теннессі, третім у південно-східних штатах, і дев'ятнадцятим у Сполучених Штатах. Мемфіс одне з наймолодших міст штату."},{"page_url":"https://en.wikipedia.org/wiki/Adelina_Kondr%C3%A1tieva","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Kondrateva_Adelina.jpg","page_title":"Adelina Kondrátieva","context_page_description":"Adelina Kondrátieva was an Argentine-born Russian translator and Brigadista who participated in the Spanish Civil War on the Republican side. For her subsequent dedication to that historical period, she was elected president of the Archive, War, and Exile Association, and in 2009 she was granted a Spanish passport."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%9A%AE%E5%9F%83%E5%B0%94%C2%B7%E5%B8%83%E8%8E%B1%E5%85%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Boulez25oct2004.jpg","page_title":"皮埃尔·布莱兹","context_page_description":"皮埃尔·布列兹，法国作曲家、指挥家、音乐理论家。"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B3%95%E5%9C%8B%E7%8E%8B%E5%AE%A4%E6%83%85%E5%A9%A6%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Contessa_di_Castiglione.jpg","page_title":"法國王室情婦列表","context_page_description":"法國王室包含法國君主、王太子、王子、親王.....等擁有王室血統的貴族，其中只有法國君主的首席情婦可獲得官方王室情婦的頭銜，其他的情婦統稱王室情婦。"},{"page_url":"https://sv.wikipedia.org/wiki/Kestert","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/St._Georg_in_Kestert.jpg","page_title":"Kestert","context_page_description":"Kestert är en Ortsgemeinde i Rhein-Lahn-Kreis i det tyska förbundslandet Rheinland-Pfalz. Kestert hade 613 invånare år 2012."},{"page_url":"https://pt.wikipedia.org/wiki/Mota-Engil","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Ponte_Vasco_da_Gama.jpg","page_title":"Mota-Engil","context_page_description":"A Mota-Engil é um conglomerado português, líder nos setores da construção civil, obras públicas, operações portuárias, resíduos, águas e na logística.\\nO presidente do Conselho de Administração é António Vasconcelos da Mota, filho do fundador do Grupo, o empreiteiro Manuel António da Mota, e Gonçalo Moura Martins é atualmente o CEO da empresa. Jorge Coelho liderou a Comissão Executiva do Grupo de 2008 a 2013, e atualmente exerce funções como Consultor do Conselho Consultivo Estratégico da Mota-Engil.\\nOriginário do concelho de Amarante, onde ainda possui sede social, este grupo empresarial possui atualmente os seus escritórios no Porto e em Lisboa.\\nO Grupo Mota-Engil integra mais de 280 empresas repartidas entre três grandes Áreas de Negócio – Engenharia e Construção, Ambiente e Serviços e Concessões de Transportes - marcando presença em 22 países através das suas sucursais e empresas participadas, entre elas a Mota-Engil Engenharia e Construção, S.A., SUMA, Manvia, Vibeiras e mais recentemente a EGF.\\nEm 2008 a Mota-Engil fez parte do ranking das cem maiores empresas europeias do setor da construção, mas atualmente faz parte do ranking das 30 maiores empresas europeias do setor."},{"page_url":"https://en.wikipedia.org/wiki/Mughal_Tahakhana","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Toha_Khana_%28Kachari_bari%29_Complex_of_Shah_Suja_02.jpg","page_title":"Mughal Tahakhana","context_page_description":"Mughal Tahakhana or Shah Shuja Tahakhana is a three storied building known as Tahakhana, means cold building or palace. The historical Tahakhana is located at the Gauḍa in Firozpur area in the west of a big pond. It is 15 km from Chapai Nawabganj District in Shahbajpur Union at Shibganj Upazila."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B5%D1%81%D0%BE%D1%82%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Lesotho_class.jpg","page_title":"Лесото","context_page_description":"Лесо́то, официальное название — Короле́вство Лесо́то — государство-анклав в Южной Африке, полностью окружённое территорией Южно-Африканской Республики. Также Лесото — это единственная в мире страна, вся территория которой находится выше 1400 м над уровнем моря. Столица страны — город Масеру."},{"page_url":"https://fr.wikipedia.org/wiki/Valence_(Espagne)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/Clima_Valencia_%28Espa%C3%B1a%29.PNG","page_title":"Valence (Espagne)","context_page_description":"Valence est une ville d'Espagne, située dans l'est du pays sur la côte méditerranéenne. Fondée en 138 av. J.-C. par le consul romain Decimus Junius Brutus Callaicus sous le nom de Valentia Edetanorum, Valence devient, au Moyen Âge, la capitale du royaume de Valence.\\nTroisième ville d'Espagne par la population qui est passée à 794 288 habitants en 2019, Valence est aujourd'hui la capitale de la Communauté valencienne et d'une de ses trois provinces, la province de Valence. Sa métropole compte 1 875 691 habitants. Dotée d'un patrimoine architectural remarquable, la ville est notamment connue pour sa Cité des arts et des sciences, à l'architecture futuriste. Le port de Valencia est le premier port de marchandises en Espagne et le premier port à conteneurs de la Méditerranée.\\nLa ville était traversée par le fleuve Túria, qui a été détourné dans les années 1960 à la suite de la Grande inondation de Valence de 1957. Son ancien lit est aujourd'hui reconverti en espaces verts, les jardins du Turia.\\nValencia est également renommée pour ses fallas, qui ont lieu du 12 au 19 mars. Elle est à l'origine de diverses spécialités gastronomiques, dont la plus connue est la paella."},{"page_url":"https://eo.wikipedia.org/wiki/Puerto_Vallarta","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/PVallartamapa.png","page_title":"Puerto Vallarta","context_page_description":"Puerto Vallarta estas unu el la 126 komunumoj de la meksika subŝtato Jalisco. La ĉefurbo de la komunumo estas Puerto Vallarta, kiu estas tre grava turisma urbo de Meksiko. Aliaj gravaj loĝlokoj estas El Pitillal, Las Juntas, Ixtapa, Las Palmas, Boca de Mismaloya, Boca de Tomatlán, El Cantón, El Jorullo, El Ranchito, La Desembocada, Las Mojoneras, El Colorado, Palmitas de Cacao, Playa Grande, Santa Cruz de Quelitán kaj Tebelchía. Aliaj lokoj havas nur etan signifon. Entute estas 91 loĝlokoj en la komunumo. La ŝlosilnumero de la komunumo laŭ la INEGI, do laŭ la nacia geografia instituto estas 14 067.\\nLa cabecera municipal es Puerto Vallarta, situada a 2 metros sobre el nivel del mar. Otras poblaciones importantes son las delegaciones de El Pitillal, Las Juntas, Ixtapa y Las Palmas; y las agencias municipales de Boca de Mismaloya, Boca de Tomatlán, El Cantón, El Jorullo, El Ranchito, La Desembocada, Las Mojoneras, El Colorado, Palmitas de Cacao, Playa Grande, Santa Cruz de Quelitán y Tebelchía. Hay otros lugares de menor importancia que, junto con los mencionados, hacen un total de 91 localidades en el municipio."},{"page_url":"https://vi.wikipedia.org/wiki/Xe_%C4%91%E1%BA%A1p_%C4%91i%E1%BB%87n","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/E-bike_charging_station.JPG","page_title":"Xe đạp điện","context_page_description":"Một chiếc xe đạp điện là một chiếc xe đạp với một động cơ điện được sử dụng cho động cơ đẩy. Có rất nhiều loại xe đạp điện có sẵn trên toàn thế giới, ví dụ như là xe đạp điện chạy bằng pin, xe đạp điện chạy bằng ắc quy, ... Các xe đạp điện thường có vận tốc trung bình từ 25 đến 32 km/giờ, tùy thuộc vào luật pháp của quốc gia mà họ đang bán ra. Trong một số thị trường, chẳng hạn như Đức, xe đạp điện đang trở nên phổ biến và tham gia một số thị phần của xe đạp thông thường, trong khi ở những nước khác, chẳng hạn như Trung Quốc, xe đạp điện đang thay thế nhiên liệu hóa thạch của mô tô và xe gắn máy nhỏ.\\nTùy thuộc vào luật pháp địa phương, xe đạp điện có thể được phân loại vào xe đạp thay vì xe máy. Vì vậy nhiều người lái xe đạp điện không tuân theo luật pháp nghiêm ngặt hơn về chứng nhận và hoạt động của họ.\\nTheo luật pháp ở nhiều nơi, xe đạp điện và xe máy điện được phân vào loại chung là xe điện.\\nTất cả các xe đạp điện đều được trang bị 2 bàn đạp như xe đạp thông thường.Tác dụng của 2 bàn đạp này dùng để đạp xe như xe đạp thường khi điện bên trong pin hoặc ắc quy bị hết."},{"page_url":"https://en.wikipedia.org/wiki/Matthew_17","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Tilapia_zillii_Kineret.jpg","page_title":"Matthew 17","context_page_description":"Matthew 17 is the seventeenth chapter in the Gospel of Matthew in the New Testament section of the Christian Bible. Jesus continues his final journey to Jerusalem ministering through Galilee."},{"page_url":"https://en.wikipedia.org/wiki/Populus_ciliata","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Safeda_3.jpg","page_title":"Populus ciliata","context_page_description":"Populus ciliata, the Himalayan poplar, is a large deciduous tree with tall clean straight trunk and wide rounded crown. The bark of the young trees is smooth greenish-grey and the bark of the old trees is dark brown with vertical cracks. Leaves are broadly ovate with serrulate-crenate and hairy margins. Flowers are drooping raceme catkins appear before or with leaves. Populus ciliata flowers are dioecious, individual flowers are either male or female. Perianth of male flowers is bell-shaped and female flowers are bluntly toothed. Their capsule encloses an average of 100–150 seeds, which are covered by long silky hair."},{"page_url":"https://de.wikipedia.org/wiki/Schienenverkehr_in_Hamburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Ausf%C3%A4delung_S-Bahnlinie_S3_%28Hamburg%29.hf.phb.ajb.jpg","page_title":"Schienenverkehr in Hamburg","context_page_description":"Dieser Artikel enthält eine allgemeine Übersicht und Zusammenstellung der einzelnen Verkehrsträger von schienengebundenen Verkehrssystemen in Hamburg und der umgebenden Region.\\nDer Hamburger Hauptbahnhof ist der meistfrequentierte Fernbahnhof in Deutschland."},{"page_url":"https://hu.wikipedia.org/wiki/Klepp","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Klepp_komm.svg","page_title":"Klepp","context_page_description":"Klepp község Norvégia délnyugati részében, Rogaland megyében.\\nTerülete 102,6 km2, népessége 16 350.\\nKlep egyházközség 1838. január 1-jén lett község.\\nA Jæren hagyományos régióhoz tartozó Klepp nyílt, sík, megművelt vidék. Legmagasabb pontja, a Tinghaug 102 méterrel fekszik a tengerszint felett. Nyugaton hosszú homokos tengerpartjai vannak.\\nKözigazgatási központja Kleppe, a község területének közepén. Kleppe körül gyorsan nő a népesség, többnyire családi házak épülnek itt, de apartmanházak is. Kleppe áruháza a Jærhagen.\\nKlepp sportklubjának női futballcsapata a norvég első vonalban játszik. A női válogatott csapatkapitánya, Ane Stangeland Horpestad a Klepp játékosa."},{"page_url":"https://hu.wikipedia.org/wiki/Gare_d%E2%80%99Aix-en-Provence","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Gare_d%27Aix-en-Provence_-_B%C3%A2timent_1.JPG","page_title":"Gare d’Aix-en-Provence","context_page_description":"Gare d’Aix-en-Provence vasútállomás Franciaországban, Aix-en-Provence településen."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%A8%AA%E5%B0%BE%E5%BF%A0%E5%89%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/2015-09-06_Okanoyama_museum-%E5%B2%A1%E4%B9%8B%E5%B1%B1%E7%BE%8E%E8%A1%93%E9%A4%A8_DSCF3085.JPG","page_title":"横尾忠則","context_page_description":"横尾 忠則は、日本の美術家、グラフィックデザイナー、作家。\\n実弟の成瀬政博も画家でイラストレーターで、1997年より『週刊新潮』の表紙絵を担当。長女の横尾美美も美術家。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B0%D0%BB_%D0%B8%D0%B3%D1%80%D0%BE%D0%B2%D1%8B%D1%85_%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%B0%D1%82%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Japanese_style_cocktail_cab.jpg","page_title":"Зал игровых автоматов","context_page_description":"Зал игровых автоматов — общественное место, предназначенное для игры в аркадные игры, которые могут быть в форме компьютерных игр, машин для пинбола, электромеханических игр, редемпшн-автоматов, мерчандайзеров, бильярдов с оплатой монетами, столов для аэрохоккея. В некоторых странах существуют залы игровых автоматов, в которых законом разрешается установка автоматов для азартных игр наподобие слот-машин или патинко. Игры, как правило, помещаются внутрь корпуса, называемого аркадным автоматом. Прообразы этих заведений в начале XX века назывались «пенни-аркадами».\\nКомпьютерные игры начали появляться в залах игровых автоматов во второй половине 1970-х годов, они оставались наиболее популярными в течение так называемого золотого века компьютерных аркадных игр, то есть в первой половине 1980-х годов. Эти игры обрели популярность среди детей, из-за чего родители начали предполагать возможность связи школьных прогулов с увлечением компьютерными играми."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%94%BE%E5%B0%84%E5%85%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Undulator.png","page_title":"放射光","context_page_description":"放射光は、シンクロトロン放射による電磁波である。「光」とあるが、実際は、人工のものでは赤外線からX線、天然のものでは電波からγ線の範囲のものがあり、特に可視光に限定して呼ぶことは少ない。また、電磁波が放射される現象は他にも多くあるが、シンクロトロン放射による電磁波に限り放射光と呼ぶ。\\nシンクロトロン放射は、高エネルギーの電子等の荷電粒子が磁場中でローレンツ力により曲がるとき、電磁波を放射する現象である。「シンクロトロン」と名が付いているが成因を問わずこう呼ぶ。放射光と呼ぶのは人工のものであることが多い。"},{"page_url":"https://fr.wikipedia.org/wiki/Vieillesse_du_chien","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/10_yr_old_Mastiff.JPG","page_title":"Vieillesse du chien","context_page_description":"Le vieillissement chez le chien traite sous le rapport médical et clinique, de l'impact du vieillissement chez le chien domestique, ainsi que des questions découlant et l'espérance de vie.\\nLe « troisième âge » n'est pas seulement humain. Il est aussi canin. Chez certaines espèces robustes de chiens, comme l'ancienne race du Mâtin napolitain, les signes de sénescence apparaissent vers 10 ans. Elles se limitent à l'apparition de poils gris sur le museau. Mais chez d'autres espèces canines plus délicates, le pelage devient totalement gris à cet age.\\nComme chez les humains, l'âge avancé apporte des changements dans la capacité du chien à entendre, voir et se déplacer.\\nDes affections de la peau, perte d'appétit et d'énergie sont ses symptômes de l'avancement de l'âge gériatrique. Les maladies inhérentes comme le cancer, l'insuffisance rénale, l'arthrite et autres signes de la vieillesse peuvent apparaître.\\nLes importants changements physiques et physiologiques chez un chien âgé peuvent conduire à confier l'animal à un organisme de logement ou de sauvetage, par son propriétaire qui n'arrive plus à assumer seul."},{"page_url":"https://pt.wikipedia.org/wiki/Bucyrus_(Ohio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Crawford_County_Ohio_Courthouse.jpg","page_title":"Bucyrus (Ohio)","context_page_description":"Bucyrus é uma cidade localizada no estado norte-americano de Ohio, no Condado de Crawford."},{"page_url":"https://no.wikipedia.org/wiki/La_Oroya","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Ferrocarril_Central_Andino_7_La_Oroya.JPG","page_title":"La Oroya","context_page_description":"La Oroya eller bare Oroya er peruansk by som også er provinshovedstad i provinsen Yauli i Junin-regionen. La Oroya hadde anslagsvis 24 500 innbyggere i 2015, og ligger i Mantaro-dalen på høysletten Altiplano der elven Yauli renner inn i Mantaro-elven. Siden 1922 har La Oroya vært dominert av det store raffinerings- og smelteverket som også har vært kilde til alvorlig forurensing av nærmiljøet. I 2006 og 2007 var La Oroya på Blacksmith Institute's liste over verdens ti mest forurensede steder. La Oroya regnes som «Perus metallurgiske hovedstad»."},{"page_url":"https://en.wikipedia.org/wiki/Wickhamford_Manor","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Worcestershire_UK_relief_location_map.jpg","page_title":"Wickhamford Manor","context_page_description":"Wickhamford Manor, Wickhamford, Worcestershire is a manor house dating from the 16th century. It was the childhood home of James Lees-Milne, the writer. The manor is a Grade II listed building."},{"page_url":"https://pt.wikipedia.org/wiki/PocketQube","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Camera_PocketQube_Shop_Render.jpg","page_title":"PocketQube","context_page_description":"Um PocketQube é um tipo de satélite artificial miniaturizado para pesquisa espacial sendo caracterizado pela forma de um cubo de 5 cm de aresta, e massa de até 180 gramas. Na sua construção, são usados geralmente componentes \\"de prateleira\\", ou seja: que existem no mercado e não necessariamente desenvolvidos para um fim específico."},{"page_url":"https://de.wikipedia.org/wiki/Zelt-Botschaft","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Aboriginal_Embassy_and_Mount_Ainslie_29-10-06.jpg","page_title":"Zelt-Botschaft","context_page_description":"Die Zelt-Botschaft ist ein politisch umstrittener, halb-provisorischer Zeltbau, der dem Anspruch der Aborigines auf ihre Rechte Nachdruck verleihen soll. Das Gründungsdatum der heute so genannten Zelt-Botschaft ist der 26. Januar 1972, am jährlich stattfindenden Australia Day, als sich vier protestierende Aborigines zum Protest unter einem Sonnenschirm versammelten. Abgeleitet vom späteren Zeltbau steht der Begriff auch für einen Teil der politischen Bewegung der Aborigines, die sich in der Zelt-Botschaft mit Aktivisten, Zeichen und Zelten auf dem Rasen des Old Parliament House in Canberra, der australischen Hauptstadt, manifestiert. Von der australischen Regierung wurde diese bisher nicht als offizielle Botschaft anerkannt; sie leitete jedoch den Wandel in der Einstellung des offiziellen Australiens zu den Landrechten der Aborigines ein."},{"page_url":"https://fr.wikipedia.org/wiki/Abbatiale_de_Saint-Gall","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Abbatiale_de_Saint-Gall_000.jpg","page_title":"Abbatiale de Saint-Gall","context_page_description":"L'abbatiale de Saint-Gall ou abbatiale Saints-Gall-et-Otmar ou cathédrale de Saint-Gall, est l'abbatiale catholique, de style Baroque tardif Rococo néo-classique du XVIIIᵉ siècle de l'abbaye de Saint-Gall du VIIᵉ siècle, à Saint-Gall en Suisse alémanique en Suisse. Dédiée à Saint Gall de Suisse et Saint Othmar de Saint-Gall, l'ensemble de l'abbaye de Saint-Gall est inscrit au patrimoine mondial de l'Organisation des Nations unies pour l'éducation, la science et la culture depuis 1983\\n. L'abbatiale, et la bibliothèque de l'abbaye de Saint-Gall du IXᵉ siècle sont inscrits à l'Inventaire suisse des biens culturels d'importance nationale et régionale\\n."},{"page_url":"https://bs.wikipedia.org/wiki/Kun%C4%91evac","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Kun%C4%91evac.JPG","page_title":"Kunđevac","context_page_description":"Kunđevac je naseljeno mjesto u sastavu općine Dubrava, Zagrebačka županija, Republika Hrvatska."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A6%D0%B7%D1%8F%D0%BE%D1%85%D1%8D_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B8%D1%89%D0%B5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Turpan-jiaohe-ruinas-d29.jpg","page_title":"Цзяохэ (городище)","context_page_description":"Цзяохэ или Ярхото — руины города (городище) в долине Ярназ, в 10 км к западу от города Турфан в Синьцзян-Уйгурском автономном районе Китая. Город был столицей царства Джуши. Это естественная крепость, расположенная на вершине крутого утеса на листообразном плато между двумя глубокими речными долинами."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%94%90%E7%B4%8D%E8%BB%8C%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/A32_approaching_Flemington_%28cropped%29.jpg","page_title":"唐納軌道","context_page_description":"唐纳轨道是唐纳集团内的一个业务部门。 除制造和维护铁路机车车辆外，也承包维护铁路基础设施。 总部位于澳洲北莱德。"},{"page_url":"https://nl.wikipedia.org/wiki/Maastricht-Noordoost","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/20130505_Maastricht_Julianakanaal_and_Brug_Itteren_11.JPG","page_title":"Maastricht-Noordoost","context_page_description":"Maastricht-Noordoost, ook wel Buitenwijk Noordoost of Wijk 05, is volgens de indeling van het Centraal Bureau voor de Statistiek een van de zeven wijken van de Nederlandse stad en gemeente Maastricht. Maastricht-Noordoost is de meest waterrijke wijk van Maastricht: het heeft een oppervlakte van circa 1052 hectare, waarvan bijna 14% uit water bestaat. De wijk telt ongeveer 2700 inwoners, verdeeld over vier buurten, waarmee het de op een na kleinste wijk qua inwonertal is. Met een dichtheid van 297 inwoners per km² is het tevens de dunst bevolkte wijk van Maastricht. Noordoost kent weinig voorzieningen en bestaat deels uit agrarisch gebied, afgewisseld met enkele dorpskernen, kastelen, natuurgebieden en bedrijfsterreinen."},{"page_url":"https://en.wikipedia.org/wiki/Ole%C5%9Bnica","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Ole%C5%9Bnica_-_Szko%C5%82a_Podstawowa_nr_7_im._Jana_Paw%C5%82a_II.jpg","page_title":"Oleśnica","context_page_description":"Oleśnica is a town in Lower Silesian Voivodeship, in south-western Poland. It is the administrative seat of Oleśnica County and also of the rural district of Gmina Oleśnica, although it is not part of the territory of the latter, the town being an urban gmina in its own right.\\nThe town is famed for its large 16th-century castle, which has previously been the seat of several dukes and lords. The castle's inner courtyard arcades, a masterpiece of Renaissance architecture, are iconic in the region."},{"page_url":"https://vi.wikipedia.org/wiki/Molineria_capitulata","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Gardenology.org-IMG_2418_rbgs11jan.jpg","page_title":"Molineria capitulata","context_page_description":"Molineria capitulata là một loài thực vật có hoa trong họ Hypoxidaceae. Loài này được Herb. mô tả khoa học đầu tiên năm 1837."},{"page_url":"https://en.wikipedia.org/wiki/Cedar_Hill,_Texas","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/JoePoolLake.jpg","page_title":"Cedar Hill, Texas","context_page_description":"Cedar Hill is a city in Dallas and Ellis counties in the U.S. state of Texas. It is located approximately 16 miles southwest of downtown Dallas and is situated along the eastern shore of Joe Pool Lake and Cedar Hill State Park. The population was 45,028 at the 2010 census.\\nCedar Hill is a suburb of Dallas and is part of the Best Southwest area, which includes the nearby cities of DeSoto, Duncanville, and Lancaster.\\nEarly in its history, Cedar Hill lay along a branch of the Chisholm Trail and served as the temporary county seat of Dallas County. In 1856, a tornado swept through the town killing nine people and destroying most of its buildings. The seat of the county was moved to Dallas not long after."},{"page_url":"https://it.wikipedia.org/wiki/Pierre_de_Conty_d%27Argencour","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/CONTY_d%27ARGENCOUR_%28de%29_Pierre.jpg","page_title":"Pierre de Conty d'Argencour","context_page_description":"Pierre de Conty d'Argencour fu un ingegnere francese, progettista di opere di difesa e di fortificazione di città, piazzeforti e castelli."},{"page_url":"https://hu.wikipedia.org/wiki/Uzsuri_j%C3%A1r%C3%A1s","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Krasnojarski-krai-uzhursky.png","page_title":"Uzsuri járás","context_page_description":"Az Uzsuri járás Oroszország egyik járása a Krasznojarszki határterületen. Székhelye Uzsur."},{"page_url":"https://it.wikipedia.org/wiki/R%C4%81bi%CA%BFa_al-%CA%BFAdawiyya","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Rabia_al-Adawiyya.jpg","page_title":"Rābiʿa al-ʿAdawiyya","context_page_description":"Rābiʿa al-ʿAdawiyya al-Qaysiyya, in arabo: رابعة العدوية القيسية‎, Rābiʿa al-ʿAdawiyya al-Qaysiyya o semplicemente Rābiʿa al-Baṣrī, è stata una mistica araba musulmana, considerata la più famosa e venerata donna sufi.\\nLa profonda influenza che esercitò sul sufismo le procurò l'appellativo onorifico di “madre del sufismo”. Con il suo sviluppo, il sufismo dette anche alle donne l'opportunità di elevarsi al rango di asceti, dal momento che nella vita spirituale non esiste disuguaglianza alcuna tra i sessi.\\nFu un'autorità indiscussa fra i suoi contemporanei. Concepì il concetto di amore passionale per Allah, il quale diventa più vicino al devoto."},{"page_url":"https://en.wikipedia.org/wiki/List_of_cities_in_Australia_with_the_most_skyscrapers","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Brisbane_skyline_in_April_2017.jpg","page_title":"List of cities in Australia with the most skyscrapers","context_page_description":"This list of cities in Australia with the most skyscrapers ranks the cities of Australia by the number of skyscrapers they comprise. Australia has over 130 skyscrapers —buildings which reach or exceed heights of 150 metres — complete and or under construction, all spread throughout five cities of the country. Most skyscrapers are located in cities within the Eastern states of Australia, and a number of these cities, such as Melbourne and Sydney, also rank high in the world list of cities with the most skyscrapers."},{"page_url":"https://cs.wikipedia.org/wiki/Fotografie_d%C4%9Bt%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Victor_Diaz_Lamich.JPG","page_title":"Fotografie dětí","context_page_description":"Fotografie dětí je zachycení podoby jednoho dítěte nebo více dětí na fotografii, ve které převládá tvář a její výraz. Cílem je, aby fotografie zobrazila podobu, osobitost nebo náladu portrétovaného. Stejně jako ostatní způsoby portrétování, zaměřuje se fotografie především také na tvář osoby, ale na snímku může být i část těla, nebo celá postava a doplňující pozadí. Portrét není náhodný snímek, ale komponovaný obraz osoby ve statické pozici. Portrét často zobrazuje osobu hledící přímo do objektivu, ale pohled může být směrován i mimo osu."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%BA%B8%E7%9A%84%E5%8E%86%E5%8F%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Fangmatan_paper_map.jpg","page_title":"纸的历史","context_page_description":"纸是一种非编制薄片，传统上是由处理过的植物纤维和纺织纤维组合而成，主要用于书写、艺术创作和包装，通常呈白色。根据中国史料记录，最早的造纸工艺见于东汉时期，归功于宫廷官员蔡伦。8世纪，中国的造纸术传播到伊斯兰世界，出现了用来造纸和造币的制浆厂和造纸厂。到11世纪，造纸术进入欧洲。到13世纪，西班牙的造纸厂利用水车改进了造纸工艺。后来在19世纪，随着木浆纸的发明，欧洲对造纸工艺进一步做出了改进。\\n尽管地中海世界和哥伦布以前的美洲分别存在莎草纸和树皮纸这样的书写介质，但这些材料并不被定义为真正的纸张。羊皮纸，一种兽皮经过复杂加工做成的书写材料，比纸更早，甚至可能早于莎草纸，它同样也不被视为纸张。20世纪，随着塑料制品的出现，出现了一类塑料“纸”，还有含有塑料或金属的各类复合纸，以及注入或涂覆有不同材料的纸，这些材料赋予了纸张特殊的性能。"},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AA%E0%B4%A4%E0%B5%8D%E0%B4%AE%E0%B4%AA%E0%B5%8D%E0%B4%B0%E0%B4%BF%E0%B4%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Padmapriya_2008.jpg","page_title":"പത്മപ്രിയ","context_page_description":"മലയാളം, തമിഴ് ചലച്ചിത്രമേഖലയിലെ ഒരു നടിയാണ് പത്മപ്രിയ."},{"page_url":"https://cs.wikipedia.org/wiki/Pjotr_Klimuk","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Soyuz-30_patch.png","page_title":"Pjotr Klimuk","context_page_description":"Pjotr Iljič Klimuk je bývalý vojenský letec a sovětský kosmonaut běloruského původu. Do vesmíru letěl v kosmických lodích Sojuz třikrát vždy jako velitel lodi."},{"page_url":"https://en.wikipedia.org/wiki/Wombat","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Wombat_burrow-Narawntapu.JPG","page_title":"Wombat","context_page_description":"Wombats are short-legged, muscular quadrupedal marsupials that are native to Australia. They are about 1 m in length with small, stubby tails and weigh between 20 and 35 kg. There are three extant species and they are all members of the family Vombatidae. They are adaptable and habitat tolerant, and are found in forested, mountainous, and heathland areas of southern and eastern Australia, including Tasmania, as well as an isolated patch of about 300 ha in Epping Forest National Park in central Queensland."},{"page_url":"https://de.wikipedia.org/wiki/Sverigedemokraterna","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Jimmie_%C3%85kesson_2016.jpg","page_title":"Sverigedemokraterna","context_page_description":"Sverigedemokraterna sind eine 1988 gegründete rechtspopulistische Partei in Schweden. Parteivorsitzender ist seit 2005 Jimmie Åkesson, sein Vorgänger war Mikael Jansson. Seit der Parlamentswahl 2010 ist die SD im schwedischen Reichstag vertreten."},{"page_url":"https://en.wikipedia.org/wiki/Pulitzer_Prize_for_Photography","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Ford_Strikers_Riot.jpg","page_title":"Pulitzer Prize for Photography","context_page_description":"The Pulitzer Prize for Photography was one of the American Pulitzer Prizes annually awarded for journalism. It was inaugurated in 1942 and replaced by two photojournalism prizes in 1968: the Pulitzer Prize for Feature Photography and \\"Pulitzer Prize for Spot News Photography\\", which was later renamed Pulitzer Prize for Breaking News Photography in 2000.\\nThe Pulitzer Prizes were established by the bequest of Joseph Pulitzer, which suggested four journalism awards, and were inaugurated beginning 1917. By 1942 there were eight Pulitzers for journalism; for several years now there have been 14 including the two for photojournalism."},{"page_url":"https://ro.wikipedia.org/wiki/Mirandiba","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Mapa_de_Mirandiba_%282%29.png","page_title":"Mirandiba","context_page_description":"Mirandiba este un oraș în Pernambuco, Brazilia."},{"page_url":"https://en.wikipedia.org/wiki/Araya_and_Paria_xeric_scrub","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Chacopatica.JPG","page_title":"Araya and Paria xeric scrub","context_page_description":"The Araya and Paria xeric scrub is an ecoregion in Venezuela that stretches along the Caribbean coast to the west of Trinidad, and that includes Margarita Island and some smaller islands. The ecoregion includes dune herbs, dry thorn scrubs and deciduous forests.\\nThe mountains on Margarita Island hold montane forests similar to those in the mainland coastal range.\\nThe beaches are used for breeding by sea turtles.\\nSome endemic bird species are threatened with extinction by illegal capture for the pet trade.\\nDeforestation and over-grazing by goats are also problems."},{"page_url":"https://sw.wikipedia.org/wiki/Rais_wa_Afrika_Kusini","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Jacob_Zuma%2C_2009_World_Economic_Forum_on_Africa-4.jpg","page_title":"Rais wa Afrika Kusini","context_page_description":"Rais wa Jamhuri ya Afrika Kusini ni mkuu wa nchi na kiongozi wa serikali chini ya katiba ya Afrika Kusini. Kuanzia mwaka 1961 hadi 1994, mkuu wa nchi alikuwa anaitwa Rais wa Nchi.\\nRais anachaguliwa na wabunge wa kitengo cha chini cha Bunge la Afrika Kusini. Kwa kawaida huwa kiongozi wa chama kikubwa zaidi bungeni, ambacho kimekuwa African National Congress tangu uchaguzi wa kwanza baada ya kupinduliwa kwa apartheid uliofanyika tarehe 27 Aprili 1994.\\nRais wa kwanza kuchaguliwa chini ya katiba mpya alikuwa Nelson Mandela, ambaye alifuatwa na Thabo Mbeki mwaka wa 1999, kufuatiwa na Kgalema Motlanthe mnamo Septemba 2008 na kisha Jacob Zuma mnamo Mei 2009. Katika § 5, sehemu ya 88, katiba inaruhusu wakati wa Rais ofisini kuwa mihula miwili. Marais huchaguliwa kila baada ya uchaguzi wa wabunge, na uchaguzi huu huwapa marais muda wa miaka mitano, pamoja na nafasi ya kurudishwa mara moja.\\nChini ya katiba ya mpito, kulikuwa na Serikali ya Muungano wa Taifa, ambapo mbunge kutoka chama cha upinzani alipewa nafasi kama Naibu wa Rais. Pamoja na Mbeki, rais wa mwisho wa nchi, F.W."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D9%85%D9%88%D9%86%D8%AA%D9%87%D8%A7_%DA%AF%D9%84%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Inauguracion_Nueva_Plaza_de_Monte_Aguila_2017_%28103%29.jpg","page_title":"امونتها گلا","context_page_description":"مونتها گلا یک شهر شیلی واقع در منطقه بیوبیو است، در شهرداری کابررو، در ۵ کیلومتری جنوب از همان نام شهر. این جمعیت شامل جمعیت ۶۰۹۰ نفر می‌باشد."},{"page_url":"https://da.wikipedia.org/wiki/Sejrshave","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/INF3-96_Food_Production_Dig_for_Victory_Artist_Peter_Fraser.jpg","page_title":"Sejrshave","context_page_description":"En Sejrshave var en betegnelse for private nyttehaver, der blev dyrket under Første og Anden Verdenskrig i USA, Storbritannien, Canada og Tyskland for at imødegå presset på fødevareproduktionen, som verdenskrigene medførte.\\nUdover etableringen af sejrshaverne indirekte bidrog til krigsindsatsen, ansås haverne også at have en vigtig funktion med at styrke den civile moral, idet de personer, der passede haverne, kunne opnå følelsen af at bidrage positivt til krigsindsatsen med deres daglige bidrag på hjemmefronten."},{"page_url":"https://fr.wikipedia.org/wiki/El_Perdig%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Ayuntamiento_de_El_Perdig%C3%B3n1.JPG","page_title":"El Perdigón","context_page_description":"El Perdigón est une municipalité espagnole de la communauté autonome de Castille-et-León et de la province de Zamora. En 2015, elle compte 740 habitants."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D0%B4%D0%B7%D1%96%D0%BF%D0%B0%D0%BD%D0%B0%D1%80%D1%96","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/Ishigaki_kabira_majipanari.jpg","page_title":"Мадзіпанарі","context_page_description":"Острів Мадзіпана́рі — невеликий острів в острівній групі Яеяма островів Сакісіма архіпелагу Рюкю. Адміністративно відноситься до округу Ісіґакі повіту Яеяма префектури Окінава, Японія.\\nНезаселений стрів розташований біля західного узбережжя острова Ісіґакі при в ході в бухту Кабіра, біля більшого острова Кабіраван.\\nМайже весь вкритий лісами."},{"page_url":"https://nl.wikipedia.org/wiki/Oppervlakte-afvoer_(model)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Hydrograph_Rogbom.png","page_title":"Oppervlakte-afvoer (model)","context_page_description":"Een model van oppervlakte-afvoer, ook wel neerslagafvoermodel genoemd, is een voorstelling van het deel van de waterkringloop dat de oppervlakte-afvoer van een hydrologisch opvanggebied betreft. Het model wordt meestal gebruikt om de oppervlakte-afvoer of afstroming te begrijpen en om voorspellingen te kunnen doen over de afvoer om het waterbeheer te regelen of om waterbouwkundige maatregelen te ontwerpen voor het beheersen van overstromingen.\\nHoewel het mogelijk is schaalmodellen te maken zijn de meeste afstromingsmodellen\\nwiskundig modellen."},{"page_url":"https://de.wikipedia.org/wiki/Caf%C3%A9_de_Flore","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Caf%C3%A9_de_Flore%2C_172_boulevard_Saint-Germain%2C_Paris_6e.jpg","page_title":"Café de Flore","context_page_description":"Das Café de Flore ist ein Café im Quartier Saint-Germain-des-Prés des 6. Arrondissements in Paris. Es liegt an der Ecke des Boulevard Saint-Germain Nr. 172 und der Rue Saint-Benoît."},{"page_url":"https://id.wikipedia.org/wiki/M4_Sherman","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Sov%C4%9Btsk%C3%A9_tanky_na_K%C5%99enov%C3%A9_ulici.gif","page_title":"M4 Sherman","context_page_description":"M4 Sherman, secara resmi disebut Medium Tank, M4, adalah tank yang paling banyak digunakan oleh Amerika Serikat dan Sekutu Barat lainnya pada masa Perang Dunia II. M4 Sherman terbukti sangat andal, murah untuk diproduksi, dan tersedia dalam jumlah yang banyak. Banyak dari tank ini yang dibagikan kepada Imperium Britania dan Uni Soviet melalui program Lend-Lease. Tank ini diberi nama Sherman oleh negara Britania Raya, tetapi nama tank ini berasal dari nama seorang Jenderal Perang Saudara Amerika Serikat, William Tecumseh Sherman.\\nM4 Sherman berevolusi dari Tank Medium M3, yang persenjataan utamanya terpasang pada bagian samping. M4 mempertahankan desain mekanikal sebelumnya, memuat meriam 75 mm pada kubah yang berputar penuh. Satu fitur, sebuah girostabilizer satu sumbu, tidak cukup presisi untuk fungsi menembak sambil berjalan tetapi membantu retikula pembidik tetap mengarah pada sasaran sehingga ketika tank berhenti untuk menembak, meriam akan mengarah pada arah yang benar. Para perancang M4 menekankan keandalan mekanis, kemudahan produksi dan pemeliharaan, ketahanan, standardisasi komponen dan peluru dalam varian yang terbatas, dan ukuran serta bobot yang tidak terlalu berat."},{"page_url":"https://nl.wikipedia.org/wiki/Sarntal","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Sarntal.jpg","page_title":"Sarntal","context_page_description":"Sarntal is een gemeente in de Italiaanse provincie Zuid-Tirol en telt 6671 inwoners. De oppervlakte bedraagt 302,5 km², de bevolkingsdichtheid is 22 inwoners per km²."},{"page_url":"https://es.wikipedia.org/wiki/Hortencia_Figueroa_Peralta","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Uaem_Morelos_logo.png","page_title":"Hortencia Figueroa Peralta","context_page_description":"Hortencia Figueroa Peralta es una abogada y política mexicana, integrante del Partido de la Revolución Democrática. A lo largo de su carrera, ha ocupado diversos cargos públicos de elección popular y otros por la vía plurinominal."},{"page_url":"https://sv.wikipedia.org/wiki/Las_Ventas_de_San_Juli%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Las_Ventas_de_San_Juli%C3%A1n.png","page_title":"Las Ventas de San Julián","context_page_description":"Las Ventas de San Julián är en ort i Spanien. Den ligger i provinsen Province of Toledo och regionen Kastilien-La Mancha, i den centrala delen av landet, 140 km väster om huvudstaden Madrid. Las Ventas de San Julián ligger 312 meter över havet och antalet invånare är 262.\\nTerrängen runt Las Ventas de San Julián är platt, och sluttar västerut. Den högsta punkten i närheten är 1 212 meter över havet, 20,0 km norr om Las Ventas de San Julián. Runt Las Ventas de San Julián är det glesbefolkat, med 20 invånare per kvadratkilometer. Närmaste större samhälle är Candeleda, 16,9 km norr om Las Ventas de San Julián. Omgivningarna runt Las Ventas de San Julián är huvudsakligen savann.\\nMedelhavsklimat råder i trakten. Årsmedeltemperaturen i trakten är 18 °C. Den varmaste månaden är augusti, då medeltemperaturen är 32 °C, och den kallaste är december, med 5 °C. Genomsnittlig årsnederbörd är 920 millimeter. Den regnigaste månaden är november, med i genomsnitt 130 mm nederbörd, och den torraste är augusti, med 4 mm nederbörd."},{"page_url":"https://tr.wikipedia.org/wiki/Magdeburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Jahrtausendturm_-_Interior.jpg","page_title":"Magdeburg","context_page_description":"Magdeburg, Almanya'nın kuzeydoğusunda, Saksonya-Anhalt eyaletinde bulunan en kalabalık şehirdir ve aynı zamanda bu eyaletin başşehridir. Orta Çağ'ın sonlarına doğru hızla büyüyerek Avrupa'nın en büyük merkezlerinden biri haline gelen şehir, Elbe Nehri'nin kenarında konumlanmıştır. Günümüzde Magdeburg, eyaletin en önemli ulaşım, kültür, bilim, sanat, ticaret ve eğlence merkezidir ve 1035'ten beri Almanya'nın en eski fuar kentidir.\\nMagdeburg, uzun tarihi boyunca her zaman güzel günler görmedi. İmparatorluk konağı, Hansa şehri ve Prusya kalesi olarak Magdeburg sürekli savaş ve yıkımla karşı karşıya kalmıştır.\\nEski pazarda, ünlü katedralin yakınında, ünlü “Magdeburger Reiter” bulunmaktadır - Alpler'in kuzeyinde özgürce görülebilen ilk atlı heykelinin bronz bir kopyası. 1240'ta yapıldı ve -Magdebuglular öyle olduğunu umuyorlar- ünlü İmparator Otto'yu betimlemektedir. Orijinali 1967 yılında taşındı: Günümüzde Kültür Tarihi Müzesi'nde seyredilebilir.\\nII. Dünya Savaşı öncesinde 336.838 kişinin yaşadığı şehirde 2015 itibarıyla 235.723 kişi yaşamaktadır. Elbe Nehri şehrin içinden geçer. 2005'te Magdeburg'un kuruluşunun 1200. yıl dönümünü kutladı."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%87%E0%A4%82%E0%A4%A6%E0%A4%BF%E0%A4%B0%E0%A4%BE_%E0%A4%97%E0%A4%BE%E0%A4%82%E0%A4%A7%E0%A5%80_%E0%A4%85%E0%A4%A8%E0%A5%8D%E0%A4%A4%E0%A4%B0%E0%A5%8D%E0%A4%B0%E0%A4%BE%E0%A4%B7%E0%A5%8D%E0%A4%9F%E0%A5%8D%E0%A4%B0%E0%A5%80%E0%A4%AF_%E0%A4%B5%E0%A4%BF%E0%A4%AE%E0%A4%BE%E0%A4%A8%E0%A4%95%E0%A5%8D%E0%A4%B7%E0%A5%87%E0%A4%A4%E0%A5%8D%E0%A4%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Welcome_Area_Delhi_T3_Departure_IGI_Airport.jpg","page_title":"इंदिरा गांधी अन्तर्राष्ट्रीय विमानक्षेत्र","context_page_description":"इंदिरा गांधी अन्तर्राष्ट्रीय विमानक्षेत्र भारत की राजधानी एवं राष्ट्रीय राजधानी क्षेत्र दिल्ली का प्रधान अन्तर्राष्ट्रीय विमानक्षेत्र है। यह नई दिल्ली नगर केन्द्र से लगभग १६ कि॰मी॰ दक्षिण-पश्चिम दिशा में स्थित है। भारत की पूर्व प्रधान मंत्री इंदिरा गाँधी के नाम पर बना यह भारत का व्यस्ततम विमानक्षेत्र है। हवाई अड्डे के नवीनतम टर्मिनल-३ के चालू हो जाने के बाद से ४ करोड़ ६० लाख यात्री क्षमता तथा वर्ष २०३० तक की अनुमानित यात्री क्षमता १० करोड़ के साथ यह भारत के साथ-साथ पूरे दक्षिण एशिया का सबसे बड़ा और सबसे महत्त्वपूर्ण व्यापार संबंधी विमानन केन्द्र बन गया है। भारत की वाणिज्यिक राजधानी मुंबई के छत्रपति शिवाजी अन्तर्राष्ट्रीय विमानक्षेत्र के साथ इसके आंकड़े मिलाकर देखें तो ये दोनों दक्षिण एशिया के आधे से अधिक विमान यातायात को वहन करते हैं। इस विमानक्षेत्र के संचालक दिल्ली इंटरनेशनल एयरपोर्ट लिमिटेड इसे विश्व का अगला अन्तर्राष्ट्रीय ट्रांज़िट हब बनाने के प्रयास कर रहा है।\\nलगभग ५, २२० एकड़ की भू-संपदा में विस्तृत, दिल्ली विमानक्षेत्र राष्ट्रीय राजधानी क्षेत्र दिल्ली के लिये प्राथमिक नागर विमानन हब है। सर्वप्रथम इसका संचालन भारतीय वायु सेना के पास था, जिसके बाद उसने इसका प्रबंधन दायित्व भारतीय विमानपत्तन प्राधिकरण को सौंप दिया।"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A2%E3%82%B9%E3%82%AF%E3%83%AF%E5%9C%B0%E4%B8%8B%E9%89%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Moscow_metro_diesel_shunter_AGMS-983_%2817961315815%29.jpg","page_title":"モスクワ地下鉄","context_page_description":"モスクワ地下鉄は、正式名称をモスクワ地下鉄公社と言い、ロシアの首都モスクワ及びモスクワ州を通る地下鉄である。運営はモスクワメトロ公社によって行われる。1957年から1992年までレーニン記念モスクワ地下鉄と称した。ロシア国内で最大の地下鉄である。世界の地下鉄の年間輸送人員においては、世界で5番目に多い東京の地下鉄に続いて利用客の多い地下鉄となっている。最初の路線は、ソコリニキ駅 - パールク・クリトゥールイ駅間にスモレンスカヤ駅への分岐線付きで1935年5月15日に開業された。\\n全15路線で、モスクワモノレールとモスクワ中央環状線を除いて総延長は397.3 kmある。モスクワ地下鉄には230駅と２つの閉鎖駅があり、48駅が文化遺産、また40駅以上がランドマークとされている。\\nモスクワ市の計画によると、2023年までにさらに55駅を建設することになっている。\\n多くの駅で社会主義リアリズムの様式に沿った豪華な装飾が施されていることでも知られており、他国の地下鉄とは対照的に美術館または宮殿のような雰囲気をもつことから、「地下宮殿」と呼ばれることもある。\\n今までに多くの駅名が変更されており、数回に亘って改名された駅もある。当初は、モスクワ地下鉄自体も、敷設に寄与したラーザリ・カガノーヴィチの名を冠していた。"},{"page_url":"https://es.wikipedia.org/wiki/R%C3%ADo_Segura","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Ca%C3%B1on_almadenes_fsalmeron.jpg","page_title":"Río Segura","context_page_description":"El río Segura es un importante río del sureste de España.\\nEl Segura nace en la Sierra de Segura a 5 kilómetros de Pontón Bajo, en una pequeña aldea llamada Fuente Segura, en el municipio de Santiago-Pontones. Discurre por las provincias de Jaén, Albacete, Murcia y Alicante. Desemboca en el Mediterráneo, en Guardamar del Segura, tras un recorrido de 325 km y una cuenca hidrográfica de 14 936 km². La superficie que abarca su confederación hidrográfica es de 18 870 km² al incluir las ramblas de la costa sur de Alicante y de la Región de Murcia​\\nEs uno de los ríos con mayor aprovechamiento hidrológico, conocido también por su irregularidad causante de grandes inundaciones alternadas con periodos largos de sequía y en las últimas décadas tristemente famoso por los graves problemas de contaminación de sus aguas, sobre todo en el curso bajo, aunque de forma reciente se ha apreciado una considerable mejora​ tras importantes inversiones en depuración y recuperación."},{"page_url":"https://it.wikipedia.org/wiki/Oliva_di_Palermo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Saint_Oliva_-_Cathedral_of_Palermo_-_Italy_2015.JPG","page_title":"Oliva di Palermo","context_page_description":"Oliva di Palermo è stata una martire cristiana, venerata come santa della Chiesa cattolica, che la festeggia il 10 giugno, e patrona di Palermo nel Medioevo."},{"page_url":"https://eu.wikipedia.org/wiki/K%C3%B6nigsfeld_(Saxonia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/K%C3%B6nigsfeld_in_FG.png","page_title":"Königsfeld (Saxonia)","context_page_description":"Königsfeld Alemaniako udalerria da. Saxonia estatuan kokatuta dago, Mittelsachsen barrutian. 2014an 1.521 biztanle zituen 28,4 kilometro koadrotan banatuta."},{"page_url":"https://nl.wikipedia.org/wiki/De_boodschap_aan_Maria_(Campin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/L%27annonciation.JPG","page_title":"De boodschap aan Maria (Campin)","context_page_description":"De boodschap aan Maria is een schilderij dat toegeschreven wordt aan de \\"Meester van Flémalle, de noodnaam voor een ongeïdentificeerde kunstschilder, waarschijnlijk Robert Campin. Het schilderij werd tussen omstreeks 1415 en 1425 geschilderd. Het is 61 x 63,7 centimeter groot en geschilderd met olieverf op een paneel van eikenhout. Het toont het verhaal van de annunciatie uit de Bijbel, waarin de aartsengel Gabriël een bezoek brengt aan Maria in haar huis te Nazareth en haar meldt dat God haar uitverkoren heeft om de moeder van zijn Zoon te worden."},{"page_url":"https://de.wikipedia.org/wiki/Benno_Berneis","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Benno_Berneis_-_Selbstbildnis_-_BG-M_12166%5E14_-_Berlinische_Galerie.jpg","page_title":"Benno Berneis","context_page_description":"Benno Berneis war ein deutscher Maler des aufkommenden Expressionismus."},{"page_url":"https://es.wikipedia.org/wiki/Serpins","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/LSA-serpins.png","page_title":"Serpins","context_page_description":"Serpins es una freguesia portuguesa del concelho de Lousã, con 36,12 km² de superficie y 1.712 habitantes. Su densidad de población es de 47,4 hab/km²."},{"page_url":"https://vi.wikipedia.org/wiki/Kirchn%C3%BCchel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Kirchnuechel_Wappen.png","page_title":"Kirchnüchel","context_page_description":"Kirchnüchel là một đô thị thuộc huyện Plön, bang Schleswig-Holstein, Đức."},{"page_url":"https://en.wikipedia.org/wiki/Yona_Kosashvili","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/ProfessorKosashvili.jpg","page_title":"Yona Kosashvili","context_page_description":"Professor Yona Kosashvili MD is an Israeli chess Grandmaster and surgeon. Born in Tbilisi, Georgia, he moved to Israel as a child. Kosashvili is one of the few people in the world to have earned both of the titles MD and GM. He is an orthopedic surgeon, specializing in a variety of procedures including arthroscopy and total joint replacement. Prof. Kosashvili is Head of Orthopedic Department at the Kaplan Medical Center in Rehovot, Israel. Dr Kosashvili is actively involved in academics through his role as Clinical Instructor of Orthopedic Surgery at Tel Aviv University. Although he never played chess professionally, he holds the title of International Chess Grandmaster. In 1995 he was ranked 93rd in the world."},{"page_url":"https://en.wikipedia.org/wiki/Tropical_cyclones_in_2019","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Ann_2019-05-13_0251Z.jpg","page_title":"Tropical cyclones in 2019","context_page_description":"During 2019, tropical cyclones formed within seven different tropical cyclone basins, located within various parts of the Atlantic, Pacific and Indian Oceans. During the year, a total of 150 systems formed with 102 of these developing further and were named by the responsible warning centre. The strongest tropical cyclone of the year was Typhoon Halong, which was estimated to have a minimum barometric pressure of 905 hPa. Hurricane Dorian has the highest wind-speed, with 1-minute sustained wind speed of 185 mph.\\nSimilar to the previous year, 2019 was above average in terms of the number of storms. The most active basin in the year was the Western Pacific, which documented 29 named systems. The Eastern Pacific had an average season, although many of the storms were rather weak and short-lived, therefore the number of hurricanes was the least since 2010. The North Atlantic hurricane season experienced an above average number of tropical storm intensity systems, numbering 18, though most were rather weak and short-lived, especially late in the season. In the North Indian Ocean basin it was extremely active, breaking many records."},{"page_url":"https://el.wikipedia.org/wiki/Alitalia_CityLiner","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Logo_AZCYL.jpg","page_title":"Alitalia CityLiner","context_page_description":"Η Alitalia CityLiner είναι η περιφερειακή θυγατρική της Alitalia. Εκτελεί δρομολόγια μικρής διαδρομής. Μεταφέρει επιβάτες από μικρά αεροδρόμια στο αεροδρόμιο Leonardo da Vinci-Fiumicino."},{"page_url":"https://ast.wikipedia.org/wiki/Chenopodium_bonus-henricus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Chenopodium_bonus-henricus_ENBLA03.jpg","page_title":"Chenopodium bonus-henricus","context_page_description":"Chenopodium bonus-henricus L. 1753, el espárragu de los probes, espinaca de Lincolnshire ye una especie de la familia de les amarantacees endémica d'Europa central y sur.\\nPor centenar d'años creció como verdura en güertos, anque na actualidá suel trátela más como maleza."},{"page_url":"https://nl.wikipedia.org/wiki/Zijkanaal_B_(Noord-Holland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Wohnboote_Nordseekanal.jpg","page_title":"Zijkanaal B (Noord-Holland)","context_page_description":"Zijkanaal B is een kanaal in de Nederlandse provincie Noord-Holland. Het is een zijtak van het Noordzeekanaal.\\nHet zijkanaal volgt het verloop van de oude zeedijk die de Velserbroekpolder beschermde tegen het water van het IJ. Vanuit het IJ bij Spaarndam loopt het kanaal naar het noordwesten. Het is echter als gevolg van afdamming niet meer met het Noordzeekanaal verbonden. Bovendien is door aanleg van de huidige Rijksweg A9 tussen het Rottepolderplein en Velsen het kanaal in tweeën gedeeld. Het zijkanaal was ook noodzakelijk voor de afvoer van water uit de Velserbroekpolder dat door het gemaal Velserbroek werd uitgeslagen. Omgekeerd kon ook water uit het kanaal de polder worden ingelaten.\\nHet kanaal, gelegen in het Recreatiegebied Spaarnwoude, heeft nog een recreatieve functie en liggen er in het zuidelijk deel woonboten. In de jaren zeventig legden de eerste woonboten aan. De eigenaren waren vrijbuiters en conformeerden zich niet aan de maatschappelijke regels. Het was primitief, maar goedkoop wonen want de overheid legde geen heffingen op, uit angst dat de bewoners er rechten aan zouden ontlenen."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0_%E2%80%9E%D0%A1%D0%B2._%D0%88%D0%BE%D0%B2%D0%B0%D0%BD_%D0%9A%D1%80%D1%81%D1%82%D0%B8%D1%82%D0%B5%D0%BB%E2%80%9C_-_%D0%9A%D1%80%D1%83%D1%88%D0%B5%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/View_of_Krushevo.jpg","page_title":"Црква „Св. Јован Крстител“ - Крушево","context_page_description":"Свети Јован се наоѓа во Крушево. Нејзината изградба била започната на 3 август 1897 година во дворот на романското училиште во Крушево. Христијанскиот храм бил изграден во 1904 година.\\nОваа црква е позната ѝ како Влашка црква. Објектот е еден од најзачуваните во градот. Во црквата нема живопис. Доминира прекрасно изработен дрвен иконостас, направен од плитка резба од браќата Несторови, чија изработка траела околу четири години. Во влезот на црквата Св. Јован исто така се наоѓаат фрески кои се пренесени од црквата Св. Атанасије во село Локвени а датираат од 1627 година а на нив се прикажани Св. Архиереи, Пресвета Богородица, итн."},{"page_url":"https://en.wikipedia.org/wiki/Souillac,_Mauritius","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/Rochester_Falls%2C_Mauritius.jpg","page_title":"Souillac, Mauritius","context_page_description":"Souillac is a village close to the southernmost point of the main island of Mauritius. It is the seat of the district council of Savanne district. It was named after the Vicomte de Souillac, the island's governor from 1779-1787."},{"page_url":"https://id.wikipedia.org/wiki/Meriam_otomatis","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/QF1pounderGunIWMApril2008.jpg","page_title":"Meriam otomatis","context_page_description":"Meriam otomatis adalah senjata proyektil tembakan cepat dan berbeda dengan sistem kerja peluru yang ditembakkan oleh senapan mesin. Meriam otomatis sering kali memiliki kaliber lebih besar dari senapan mesin, tetapi biasanya lebih kecil dari senapan lapangan atau artileri lainnya. Meriam otomatis modern biasanya tidak mudah dibawa manusia atau berdiri sendiri, Biasanya berupa kendaraan-gunungt atau bahkan dioperasikan di angkatan laut. Amunisi terangkai seperti sabuk untuk mengurangi pengisian atau untuk tingkat tembakan yang lebih cepat, tetapi magazin tetap menjadi pilihan. Meriam otomatis dapat menggunakan berbagai amunisi: peledak berdaya tinggi jenis dwi-guna, berbagai jenis penembus perisai, seperti komposit keras atau Jenis sabot.\\nMeskipun mampu menghasilkan tembakan tingkat tinggi, meriam otomatis cepat panas jika digunakan untuk tembakan berkelanjutan, dan dibatasi oleh jumlah amunisi yang dapat dilakukan oleh sistem senjata. Baik 25 mm Bushmaster Amerika dan 30 mm Rarden Inggris memiliki rentang tembak relatif lambat agar tidak menggunakan amunisi terlalu cepat."},{"page_url":"https://en.wikipedia.org/wiki/Louis_Varney","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/57/Louis_Varney.jpg","page_title":"Louis Varney","context_page_description":"Louis Varney was a French composer."},{"page_url":"https://de.wikipedia.org/wiki/Rafael_Correa","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Rafaelcorrea08122006.jpg","page_title":"Rafael Correa","context_page_description":"Rafael Vicente Correa Delgado ist ein ecuadorianischer Wirtschaftswissenschaftler und Politiker. Vom 15. Januar 2007 bis zum 24. Mai 2017 war er Präsident seines Landes.\\nDie „Revolution der Bürger“, wie der linksorientierte Präsident Correa seine Regierung nannte, brachte Ecuador eine bis dahin unbekannte politische Stabilität, institutionelle Fortschritte und soziale Erfolge. Correas politisches Vermächtnis ist unter anderem die erfolgreiche Bekämpfung der Armut, sie sank zwischen 2007 und 2014 um 38 Prozent und die extreme Armut um 47 Prozent. Kritisiert wurden an Correa hingegen ein autoritärer Politikstil und Beschränkungen der Pressefreiheit. Der seit 2017 im Amt befindliche Nachfolger von Correa im Präsidentenamt, Lenin Moreno, vollführte innen- und außenpolitisch nach seiner Wahl eine rechte Kehrtwende der Politik und warf Correa vor für die Proteste gegen die Regierung Morenos verantwortlich zu sein. Seit 2018 laufen in Ecuador mehrere juristische Verfahren gegen Correa. Im Juli 2018 wurde gegen Correa, wegen des Vorwurfs einer Entführung, von einem ecuadorianischem Gericht internationaler Haftbefehl erlassen."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A1%D7%97%D7%99%D7%A4%D7%94_%D7%9C%D7%90%D7%97%D7%95%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Canyonlands_NP18.jpg","page_title":"סחיפה לאחור","context_page_description":"סחיפה לאחור או גם התחתרות לאחור היא סחיפה בתחילת ערוץ נחל, הגורמת לתחילת הערוץ לסגת אחורנית בכיוון מנוגד לזרם, ובכך להאריך את הערוץ. המונח יכול גם להתייחס להתרחבות של קניון בעקבות סחיפה בקצהו העליון, כאשר מים זורמים על פני המישורים שמעליו ונכנסים לתוכו במפל, כפי שמתרחש בפארק הלאומי קניונלנדס ביוטה. תוך כדי כך, עובר הקצה העליון של הקניון סחיפה אל תוך המישור שמעליו, והקניון מתארך ומתרחב."},{"page_url":"https://en.wikipedia.org/wiki/Four_Forks,_Virginia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Four_Forks_in_Nelson_County.jpg","page_title":"Four Forks, Virginia","context_page_description":"Four Forks is an unincorporated community in Nelson County, Virginia, United States."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%B5%D5%BE%D5%A1%D5%A6%D5%B8%D5%BE%D5%BD%D5%AF%D5%B8%D6%82_%D5%B6%D5%AF%D5%A1%D6%80%D5%B6%D5%A5%D6%80%D5%AB_%D6%81%D5%A1%D5%B6%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/%D0%98%D1%82%D0%B0%D0%BB%D1%8C%D1%8F%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%B5%D0%B9%D0%B7%D0%B0%D0%B6._%D0%92%D0%B5%D1%87%D0%B5%D1%80_%D0%90%D0%B9%D0%B2%D0%B0%D0%B7%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B3%D0%BE.jpg","page_title":"Այվազովսկու նկարների ցանկ","context_page_description":"Այստեղ ցուցադրված է ազգությամբ հայ, ռուս մեծ նկարիչ Հովհաննես Այվազովսկու նկարների շարքը:"},{"page_url":"https://fr.wikipedia.org/wiki/1I/%CA%BBOumuamua","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/C2017U1still.gif","page_title":"1I/ʻOumuamua","context_page_description":"1I/ʻOumuamua, à l'origine C/2017 U1 puis A/2017 U1, est un petit corps interstellaire repéré le 19 octobre 2017 par le télescope Pan-STARRS 1 installé sur l'Observatoire du Haleakalā, à Hawaï, alors qu'il se trouvait à 0,2 unité astronomique de la Terre. Il est le premier objet identifié à provenir de l'extérieur du Système solaire.\\nD'abord classé comme comète et désigné pour cette raison C/2017 U1, il a été reclassé parmi les astéroïdes une semaine plus tard et désigné en conséquence A/2017 U1. Le 6 novembre 2017, il est formellement catégorisé dans la classe des objets interstellaires et, conformément à la nouvelle nomenclature établie à cette occasion, il reçoit la désignation permanente 1I et le nom ʻOumuamua.\\nFin juin 2018, l'analyse fine de sa trajectoire indique que son mouvement est influencé par autre chose que les forces gravitationnelles, peut-être des phénomènes de dégazage, ce qui le classe temporairement comme une comète."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%AF%D8%A8_%D8%A7%D9%84%D8%A3%D8%B5%D8%BA%D8%B1_(%D9%83%D9%88%D9%83%D8%A8%D8%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Zirkumpolar_ani.gif","page_title":"الدب الأصغر (كوكبة)","context_page_description":"كوكبة الدب الأصغر أو بَنَات نَعْش الصغرى أقرب الكوكبات إلى القطب الشمالي وترسم في الخرائط وعلى الكرات السماوية بصورة دب صغير قائم الذيل. نجومها الهامة والرئيسية هي سبعة فقط، ولكن توجد 20 نجمة أخرى ليست معروفة كثيرا وليست مرتبطة بالصورة التي تخيل عليها القدماء الدب الأصغر. ففي طرف ذيل الدب الأصغر يوجد نجم كبير لامع واضح هو نجم الشمال وهو لايقع فوق قطب الارض الشمالي تماما ولكن يبعد عنه بمقدار ضئيل، وقد استخدم قديما لتحديد الاتجاهات. أشد نجوم الدب الأصغر لمعانا - نجم الشمال - هو ما نسميه بالعربية الجدي وهو طرف ذيل الدب الأصغر، ويسى باللغات الأجنبية Polaris.\\nوتقول الميثولوجيا الإغريقية أن \\"كاليستو\\" قد تحولت إلى دب وأصبحت الدب الأكبر، وقد تزوجت بأحد الآلهة وأنجبت منه ابنها \\"أركاس \\" الذي تحول إلى الدب الأصغر."},{"page_url":"https://es.wikipedia.org/wiki/Laserpitium","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Laserpitium_prutenicum.jpeg","page_title":"Laserpitium","context_page_description":"Laserpitium L. es un género perteneciente a la familia Apiaceae. Comprende 161 especies descritas y de estas, solo 1 aceptadas.​"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9B%BC%E6%89%98%E7%93%A6%E5%8F%8A%E8%92%99%E8%B2%BB%E6%8B%89%E6%89%98%E7%88%B5%E4%BD%8D%E7%B9%BC%E6%89%BF%E6%88%B0%E7%88%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Michiel_Jansz_van_Mierevelt_-_Ambrogio_Spinola.jpg","page_title":"曼托瓦及蒙費拉托爵位繼承戰爭","context_page_description":"曼托瓦及蒙費拉托爵位繼承戰爭，或稱曼托瓦爵位繼承戰爭，是一個發生於17世紀前期的戰爭，戰爭原因是因貢扎加家族的末代曼托瓦公爵文琴佐二世·貢扎加於1627年12月在沒有合法繼承者的情況下去世而導致的。衝突的兩方是主張由貢扎加-訥韋爾繼承爵位並被教宗烏爾巴諾八世支持的法蘭西王國及威尼斯共和國聯軍，另一方則是反對此主張的神聖羅馬帝國、西班牙王國和薩伏依公國組成的聯軍，這場戰爭通常被包含在三十年戰爭的周圍戰爭之一，是法蘭西王國與哈布斯堡王朝為了爭奪義大利北部的控制權而演變的衝突。"},{"page_url":"https://es.wikipedia.org/wiki/Lagidium_peruanum","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Vizcachas%2C_ciudad_de_Chicla%2C_Huarochiri%2C_Lima%2C_Per%C3%BA.JPG","page_title":"Lagidium peruanum","context_page_description":"La vizcacha norteña es una especie de roedores de la familia Chinchillidae. Es una de las varias especies reconocidas de \\"Vizcachas de montaña\\", vive en las montañas de los Andes de Perú, Bolivia y Chile en elevaciones que van desde aproximadamente 3,000-5,000 metros."},{"page_url":"https://cs.wikipedia.org/wiki/Aegyptopithecus_zeuxis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Aegyptopithecus_face_%28University_of_Zurich%29-2.JPG","page_title":"Aegyptopithecus zeuxis","context_page_description":"Aegyptopithecus zeuxis je zástupce vyšších primátů z období oligocénu. Někdy bývá kvůli minimálním rozdílům slučován s rodem Propliopthecus. Objevil jej profesor Elwyn L. Simons v roce 1965 mezi pahorkatinou Jebel Qatrani a jezerem Qarun v egyptské provincii Fajjúm společně s několika dalšími soudobými primáty. Dosud získané ostatky zahrnují lebky i části postkraniální kostry.\\nAegyptopithecus zeuxis je jedním z předků všech úzkonosých opic včetně člověka. Měl již některé znaky nadčeledi Hominoidea - zubní vzorec 2.1.2.3 a stoličky s pěti hrbolky v tzv. dryopitekovém vzoru. Zároveň ale měl i ocas, který hominoidům chybí a protáhlejší obličejovou část. Také jeho mozek byl v poměru k velikosti těla celkem malý.\\nAegyptopithecus zeuxis vážil asi 6 kg a měřil přibližně 60 - 70 cm. Mezi fajjúmskými primáty byl tedy největší. Vyznačoval se silným pohlavním dimorfismem, samci byli značně větší než samice a měli výrazné špičáky. Tento rozdíl mezi samcem a samicí je důvodem k předpokladu polygynního života s intenzivním bojem o samice.\\nTento primát se pohyboval pomocí všech čtyř končetin ve stromech subtropického pralesa, který se v oligocénu kolem Fajjúmu rozkládal. Aktivní byl během dne."},{"page_url":"https://fr.wikipedia.org/wiki/Jacques-Aubin_Gaudin_de_La_B%C3%A9rillais","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Manifeste_Gaudin_Berillais.jpg","page_title":"Jacques-Aubin Gaudin de La Bérillais","context_page_description":"Jacques Aubin Gaudin de La Bérillais, né à Nantes le 14 avril 1733, guillotiné à Nantes le 18 avril 1793, appelé aussi La Bérillais, Laberillais ou Gaudin-Bérillais, est un officier de l'Ancien Régime, élu chef royaliste et médiateur pendant la guerre de Vendée.\\nLa Bérillais, officier d'infanterie, combat en Europe lors de la Guerre de Sept Ans, puis prend part à la guerre d'indépendance des États-Unis. Il devient major, puis lieutenant-colonel.\\nAu début de la Révolution française, il se retire sur ses terres près de Nantes. Il invite des prêtres réfractaires à célébrer dans sa chapelle des messes illégales. Il est secrètement l'un des deux chefs nantais d'une vaste conjuration royaliste, l'Association bretonne créée par La Rouërie.\\nQuand la guerre de Vendée éclate en mars 1793, il désapprouve ce soulèvement paysan. C'est contre son gré qu'il est élu chef par vingt et une paroisses de la région.\\nLa Bérillais accepte alors le commandement, mais refuse d'attaquer Nantes à la tête de ses troupes royalistes et impose sa volonté de rechercher la paix par la négociation, en tant que conciliateur."},{"page_url":"https://ceb.wikipedia.org/wiki/Kololi_Beach","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Kololibeach.JPG","page_title":"Kololi Beach","context_page_description":"Lapyahan ang Kololi Beach sa Gambiya. Nahimutang ni sa kasadpang bahin sa nasod, 16 km sa kasadpan sa Banjul ang ulohan sa nasod.\\nAng klima nga savanna. Ang kasarangang giiniton 24 °C. Ang kinainitan nga bulan Abril, sa 27 °C, ug ang kinabugnawan Hulyo, sa 22 °C. Ang kasarangang pag-ulan 1,148 milimetro matag tuig. Ang kinabasaan nga bulan Agosto, sa 449 milimetro nga ulan, ug ang kinaugahan Pebrero, sa 1 milimetro."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D9%8A%D9%86%D8%AC%D8%AA_%D8%A7%D8%AF%D9%85%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Bengt_Edman.jpg","page_title":"بينجت ادمان","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nبينجت ادمان كان مهندس من السويد."},{"page_url":"https://en.wikipedia.org/wiki/Algeria","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Abdelaziz_Bouteflika_and_George_W_Bush_20080707.jpg","page_title":"Algeria","context_page_description":"Algeria, officially the People's Democratic Republic of Algeria, is a country in the Maghreb region of North Africa. The capital and most populous city is Algiers, located in the far north of the country on the Mediterranean coast. With an area of 2,381,741 square kilometres, Algeria is the tenth-largest country in the world, and the largest by area in the African Union and the Arab world. With an estimated population of over 44 million, it is the eighth-most populous country in Africa.\\nAlgeria is bordered to the northeast by Tunisia, to the east by Libya, to the southeast by Niger, to the southwest by Mali, Mauritania, and the Western Saharan territory, to the west by Morocco, and to the north by the Mediterranean Sea. The country has a semi-arid geography, with most of the population living in the fertile north and the Sahara dominating the geography of the south. This arid geography makes the country very vulnerable to climate change."},{"page_url":"https://de.wikipedia.org/wiki/Johann_Philipp_H%C3%B6gl","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/H%C3%BCgel-Altar.jpg","page_title":"Johann Philipp Högl","context_page_description":"Johann Philipp Högl war Wiener Stadt-Steinmetzmeister, Grundrichter in der Roßau und 1797 Obervorsteher der Wiener Bauhütte."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_%C3%A9glises_des_C%C3%B4tes-d%27Armor","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Eglise_Notre-Dame_de_Tr%C3%A9gonneau.jpg","page_title":"Liste des églises des Côtes-d'Armor","context_page_description":"La liste des églises des Côtes-d'Armor recense de la manière la plus complète possible les églises, cathédrales et basiliques situées dans le département français des Côtes-d'Armor.\\nToutes sont situées dans le diocèse de Saint-Brieuc et Tréguier."},{"page_url":"https://nl.wikipedia.org/wiki/P49_(Letland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Dzenigali.jpg","page_title":"P49 (Letland)","context_page_description":"De P49 is een regionale weg in Letland. De weg loopt van Kārsava via Ludza naar Ezernieki en is 75,7 kilometer lang. In Kārsava sluit de weg aan op de A13 naar Rēzekne en Pskov en in Ludza op de A12 naar Riga en Moskou."},{"page_url":"https://en.wikipedia.org/wiki/List_of_listed_buildings_in_Nairn,_Highland","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/1_Crescent_Road%2C_Nairn.jpg","page_title":"List of listed buildings in Nairn, Highland","context_page_description":"This is a list of listed buildings in the parish of Nairn in Highland, Scotland."},{"page_url":"https://fr.wikipedia.org/wiki/Small_Luk","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Small_Ela_Luk.jpg","page_title":"Small Luk","context_page_description":"Small Luk, anciennement nommée Luk yiu-hung, est la première personne intersexe à évoquer ouvertement son intersexuation à Hong Kong. Elle est née avec un syndrome d'insensibilité partielle aux androgènes. Luk a vécu en tant qu'homme pendant 36 ans et a opté depuis pour le genre féminin. En 2011, elle a fondé l'organisation « Beyond Boundaries - Knowing and Concerns Intersex », structure de défense des droits des personnes intersexes."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%84%D8%A7%D8%B1%D9%8A_%D8%A5%D9%84._%D8%A8%D9%8A%D8%AA%D8%B1%D8%B3%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/OpenNetworkingSummit_Europe_Amsterdam_180927_highres-69_%2830126644187%29_%28cropped%29.jpg","page_title":"لاري إل. بيترسون","context_page_description":"لاري إل. بيترسون ‏ هو عالم حاسوب ومهندس أمريكي، ولد في 1958."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%98%D0%BB-18_%D0%BF%D0%BE%D0%B4_%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD%D0%B3%D1%80%D0%B0%D0%B4%D0%BE%D0%BC_(1974)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/%D0%9C%D0%B5%D0%BC%D0%BE%D1%80%D0%B8%D0%B0%D0%BB_%D1%8D%D0%BA%D0%B8%D0%BF%D0%B0%D0%B6%D1%83_%D0%98%D0%BB-18_%D0%B1%D0%BE%D1%80%D1%82_CCCP-75559_5.JPG","page_title":"Катастрофа Ил-18 под Ленинградом (1974)","context_page_description":"Катастрофа Ил-18 под Ленинградом — авиационная катастрофа самолёта Ил-18В из Ленинградского авиаотряда, произошедшая в субботу 27 апреля 1974 года в районе Ленинграда. Авиалайнер со 109 людьми на борту выполнял пассажирский рейс из Ленинграда в Запорожье, но сразу после вылета из аэропорта Пулково экипаж доложил о пожаре двигателя, в связи с чем они возвращаются в аэропорт. Однако при заходе на посадку пожар усилился, после чего машина потеряла управление и упала на поле, при этом все на борту погибли. Это крупнейшая авиакатастрофа в Санкт-Петербурге и Ленинградской области."},{"page_url":"https://sv.wikipedia.org/wiki/Epidendrum_frutex","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Epidendrum_frutex_-_Xenia_vol_1_pl_37_%281858%29.jpg","page_title":"Epidendrum frutex","context_page_description":"Epidendrum frutex är en orkidéart som beskrevs av Heinrich Gustav Reichenbach. Epidendrum frutex ingår i släktet Epidendrum och familjen orkidéer. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ca.wikipedia.org/wiki/Blat%C3%A0ria","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Verbascum_blattaria46.JPG","page_title":"Blatària","context_page_description":"Blatària és una espècie de planta dins la família Scrophulariaceae."},{"page_url":"https://id.wikipedia.org/wiki/Bait_Allah_(Yerusalem)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/70/Map_jerusalem_oldcity.png","page_title":"Bait Allah (Yerusalem)","context_page_description":"Bait Allah adalah sebutan untuk pusat peribadahan bangsa Israel dan orang Yahudi di Yerusalem pada zaman kuno, yang terletak di Bukit Bait Suci. Dalam bahasa Ibrani, tempat ini disebut Bait Suci. Bangunan ini digunakan untuk beribadah dan mempunyai fungsi utama untuk mempersembahkan kurban korbanot. Selama beberapa abad tempat ini menjadi pusat ibadah agama Yahudi.\\nMenurut Kitab Suci Ibrani dan Perjanjian Lama, Bait Allah ini dibangun oleh Salomo untuk menggantikan Kemah Suci yang dibangun Musa."},{"page_url":"https://en.wikipedia.org/wiki/Red-tailed_black_cockatoo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Thomas_Watling_-_Banksian_Cockatoo.jpg","page_title":"Red-tailed black cockatoo","context_page_description":"The red-tailed black cockatoo also known as Banksian- or Banks' black cockatoo, is a large black cockatoo native to Australia. Adult males have a characteristic pair of bright red panels on the tail that gives the species its name. It is more common in the drier parts of the continent. Five subspecies are recognised, differing chiefly in beak size. Although the more northerly subspecies are widespread, the two southern subspecies, the forest red-tailed black cockatoo and the south-eastern red-tailed black cockatoo are under threat.\\nThe species is usually found in eucalyptus woodlands, or along water courses. In the more northerly parts of the country, these cockatoos are commonly seen in large flocks. They are seed eaters and cavity nesters, and as such depend on trees with fairly large diameters, generally Eucalyptus. Populations in southeastern Australia are threatened by deforestation and other habitat alterations. Of the black cockatoos, the red-tailed is the most adaptable to aviculture, although black cockatoos are much rarer and much more expensive in aviculture outside Australia."},{"page_url":"https://de.wikipedia.org/wiki/Ananas","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Charles-pineapple.jpg","page_title":"Ananas","context_page_description":"Die Ananas ist eine Pflanzenart aus der Familie der Bromeliengewächse. Sie ist ursprünglich in Amerika heimisch und wird heute weltweit in den tropischen Gebieten als Obstpflanze angebaut. Sie bildet fleischige Fruchtstände, die frisch verzehrt oder zu Konserven und Saft verarbeitet werden können.\\nDas Wort Ananas entstammt der Bezeichnung naná ‚Frucht‘ in der Guaraní-Sprache. Das lateinische Art-Epitheton comosus ‚schopfig‘ spielt auf den Blattschopf am oberen Ende des Fruchtstandes an."},{"page_url":"https://es.wikipedia.org/wiki/Yardang","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Yardangs_in_the_Tsaidam_Desert.jpg","page_title":"Yardang","context_page_description":"Un yardang es una formación rocosa moldeada de forma característica por la erosión causada por el viento que, en este caso, casi siempre sopla desde el mismo punto. La roca en cuestión se va alargando y tomando distintas formas con el tiempo que pueden ser realmente curiosas: la Gran Esfinge de Guiza, por ejemplo, fue originalmente un yardang que comenzó a erosionarse hace más de 40000 años y los egipcios usaron posteriormente como material para tallar su estatua.\\nLos yardangs se forman exclusivamente en zonas desérticas, allí donde el viento puede desplazarse a gran velocidad levantando grandes cantidades de arena. El impacto de los granos de arena levantados contra la roca original la va erosionando de manera imperceptible, de tal manera que sus efectos sólo son reconocibles tras varios miles de años. A esta lenta erosión se debe entre otras cosas que la esfinge haya perdido su nariz. Con el paso del tiempo, los yardangs acaban por ser destruidos completamente y convertidos en arena."},{"page_url":"https://en.wikipedia.org/wiki/Gas_diffusion_electrode","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Sinterelektrode.jpg","page_title":"Gas diffusion electrode","context_page_description":"Gas diffusion electrodes are electrodes with a conjunction of a solid, liquid and gaseous interface, and an electrical conducting catalyst supporting an electrochemical reaction between the liquid and the gaseous phase."},{"page_url":"https://gl.wikipedia.org/wiki/Umberto_Saba","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Umberto_Saba.jpg","page_title":"Umberto Saba","context_page_description":"Umberto Poli, nado en Trieste o 9 de marzo de 1883 e finado en Gorizia o 25 de agosto de 1957, foi un poeta e novelista italiano, coñecido como Umberto Saba."},{"page_url":"https://ast.wikipedia.org/wiki/Megacorma_obliqua","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Megacorma_obliqua_MHNT_CUT_2010_0_342_Borneo%2C_Trusmadi_male_ventral.jpg","page_title":"Megacorma obliqua","context_page_description":"Megacorma obliqua ye una poliya de la familia Sphingidae.\\nSábese que vuela en Sri Lanka, nordeste de la India, Myanmar, suroeste de China, Tailandia, Vietnam del Norte, península de Malasia, Indonesia, les IsllesFilipines, Papúa Nueva Guinea y les Islles Salomón.\\nEl so valumbu de nala ye de 120 a 145 mm. Pueda ser estremáu de cola otru espécime de Sphingidae pola combinación de la estructura del palpu llabial, nala y tórax y patrón de nala."},{"page_url":"https://ro.wikipedia.org/wiki/Lista_monumentelor_istorice_din_jude%C8%9Bul_Sibiu_-_V","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Vard_-_Ansamblul_bisericii_evanghelice_fortificate.jpg","page_title":"Lista monumentelor istorice din județul Sibiu - V","context_page_description":"Lista monumentelor istorice din județul Sibiu - V cuprinde monumentele istorice înscrise în Patrimoniul cultural național al României și aflate în localități ce încep cu litera V din județul Sibiu.\\nLista completă este menținută și actualizată periodic de către Ministerul Culturii, Cultelor și Patrimoniului Național din România, prin intermediul Institutului Național al Patrimoniului, ultima versiune datând din 2015. Această listă cuprinde și actualizările ulterioare, realizate prin ordin al ministrului culturii."},{"page_url":"https://en.wikipedia.org/wiki/Melaleuca_linariifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Melaleuca_linariifolia_3.jpg","page_title":"Melaleuca linariifolia","context_page_description":"Melaleuca linariifolia, commonly known as snow-in-summer, narrow-leaved paperbark, flax-leaved paperbark and in the language of the Gadigal people as budjur. It is a plant in the myrtle family Myrtaceae, and is endemic to New South Wales and Queensland in Australia. A hardy plant, it flowers prolifically in late spring or summer, making it a popular garden shrub or small tree in temperate places. Melaleuca trichostachya is a similar species but its leaves are arranged differently and the fruits have projecting valves."},{"page_url":"https://ca.wikipedia.org/wiki/Petr%C3%A9s","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/CatedralPrimadaBogota2004-7.jpg","page_title":"Petrés","context_page_description":"Petrés és un municipi del País Valencià situat a la comarca del Camp de Morvedre. Limita amb Gilet i Sagunt."},{"page_url":"https://en.wikipedia.org/wiki/Lessach","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Lessach_HlPaulus_2014-0001.jpg","page_title":"Lessach","context_page_description":"Lessach is a municipality in the district of Tamsweg in the state of Salzburg in Austria."},{"page_url":"https://ro.wikipedia.org/wiki/Padstow_Heights,_New_South_Wales","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/2007_0810klklk0042.JPG","page_title":"Padstow Heights, New South Wales","context_page_description":"Padstow Heights este o suburbie în Sydney, Australia."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%BC%D0%B5%D1%80%D1%88%D0%B8%D0%B5_%D0%B2_%D0%BC%D0%B0%D1%80%D1%82%D0%B5_2018_%D0%B3%D0%BE%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/John_Sulston.jpg","page_title":"Умершие в марте 2018 года","context_page_description":"Это список известных людей, соответствующих установленным критериям значимости, умерших в марте 2018 года.\\nПричина смерти указывается лишь в исключительных случаях. В остальных случаях — не указывается.\\n← Февраль 2018"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%88%B1%E5%B0%94%E5%85%B0%E5%9B%BD%E7%AB%8B%E5%A4%A7%E5%AD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/NUI_HQ_Merrion_Square.jpg","page_title":"爱尔兰国立大学","context_page_description":"愛爾蘭國立大學建於1908年，現有四所成員校。"},{"page_url":"https://ja.wikipedia.org/wiki/%E7%A5%9E%E6%88%B8%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Kobe-Univ-Rokkodai-Honkan02.jpg","page_title":"神戸市","context_page_description":"神戸市は、兵庫県の南部に位置する市。兵庫県の県庁所在地で、政令指定都市である。\\n市域は垂水区・須磨区・長田区・兵庫区・中央区・灘区・東灘区・北区・西区の9区から構成される。人口は約152万人で市としては全国7番目、県内最大である。"},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%A7%D8%AA%D9%8A%D8%AC_%D9%81%D9%8A%D8%AF%D8%B1%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/14-06-03-%C4%8Cesko-Rakousko-Olomouc-nr12-1.jpg","page_title":"ماتيج فيدرا","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nماتيج فيدرا لاعب كورة قدم من تشيكيا."},{"page_url":"https://es.wikipedia.org/wiki/Jos%C3%A9_Mart%C3%ADnez_de_Salazar","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Catedral_de_Buenos_Aires%2C_1817.jpg","page_title":"José Martínez de Salazar","context_page_description":"José Martínez de Salazar era un militar español que actuó como maestre de campo al mando de un tercio en la guerra de Restauración portuguesa de 1640 a 1660 y también en el año 1644 en la Guerra franco-española debido a la sublevación catalana en el condado de Barcelona y a la consecuente invasión del reino vecino, ambas en el contexto de la guerra de los Treinta Años, lo que le valió el nombramiento como caballero de la Orden de Santiago y posteriormente el ascenso al rango de general en 1662. Poco después fue nombrado gobernador y capitán general del Río de la Plata y ocupó el cargo desde 1663 hasta 1674 y simultáneamente fue el primer presidente pretorial de la Real Audiencia de Buenos Aires hasta 1672, fecha en que sería suprimida, para continuar solo como gobernador por dos años más. Por su gestión en la restauración del fuerte de Buenos Aires y la Catedral, y la construcción de un horno de ladrillos y tejas y de un par de tahonas para que dichas reparaciones sean autosustentables económicamente, se lo considera actualmente como el primer industrial porteño."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%84%D8%BA%D8%B1%D8%A7%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Central_bank%2C_Belgrade%2C_Serbia.jpg","page_title":"بلغراد","context_page_description":"بلغراد هي عاصمة صربيا وأكبر مدنها على الإطلاق. تقع المدينة عند نقطة التقاء نهريّ الساڤا والدانوب، حيث يلتقي السهل الپانونّي لأوروبا الوسطى بشبه جزيرة البلقان. يصل عدد سكان المدينة نفسها إلى 1.2 مليون نسمة، بينما يصل عدد سكان المناطق المحيطة التابعة إداريًا لبلغراد، إلى 1.7 ملايين نسمة، الأمر الذي يجعل من هذه المدينة إحدى أكبر المدن في جنوب شرق أوروبا.\\nكانت بلغراد ومحيطها الموقع الذي نشأت فيه أكبر حضارة قبتاريخيّة أوروبية، ألا وهي حضارة \\"الڤينكا\\"، التي ظهرت حوالي الألفية السادسة قبل الميلاد، وفي العصور القديمة سكنت المنطقة قبيلة تراقيّة داتشيينة أطلقت على نفسها اسم قبيلة سينگي، وقد استمر هؤلاء الناس يقطنون المنطقة حتى عام 279 قبل الميلاد، عندما استوطنت المدينة قبيلة كلتيّة وسمّتها سينگيدون، بمعنى \\"حصن السينگي\\"، تيمنًا بالقوم الذين سبقوهم إلى المنطقة.\\nصُنّفت بلغراد مدينةً كاملةً الحقوق خلال العهد الروماني، وبحلول عام 520م كان الصقالبة، أو السلاڤيون، قد استوطنوها بشكل دائم. عرفت بلغراد 115 حربًا خاضتها أمم مختلفة لتسيطر على المدينة بفعل موقعها الإستراتيجي، وقد تمّت تسويتها بالأرض 44 مرة على يد بعض تلك الجيوش."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D1%84%D0%BE%D1%80%D0%BC%D0%B0_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE%D0%B9_%D0%B0%D1%80%D0%BC%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/%D0%9F%D0%B5%D1%82%D0%BB%D0%B8%D1%86%D0%B0_%D0%B3%D0%B5%D0%BD_%D0%B0%D0%B1%D1%82%D0%B2.png","page_title":"Военная форма Советской армии","context_page_description":"Военная форма Советской Армии — предметы форменной одежды и снаряжения военнослужащих Советской Армии, а также Правила их ношения в период с 1918 по 1991 г., установленные высшими правительственными органами для личного состава Советской Армии.\\nСтатья 1. Право ношения военной формы одежды имеют военнослужащие, состоящие на действительной военной службе в Советской Армии и Военно-Морском Флоте, суворовцы, нахимовцы, воспитанники военно-музыкальных училищ, учащиеся специальных школ-интернатов и военные строители, а также маршалы, генералы, офицеры, прапорщики и мичманы, состоящие в запасе или отставке с правом ношения военной формы одежды.\\n— ПРИЛОЖЕНИЕ № 1 к приказу Министра обороны СССР 1988 г. № 250."},{"page_url":"https://fr.wikipedia.org/wiki/Tisza%C3%BAjv%C3%A1ros","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/HUN_Tisza%C3%BAjv%C3%A1ros_COA.jpg","page_title":"Tiszaújváros","context_page_description":"Tiszaújváros est une ville hongroise et une commune du comitat de Borsod-Abaúj-Zemplén, dans le nord-est du pays, à 35 km au sud-est de Miskolc, près de la Tisza. La ville a été créée ex-nihilo après la Seconde Guerre mondiale et s'appelait Leninváros."},{"page_url":"https://en.wikipedia.org/wiki/Herne_Hill","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Herne_Hill_and_Half_Moon_Lane_in_1823.jpg","page_title":"Herne Hill","context_page_description":"Herne Hill is a district in South London, England, approximately four miles from Charing Cross and bordered by Brixton, Denmark Hill, Dulwich Village, Loughborough Junction and Tulse Hill. It overlaps the boundary between the boroughs of Lambeth and Southwark. There is a road of the same name in the area, as well as a railway station."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%AB%A9%E6%B1%9F","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/LocationNen.png","page_title":"嫩江","context_page_description":"嫩江，河源處又譯為南瓮河或納文慕仁，是松花江最大支流。位於中國黑龍江省西部，部分河段為黑龍江省與內蒙古自治區邊界。源出大興安嶺北麓伊勒呼里山，南流到鎮賚縣，經吉林省大安市在三岔河匯入松花江。長1370千米，流域面積28.3萬平方千米。支流主要有甘河、訥謨爾河、諾敏河、綽爾河、洮兒河、罕諾河、臥都河、那都里河、多布庫爾河、歐肯河、門魯河、科洛河、霍日裡河、阿倫河、雅魯河、音河等。\\n無論從長度、流量還是流域面積看，嫩江都實應為松花江正源，只因第二松花江發源於長白山天池而在中國清代被奉為松花江的正源，故正源之說延續至今。\\n嫩江有4個月冰期，江輪可航至齊齊哈爾。嫩江流經坡度很緩的松嫩平原，有許多湖泊、沼澤。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1960","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Ottey.jpg","page_title":"Lijst van personen geboren in 1960","context_page_description":"Dit is een lijst van personen die geboren zijn in 1960.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://sv.wikipedia.org/wiki/Sarin","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Sarin-3D-balls.png","page_title":"Sarin","context_page_description":"Sarin eller isopropylmetylfluorfosfonat är en lättflyktig nervgas. Sarin upptäcktes 1938 i Tyskland, och namngavs efter de tyska upptäckarna Schrader, Ambros, Rüdiger och van der Linde. Flyktigheten, att sarin lätt förångas, gör att den kan användas i strid på ett område som senare ska ockuperas av egna soldater, eftersom gasen snabbt dunstar bort efter insats. Sarin är den mest lättflyktiga av de vanligen förekommande nervgaserna.\\nSarin är förhållandevis billigt och lätt att tillverka, och ingick i många länders C-vapenarsenaler, särskilt fattigare länder som inte hade råd med kärnvapen."},{"page_url":"https://es.wikipedia.org/wiki/Municipio_de_Plain_Grove_(condado_de_Lawrence,_Pensilvania)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Plain_Grove_PCUSA.jpg","page_title":"Municipio de Plain Grove (condado de Lawrence, Pensilvania)","context_page_description":"El municipio de Plain Grove es un municipio ubicado en el condado de Lawrence en el estado estadounidense de Pensilvania. En el año 2000 tenía una población de 854 habitantes y una densidad poblacional de 18 personas por km².​"},{"page_url":"https://ca.wikipedia.org/wiki/Oficina_de_Justificaci%C3%B3_de_la_Difusi%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/50_aniversario_OJD_logo.png","page_title":"Oficina de Justificació de la Difusió","context_page_description":"Oficina de Justificació de la Difusió és una empresa espanyola fundada el 20 d'octubre de 1964 encarregada del control del tiratge i difusió de diversos tipus de mitjans de comunicació a Espanya, entre els quals es troben publicacions impreses i mitjans de comunicació per Internet."},{"page_url":"https://pt.wikipedia.org/wiki/Igreja_Matriz_de_Santa_Marinha_de_Cortega%C3%A7a","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Igr_sta_marinha_5.JPG","page_title":"Igreja Matriz de Santa Marinha de Cortegaça","context_page_description":"A Igreja Matriz de Santa Marinha de Cortegaça localiza-se na vila e freguesia de Cortegaça, freguesia portuguesa do concelho de Ovar, distrito de Aveiro, em Portugal.\\nO dia da Padroeira é celebrado anualmente a 18 de julho."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BE%D1%80%D0%B5%D0%B2%D0%BD%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D1%8F_%D0%BF%D0%BE_%D1%84%D0%B8%D0%B3%D1%83%D1%80%D0%BD%D0%BE%D0%BC%D1%83_%D0%BA%D0%B0%D1%82%D0%B0%D0%BD%D0%B8%D1%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Claudia_Leistner_heute_mit_Tochter_Julia_Pfrengle_und_Trainer_Sczypa.JPG","page_title":"Соревнования по фигурному катанию","context_page_description":"У каждого вида спорта своя специфика. В частности, в фигурном катании результат определяется субъективным мнением судей, спортсмены выступают поодиночке, а отбор будущих спортсменов начинается с дошкольного возраста. Это не могло не сказаться на системе соревнований по фигурному катанию."},{"page_url":"https://uk.wikipedia.org/wiki/Mitsubishi_Lancer_Evolution","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Saxony_rally_racing_Mitsubishi_Lancer_Evo_2_52_%28aka%29.jpg","page_title":"Mitsubishi Lancer Evolution","context_page_description":"Mitsubishi Lancer Evolution — спортивна версія автомобіля японського концерну Mitsubishi «компактного» класу — Mitsubishi Lancer. Lancer Evolution виробляється з 1992 року."},{"page_url":"https://it.wikipedia.org/wiki/Pennarello","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Filzstifte1.jpg","page_title":"Pennarello","context_page_description":"Il pennarello è un tipo di penna il cui serbatoio ha inchiostro colorato e la punta è formata da un materiale sintetico poroso."},{"page_url":"https://hu.wikipedia.org/wiki/Richard_C._Hunter","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Richard_Charles_Hunter_%28United_States_Senator_from_Nebraska%29.jpg","page_title":"Richard C. Hunter","context_page_description":"Richard C. Hunter az Amerikai Egyesült Államok szenátora."},{"page_url":"https://it.wikipedia.org/wiki/Khalid_Bouta%C3%AFb","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Khalid_Bouta%C3%AFb.jpg","page_title":"Khalid Boutaïb","context_page_description":"Khalid Boutaïb è un calciatore francese naturalizzato marocchino, attaccante dello Zamalek."},{"page_url":"https://no.wikipedia.org/wiki/Terrell","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/TXMap-doton-Terrell.PNG","page_title":"Terrell","context_page_description":"Terrell er en by i Texas, nærmere bestemt i Kaufman County, i USA. I 2000 bodde det 13.606 mennesker i Terrell. Terrell befinner seg 52 km øst for storbyen Dallas. Byens totale landareal omfatter 48.3 km²"},{"page_url":"https://en.wikipedia.org/wiki/Santillane","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Santillane.jpg","page_title":"Santillane","context_page_description":"Santillane is a historic home located near Fincastle, Botetourt County, Virginia. It was built in 1795, and consists of a two-story high, three bay by four bay, main block with a one-story, rear kitchen wing. It is constructed of brick and is in the Greek Revival style. The house has a shallow hipped roof and tetrastyle two-story front portico dated to the early 20th century. Also on the property is a contributing stone spring house. The house stands on a tract purchased by Colonel George Hancock in 1795. The kitchen wing may date to his period of ownership.\\nIt was listed on the National Register of Historic Places in 1974."},{"page_url":"https://tr.wikipedia.org/wiki/Vasubandhu","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Seshin_Vasubandhu_Kofukuji.jpg","page_title":"Vasubandhu","context_page_description":"Vasubandhu MS 420 ile 500 yılları arasında yaşamış olan ve \\"realist sistem\\" adıyla anılan Budist öğretiyi geliştirmiş olan Hint düşünür. Nirvanaya erişme yolu olarak değilleme mantığını kullanan, hakikati mantık işlemleriyle bulmayı amaçlayan Vasubandhu, varlığın bir taraftan çeşit çeşit somut nesnelerden, diğer taraftan da bu nesnelere geçici bir süre için yönelen benlik ya da ruhlardan oluştuğunu savunmuş, değilleme mantığını kişiler üzerinde uygulayarak sürekli ve kalıcı ruhlar olabileceği düşüncesini yadsımaya çalışmıştır."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D8%B1%D9%88%D8%AF%DA%AF%D8%A7%D9%87_%D9%84%D8%A7%D9%86%D8%AF%D8%B3_%D8%A7%D9%86%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/IslanderBN500.jpg","page_title":"فرودگاه لاندس اند","context_page_description":"فرودگاه لاندس اند یک فرودگاه خصوصی حمل و نقل با کد یاتا LEQ است که یک باند فرود چمن دارد و طول باند آن ۷۹۲ متر است. این فرودگاه در شهر کورن‌وال کشور انگلستان قرار دارد و در ارتفاع ۱۲۲ متری از سطح دریا واقع شده‌است."},{"page_url":"https://ast.wikipedia.org/wiki/%E1%B8%B6%E1%B8%B7uarca_(parroquia)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/45/Luarca01.jpg","page_title":"Ḷḷuarca (parroquia)","context_page_description":"Ḷḷuarca ye una parroquia del conceyu asturianu de Valdés. Tien una población de 4934 hab. repartíos en 5,84 km² y cuasi íntegramente na villa homónima, sacantes 892 habitantes que pueblen el restu de güeries de la parroquia. Ta allugada a 100 km d'Uviéu, capital del Principáu. La so ilesia parroquial ta dedicada a Santa Olaya.\\nYe una llocalidá del Camín de Santiagu y cuenta con albergue de pelegrinos, asitiáu n'Almuña, a unos dos kilómetros de la villa de Ḷḷuarca. Ente los llugares más destacaos tán el faru y el palaciu del Marqués de La Ferrera."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B3%D0%B5%D0%B1%D1%80%D0%BE%D0%B2-%D0%98%D0%B7%D0%BE%D1%82%D1%82%D0%B0-%D0%A4%D1%80%D0%B0%D1%81%D0%BA%D0%B8%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/RU066-16.jpg","page_title":"Мгебров-Изотта-Фраскини","context_page_description":"«Мге́бров-Изо́тта-Фраски́ни» — пулемётный бронеавтомобиль Российской империи периода Первой мировой войны. Построен в 1916 году на Ижорском заводе на базе шасси заднеприводного грузовика итальянской фирмы Isotta-Fraschini. Проект бронировки разработан штабс-капитаном Владимиром Мгебровым. Как и во всех броневиках Мгеброва, в проекте «Мгебров-Изотта-Фраскини» активно использовалось расположение бронелистов под рациональными углами наклона, что повышало их пулестойкость."},{"page_url":"https://de.wikipedia.org/wiki/Georg_von_Berchem","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Parochialkirche_Innenraum_Epitaph_2.jpg","page_title":"Georg von Berchem","context_page_description":"Georg von Berchem war ein Geheimer Rat unter dem Kurfürsten Friedrich III. von Brandenburg, dem späteren König Friedrich I. in Preußen."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%9F%D0%B0%D1%9E%D0%BB%D1%96%D0%BD%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Pfau_imponierend.jpg","page_title":"Паўліны","context_page_description":"Паўліны — род птушак сямейства фазанавых атрада курападобных.\\nАдрозьніваюць 2 віды. Паўлін звычайны, або індыйскі, або чубаты, пашыраны на п-ве Індастан і в-ве Шры-Ланка. Драбнейшы паўлін сінякрылы, або яванскі, пашыраны ў Індакітаі і Інданэзіі; занесены ў Чырвоную кнігу МСАП. Жывуць у зарасьніках, на лясных высечках, па берагах рэк. У Эўропу завезены ў IV ст. да н. э.\\nУ самцоў даўжыня цела да 125 см, хваста да 45 см, падоўжаных, упрыгожаных «вочкамі» пёраў надхвосьця да 150 см; маса да 4,3 кг. Афарбоўка яркая, пераважна сіне-зялёная, з мэталічным адлівам. На галаве чубок. Самкі драбнейшыя, бурага колеру, бяз доўгага надхвосьця. Кормяцца насеньнем, зернем, травой, насякомымі. Палігамы. Пры такаваньні самец разводзіць пёры надхвосьця веерам і падымае іх амаль вэртыкальна. Нясуць да 6 яец."},{"page_url":"https://da.wikipedia.org/wiki/Erkki_Melartin","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Erkki_melartin.jpg","page_title":"Erkki Melartin","context_page_description":"Erkki Melartin var en finsk komponist og lærer.\\nMelartin er nok mest kendt som symfoniker. Han har komponeret seks symfonier i lyrisk stil. Han fjerner sig i stil væsentligt fra sin samtidige kollega Jean Sibelius\\nHan var den første komponist i Finland, som komponerede i stil med Gustav Mahler.\\nHan har undervist bl.a. Uuno Klami. Han komponerede ligeledes orkesterværker, klaverværker, vokalværker og kammermusik."},{"page_url":"https://en.wikipedia.org/wiki/Modern_Greek_literature","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Giorgos_Seferis_1963.jpg","page_title":"Modern Greek literature","context_page_description":"Modern Greek literature refers to literature written in common Modern Greek, emerging from the late Byzantine era in the 11th century AD. During this period, spoken Greek became more prevalent in the written tradition, as demotic Greek came to be used more and more over the Attic idiom and the katharevousa reforms.\\nThe migration of Byzantine scholars and other émigrés during the decline of the Byzantine Empire and mainly after the fall of Constantinople in 1453 until the 16th century is considered by some scholars as key to the revival of Greek and Roman studies and subsequently in the development of the Renaissance humanism and science. These emigres were grammarians, humanists, poets, writers, printers, lecturers, musicians, astronomers, architects, academics, artists, scribes, philosophers, scientists, politicians and theologians. They brought to Western Europe the far greater preserved and accumulated knowledge of their own civilization.\\nThe Cretan Renaissance poem Erotokritos is undoubtedly the masterpiece of this early period of modern Greek literature, and represents one of its supreme achievements. It is a verse romance written around 1600 by Vitsentzos Kornaros."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A7%E6%B1%B6%E5%8F%A3%E9%81%97%E5%9D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/National_Museum_of_China_2014.02.01_14-57-21.jpg","page_title":"大汶口遗址","context_page_description":"大汶口遗址位于中国山东省泰安市岱岳区大汶口镇大汶河畔，是一处新石器时代遗址，1982年被列为第二批全国重点文物保护单位。\\n大汶口遗址于1959年首次发现，经过三次大规模考古发掘，探明其遗址范围达82万平方米左右，历史跨度有2500多年。大汶口文化因大汶口遗址而得名。\\n[1] 鬶，中国新石器时期的一种陶制的炊事用具，用三只脚承托。按《说文》中的的释义是鬶，三足釜也，有柄喙。而清朝段玉裁所著《说文解字注》的释义则是有柄可持，有喙可写物。"},{"page_url":"https://sl.wikipedia.org/wiki/Rok_Roblek","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Rok_Roblek.jpg","page_title":"Rok Roblek","context_page_description":"Rok Roblek se je rodil 14. 9. 1989 v Kranju. Prihaja iz vasi Bašelj pri Preddvoru. Obiskoval je osnovno šolo Matije Valjavca v Preddvoru, ki jo je zaključil z osemletnim odličnim uspehom. Šolanje je nadaljeval na Gimnaziji Kranj in se vpisal na Biotehniško fakulteto smer Agronomija. Študij je dokončal leta 2011 in pridobil izobrazbo univerzitetni diplomirani inženir agronomije. Študij je nadaljeval na podiplomskem študiju in leta 2018 pridobil naziv magister inženir agronomije.\\nOd leta 2011 do 2014 je vodil Zvezo slovenske podeželske mladine, bil član Sveta za kmetijstvo in podeželje pri Ministrstvu za kmetijstvo, gozdarstvo in prehrano ter bil član Strokovnega odbora za socialno varnost, kmečko družino, kmetice in podeželsko mladino pri Kmetijsko gozdarski zbornici Slovenije. V letih 2012 do 2014 je bil voljeni član glavnega odbora Rural youth Europe.\\nLeta 2014 je bil izvoljen na mesto občinskega svetnika Občine Preddvor. Leta 2016 se je vpisal na vzporedni magistrski študij managementa na Fakulteti za Management Koper.\\nPo končanem prvostopenjskem študiju Agronomije se je leta 2014 kot višji svetovalec zaposlil na Ministrstvu za kmetijstvo, gozdarstvo in prehrano."},{"page_url":"https://sv.wikipedia.org/wiki/Z-funktionen","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/Riemann_Siegel_Z_2.jpg","page_title":"Z-funktionen","context_page_description":"Inom matematiken är Z-funktionen en speciell funktion som används då man studerar Riemanns zetafunktion vid den kritiska linjen där den reella delen av argumentet är en halv. Den är även känd som Riemann-Siegels Z-funktion, Riemann-Siegels zetafunktion, Hardys funktion, Hardys Z-funktion och Hardys zetafunktion. Den kan definieras med hjälp av Riemann–Siegels thetafunktion och Riemanns zetafunktion som"},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%B8%E0%B3%8D%E0%B2%9F%E0%B3%8D%E0%B2%AF%E0%B2%BE%E0%B2%A8%E0%B3%8D%E2%80%8C%E0%B2%AB%E0%B3%8B%E0%B2%B0%E0%B3%8D%E0%B2%A1%E0%B3%8D_%E0%B2%B5%E0%B2%BF%E0%B2%B6%E0%B3%8D%E0%B2%B5%E0%B2%B5%E0%B2%BF%E0%B2%A6%E0%B3%8D%E0%B2%AF%E0%B2%BE%E0%B2%A8%E0%B2%BF%E0%B2%B2%E0%B2%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/The_Dish%2C_Stanford_University.jpg","page_title":"ಸ್ಟ್ಯಾನ್‌ಫೋರ್ಡ್ ವಿಶ್ವವಿದ್ಯಾನಿಲಯ","context_page_description":"ಲೇಲ್ಯಾಂಡ್ ಸ್ಟ್ಯಾನ್‌ಫೋರ್ಡ್ ಜೂನಿಯರ್ ವಿಶ್ವವಿದ್ಯಾನಿಲಯ, ಸಾಮಾನ್ಯವಾಗಿ ಸ್ಟ್ಯಾನ್‌ಫೋರ್ಡ್ ವಿಶ್ವವಿದ್ಯಾನಿಲಯ ಅಥವಾ ಸ್ಟ್ಯಾನ್‌ಫೋರ್ಡ್, ಎನ್ನುತ್ತಾರೆ, ಇದು ಖಾಸಗೀ ಸಂಶೋಧನಾ ವಿಶ್ವವಿದ್ಯಾನಿಲಯವಾಗಿದ್ದು, ಸ್ಟ್ಯಾನ್‌ಫೋರ್ಡ್, ಕ್ಯಾಲಿಫೋರ್ನಿಯಾ, ಯುನೈಟೆಡ್ ಸ್ಟೇಟ್ಸ್‌ನಲ್ಲಿದೆ. ಕ್ಯಾಲಿಫೋರ್ನಿಯಾದ ರೈಲ್‌ರೋಡ್ ಟೈಕೂನ್‌ ಲಿಲ್ಯಾಂಡ್‌ ಸ್ಟ್ಯಾನ್‍ಫೋರ್ಡ್‌‌ನಲ್ಲಿ 1891 ರಲ್ಲಿ ಈ ಯೂನಿವರ್ಸಿಟಿಯನ್ನು ಸ್ಥಾಪಿಸಲಾಯಿತು ಮತ್ತು ತನ್ನ ರೋಗಗ್ರಸ್ಥ ಮಗನ ಹೆಸರನ್ನು ಇಡಲಾಯಿತು. ಇದರ ಹಳೇ ವಿದ್ಯಾರ್ಥಿಗಳ ಸಂಘವು ಹೆವೆಲ್ಟ್‌-ಪ್ಯಾಕರ್ಡ್‌, ಎಲೆಕ್ಟ್ರಾನಿಕ್ ಆರ್ಟ್ಸ್‌, ಸನ್‌ ಮೈಕ್ರೋಸಿಸ್ಟಮ್ಸ್, ನ್ವಿಡಿಯಾ, ಯಾಹೂ!, ಸಿಸ್ಕೋ ಸಿಸ್ಟೆಮ್ಸ್‌, ಸಿಲಿಕಾನ್‌ ಗ್ರಾಫಿಕ್ಸ್‌ ಮತ್ತು ಗೂಗಲ್‌ಗಳನ್ನು ಸಂಸ್ಥಾಪಿಸಿತು.\\nಸ್ಟ್ಯಾನ್‌ಫೋರ್ಡ್ ಸರುಸುಮಾರು 6,800 ಪದವಿ ಪೂರ್ವ ವಿದ್ಯಾರ್ಥಿಗಳನ್ನು ಮತ್ತು 8,300 ಪದವಿ ವಿದ್ಯಾರ್ಥಿಗಳನ್ನು ಯುನೈಟೆಡ್‌ ಸ್ಟೇಸ್ಟ್ಸ್‌ನಿಂದ್ ಮತ್ತು ಪ್ರಪಂಚದಾದ್ಯಂತದಿಂದ ನೋಂದಾಯಿಸಿಕೊಳ್ಳುತ್ತವೆ. ವಿಶ್ವವಿದ್ಯಾಲಯವು ಸ್ಟ್ಯಾನ್‌ಫೋರ್ಡ್‌ ಗ್ರಾಜುಯೇಟ್‌ ಸ್ಕೂಲ್ ಆಫ್ ಬಿಸಿನೆಸ್‌, ಸ್ಟ್ಯಾನ್‌ಫೋರ್ಡ್‌ ಲಾ ಸ್ಕೂಲ್, ಸ್ಟ್ಯಾನ್‌ಫೋರ್ಡ್‌ ಸ್ಕೂಲ್‌ ಆಫ್ ಮೆಡಿಸೀನ್‌, ಮತ್ತು ಸ್ಟ್ಯಾನ್‌ಫೋರ್ಡ್‌ ಸ್ಕೂಲ್‍ ಆಫ್‌ ಎಂಜಿನಿಯರಿಂಗ್‌ ಸೇರಿದಂತೆ ಅಸಂಖ್ಯಾತ ಶಾಲೆಗಳಾಗಿ ವಿಂಗಡಣೆಗೊಂಡಿದೆ.\\nಸ್ಟ್ಯಾನ್‌ಫೋರ್ಡ್‌ ಅಕಾಡೆಮಿಕ್‌ ರ್ಯಾಂಕಿಂಗ್‌ ಆಫ್‌ ವರ್ಲ್ಡ್‌ ಯುನಿವರ್ಸೀಟಿಸ್‌ಯಿಂದ ಪ್ರಪಂಚದ ವಿವಿಗಳಲ್ಲೇ 2ನೇ ಸ್ಥಾನವನ್ನು ಪಡೆದಿದೆ ಹಾಗೂ ಇದರ ಪದವಿ ಪೂರ್ವ ಕ್ಷೇತ್ರವು ಇತ್ತೀಚೆಗೆ ಯು.ಎಸ್‌."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%87%91%E8%9E%8D%E4%BA%BA%E7%89%A9%E8%AA%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/%E5%BC%B5%E5%9C%8B%E5%B2%B1.jpg","page_title":"金融人物誌","context_page_description":"《金融人物誌》，中國金融年鑑社編訂，民國37年11月出版，沈雷春發行，藝文書局印刷，黎明書局經銷。此書內容主要是介紹1940年代中國的金融界人物，保留了大量珍貴的歷史人物照片。"},{"page_url":"https://hu.wikipedia.org/wiki/Ecuador","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/SageoEG_-_Biblioteca_Municipal_de_Guayaquil_001.jpg","page_title":"Ecuador","context_page_description":"Az Ecuadori Köztársaság egy dél-amerikai ország, amely északon Kolumbiával, keleten és délen Peruval, nyugaton a Csendes-óceánnal határos. Hozzá tartoznak még a Galápagos-szigetek a Csendes-óceánban, 965 km-re a kontinens partjaitól. Nevének jelentése spanyolul ’Egyenlítő’, mivel az Egyenlítő vonalán fekszik. A 272 045 km² területű ország fővárosa Quito, amely az 1970-es években UNESCO világörökségi címet kapott, amiért egész Latin-Amerikában az itteni történelmi központ őrizte meg legjobban eredeti jellegét. Ecuador legnagyobb városa Guayaquil. Az ország harmadik legnagyobb városa, Cuenca 1999-ben szintén világörökségi címet kapott, amiért rendkívül jól illusztrálja a gyarmatosító spanyol reneszánsz várostervezést valamint városképe élénken tükrözi a különböző latin-amerikai társadalmakat és kultúrákat. Ecuador számos állatfajnak ad otthont, amely közül sok az őshonos, mint például az egyedülálló állatvilágáról híres Galápagos-szigeteken élő fajok jelentős része.\\nEcuador HDI mutatója 0,695 és a lakosság 35,1%-a a szegénységi vonal alatt él."},{"page_url":"https://pl.wikipedia.org/wiki/Solaris_Urbino","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Solaris_Urbino_12_electric_von_der_Freiburger_Verkehrs_AG_auf_der_Linie_27_an_der_Haltestelle_Herdern_Kirche.jpg","page_title":"Solaris Urbino","context_page_description":"Solaris Urbino – rodzina niskopodłogowych autobusów miejskich i niskowejściowych autobusów podmiejsko-międzymiastowych produkowana od 1999 r. przez polskie przedsiębiorstwo Solaris Bus & Coach S.A. z Bolechowa koło Poznania. Napęd stanowią klasyczne silniki wysokoprężne lub na paliwa alternatywne. W 2014 r. podczas targów IAA w Hanowerze oraz w Polsce w czasie Transexpo w Kielcach odbyła się premiera pojazdów czwartej generacji, która do produkcji weszła w 2015 r. Solaris Urbino 12 electric jako pierwszy polski autobus został nagrodzony tytułem Autobus Roku 2017. Solaris Urbino jest obecnie najpopularniejszym pod względem sprzedaży modelem autobusów miejskich w Polsce, a także jednym z najpopularniejszych w Europie."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Gedenkm%C3%BCnzen_der_Bundesrepublik_Deutschland_(DM)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bc/Herder_RS.JPG","page_title":"Liste der Gedenkmünzen der Bundesrepublik Deutschland (DM)","context_page_description":"Von 1953 bis 2001 wurden von der Bundesrepublik Deutschland 87 Gedenkmünzen mit der Währungsbezeichnung Deutsche Mark ausgegeben. Bis auf eine goldene Gedenkmünze bestanden diese aus unterschiedlich hohen Silberlegierungen oder Magnimat, einer Kupfer-Nickel-Legierung. Die Qualitäten der Prägung waren Stempelglanz und Spiegelglanz; Bekanntmachungen der Bundesregierung über Münzprägungen enthalten seit 1997 Zahlen über den Anteil von Spiegelglanzmünzen.\\nDie ersten fünf Gedenkmünzen wurden in einem Zeitraum von 14 Jahren ausgegeben. Sie hatten eine sehr geringe Auflage und sind die gesuchtesten Münzen für Sammler der Deutschen Mark. Aufgrund ihrer Seltenheit existieren verschiedene gesetzlich erlaubte Nachahmungen; diese sind für Numismatiker allerdings bedeutungslos.\\nIn den folgenden 34 Jahren wurden 82 verschiedene Motive geprägt. Die Auflage war mit anfangs häufig über acht Millionen Exemplaren bezogen auf die Einwohnerzahl der Bundesrepublik relativ hoch. Im Laufe der Jahre wurde die Menge auf zum Schluss zwei Millionen abgesenkt."},{"page_url":"https://az.wikipedia.org/wiki/Raul_Kastro","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Presidente_de_Cuba%2C_Ra%C3%BAl_Castro%2C_visita_Salvador.jpg","page_title":"Raul Kastro","context_page_description":"Raul Kastro - Dövlət Şurasının sədri, Fidel Kastronun qardaşı"},{"page_url":"https://sv.wikipedia.org/wiki/Caterham_Seven","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/Caterham_R300.jpg","page_title":"Caterham Seven","context_page_description":"Caterham Seven, brittisk sportbil. När Lotus 1973 beslutade att sluta tillverka modellen Seven, ansåg återförsäljaren Caterham att konceptet var alltför bra för att dö. Tillverkningsrättigheterna köptes, och tillverkningen har fortsatt sen dess. Enda skillnaden mot Lotus-bilarna var att de hädanefter hette Caterham istället. Namnet Seven ingick dock och har omsorgsfullt skyddats sedan dess.\\nI början fortsatte man att tillverka Seven S4 tills dessa delar tog slut. Därefter återgick man till att tillverka bilar som ser ut som Seven S3. Man har till och med skyddat modellens utseende numera. Exempelvis konkurrenten Westfield som tillverkar en Seven-kopia har tvingats ändra utseendet på sina bilar.\\nDe flesta nya Caterham Seven är unika, men egentligen har man några grundmodeller; Classic är enklast och billigast. Då ingår en enkelförgasare och hastighetsmätare men inte vindruta. Super Sprint innehåller bland annat dubbla Weberförgasare, aluminiumhjul och vindruta.\\nCaterham släppte våren 2006 CSR-modellen med en ny hjulupphängning och en motor tillverkad av Ford."},{"page_url":"https://en.wikipedia.org/wiki/Kepier_Hospital","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Kepier_Hospital_gate_house_1333_-_geograph.org.uk_-_247458.jpg","page_title":"Kepier Hospital","context_page_description":"Kepier Hospital was a medieval hospital at Kepier, Durham, England."},{"page_url":"https://eo.wikipedia.org/wiki/Pa%C5%ADlo_Orosio","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Paulo_Orosio_-_Detalle.jpg","page_title":"Paŭlo Orosio","context_page_description":"”En lia eta lumo ridas / tiu advokato de la kristanaj tempoj / de kies latino profitis Aŭgusteno.”\\nPaulo Orosio estis romia sacerdoto, historiisto kaj apologiulo, disĉiplo kaj kunlaboranto de Sankta Aŭgusteno de Hipono. Invitite de ĉi tiu lasta, Orosio verkis Historiarum adversos paganos libri VII kiu devis servi kiel historia kompletigo de De civitate Dei de sia majstro."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A9%D0%B5%D1%86%D0%B8%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%83%D0%BD%D1%96%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/USBudynekRektoratu.jpg","page_title":"Щецинський університет","context_page_description":"Щецинський університет — державний вищий навчальний заклад Польщі, розташований у місті Щецині, на північному заході країни. Офіційно заснований 21 липня 1984 року, відкритий 1 жовтня 1985 року. Університет має 13 факультетів, більше 22 тис. студентів та бл. 1200 викладачів. Ректор — Едвард Влодарчик."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Yale_University_people","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Ernesto_Zedillo_Ponce_de_Leon_World_Economic_Forum_2013.jpg","page_title":"List of Yale University people","context_page_description":"Yalies are persons affiliated with Yale University, commonly including alumni, current and former faculty members, students, and others. Here follows a list of notable Yalies."},{"page_url":"https://pt.wikipedia.org/wiki/Palacios_de_Goda","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Palacios_de_Goda_09_by-dpc.jpg","page_title":"Palacios de Goda","context_page_description":"Palacios de Goda é um município da Espanha na província de Ávila, comunidade autónoma de Castela e Leão, de área 52,97 km² com população de 455 habitantes e densidade populacional de 8,59 hab/km²."},{"page_url":"https://da.wikipedia.org/wiki/Carol_1._af_Rum%C3%A6nien","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Prince_Karl_of_Hohenzollern_Sigmaringen.jpg","page_title":"Carol 1. af Rumænien","context_page_description":"Carol 1. af Rumænien var regent af Rumænien fra 1866 til 1914, fra 1866 til 1881 som fyrste og fra 1881 til 1914 som konge.\\nCarol var en yngre søn af den tyske fyrste Karl Anton af Hohenzollern-Sigmaringen og tilhørte dermed en en katolsk sidegren af det preussiske kongehus, Huset Hohenzollern. Han var officer i den preussiske hær, da han på anbefaling af kejser Napoleon 3. af Frankrig i 1866 blev tilbudt at blive regent i Rumænien. Som fyrste af Rumænien tog han navnet Carol, rumænsk for Karl. I de 48 år han regerede, fremmede han som en seriøs og effektiv men personligt kold og beregnende hersker Rumæniens udvikling. Landet erklærede fuld uafhængighed fra Tyrkiet i 1877, og Carol antog titel af konge i 1881. De første jernbaner blev bygget, og udvindingen af olie begyndte. Bøndernes situation var dårlig, og der var flere oprør i landbefolkningen: det alvorligste i 1907. I 1883 havde Carol underskrevet en hemmelig alliance med Centralmagterne. Men da Første Verdenskrig brød ud, ville hans franskvenlige land ikke følge ham.\\nHan var gift med Prinsesse Elisabeth af Wied. Deres eneste barn, en datter, døde som treårig, og Carol blev derfor efterfulgt som konge af sin nevø Ferdinand 1."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%9F%D1%80%D0%B0%D0%BF%D0%BE%D1%80%D1%89%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/%D0%9D%D0%B7%D1%81%D1%811.png","page_title":"Прапорщик","context_page_description":"Прапорщик — Ҡораллы көстәрҙә һәм ҡайһы бер дәүләттәрҙең «көс» структураларында хәрби званиеһы.\\nПрапорщиктар — СССР һәм Рәсәй Федерацияһының закондары менән СССР һәм Рәсәй Федерацияһының Ҡораллы Көстәрендё, башҡа ғәскәрҙәрҙә, формированиеларҙа һәм органдарҙағы хәрби хеҙмәткәрҙәр составы."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B9%BE%E6%B1%BD%E8%88%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Inui_bld01s5s3200.jpg","page_title":"乾汽船","context_page_description":"乾汽船株式会社は、東京都中央区に本社を置く海運業・倉庫業・不動産業を営む会社である。"},{"page_url":"https://en.wikipedia.org/wiki/Frieda_Fronm%C3%BCller","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/F%C3%BCrth-Ehrentafel_7886.JPG","page_title":"Frieda Fronmüller","context_page_description":"Friederike Helene Emma Fronmüller was a German Lutheran church musician and composer, who published as Frieda Fronmüller."},{"page_url":"https://tr.wikipedia.org/wiki/Frizya","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Elfstedentocht.png","page_title":"Frizya","context_page_description":"Frizya veya Frizye, Hollanda'nın illerinden birisidir. Hollanda'nın kuzeyinde yani deniz kıyısında yer alan bir şerit şeklindedir. Frizya Hollanda'da resmi bir yerleşim birimi olarak varlığını günümüzde de sürdürmekte ve halkı Frizce konuşmaktadır. Frizce, İngilizcenin de kökenini teşkil eder.\\nFrizya 643,000'lik bir nüfusa sahiptir. Leeuwarden ise 91,817 kişilik sakiniyle ilin resmî merkezidir.\\nElfstedentocht adındaki yarışlar burada yapılmaktadır. Frizya'da mutfağında en sık tüketilen içecek doğu Frizya çayıdır."},{"page_url":"https://fr.wikipedia.org/wiki/Hartford_Courant","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/The_Hartford_Courant_building_in_downtown_Hartford%2C_seen_from_I-84_East.jpg","page_title":"Hartford Courant","context_page_description":"Le Hartford Courant est le plus grand journal de l'État américain du Connecticut souvent considéré comme le plus ancien journal publié de façon continue aux États-Unis, un journal du matin qui dessert la plus grande partie de l'État au nord de New Haven et à l'est de Waterbury, son siège sur Broad Street se trouve à quelques pas du Capitole de l'État du Connecticut. Il rend compte de l'actualité régionale avec des bureaux dans les plus petites villes et des éditions locales. Depuis 2000, il appartient à la Tribune Company, qui plus tard associa la gestion du journal et les installations avec celles de WTIC-TV à Hartford qui appartient également à la Tribune."},{"page_url":"https://en.wikipedia.org/wiki/National_Institute_of_Mental_Health_and_Neurosciences","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Nimhans_hostel.jpg","page_title":"National Institute of Mental Health and Neurosciences","context_page_description":"The National Institute of Mental Health and Neuro-Sciences is a premier medical institution in Bengaluru, India. NIMHANS is the apex centre for mental health and neuroscience education in the country. It is an Institute of National Importance operates autonomously under the Ministry of Health and Family Welfare. NIMHANS is ranked 4th best medical institute in India, having applied for the first time in NIRF ranking of 2020."},{"page_url":"https://sv.wikipedia.org/wiki/Ficus_destruens","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Balete_from_Forest_of_the_Philippines_plate8_part2.jpg","page_title":"Ficus destruens","context_page_description":"Ficus destruens är en mullbärsväxtart som beskrevs av F. Müll. och Cyril Tenison White. Ficus destruens ingår i släktet fikonsläktet, och familjen mullbärsväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/Dianthus_balbisii","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Caryophyllaceae_-_Dianthus_balbisii.JPG","page_title":"Dianthus balbisii","context_page_description":"Dianthus balbisii is a herbaceous perennial plant of the genus Dianthus of the family Caryophyllaceae. The genus name Dianthus derives from the Greek words for divine and flower, while the species name balbisii honors the Italian botanist Giovanni Battista Balbis."},{"page_url":"https://es.wikipedia.org/wiki/Lauburu","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Armentdarits_Linteau9.jpg","page_title":"Lauburu","context_page_description":"El lauburu es el nombre que recibe en euskera la cruz de brazos curvilíneos.​ Este símbolo se encuentra muy frecuentemente entre las representaciones artísticas de ciertos pueblos europeos, como celtas y germanos, como por ejemplo, en dibujos y tallas visigóticas. Asimismo, pueden verse lauburus grabados en petroglifos de Galicia y en hórreos asturianos y gallegos, siendo denominados en este caso simplemente \\"tetrasqueles\\".​ También han sido utilizadas esvásticas curvilíneas de cuatro o más brazos en Aragón, donde se conocen en algunos pueblos pirenaicos como cuatrefuellas​ o \\"religadas\\"​. Es actualmente uno de los símbolos más representativos y reconocibles de la cultura vasca, si bien tradicionalmente nunca ha sido usado, por ejemplo, en escudos o banderas de ningún territorio de las actuales provincias de Vizcaya, Guipúzcoa, Álava o Navarra, situadas en el norte de España.​"},{"page_url":"https://fr.wikipedia.org/wiki/Magnificent","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cd/U2-panorama.jpg","page_title":"Magnificent","context_page_description":"Magnificent est une chanson d'amour pop rock alternatif de 2009 du groupe de rock irlandais U2. Ce titre est un des tubes de leur répertoire, second des trois singles extraits de leur douzième album No Line on the Horizon."},{"page_url":"https://fr.wikipedia.org/wiki/Zarra_(Espagne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Zarra_9.jpg","page_title":"Zarra (Espagne)","context_page_description":"Zarra est une commune d'Espagne de la province de Valence dans la Communauté valencienne. Elle est située dans la comarque du Valle de Cofrentes et dans la zone à prédominance linguistique castillane."},{"page_url":"https://hu.wikipedia.org/wiki/TER_Bourgogne","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Gare_de_Ch%C3%A2tillon_%28Rh%C3%B4ne%29_-_Entr%C3%A9e_gare_%28ao%C3%BBt_2018%29.jpg","page_title":"TER Bourgogne","context_page_description":"A TER Bourgogne egy regionális vasúthálózat Franciaországban, a Burgundia régióban. Az összesen 18 vonalat alkotó hálózat 126 állomást szolgál ki, hossza 1139 km."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%82%A7%E3%83%AB%E3%83%88%E3%83%98%E3%83%AB%E3%83%B3%E3%83%8F%E3%83%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Bundesarchiv_Bild_183-E12359%2C_M%C3%BCnchen%2C_Adolf_Hitler_vor_Feldherrenhalle.jpg","page_title":"フェルトヘルンハレ","context_page_description":"フェルトヘルンハレは、ドイツのミュンヘン市内のオデオン広場の南側、ルートヴィヒ街に面した場所に設置されているロッジア。日本語では将軍廟や将軍堂の訳語がある。背後となる南側にはプライジング宮殿があり、西側にはテアティナー教会が存在する。"},{"page_url":"https://ru.wikipedia.org/wiki/Cjdns","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Cjdns_logo.png","page_title":"Cjdns","context_page_description":"Cjdns — сетевой протокол и его реализация, с помощью которого можно создать масштабируемую, безопасную и простую в настройке сеть. Сеть может работать как поверх интернет-соединения, так и между маршрутизаторами напрямую."},{"page_url":"https://fi.wikipedia.org/wiki/Kallahdenharju","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Kallahdenharju.jpg","page_title":"Kallahdenharju","context_page_description":"Kallahdenharju on harju Kallahdessa, Helsingin itäosassa. Harju syntyi 12 000 vuotta sitten mannerjäätikön sulamisvesien kasaamana. Se muodostaa kannaksen, joka yhdistää Kallahdenniemen mantereeseen. Harju jatkuu mereen vedenalaisilla hiekkasärkillä ja hiekkapohjana. Vedenalaisen harjun korkeimmat kohdat ovat nyt saaria, kuten Santinen ja Iso Leikosaari. Kallahdenharju kuuluu Kallahdenharjun luonnonsuojelualueeseen, joka rauhoitettiin vuonna 1973."},{"page_url":"https://cs.wikipedia.org/wiki/%C3%9Eingvallavatn","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Thingvallavatn.jpg","page_title":"Þingvallavatn","context_page_description":"Þingvallavatn je jezero na jihozápadě Islandu, největší na ostrově. Má rozlohu 82,6 km² a dosahuje maximální hloubky 114 m. Leží v nadmořské výšce 103 m v tektonické propadlině uprostřed vulkanického plató."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9C%A8%E6%B0%B8%E6%81%86%E4%B9%8B%E9%96%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Vincent_van_Gogh_-_Weeping_Woman_%28F1069%29.jpg","page_title":"在永恆之門","context_page_description":"《在永恆之門》，或稱《悲痛的老人》是一幅梵谷1890年5月初在聖雷米精神病院完成的油畫， 此畫基於其1882年在海牙繪成的鉛筆草稿完成，畫中人物是一名名叫「Adrianus Jacobus Zuyderland」老兵。 而原畫的靈感來源則是休伯特·馮·赫科默繪製的畫作《切爾西醫院的星期日》。\\n畫中的老兵坐在爐火旁，雙手掩面。這可能也表現出了畫家創作時的悲痛心情及畫家對神與永恆的信仰，而這些事物的難以感知實際也是其悲痛的來源，這一點在其早年的書信中就可以看出。"},{"page_url":"https://de.wikipedia.org/wiki/Eisenerzbergbau_in_Western_Australia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Mount_Tom_Price_mine%2C_September_2006.jpg","page_title":"Eisenerzbergbau in Western Australia","context_page_description":"Der Eisenerzbergbau in Western Australia ist ein bedeutender wirtschaftlicher Faktor für Australien. In Western Australia befindet sich das zweitgrößte Vorkommen von Eisenerz auf der Erde und 2010/2011 wurden 98 % aller australischen Eisenerze in Western Australia produziert.\\nDer Abbau wird von den zwei Bergbau-Konzernen Rio Tinto Group und BHP Billiton dominiert, die mehr als 90 % aller australischen Eisenerze in der Abrechnungsperiode 2008/2009 produzierten. Der drittgrößte dort aktive Konzern ist die Fortescue Metals Group.\\nNach China war Australien 2010 weltweit der zweitgrößte Eisenerzproduzent, wobei der größte Anteil des australischen Eisenerz-Exports nach China verschifft wurde. Mit einem Anteil von 72 % dominieren die australische Rio Tinto und BHP Billiton und die brasilianische Vale den Seehandel mit Eisenerz.\\nMit dieser Ausfuhr von Bodenschätzen ist eine starke Abhängigkeit staatlicher Einnahmen von der Weltkonjunktur gegeben, denn aus dem Verkauf des produzierten Eisenerzes realisiert Western Australia AUD 1,7 Milliarden."},{"page_url":"https://sv.wikipedia.org/wiki/Echinopsis_lageniformis","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Echinopsis_lageniformis_%28riomizquensis%29.jpg","page_title":"Echinopsis lageniformis","context_page_description":"Echinopsis lageniformis är en kaktusväxtart som först beskrevs av C.F. Först., och fick sitt nu gällande namn av H. Friedrich och Gordon Douglas Rowley. Echinopsis lageniformis ingår i släktet Echinopsis och familjen kaktusväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://simple.wikipedia.org/wiki/Indian_Rebellion_of_1857","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Mutiny_Memorial%2C_Jhansi_1900.jpg","page_title":"Indian Rebellion of 1857","context_page_description":"The Indian Rebellion of 1857 is also called the Indian Mutiny, the Sepoy Mutiny, India's First War of Independence or India's first struggle for independence. It began on 10 May 1857 at Meerut, as a mutiny of sepoys of the British East India Company's army. Sepoys in the Presidency of Bengal revolted against their British officers."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%83%DA%86%D9%8A%D9%84_%D9%88%D8%B1%D9%8A%D8%AA%D9%84%D9%8A%D9%86%D8%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Kjell_Wretling.jpg","page_title":"كچيل وريتلينج","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nكچيل وريتلينج كان مهندس من السويد."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%BE%8E%E6%B9%96%E8%A7%80%E9%9F%B3%E4%BA%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/%E6%BE%8E%E6%B9%96%E8%A7%80%E9%9F%B3%E4%BA%AD%EF%BD%9C%E4%BA%A6%E5%BE%A9%E5%A6%82%E6%98%AF%E5%8C%BE.jpg","page_title":"澎湖觀音亭","context_page_description":"澎湖观音亭，位于马公市中兴里，古称观音庙，光绪年后才泛称观音亭，阖澎公庙之一。\\n当地人今称“观音亭”有两层意思，广义泛指涵盖观音亭佛寺与整片海景的海水浴场，狭义则单指佛刹观音亭。"},{"page_url":"https://es.wikipedia.org/wiki/Biota_del_periodo_Ediac%C3%A1rico","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4a/Cyclomedusa_cropped.jpg","page_title":"Biota del periodo Ediacárico","context_page_description":"Los organismos ediacáricos, también conocidos como biota del periodo Ediacárico o, anteriormente, biota o fauna vendiense, son antiguas formas de vida sésiles con forma tubular y de hoja que habitaron la Tierra durante el periodo Ediacárico y que representan los organismos multicelulares complejos más antiguos conocidos dentro del nivel macrocelular de complejidad biológica.​ Aparecieron poco después de que concluyese la extensa y última glaciación del periodo Criogénico, y se extinguieron en su mayoría poco antes del abrupto incremento en la biodiversidad terrestre conocido como explosión cámbrica, que consistió en la primera aparición en el registro fósil de los patrones y morfologías básicas que más adelante supondrían la base de los animales modernos. Pocos elementos propios de la diversidad de los organismos ediacáricos fueron incorporados a estos patrones, y los distintos organismos del Cámbrico desplazaron y reemplazaron totalmente a las formas de vida que habían dominado el registro fósil Ediacara.\\nLos organismos ediacáricos aparecieron por primera vez hace unos 580 millones de años y prosperaron a comienzos del Cámbrico, hace 542 millones de años."},{"page_url":"https://de.wikipedia.org/wiki/Amazonasbecken","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Amazonasbecken.png","page_title":"Amazonasbecken","context_page_description":"Als Amazonasbecken, Amazonastiefland oder Amazonien wird das Einzugsgebiet des Amazonas, des Rio Anapu und des Rio Tocantins bezeichnet. Es bedeckt fast die gesamte nördliche Hälfte des Kontinents Südamerika. Der Amazonas hat weltweit mit Abstand die größte Wasserschüttung.\\nDiese größte Stromebene Südamerikas, eine äquatoriale Regenwald-Tiefebene, erhält die sie formenden Wasser zuvorderst aus den Anden. Die Hauptflussrichtung weist dort zunächst nach Norden und wechselt dann quer über den gesamten Kontinent nach Osten. Nördlich liegt die durch die Bergländer Guayanas getrennte Orinoco-Ebene, wobei jedoch über den Casiquiare eine Verbindung zwischen den Flusssystemen des Amazonas und des Orinoco besteht. Südlich liegt die Ebene des Río Paraguay und Paraná."},{"page_url":"https://it.wikipedia.org/wiki/Hacelia_attenuata","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Hacelia_attenuata.jpg","page_title":"Hacelia attenuata","context_page_description":"Hacelia attenuata, conosciuta comunemente come stella arancio, è una stella marina della famiglia Ophidiasteridae."},{"page_url":"https://en.wikipedia.org/wiki/Hurricane_Kyle_(2008)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/Ex_Kyle_Sep_29_1753Z.jpg","page_title":"Hurricane Kyle (2008)","context_page_description":"Hurricane Kyle was a Category 1 hurricane that caused heavy rain and flooding in Puerto Rico in its formative stage and brought hurricane-force winds to Nova Scotia while extratropical.The eleventh tropical storm and sixth hurricane of the 2008 Atlantic hurricane season, Kyle formed from a strong tropical disturbance that tracked across the northeastern Caribbean Sea in the third week of September. As a low pressure area, it moved slowly across Puerto Rico and Hispaniola, dumping torrential rains across those islands.\\nBy September 24, it began to track northward away from the islands, and developed enough strong thunderstorm activity near its center and a well-defined enough circulation to be deemed a tropical storm on September 25. It strengthened to a hurricane on September 27 west of Bermuda. It made landfall in Nova Scotia as a Category 1 hurricane late on September 28, then became extratropical shortly afterward.\\nThe precursor to Kyle produced torrential rainfall over Puerto Rico, resulting in six fatalities and $48 million in damages. Little impact was recorded in Hispanola and Bermuda as the system tracked northward."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BB%D1%96_%D0%9A%D1%83%D1%81%D0%BA%D1%96%D0%B2%D1%86%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/%D0%9C%D0%B5%D0%BC%D0%BE%D1%80%D1%96%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D0%BF%D0%B0%D0%BC%27%D1%8F%D1%82%D0%BD%D0%B8%D0%BA.jpg","page_title":"Малі Кусківці","context_page_description":"Малі́ Ку́сківці — село Лановецького району Тернопільської області. Розташоване на сході району. Підпорядковане Лановецькій міській раді.\\nДавня назва — Куськівці."},{"page_url":"https://ca.wikipedia.org/wiki/Ferdinand_Marcos","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Ferdinand_Marcos.JPEG","page_title":"Ferdinand Marcos","context_page_description":"Ferdinand Emmanuel Edralin Marcos va ser un polític i advocat filipí. President de la República de Filipines.\\nVa estudiar dret a la Universitat de les Filipines. Acusat en 1939 de l'assassinat d'un oponent del seu sogre, fet esdevingut sis anys abans, va apel·lar davant del Tribunal Suprem Filipí i va ser absolt el 1940. Va arribar a exercir l'advocacia a Manila i durant la Segona Guerra Mundial va ser oficial de l'exèrcit del seu país. Posteriorment va afirmar haver exercit un paper essencial en el moviment de resistència filipí, la qual cosa va contribuir en bona part al seu èxit polític, encara que després de la seva mort es va demostrar que amb prou feines havia participat en les activitats contra els japonesos entre 1942 i 1945. El 1946 va passar a ser ajudant del primer president de la República independent de Filipines, Manuel Roxas. Va ser membre de la Casa de Representants durant deu anys i després va formar part del Senat. El 1954 es va casar amb Imelda Marcos qui va ser sempre la seva principal consellera."},{"page_url":"https://no.wikipedia.org/wiki/Klemmeknuter","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Topsegelschotstek.jpg","page_title":"Klemmeknuter","context_page_description":"Klemmeknuter, eller friksjonsknuter, er en rekke knuter som etterligner måten handen griper et tau.\\nKlemknute er den friksjonsknuten som er symmetrisk; det finnes andre friksjonsknuter som bærer navn som Valdotain, Klemheist, Hedden, Blakes, Distel, Bachmann, Knut, Todd-Kramer, Schwabisch, Icicle, Autoblock-Machard, Farimond, Michoacan-Martin."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A0%CF%8D%CF%81%CE%B3%CE%BF%CF%82_%CE%A3%CE%BF%CE%B3%CE%B9%CE%B5%CE%BC%CF%80%CE%B9%CE%BA%CE%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Kazan_Soyembika.jpg","page_title":"Πύργος Σογιεμπικά","context_page_description":"Ο Πύργος Σογιεμπικά, επίσης γνωστό ως Τζαμί του Χάνου, είναι ίσως το πιο γνωστό ορόσημο και αρχιτεκτονικό σύμβολο του Καζάν. Στο παρελθόν αποτελούσε το υψηλότερο κτίριο του κρεμλίνου της πόλης, που ήταν γνωστό για τους επομοναζόμενους κεκλιμένους πύργους. Στις αρχές του 20ου αιώνα, η κλίση υπολογίστηκε σε 194 εκατοστά. Ποικίλες μέθοδοι σταθεροποίησης χρησιμοποιήθηκαν για να ισιώσει ο πύργος στη δεκαετία του 1930 και της δεκαετίας του 1990, και δεν γέρνει περισσότερο.\\nΗ ημερομηνία κατασκευής είναι άγνωστη. Αρκετοί μελετητές θέτουν την ημερομηνία κατασκευής του στο τέλος του 17ου και 18ου αιώνα, όταν οι κλιμακωτοί πύργοι ήταν εξαιρετικά δημοφιλείς στη Ρωσία. Άλλοι θέτουν την ημερομηνία κατασκευής στον 16ο αιώνα, πιθανώς πριν το 1552.\\nΣύμφωνα με ένα θρύλο ο πύργος χτίστηκε πάνω από έναν αιώνα νωρίτερα από τους τεχνίτες του Ιβάν του Τρομερού σε μόλις μια εβδομάδα. Όπως λέει ο θρύλος, η βασίλισσα του Καζάν Σογιεμπικά έπεσε από τον υψηλότερο όροφο, απ'όπου πήρε και το όνομά του. Αυτός ο μύθος δε σχετίζεται με την πραγματική ιστορία του πύργου επειδή η Σογιεμπικά συνελήφθη με τη βία από τις Μοσχοβιτικές δυνάμεις το 1551 και μετακόμισε στην πόλη του Κασίμοφ και πέθανε χρόνια αργότερα."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AA%DB%8C%D9%81%D8%A7%D9%86%DB%8C%E2%80%8C%D8%AF%D9%87_%D8%B3%D8%AD%D8%B1_%DB%8C%D8%A6%D9%85%D9%87_%DB%8C%DB%8C_(%D9%81%DB%8C%D9%84%D9%85%D8%8C_%DB%B1%DB%B9%DB%B6%DB%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Audrey_Hepburn_Tiffany%27s_4.jpg","page_title":"تیفانی‌ده سحر یئمه یی (فیلم، ۱۹۶۱)","context_page_description":"تیفانی‌ده سحر یئمه یی نده دۇزلمیش دراماتیک رومانتیک کومدی قیسا فیلم. فیلمین باش روْللارینی میکی رونی، مارتین بالسام، بادی ابسن، پاتریشا نیل، جرج پپارد، آدری هپبورن جانلاندیریب. فیلمین موسیقیسین هنری مانچینی یارادیب."},{"page_url":"https://pt.wikipedia.org/wiki/%C5%98%C3%ADkovice","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/%C5%98%C3%ADkovice%2C_%C5%BEelezni%C4%8Dn%C3%AD_stanice.jpg","page_title":"Říkovice","context_page_description":"Říkovice é uma comuna checa localizada na região de Olomouc, distrito de Přerov."},{"page_url":"https://cy.wikipedia.org/wiki/Bras_tai","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Common_reed_bunting_%28emberiza_schoeniclus%29_m.jpg","page_title":"Bras tai","context_page_description":"Aderyn a rhywogaeth o adar yw Bras tai a adnabyddir hefyd gyda'i enw gwyddonol Emberiza striolata; yr enw Saesneg arno yw House bunting. Mae'n perthyn i deulu'r Breision sydd yn urdd y Passeriformes.\\nTalfyrir yr enw Lladin yn aml yn E. striolata, sef enw'r rhywogaeth. Mae'r rhywogaeth hon i'w chanfod yn Asia ac Affrica."},{"page_url":"https://nl.wikipedia.org/wiki/Osheaga_Festival","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Osheaga_2017_foster_the_people_2017-08-06.jpg","page_title":"Osheaga Festival","context_page_description":"The Osheaga Music and Arts Festival is een meerdaags indiemuziekfestival in Montreal, Quebec, dat elke zomer wordt gehouden in Parc Jean-Drapeau op Île Sainte-Hélène. Het festival vindt plaats op zes podia met verschillende publiekscapaciteiten. Vertaald uit hun Franse equivalenten, worden ze \\"Rivierpodium\\", \\"Bergpodium\\", \\"Groen Podium\\", \\"Bomenpodium\\", \\"Valleipodium\\" en \\"Zone Piknic Electronik\\" genoemd. Elk prestatiegebied is gekoppeld aan een sponsor. Beginnende of opkomende artiesten spelen sets van 30 minuten en de hoofdacts sluiten elke dag af met sets van 90 minuten plus. Het festival trok ongeveer 25.000 mensen bij zijn eerste editie. Het festival 2012 bereikte elke dag zijn 40.000 bezoekerscapaciteit."},{"page_url":"https://en.wikipedia.org/wiki/Sarvastivada","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Kalawan_copper-plate_inscription_of_the_year_134.jpg","page_title":"Sarvastivada","context_page_description":"The Sarvāstivāda was one of the early Buddhist schools established around the reign of Asoka. It was particularly known as an Abhidharma tradition, with a unique set of seven Abhidharma works.\\nThe Sarvāstivādins were one of the most influential Buddhist monastic groups, flourishing throughout North India and Central Asia until the 7th century. The orthodox Kashmiri branch of the school composed the large and encyclopedic Mahāvibhāṣa Śāstra around the time of the reign of Kanishka. Because of this, orthodox Sarvāstivādins who upheld the doctrines in the Mahāvibhāṣa were called Vaibhāṣikas.\\nThe Sarvāstivādins are believed to have given rise to the Mūlasarvāstivāda sect as well as the Sautrāntika tradition, although the relationship between these groups has not yet been fully determined."},{"page_url":"https://war.wikipedia.org/wiki/Zhou_Enlai","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/%E5%9C%8B%E5%85%B1%E5%85%A7%E6%88%B0%E6%99%82%E6%9C%9F%E5%91%A8%E6%81%A9%E4%BE%86.jpg","page_title":"Zhou Enlai","context_page_description":"Hi Zhou Enlai, kilado gihapon ha ngaran nga Zhou Xiangyu, amo an syahan nga Premier han Kanan Katawhan Republika han Tsina. Hi Zhou amo an namuno han kagamhanan han Tsina, nga nag-alagad tikang han Oktubre 1949 kutob han iya kamatayan han Enero 1976. Nagsirbe hi Zhou ha ilarom ni Chairman Mao Zedong ngan amo an nagin-paagi han pagsaká ha poder han Partido Komunista, ngan ha urhe nga panahon han pagpayubos han pagdumara hiní, nga diin hiyá an naghimo han polisiya panlangyaw, ngan pagpadukwag han Tsino nga ekonomiya.\\nUsá nga makarit ngan takos nga diplomata hi Zhou nga nagsirbe komo ministro hin panlangyaw tikang 1949 kutob 1958. Nagbandilyo hiyá hin mamurayaw nga ko-existensya ngan han Katundan katapos han Gera Koreano, tinmambong hiyá han 1954 nga Komperensya ha Ginebra ngan han 1955 nga Komperensya ha Bandung, ngan nagbúlig hiyá han pag-arreglar han kan Richard Nixon bisita han 1972 ha Tsina. Nagbúlig hiyá paghímò hin mga polisiya mahiunong han mga mapait nga mga pagkabangga han Estados Unidos, han Taiwan, han Unyon Sovyetika, han India ngan han Vietnam.\\nWaray mahiapil hi Zhou han pagpurga han iba nga mga igbaw nga mga opisyal dida han Rebolusyon Kultural."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%95%E0%B5%87%E0%B4%B0%E0%B4%B3%E0%B4%A4%E0%B5%8D%E0%B4%A4%E0%B4%BF%E0%B4%B2%E0%B5%86_%E0%B4%AA%E0%B4%BE%E0%B4%AE%E0%B5%8D%E0%B4%AA%E0%B5%81%E0%B4%95%E0%B5%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/AB098_Elaphe_helena.JPG","page_title":"കേരളത്തിലെ പാമ്പുകൾ","context_page_description":"ശീതരക്തമുള്ള ഇനം ഉരഗങ്ങളാണ് പാമ്പുകൾ. പ്രധാനമായും ഏഴ് കുടുംബങ്ങളിൽപ്പെട്ട പാമ്പുകളാണ് കേരളത്തിൽ കാണപ്പെടുന്നത്. എലാപ്പിഡേ, വൈപ്പറിഡേ, കൊളുബ്രിഡേ, ബോയ്ഗണേ, പൈത്തോണിഡേ, യൂറോപെൽറ്റിഡേ, ബോയ്ഡേ എന്നിവയാണ് പ്രധാനപ്പെട്ട കുടുംബങ്ങൾ. എലാപ്പിഡേ, വെപ്പറിഡേ കുടുംബത്തിൽ വിഷമുള്ള ഇനം പാമ്പുകളും കൊളുബ്രിഡേ, ബോയ്ഗണേ, പൈത്തോണിഡേ, യൂറോപെൽറ്റിഡേ, ബോയ്ഡേ എന്നീ അഞ്ചു കുടുംബങ്ങളിൽ വിഷമില്ലാത്ത ഇനം പാമ്പുകളുമാണ് ഉൾപ്പെടുന്നത്. പെരുമ്പാമ്പുകൾ ഉൾപ്പെടുന്ന കുടുംബമാണ് പൈത്തോണിഡേ. ഇങ്ങനെ ആകെ നൂറ് ഇനം പാമ്പുകളാണ് കേരളത്തിള്ളത്. ഇതിൽ 90% പാമ്പുകളും വിഷമില്ലാത്തവയാണ്. കേരളത്തിൽ നാലിനം പാമ്പുകൾക്കാണ് മനുഷ്യജീവൻ അപഹരിക്കാൻ കഴിയുന്നത്. ഇവ യഥാക്രമം:\\n1. രാജവെമ്പാല\\n2. അണലി\\n3. മൂർഖൻ\\n4. ശംഖുവരയൻ\\nഇവയ്ക്കു പുറമെ മനുഷ്യമരണത്തിന് കാരണമാകാത്തതും വിഷമുള്ളതുമായ 20 ഓളം പാമ്പുകളും കേരളത്തിൽ കണ്ടുവരുന്നു. അണലിവർഗ്ഗക്കാരായ ചുരുട്ട മണ്ഡലി, പാറമണ്ഡലി, മുളമണ്ഡലി തുടങ്ങിയവ ഇതിന് ഉദാഹരണങ്ങളാണ്"},{"page_url":"https://bg.wikipedia.org/wiki/2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/James_Rebhorn_at_the_2009_Tribeca_Film_Festival.jpg","page_title":"2014","context_page_description":"2014 година е обикновена година, започваща в сряда според Григорианския календар.\\nООН обявява 2014 за година на семейното фермерство, на малките островни развиващи се държави и на кристалографията.\\nСъответства на:\\n1463 година по Арменския календар\\n6765 година по Асирийския календар\\n2965 година по Берберския календар\\n1376 година по Бирманския календар\\n2558 година по Будисткия календар\\n5774 – 5775 година по Еврейския календар\\n2006 – 2007 година по Етиопския календар\\n1392 – 1393 година по Иранския календар\\n1435 – 1436 година по Ислямския календар\\n4710 – 4711 година по Китайския календар\\n1730 – 1731 година по Коптския календар\\n4347 година по Корейския календар\\n2767 години от основаването на Рим\\n2557 година по Тайландския слънчев календар\\n103 година по Чучхе календара"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_F%C3%BCrth-Stadeln","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/F%C3%BCrth_Stadeln_Romminggasse_9_001.JPG","page_title":"Liste der Baudenkmäler in Fürth-Stadeln","context_page_description":"In der Liste der Baudenkmäler in Stadeln sind die Baudenkmäler im Fürther Ortsteil Stadeln aufgelistet. Zu diesen Baudenkmälern gibt es auch eine Bildersammlung.\\nDiese Liste ist eine Teilliste der Liste der Baudenkmäler in Fürth. Grundlage der Liste ist die Bayerische Denkmalliste, die auf Basis des bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt und aktualisiert wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://eo.wikipedia.org/wiki/Saint-P%C3%A9e-sur-Nivelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Saint-P%C3%A9e-sur-Nivelle_Eglise.jpg","page_title":"Saint-Pée-sur-Nivelle","context_page_description":"Saint-Pée-sur-Nivelle estas franca komunumo situanta en la departemento Pyrénées-Atlantiques, en la regiono Nova Akvitanio kaj en la Nord-Eŭska historia provinco Lapurdo, ĉe la piedo de Pireneoj, proksime al la Kantabra Maro.\\nEl administracia vidpunkto ĝi dependas de la Arondismento de Bayonne kaj de la kantono de Ustaritz.\\nEn la Mezepoko, La komunumo estis konata sub la nomo St Pierre d'Ibarren aŭ St Petrus divarren.\\nTrairita de la rivero Nivelle, ĝi ankaŭ enhavas Lagon de Saint-Pée-sur-Nivelle destinitan al turismo kaj ripozo. Ĝi havas limojn norde kun Ahetze kaj Arcangues, okcidente kun Saint-Jean-de-Luz kaj Ascain, sude kun Sare kaj oriente kun Ustaritz, Souraïde kaj Ainhoa.\\nĈiujare ekde la 1980-aj jaroj estas celebrata meze de majo \\"Herri Urrats\\" aŭ festo de la \\"ikastola\\" de Nord-Eŭskio, kiu okazas sur la lago de Senpere kiun ĉeestas pluraj dekmiloj da partoprenantoj.\\nTemas, ankaŭ, pri unu el la komunumoj produktantaj \\"Paprikon de Espelette\\".\\nEn Senpere ripozas la mortaj restaĵoj de la poeto Tristan Derème."},{"page_url":"https://en.wikipedia.org/wiki/Military_equipment_of_the_Czech_Republic","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Land_Rover_110_ST_Iafeto_%282%29.jpg","page_title":"Military equipment of the Czech Republic","context_page_description":"This is a list of military equipment of the Czech Republic currently in service and in storage. This includes weapons and equipment of the Armed Forces of the Czech Republic, with the Army of the Czech Republic and its service branches, namely the Czech Land Forces and Czech Air Force, at their core."},{"page_url":"https://sv.wikipedia.org/wiki/Tr%C3%A4dskator","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Rufous_Treepie_I_IMG_9136.jpg","page_title":"Trädskator","context_page_description":"Trädskator är ett släkte av fåglar som tillhör familjen kråkfåglar.\\nDet skiljer sig från familjens övriga medlemmar genom de två starkt förlängda mellersta stjärtpennorna samt genom långa vingar och krökt näbb med hakformig spets. Fjädrarna är praktfullt färgade.\\nSläktet omfattar sju arter som förekommer från Himalaya till Taiwan och till Stora Sundaöarna:\\nOckrabukig trädskata\\nSumatraträdskata\\nBorneoträdskata\\nGrå trädskata\\nVitbukig trädskata\\nSvartmaskad trädskata\\nAndamanträdskata"},{"page_url":"https://da.wikipedia.org/wiki/Hyrdefugle","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Zoo_Am%C3%A9rica-2897-Chauna_torquata.jpg","page_title":"Hyrdefugle","context_page_description":"Hyrdefugle er en familie af fugle med tre arter.\\nHyrdefugle\\nAnhima\\nToppet Chaja\\nSorthalset Chaja"},{"page_url":"https://en.wikipedia.org/wiki/Azerbaijani_manat","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/100_Azerbaijani_manat_in_2005_Reverse.jpg","page_title":"Azerbaijani manat","context_page_description":"The manat is the currency of Azerbaijan. It is subdivided into 100 qəpik.\\nThe Azerbaijani manat symbol, ₼, was assigned to Unicode U+20BC in 2013. A lowercase m can be used as a substitute for the manat symbol."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BC%D0%BB%D0%B5%D0%BA%D0%BE%D0%BF%D0%B8%D1%82%D0%B0%D1%8E%D1%89%D0%B8%D1%85_%D0%AD%D0%BA%D0%B2%D0%B0%D0%B4%D0%BE%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Dv%C3%A6rgsilkeabe_Callithrix_pygmaea.jpg","page_title":"Список млекопитающих Эквадора","context_page_description":"Этот список является списком видов млекопитающих, записанных в Эквадоре, в том числе, Галапагосских островах. Из 401 указанного в таблице вида, 3 вида считается вымершими, 3 находятся в критическом положении, 13 находятся под угрозой исчезновения, 32 являются уязвимыми, и 17 под угрозой.\\nСледующие теги используются для выделения охранного статуса каждого вида по оценкам МСОП:"},{"page_url":"https://ro.wikipedia.org/wiki/Lista_monumentelor_istorice_din_jude%C8%9Bul_Bra%C8%99ov_-_C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/RO_BV_Biserica_evanghelica_din_Cata_%2859%29.jpg","page_title":"Lista monumentelor istorice din județul Brașov - C","context_page_description":"Lista monumentelor istorice din județul Brașov - C cuprinde monumentele istorice înscrise în Patrimoniul cultural național al României și aflate în localități ce încep cu litera C din județul Brașov.\\nLista completă este menținută și actualizată periodic de către Ministerul Culturii, Cultelor și Patrimoniului Național din România, prin intermediul Institutului Național al Patrimoniului, ultima versiune datând din 2015. Această listă cuprinde și actualizările ulterioare, realizate prin ordin al ministrului culturii."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%AF%8C%E7%88%BE%E9%A0%93_(%E5%8A%A0%E5%88%A9%E7%A6%8F%E5%B0%BC%E4%BA%9E%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/FultonWelcome.jpg","page_title":"富爾頓 (加利福尼亞州)","context_page_description":"富爾頓是位於美國加利福尼亞州索諾馬郡的一個人口普查指定地區。"},{"page_url":"https://eo.wikipedia.org/wiki/Condom","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Condom_Gers_le_port.jpg","page_title":"Condom","context_page_description":"Condom estas franca komunumo kaj subprefektejo de la departemento Gers, en la regiono Sudo-Pireneoj. Ĝi havis 7 012 loĝantojn en la jaro 2010."},{"page_url":"https://ca.wikipedia.org/wiki/Langenhorn","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Stadthaus_Langenhorner_Ch.115_frontal.jpg","page_title":"Langenhorn","context_page_description":"Langenhorn, en baix alemany Langenhoorn és un barri del bezirk d'Hamburg-Nord a la ciutat estat d'Hamburg a Alemanya. El 2011 tenia 41.459 habitants sobre una superfície de 13,8 km². Es troba al nord de la ciutat entre el Tarpenbek a l'oest, el Raakmoorgraben al sud i la frontera amb Slesvig-Holstein al quarter transfronter d'Ochsenzoll al nord."},{"page_url":"https://sv.wikipedia.org/wiki/Federico_Grabich","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Kazan_2015_-_Victory_Ceremony_100m_freestyle_M_%28cropped%29.JPG","page_title":"Federico Grabich","context_page_description":"Federico Grabich, född 26 mars 1990, är en argentinsk simmare.\\nGrabich tävlade i två grenar för Argentina vid olympiska sommarspelen 2012 i London. Han blev utslagen i försöksheatet på 50 meter frisim och 100 meter ryggsim.\\nVid olympiska sommarspelen 2016 i Rio de Janeiro tävlade Grabich i tre grenar. Han blev utslagen i försöksheatet på 50, 100 och 200 meter frisim."},{"page_url":"https://nn.wikipedia.org/wiki/Mariner_3","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bc/Mariner_3_and_4.jpg","page_title":"Mariner 3","context_page_description":"Mariner 3 var den tredje romsonda i det Amerikanske Marinerprogrammet. Den vart skoten opp 5. november, 1964 på veg til planeten Mars. Sonden gjekk tapt då den skyddande skjermen rundt ikkje opna seg skikkeleg og batteriet ikkje fekk nok straum frå solcellepanela. Mariner 3 går no istaden i bane rundt sola. 3 veker etter oppsytinga av Mariner 3, vart Mariner 4 skoten opp og flaug vellykka forbi Mars.\\nDenne astronomiartikkelen er ei spire. Du kan hjelpe Nynorsk Wikipedia gjennom å utvide han."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%A1%E3%83%AA%E3%82%AB%E7%A9%BA%E8%BB%8D%E3%81%AE%E8%88%AA%E7%A9%BA%E5%9B%A3%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/28th_Bomb_Wing.png","page_title":"アメリカ空軍の航空団一覧","context_page_description":"アメリカ空軍の航空団一覧は、アメリカ空軍において編成されている航空団の一覧である。\\nアメリカ空軍の航空団は、序数航空軍隷下の作戦部隊で、航空団は隷下に1個以上の飛行隊を擁しており、航空団と飛行隊の中間組織として作戦群が編成されている場合も多い。なお、航空団は主要軍団直轄部隊もある。"},{"page_url":"https://la.wikipedia.org/wiki/Civitates_Atlanticae_Mediae","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/NYC_wideangle_south_from_Top_of_the_Rock.jpg","page_title":"Civitates Atlanticae Mediae","context_page_description":"Civitates Atlanticae Mediae, etiam civitates Atlanticae aliquando appellatae, sunt regio Civitatum Foederatarum, inter Novam Angliam et Civitates Atlanticae Meridianae plerumque sita. Definitio exacta fonte variatur, sed regio saepe civitates Delavariam, Terram Mariae, Novam Caesaream, Pennsylvaniam, Vasingtoniam, Novum Eboracum, Virginiam, et Virginiam Occidentalem comprehendit. Carolina Septentrionalis aliquando inter eas comprehenditur. Haec regio partes magni momenti in evolutione culturae, commercii, mercaturae, et industriae in Civitatibus Foederatis egit.\\nRegio \\"usitate Americana\\" regio a Friderico Jackson Turner appellabatur. Pluralismus religiosa et diversitas ethnica graves societatis Medii Atlantici proprietates fuerunt, a deductione primarum coloniarum a Nederlandensibus, Sueticis, Catholicis Anglicis, et Tremebundis usque ad tempus dominationis Britanniarum Regni ac post. Rebus Novis Americanis confectis, regio Civitatum Atlanticarum Mediarum facta est locus cuiusque capitis historici Civitatum Foederatarum, inter quae Vasingtonia, hodiernum caput foederale."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A1%CF%8C%CE%BF%CF%85%CE%B6_%CE%9A%CE%AD%CE%BD%CE%B5%CE%BD%CF%84%CE%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Rose_Kennedy_1967.JPG","page_title":"Ρόουζ Κένεντι","context_page_description":"Η Ρόουζ Κένεντι ήταν Αμερικανίδα φεμινίστρια και σοσιαλίστρια καθώς και μητέρα της Οικογένειας Κένεντι. Ήταν πολύ καλά μυημένη στα μυστικά του Ιρλανδικού Καθολικού Δόγματος της Βοστώνης όπου ο πατέρας της, ο Τζον Φιτζέραλντ ήταν Δήμαρχος. Ήταν σύζυγος του Τζόζεφ Πάτρικ Κένεντι ο οποίος ήταν Πρέσβης των ΗΠΑ στο Ηνωμένο Βασίλειο. Η Πρεσβεία των ΗΠΑ στο Ηνωμένο Βασίλειο στεγαζόταν στο χώρο του Δικαστηρίου του Αγίου Δημητρίου. Τρία απ' τα 9 παιδιά που απέκτησε το ζεύγος Κένεντι ήταν ο 35ος Πρόεδρος των ΗΠΑ Τζον Φιτζέραλντ Κένεντι, ο Γερουσιαστής και υποψήφιος για την Προεδρία το 1968 με το Κόμμα των Δημοκρατικών Ρόμπερτ Κένεντι και ο επίσης Γερουσιαστής Τεντ Κένεντι."},{"page_url":"https://de.wikipedia.org/wiki/Burg_Hohenneuffen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Hohenneuffen_-_Aquarell_von_Eduard_von_Kallee.jpg","page_title":"Burg Hohenneuffen","context_page_description":"Die Burg Hohenneuffen ist die Ruine einer großen Höhenburg oberhalb der Stadt Neuffen im Landkreis Esslingen in Baden-Württemberg."},{"page_url":"https://war.wikipedia.org/wiki/Malpighiales","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Ochna_serrulata1.jpg","page_title":"Malpighiales","context_page_description":"An Malpighiales in uska ordo han Magnoliopsida. An Malpighiales in nahilalakip ha classis nga Magnoliopsida, punoan nga Tracheophyta, ngan regnum nga Plantae. An ordo nga Malpighiales in naglalakip hin 18904 ka mga species, sumala ha Catalogue of Life."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E9%A6%99%E6%B8%AF%E7%B4%85%E5%8D%81%E5%AD%97%E6%9C%83%E7%94%98%E8%BF%BA%E8%BF%AA%E4%B8%AD%E5%BF%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/TheJohnFKennedyCentre_Annex.jpg","page_title":"香港紅十字會甘迺迪中心","context_page_description":"香港红十字会甘乃迪中心位于香港香港岛南区沙湾，由香港红十字会于1967年创立，是香港的一所政府资助的特殊学校，学生主要为身体弱能学童，弱能类别包括大脑痳痹、肌肉营养不良、脊髓神经细胞萎缩、骨科及脊髓疾病等，同时收录使用呼吸机的病童及智障的弱能学童，开设小一至预科，共19班，采用母语教学。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%91%D7%95%D7%A6%D7%AA_%D7%94%D7%9B%D7%9C%D7%91%D7%99%D7%9D_%D7%94%D7%A9%D7%99%D7%9E%D7%95%D7%A9%D7%99%D7%99%D7%9D_%D7%A9%D7%9C_%D7%9E%D7%95%D7%A2%D7%A6%D7%AA_%D7%94%D7%9B%D7%9C%D7%91%D7%A0%D7%95%D7%AA_%D7%94%D7%90%D7%95%D7%A1%D7%98%D7%A8%D7%9C%D7%99%D7%AA_%D7%94%D7%9C%D7%90%D7%95%D7%9E%D7%99%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Malamute-003.jpg","page_title":"קבוצת הכלבים השימושיים של מועצת הכלבנות האוסטרלית הלאומית","context_page_description":"קבוצת הכלבים השימושיים היא קבוצה של גזעי כלבים המשמשת את רוב מועדוני הכלבים המורכבת מכלבים השימושיים לאדם."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%98%C3%ADmskokatolick%C3%A1_farnost_Mlado%C5%A1ovice","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fa/Lhota_Mladosovice-kaplicka.jpg","page_title":"Římskokatolická farnost Mladošovice","context_page_description":"Římskokatolická farnost Mladošovice je územním společenstvím římských katolíků v rámci vikariátu České Budějovice - venkov českobudějovické diecéze."},{"page_url":"https://hu.wikipedia.org/wiki/Ikrjanojei_j%C3%A1r%C3%A1s","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Astrakhanskaya_oblast_Ikryaninskiy_rayon.png","page_title":"Ikrjanojei járás","context_page_description":"Az Ikrjanojei járás Oroszország egyik járása az Asztraháni területen. Székhelye Ikrjanoje."},{"page_url":"https://en.wikipedia.org/wiki/Sisimiut","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Panel_buildings_in_Sisimiut_%283%29.JPG","page_title":"Sisimiut","context_page_description":"Sisimiut, formerly known by its colonial name Holsteinsborg, is the capital and largest city of the Qeqqata municipality, the second-largest city in Greenland, and the largest arctic city in North America. It is located in central-western Greenland, on the coast of Davis Strait, approximately 320 km north of Nuuk.\\nAlthough now the name of the city, Sisimiut literally means \\"the residents at the foxholes\\". The site has been inhabited for the last 4,500 years, first by the Inuit peoples of the Saqqaq culture, Dorset culture, and then the Thule people, whose descendants form the majority of the current population. Artifacts from the early settlement era can be found throughout the region, favored in the past for its plentiful fauna, particularly the marine mammals providing subsistence for the early hunting societies.\\nThe population of modern Greenlanders in Sisimiut is a mix of the Inuit and Danish peoples, who first settled in the area in the 1720s, under the leadership of the Danish missionary, Hans Egede.\\nToday, Sisimiut is the largest business center north of the national capital of Nuuk and is one of the fastest growing cities in Greenland."},{"page_url":"https://es.wikipedia.org/wiki/Lawson_Craddock","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Isbergues_-_Grand_Prix_d%27Isbergues%2C_21_septembre_2014_%28B062%29.JPG","page_title":"Lawson Craddock","context_page_description":"Gregory Lawson Craddock es un ciclista estadounidense, miembro del equipo EF Pro Cycling."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%B5%E0%AE%BF%E0%AE%B2%E0%AF%8D%E0%AE%B2%E0%AF%86%E0%AE%AE%E0%AF%8D_%E0%AE%B0%E0%AF%8B%E0%AE%A3%E0%AF%8D%E0%AE%9F%E0%AF%8D%E0%AE%95%E0%AE%A9%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/X-ray_by_Wilhelm_R%C3%B6ntgen_of_Albert_von_K%C3%B6lliker%27s_hand_-_18960123-02.jpg","page_title":"வில்லெம் ரோண்ட்கன்","context_page_description":"வில்லெம் கோன்ராடு ரோண்ட்கன் என்பவர் ஜெர்மனியைச் சேர்ந்த வூர்ட்ஃசுபர்கு பல்கலைக்கழக இயற்பியலாளர் ஆவார். இவர் நவம்பர் 8, 1895 இல், மின்காந்தக் கதிர்வீச்சு அலைத்தொடர் வரிசையில் ஊடுகதிர் என்று இன்று அழைக்கப்படும் அலைகள் பகுதியைக் கண்டுபிடித்தார். இன்று இவை ஊடுகதிர் அலைகள், X கதிர்கள், புதிர்க்கதிர்கள், ரோண்ட்கன் கதிர்கள் என்று பலவிதமாக அழைக்கப்படுகின்றன. இக்கண்டுபிடிப்பிற்காக இவருக்கு 1901 இல் இயற்பியலுக்கான முதலாவது நோபல் பரிசு வழங்கப்பட்டது."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Worcester_County,_Massachusetts","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/HubbardstonMA_RevSamuelGayHouse.jpg","page_title":"National Register of Historic Places listings in Worcester County, Massachusetts","context_page_description":"This is a list of the National Register of Historic Places designated in Worcester County, Massachusetts. The locations of NRHP properties and districts for which the latitude and longitude coordinates are included below, may be seen in a map.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://ca.wikipedia.org/wiki/W%C4%93ij%C4%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Chinese_word_for_crisis.svg","page_title":"Wēijī","context_page_description":"El mot xinès wēijī és un recurs motivacional en el món occidental arrelat en la falsa creença que està compost pels caràcters que representen els conceptes \\"perill\\" i \\"oportunitat\\" i que, per tant, en tota crisi hi ha una oportunitat. Aquesta creença errònia pot considerar-se una llegenda urbana o un cas d'etimologia popular."},{"page_url":"https://en.wikipedia.org/wiki/Sathon_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Bangkoksoiwanglee0609.jpg","page_title":"Sathon District","context_page_description":"Sathon or Sathorn is one of the 50 districts of Bangkok, Thailand. The district is bounded by six other districts: Bang Rak, Pathum Wan, Khlong Toei, Yan Nawa, Bang Kho Laem, and Khlong San."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%B1%D8%A7%D9%86_%D8%B1%D9%85%D8%A7%D8%AF%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Fraxinus_ornus_JPG2.jpg","page_title":"مران رمادي","context_page_description":"المُران الرمادي نوع نباتي ينتمي إلى جنس المُران من الفصيلة الزيتونية."},{"page_url":"https://de.wikipedia.org/wiki/Sparrige_Flockenblume","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Centaurea_diffusa_5.jpg","page_title":"Sparrige Flockenblume","context_page_description":"Die Sparrige Flockenblume ist eine Pflanzenart aus der Gattung der Flockenblumen innerhalb der Familie der Korbblütler. Centaurea diffusa ist zusammen mit der Rispen-Flockenblume der typische „Steppenläufer“ als Neophyt im Westen der Vereinigten Staaten – die Pflanze bricht oberhalb der Wurzeln ab und verstreut, wenn sie verweht wird, weit und breit ihre Samen."},{"page_url":"https://lt.wikipedia.org/wiki/Juozapas_Ole%C5%A1kevi%C4%8Dius","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/Oleszkiewicz-portrait.jpg","page_title":"Juozapas Oleškevičius","context_page_description":"Juozapas Oleškevičius – lietuvių tapytojas."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%92%B8%F0%A4%A8%92%E6%99%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/150531_MyeongDong_Busking_Concert.jpg","page_title":"咸𤨒晶","context_page_description":"咸𤨒晶，艺名𤨒晶和Elsie，前错译作含恩靜、咸恩靜、咸慇晶，韩国女艺人、饶舌者和主持人，女子流行音乐组合T-ara成员，为队中的第一任队长。\\n𤨒晶在七年级时开始学习跆拳道，并在三个不同比赛中获胜。2007年𤨒晶高中毕业之前，她的妈妈决定辞去𤨒晶所属的经纪公司钢琴教学工作，专职管理𤨒晶的演艺事业。\\n𤨒晶最初为儿童演员，早在1995年参演KBS剧集《看新时代不知道大人》，之后一直有参演电视剧和电影。她在某电影拍摄过程中通过导演介绍与Core Contents Media代表金光洙见面，并加入Mnet Media当练习生，在T-ara出道前三年已加入公司接受训练，因此她是T-ara中资历最深的成员，故在2009年7月29日T-ara正式出道时被选为队长。"},{"page_url":"https://en.wikipedia.org/wiki/Urho_Kekkonen_National_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Urho_Kekkonen_national_park.JPG","page_title":"Urho Kekkonen National Park","context_page_description":"Urho Kekkonen National Park is a national park in Lapland, Finland, situated in area of municipalities of Savukoski, Sodankylä and Inari. Established in 1983 and covering 2,550 square kilometres, it is one of Finland's largest protected areas. It is named after Urho Kekkonen, late President and Prime Minister of Finland.\\nThe Suomujoki river flows through the northern parts of the diverse park. The marked paths in its western part are an easy destination even for the inexperienced backpacker, whereas the wilderness is good for long and demanding trips.\\nMost trips to Urho Kekkonen National Park are started from the Kiilopää fell center, the Aittajärvi lake along the Suomujoki river, or Raja-Jooseppi, and backpackers usually end up nearby the Saariselkä fell line, for instance on the top of its highest fell, Sokosti. Reindeer herding is still a common livelihood in the area."},{"page_url":"https://de.wikipedia.org/wiki/SEV_1011","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/SEV_1011_2009_Hierarchische_System.png","page_title":"SEV 1011","context_page_description":"Die SN 441011, bis 2019 SEV 1011, ist eine Schweizer Norm für Stecker und Steckdosen für den Hausgebrauch.\\nDas einphasige System ist für 250 V Wechselspannung bei 50 Hz normiert und je nach Typ für Ströme bis 10 A beziehungsweise 16 A dimensioniert. Für Geräte mit nominalen Spitzenwerten von 16 A existieren die Stecker Typ 21 und Typ 23 sowie die Steckdose Typ 23 mit rechteckigen Stiften.\\nDas dreiphasige System ist für 250 V/440 V Wechselspannung normiert und für Ströme von entweder 10 A oder 16 A dimensioniert; die Dosen sind nicht nur mit den dreiphasigen Steckern desselben Typs, sondern auch mit den Steckern Typ 12 und Typ 13 kompatibel.\\nBei den Ausführungen mit drei Kontaktstiften ist der mittlere, leicht versetzte Pol der Schutzkontakt. Obwohl die Kontaktstifte gleich lang sind, ist der Schutzkontakt vorauseilend, weil die Buchsen für Neutralleiter und Aussenleiter in der Steckdose tiefer versenkt angebracht sind. Durch die versetzte Anordnung der Kontakte ist eine Verpolungssicherheit gewährleistet. Die Steckdosen sind mit Schutzkragen ausgestattet."},{"page_url":"https://he.wikipedia.org/wiki/%D7%AA%D7%95%D7%AA%D7%97_75_%D7%9E%22%D7%9E_%D7%9E%D7%95%D7%93%D7%9C_1897","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/French_AA_gun_Model_1897_LOC_npcc_19802.jpg","page_title":"תותח 75 מ\\"מ מודל 1897","context_page_description":"תותח 75 מ\\"מ מודל 1897 היה תותח שדה מהיר-ירי ששימש כתותח השדה העיקרי של צבא צרפת במלחמת העולם הראשונה ושימש גם את חיל המשלוח האמריקאי במהלך מלחמה זו. התותח שירת גם לאורך מלחמת העולם השנייה במגוון תצורות. התותח הצטיין במערכת הידרו-פנאומטית לספיגת רתע, בזכותה נותר יציב לחלוטין לאחר ירי ולא התגלגל לאחור. בשל מנגנון הירי שלו איפשר ירי של 15 פגזים בדקה, קצב אש שלא נודע כמותו עד אליו. עד שנות הארבעים יוצרו למעלה מ-20,000 פריטים של התותח. בנוסף למלחמות העולם השתתף התותח במרד הבוקסרים ובמלחמה הפולנית-סובייטית. מלבד צבאות צרפת וארצות הברית השתמשו בו גם צבאות פולין, בלגיה, גרמניה, רומניה, פינלנד ופורטוגל."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%86%D9%8A%D8%A9_%D8%AC%D8%B3%D9%85_%D8%A7%D9%84%D8%A5%D9%86%D8%B3%D8%A7%D9%86_(%D9%83%D8%AA%D8%A7%D8%A8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Fourth_muscle_man%2C_by_Vesalius._Wellcome_L0001647.jpg","page_title":"بنية جسم الإنسان (كتاب)","context_page_description":"بنية جسم الإنسان هي موسوعة طبيَّة من سبعة أجزاء كتبها الطبيب البلجيكي أندرياس فيساليوس ونشرت عام 1543، يعتبر هذا الكتاب تقدماً كبيراً وثورة حقيقية في علم التشريح الذي كان يسيطر عليه جالينوس منذ العصور القديمة.\\nقام فيساليوس بجمع كتابه هذا اعتماداً على المحاضرات التي كان يلقيها في جامعة بادوفا في إيطاليا، والتي كان يقوم بها بطريقة مخالفة للمنهج التقليدي السائد وقتها بالتشريح والذي يعتمد على الإلقاء النظري في أغلب الأحيان، بينما قام فيساليوس بتشريح الجثث بنفسه ودراسة مختلف أعضاء الجسم بشكل مفصَّل، واعتمد على التطورات الفنيَّة والتقنية التي ظهرت في عصر النهضة لإضافة صور دقيقة ورائعة إلى كتابه بشكل يفوق أي كتاب آخر أنتج من قبل.\\nيقول ويليام أوسلر عن كتاب تشريح جسم الإنسان: \\"إنَّه أعظم ما كتب في الطب قاطبةً\\"، وإلى يومنا هذا ما يزال يعتبر أحد أكثر الكتب تأثيراً في تاريخ الطب."},{"page_url":"https://hr.wikipedia.org/wiki/Megadeth","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Megadeth1991AL.jpg","page_title":"Megadeth","context_page_description":"Megadeth je američki heavy metal sastav iz Los Angelesa, Kalifornije. Gitarist Dave Mustaine i basist David Ellefson osnovali su grupu 1983. ubrzo nakon što je Mustaine bio izbačen iz Metallice. Uz Metallicu, Anthrax i Slayer Megadeth je jedan od \\"velike četvorke\\" američkog thrash metala, koja je zaslužna za njegov razvoj i popularizaciju. Njegova glazba sadrži složene aranžmane i brze ritmičke sekcije te tekstove pjesama o smrti, ratu, politici i religiji.\\nMegadethov je album prvijenac, Killing Is My Business... and Business Is Good!, 1985. godine objavila nezavisna diskografska kuća Combat Records te je bio djelomično uspješan. Privukao je pažnju većih izdavača i Megadeth je potpisao ugovor s Capitol Recordsom. Njegov prvi album koji je objavila veća diskografska kuća, Peace Sells... but Who's Buying?, bio je objavljen 1986. godine i utjecao je na podzemnu metal scenu. Megadeth je u to doba bio na lošem glasu zbog zloupotrebe droga i svađa među njegovim članovima.\\nNakon što je postava postala stabilna, Megadeth je objavio nekolicinu albuma koji su postigli platinastu nakladu, među kojima su Rust in Peace i Countdown to Extinction."},{"page_url":"https://de.wikipedia.org/wiki/Salonta","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Katolische_Kirche.jpg","page_title":"Salonta","context_page_description":"Salonta ist nach Oradea die zweitgrößte Stadt im Kreis Bihor im historischen Kreischgebiet in Rumänien."},{"page_url":"https://en.wikipedia.org/wiki/Rochet","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Abbatia_CIST_Sbernadiensis_27a.jpg","page_title":"Rochet","context_page_description":"A rochet is a white vestment generally worn by a Roman Catholic or Anglican bishop in choir dress. It is unknown in the Eastern churches. The rochet in its Roman form is similar to a surplice, except that the sleeves are narrower. In its Anglican form it is a descendant of the traditional albs worn by deacons and priests. In the Roman Catholic tradition, the rochet comes below the knee and its sleeves and hem are sometimes made of lace; in the Anglican tradition, the rochet comes down almost to the hem of the cassock and its sleeves are gathered at the wrist.\\nThe word stems from the Latin rochettum, means an ecclesiastical vestment."},{"page_url":"https://da.wikipedia.org/wiki/Vennebjerg_Kirke","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Vennebjerg_Kirke_altertavle.jpg","page_title":"Vennebjerg Kirke","context_page_description":"Vennebjerg Kirke er en kirke i Vennebjerg Sogn i Hjørring Kommune. Den er bygget øst for af Klangshøj, som hæver sig 69 m over havet. Klangshøj er en gravhøj fra vikingetiden eller en høj, som har været forbundet med religiøs kult i samme periode. Gravhøjen er dateret via C14."},{"page_url":"https://nl.wikipedia.org/wiki/Loop_(Chicago)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/CTA_loop_junction.jpg","page_title":"Loop (Chicago)","context_page_description":"De Loop is een bovengrondse spoorlijn op een viaduct boven de straten van Chicago, gebouwd tussen 1895 en 1897. De wijk binnen deze ringlijn, het zakencentrum van Chicago, wordt ook wel aangeduid als de Loop."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A0%E1%83%A5%E1%83%98%E1%83%90%E1%83%9C%E1%83%98_%E1%83%92%E1%83%9D%E1%83%9B%E1%83%91%E1%83%94%E1%83%A8%E1%83%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Argentine_horned_frog_%28Ceratophrys_ornata%29.jpg","page_title":"რქიანი გომბეშო","context_page_description":"რქიანი გომბეშო — უკუდო ამფიბიათა გვარი გომბეშოსებრთა ოჯახისა. ზედა ქუთუთოზე რქისებრი გამონაზარდი აქვთ. თავზე კანი გაძვალებულია და მეჭეჭებიან ქედებს ქმნის. რქიანი გომბეშო მოიცავს 14 სახეობას. გავრცელებული არიან ჩრდილოეთ ამერიკის სამხრეთ ნაწილში, ცენტრალურ და სამხრეთ ამერიკაში. Ceratophrys cornuta სიგრძით 20 სმ აღწევს, შეფერილია მკვეთრი ფერებით. ბინადრობს ტენიან ტყეში. იკვებება არა მარტო უხერხემლოებით, არამედ პატარ-პატარა ხერხემლიანებითაც. ზოგი რქიანი გომბეშოს კანის გამონაყოფი მეტად შხამიანია."},{"page_url":"https://en.wikipedia.org/wiki/Steph_Davis","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Coyne_Crack_5.11%2B_-_Supercrack_Buttress_-_Indian_Creek.jpg","page_title":"Steph Davis","context_page_description":"Stephanie \\"Steph\\" Davis is an American rock climber, BASE jumper, and wingsuit flyer. She is one of the world's leading climbers, having completed some of the hardest routes in the world. She is the first woman to have soloed a 5.11 grade climb, the first woman to summit all the peaks of the Fitzroy Range in Patagonia, the second woman to free climb El Capitan in a day, the first woman to free climb the Salathė Wall on El Capitan, the first woman to free solo The Diamond on Longs Peak in Colorado, and the first woman to summit Torre Egger. Davis was married to fellow climbers and BASE jumpers Dean Potter and Mario Richard, and currently to sky-diving instructor, and flyer and jumper Ian Mitchard. Davis is also a blogger, writing about her interests in climbing, BASE jumping, yoga, and veganism."},{"page_url":"https://en.wikipedia.org/wiki/History_of_Tonga","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Ata%2C_a_Tonga_Chief_%28December_1853%2C_X%2C_p.132%29.jpg","page_title":"History of Tonga","context_page_description":"The history of Tonga is recorded since the century after 900 BC, when seafarers associated with the Lapita diaspora first settled the islands which now make up the Kingdom of Tonga. Along with Fiji and Samoa, the area served as a gateway into the rest of the Pacific region known as Polynesia. Ancient Tongan mythologies recorded by early European explorers report the islands of 'Ata and Tongatapu as the first islands having been hauled to the surface from the deep ocean by Maui."},{"page_url":"https://en.wikipedia.org/wiki/Diorocetus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Buttercup_Diorocetus.jpg","page_title":"Diorocetus","context_page_description":"Diorocetus is an extinct genus of baleen whale, belonging to the family Pelocetidae. Fossils are found in Miocene-aged marine strata in North America and Japan."},{"page_url":"https://en.wikipedia.org/wiki/Gordon_Byrom_Rogers","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Gordon_Byrom_Rogers_cadet.jpg","page_title":"Gordon Byrom Rogers","context_page_description":"Gordon Byrom Rogers was a United States Army lieutenant general who served in several command positions during World War II and the Korean War, including the United States Military Advisory Group to the Republic of Korea and the 3rd Armored Division."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%96%8B%E5%85%83%E5%AF%BA_(%E8%87%BA%E5%8D%97%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/%E8%87%BA%E5%8D%97%E9%96%8B%E5%85%83%E5%AF%BA%E5%A4%A7%E9%9B%84%E5%AF%B6%E6%AE%BF%E4%BD%9B%E5%83%8F.JPG","page_title":"開元寺 (臺南市)","context_page_description":"台南开元寺位于台湾台南市北区，清时的柴头港溪溪畔，于1985年8月19日公告为二级古迹。前身为延平王室位于府城外的行宫北园别馆，后改建为寺于大清国康熙年间，原称海会寺，是台湾著名的寺庙和最早创立的官方寺院，对近代台湾佛教的发展关系颇深。该寺亦是台湾府城七寺八庙之一。"},{"page_url":"https://sv.wikipedia.org/wiki/Solanum_erianthum","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Solanum_erianthum_Don_W2_IMG_1616.jpg","page_title":"Solanum erianthum","context_page_description":"Solanum erianthum är en potatisväxtart som beskrevs av David Don. Solanum erianthum ingår i potatissläktetsom ingår i familjen potatisväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://pt.wikipedia.org/wiki/Kawanishi_H6K","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1c/KawanishiH6K.jpg","page_title":"Kawanishi H6K","context_page_description":"O Kawanishi H6K foi um hidroavião quadrimotor monoplano japonês, da Marinha Imperial Japonesa, produzido pela companhia de aviões Kawanishi e usado durante a Segunda Guerra Mundial em missões de patrulha marítima. Era conhecido pelas forças aliadas como \\"Mavis\\"; A designação da Marinha Imperial Japonesa era \\"Grande Barco Voador Tipo 97\\"."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Hasselt","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Hasselt_-_Huis_Cornu.jpg","page_title":"Lijst van onroerend erfgoed in Hasselt","context_page_description":"Een overzicht van het onroerend erfgoed in Hasselt. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E8%87%BA%E6%BE%8E%E9%87%91%E9%A6%AC%E5%80%8B%E5%88%A5%E9%97%9C%E7%A8%85%E9%A0%98%E5%9F%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Agency_for_International_Trade_Information_and_Cooperation_%28map_of_member_nations%29.png","page_title":"臺澎金馬個別關稅領域","context_page_description":"台湾、澎湖、金门及马祖个别关税领域，为中华民国于世界贸易组织之会籍完整名称，简称台澎金马个别关税领域，副名中华台北。\\n此名称来自中华民国政府自1950年代起所实际管辖统治的主要土地，即台湾、澎湖、金门及马祖。中华人民共和国政府称其为台湾、澎湖、金门、马祖单独关税区。"},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AC%E0%A6%BE%E0%A6%82%E0%A6%B2%E0%A6%BE%E0%A6%A6%E0%A7%87%E0%A6%B6_%E0%A6%B8%E0%A7%87%E0%A6%A8%E0%A6%BE%E0%A6%AC%E0%A6%BE%E0%A6%B9%E0%A6%BF%E0%A6%A8%E0%A7%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/BangladeshMilitaryUN_PeacekeepingForce.jpg","page_title":"বাংলাদেশ সেনাবাহিনী","context_page_description":"বাংলাদেশ সেনাবাহিনী বাংলাদেশ সশস্ত্র বাহিনীর স্থল শাখা। এটি বাংলাদেশ সশস্ত্র বাহিনীর সর্ববৃহৎ শাখা। সেনাবাহিনীর প্রাথমিক দায়িত্ব হচ্ছে বাংলাদেশের ভূখণ্ডের অখণ্ডতা রক্ষা সহ সব ধরনের নিরাপত্তা ও প্রতিরক্ষা সহায়তায় প্রয়োজনীয় শক্তি ও জনবল সরবরাহ করা। সেনাবাহিনীর সব ধরনের কর্মকান্ড সশস্ত্র বাহিনী বিভাগের সেনা শাখা দ্বারা নিয়ন্ত্রিত হয়। প্রাথমিক দায়িত্বের পাশাপাশি যেকোন জাতীয় জরুরি অবস্থায় বেসামরিক প্রশাসনের সহায়তায় এগিয়ে আসতে বাংলাদেশ সেনাবাহিনী সাংবিধানিক ভাবে প্রতিশ্রুতিবদ্ধ।"},{"page_url":"https://en.wikipedia.org/wiki/Kre%C5%A1imir_Lon%C4%8Dar","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/Presentaci%C3%B3_de_Loncar_-_15.jpeg","page_title":"Krešimir Lončar","context_page_description":"Krešimir Lončar is a Croatian professional basketball player for s.Oliver Würzburg of the Basketball Bundesliga. Standing at 2.10 m, he plays both the power forward and center positions."},{"page_url":"https://nl.wikipedia.org/wiki/Kaaibakken","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Blokgooien_spel.jpg","page_title":"Kaaibakken","context_page_description":"Bloktikken, kaaibakken, piksjitten en butken zijn benamingen voor traditioneel volksvermaak en een spel. In het spel gaat het er om om met een kogel, een bal, een blokje of zoals oorspronkelijk een afgerond veldkeitje, anderen proberen af te gooien of een houten blok te raken met daarop de door de spelers ingezette munten. Ook het Noord-Hollandse steenwerpen toont veel overeenkomsten.\\nHet spel heeft kenmerken van het kegelen, jeu de boules, het Zweedse kubb, het Finse mölkky en het Italiaanse bocce."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B9%E0%A6%BE%E0%A6%87%E0%A6%A1%E0%A7%8D%E0%A6%B0%E0%A6%B0%E0%A7%8D%E0%A6%A8%E0%A6%BF%E0%A6%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Pitta_guajana-20030531B.jpg","page_title":"হাইড্রর্নিস","context_page_description":"হাইড্রর্নিস Pittidae গোত্রের অন্তর্গত একটি গণ। মোট ১৩টি প্রজাতি এ গণের অন্তর্ভুক্ত। সবগুলো প্রজাতিই দক্ষিণ-পূর্ব এশিয়ায় বিচরণ করে। পূর্বে এ গণের সদস্যগুলো পিট্টা গণের অন্তর্ভুক্ত ছিল। পরবর্তীতে ২০০৬ সালে বৈজ্ঞানিক গবেষণার ভিত্তিতে এ পিট্টা গণটি ভেঙে নতুন দু'টি গণ হাইড্রর্নিস ও ইরিথ্রোপিট্টা-এর সৃষ্টি হয়। এ তিনটি গণের সব সদস্যই শুমচা নামে পরিচিত।"},{"page_url":"https://fr.wikipedia.org/wiki/Synagogue_de_Teschen_(1878-1939)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Syna_Teschen_13_septemnre_1939.jpg","page_title":"Synagogue de Teschen (1878-1939)","context_page_description":"La synagogue de Teschen ou synagogue de Cieszyn, construite en 1837 au 6 rue Bóżnicza et agrandie en 1878, a été détruite par les troupes allemandes en 1939, au début de l'invasion de la Pologne.\\nCieszyn en polonais, Teschen en allemand, est une ville du sud de la Pologne qui fait partie de la voïvodie de Silésie. Teschen appartient à la couronne des Habsbourg depuis 1653. Elle fait partie du duché de Haute et de Basse-Silésie. Après la Première Guerre mondiale, la ville est divisée en 1920 en deux parties, une partie tchèque qui prend le nom de Český Těšín et une partie polonaise avec pour nom Cieszyn. En octobre 1938, la Pologne occupe la partie tchèque. En septembre 1939, la ville est envahie par l'armée allemande. Après la Seconde Guerre mondiale, la ville est de nouveau divisée entre la Tchécoslovaquie et la Pologne. Cieszyn compte actuellement un peu plus de 36 000 habitants."},{"page_url":"https://en.wikipedia.org/wiki/R%C3%BDnovice","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/68/Rynovicekostel.jpg","page_title":"Rýnovice","context_page_description":"Rýnovice is part of the town of Jablonec nad Nisou in the district of Jablonec nad Nisou, in the Liberec region, in the Czech Republic. Today nearly 2200 people live in Rýnovice."},{"page_url":"https://ceb.wikipedia.org/wiki/Encephalartos_ghellinckii","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Encephalartos_ghellinckii02.jpg","page_title":"Encephalartos ghellinckii","context_page_description":"Espesye sa tanom sakop sa ka-ulo nga Tracheophyta, ug nga gihulagway ni [[Lem ang Encephalartos ghellinckii. |Lem.]]. Ang Encephalartos ghellinckii sakop sa kahenera nga Encephalartos sa kabanay nga Zamiaceae. Giklaseklase sa IUCN ang espesye sa madutlan. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B0%D0%BD%D0%B8%D0%B5%D0%BB%D1%8F%D0%BD,_%D0%93%D0%B5%D0%BD%D1%80%D0%B8%D0%BA_%D0%9C%D1%83%D1%80%D0%B0%D0%B4%D1%85%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Henrik_Danielyan%27s_Monument_2.jpg","page_title":"Даниелян, Генрик Мурадханович","context_page_description":"Генрик Мурадханович Даниелян — известный судья, бывший председатель кассационного суда Армении.\\n1957 — окончил местную среднюю школу и поступил на работу в Севанском «Армрыбтресте» в качестве машиниста.\\n1960—1963 — работал в редакции газеты «Севан» в качестве литературного сотрудника, заведующим отдела.\\n1963—1965 — был первым секретарем Севанского райкома ВЛКСМ.\\n1965—1969 — работал в качестве ответственного секретаря в газете «Севан».\\n1961—1967 — окончил юридический факультет Ереванского государственного университета.\\n1969 — был избран судьей Севанского района.\\nС 1977 — член верховного суда Армении.\\n1998—2005 — был председателем кассационного суда Армении.\\n9 июня 2005 — указом президента назначен членом Конституционного суда Армении.\\nИмеет звание \\"Судья высшего квалификационного класса\\".\\n2003 — было присвоено звание заслуженного юриста Армении."},{"page_url":"https://es.wikipedia.org/wiki/Arthur_Schnitzler","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Arthur_Schnitzler_signature.jpg","page_title":"Arthur Schnitzler","context_page_description":"Arthur Schnitzler fue un narrador y dramaturgo austríaco. Médico de profesión, en sus obras mostró gran interés por el erotismo, la muerte, la psicología y la crisis social de entresiglos en un centro cultural como Viena. Fue muy admirado por Sigmund Freud, que le llevaba seis años y veía en él una especie de «doble» literario​ y con quien se carteó en la última etapa de su vida. En su afán por profundizar en la complejidad psicológica de sus personajes, fue uno de los primeros autores de lengua alemana en hacer uso de la técnica del monólogo interior, en obras como El teniente Gustl o La señorita Else.\\nMuchas de sus obras han sido adaptadas al cine y la televisión, ​ entre otros, por directores tan conocidos como Max Ophüls o Stanley Kubrick.\\nEs abuelo del conocido ecologista austríaco Michael Schnitzler."},{"page_url":"https://fr.wikipedia.org/wiki/Samuel_Provoost","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Samuel_Provoost-Bishop_Episcopal_Church_USA.jpg","page_title":"Samuel Provoost","context_page_description":"Samuel Provoost est un évêque épiscopalien américain.\\nIl fut un whig, défendant l'indépendance des colonies américaines pendant la guerre d'Indépendance.\\nEn 1787, il fut consacré évêque du diocèse de New York à Londres, après qu'une réforme du parlement britannique eut rendu possible la consécration des évêques étrangers sans allégeance à la Couronne britannique.\\nIl s'opposa à la reconnaissance de la validité de la consécration de Samuel Seabury, premier évêque épiscopalien, consacré par des évêques non-jureurs de l'église écossaise."},{"page_url":"https://fr.wikipedia.org/wiki/Mallemoisson","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Mallemoisson-03-2013_14-Mairie_m%C3%A9diath%C3%A8qe.JPG","page_title":"Mallemoisson","context_page_description":"Mallemoisson, ou Mallemoisson-les-Grillons d'après le nom du village chef-lieu, est une commune française, située dans le département des Alpes-de-Haute-Provence en région Provence-Alpes-Côte d'Azur.\\nLe nom de ses habitants est Mallemoissonnais."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%95%D7%95%D7%96_%D7%91%D7%A8%D7%A0%D7%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Brant_Goose_Range.png","page_title":"אווז ברנט","context_page_description":"אווז ברנט היא מין אווז מהסוג ברנטה שבמשפחת הברווזיים.\\nאורכו של אווז זה 55-66 ס\\"מ, מוטת הכנפיים 106-121 ס\\"מ ומשקלו 0.8-2.2 ק\\"ג. הוא בעל גוף חום כהה וחזה, צוואר וראש כהים עם פס לבן בתחילת הצוואר. הזנב לבן והרגליים שחורות. לאווזים יש ראש גדול, מקור קצר ורגליים ארוכות.\\nהאווזים רועים בלהקות סביב לחופי האזור הארקטי ממערב אירופה למרכז ומערב סיביר ולאורך חופי קנדה ואלסקה. בארצות הברית הם נמצאים בין מיין לג'ורג'יה.\\nהאווזים ניזונים מעשבים שהם מלקטים במקורם אך מחבבים במיוחד עשבי ים ממין Zostera marina.\\nהם חיים בקבוצות גדולות ומקננים סמוך למושבות של אוחי שלג. האוחים מקננים סמוך לזמנם ומגרשים שועלי קוטב רעבים המתקרבים לביצים. אך לאחר הבקיעה האוח עלול לחטוף את אחד האווזונים עם הוריו לא משגיחים עליו ומגרשים את האוח."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Russian-language_novelists","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/The_Soviet_Union_1972_CPA_4088_stamp_%28Alexandra_Kollontai_%281872-1952%29%2C_Diplomat_%28Birth_Centenary%29%29.jpg","page_title":"List of Russian-language novelists","context_page_description":"This is a list of authors who have written works of fiction in the Russian language. The list encompasses novelists and writers of short fiction.\\nSee also: List of Russian-language writers, List of Russian-language poets, List of Russian-language playwrights, List of Russian artists, List of Russian architects, List of Russian inventors, List of Russian explorers, Russian literature, Russian culture"},{"page_url":"https://hu.wikipedia.org/wiki/Blur","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Blur_Newcastle_2009_Coxon_Albarn.jpg","page_title":"Blur","context_page_description":"A Blur egy angol alternatív rockegyüttes, melyet 1989-ben alapítottak Colchesterben. Négy tagja változatlan: Damon Albarn, Graham Coxon, Alex James, és Dave Rowntree. Első albumuk, a Leisure 1991-ben jelent meg, és a Madchester valamint a shoegazing stílus jegyeit viselte magán. Sikerük a kilencvenes évek folyamán egyre nagyobb lett, nekik is köszönhető, hogy a britpop világszerte elterjedt. Még egy csatát is vívtak az Oasis együttessel. A kilencvenes évek végére stílusukba egyre több indie, elektronika, és némi gospel szövődött. Legismertebb számuk, a Song 2 is ekkor született. 2002-ben Graham Coxon elhagyta a zenekart, éppen a Think Tank nevű stúdióalbum készítése közben. Ennek megjelenése óta a Blur nem adott ki semmilyen kiadványt. 2009-ben Graham visszatért és több koncertet adtak az eredeti felállásban, két új dalt is készítettek, de új lemez nem született."},{"page_url":"https://de.wikipedia.org/wiki/Oralepidemiologie","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Fuenfte_deutsche_mundgesundheitsstudie_dms_v_logo.gif","page_title":"Oralepidemiologie","context_page_description":"Die Oralepidemiologie ist eine wissenschaftliche Unterdisziplin der Epidemiologie, die sich speziell mit den Ursachen und Folgen sowie der Verbreitung von Zahn-, Mund- und Kieferkrankheiten in der Bevölkerung beschäftigt. Das Institut der Deutschen Zahnärzte, eine Gemeinschaftseinrichtung der Bundeszahnärztekammer und der Kassenzahnärztlichen Bundesvereinigung, erstellte zum Thema bisher fünf „Mundgesundheitsstudien“ heraus, zuletzt 2016."},{"page_url":"https://sv.wikipedia.org/wiki/Rimner","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Sk%C3%ADrnism%C3%A1l-748-2v.jpg","page_title":"Rimner","context_page_description":"Rimner är en jätte som ofta nämns i fornnordisk mytologi. Han omnämns ibland som Bergelmer, osäkert om det är samma Rimner.\\nI Hyndlas sång vers 32 står att han är far till Heid och Rosstjuf.\\nHan nämns i Sången om Skirner vers 28.\\nHan står med i listan över jättar i Namntulorna, en del av den prosaiska Eddan.\\nI Völsungasagan står det att han är far till Ljod, som Frigg sänder till Rerir med gudarnas äpple som gör det möjligt för hans fru att bli havande med Völsung. Senare skickar Rimner Ljod för att bli Völsungs fru. Detta liknar berättelsen om Peredur i Artursagan, och den skotska folksagan \\"The Sea Maiden.\\"\\nI Grim Lodenkinns saga, är han far till jättinnorna Feima och Kleima och hans hustrus namn är Hyrja.\\nRimner kan betyda antingen \\"den som är täckt med rimfrost\\" eller \\"den sotige\\". Det är inte klart om namnet är avsett att framkalla frosten ifrån jättar eller rimtursar."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8C%D5%AB%D5%B9%D5%AB%D5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Riccia_fluitans_Strasburger1900.png","page_title":"Ռիչիա","context_page_description":"Ռիչիա, ռիչիազգիների ընտանիքի լյարդամամուռների ցեղ։ Հայտնի է 100, ՀՀ-ում՝ 3 տեսակ։ Առավել տարածված է\\nՌիչիա լողացողը ։"},{"page_url":"https://hr.wikipedia.org/wiki/Tiberijada","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Coat_of_arms_of_Tiberias.png","page_title":"Tiberijada","context_page_description":"Tiberijada je grad na sjeveru Izraela. S oko 44 000 stanovnika Tiberijada je najveći grad u dolini Jordana. Zbog svojeg smještaja na obali Galilejskog jezera i blage klime popularna je turistička destinacija."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%90%D1%80%D1%81%D0%BB%D0%B0%D0%BD%D0%B0%D0%B3%D0%B8%D1%9B%D0%B0_%D0%BC%D0%BE%D1%81%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Arslanagica_most_trebinje.JPG","page_title":"Арсланагића мост","context_page_description":"Арсланагића мост, или Перовића мост, мост је на Требишњици у Требињу, а налази се на списку непокретних културних добара Републике Српске. Мост се налазио на путу који је спајао Дубровник и Херцег Нови са Цариградским друмом."},{"page_url":"https://de.wikipedia.org/wiki/Course_Landaise","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Sauteur.JPG","page_title":"Course Landaise","context_page_description":"Der Course Landaise ist ein in der Gascogne traditionelles Spiel mit wilden Rindern, das hauptsächlich in den französischen Departements Gers, Landes und teilweise auch Gironde ausgeübt wird.\\nBei dieser Art des Stierkampfes fließt kein Blut, das Tier bleibt unverletzt, ja es darf nicht einmal berührt werden. Die Teilnehmer dieses populären Spiel gelten als ausgezeichnete Athleten. Die Courses Landaises werden von März bis Oktober zumeist bei Kirchweihfesten abgehalten. Bekannt sind die Courses in Nogaro, Mont-de-Marsan, Dax und Castelnau-d’Auzan. Inzwischen gibt es auch nationale Meisterschaften."},{"page_url":"https://de.wikipedia.org/wiki/Jan_Van_Beers_(Dichter)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Jan_Van_Beers.jpg","page_title":"Jan Van Beers (Dichter)","context_page_description":"Jan Van Beers war ein flämischer Dichter. Er war der Vater des Malers Jan Van Beers.\\nVan Beers arbeitete als Lehrer für niederländische Sprache an Schulen in Mechelen und Lier sowie an einem Athenaeum in Antwerpen. Zudem verfasste er eine niederländische Grammatik."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D8%B6%D8%B7%D8%B1%D8%A7%D8%A8_%D9%86%D8%B8%D9%85_%D9%82%D9%84%D8%A8%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Asystole11.JPG","page_title":"اضطراب نظم قلبي","context_page_description":"اضطراب النظم القلبي أو اختلال النَّظْم القَلْبِيّ أو اللانظمية القلبية هي الاختلافات التي تطرأ على دقات القلب وعلى نُظُم نقل الشارة الكهربائية في عضلة القلب، هذه الشارة التي تنظم انقباض عضلة القلب انقباضاً منسجماً مع وظائف حجرات القلب لتأدية وظيفة الضخ على أحسن وجه. تسمى اضطرابات النظم اختصاراً باللانظميات.\\nهذه الاختلافات في نظم القلب يمكن أن تظهر أعراضها كتسارع أو تباطؤ في دقات القلب، ويمكن أن تظهر أعراضها بعدم الانتظام في دقات القلب، أو كخفقان. وتختلف اضطرابات النظم فيما بينها بأهميتها وخطورتها على حياة المريض، فمنها ما يعتبر مظهراً من مظاهر التنوع لا قيمة مرضية له، ومنها ما يشكل خطراً على حياة المريض، أو مرضاً لابد من علاجه.\\nمعظم حالات اضطراب النًّظْم غير ضارة، ولكن بعضها قد يكون خطيراً أو حتى قد يهدد حياة المصاب. عندما تكون دقات القلب بطيئة جداً، سريعة جدا، أو غير نظامية، فقد لا يكون القلب قادرا على ضخ ما يكفي من الدم إلى الجسم وبالتالي يؤدي إلى نقص التروية الدموية لهذه الأعضاء، هذا بدوره يلحق الضرر بالدماغ وبالقلب، وغيرهما من الأعضاء الحيوية وقد يقود إلى صدمة دورية."},{"page_url":"https://en.wikipedia.org/wiki/Pedro_Nunes","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Nonio_originale.jpg","page_title":"Pedro Nunes","context_page_description":"Pedro Nunes was a Portuguese mathematician, cosmographer, and professor, from a New Christian family.\\nConsidered one of the greatest mathematicians of his time, Nunes is best known for his contributions to the nautical sciences, which he approached, for the first time, in a mathematical way. He was the first to propose the idea of a loxodrome, and was the inventor of several measuring devices, including the nonius, named after his Latin surname."},{"page_url":"https://en.wikipedia.org/wiki/W._G._Hoskins","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Medieval_Ridge_and_Furrow_above_Wood_Stanway_-_geograph.org.uk_-_640050.jpg","page_title":"W. G. Hoskins","context_page_description":"William George Hoskins CBE FBA was an English local historian who founded the first university department of English Local History. His great contribution to the study of history was in the field of landscape history. Hoskins demonstrated the profound impact of human activity on the evolution of the English landscape in a pioneering book: The Making of the English Landscape. His work has had lasting influence in the fields of local and landscape history and historical and environmental conservation."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Bauwerke_der_norddeutschen_und_rheinischen_Backsteingotik_in_Deutschland","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/20030708560DR_Ankershagen_Dorfkirche_Fresken.jpg","page_title":"Liste der Bauwerke der norddeutschen und rheinischen Backsteingotik in Deutschland","context_page_description":"Die Liste der Bauwerke der norddeutschen und rheinischen Backsteingotik in Deutschland ist Teil des Listenwerks Backsteinbauwerke der Gotik, der möglichst vollständigen Erfassung aller gotischen Backsteinbauten in Europa. Aufgenommen sind nur Bauwerke, an denen der Backstein irgendwo zutage tritt oder, bei geschlämmten Oberflächen, wenigstens die Backsteinstruktur von Mauerwerk erkennbar ist.\\nDie gotischen Backsteinbauwerke in diesen Regionen Deutschlands sind Teil des geographisch zusammenhängenden Bestandes der nördlichen Backsteingotik, der sich von der Straße von Dover bis nach Galizien erstreckt.\\nUmfang:\\nDiese Liste umfasst 1633 Bauwerke und Gruppen von Bauwerken.\\nNavigation:\\nDurch Anklicken der Pfeile an den Zeilenanfängen gelangt man aufwärts zum Kopf der jeweiligen Teilliste und zu den darüber platzierten Navigationsleisten. Abwärts gelangt man zu den Navigationsleisten unterhalb der Teilliste und dem Kopf der nächsten Teilliste.\\nSchriftbild/Schriftstile: Wo Bauten in mehreren Orten einer Gemeinde in Folge aufgeführt sind, wurde der Gemeindename beim erstgenannten Ort/Ortsteil fett gesetzt. Die Namen so gruppierter Ortsteile sind kursiv gesetzt.\\nGliederung:"},{"page_url":"https://it.wikipedia.org/wiki/Burcy_(Calvados)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/FranceNormandieBurcyEglise.jpg","page_title":"Burcy (Calvados)","context_page_description":"Burcy è un comune francese di 373 abitanti situato nel dipartimento del Calvados nella regione della Normandia."},{"page_url":"https://de.wikipedia.org/wiki/Teufen_AR","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Teufen_Hotelo_Linde_003.JPG","page_title":"Teufen AR","context_page_description":"Teufen ist eine politische Gemeinde im Mittelland des Kantons Appenzell Ausserrhoden in der Schweiz. Teufen liegt durch eine Anhöhe getrennt unmittelbar südlich der Stadt St. Gallen."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%B1%85%E9%85%92%E5%B1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Izakaya%2Cwakkanai%2Chokkaido_6240687%E6%9C%80%E6%9E%9C%E3%81%A6%E5%8C%97%E6%B5%B7%E9%81%93%E7%A8%9A%E5%86%85%E3%81%AE%E5%B1%85%E9%85%92%E5%B1%8B.jpg","page_title":"居酒屋","context_page_description":"居酒屋又称酒馆，是提供酒类和饭菜的料理店。与只提供酒类为中心点的普通酒馆不同，居酒屋提供比较有质量的饭菜，但却不同于小吃店。居酒屋是具有日本特色的饮食店。不过，在其他国家也有类似的酒馆，能方便地吃饭、提供酒水。有时居酒屋亦译作bar。"},{"page_url":"https://en.wikipedia.org/wiki/Ed_de_Noorlander","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Ed_de_Noorlander_1972b.jpg","page_title":"Ed de Noorlander","context_page_description":"Eduard Jan \\"Ed\\" de Noorlander is a retired Dutch decathlete who finished in ninth place at the 1968 Summer Olympics."},{"page_url":"https://de.wikipedia.org/wiki/Dia%C4%BEnica_D1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/D1Highway15Slovakia20.JPG","page_title":"Diaľnica D1","context_page_description":"Die Diaľnica D1 ist die längste Autobahn in der Slowakei. Sie ist Teil der Europastraßen 50, 58, 75 und 571 sowie in voller Länge Teil des V. Paneuropäischen Verkehrskorridors: Venedig – Bratislava – Košice – Uschhorod. Der erste Abschnitt wurde 1975 zwischen Bratislava und Senec eröffnet.\\nIm Endausbau soll die Autobahn 516 km lang sein. Sie wird dann von Bratislava über Trnava, Trenčín, Púchov, Žilina, Martin, Poprad, Prešov, Košice und Michalovce zur ukrainischen Grenze bei Záhor führen. Derzeit hat die Autobahn vier Teilstrecken mit einer Gesamtlänge von 380,6 km, somit sind 73,8 Prozent von der Gesamtlänge sowie 85,6 Prozent der Teilstrecke zwischen Bratislava und Košice fertiggestellt. Fertige zusammenhängende Abschnitte sind im Einzelnen Bratislava–Hričovské Podhradie, Dubná Skala–Turany, Ivachnová–Prešov-západ und Prešov-juh–Bidovce.\\nIn Bau sind fünf Bauabschnitte mit einer Gesamtlänge von 48 km, die im Zeitraum 2020–2023 dem Verkehr freigegeben werden sollen. Geplant ist Bauabschnitt Turany–Hubová sowie alle Bauabschnitte östlich von Bidovce, insgesamt 88 km.\\nInsgesamt zwölf Tunnel sind geplant, sechs davon entfallen auf die Teilstrecke zwischen Žilina und Ružomberok."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%BD%D0%B0%D0%BA%D0%B8_%D0%BF%D0%BE%D1%88%D1%82%D0%BE%D0%B2%D0%BE%D1%97_%D0%BE%D0%BF%D0%BB%D0%B0%D1%82%D0%B8_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8_2001","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Stamp_of_Ukraine_s365.jpg","page_title":"Знаки поштової оплати України 2001","context_page_description":"Знаки поштової оплати України 2001 — перелік поштових марок, введених в обіг Укрпоштою у 2001 році.\\nЗ 16 січня по 20 грудня 2001 року було випущено 58 поштових марок, у тому числі 52 пам'ятні і 6 стандартних п'ятого випуску «В», «Д», «Е», «Є», «Ж» та «Р». Тематика комеморативних марок охопила ювілеї визначних дат, подій, пам'яті видатних діячів культури та інши.\\nМарки було надруковано державним підприємством «Поліграфічний комбінат „Україна“».\\nВідсортовані за датою введення."},{"page_url":"https://it.wikipedia.org/wiki/Miyagi_Michio","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Miyagi_Michio_photographed_by_Shigeru_Tamura.jpg","page_title":"Miyagi Michio","context_page_description":"Michio Miyagi è stato un musicista giapponese famoso per la sua abilità nel suonare il koto."},{"page_url":"https://sh.wikipedia.org/wiki/J%C3%BCbek","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Juebek-Wappen.png","page_title":"Jübek","context_page_description":"Jibek je opština u njemačkoj saveznoj državi Šlezvig-Holštajn. Jedno je od 134 opštinska središta okruga Šlezvig-Flensburg. Prema procjeni iz 2010. u opštini je živjelo 2.576 stanovnika. Posjeduje regionalnu šifru 1059044, NUTS i LOCODE kod."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%9F%83%E5%8F%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Egypt_Topography.png","page_title":"埃及","context_page_description":"阿拉伯埃及共和国，通称埃及，是东北非洲人口最多的国家，面积为1,001,450平方千米，2020年2月人口突破1亿。原存在于当地的古埃及是世界文明古国之一，与两河流域文明有一定程度的交流，不过在在希腊与罗马人的统治下，古埃及文明在公元前逐渐没落，后来被阿拉伯文化所取代。二战后，埃及于1953年由阿拉伯人建立共和国，地理上该国地跨二洲即亚洲和非洲，西奈半岛位于西南亚，而该国大部分国土位于北非地区。伊斯兰教为国教。埃及人大部分信仰伊斯兰教逊尼派，最大的宗教少数派为科普特正教。另外还有基督教其他教派和伊斯兰教什叶派；官方语言为阿拉伯语，通用英语和法语。埃及经济的多元化程度在中东地区名列前茅。\\n埃及也被认为是一个中等强国，各项重要产业如旅游业、农业、工业和服务业有着几乎同等的发展比重，埃及的苏伊士运河是亚洲与欧洲的桥梁。在地中海、中东和伊斯兰信仰地区尤其有广泛的影响力。埃及计划于2019年底正式迁往新首都，缓解开罗人口压力。"},{"page_url":"https://sv.wikipedia.org/wiki/California_Academy_of_Sciences","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/California_Academy_of_Sciences_-_Steinhart_Aquarium_21_2016-11-09.jpg","page_title":"California Academy of Sciences","context_page_description":"California Academy of Sciences är ett forskningsinstitut och naturhistoriskt museum i Golden Gate Park, San Francisco, Kalifornien, USA. Samlingarna, som omfattar över 46 miljoner exemplar, tillhör de största i världen. Den 2008 nybyygda museibyggnaden innehåller även ett planetarium, en fyra våningar hög regnskog, stora akvarier och 40 000 levande djur. Över 100 forskare är knutna till California Academy of Sciences."},{"page_url":"https://fi.wikipedia.org/wiki/GFriend","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Jung_Eunha_at_Ulsan_Summer_Festival_on_July_23%2C_2018_%282%29.jpg","page_title":"GFriend","context_page_description":"GFriend on vuonna 2015 perustettu kuusijäseninen eteläkorealainen tyttöyhtye, jonka levy-yhtiönä toimii Source Music. Yhtyeeseen kuuluvat Sowon, Yerin, Eunha, Yuju, SinB ja Umji. Yhtye debytoi 15. tammikuuta 2015 minialbumillaan Season of Glass."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%87%D9%88%DB%8C%D8%A8%D8%A7%D8%AE_(%D9%88%D9%88%D8%B1%D8%AA%D9%85%D8%A8%D8%B1%D9%82)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/Heubach-rosenstein.jpg","page_title":"هویباخ (وورتمبرق)","context_page_description":"هویباخ (وورتمبرق) آلمانین بادن-وورتمبرق ایالتینده یئر آلان بیر شهردیر و ۴۶۶ متر دنیز سئویه‌سیندن اۇجالیقی وار. ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا ۱۰۱۰۵ نفر دیر. بۇ شهرین ۲۵٫۸۱ کیلومتر موربّع ساحه سی وار."},{"page_url":"https://lv.wikipedia.org/wiki/P%C4%93tera_iela_(Jelgava)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/P%C4%93tera_iela_4_%28Jelgava%29.jpg","page_title":"Pētera iela (Jelgava)","context_page_description":"Pētera iela ir viena no Jelgavas ielām, kas sākas pie krustojuma ar Lielo ielu, ved gar policijas ēkām, tālāk turpinās līdz Zirgu ielai.\\nOtrā Pasaules kara laikā 1944. gada augustā ielas apbūve tika daļēji iznīcināta, mūsdienās to veido gan senākās, gan Latvijas PSR laikā celtās ēkas."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B7%B4%E9%BB%8E%E5%9C%B0%E9%90%B5%E8%BB%8A%E7%AB%99%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Landon-entr%C3%A9e_rue.jpg","page_title":"巴黎地鐵車站列表","context_page_description":"這是巴黎地鐵車站列表。"},{"page_url":"https://de.wikipedia.org/wiki/J%C3%BCdischer_Friedhof_Essentho","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/73/Juedischer_Friedhof_Essentho_1.JPG","page_title":"Jüdischer Friedhof Essentho","context_page_description":"Der Jüdische Friedhof Essentho ist ein jüdischer Friedhof bei Essentho/Stadt Marsberg im Hochsauerlandkreis in Nordrhein-Westfalen.\\nEr ist ein geschütztes Baudenkmal."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D9%88%D8%B4_%D8%A8%D8%A7%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Jpayne.jpg","page_title":"جوش باين","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nجوش باين لاعب كورة قدم من المملكه المتحده."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D1%83%D1%88%D0%B5%D0%BD%D1%81%D0%B0%D0%B9%D0%B4_(%D0%9A%D0%B0%D0%BB%D0%B8%D1%84%D0%BE%D1%80%D0%BD%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Flag_of_Oceanside%2C_California.png","page_title":"Оушенсайд (Калифорния)","context_page_description":"Оушенсайд — третий по величине город в округе Сан-Диего, штат Калифорния, США. В городе проживает около 183 095 человек. Город расположен к югу от корпуса морской пехоты базы Кэмп-Пендлтон, военной базы Соединенных Штатов. Оушенсайд пережил значительный рост населения с 1970 года, когда его население составляло 45 000 человек. Большая часть территории города была построена в течение 1970-х и 1980-х годов."},{"page_url":"https://ceb.wikipedia.org/wiki/Valdefuentes_del_P%C3%A1ramo_(munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Ayuntamiento_de_Valdefuentes_del_P%C3%A1ramo.jpg","page_title":"Valdefuentes del Páramo (munisipyo)","context_page_description":"Munisipyo ang Valdefuentes del Páramo sa Espanya. Nahimutang ni sa lalawigan sa Provincia de León ug rehiyon sa Castilla y León, sa amihanan-kasadpang bahin sa nasod, 270 km sa amihanan-kasadpan sa Madrid ang ulohan sa nasod. Adunay 354 ka molupyo.\\nAng klima mediteranyo. Ang kasarangang giiniton 13 °C. Ang kinainitan nga bulan Hunyo, sa 24 °C, ug ang kinabugnawan Enero, sa 2 °C. Ang kasarangang pag-ulan 792 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 96 milimetro nga ulan, ug ang kinaugahan Agosto, sa 8 milimetro."},{"page_url":"https://no.wikipedia.org/wiki/Zacatl%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Zacatlan.jpg","page_title":"Zacatlán","context_page_description":"Zacatlán er en by og en kommune nord i den meksikanske delstaten Puebla. Den ligger på om lag 2000 meters høyde i fjellkjeden Sierra Norte de Puebla. Byen hadde 33 736 innbyggere i 2010, mens hele kommunen hadde 77 296 innbyggere.\\nKommunen er et av landets viktigste områder for epledyrking. Sideren fra Zacatlán er godt kjent. Det samme er bakervaren «pan de Zacatlán», en søt bolle fylt med ost.\\nByen har et vakkert sentrum med godt bevart arkitektur fra kolonitida. I kommunen ligger også Valle de las Piedras Encimadas, en dal med høye steinformasjoner. Zacatlán fikk status som «Pueblo Mágico» i 2011.\\nNavnet Zacatlán er nahuatl og betyr «Sted med mye gras»."},{"page_url":"https://fi.wikipedia.org/wiki/Haihtuvat_rasvahapot","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Butyric_acid_acsv.svg","page_title":"Haihtuvat rasvahapot","context_page_description":"Haihtuvat rasvahapot ovat lyhytketjuisia karboksyylihappoja. Nimitystä käytetään erityisesti käymisessä muodostuvista karboksyylihapoista. Märehtijöiden pötsissä mikrobit hajottavat hiilihydraatteja anaerobisessa käymisessä haihtuviksi rasvahapoiksi. Etikkahappo muodostaa noin 65 %, propioni- ja voihappo kumpikin 15 % ja muut 5 % käymistuotteista."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D0%B5%D1%81%D1%82%D0%B8%D1%89%D0%B5_(%D0%A5%D0%B0%D1%80%D1%8C%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Hrestyshche_krasn_prapor.png","page_title":"Крестище (Харьковская область)","context_page_description":"Крести́ще — село Крестищенского сельского совета, Красноградский район, Харьковская область, Украина.\\nКод КОАТУУ — 6323381501. Население по переписи 2001 года составляет 947 человек.\\nЯвляется административным центром Крестищенского сельского совета, в который, кроме того, входят сёла Кобцевка, Оленовка, Першотравневое и Украинка."},{"page_url":"https://fr.wikipedia.org/wiki/Quarterback","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Spalding%27s_how_to_play_foot_ball%3B_%281902%29_%2814597024517%29.jpg","page_title":"Quarterback","context_page_description":"Le quarterback, appelé quart-arrière en français canadien, est un poste offensif au football américain et au football canadien. Le quarterback est placé derrière sa ligne offensive et dirige l'attaque.\\nEn connexion avec le centre, le quarterback prend le snap et doit distribuer le jeu. Il peut utiliser le ballon pour jouer avec des passes dont il est responsable ou donner des opportunités de courses à ses running backs. Le QB a la possibilité de rester protégé dans sa poche ou d'être plus mobile. Il est également responsable des modifications tactiques sur le terrain et mène son équipe entre les jeux offensifs dans le huddle. Le rôle décisif joué par le quarterback en fait l'un des postes les plus médiatisés du sport américain."},{"page_url":"https://en.wikipedia.org/wiki/Loongson","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Lemote-A1310_motherboard.jpg","page_title":"Loongson","context_page_description":"Loongson is a family of general-purpose MIPS64 CPUs developed at the Institute of Computing Technology, Chinese Academy of Sciences in China. The chief architect is Professor Hu Weiwu. It was formerly called Godson.\\nLoongson is the result of a public–private partnership. BLX IC Design Corporation was founded in 2002 by ICT and Jiangsu Zhongyi Group. Based in Beijing, BLX focuses on designing the 64-bit Loongson general-purpose and embedded processors, together with developing software tools and reference platforms.\\nSTMicroelectronics fabricates and markets Loongson chips for BLX, which is fabless."},{"page_url":"https://fi.wikipedia.org/wiki/Bernhard_Kohl","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Bernhard_Kohl_Wels_2008.jpg","page_title":"Bernhard Kohl","context_page_description":"Bernhard Kohl on itävaltalainen entinen maantiepyöräilijä. Hän oli hyvä mäkiajaja.\\nKohl aloitti ammattilaisuransa vuonna 2005 edustaen ensimmäiset kaksi vuotta T-Mobile-tallia. Hän sijoittui Dauphiné Libérén kokonaiskilpailussa kolmanneksi 2006. Samana vuonna hän voitti Itävallan maantieajomestaruuden.\\nKohl siirtyi Gerolsteiner-joukkueseen vuonna 2007, jolloin hän sijoittui Ranskan ympäriajon nuorten kilpailussa neljänneksi. Ranskan ympäriajossa 2008 hän sijoittui Hautacamiin päättyneellä, vuoristossa ajetulla kymmenennellä etapilla neljänneksi. 15. osuuden loppunousussa hän oli paras kokonaiskilpailun kärkiajajista sijoittuen etapilla viidenneksi. Tämän myötä hän nousi yhteistilanteessa toiseksi ja siirtyi mäkikilpailun kärkeen. Hän piti mäkipaidan hallussaan maaliin saakka ja sijoittui kokonaiskilpailussa lopulta kolmanneksi.\\nGerolsteinerin manageri Hans-Michael Holzer ilmoitti 13. lokakuuta 2008 Kohlin kertoneen hänelle, että hänen on ilmoitettu jääneen Ranskan ympäriajon aikana kiinni EPO CERA -hormonin käytöstä. Pari päivää myöhemmin Kohl itse tunnusti sortuneensa kiellettyjen aineiden käyttöön nopeuttaakseen palautumistaan kesäkuussa sattuneesta kaatumisesta."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%9C%9F%E8%80%B3%E5%85%B6%E7%B6%93%E6%BF%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Ankjewels1.jpg","page_title":"土耳其經濟","context_page_description":"土耳其经济发展快速。土耳其在生产农产品、纺织品、汽车、船只及其他运输工具、建筑材料和家用电子产品皆居领导地位。近年来，土耳其在私人部门已有显著发展，然而国有企业于工业、银行业、运输及通讯仍有重要地位。"},{"page_url":"https://it.wikipedia.org/wiki/Giro_d%27Italia_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/13_tappa_giro2014.jpg","page_title":"Giro d'Italia 2014","context_page_description":"Il Giro d'Italia 2014, novantasettesima edizione della \\"Corsa Rosa\\", si è svolto in 21 tappe dal 9 maggio al 1º giugno 2014, per un totale di 3 465,4 km. È stato vinto dal colombiano Nairo Quintana della Movistar Team, che ha concluso la corsa in 88h14'32\\", con 2'58\\" di vantaggio sul suo connazionale Rigoberto Urán.\\nQuesta edizione vide il ritorno di Silvio Martinello come commentatore tecnico, dopo quella del 1997 per conto delle reti Mediaset e quelle dal 2003 al 2013 nelle quali forniva i suoi pareri dal pullman regia della RAI."},{"page_url":"https://pt.wikipedia.org/wiki/Shellman","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Shellman%2C_GA.png","page_title":"Shellman","context_page_description":"Shellman é uma cidade localizada no estado americano de Geórgia, no Condado de Randolph."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A6%D1%8F%D1%86%D0%B5%D1%80%D1%8B%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%93%D0%AD%D0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Teterino_Hydroelectric_Power_Station_01.jpg","page_title":"Цяцерынская ГЭС","context_page_description":"Цяцерынская ГЭС — малая гідраэлектрастанцыя ў Магілёўскай вобласці, размешчаная на рацэ Друць. Вызначаная магутнасць 370 кВт.\\nБудаўніцтва Цяцерынскай ГЭС пачалося ў 1952, пуск ў эксплуатацыю адбыўся ў 1955 на пярэдадні кастрычніцкіх святаў. Вызначаная магутнасць 300 кВт. У адпаведнасці з праектам гадавая выпрацоўка станцыі ацэньвалася ў 1,187 млн кВт·гадзін. Станцыя забяспечвала электраэнергіяй 6 калгасаў і г.п. Круглае. У 1993—1996 Цяцерынская ГЭС капітальна адрэмантаваная, рэканструяваны гідратэхнічныя збудаванні і вадасховішча, выкананы работы па добраўпарадкаванню прылягаючай да вадасховішча тэрыторыі. Усталяваныя дзве турбіну агульнай вызначанай магутнасцю 370 кВт. Работы выконвала ТАА «Белэнергарэмналадка». Урачыстае адкрыццё адноўленага гідраэнергавузла адбылося 15.11.1996.\\nЦяцерынскую ГЭС абслугоўвае 1—2 чалавекі. За люты 1998 ГЭС выпрацавала 108 тыс.кВт·гадзін электраэнергіі. За 2005 год выпрацоўка Цяцерынскай ГЭС ацэньвалася ў 1,170 млн.кВт·гадзін. Вадасховішча плошчай 461 га з'яўляецца месцам адпачынку."},{"page_url":"https://pt.wikipedia.org/wiki/Regi%C3%A3o_Sul_do_Brasil","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/A_couple_of_Italian_immigrants_to_Southern_Brazil.jpg","page_title":"Região Sul do Brasil","context_page_description":"A Região Sul do Brasil é a menor das cinco regiões do país, com área territorial de 576 774,31 km², sendo maior que a área da França metropolitana e menor que o estado brasileiro de Minas Gerais. Faz parte da Região Centro-Sul do Brasil. Divide-se em três unidades federativas: Paraná, Santa Catarina e Rio Grande do Sul, sendo limitada ao norte pelos estados de São Paulo e Mato Grosso do Sul, ao sul pelo Uruguai, a oeste pelo Paraguai e pela Argentina, além de ser banhada a leste pelas águas do Oceano Atlântico. É única região brasileira localizada na porção sul abaixo da zona tropical, com as estações do ano variando nitidamente; contudo, a parte norte situa-se acima do Trópico de Capricórnio. No inverno, ocorrem geadas e, com maior raridade, há queda de neve. O relevo da Região Sul tem uma pequena quantidade de acidentes geográficos, predominando um grande planalto, geralmente, de pequena elevação.\\nSua maior característica é o modo de colonização e o tipo de colonizadores recebidos. A Região Sul começou a ser colonizada durante os séculos XVII e XVIII. Em 1648, os portugueses foram os fundadores da vila de Paranaguá, a mais antiga cidade da Região Sul e do Paraná."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%8F_%D0%BF%D0%BE%D1%87%D1%82%D1%8B_%D0%B8_%D0%BF%D0%BE%D1%87%D1%82%D0%BE%D0%B2%D1%8B%D1%85_%D0%BC%D0%B0%D1%80%D0%BE%D0%BA_%D0%9A%D0%B8%D1%82%D0%B0%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Shanghai_stamp_1877_-_1_candareen_on_12_candareen.jpg","page_title":"История почты и почтовых марок Китая","context_page_description":"История почты и почтовых марок Китая отражает развитие почтовой связи в Китае в периоды:\\nпостепенного упадка императорского Китая с возникновением Китайской Республики, во время которого начались эмиссии собственных почтовых марок страны и членство во Всемирном почтовом союзе,\\nгражданской войны,\\nяпонской оккупации Китая в 1930-е — 1940-е годы и\\nпослевоенного времени."},{"page_url":"https://vi.wikipedia.org/wiki/Brachionichthys_hirsutus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/CSIRO_ScienceImage_13_A_Female_Spotted_Handfish_With_Eggs.jpg","page_title":"Brachionichthys hirsutus","context_page_description":"Cá tay đốm là một loài cá trong họ Brachionichthyidae, chúng được biết đến ngay từ chính cái tên của nó. Thay vì bơi lội, những con cá hiếm hoi này tiến hóa vây ngực thành đôi tay và sử dụng tay để đi bộ trên đáy biển."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A2%D1%83%D1%82%D1%83%D1%82%D0%BD%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Image_from_page_755_of_%22Bulletin%22_%281901%29_%2820418075722%29.jpg","page_title":"Тутутні","context_page_description":"Тутутні — плямёны ціхаакіянскіх атабаскаў, што да сярэдзіны XIX ст. насялялі паўднёва-заходняе ўзбярэжжа Арэгона. Нашчадкі тутутні насяляюць 2 рэзервацыі ў гэтым штаце.\\nАгульную назву тутутні адносяць да племянных аб'яднанняў, што насялялі бераг Ціхага акіяна і землі ўздоўж ракі Роўг. Іх агульная колькасць вагалася ад 7 да 12. Яны размаўлялі на аднолькавай мове, што падзялялася на 3 дыялекты.\\nГалоўнымі заняткамі былі збіральніцтва, рыбалоўства і паляванне. Асаблівую ролю ў забеспячэнні адыгрываў лоў ласося. Яму папярэднічала свята, прысвечанае гэтай рыбіне. Тутутні будавалі лодкі, прыдатныя для лову на рацэ і ў акіяне. Карысталіся ракавінамі малюскаў у якасці грошай.\\nНазапашванне багацця лічылася важным для падвышэння сацыяльнага статуса. Найбольш заможныя мужчыны кіравалі вясковымі абшчынамі, практыкавалі палігінію, размяркоўвалі вынікі супольнага лову, але павінны былі аказваць дапамогу найбольш бедным.\\nУ 1851 г. на тэрыторыі тутутні быў заснаваны Порт-Орфард, што прывяло да росту амерыканскага насельніцтва і яго канфліктам з індзейцамі. У 1855 - 1856 гг. канфлікты перараслі ў крывавыя сутычкі, вядомыя як войны на рацэ Роўг."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B8%89%E9%97%A8%E5%B3%A1%E5%8D%97%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Plaza%2C_Sanmenxia_South_Railway_Station_-_panoramio.jpg","page_title":"三门峡南站","context_page_description":"三門峽南站位於河南省三門峽市陝州區，距三門峽市中心約6公里，是徐蘭客運專線中段鄭西客運專線上一個一等客運站，主要承擔著三門峽市、運城市、陝縣、平陸縣來往旅客運輸任務。"},{"page_url":"https://sv.wikipedia.org/wiki/Dendrobium_moniliforme","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Flower-center130851.jpg","page_title":"Dendrobium moniliforme","context_page_description":"Dendrobium moniliforme är en orkidéart som först beskrevs av Carl von Linné, och fick sitt nu gällande namn av Olof Swartz. Dendrobium moniliforme ingår i släktet Dendrobium, och familjen orkidéer. IUCN kategoriserar arten globalt som starkt hotad. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://es.wikipedia.org/wiki/Faro_Les_%C3%89claireurs","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Les_Eclaireurs_Lighthouse.jpg","page_title":"Faro Les Éclaireurs","context_page_description":"Les Éclaireurs es un faro emplazado en el islote NE del conjunto de islotes Les Éclaireurs en el canal Beagle, frente a las costas de la bahía de Ushuaia, en Tierra del Fuego, Argentina.\\nEl faro consiste en una torre ligeramente troncocónica de ladrillo, de 11 metros de altura y 3 metros de diámetro, pintada en tres franjas: roja, blanca y roja. La linterna se halla a 22,5 metros sobre el nivel del mar y emite luz de color blanco y rojo a intervalos de 5 segundos. Tiene un alcance óptico de 7,2 millas náuticas y es alimentada por paneles solares.\\nEl conjunto de islotes que dan nombre al faro fueron bautizados por el Capitán de Fragata Luis Fernando Martial, al mando de la expedición francesa La Romanche en los años 1882-1883.​\\nEl faro fue librado al servicio el 23 de diciembre de 1920 y en la actualidad se encuentra en funcionamiento, de forma automática, controlado a distancia y cerrado al público."},{"page_url":"https://zh.wikipedia.org/wiki/2008%E5%B9%B4%E5%A4%8F%E5%AD%A3%E6%AE%98%E7%96%BE%E4%BA%BA%E5%A5%A7%E6%9E%97%E5%8C%B9%E5%85%8B%E9%81%8B%E5%8B%95%E6%9C%83%E5%93%A5%E5%80%AB%E6%AF%94%E4%BA%9E%E4%BB%A3%E8%A1%A8%E5%9C%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Flag_of_Colombia.svg","page_title":"2008年夏季殘疾人奧林匹克運動會哥倫比亞代表團","context_page_description":"2008年夏季残疾人奥林匹克运动会哥伦比亚代表团于2008年9月6日至17日参加在中国北京举行的第13届残疾人奥运会。\\n哥伦比亚在本届残奥会将派出运动员出战包括田径、游泳等项目。"},{"page_url":"https://it.wikipedia.org/wiki/Bernardo_Falconi","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Santa_Maria_degli_Scalzi_%28Venice%29.jpg","page_title":"Bernardo Falconi","context_page_description":"Bernardo Falconi, o Falcone, detto anche Bernardino da Lugano, è stato uno scultore svizzero-italiano."},{"page_url":"https://de.wikipedia.org/wiki/Ensiferum","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Ensiferum_Rockharz_2016_28.jpg","page_title":"Ensiferum","context_page_description":"Ensiferum ist eine finnische Metal-Band, die meist dem Viking- oder Folk-Metal zugeordnet wird. Sie wurde 1995 von Markus Toivonen, Sauli Savolainen und Kimmo Miettinen gegründet. Von den Genannten spielt heute nur noch Toivonen bei Ensiferum. Er schreibt größtenteils die Musik der Stücke. Bislang wurden sieben reguläre Studioalben und eine EP veröffentlicht, daneben eine Live-DVD sowie eine Wiederveröffentlichung der Demos."},{"page_url":"https://en.wikipedia.org/wiki/Thuringian_Basin","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Naturraumkarte_Thueringer_Becken.png","page_title":"Thuringian Basin","context_page_description":"The Thuringian Basin is a depression in the central and northwest part of Thuringia in Germany which is crossed by several rivers, the longest of which is the Unstrut. It stretches about 60 kilometres from north to south and around 120 kilometres from east to west. Its height varies from about 150 to 250 m above sea level.\\nThe Basin is surrounded by a wide outer girdle of limestone ridges, and to the southwest by the Thuringian Forest and to the southeast by sharply divided terraces. The Thuringian Basin belongs to the triassic period, during which horizontal beds of Bunter sandstone, Muschelkalk and Keuper were laid down. Below those lie the salt and gypsum layers of Magnesian Limestone. In the Cenozoic era the surrounding ridges were uplifted, whilst the Thuringian Basin sank to form a saucer-shaped depression.\\nThe elevation of the Thuringian Basin descends from the south and west to the east. While some of the marginal ridges have the character of low mountain ranges, there are no really noteworthy uplands within it, apart from the Ettersberg and Fahnerscher Höhe.\\nThe Thuringian Basin is dominated by agriculture."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B4%D0%B6%D0%B5%D1%80_%D0%91%D0%B8%D0%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Thetford_Priory_ruins.jpg","page_title":"Роджер Биго","context_page_description":"Роджер Биго́ — нормандский рыцарь, участник нормандского завоевания Англии в 1066 г., основатель дворянского рода Биго — будущих графов Норфолк."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%B0%E1%83%9D%E1%83%A0%E1%83%A1%E1%83%A2_%E1%83%99%E1%83%94%E1%83%9A%E1%83%94%E1%83%A0%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Horst_K%C3%B6hler.jpg","page_title":"ჰორსტ კელერი","context_page_description":"ჰორსტ კელერი — გერმანელი ეკონომისტი და პოლიტიკური მოღვაწე, საერთაშორისო სავალუტო ფონდის გენერალური დირექტორი 2000-2004 წლებში და გერმანიის ბუნდესპრეზიდენტი 2004 წლიდან 2010 წლამდე."},{"page_url":"https://es.wikipedia.org/wiki/Flora_de_Venezuela","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Restrepia_lansbergii_Orchi_01.jpg","page_title":"Flora de Venezuela","context_page_description":"Venezuela al ser un país del trópico tiene una gran representación de grupos taxonómicos en fauna y flora típica del área a la que se suman variedades de migraciones de fauna desde distintas partes del planeta por la variedad de ecosistemas. Venezuela posee diferentes tipos de relieves en su geografía, como páramos, montañas nevadas, selvas amazónicas, selva húmeda-tropical, clima de tepuy, vegetación herbácea arbustiva de cerros amazónicos, bosques bajos, bosques húmedos y catingales amazónicos, sabanas llaneras, matorrales xerofíticos y desiertos, bosques aluviales, bosques húmedos tropicales, bosques de manglar, bosques y vegetación de pantano, las sabanas del Caribe, bosques andinos, bosques secos o subhúmedos tropicales e islas y archipiélagos en el mar Caribe. Es por esto que Venezuela está entre los 17 países más megadiversos del mundo y así entrando en el top 10 de los países con más biodiversidad del mundo. Venezuela es el 7° país con más especies de plantas vasculares en el mundo.​\\nVenezuela posee alrededor de 30.000 a 35.000​​especies de plantas, de las cuales más de 8.000 son endémicas y únicas del país."},{"page_url":"https://es.wikipedia.org/wiki/Heiligenstadt_in_Oberfranken","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Traindorf_Bevoelkerungsanteil_Heiligenstadt_in_Oberfranken.png","page_title":"Heiligenstadt in Oberfranken","context_page_description":"Heiligenstadt in Oberfranken es una comunidad con derechos comerciales en el distrito de la Alta Franconia en Bamberg.\\nPara fomentar el turismo, la antigua escuela fue reconvertida en el actual ayuntamiento, el mercado histórico fue remodelado y durante la Semana Santa se adorna con una fuente de pascua. También se transformó un antiguo granero en un centro comunitario.\\nEsta comunidad, con sus casitas que gozan de antiquísima protección y su interesante iglesia histórica, es un afamado destino turístico.\\nLos visitantes acuden sobre todo durante la Pascua para admirar las famosas fuentes de pascua suizas.\\nLa iglesia evangélica St.-Veit- und St.-Michaels-Kirche se remonta a un antiguo granero de diezmo. La torre del campanario se yergue sobre los restos de un antiguo castillo. Las galerías de madera y los paneles de los techos están recubiertos de complejas pinturas barrocas, lo cual no suele darse en una iglesia evangélica."},{"page_url":"https://en.wikipedia.org/wiki/Zduha%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Zamenis_longissimus_tree.jpg","page_title":"Zduhać","context_page_description":"A zduhać and vetrovnjak in Serbian tradition, and a dragon man in Bulgarian, Macedonian and Serbian traditions, were men believed to have an inborn supernatural ability to protect their estate, village, or region against destructive weather conditions, such as storms, hail, or torrential rains. It was believed that the souls of these men could leave their bodies in sleep, to intercept and fight with demonic beings imagined as bringers of bad weather. Having defeated the demons and taken away the stormy clouds they brought, the protectors would return into their bodies and wake up tired.\\nNotions associated with the zduhać, vetrovnjak, and dragon man, respectively, are not identical. The dragon man fought against female demons called ala, which led hail clouds over fields to destroy crops, and consumed the fertility of the fields. The zduhaći of an area usually fought together against the attacking zduhaći of another area who were bringing a storm and hail clouds above their fields. The victorious zduhaći would loot the yield of all agricultural produce from the territory of their defeated foes, and take it to their own region."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B3%D5%A1%D5%B6%D5%B1%D5%A1%D5%AF_(%D4%B3%D5%A5%D5%B2%D5%A1%D6%80%D6%84%D5%B8%D6%82%D5%B6%D5%AB%D6%84%D5%AB_%D5%B4%D5%A1%D6%80%D5%A6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/%D4%B3%D5%A1%D5%B6%D5%B1%D5%A1%D5%AF_%D5%A3%D5%B5%D5%B8%D6%82%D5%B2%2C_%D4%B3%D5%A5%D5%B2%D5%A1%D6%80%D6%84%D5%B8%D6%82%D5%B6%D5%AB%D6%84%D5%AB_%D5%B4%D5%A1%D6%80%D5%A6_%282%29.jpg","page_title":"Գանձակ (Գեղարքունիքի մարզ)","context_page_description":"Անվան այլ կիրառումների համար տե՛ս՝ Գանձակ\\nԳանձակ, գյուղ Հայաստանի Գեղարքունիքի մարզում։"},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Dominique_de_Roura","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/P1000151_Roura.jpg","page_title":"Église Saint-Dominique de Roura","context_page_description":"L'église Saint-Dominique est une église situé sur la commune de Roura en Guyane."},{"page_url":"https://eu.wikipedia.org/wiki/Ezkontza","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Van_Eyck_-_Arnolfini_Portrait.jpg","page_title":"Ezkontza","context_page_description":"Ezkontza bi pertsonak elkarrekin bizitzeko asmoz hitzarmenez egindako elkartzea da, lege zibilak, erlijiosoak edo ohiturak arautua izan daitekeena. Erlijio katolikoan, zazpi sakramentuetako bat da. Instituzio honek sortzen dituen pertsonen arteko harremanak, gehienetan barrukoak eta sexualak, kulturaren arabera aldatzen dira. Normalean, elkartzea era formal batean ospatzeko ezteiak izeneko zeremonia egiten dute.\\nEzkontzeko arrazoiak ezkongaiaren arabera aldatzen dira, hurrengoetako bat edo gehiago izanik: legalak, sozialak, emozionalak, ekonomikoak, espiritualak edota erlijiosoak.\\nEzkontza ohiturak kulturen arabera aldatzen dira. Gehienetan, gizon baten eta emakume baten arteko ezkontza onartzen da, baina badira bestelako elkarteak onartzen dituztenak: sexu berekoen arteko ezkontzak, senar bat eta emazte asko edo emazte bat eta senar asko. Gizarte gehienek ezkontzetan murrizte batzuk arautzen dituzte: ezkongaien adina, ahaidetasun-maila edo talde sozial edo erlijioso ezberdinetakoa izatea.\\nEzkontzak betebehar juridiko eta sozialak sortzen dizkie ezkongaiei, batzuetan bere familiaren zenbait kidetara zabaltzen direnak."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%BB%91%E6%9A%97%E9%A8%8E%E5%A3%AB%EF%BC%9A%E9%BB%8E%E6%98%8E%E6%98%87%E8%B5%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/2012_British_GP_-_Lotus.jpg","page_title":"黑暗騎士：黎明昇起","context_page_description":"《黑暗騎士：黎明昇起》是一部於2012年上映的超級英雄電影，由克里斯多福·諾蘭執導，並與他的弟弟強納森·諾蘭共同編劇。故事由諾蘭和大衛·S·高耶所提供。該片為諾蘭所執導的黑暗騎士三部曲中的最後一部作品，且是《蝙蝠俠：開戰時刻》及《黑暗騎士》的續集。克里斯汀·貝爾、米高·肯恩、蓋瑞·歐德曼及摩根·費里曼分別於電影中飾演布魯斯·韋恩 / 蝙蝠俠、阿福·潘尼沃斯、詹姆斯·高登與盧修斯·福斯。電影還出現了塞琳娜·凱爾和班恩。\\n背景設定於上部《黑暗騎士》的八年後，新敵人班恩的無情虛假革命迫使隱居的布魯斯·韋恩復出成為蝙蝠俠，並從核危機之中拯救高譚市。劇情靈感來源自著名蝙蝠俠漫畫《蝙蝠俠：騎士隕落》、《蝙蝠俠：黑暗騎士歸來》和《蝙蝠俠：無人地帶》。導演克里斯多福·諾蘭最初對電影蝙蝠俠第三部的發展有所猶豫，由於前作《黑暗騎士》獲得的高評價，諾蘭擔心三部曲可能無法超越二部曲的優異表現，但最終同意製作。拍攝地點包含焦特布爾、倫敦、諾丁漢、格拉斯哥、洛杉磯、紐約市、紐華克及匹茲堡。諾蘭使用IMAX 70毫米膠片攝影機拍攝多數場景，包含電影的前六分鐘，以強化畫面的品質。\\n電影的首映禮於2012年7月16日在紐約市舉行。7月19日在台灣、香港、澳大利亞和紐西蘭上映，7月20日於美國及英國發行。該片收穫普遍影評人的肯定，其中許多人將其譽為2012年最佳電影之一。如同電影的前作，《黑暗騎士：黎明昇起》於全球進帳逾10億美元，使其成為蝙蝠俠系列電影中第二賣座的作品。該片在全球歷史票房總榜上名列第30名，同時亦於2012年的票房排行上名列第三。電影首映當天，在美國科羅拉多州奧羅拉的一家正放映該片的電影院內發生嚴重槍擊案件，造成12人死亡，58人受傷。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%B0%D0%BB%D1%96%D0%B7%D0%BD%D0%B8%D1%87%D0%BD%D0%B8%D0%B9_%D1%82%D1%80%D0%B0%D0%BD%D1%81%D0%BF%D0%BE%D1%80%D1%82_%D0%90%D0%B7%D0%B5%D1%80%D0%B1%D0%B0%D0%B9%D0%B4%D0%B6%D0%B0%D0%BD%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/1996_The_115th_Anniversary_of_Azerbaijan_Railway.jpg","page_title":"Залізничний транспорт Азербайджану","context_page_description":"Залізничний транспорт в Азербайджані — найбільша за довжиною та обсягом перевезень мережа ширококолійних залізниць загального користування в Закавказзі. Загальна протяжність становить 2125 км, з яких 1278 км електрифіковані. З 2010 р. очікується поступовий перехід з постійного струму на змінний."},{"page_url":"https://es.wikipedia.org/wiki/Milenario_de_Rusia","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/1000_Innokenty.jpg","page_title":"Milenario de Rusia","context_page_description":"Milenario de Rusia o Milenio de Rusia es un monumento patriótico ruso, ubicado en la ciudad de Nóvgorod. Fue erigido en 1862 para conmemorar los mil años de existencia del Estado ruso; el concepto general del proyecto corrió a cargo del escultor Mijaíl Mikeshin.\\nEl monumento se encuentra en el Kremlin de Nóvgorod, entre la Catedral de Santa Sofía y el edificio principal del Museo Estatal de Nóvgorod.\\nEstá declarado como Patrimonio nacional de la Federación de Rusia, e incluido desde 1992 por la Unesco como parte del Patrimonio de la Humanidad de la ciudad de Nóvgorod bajo el título de «Monumentos históricos de Nóvgorod y sus alrededores».​"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D1%8F%D0%BA%D0%BE%D0%B2%D1%81%D1%8C%D0%BA%D0%B0_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D1%96%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE,_%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/02_%D0%A2%D1%83%D1%80%D0%BD%D0%B8%D0%BA%D0%B5%D1%82%D1%8B_%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0%2C_%D1%81%D1%82.%D0%BC._%D0%9C%D0%B0%D1%8F%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F%2C_2-01-2008.jpg","page_title":"Маяковська (станція метро, Москва)","context_page_description":"«Маяковська» — станція Замоскворіцької лінії Московського метрополітену. Розташована між станціями «Білоруська» і «Тверська», на території Тверського району Центрального адміністративного округу міста Москви."},{"page_url":"https://pt.wikipedia.org/wiki/Mam%C3%ADferos_da_pen%C3%ADnsula_Ib%C3%A9rica","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Leefgebied_boommarter.JPG","page_title":"Mamíferos da península Ibérica","context_page_description":"Lista dos mamíferos silvestres que vivem na Península Ibérica. Inclui espécies autóctones e exóticas estabelecidas."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A7%D0%B5%D1%82%D0%B2%D0%B5%D1%80%D0%BE%D0%B5%D0%B2%D0%B0%D0%BD%D0%B3%D0%B5%D0%BB%D0%B8%D0%B5_%D0%BD%D0%B0_%D1%86%D0%B0%D1%80_%D0%98%D0%B2%D0%B0%D0%BD_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%8A%D1%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Ivan_ALexander_and_his_family_Tetraevangelia.jpg","page_title":"Четвероевангелие на цар Иван Александър","context_page_description":"Четвероевангелието на цар Иван Александър е илюстрован ръкопис на среднобългарски език, преписан през 1355 – 1356 г. от монаха Симеон за цар Иван Александър."},{"page_url":"https://cs.wikipedia.org/wiki/Kochova_k%C5%99ivka","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Koch_surface_0_through_3.png","page_title":"Kochova křivka","context_page_description":"Kochova křivka je matematická křivka, jedna z prvních popsaných fraktálních křivek. Známější je jako součást Kochovy vločky, vytvořené ze tří spojených Kochových křivek. Křivka je pojmenována po švédském matematikovi Helge von Kochovi, který ji popsal ve své práci Sur une courbe continue sans tangente, obtenue par une construction géométrique élémentaire z roku 1904."},{"page_url":"https://pl.wikipedia.org/wiki/Gorbio","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Gorbio_BW_2.JPG","page_title":"Gorbio","context_page_description":"Gorbio – miejscowość i gmina we Francji, w regionie Prowansja-Alpy-Lazurowe Wybrzeże, w departamencie Alpy Nadmorskie.\\nWedług danych na rok 1990 gminę zamieszkiwało 930 osób, a gęstość zaludnienia wynosiła 132 osoby/km²."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%B6%D0%B5%D1%84%D1%84%D1%80%D1%96_%D0%9A%27%D1%94%D0%B7%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/Jeffrey_Chiesa%2C_official_portrait%2C_113th_Congress.jpg","page_title":"Джеффрі К'єза","context_page_description":"Джеффрі Скотт К'єза — американський юрист і політик-республіканець, сенатор США від штату Нью-Джерсі з червня по жовтень 2013.\\nПісля навчання в Університеті Нотр-Дам, К'єза закінчив Школу права Католицького університету Америки і почав кар'єру адвоката.\\nПісля чотирнадцяти років роботи в юридичній фірмі, у 2002 році він пішов працювати до офісу окружного прокурора Кріса Крісті. Покинув посаду у 2009, коли Крісті був обраний губернатором Нью-Джерсі. У грудні 2011 Крісті призначив К'єзу генеральним прокурором штату."},{"page_url":"https://hu.wikipedia.org/wiki/Saint-Julien-de-Coppel","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Saint-Julien-de-Coppel%2C_Kapelle_Notre_Dame_de_Roche.jpg","page_title":"Saint-Julien-de-Coppel","context_page_description":"Saint-Julien-de-Coppel település Franciaországban, Puy-de-Dôme megyében. Lakosainak száma 1276 fő. +/- Saint-Julien-de-Coppel Billom, Busséol, Isserteaux, Laps, Montmorin, Saint-Georges-sur-Allier és Sallèdes községekkel határos."},{"page_url":"https://en.wikipedia.org/wiki/German_submarine_U-1165","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/U995_2004_1.jpg","page_title":"German submarine U-1165","context_page_description":"German submarine U-1165 was a Type VIIC/41 U-boat built for Nazi Germany's Kriegsmarine for service during World War II.\\nShe was laid down on 31 December 1941 by Danziger Werft, Danzig as yard number 137, launched on 20 July 1943 and commissioned on 17 November 1943 under Oberleutnant zur See Hans Homann."},{"page_url":"https://hu.wikipedia.org/wiki/Ford_Escort","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/1975_Ford_Escort_1100L%2C_Museum_of_Liverpool_%28geograph_4545485%29.jpg","page_title":"Ford Escort","context_page_description":"A Ford Escort egy alsó középkategóriás autó, melyet a Ford of Europe gyártott 1967 és 2004 között. A Ford Escort nevet Észak-Amerikában is alkalmazták, egy 1981 és 2003 között gyártott járműre. 2014-ben Kínában ismét visszatért az Escort típusnév: egy a második generációs Ford Focuson alapuló autót neveztek el így."},{"page_url":"https://en.wikipedia.org/wiki/Benjam%C3%ADn_M%C3%A1ximo_Laguna_y_Villanueva","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/M%C3%A1ximo_Laguna_y_Villanueva.jpg","page_title":"Benjamín Máximo Laguna y Villanueva","context_page_description":"Benjamín Máximo Laguna y Villanueva was a Spanish botanist and entomologist.\\nWhile the standard form of his name is \\"Laguna\\", he is sometimes referred to by both surnames \\"Laguna y Villanueva\\"."},{"page_url":"https://fi.wikipedia.org/wiki/Abbas_Kiarostami","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Kiarostami-1940.jpg","page_title":"Abbas Kiarostami","context_page_description":"Abbas Kiarostami oli kansainvälisesti arvostettu iranilainen elokuvaohjaaja, käsikirjoittaja ja elokuvatuottaja."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AC%E3%83%8A%E5%B7%9D%E3%81%AE%E6%9F%B1%E7%BE%A4","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/Lenapillarsriverview.JPG","page_title":"レナ川の柱群","context_page_description":"レナ川の柱群は、ロシア連邦のシベリア極東部、レナ川沿いに見られる自然岩の地形であり、サハ共和国の首都ヤクーツクから上流約180キロメートル、ボートで1日もかからない距離の場所に存在している。柱群の高さは150メートルから300メートルで、カンブリア紀の海盆の隆起と、100度にもなる年較差がもたらす浸食作用で形成されたものである。一帯は1995年にレナ石柱自然公園に指定され、2012年にはそれがUNESCOの世界遺産リストに登録された。"},{"page_url":"https://fr.wikipedia.org/wiki/Louis_Daguerre","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Bry_MaisonDaguerre_5529.jpg","page_title":"Louis Daguerre","context_page_description":"Louis Daguerre, né le 18 novembre 1787 à Cormeilles-en-Parisis, mort le 10 juillet 1851 à Bry-sur-Marne, est un peintre et photographe français. Sa commercialisation du daguerréotype inspiré des travaux de Joseph Nicéphore Niépce a fait qu'il a un temps été considéré comme l'inventeur de la photographie.\\nIl épouse le 10 novembre 1810 Louise Georgina Smith à Paris."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%A0%D0%B5%D0%B1%D1%83%D1%80%D0%B3-%D0%9B%D0%BE%D0%BA%D0%BA%D1%83%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Stadtwappen_der_Stadt_Rehburg-Loccum.png","page_title":"Ребург-Локкум","context_page_description":"Ребург-Локкум — Германия Федеративтік Республикасының Төменгі Саксония жерінде орналасқан қала. Ниэнбург-на-Везере ауданының құрамына енеді.\\nҚаланың тұрақты тұрғындарының саны 10 384 адамды құрайды. Алып жатқан жер аумағы 99,99 км² шамасында. Мемлекет ішінде бекітілген ресми коды — 03 2 56 025. Қаланың басшысы — Дитер Хюземан."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8D%97%E6%B3%95%E8%8F%AF%E5%AF%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Minamihokke-ji_Temple_-_Daiseki-d%C3%B4_-_Entrance.jpg","page_title":"南法華寺","context_page_description":"南法華寺は、奈良県高市郡高取町にある真言宗系単立の寺院。山号は壺阪山。一般には壺阪寺の通称で知られる。西国三十三所第6番札所で本尊は十一面千手観世音菩薩。\\n本尊真言：おん ばざら たらま きりく そわか\\nご詠歌：岩をたて水をたたえて壺阪の 庭のいさごも浄土なるらん"},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D8%B1%D8%AF%D9%84%D8%8C_%D8%AC%D9%88%D8%B1%D8%AC%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Cordele_City_Hall.JPG","page_title":"کردل، جورجیا","context_page_description":"کردل، جورجیا یک شهر در ایالات متحده آمریکا با جمعیت ۱۱٬۶۰۸ نفر است که در جورجیا واقع شده‌است."},{"page_url":"https://de.wikipedia.org/wiki/Max_Emden","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/VillaEmdenBrissago1.JPG","page_title":"Max Emden","context_page_description":"Max James Emden war ein deutscher Chemiker, Großkaufmann, Kunstsammler und seit 1927 Eigentümer der Isole di Brissago im Lago Maggiore."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BB%D0%B5%D1%80%D1%83%D1%85%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/EPMA-6798-6815-12936-IGI%283%291-Salamis_clerouchs-2.JPG","page_title":"Клерухия","context_page_description":"Клерухи́я — владения граждан какого-либо древнегреческого государства, располагавшиеся вне его пределов. Известны главным образом только клерухии афинян, но их имели и другие государства. Для Афин клерухия была одним из средств контроля над союзниками и важными морскими путями."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Burgen_und_Schl%C3%B6ssern_in_Sachsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Schloss_Leubnitz_-_Andreas_Wetzel.jpg","page_title":"Liste von Burgen und Schlössern in Sachsen","context_page_description":"Die Liste von Burgen und Schlössern in Sachsen ist ein Verzeichnis von Burgen, Schlössern, Herrensitzen und Festungen im heutigen Freistaat Sachsen. Die Liste ist nach Landkreisen geordnet. Nicht aufgeführt sind Zier- und Nachbauten, die nie als Wohngebäude oder zur Verteidigung genutzt wurden.\\nIn einer Zusammenstellung aller Burgen in Sachsen durch Gerhard Billig und Heinz Müller werden 821 sicher nachweisbare Anlagen erfasst, darunter etwa 150 Wehranlagen, die als „castrum, munitio, sloss, Feste“ oder „hus“ direkt historisch erwähnt sind. Heinz Müller und Heyko Dehn nannten im Jahr 2006 723 hoch- und spätmittelalterliche Wehranlagen, die von der modernen Forschung in Sachsen erfasst sind, von denen sie wiederum 93 Objekte auswählten, die „touristisch interessant sind, das heißt mit Bauresten noch einen bemerkenswerten Anschauungswert bieten und in der sächsischen Geschichte Spuren hinterließen“."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B0%D1%81%D1%81%D1%82%D1%80%D0%B5%D0%BB_%D0%B2_%D0%90%D0%B3%D1%80%D0%B8%D0%BD%D0%B8%D0%BE%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/AGRINIO-4.jpg","page_title":"Расстрел в Агринионе","context_page_description":"Расстрел в Агринионе — расстрел 120 человек греческого гражданского населения, совершённый солдатами Вермахта 14 апреля 1944 года, в Агринионе, во время тройной, германо-итало-болгарской, оккупации Греции, в годы Второй мировой войны."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%87%AD%E9%BC%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Mephitis_mephitis_range_map.png","page_title":"臭鼬","context_page_description":"臭鼬，是臭鼬科最著名的一种动物。"},{"page_url":"https://pt.wikipedia.org/wiki/Regi%C3%A3o_de_Governo_de_Araraquara","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/%C3%81rea_Central_de_Araraquara.jpg","page_title":"Região de Governo de Araraquara","context_page_description":"A Região de Governo de Araraquara é uma das 42 regiões de governo do estado brasileiro de São Paulo, pertencente à Região Administrativa Central. É formada por quinze municípios da microrregião de Araraquara junto com o município de Cândido Rodrigues, Fernando Prestes, Santa Ernestina e Taquaritinga. As maiores cidades são: Araraquara com 222.036 habitantes e Matão com 80.528 habitantes. A região conta com um Hospital Estadual, na cidade de Américo Brasiliense."},{"page_url":"https://pl.wikipedia.org/wiki/Zakrze","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/92/Kapliczka_Zakrze.jpg","page_title":"Zakrze","context_page_description":"Zakrze – wieś w Polsce położona w województwie mazowieckim, w powiecie łosickim, w gminie Łosice.\\nW latach 1975–1998 miejscowość administracyjnie należała do województwa bialskopodlaskiego.\\nZakrze leży przy drodze Łosice – Korczew około 3 km na północny zachód od Łosic, w odległości ok. 3 km od stacji kolejowej Niemojki. W Zakrzu znajduje się wytwórnia wyrobów betonowych SUPERBET."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%A1%D0%BB%D1%8E%D0%B4%D1%8F%D0%BD%D0%BA%D0%B0_(%D2%9B%D0%B0%D0%BB%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Slyudyanka_coat_of_arms.jpg","page_title":"Слюдянка (қала)","context_page_description":"Слюдянка — қала, Иркутск облысы Слюдянка ауданының орталығы. Қала Байкөлдің батыс жағасында орналасқан. Халқының саны —18,5 мың адам."},{"page_url":"https://oc.wikipedia.org/wiki/Med%C3%A8a","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Eug%C3%A8ne_Ferdinand_Victor_Delacroix_031.jpg","page_title":"Medèa","context_page_description":"Dins la mitologia grèga, Medèa es la filha d'Eetés e d'Idiia. Lo nom de Medèa es eissit del verb grèc μηδομαι « meditar », venent de la raíç d'origina benlèu medica « med »: comprendre, concebre. Aquel nom revèla benlèu lo saber o la capacitat de rasonar d'aquel personatge. Es masca, coma sa tanta Circè que se tròba per exemple dins l'Odissèa d'Omèr, aède grèc del sègle IX AbC."},{"page_url":"https://nl.wikipedia.org/wiki/Abdul-Yakuni_Iddi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Abdul_Yakuni_Iddi.jpg","page_title":"Abdul-Yakuni Iddi","context_page_description":"Abdul-Yakinu Iddi is een Ghanese voetballer. Hij is afkomstig van de Feyenoord Academy in het Ghanese Fetteh. Feyenoord stalde hem daarna één seizoen bij KV Mechelen. Na afloop van dat seizoen tekende hij daar een vast contract. In het seizoen 2014-2015 speelt hij op huurbasis in de Belgische Tweede klasse, bij Oud-Heverlee Leuven."},{"page_url":"https://hu.wikipedia.org/wiki/PS10_naph%C5%91er%C5%91m%C5%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/PS10_solar_power_tower_2.jpg","page_title":"PS10 naphőerőmű","context_page_description":"A Planta Solar 10 vagy PS10 naphőerőmű a spanyol Sevilla város mellett épült meg. A 11 megawattos naphőerőmű 624 nagy mozgatható tükörrel fókuszálja a nap sugárzását egy központi toronyra, amelyben nagy fajhőjű sóoldat nyeli el azt, majd ezt a tárolt hőt használják gőzfejlesztésre. Európa első kereskedelmi erőművének megépítésében az Abengoa nevű spanyol multinacionális cég, a Tecnical-Tecnicas Reunidas és a Spanish Engineering Company vett részt.\\nA PS10 naperőmű az építkezések első üteméhez tartozik. 2013 -tól további erőművek épülnek, így végül 300 MW-os teljesítménnyel fog működni a sevillai naperőmű telep."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%9B%E0%B8%A3%E0%B8%B0%E0%B9%80%E0%B8%97%E0%B8%A8%E0%B9%81%E0%B8%AD%E0%B8%87%E0%B9%82%E0%B8%81%E0%B8%A5%E0%B8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Huambo%2C_Jardim_da_Cultura.jpg","page_title":"ประเทศแองโกลา","context_page_description":"แองโกลา หรือชื่ออย่างเป็นทางการว่า สาธารณรัฐแองโกลา คือประเทศในแอฟริกาตะวันตกเฉียงใต้ มีพรมแดนจดกับประเทศนามิเบีย สาธารณรัฐประชาธิปไตยคองโกและประเทศแซมเบีย และมีชายฝั่งทางตะวันตกบนมหาสมุทรแอตแลนติก ส่วนจังหวัดกาบิงดาแยกจากส่วนที่เหลือของประเทศและมีพรมแดนจดสาธารณรัฐคองโก แองโกลาเป็นอดีตอาณานิคมของประเทศโปรตุเกส มีทรัพยากรธรรมชาติอยู่พอสมควร ที่สำคัญคือน้ำมันและเพชร แองโกลาเป็นประเทศที่ปกครองภายใต้ระบอบประชาธิปไตย"},{"page_url":"https://pl.wikipedia.org/wiki/13_P%C3%B3%C5%82brygada_Legii_Cudzoziemskiej","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/13BLE-Bankoual%C3%A9.jpg","page_title":"13 Półbrygada Legii Cudzoziemskiej","context_page_description":"13 Półbrygada Legii Cudzoziemskiej – – jednostka Legii Cudzoziemskiej. Utworzona 20 stycznia 1940 roku. Stacjonująca w Zjednoczonych Emiratach Arabskich do czerwca 2016 roku.\\nObecnie stacjonuje we Francji jako pułk piechoty w miejscowości La Cavalerie w obozie wojskowym Larzac."},{"page_url":"https://ro.wikipedia.org/wiki/Jimmy_Hart","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Jimmy_Hart_in_Toronto.jpg","page_title":"Jimmy Hart","context_page_description":"James „Jimmy” Ray Hart este un manager profesionist de wrestling, compozitor și muzician, semnat cu WWE. El este cunoscut mai mult pentru munca sa în World Wrestling Federation and World Championship Wrestling sub porecla \\"The Mouth of the South\\".\\nJimmy Hart a fost managerul mai multor luptători profesioniști, inclusiv Hulk Hogan, Bret Hart, Jim Neidhart, Greg „The Hammer” Valentine, Jerry „The King” Lawler, „Million Dollar Man” Ted DiBiase, King Kong Bundy, Earthquake, Dino Bravo, Nasty Boys, The Giant și Honky Tonk Man. El este campion al AWA Southern Heavyweight.\\nÎnainte de a se implica în luptele profesioniste, Hart a fost membru al trupei rock The Gentrys, cunoscută pentru hitul lor „Keep on Dancing” care a intrat în top Billboard Hot 100 hit."},{"page_url":"https://en.wikipedia.org/wiki/Mono%E2%80%93Inyo_Craters","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Panum_Crater.jpg","page_title":"Mono–Inyo Craters","context_page_description":"The Mono–Inyo Craters are a volcanic chain of craters, domes and lava flows in Mono County, Eastern California. The chain stretches 25 miles from the northwest shore of Mono Lake to the south of Mammoth Mountain. The Mono Lake Volcanic Field forms the northernmost part of the chain and consists of two volcanic islands in the lake and one cinder cone volcano on its northwest shore. Most of the Mono Craters, which make up the bulk of the northern part of the Mono–Inyo chain, are phreatic volcanoes that have since been either plugged or over-topped by rhyolite domes and lava flows. The Inyo volcanic chain form much of the southern part of the chain and consist of phreatic explosion pits, and rhyolitic lava flows and domes. The southernmost part of the chain consists of fumaroles and explosion pits on Mammoth Mountain and a set of cinder cones south of the mountain; the latter are called the Red Cones.\\nEruptions along the narrow fissure system under the chain began in the west moat of Long Valley Caldera 400,000 to 60,000 years ago. Mammoth Mountain was formed during this period."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A5%D1%80%D1%83%D1%88%D0%BE%D0%B2_(%D0%92%D0%B5%D1%99%D0%BA%D0%B8_%D0%9A%D1%80%D1%82%D0%B8%D1%88)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Hru%C5%A1ov_%28okres_Ve%C4%BEk%C3%BD_Krt%C3%AD%C5%A1%29.jpg","page_title":"Хрушов (Вељки Кртиш)","context_page_description":"Хрушов насељено је мјесто са административним статусом сеоске општине у округу Вељки Кртиш, у Банскобистричком крају, Словачка Република."},{"page_url":"https://nl.wikipedia.org/wiki/Hoogheemraadschap_van_Rijnland","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Hoogheemraadschap_Rijnland_building_Leiden.jpg","page_title":"Hoogheemraadschap van Rijnland","context_page_description":"Het hoogheemraadschap van Rijnland is een van de eenentwintig waterschappen die Nederland telt. Het is gevestigd in Leiden. Het gebied waarin Rijnland werkt, strekt zich uit van Wassenaar tot Amsterdam en van IJmuiden tot Gouda. Dit gebied, dat ruim 1.100 vierkante kilometer groot is, wordt aan de westkant begrensd door de Noordzee."},{"page_url":"https://da.wikipedia.org/wiki/Stormogulernes_Indien","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Mughal_Historical_Map.png","page_title":"Stormogulernes Indien","context_page_description":"Stormogulernes Indien betegner en periode i Indiens historie, der strækker sig fra begyndelsen af 1500-tallet til midt i 1700-tallet, og var kendetegnet af to forskellig kategorier af fremmede magters indtrængen i Det Indiske Subkontinent.\\nFørst ankom fyrstedynastiet stormogulerne fra Afghanistan og Centralasien og op gennem 1500-tallet kom samtidig stadig flere europæerne til Indien. Igennem en årrække fastholdt stormogulerne og de lokale fyrster magten, og europæerne, som på dette tidspunkt i særdeleshed bestod af portugisere, franskmænd, hollændere og briter, havde kun held til at leje sig ind i mindre handelsstationer ud til kysten.\\nStormogulernes dynasti regerede – med seks stormoguler fra den samme slægt – over store dele af det nuværende Indien, Bangladesh, Pakistan og Afghanistan gennem perioden fra ca. 1500 til begyndelsen af 1700-tallet. Det store rige blev generelt styret med konsekvent og kulturelt engageret hånd. Når den lokale modstand mod stormogulernes herredømme var så begrænset som tilfældet var, hang det sammen med, at deres styre var med til at øge den nationale og lokale sikkerhed. Det gavnede også de lokale fyrster."},{"page_url":"https://simple.wikipedia.org/wiki/Ray_Thornton","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/RayThornton.jpg","page_title":"Ray Thornton","context_page_description":"Raymond Hoyt \\"Ray\\" Thornton, Jr. was an American politician. He was a member of the Democratic Party. He was a member of the U.S. Representative for Arkansas' 4th congressional district from 1973 to 1979 and the 2nd district from 1991 to 1997.\\nHe studied among others at Yale University.\\nThornton died in Little Rock, Arkansas on April 13, 2016, aged 87."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9D%B1%E6%AD%A6%E6%9D%B1%E4%B8%8A%E6%9C%AC%E7%B7%9A","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b2/Tobu8000-8111_Sadamine.jpg","page_title":"東武東上本線","context_page_description":"東上本線は、東京都豊島区の池袋駅から埼玉県大里郡寄居町の寄居駅までを結ぶ東武鉄道の鉄道路線。越生線とともに東上線を構成する。ラインカラーは紺色●、駅ナンバリングの路線記号はTJ。旅客案内上はこの路線単体を東武東上線あるいは東上線と呼ぶことがほとんどである。伊勢崎線とともに東武鉄道の基幹路線となっている。"},{"page_url":"https://pl.wikipedia.org/wiki/Amblecote","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Amblecote_In_Bloom.JPG","page_title":"Amblecote","context_page_description":"Amblecote – osada w Anglii, w hrabstwie West Midlands, w dystrykcie Dudley. Leży 6 km od miasta Dudley. W 1961 roku civil parish liczyła 3009 mieszkańców. Amblecote jest wspomniana w Domesday Book jako Elmelecote."},{"page_url":"https://pt.wikipedia.org/wiki/Chasco-poliglota","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Myrmecocichla_cinnamomeiventris_-Mapungubwe_National_Park%2C_Limpopo_Province%2C_South_Africa_-male-8.jpg","page_title":"Chasco-poliglota","context_page_description":"O chasco-poliglota é uma espécie de ave da família Muscicapidae.\\nPode ser encontrada nos seguintes países Benin, Botswana, Burkina Faso, Burundi, Camarões, República Centro-Africana, Chade, República Democrática do Congo, Costa do Marfim, Eritreia, Etiópia, Gana, Guiné, Quénia, Lesoto, Malawi, Mali, Mauritânia, Moçambique, Nigéria, Ruanda, Senegal, África do Sul, Sudão, Essuatíni, Tanzânia, Togo, Uganda, Zâmbia e Zimbabwe.\\nOs seus habitats naturais são savanas áridas."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D9%85%D9%BE_%D8%AF%D9%88%DA%86%D8%B1%D8%AE%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Bike_pump.jpg","page_title":"پمپ دوچرخه","context_page_description":"پمپ دوچرخه یا تلمبه دوچرخه نوعی پمپ باد است که معمولاً برای باد کردن تایر دوچرخه استفاده می‌شود. برای وصل شدن به تایر از یک والو استفاده می‌شود که یکی از دو نوع Schrader valve یا Presta valve است این دو، دو نوع از معروف‌ترین نوع والوهای مورد استفاده در این زمینه هستند. البته نوع سومی از این والوها نیز هست که Dunlop valve خوانده می‌شود ولی فقط با پمپ‌های Presta قابل پر کردن است.\\nمدل‌های پایه‌ای موجود عبارتند از:\\nمدل ایستاده\\nمدل نصب شده روی بدنه دوچرخه\\nمدل دستی\\nمدل پدالی\\nدو منظوره\\nدر مدل ایستاده پمپ توسط یک پیستون که با نیروی دست جابه جا می‌شود کار می‌کند. موقع بالا کشیدن این پیستون هوا را از طریق یک دریچه یک طرفه از بیرون به داخل می‌کشد. هنگام پایین رفتن این پمپ هوا را از داخل پیستون \\"جابه جا\\" می‌کند به درون تایر دوچرخه به همین خاطر به آن پمپ جابه جایی مثبت می‌گویند بیشتر این پمپ هایک فشار سنج نیز روی خود دارند.\\nپمپ‌های الکتریکی برای پر کردن تایرهای ماشین ساخته شده‌اند اما می‌توانند تایرهای دوچرخه را نیز پر کنند اگر قطعهٔ درست برای اتصال موجود باشد. بیشتر پمپ‌ها طراحی شده‌اند که قبل از یک فشار مشخص قطع شوند اما بعضی دیگر این گونه نیستند و برای باد کردن تایرهای بزرگتر ساخته شده‌اند اما اگر با این پمپ‌ها تارهای کوچکتر را باد کنید خطر ترکیدن لاستیک وجود دارد."},{"page_url":"https://fr.wikipedia.org/wiki/Sites_m%C3%A9galithiques_du_Tarn","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Nages_menhir_Barraque.jpg","page_title":"Sites mégalithiques du Tarn","context_page_description":"Les mégalithes du Tarn sont relativement nombreux et diversifiés. Ils relèvent essentiellement du Néolithique final."},{"page_url":"https://es.wikipedia.org/wiki/Patrulla_Azul","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Fiat_C.R.32-Baleari.jpg","page_title":"Patrulla Azul","context_page_description":"La Patrulla Azul fue una unidad aérea del Bando sublevado que operó durante la Guerra civil española. Fue creada en diciembre de 1936 por Joaquín García-Morato, convirtiéndose en una de las unidades más famosas de la Aviación \\"Nacional\\". Algunos de sus integrantes lucharían después en la Segunda guerra mundial junto a la Luftwaffe alemana, integrándose en la Escuadrilla Azul.​"},{"page_url":"https://id.wikipedia.org/wiki/Rikuzentakata,_Iwate","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Takata-matsubara.jpg","page_title":"Rikuzentakata, Iwate","context_page_description":"Rikuzentakata adalah kota yang terletak di Prefektur Iwate, Jepang. Pada 1 Oktober 2019, kota ini memiliki perkiraan populasi 18,500 dan kepadatan penduduk 79.8 orang per km². Total wilayah kota adalah 231.94 km²."},{"page_url":"https://fi.wikipedia.org/wiki/Vasili_Bl%C3%BCcher","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/1923_vasily_bljucher.png","page_title":"Vasili Blücher","context_page_description":"Vasili Konstantinovitš Blücher oli neuvostoliittolainen upseeri.\\nVasili Blücher syntyi talonpojan perheeseen. Hän työskenteli viilarina Pietarissa ja Moskovan lähellä Mytištšissä. Vuosina 1910–1913 hän oli vangittuna lakkoliikkeeseen osallistumisen takia. Ensimmäiseen maailmansotaan Blücher osallistui sotamiehenä ja aliupseerina, ja hän haavoittui vakavasti. Sen jälkeen hän työskenteli Nižni Novgorodin lähellä Sormovossa sekä Kazanissa. Vuonna 1916 hän liittyi bolševikkipuolueeseen.\\nHelmikuun vallankumouksen jälkeen Blücher teki puoluetyötä armeijassa. Marraskuussa 1917 hän oli pystyttämässä neuvostovaltaa Samaraan. Sen jälkeen hänet lähetettiin Tšeljabinskiin, jossa hänet valittiin vallankumouskomitean ja neuvoston puheenjohtajaksi. Tšekkoslovakialaisen armeijakunnan kapinan jälkeen hän johti neuvostojoukkojen vetäytymistä Orenburgista, minkä johdosta hänet palkittiin Venäjän ensimmäisellä punaisen lipun kunniamerkillä. Hän osallistui divisioonankomentajana taisteluihin Koltšakin joukkoja vastaan, Kahovkan sillanpääaseman puolustukseen ja Perekopin valtaukseen.\\nVuosina 1921–1922 Blücher toimi Kaukoidän tasavallan sotaministerinä ja armeijan ylipäällikkönä."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%94%D7%98%D7%A8%D7%94_%D7%9E%D7%95%D7%A8%D7%A0%D7%94","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/96/Matra_Murena_2.2_dashboard.jpg","page_title":"מהטרה מורנה","context_page_description":"מהטרה מורנה היא מכונית ספורט מתוצרת קבוצת ההנדסה הצרפתית \\"מהטרה\\", שיוצרה בין השנים 1980–1983 בצרפת."},{"page_url":"https://vi.wikipedia.org/wiki/Cytisus_procumbens","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Cytisus_procumbens_3.jpg","page_title":"Cytisus procumbens","context_page_description":"Cytisus procumbens là một loài thực vật có hoa trong họ Đậu. Loài này được Spreng. miêu tả khoa học đầu tiên."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%94%D0%B6%D0%B5%D0%BA_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D1%81%D0%BE%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/56/Little_Shop_of_Horrors_Nicholson.JPG","page_title":"Джек Николсон","context_page_description":"Джек Николсон — Америка актёры, кинорежиссёр, сценарист һәм продюсер.\\nНиколсон кино тарихында бөйөк актёрҙарҙың береһе тип һанала. Ул «Оскар» премияһына рекордлы 12 тапҡыр номинациялана. Ул шулай уҡ 1960-сы йылдарҙан башлап һәр ун йыл һайын иң яҡшы роль өсөн «Оскар»ға тәҡдим ителгән ике актёрҙың береһе. 1994 йылда ул ҡаҙаныштары өсөн Америка кино сәнғәте институты премияһы менән бүләкләнгән иң йәш актёрҙарҙың береһе була.\\nДжек Николсон өс «Оскар» һәм BAFTA, ете «Алтын глобус», АҠШ Милли кино тәнҡитселәре советының алты премияһы лауреаты, йәнә АҠШ Кино актёрҙары гильдияһы премияһы еңеүсеһе була. Актёрҙың кинематограф өлкәһендәге «Алтын ҡурай еләге» антипремияһына номинацияһы ла бар."},{"page_url":"https://cs.wikipedia.org/wiki/Perry_Anderson","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Perry_Anderson_at_Fronteiras_do_Pensamento_Porto_Alegre.jpg","page_title":"Perry Anderson","context_page_description":"Perry R. Anderson je britský historik a politický filozof marxistické orientace. Je profesorem historie a sociologie na Kalifornské univerzitě v Los Angeles. Byl spjatý s tzv. Novou levicí. Jeho specializací jsou dějiny idejí. 23 let byl šéfredaktorem vlivné intelektuální revue New Left Review. Jeho bratr Benedict Anderson je rovněž významným sociálním vědcem."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%93%D0%BE%D1%82%D1%84%D1%80%D0%B8%D0%B4_%D1%84%D0%BE%D0%BD_%D0%A4%D0%BB%D0%B5%D0%BA%D0%B5%D0%BD%D1%89%D0%B0%D0%B9%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Fleckenstein.jpg","page_title":"Готфрид фон Флекенщайн","context_page_description":"Готфрид фон Флекенщайн е първият известен благородник от фамилията на имперските министериали Флекенщайн от Елзас и господар на замък Флекенщайн в Елзас. Той е споменат за пръв път през 1129 г.\\nГотфрид фон Флекенщайн има три сина:\\nГодефридус фон Флекенщайн\\nКонрадус фон Флекенщайн, дядо на Хайнрих I фон Флекенщайн\\nФридерикус фон Флекенщайн"},{"page_url":"https://sv.wikipedia.org/wiki/Agneta_Horn","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Det_h%C3%A4r_%C3%A4r_Agneta_Horn_2013-11-05_20-11.jpg","page_title":"Agneta Horn","context_page_description":"Agneta Horn af Björneborg, född 18 augusti 1629 i Riga, död 18 mars 1672 i Stockholm, var en svensk memoarförfattare, mest känd för sin unika dagbok som ger en god inblick i den svenska högadelns familjeliv under stormaktstiden. Hon var dotter till fältmarskalk greve Gustaf Horn och Christina Oxenstierna, dotterdotter till rikskanslern Axel Oxenstierna och svärdotter till Brita De la Gardie. Litterärt och personlighetsmässigt har hon jämförts med Strindberg."},{"page_url":"https://fi.wikipedia.org/wiki/Sorgenfrin_linna","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/Schloss_Sorgenfri_2014.jpg","page_title":"Sorgenfrin linna","context_page_description":"Sorgenfrin linna on linna Kööpenhaminan pohjoispuolella, lähellä Kongens Lyngbytä, Pohjois-Seelantiin johtavan kuninkaantien varrella.\\nAlkuperäisen linnan rakennutti vuosina 1705–1706 lääninkreivi Carl Ahlefeldt arkkitehti François Dieussartin suunnitelmien mukaan. Linna on rakennettu uudelleen useita kertoja.\\nKuninkaallinen perhe on käyttänyt Sorgenfrin linnaa vuodesta 1730 lähtien, ja se on ollut useiden kuninkaallisen perheen jäsenten asuinpaikka, kuten kuninkaiden Kristian VIII ja Kristian X. Se on edelleen kuninkaallisen perheen käytössä."},{"page_url":"https://fr.wikipedia.org/wiki/Colazza","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Colazza_panorama.jpg","page_title":"Colazza","context_page_description":"Colazza est une commune italienne de la province de Novare dans la région du Piémont en Italie."},{"page_url":"https://en.wikipedia.org/wiki/Tr%C3%A0_Ki%E1%BB%87u","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Di_t%C3%ADch_t%C6%B0%E1%BB%9Dng_th%C3%A0nh_Sinhapura_%28Tr%C3%A0_Ki%E1%BB%87u%29.JPG","page_title":"Trà Kiệu","context_page_description":"Trà Kiệu is a village in Duy Xuyên, Quảng Nam Province, Vietnam.\\nIt was the first capital city of the Hindu Champa Kingdom, then named Simhapura, from the 4th century to the 8th century CE. Today nothing remains of the ancient city except the rectangular ramparts."},{"page_url":"https://es.wikipedia.org/wiki/Clase_Izumo_(2015)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/DDH-183_%E3%81%84%E3%81%9A%E3%82%82%282%29.jpg","page_title":"Clase Izumo (2015)","context_page_description":"La Clase Izumo es una serie de dos destructores portahelicópteros de la Fuerza Marítima de Autodefensa de Japón. Los buques de esta clase serán los mayores navíos de superficie de la Armada japonesa, como complemento a los destructores portahelicópteros de clase Hyūga. Desde finales de 2018 se están reconvertiendo en portaaviones para que operen con aviones F-35B​​​."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B2%D0%B8_%D0%97%D0%B5%D0%BB%D0%B0%D0%BD%D0%B4_%D0%BD%D0%B0_%D0%9B%D0%B5%D1%82%D1%9A%D0%B8%D0%BC_%D0%BE%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D1%98%D1%81%D0%BA%D0%B8%D0%BC_%D0%B8%D0%B3%D1%80%D0%B0%D0%BC%D0%B0_2016.","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Flag_of_New_Zealand.svg","page_title":"Нови Зеланд на Летњим олимпијским играма 2016.","context_page_description":"Нови Зеланд је учествовао на Летњим олимпијским играма 2016. које су одржане у Рио де Жанеиру у Бразилу од 5. до 21. августа 2016. године. Олимпијски комитет Новог Зеланда послао је 199 квалификованих спортиста у двадесет спортова. Освојено је осамнаест медаља од тога четири златне. По четири медање освојене су у атлетици и једрењу, три у веслању и кајаку, а по једна у бициклизму, голфу, рагбију седам и стрељаштву."},{"page_url":"https://en.wikipedia.org/wiki/Udayamarthandapuram_Bird_Sanctuary","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Asian_Openbill_%28Anastomus_oscitans%29_in_Kolkata_I_IMG_0495.jpg","page_title":"Udayamarthandapuram Bird Sanctuary","context_page_description":"Udayamarthandapuram Bird Sanctuary is a .45 km² protected area in Tiruvarur District, Tamil Nadu, India at 10°26′59″N 79°27′58″E."},{"page_url":"https://en.wikipedia.org/wiki/Cali","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Estadio_Pascual_Guerrero_visto_desde_Cristo_Rey.jpg","page_title":"Cali","context_page_description":"Santiago de Cali, or Cali, is the capital of the Valle del Cauca department, and the most populous city in southwest Colombia, with an 2,227,642 residents according to the 2018 census. The city spans 560.3 km² with 120.9 km² of urban area, making Cali the second-largest city in the country by area and the third most populous. As the only major Colombian city with access to the Pacific Coast, Cali is the main urban and economic center in the south of the country, and has one of Colombia's fastest-growing economies. The city was founded on 25 July 1536 by the Spanish explorer Sebastián de Belalcázar.\\nCali is also a center for sports in Colombia, and is the only Colombian city to have hosted the Pan American Games. It hosted the 1992 World Wrestling Championships, the ninth edition of the World Games in 2013, the UCI Track Cycling World Championships in 2014 and the World Youth Championships in Athletics in 2015. The city is to host the first ever Junior Pan American Games in 2021."},{"page_url":"https://ro.wikipedia.org/wiki/Comitatul_Washburn,_Wisconsin","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Washburn_county_WI_Shell_Lake_IMG_1660.JPG","page_title":"Comitatul Washburn, Wisconsin","context_page_description":"Comitatul Washburn este situat în statul Wisconsin din Statele Unite. Sediul acestuia este Shell Lake. Conform recensământului din anul 2000, populația sa a fost 16.036 de locuitori."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%98%BF%E9%87%8C%E5%B1%B1%E5%AE%A2%E9%81%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Alishan_Bus_EAA-716_20170710.jpg","page_title":"阿里山客運","context_page_description":"阿里山客運股份有限公司簡稱阿里山客運，於2016年12月23日奉臺中市政府核准成立，總公司設立於台中市西屯區，為電動巴士業者路得寶交通為運營嘉義地區之市區公車路線所成立之子公司，目前專營嘉義縣市區公車。2017年1月24日於高鐵嘉義站前低碳轉運中心舉行電動巴士通車典禮，並於2017年1月25日開始經營嘉義縣市區公車166路及168路等兩條純電動巴士路線，全車隊採比亞迪電巴行駛，目前主要營運基地為嘉義縣太保市，並在高鐵嘉義站附近有車輛基地，為嘉南地區第一家全面使用低底盤電動巴士（凱勝綠能K9電動車）的業者，目前服務範圍含括嘉義縣及台南市鹽水區。"},{"page_url":"https://de.wikipedia.org/wiki/Festung_Namhansanseong","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Korea-Namhansanseong-11.jpg","page_title":"Festung Namhansanseong","context_page_description":"Die Festung Namhansanseong ist eine koreanische Bergfestung, die etwa 15 Kilometer südöstlich von Seoul 480 m über dem Meer auf dem Namhansan liegt. Die meisten Festungsanlagen und Tempel in der Festung stammen aus dem 17. Jahrhundert. Im Jahr 2014 wurde die Festung von der UNESCO als Weltkulturerbestätte in das UNESCO-Welterbe aufgenommen."},{"page_url":"https://sv.wikipedia.org/wiki/R%C3%B8a","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/R%C3%B8a_senter.JPG","page_title":"Røa","context_page_description":"Røa är en förort som ligger i den västra delen av Oslo, Norge. Det var tidigare en egen stadsdel i Oslo kommun. Røa gränsar till Bærums kommun i väster. Vid stadsdelsreformen 2004 blev Røa sammanslagen med Vinderen och är nu en del av bydelen Vestre Aker. Røa hade bydelsnummer 7.\\nNamnets ursprung är en fornnordisk pluralform av ruð, som betyder 'röjning', alltså betyder namnet 'röjningarna'. Rød eller Røed är också namn på gårdar som har legat i Røa-området.\\nRøas idrottsklubb Røa IL har en mycket framgångsrik damfotbollssektion, Røa Dynamite Girls."},{"page_url":"https://en.wikipedia.org/wiki/O%27Bleness_Hospital","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Sheltering_arms-1.jpg","page_title":"O'Bleness Hospital","context_page_description":"OhioHealth O'Bleness Hospital is a 144-bed community hospital at 55 Hospital Drive, Athens, Ohio 45701. O'Bleness overlooks the Hocking River. The westernmost wing of the hospital is known as the Cornwell Center, which houses medical offices; a separate office building slightly northwest of this was recently built, and is known as the Castrop Center. The Hopewell Health Center complex is also next door to the west.\\nIn January 2014 OhioHealth took over control of O'Bleness Hospital. As such, O'Bleness Memorial Hospital has changed their name to OhioHealth O'Bleness Hospital to reflect the acquisition.\\nThe current President and CEO of OhioHealth O'Bleness Hospital is Mark Seckinger, replacing Greg Long in April 2015."},{"page_url":"https://fr.wikipedia.org/wiki/Basilique_Sainte-Marie-Madeleine_de_V%C3%A9zelay","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Saint-Bernard_pr%C3%AAchant_la_2e_croisade%2C_%C3%A0_V%C3%A9zelay%2C_en_1146.jpg","page_title":"Basilique Sainte-Marie-Madeleine de Vézelay","context_page_description":"La basilique Sainte-Marie-Madeleine de Vézelay est une ex abbatiale française du XIIᵉ siècle située à Vézelay, dans le département de l'Yonne en Bourgogne-Franche-Comté. Haut lieu de la chrétienté au Moyen Âge, Vézelay est un lieu de pèlerinage important sur le chemin de Saint-Jacques-de-Compostelle.\\nConstruite entre 1120 et 1150, la basilique de Vézelay est une illustration majeure de l'architecture romane et de l'art roman en général. Le tympan intérieur du narthex, présentant un Christ en gloire, est un des chefs-d'œuvre de la sculpture romane. Reconstruit à la fin du XIIᵉ siècle, le chœur présente un style gothique qui accroît la luminosité de la basilique et contribue à renforcer sa symbolique autour du thème de la lumière divine. En passant du narthex à la nef puis au chœur, le visiteur progresse d'un espace obscur à un espace de plus en plus lumineux, illustrant la transformation intérieure du fidèle."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%84%80%E6%AD%A6%E5%89%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Gibu.png","page_title":"儀武剛","context_page_description":"儀武 剛は沖縄県の政治家。元金武町長。金武町長在任中に北部市町村会長を4期務めた。"},{"page_url":"https://vi.wikipedia.org/wiki/B%C4%83ng_m%C6%B0a","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Icicles.jpg","page_title":"Băng mưa","context_page_description":"Băng mưa là một lớp băng cứng và trong suốt được hình thành do mưa siêu lạnh không bị đóng băng ngay cả ở nhiệt độ dưới 0 °C rơi xuống, bám vào mặt đất hoặc các vật thể như cây cối và bị đóng băng lại. Nó cũng là một loại hiện tượng nước đóng băng."},{"page_url":"https://id.wikipedia.org/wiki/Kepulauan_Riau","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Locator_Natuna_Regency.png","page_title":"Kepulauan Riau","context_page_description":"Kepulauan Riau adalah sebuah provinsi di Indonesia. Provinsi Kepulauan Riau berbatasan dengan Vietnam dan Kamboja di sebelah utara; Malaysia dan provinsi Kalimantan Barat di timur; provinsi Kepulauan Bangka Belitung dan Jambi di selatan; Negara Singapura, Malaysia dan provinsi Riau di sebelah barat. Provinsi ini termasuk provinsi kepulauan di Indonesia.\\nSecara keseluruhan wilayah Kepulauan Riau terdiri dari 5 kabupaten, dan 2 kota, 52 kecamatan serta 299 kelurahan/desa dengan jumlah 2.408 pulau besar, dan kecil yang 30% belum bernama, dan berpenduduk. Adapun luas wilayahnya sebesar 8.201,72 km², sekitar 96% merupakan lautan, dan hanya sekitar 4% daratan."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%D8%B1%D8%B2%D8%B4%DA%AF%D8%A7%D9%87%E2%80%8C%D9%87%D8%A7%DB%8C_%D9%81%D9%88%D8%AA%D8%A8%D8%A7%D9%84_%D8%A7%D9%86%DA%AF%D9%84%D8%B3%D8%AA%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Huddersfield_002.jpg","page_title":"ورزشگاه‌های فوتبال انگلستان","context_page_description":"در حال کامل شدن"},{"page_url":"https://en.wikipedia.org/wiki/San_Francisco_cable_car_system","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/6408-SFOCableCarTurntable.jpg","page_title":"San Francisco cable car system","context_page_description":"The San Francisco cable car system is the world's last manually operated cable car system. An icon of San Francisco, the cable car system forms part of the intermodal urban transport network operated by the San Francisco Municipal Railway. Of the 23 lines established between 1873 and 1890, only three remain: two routes from downtown near Union Square to Fisherman's Wharf, and a third route along California Street. While the cable cars are used to a certain extent by commuters, the vast majority of their seven million annual passengers are tourists, and as a result, the wait to get on can often reach two hours or more. They are among the most significant tourist attractions in the city, along with Alcatraz Island, the Golden Gate Bridge, and Fisherman's Wharf. The cable cars are listed on the National Register of Historic Places.\\nThe cable cars are separate from San Francisco's heritage streetcars, which operate on Market Street and the Embarcadero, as well as from the more modern Muni Metro light rail system."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%82%B9%EC%8A%A4%ED%84%B4_(%EC%98%A8%ED%83%80%EB%A6%AC%EC%98%A4%EC%A3%BC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Kingston_City_Hall-_Kingston-_Ontario-_20180414.jpg","page_title":"킹스턴 (온타리오주)","context_page_description":"킹스턴은 온타리오주의 도시로, 인구는 123,363명이다."},{"page_url":"https://pl.wikipedia.org/wiki/Przylepka_okopcona","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Melanelixia_fuliginosa_T85_%282%29.jpg","page_title":"Przylepka okopcona","context_page_description":"Przylepka okopcona, tarczownica okopcona – gatunek grzybów z rodziny tarczownicowatych. Ze względu na symbiozę z glonami zaliczany jest do porostów."},{"page_url":"https://pl.wikipedia.org/wiki/Fl%C3%A9ville","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f1/Vue_sur_Fl%C3%A9ville_dans_la_vall%C3%A9e_de_l%27Aire%2C_depuis_la_colline_de_l%27Argonne.JPG","page_title":"Fléville","context_page_description":"Fléville – miejscowość i gmina we Francji, w regionie Grand Est, w departamencie Ardeny.\\nWedług danych na rok 1990 gminę zamieszkiwało 108 osób, a gęstość zaludnienia wynosiła 14 osób/km²."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D1%80%D1%81%D0%B5%D0%B4%D0%B8%D0%BB%D1%8C%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/10/Bandera_de_Cercedilla.png","page_title":"Серседилья","context_page_description":"Серседи́лья — муниципалитет в Испании, входит в провинцию Мадрид в составе автономного сообщества Мадрид. Муниципалитет находится в составе района Куэнка-дель-Гвадаррама."},{"page_url":"https://es.wikipedia.org/wiki/H%C3%A4ggenschwil","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Haeggenschwil.png","page_title":"Häggenschwil","context_page_description":"Häggenschwil es una comuna suiza del cantón de San Galo, ubicada en el distrito de San Galo. Limita al norte con las comunas de Muolen y Egnach, al este con Roggwil y Wittenbach, al sur con Waldkirch, y al oeste con Hauptwil-Gottshaus y Zihlschlacht-Sitterdorf.\\nLa comuna está compuesta por las localidades de: Eggen, así como Lömmenschwil, Oberatzenholz, Ruggisberg y Unteratzenholz."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BB%D5%BD%D5%BA%D5%A1%D5%B6%D5%AB%D5%A1%D5%B5%D5%AB_%D5%BF%D5%B8%D5%B6%D5%A5%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Torres_de_Catoira_1.jpg","page_title":"Իսպանիայի տոներ","context_page_description":"Իսպանիայի տոներ կամ Միջազգային զբոսաշրջային հետաքրքրություն ներկայացնող տոն պատվավոր կոչումի արժանացած տոներ Իսպանիայում. տիտղոսը տրվում է Իսպանիայի կառավարության Զբոսաշրջության, արդյունաբերության, տուրիզմի ու առևտրի նախարարության Գլխավոր քարտուղարության կողմից, որը տրամադրվում է այն տոներին կամ իրադարձություններին, որոնք ներառում են այնպիսի դրսեւորումներ, որոնք կապված են մշակութային և ժողովրդական ավանդույթների հետ, մասնավորապես, հատուկ կարեւորություն ունեն էթնիկ հատկանիշները եւ զբոսաշրջային տեսարժան վայրեր ներկայացնելու համար։ Իսպանիայում այս պատվավոր տիտղոսը շնորհվել է իսպանական 30 տոների։\\nԱյդ պահանջները ներառում են.\\nՀնություն և շարունակականություն\\nՀանրաճանաչ արմատներ և մասնակցություն, հատկապես կարևորություն են ներկայացնում այն կազմակերպությունների առկայությունը, որոնք աջակցում են տենին\\nԻնքնատիպությունը, բազմազանությունը, որոնք արդիական են արտերկրից Իսպանիայի զբոսաշրջության խթանման առումով\\nՄիջազգային լրատվամիջոցների վրա թողած ազդեցությունը. առնվազն տասը արձագանք արտասահմանյան մեկ կամ մի քանի լրատվամիջոցների կողմից\\nՈւնենալ Ազգային տուրիստական հետաքրքրություն հռչակագիր ոչ պակաս, քան հինգ տարի"},{"page_url":"https://en.wikipedia.org/wiki/Idora_Hegel","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Idora_Hegel_04_NHK.jpg","page_title":"Idora Hegel","context_page_description":"Idora Hegel is a Croatian former competitive figure skater. She is the 2004 Golden Spin of Zagreb champion and a seven-time Croatian national champion. She represented 2002 Winter Olympics in Salt Lake City and at the 2006 Winter Olympics in Turin. At both events, she qualified for the free skate and finished 19th overall. She also reached the free skate at sixteen ISU Championships – six Worlds, seven Europeans, and three Junior Worlds."},{"page_url":"https://en.wikipedia.org/wiki/Coat_of_arms_of_Denmark","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/Skibsflaget_fra_Mariakirken_i_L%C3%BCbeck.png","page_title":"Coat of arms of Denmark","context_page_description":"The coat of arms of the Denmark has a lesser and a greater version.\\nThe state coat of arms consists of three pale blue lions passant wearing crowns, accompanied by nine red lilypads, all in a golden shield with the royal crown on top.\\nThe national coat of arms of Denmark is similar to the state coat of arms, but without the royal crown above the shield.\\nIt is historically the coat of arms of the House of Estridsen, the dynasty which provided the kings of Denmark between 1047 and 1412. The current design was introduced in 1819, under Frederick VI. Previously, there had been no distinction between the \\"national\\" and the \\"royal\\" coat of arms. Since 1819, there has been a more complex royal coat of arms of Denmark separate from the national coat of arms."},{"page_url":"https://cs.wikipedia.org/wiki/FC_ViOn_Zlat%C3%A9_Moravce_%E2%80%93_Vr%C3%A1ble","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Fc_vion_stadium.JPG","page_title":"FC ViOn Zlaté Moravce – Vráble","context_page_description":"FC ViOn Zlaté Moravce – Vráble je slovenský fotbalový klub, který sídlí ve městě Zlaté Moravce v Nitranském kraji. Založen byl v roce 1995. Od sezóny 2010/11 působí ve slovenské nejvyšší fotbalové soutěži. Klubové barvy jsou červená a bílá.\\nHřištěm klubu je stadion Štadión FC ViOn s kapacitou 5 000 diváků."},{"page_url":"https://cs.wikipedia.org/wiki/Amatol","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/152_mm_shell_production_SA-Kuva_88285.jpg","page_title":"Amatol","context_page_description":"Amatol je triviální název pro skupinu trhavin, sestávajících ze směsí dusičnanu amonného a TNT v různých poměrech. Ve Francii byly podobné sloučeniny známé pod názvem schneiderite.\\nJedná se o vysoce výkonné trhaviny, které se používaly pro vojenské účely především během dlouhotrvajících vojenských konfliktů, když průmyslové produkční kapacity tritolu nestačily vysoké spotřebě ozbrojenými silami. Během druhé světové války byl často používán jako trhací náplň leteckých pum, dělostřeleckých granátů, protiponorkových náloží a námořních min. Bývá nahrazován jinými trhavinami jako hexolity, torpexy a tritonaly.\\nObsah dusičnanu amonného se v amatolech pohybuje od 40 po 80 % v závislosti na dostupnosti tritolu a účelu použití. Síla a brizance se vzrůstajícím podílem dusičnanu amonného klesá, zároveň stoupá citlivost trhaviny na mechanické a tepelné impulsy. Amatol 80/20 při výbuchu produkuje bílý kouř. I při takto nízkém obsahu tritolu je poměrně účinnou trhavinou. Amatol 50/50 produkuje při detonaci tmavý kouř. Nevýhodou amatolů je jejich hygroskopie."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1927","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Roland_Verhavert.jpg","page_title":"Lijst van personen geboren in 1927","context_page_description":"Dit is een lijst van personen die geboren zijn in 1927.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://es.wikipedia.org/wiki/Arte_infantil","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Faroe_stamp_041_childrens_year_%28children_of_different_skin_colour%29.jpg","page_title":"Arte infantil","context_page_description":"El arte infantil son los dibujos, pinturas y otras obras artísticas creadas por los niños. También se le conoce como \\"el arte de los niños\\" o \\"arte de niños\\".\\nTal como afirma Carmen Alcalde: \\"En la infancia, especialmente para los más pequeños, el arte es ante todo un medio natural de expresión\\". También añade que \\"la expresión plástica es un lenguaje de comunicación\\" ​"},{"page_url":"https://fr.wikipedia.org/wiki/Coll%C3%A9giale_Saint-Maurice_d%27Oiron","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Oiron_%2879%29_Coll%C3%A9giale_Saint-Maurice_-_Ext%C3%A9rieur_02.jpg","page_title":"Collégiale Saint-Maurice d'Oiron","context_page_description":"L'église Saint-Maurice est une église catholique située à Oiron, en France."},{"page_url":"https://it.wikipedia.org/wiki/Magnus_I_di_Norvegia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Magnus_den_godes_saga_-_Magnus_og_Horda-Knut_-_H._Egedius.jpg","page_title":"Magnus I di Norvegia","context_page_description":"Magnus I, fu re di Norvegia e re di Danimarca."},{"page_url":"https://vo.wikipedia.org/wiki/Elloree","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/99/SCMap-doton-Elloree.PNG","page_title":"Elloree","context_page_description":"Elloree binon zif in komot: Orangeburg, in tat: South Carolina, in Lamerikän."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%95%D5%BD%D5%A1%D5%AF%D5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Osaka_satellite_map.jpg","page_title":"Օսակա","context_page_description":"Օսակա ՝ Ճապոնիայի՝ բնակչության թվով երրորդ քաղաքն է, որը գտնվում է Հոնսյու կղզու հարավային մասում, Օսակա ծոցում։ Համանուն պրեֆեկտուրայի կենտրոնն է։ 1956 թվականին կառավարության հրամանագրով հռչակվել է քաղաք։"},{"page_url":"https://oc.wikipedia.org/wiki/Positron","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/PositronDiscovery.jpg","page_title":"Positron","context_page_description":"Lo positron, tanben nomenat antielectron, es l'antiparticula associada a l'electron dins lo domeni de la fisica de las particulas. Possedís una carga electrica de +1 carga elementara, lo meteis espin e la meteissa massa que l'electron.\\nL'existéncia del positron foguèt postulada pel fisician anglosoís Paul Dirac en 1928.\\nSe per escasença un positron se tròba en contacte amb un electron, totes dos s'anequelisson en emetre de fotons ultraenergetics, los rais gamma. Los positrons pòdon èsser generats per divèrs procèsses radioactius o mai per l'interaccion de rais gamma amb la matèria."},{"page_url":"https://tl.wikipedia.org/wiki/Hippopotamidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Choeropsis.jpg","page_title":"Hippopotamidae","context_page_description":"Ang mga Hippopotamus ay matigas, hubad na balat, at amphibious artiodactyl na mga miyembro ng pamilyang Hippopotamidae na may tatlong silid na tiyan at naglalakad sa apat na daliri sa bawat paa. Habang sila ay katulad ng mga baboy na physiologically at mga pseudoruminants tulad ng mga kamelyo, ang kanilang pinakamalapit na kamag-anak na mga kamag-anak ay ang cetaceans.\\nMayroong dalawang mga nabubuhay na species ng hipopotamus sa dalawang genera; ang pygmy hippo ng kagubatan ng kanlurang Africa, at ang karaniwang hippo."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_des_Pyr%C3%A9n%C3%A9es-Atlantiques_(A-L)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/B%C3%A9on12.JPG","page_title":"Liste des monuments historiques des Pyrénées-Atlantiques (A-L)","context_page_description":"Cet article recense une partie des monuments historiques des Pyrénées-Atlantiques, en France.\\nPour des raisons de taille, la liste des monuments historiques du département est découpée en deux. Cette partie regroupe les communes débutant de A à L. Pour les autres, voir la liste des monuments historiques des Pyrénées-Atlantiques."},{"page_url":"https://it.wikipedia.org/wiki/Circoscrizione_Lombardia_2_(1993-2017)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Circoscrizione_Lombardia_2_%28Camera_dei_Deputati%29.png","page_title":"Circoscrizione Lombardia 2 (1993-2017)","context_page_description":"La circoscrizione IV Lombardia 2, per l'elezione della Camera dei deputati, venne istituita con la legge 4 agosto 1993, n. 277, venendo poi confermata nella legge 21 dicembre 2005, n. 270.\\nLa circoscrizione comprendeva geograficamente le province di Bergamo, Brescia, Como, Lecco, Sondrio e Varese e sostituiva, ai fini dell'elezione della Camera, le precedenti circoscrizioni Brescia e Como in vigore dalle elezioni del 1946 a quelle del 1992. Con la Legge Mattarella la circoscrizione ha eletto 42 deputati. Con l'introduzione della Legge Calderoli il numero dei deputati è salito a 43 e con il censimento 2011 la circoscrizione ha guadagnato due ulteriori seggi arrivando ad eleggere 45 deputati.\\nLa legge 3 novembre 2017, n. 165 è stata nuovamente separata nelle due circoscrizioni dette ora Lombardia 2 e Lombardia 3."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BB%E3%83%B4%E3%82%A7%E3%83%AD%E3%83%90%E3%82%A4%E3%82%AB%E3%83%AA%E3%82%B9%E3%82%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Severobaykalsk_railway_station%2C_Buryatia%2C_Russia.jpg","page_title":"セヴェロバイカリスク","context_page_description":"セヴェロバイカリスクはロシアのブリヤート共和国に属する都市。バイカル湖の北端に位置し、ティヤ川がバイカル湖に注ぐ河口にある。ブリヤートの首都ウラン・ウデの北西440km、東シベリアの中心イルクーツク市からは北東へ490km。\\nセヴェロバイカリスクは1974年にバイカル・アムール鉄道の建設作業用の集落として誕生し、1980年に正式に町となった。2002年の国勢調査では人口は25,434人。2006年の推計人口は25,800人である。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%83%A5%E3%83%BC%E3%83%88_(%E6%A4%8D%E7%89%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Cynodon_dactylon.jpg","page_title":"シュート (植物)","context_page_description":"シュートとは、茎とその上にできる多数の葉からなる単位であり、維管束植物の地上部をなす主要器官である。苗条、芽条、葉条、枝条とも呼ばれる。普通、シュートという語が用いられる。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B5%D1%80%D1%80%D1%8E%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Etangeverruyes.jpg","page_title":"Веррюї","context_page_description":"Веррюї́ — муніципалітет у Франції, у регіоні Нова Аквітанія, департамент Де-Севр. Населення — 914 осіб.\\nМуніципалітет розташований на відстані близько 330 км на південний захід від Парижа, 50 км на захід від Пуатьє, 25 км на північний схід від Ніора."},{"page_url":"https://it.wikipedia.org/wiki/Oudekerksplein","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Old_Church_-_Old_Profession.jpg","page_title":"Oudekerksplein","context_page_description":"Oudekerksplein è una piazza del centro di Amsterdam che prende il nome dalla Oude Kerk, la chiesa del XIV secolo che domina la piazza.\\nInizialmente la piazza era un cimitero che, nel 1655, fu spostato in una nuova posizione oltre i confini cittadini dando vita all'attuale piazza.\\nOudekerksplein si trova nel cuore del quartiere a luci rosse di De Wallen e sulla piazza si affacciano 35 finestre da cui le prostitute offrono i loro servizi. Come parte del cosiddetto Progetto 1012, il governo della città di Amsterdam vuole rimuovere tutti i bordelli dalla piazza e sostituirli con ristoranti, negozi, laboratori di artisti e così via. Fa parte del piano anche la chiusura del coffee-shop presente nella piazza.\\nNel marzo del 2019 è stato annunciato che la città vieterà le visite guidate del quartiere a luci rosse a partire dal gennaio 2020, che ad oggi si contano in più di 1.000 a settimana.\\nSulla piazza è presente dal 2007 una statua collocata in onore delle prostitute del mondo e sul selciato è presente un rilievo in bronzo di una mano che accarezza un seno femminile, opera di un artista anonimo."},{"page_url":"https://eo.wikipedia.org/wiki/Bielany","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/PL_Warsaw_bielany_location.svg","page_title":"Bielany","context_page_description":"Bielany estas administra parto de Varsovio. Ĝi situas inter: Bemowo, Żoliborz, Białołęka.\\nUnu el 18 kvartaloj de Varsovio, sur la maldekstra bordo de Vistulo. La nomo akceptiĝis post alveno de la ordeno romualdanoj, kiu venis de Krakovo, kaj ligiĝas kun blanka froko de la monaĥoj."},{"page_url":"https://ca.wikipedia.org/wiki/Godfrey_Kneller","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Johanna_St_John.jpg","page_title":"Godfrey Kneller","context_page_description":"Godfrey Kneller, originàriament Gottfried Kniller, fou un pintor, dibuixant, aquarel·lista i miniaturista nascut al Sacre Imperi Romanogermànic i establert a la capital anglesa, el qual es convertí en el retratista barroc més important d'Anglaterra durant el final del segle XVII i principi del xviii."},{"page_url":"https://en.wikipedia.org/wiki/Cartouche_(cartography)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Cartouche_1.jpg","page_title":"Cartouche (cartography)","context_page_description":"A cartouche in cartography is a decorative emblem on a globe or map.\\nMap cartouches may contain the title, the printer's address, date of publication, the scale of the map and legends, and sometimes a dedication.\\nThe design of cartouches varies according to cartographer and period style. On 15th-century maps they are modelled after Italian precedent, by the 16th century architectural and figurative elements are added. The cartographic cartouche had its heyday in the Baroque period.\\nToward the end of the 18th century ornamental effects in cartography became less popular, their style developed to simple oval or rectangular fields with inscriptions."},{"page_url":"https://vi.wikipedia.org/wiki/Lestes_macrostigma","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Lestes_macrostigma2.jpg","page_title":"Lestes macrostigma","context_page_description":"Lestes macrostigma là loài chuồn chuồn trong họ Lestidae. Loài này được Eversmann mô tả khoa học đầu tiên năm 1836."},{"page_url":"https://zh-yue.wikipedia.org/wiki/EEPROM","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/52/UNIO_WLCSP_and_SOT23_Device_on_Penny.jpg","page_title":"EEPROM","context_page_description":"EEPROM，或者叫E²PROM，全稱電子抹除式可複寫唯讀記憶體 （英文：Electrically-Erasable Programmable Read-Only Memory），係一種可以通過電子方式多次複寫嘅半導體儲存設備。相比EPROM，EEPROM唔需要用紫外線照射，亦唔使除低，就可以用特定嘅電壓，嚟抹除集成電路上嘅信息，以寫低新嘅數據。\\nEEPROM有4種工作模式：讀取模式、寫入模式、擦除模式、校驗模式。讀取嘅時候，芯片只需要Vcc低電壓（一般+5V）供電。編程寫入嘅時候，芯片通過Vpp（一般+25V，新嗰啲可能會用 12V 或 5V）攞到編程電壓，並通過PGM編程脈衝（一般50ms）寫入數據。擦除嘅時候，只需要用Vpp高電壓，唔需要紫外線，就可以擦除指定地址嘅內容。為咗保證寫入正確，喺每寫入一塊數據之後，都要進行類似讀取嘅校驗步驟，如果錯咗就要重新寫入。依家嘅EEPROM通常唔需要用額外嘅Vpp電壓，寫入時間都已經縮短。\\n由於EEPROM嘅優秀性能，同埋喺線上操作嘅便利，佢廣泛用喺需要經常擦除嘅BIOS晶片以及快閃記憶體芯片，並逐步替代部分有斷電保留需要嘅RAM晶片，甚至取代部份嘅硬碟功能（睇SSD）。佢同高速RAM成為咗當前（2000年代）最常用同發展最快嘅兩種儲存技術。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D9%86%D8%AA_%D9%88%DB%8C%D9%86%D8%B3%D9%86%D8%AA_%D9%88_%DA%AF%D8%B1%D9%86%D8%A7%D8%AF%DB%8C%D9%86%E2%80%8C%D9%87%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Fort_Duvernette_and_Young%27s_Island_from_Calliaqua%2C_St._Vincent_1890s.jpg","page_title":"سنت وینسنت و گرنادین‌ها","context_page_description":"سنت وینسنت و گرنادین‌ها یک کشور جزیره‌ای کوچک در دریای کارائیب است."},{"page_url":"https://sv.wikipedia.org/wiki/Borghesiana_(Roms_tunnelbana)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Station_of_Line_C_Metro_in_Rome_Borghesiana.jpg","page_title":"Borghesiana (Roms tunnelbana)","context_page_description":"Borghesiana är en station på Roms tunnelbanas Linea C. Stationen är belägen vid Via Casilina i Borghesiana i sydöstra Rom och togs i bruk år 2014.\\nStationen Borghesiana har:\\nBiljettautomater\\nWC"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%A1%B0%EC%84%A0%EB%AF%BC%EC%A3%BC%EC%A3%BC%EC%9D%98%EC%9D%B8%EB%AF%BC%EA%B3%B5%ED%99%94%EA%B5%AD_%EC%9B%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/1947-100won-1.jpg","page_title":"조선민주주의인민공화국 원","context_page_description":"조선민주주의인민공화국 원은 조선민주주의인민공화국에서 통용되는 화폐이다. 1원은 100전에 해당한다. 조선민주주의인민공화국 원은 조선민주주의인민공화국 중앙은행에 의해 발행된다. 다만, 환율의 가치를 볼 때 조선민주주의인민공화국 100원은 한국 돈으로 약 135원 내외를 가지고 있는 가치가 되므로 1KPW = 1.35KRW의 가치를 두고 있는 등가를 가지고 있는 셈이지만 실제 가치는 북한 원이 한국 원보다 약간 무거운 측면을 가지고 있다."},{"page_url":"https://no.wikipedia.org/wiki/Bj%C3%B8rnar_Skj%C3%A6ran","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Bj%C3%B8rnar_Skj%C3%A6ran%2C_fylkesvaraordf%C3%B8rerkandidat_%2815746492405%29.jpg","page_title":"Bjørnar Skjæran","context_page_description":"Bjørnar Selnes Skjæran er en norsk politiker. Fra 6. april 2019 er han nestleder i Arbeiderpartiet. Skjæran er leder for Nordland Arbeiderparti og gruppeleder for Ap i fylkestinget i Nordland. Han var ordfører i Lurøy kommune fra 2011 til 2015.\\nHan har yrkesbakgrunn som gårdbruker og sjølstendig næringsdrivende, men har siden 2011 vært politiker på heltid.\\nBjørnar Skjæran ble valgt til leder for Nordland Arbeiderparti i 2011. Etter valget samme år tok han over som ordfører i Lurøy etter Carl Einar Isachsen jr. fra Senterpartiet. I 2013 ble Skjæran valgt som medlem av sentralstyret i Arbeiderpartiet.\\nHan var medlem i Lurøy kommunestyre i 28 år, fra 1987 til 2015, de fire siste årene som ordfører. Han tok ikke gjenvalg i 2015. Samme år ble han valgt inn i Nordland fylkesting og var gruppeleder for Arbeiderpartiet der.Høsten 2019 ble han igjen valgt på fylkestinget, og er nestleder i fylkestingsgruppa.\\n19. mars 2019 ble det offentliggjort at Skjæran var innstilt som nestleder i Arbeiderpartiet sammen med Hadia Tajik i forbindelse med partiets landsmøte i april 2019."},{"page_url":"https://en.wikipedia.org/wiki/Prehistoric_Lepidoptera","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Spatalistiforma_submerga_Skalski_1992-ZMCD-HT-12-4-1957LEPSUCC88-UZMC-AWS-Baltic_Fig_A.jpg","page_title":"Prehistoric Lepidoptera","context_page_description":"Prehistoric Lepidoptera are both butterflies and moths that lived before recorded history. The fossil record for Lepidoptera is lacking in comparison to other winged species, and tending not to be as common as some other insects in the habitats that are most conducive to fossilization, such as lakes and ponds, and their juvenile stage has only the head capsule as a hard part that might be preserved. The location and abundance of the most common moth species are indicative that mass migrations of moths occurred over the Palaeogene North Sea, which is why there is a serious lack of moth fossils. Yet there are fossils, some preserved in amber and some in very fine sediments. Leaf mines are also seen in fossil leaves, although the interpretation of them is tricky. Putative fossil stem group representatives of Amphiesmenoptera are known from the Triassic.\\nPreviously, the earliest known lepidopteran fossils were three wings of Archaeolepis mane, a primitive moth-like species from the Jurassic, about 190 million years ago, found in Dorset, UK, which show scales with parallel grooves under a scanning electron microscope and a characteristic wing venation pattern shared with Trichoptera."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9C%9F%E5%8D%AB%E4%B9%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Phoebe.png","page_title":"土卫九","context_page_description":"土衛九又稱為「菲比」，是環繞土星運行的一顆衛星。"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%91%D0%BE%D0%B9%D0%BA%D0%BE%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Charles_Cunningham_Boycott_%28Vanity_Fair%29.jpg","page_title":"Бойкот","context_page_description":"Бойкотът е форма на гражданско неподчинение и протест, представляваща масов отказ от свободно избираемо действие, най-често отказ от продукти и услуги. Използва се от привържениците на ненасилие.\\nДумата „бойкот“ навлиза в английския език по името на Чарлз Бойкот, капитан от британската армия, който управлява като наместник ирландското имение на граф Ърн. Поради слабата реколта през 1880 г. местните отправят молба към Бойкот да намали данъците им, но той не само че не ги намалява, но ги заплашва, че ще ги прогони от земите, които обработват. На 19 септември в своя реч пред арендаторите ирландският политически лидер Чарлз Стюарт Парнел заклеймява Бойкот, но вместо към отмъщение и насилие призовава хората от околността да поставят наместника в изолация. Въпреки че преживяват кратковременни финансови затруднения, селяните престават да обработват земите, да работят в имението, да носят пощата и да търгуват с Бойкот."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8E%D5%A5%D6%80%D5%A1%D5%B5%D5%AB_%D5%A6%D5%A2%D5%B8%D5%BD%D5%A1%D5%B5%D5%A3%D5%AB_(%D4%B9%D5%A2%D5%AB%D5%AC%D5%AB%D5%BD%D5%AB)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Churches_of_St._Andrew_and_of_John_the_Apostle%2C_Tbilisi_%28Photo_A._Muhranoff%2C_2011%29.jpg","page_title":"Վերայի զբոսայգի (Թբիլիսի)","context_page_description":"Վերայի զբոսայգի, Թբիլիսիի քաղաքային զբոսայգի: Գտնվում է քաղաքի պատմական շրջանում՝ Մերաբ Կոստավայի և Նիկո Նիկոլաձեի փողոցների և Կուրի գետափի միջև:"},{"page_url":"https://ru.wikipedia.org/wiki/NGC_235B","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1a/NGC235-hst-606.png","page_title":"NGC 235B","context_page_description":"NGC 235B — линзообразная галактика в созвездии Кит. Скорее всего, гравитационно связана с галактикой NGC 235A.\\nЭтот объект не входит в число перечисленных в оригинальной редакции «Нового общего каталога» и был добавлен позднее."},{"page_url":"https://no.wikipedia.org/wiki/Puttesund_bro","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Puttesund_bro_1.jpg","page_title":"Puttesund bro","context_page_description":"Puttesund bro er en 138 meter lang bro i Fredrikstad kommune, som forbinder Håholmen med Kjøkøy. Broen inngår i riksvei 108. Broen ble bygd som spennbetongbro i 1971, og ombygd til skråstagsbro i 2002. Midten av broen sank med 40 cm fram til den ble ombygd i 2002."},{"page_url":"https://de.wikipedia.org/wiki/Schachbriefmarke","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/1991_CPA_6284.jpg","page_title":"Schachbriefmarke","context_page_description":"Schachbriefmarken sind Briefmarken mit Motiven, die im weiteren Sinne auf das Schachspiel bezogen sind. Das Spezialgebiet der Philatelie zieht Schachliebhaber an, die auf diese Weise zwei Interessengebiete miteinander verbinden."},{"page_url":"https://en.wikipedia.org/wiki/Kathy_Johnson_(figure_skating_coach)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Patrick_Chan_-_WC_2016_-_SP_-_Kiss_and_Cry_%28cropped%29.jpg","page_title":"Kathy Johnson (figure skating coach)","context_page_description":"Kathy Johnson is a figure skating coach and modern dance instructor. She is known as a coach of Olympic Gold medalist Patrick Chan between 2012 and 2016."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%98%D0%BA%D0%B5%D0%B1%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Ikebana_Riflesso_sull%27acqua.JPG","page_title":"Икебана","context_page_description":"Сама реч икебана може се превести као цветни аранжман али и као живи цвет. Права икебана увелико се разликује од обичног аранжмана. Основна је разлика између аранжмана и икебане у духовној позадини из које произлази слагање цвећа и која аранжману даје прави израз. Религијски циљ икебане је нека врста пута према сазнању. Будистички свешеници аранжирали су цвеће приликом службе код олтара. Одатле су се развили различити стилови икебане. Буда учи да је човек у својој бити истоветан са свиме у природи и да се та божанска истина открива само путем сазнања. Тај пут сазнања назива се „кадо“ што значи пут истине. Кад Јапанац посматра цвет он у њему види природу, снагу земље и благослов сунца. Осећај хармоније у свему живом је смисао икебане. Током времена икебана је изгубила много од религијског значења а посебно се значење придаје проучавању природе. Икебана се заснива на љубави према линији, која је типично обележје јапанске уметности."},{"page_url":"https://es.wikipedia.org/wiki/Inmigraci%C3%B3n_danesa_en_Argentina","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Iglesia_Danesa_en_Tandil.jpg","page_title":"Inmigración danesa en Argentina","context_page_description":"La inmigración danesa en Argentina es el movimiento migratorio proveniente del Reino de Dinamarca hacia la República Argentina.\\nEntre las inmigraciones de los países nórdicos, la colectividad danesa es la que tiene el 1° puesto como la que más inmigrantes aportó, y llegó a estar entre las 14 colectividades más grandes de Argentina en el periodo entre mediados del siglo XIX y mediados del siglo XX.\\nEn dicho periodo se radicaron en Argentina unos 18 mil daneses, ​ constituyéndose así como la tercera comunidad de daneses en el exterior más numerosa del mundo, detrás de las que existieron en Estados Unidos y Australia.​\\nSegún los testimonios y estadísticas históricas, la colectividad danesa fue pequeña pero pujante.​ Pequeña en comparación con otras colectividades, como las de italianos y españoles, que son por lejos las 2 colectividades más grandes de Argentina. Pero pujante por haberse consolidado sólidamente, al traer el desarrollo y la integración económica a las tierras donde se asentaron, y al haber establecido sus instituciones donde mantener vivos sus valores culturales de Dinamarca, como lo fueron sus fundaciones de escuelas de educación danesa y sus iglesias luteranas."},{"page_url":"https://fi.wikipedia.org/wiki/Kristjan_J%C3%A4rvi","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/15.IX_Goran_Bregovic_Wedding_and_Funeral_Band_with_Kristjan_J%C3%A4rvi.jpg","page_title":"Kristjan Järvi","context_page_description":"Kristjan Järvi on virolainen kapellimestari. Hän on Neeme Järven poika ja Paavo Järven veli.\\nJärvi syntyi Tallinnassa ja vietti suuren osan lapsuusvuosistaan New Yorkissa. Hän opiskeli Manhattan School of Musicissa. Hän toimi kolmen vuoden ajan Los Angelesin filharmonisen orkesterin apulaiskapellimestarina ennen kiinnitystään Uumajassa, Ruotsissa.\\nKristjan Järvi toimii tällä hetkellä Tonkünstler-orkesterin ylikapellimestarina. Hän seurasi virassa Carlos Kalmaria vuonna 2003."},{"page_url":"https://ca.wikipedia.org/wiki/Store_Trolltind","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/StoreTrolltindFromBreitinden.jpg","page_title":"Store Trolltind","context_page_description":"Store Trolltind és una muntanya del municipi de Rauma, al comtat de Møre og Romsdal, Noruega. El pic separa la vall de Romsdal i és considerat el penya-segat més alt d'Europa amb 1.788 metres de desnivell. El riu Rauma i l'autopista E136 es troben l'est de la munyanya. El pic Trollryggen es troba a uns 700 metres cap al sud.\\nL'accés més fàcil al cim és a peu des de l'aparcament a Trollstigen uns 5 quilòmetres al sud-oest. Directament sota del cim, es podria preferir fer escalada per superar més ràpid l'última pujada."},{"page_url":"https://de.wikipedia.org/wiki/Prakticar","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Praktica_bellows_macro_lens.jpg","page_title":"Prakticar","context_page_description":"Prakticar war eine Marke für Objektive des VEB Pentacon, für die neuen Praktica-B-Kameras in der DDR.\\nDie meisten Objektive waren sowohl mit M42-Schraubgewinde als auch im neuen Design mit Praktica B-Bajonett erhältlich. Die Festbrennweiten kamen nahezu ausschließlich aus der DDR und wurden in den zum VEB Pentacon bzw. VEB Kombinat Carl Zeiss Jena gehörenden Unternehmen hergestellt.\\nDas neue Pancakeobjektiv 1:2,4/50mm wurde aus Kapazitätsgründen in Rumänien montiert. Erstmals gab es mit dem Macro-Prakticar 1:2,8/55 mm ein Makroobjektiv von Carl Zeiss Jena und mit dem Prakticar 1:1,4/50 mm ein hochlichtstarkes Standardobjektiv. Zur Fertigung von Zoomobjektiven gab es in der DDR nur in Jena bei Carl Zeiss die nötige Maschinentechnik. Da diese jedoch bereits mit der Produktion der Carl-Zeiss-Jena-Objektive ausgelastet war, bezog man die Prakticar-Zoomobjektive aus dem Ausland, vorzugsweise aus Südostasien. Einige dieser Objektive stellten diese Produzenten ausschließlich für den VEB Pentacon her, andere wurden dort identisch auch für andere Marken produziert.\\nAlle Fremdbezüge waren mit Prakticar gelabelt. Die meisten Zoomobjektive stammten von Samyang aus Südkorea."},{"page_url":"https://es.wikipedia.org/wiki/Archivo_General_de_la_Marina_%C3%81lvaro_de_Baz%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Viso_del_Marqu%C3%A9s_%28RPS_19-08-2012%29_Palacio_del_Marqu%C3%A9s_de_Santa_Cruz%2C_fresco.png","page_title":"Archivo General de la Marina Álvaro de Bazán","context_page_description":"El Archivo General de la Marina Española \\"Don Álvaro de Bazán\\" es un archivo español cuyos fondos custodiados corresponden a documentación de la Armada Española, y su sede se encuentra en el Palacio del Marqués de Santa Cruz, en la localidad de Viso del Marqués España. Es un archivo de titularidad estatal, gestionado por el Ministerio de Defensa."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Schaubergwerken","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Rammelsberg_Bergwerksanlagen.jpg","page_title":"Liste von Schaubergwerken","context_page_description":"Dies ist eine Liste von Schaubergwerken, die sich in Betrieb befinden. Voraussetzung für die Aufnahme ist nicht ein ständiger Besucherbetrieb, wohl aber die Möglichkeit, die Bergwerke auf Anfrage unter fachkundiger Führung begehen zu können. Schaubergwerke besitzen in der Regel eine entsprechende Betriebsgenehmigung und sind in offiziellen Listen von Bergbehörden aufgeführt."},{"page_url":"https://fr.wikipedia.org/wiki/Domingo_Faustino_Sarmiento","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/Batalla_%C3%91aemb%C3%A9_Enrique_Pinaroli.jpg","page_title":"Domingo Faustino Sarmiento","context_page_description":"Domingo Faustino Sarmiento était un militant, intellectuel, écrivain, militaire et homme d’État argentin, et le septième président de la République Argentine. Ses écrits couvrent un large éventail de genres et de thèmes, allant du journalisme à l’autobiographie, et de la philosophie politique à l’historiographie. Il faisait partie d’un groupe d’intellectuels, connu sous l’appellation Génération de 1837, qui eut une grande influence sur l’Argentine du XIXᵉ siècle. Mais c’est aux questions d’instruction publique que Sarmiento lui-même s’intéressait au premier chef, à telle enseigne qu'on le surnomme parfois le maître d’école de l’Amérique latine. Comme écrivain, son influence fut également considérable sur la littérature de cette partie méridionale de l’Amérique du Sud.\\nSarmiento grandit dans une famille peu fortunée, mais instruite et politiquement engagée, qui lui prépara ainsi la voie à son action future. De 1843 à 1850, il se trouva souvent en exil, et ses écrits virent le jour tant en Argentine qu’au Chili voisin."},{"page_url":"https://ca.wikipedia.org/wiki/Il%C2%B7lustraci%C3%B3_escocesa","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/James_Watt_by_Henry_Howard.jpg","page_title":"Il·lustració escocesa","context_page_description":"La Il·lustració escocesa fou un moviment cultural del segle xviii caracteritzat per la destacada producció intel·lectual, científica i cultural desenvolupada a Escòcia, sobretot a partir de la segona meitat de segle. Sovint vista com una edat d'or en la història del país, la Il·lustració escocesa significà l'eclosió cultural dels escocesos, que es van internacionalitzar i convertiren Escòcia en un dels principals focus culturals d'Europa. Cap al 1750, els escocesos es comptaven entre els habitants més cultes del continent, amb una tassa d'analfabetisme estimada en només 25%. L'impacte del moviment fou notable: en algun moment de la segona meitat del segle XVIII, Edimburg va passar a tenir el pseudònim d'Atenes del Nord.\\nLa Il·lustració escocesa abraçà els preceptes humanistes i racionalistes de la Il·lustració europea, i es va deixar influir principalment pels intel·lectuals francesos, país amb qui Escòcia sempre havia mantingut contacte."},{"page_url":"https://de.wikipedia.org/wiki/Kordylewskische_Wolken","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Lagrange_points_Earth_vs_Moon.jpg","page_title":"Kordylewskische Wolken","context_page_description":"Die Kordylewskischen Wolken sind Staubwolken in den Lagrange-Punkten L₄ und L₅ des Systems Erde-Mond. Sie sollen aus Gas und Staubpartikeln bis zu einer Größe von mehreren Zentimetern bestehen. Die Existenz der Kordylewskischen Wolken wurde im Oktober 2018 bestätigt."},{"page_url":"https://en.wikipedia.org/wiki/Kawanishi,_Hy%C5%8Dgo","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/120922_Kawanishi_Municipal_Museum_Hyogo_pref_Japan01s3.jpg","page_title":"Kawanishi, Hyōgo","context_page_description":"Kawanishi is a city in Hyōgo Prefecture in the northwestern part of the Kansai region of Japan, about 5 km north of Osaka Itami Airport. It is bordered on the west by the Inagawa river.\\nAs of August 31, 2016, the city has an estimated population of 159,723 and a population density of 2,948.83 persons per km². The total area is 53.44 km²."},{"page_url":"https://fr.wikipedia.org/wiki/Trogne_(arbre)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Wiki_DSC05961_NSG_1433002_K%C3%BChkopf-Knoblochsaue.jpg","page_title":"Trogne (arbre)","context_page_description":"Une trogne appelée aussi arbre têtard ou plus simplement têtard, est un arbre dont la forme caractéristique résulte d'un mode d'exploitation ancestral spécifique, consistant en des tailles périodiques spécifiques, afin de fournir principalement du bois et du fourrage.\\nDe nombreuses essences forestières peuvent être conduites en trognes, formant une haie, une « prairie aérienne », un « taillis sur pilotis », une « forêt perchée » ou un boisement de trognes. Ce système ancestral de production de bois était familier des campagnes où les arbres conduits en trognes s'inscrivaient notamment dans les haies bocagères. Menacés de disparition à la suite, notamment, des remembrements successifs, les têtards, éléments emblématiques des paysages, ont pourtant des fonctions écologiques, économiques et sociales importantes, ce qui encourage des projets de sensibilisation, de valorisation et de réhabilitation des trognes."},{"page_url":"https://de.wikipedia.org/wiki/Yofortierit","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/25/Yofortierite%2C_Microcline-192645.jpg","page_title":"Yofortierit","context_page_description":"Yofortierit ist ein sehr selten vorkommendes Mineral aus der Mineralklasse der „Silikate und Germanate“. Es kristallisiert im monoklinen Kristallsystem mit der chemischen Zusammensetzung Mn²⁺₅[(OH)₂|Si₈O₂₀]·7H₂O, ist also ein wasserhaltiges Mangan-Silikat mit zusätzlichen Hydroxidionen. Strukturell gehört Yofortierit zu den Schichtsilikaten.\\nYofortierit entwickelt faserige bis nadelige Kristalle, die meist in radialstrahligen, büscheligen oder kugeligen Aggregaten angeordnet sind und einen seidenähnlichen Glanz zeigen. Das Mineral kommt in verschiedenen Farben von rosa bis violett, rötlich bis orangebraun sowie beige bis dunkelbraun bzw. Bronzefarben. Seine Strichfarbe ist allerdings immer hellrosa."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%81%AB%E7%B9%A9%E6%A7%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7b/Bronze_barreled_Japanese_matchlock_pistol.jpg","page_title":"火繩槍","context_page_description":"火繩槍，是以火繩點火裝置來點火的銃械。火繩點火裝置是以緩慢燃燒的火繩先點燃引火藥，引火藥起火後再點燃推進藥的機構。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B3%A2%E9%9A%86%E6%B6%85%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Polonyanskyi-Raion.png","page_title":"波隆涅區","context_page_description":"波隆涅區，是烏克蘭的一個區，位於該國西部，由赫梅利尼茨基州負責管轄，首府設於波隆涅，面積866平方公里，2015年人口45,187，人口密度每平方公里52.18人。"},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%A6%E0%B2%BE%E0%B2%A6%E0%B2%BE%E0%B2%B8%E0%B2%BE%E0%B2%B9%E0%B3%87%E0%B2%AC%E0%B3%8D_%E0%B2%AB%E0%B2%BE%E0%B2%B2%E0%B3%8D%E0%B2%95%E0%B3%86_%E0%B2%AA%E0%B3%8D%E0%B2%B0%E0%B2%B6%E0%B2%B8%E0%B3%8D%E0%B2%A4%E0%B2%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/VinodKhanna.jpg","page_title":"ದಾದಾಸಾಹೇಬ್ ಫಾಲ್ಕೆ ಪ್ರಶಸ್ತಿ","context_page_description":"ದಾದಾಸಾಹೇಬ್ ಫಾಲ್ಕೆ ಪ್ರಶಸ್ತಿ - ಭಾರತೀಯ ಚಿತ್ರರಂಗದಲ್ಲಿನ ಜೀವಮಾನದ ಸಾಧನೆಗಾಗಿ ಭಾರತ ಸರ್ಕಾರವು ನೀಡುವ, ವಾರ್ಷಿಕ ಪ್ರಶಸ್ತಿ. ಭಾರತೀಯ ಚಿತ್ರರಂಗದ ಪಿತಾಮಹರೆಂದೇ ಹೆಸರಾದ ದಾದಾಸಾಹೇಬ್ ಫಾಲ್ಕೆ, '' ಯವರ, 'ಜನ್ಮ ಶತಾಬ್ದಿಯ ವರ್ಷ'ವಾದ ೧೯೬೯ರಲ್ಲಿ ಈ ಪ್ರಶಸ್ತಿಯನ್ನು ನೀಡುವ ಪರಂಪರೆ, ಉಗಮಗೊಂಡಿತು. 'ಪ್ರತಿ ವರ್ಷದ ಪ್ರಶಸ್ತಿ'ಯನ್ನು ಅದರ ಮುಂದಿನ ವರ್ಷದ ಕೊನೆಯಲ್ಲಿ ನಡೆಯುವ 'ರಾಷ್ಟ್ರೀಯ ಚಲನಚಿತ್ರ ಪ್ರಶಸ್ತಿ ಪ್ರದಾನದ ಸಂದರ್ಭ'ದಲ್ಲಿ ನೀಡಲಾಗುತ್ತದೆ."},{"page_url":"https://it.wikipedia.org/wiki/Monte_Alto_(Texas)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/TXMap-doton-MonteAlto.PNG","page_title":"Monte Alto (Texas)","context_page_description":"Monte Alto è un census-designated place degli Stati Uniti d'America situato nella contea di Hidalgo dello Stato del Texas.\\nLa popolazione era di 1.924 persone al censimento del 2010. Fa parte dell'area metropolitana di McAllen–Edinburg–Mission."},{"page_url":"https://pt.wikipedia.org/wiki/Dominic_Raab","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Official_portrait_of_Dominic_Raab_crop_2.jpg","page_title":"Dominic Raab","context_page_description":"Dominic Rennie Raab é um político do Partido Conservador britânico, atualmente servindo como Parlamentar por Esher e Walton, e também detém as posições de Primeiro Secretário de Estado e Secretário para Assuntos Externos."},{"page_url":"https://it.wikipedia.org/wiki/United_States_Naval_Forces_Central_Command","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/United_States_Naval_Forces_Central_Command_patch_2014.png","page_title":"United States Naval Forces Central Command","context_page_description":"Il Comando centrale delle forze navali degli Stati Uniti/Quinta Flotta è un comando dell'U.S. Navy, responsabile su tutte le sue unità navali di superficie, sottomarine e forze aeree dislocate nel Golfo Persico e Mar Rosso. Fornisce le unità navali al comando unificato di teatro dello U.S.Central Command."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8A%E3%82%BF%E3%83%9E%E3%83%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Canavalia_gladiata2.jpg","page_title":"ナタマメ","context_page_description":"ナタマメはマメ亜科の蔓性の一年草。原産地は熱帯アジアまたはアフリカ。刀豆、帯刀とも呼ばれる。日本へは江戸時代に渡来。約25cmほどの豆果を結ぶ。以前から漢方薬として知られており、近年では健康食品、健康茶としても一般的に知られるようになった。"},{"page_url":"https://en.wikipedia.org/wiki/Epiur","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Etruscan_Bronze_Mirror_Fragment_300_BC.gif","page_title":"Epiur","context_page_description":"Epiur is an Etruscan mythological figure that appears on bronze Etruscan engraved mirrors. He is shown as an infant that has the face of a young man. He is also often winged and being held by Hercle or Menrva, who are charged with the protection and care of infants. He is also often shown to be presented to other gods."},{"page_url":"https://fr.wikipedia.org/wiki/Seraina_Rohrer","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Seraina_Rohrer.jpg","page_title":"Seraina Rohrer","context_page_description":"Seraina Rohrer, née le 19 décembre 1977 à Männedorf, est une chercheuse en cinéma suisse."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%9F%A5%E5%A3%AB%E4%B8%81%E5%B0%BC%E4%B8%80%E4%B8%96","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/Justinian.jpeg","page_title":"查士丁尼一世","context_page_description":"查士丁尼一世全名為弗拉維·伯多祿·塞巴提烏斯·查士丁尼，527年到565年擔任羅馬帝國皇帝。由於他收復了許多失土、重建聖索菲亞教堂並編纂《查士丁尼法典》，功不可沒，因此也被稱為查士丁尼大帝。\\n查士丁尼一世是古羅馬時代末期最重要的一位統治者，他的統治期一般被看作是羅馬帝國歷史從古典時期邁向中古世紀的的重要過渡期。比如他於542年廢除了執政官這個從羅馬共和國時期傳承下來的職務。他還加強了皇帝作為君權神授的地位，這一舉動徹底破壞了羅馬帝國中皇帝被視為執行長、「國家之父」，「第一公民」的世俗社會形象，但歷史學家普羅科匹厄斯時即對查士丁尼一世的一些政務決策提出了深刻批評。普羅科匹厄斯的著作是今天對查士丁尼一世統治期研究最重要的一手資料。"},{"page_url":"https://el.wikipedia.org/wiki/%CE%A4%CF%85%CF%86%CF%8E%CE%BD%CE%B1%CF%82_%CE%A7%CE%B1%CF%8A%CE%B3%CE%B9%CE%AC%CE%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Haiyan_2013-11-07_0420Z.jpg","page_title":"Τυφώνας Χαϊγιάν","context_page_description":"O τυφώνας Χαϊγιάν ή Γιολάντα, όπως είναι γνωστός στις Φιλιππίνες, είναι ανεπίσημα ο ισχυρότερος τροπικός τυφώνας, ο οποίος πέρασε από στεριά, με ταχύτητες ανέμου που έφτασαν τα 315 χιλιόμετρα την ώρα. O τυφώνας σχηματίστηκε ως περιοχή χαμηλής πίεσης αρκετές εκατοντάδες χιλιόμετρα ανατολικά-νοτιοανατολικά του Πονπέι, στις Ομόσπονδες Πολιτείες της Μικρονησίας στις 2 Νοεμβρίου 2013. Κινήθηκε προς τα δυτικά και εξελίχθηκε σε τροπική ύφεση την επόμενη μέρα. Όταν εξελίχθηκε σε τροπική καταιγίδα στις 4 Νοεμβρίου έλαβε το όνομα Χαϊγιάν και δυνάμωσε γρήγορα σε τυφώνα την επόμενη μέρα. Στις 6 Νοεμβρίου έφτασε σε κατηγορία 5 στη Κλίμακα Σαφίρ-Σίμπσον, αφότου πέρασε από την ατολλή Καγιαγκέλ του Παλάου. Στις 7 Νοεμβρίου, στις 18:00 UTC, η μετεωρολογική υπηρεσεία της Ιαπωνίας μέτρησε ταχύτητα ανέμων που έφτανε τα 315 χιλιόμετρα την ώρα. Αρκετές ώρες αργότερα, του μάτι του τυφώνα πέρασε πάνω από το Γκουιουάν, στο Ανατολικό Σαμάρ, και αν είχε διατηρήσει την ίδια ταχύτητα, τότε θα ήταν ο ισχυρότερος τυφώνας που πέρασε από στεριά, ξεπερνώντας το ρεκόρ που έθεσε ο τυφώνας του Ατλαντικού Καμίλ το 1969, ο οποίος είχε ταχύτητα ανέμου 305 χιλιόμετρα την ώρα όταν έφτασε στη στεριά."},{"page_url":"https://hu.wikipedia.org/wiki/Mexicali_(v%C3%A1ros)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Coat_of_Arms_Mexicali.png","page_title":"Mexicali (város)","context_page_description":"Mexicali Mexikó Alsó-Kalifornia államának fővárosa és második legnagyobb városa Tijuana után. Lakossága 2010-ben kb. 690 000 fő volt. A város neve mesterségesen alkotott vegyülékszó: a México és a California szavakból alkotta meg 1902-ben Agustín Sanginés. Ugyanezekből a szavakból rakták össze az USA területén fekvő, Mexicalival egybeépült Calexico nevét is."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A0%D7%A7%D7%95%D7%93%D7%94_%D7%A7%D7%A8%D7%99%D7%98%D7%99%D7%AA","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/77/Diag_phase_eau_heb.svg","page_title":"נקודה קריטית","context_page_description":"נקודה קריטית היא מונח בתרמודינמיקה.\\nבנקודה הקריטית, מצבי נוזל רווי ואד רווי זהים. כלומר, במהלך חימום נוזל הנתון בלחץ קריטי הגבול בין שני מצבי הצבירה, נוזל ואדים הולך ומטשטש כאשר מתקרבים לטמפרטורה הקריטית. צפיפות הנוזל הולכת וקטנה וצפיפות הגז הולכת וגדלה וכאשר הטמפרטורה מגיעה לערך מסוים שתי הצפיפויות משתוות ומקבלים מצב צבירה אחד הנקרא זורם.\\nהטמפרטורה, הלחץ והנפח בנקודה הקריטית נקראים הטמפרטורה הקריטית, הלחץ הקריטי והנפח הקריטי.\\nחומר המצוי בתנאים של לחץ וטמפרטורה הגבוהים מהתנאים הקריטיים נקרא זורם סופר-קריטי.\\nהנקודה הקריטית מצוינת באות 'C' בדיאגרמת מצבי הצבירה."},{"page_url":"https://en.wikipedia.org/wiki/Lewis_Hamilton","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/FIA_F1_Austria_2018_Handshake_after_Qualifying.jpg","page_title":"Lewis Hamilton","context_page_description":"Lewis Carl Davidson Hamilton MBE HonFREng is a British racing driver currently competing in Formula One for the Mercedes-AMG Petronas Formula One Team. A six-time Formula One World Champion, he is widely regarded as one of the greatest drivers in the history of the sport, and considered by some to be the greatest of all time. He won his first World Drivers' Championship with McLaren in 2008, before moving to Mercedes in 2013, with whom he has won a further five titles. One of the most successful drivers in the history of the sport, Hamilton's six World Championship titles is the second-most of all time, as is his tally of 89 race victories, while he holds the records for the all-time most career points, the all-time most pole positions, the all-time most podium finishes, the most grand slams in a season and the most points in a season.\\nBorn and raised in Stevenage, Hertfordshire, Hamilton enjoyed a successful ascent up the racing ladder and was signed to the McLaren young driver programme in 1998. This later resulted in a Formula One drive with McLaren in 2007, making Hamilton the first and only black driver to race in the sport."},{"page_url":"https://en.wikipedia.org/wiki/May_2012_Greek_legislative_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Alexis_Tsipras_2013_%28cropped%29.jpg","page_title":"May 2012 Greek legislative election","context_page_description":"The May 2012 Greek legislative election was held in Greece on Sunday, 6 May, to elect all 300 members to the Hellenic Parliament. Under the constitution, it was due to be held in late 2013, four years after the previous election; however, an early election was agreed under the November 2011 agreement to form a coalition government, formed with a remit to ratify and implement decisions taken with other Eurozone countries and the International Monetary Fund a month earlier."},{"page_url":"https://pl.wikipedia.org/wiki/Parki_narodowe_w_Holandii","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/03/NP-DrentscheAaKaart.jpg","page_title":"Parki narodowe w Holandii","context_page_description":"Poniżej znajduje się lista parków narodowych, zlokalizowanych na terenie Holandii."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B2%99%E7%9F%B3%E5%9C%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/KalksteinbruchR%C3%B6senbeck1.JPG","page_title":"沙石场","context_page_description":"砂石场，指建筑用砂、建筑用石的采掘、精选加工生产单位。砂石场多为成片连接的开放性露天开采区域，属于生产性企业单位。采石场多位于岩石富集区，多位于陆地的丘陵、山区；采砂场多位于水道、富砂陆地，大多数临水道而建，内陆地区多临河道、湖泊而建，大型海洋砂石采掘则依海而建。砂、石的生产过程主要分为二道工序，即采掘和精选分级。其固定场所多用于储存和精选分级。一个中等规模的生产企业可以年生产砂石数十万吨，大型的企业生产年生产能力达百万吨。\\n一些采石场在废弃后，因地下水回流会成为地形复杂的池塘或湖泊，称“采石场湖”。又或再利用成为垃圾堆填区。"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%84%B8%EB%A0%88%EC%8A%A4_(%EC%99%9C%ED%96%89%EC%84%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/PIA20134-Ceres-DwarfPlanet-Dawn-3rdMapOrbit-HAMO-image71-20151015.jpg","page_title":"세레스 (왜행성)","context_page_description":"세레스는 소행성대에 있는 왜행성으로, 공식 명칭인 소행성명은 1 세레스이다. 현재 태양계의 소행성대에 존재하는 유일한 왜행성이다. 1801년 1월 1일 이탈리아의 천문학자 주세페 피아치가 발견하여, 그 후 반세기 동안 행성에 속했었다. 세레스라는 이름은 로마 신화의 농업과 곡물의 여신인 케레스에서 따왔다.\\n지름은 970 km 로, 소행성대에서 가장 크고 무거운 천체이다.\\n다른 소행성은 불규칙한 모형, 약한 중력임에 반해 세레스는 관측을 통해 구형임이 밝혀졌다.\\n표면은 물얼음과 다양한 수화물이 혼합되어 있는 것으로 추정된다.\\n세레스의 내부는 암석질의 핵 그리고 얼음 맨틀으로 구성되어 있으며, 표면 아래에는 물로 이루어진 바다가 존재하는 것으로 생각된다.\\n세레스의 겉보기등급은 +6.7 ~ +9.3 등급으로, 육안으로는 볼 수가 없다.\\n2007년 9월 27일, NASA에서는 4 베스타, 세레스 를 탐사하기 위하여 돈 탐사선을 발사했다."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D9%88%D8%B1%D9%86%D9%8A%D9%84%D9%8A%D9%88%D8%B3_%D9%87%D9%8A%D9%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/Cornelius_hill.jpg","page_title":"كورنيليوس هيل","context_page_description":"كورنيليوس هيل ‏ هو قسيس أمريكي، ولد في 13 نوفمبر 1834، وتوفي في 25 يناير 1907 في Oneida في الولايات المتحدة."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%94%D1%83%D0%B1%D1%80%D0%B0%D0%B2%D0%BA%D0%B0_%D0%A1%D1%82%D0%BE%D1%98%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Dubravka_Stojanovi%C4%87.jpg","page_title":"Дубравка Стојановић","context_page_description":"Дубравка Стојановић је историчарка, редовни професор на Одељењу за историју Филозофског факултета у Београду."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%9B%BB%E5%8B%95%E6%89%B6%E6%A2%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/20190131%E6%B3%A2%E6%B5%AA%E6%96%87%E5%8C%96%E5%9F%8E%E5%88%86%E7%BA%A7%E8%87%AA%E5%8A%A8%E6%89%B6%E6%A2%AF.jpg","page_title":"電動扶梯","context_page_description":"电动扶梯，俗称滚梯，是一种以运输带方式运送行人的运输工具。电动扶梯一般是斜置的。行人在扶梯的一端站上自动行走的梯级，便会自动被带到扶梯的另一端，途中梯级会一路保持水平。枎梯在两旁设有跟梯级同步移动的扶手，供使用者扶握。电动扶梯可以是永远向一个方向行走，但多数都可以根据时间、人流等需要，由管理人员控制行走方向。另一种和电动扶梯十分类似的行人运输工具，是电动平面步道。两者的分别主要是自动行人道是没有梯级的；多数只会在平地上行走，或是稍微倾斜。"},{"page_url":"https://nl.wikipedia.org/wiki/Nederlandsche_Rhijnspoorweg-Maatschappij","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Perron_van_de_Nederlandsche_Rhijnspoorweg-Maatschappij_in_1866_te_Utrecht.jpg","page_title":"Nederlandsche Rhijnspoorweg-Maatschappij","context_page_description":"De Nederlandsche Rhijnspoorweg-Maatschappij was een Nederlandse spoorwegmaatschappij. De NRS is opgericht op 3 juli 1845 in Utrecht en is de rechtsopvolger van de Rijn Spoorweg die de Rhijnspoorweg heeft aangelegd.\\nDe NRS heeft de volgende spoorlijnen aangelegd en geëxploiteerd:\\nSpoorlijn Utrecht - Rotterdam\\nSpoorlijn Gouda - Den Haag\\nVerlenging van de Rhijnspoorweg naar Duitsland\\nSpoorlijn Harmelen - Breukelen\\nSpoorlijn Zevenaar - Kleef\\nDaarnaast exploiteerde de NRS de spoorlijn Woerden - Leiden. Ook de eerste Nederlandse stoomtramlijn, van Den Haag Rhijnspoorstation naar Scheveningen is in 1879 door de NRS geopend. De tramlijn Ede - Wageningen werd in 1882 geopend.\\nIn 1890 is de NRS overgenomen door de Staat der Nederlanden, die de exploitatie in handen gaf van de Staatsspoorwegen. Het spoorwegmaterieel van de NRS werd verdeeld over de Staatsspoorwegen en de Hollandse IJzeren Spoorweg-Maatschappij. Van het oorspronkelijke materieel van de NRS is de locomotief 107 bewaard door het Spoorwegmuseum."},{"page_url":"https://la.wikipedia.org/wiki/Vertillum","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/Map_commune_FR_insee_code_21671.png","page_title":"Vertillum","context_page_description":"Vertillum est commune Francicum 54 incolarum praefecturae Clivi Aurei in regione occidentali Burgundia."},{"page_url":"https://es.wikipedia.org/wiki/Somiedo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Somiedo.jpg","page_title":"Somiedo","context_page_description":"Somiedo es un concejo de la comunidad autónoma del Principado de Asturias. Limita al norte con Belmonte de Miranda, al este con Teverga, al oeste con Tineo y Cangas del Narcea y al sur con la provincia de León.\\nEs el segundo municipio con menor densidad de población. Todo el concejo forma parte del parque natural de Somiedo, habiendo sido declarado Reserva de la Biosfera."},{"page_url":"https://it.wikipedia.org/wiki/Fasti_medicei","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Volterrano%2C_fasti_medicei_07_Cosimo_II_riceve_i_vincitori_dell%27impresa_di_Bona%2C_1637-46%2C_01.JPG","page_title":"Fasti medicei","context_page_description":"I Fasti medicei sono un ciclo di affreschi dipinti dal Volterrano tra il 1636 e il 1646 nel cortile della villa medicea della Petraia a Firenze. Dedicati alla celebrazione di Casa Medici, sono considerati il capolavoro dell'artista, e una delle opere più significative del Seicento fiorentino."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9D%8E%E6%9D%91%E5%85%AC%E5%9B%AD%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/%E6%9D%8E%E6%9D%91%E5%85%AC%E5%9B%AD%E7%AB%99%E7%AB%99%E7%89%8C.jpg","page_title":"李村公园站","context_page_description":"李村公园站，位于中国青岛市李沧区，是青岛地铁2号线一期的终点站，是信号系统含有联锁目标控制器的设备集中站。"},{"page_url":"https://es.wikipedia.org/wiki/Solenopsis_xyloni","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/Solenopsis_xyloni_casent0005806_dorsal_1.jpg","page_title":"Solenopsis xyloni","context_page_description":"La hormiga de fuego del sur, también conocida como \\"hormiga de fuego de California\\" u \\"hormiga de algodón\\", es una \\"hormiga de fuego\\", género Solenopsis nativa de las partes meridionales de los Estados Unidos.​​​ Su comportamiento es similar a la hormiga de fuego roja importada, aunque su picadura es menos dolorosa. Tiene una dieta amplia y oportunista, almacena las semillas en su nido y come melaza recolectada de otros insectos.​\\nLa hormiga de fuego del sur comparte su rango con la hormiga de fuego roja importada, la hormiga de fuego dorada y S. amblychila. La hormiga de fuego del sur tiene la distribución más amplia de éstos, ocurriendo desde las Carolinas a California, incluyendo Georgia, Tennessee, Arkansas, y Kansas meridional.​"},{"page_url":"https://ceb.wikipedia.org/wiki/Camponotus_germaini","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Camponotus_germaini_casent0173420_profile_1.jpg","page_title":"Camponotus germaini","context_page_description":"Espesye sa holmigas ang Camponotus germaini. Una ning gihulagway ni Carlo Emery ni adtong 1903. Ang Camponotus germaini sakop sa kahenera nga Camponotus sa kabanay nga holmigas."},{"page_url":"https://es.wikipedia.org/wiki/Viva_Air_Colombia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Logosvivaair_Mesa-de-trabajo-1.png","page_title":"Viva Air Colombia","context_page_description":"Viva Air Colombia es una aerolínea de bajo costo comercial de pasajeros de Colombia. Fundada el 16 de septiembre de 2009 bajo el nombre de Fast Colombia S.A.S., inició operaciones el 25 de mayo de 2012. Su centro de operaciones es el Aeropuerto Internacional José María Córdova de Rionegro que brinda servicio a Medellín."},{"page_url":"https://de.wikipedia.org/wiki/Epitaph_f%C3%BCr_Philipp_Friedrich_von_Geismar","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Stuttgart_Hospitalkirche_Epitaph.jpg","page_title":"Epitaph für Philipp Friedrich von Geismar","context_page_description":"Das Epitaph für Philipp Friedrich von Geismar ist ein Wandepitaph an der Hospitalkirche in Stuttgart. Das Außenepitaph ist dem württembergischen Rat, Hofmeister und Obervogt zu Marbach am Neckar Philipp Friedrich von Geismar gewidmet. Das Epitaph besteht aus einer teilweise stark verwitterten Inschriftentafel mit einer ornamentalen Randleiste."},{"page_url":"https://de.wikipedia.org/wiki/Jenaplanschule_Rostock","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Frieda23_TinoHoefert_2.jpg","page_title":"Jenaplanschule Rostock","context_page_description":"Die Jenaplanschule Rostock ist eine integrierte Gesamtschule mit Grundschule und einer sich im Aufbau befindenden gymnasialen Oberstufe in Rostock. Ihr Schulkonzept basiert auf dem „Jenaplan“ Peter Petersens. Sie ist damit eine der wenigen staatlichen Schulen mit einem reformpädagogischen Schulprogramm. 2015 wurde die Jenaplanschule Rostock als Preisträgerin des Deutschen Schulpreises der Robert Bosch Stiftung ausgezeichnet."},{"page_url":"https://cy.wikipedia.org/wiki/Le_Claire,_Iowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Ralph_Erskine_Cleland_%281892-1971%29.jpg","page_title":"Le Claire, Iowa","context_page_description":"Dinas yn Scott County, yn nhalaith Iowa, Unol Daleithiau America yw Le Claire, Iowa.\\nCeir 9 cylchfa amser yn UDA, ac mae hon yn perthyn i'r cylchfa amser a elwir yn: Cylchfa Amser Canolog."},{"page_url":"https://fr.wikipedia.org/wiki/Roger_Mehl","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Roger_Mehl-Ann%C3%A9es_1980.jpg","page_title":"Roger Mehl","context_page_description":"Roger Adolphe Mehl, né le 10 mai 1912 à Relanges et mort le 7 mars 1997 à Strasbourg, est un théologien et sociologue protestant français. Il est professeur à la faculté de théologie protestante de Strasbourg de 1945 à 1981 et fonde le Centre de sociologie du protestantisme au sein de l'université de Strasbourg."},{"page_url":"https://es.wikipedia.org/wiki/Nanzen-ji","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Nanzenji_Sanmon_1.jpg","page_title":"Nanzen-ji","context_page_description":"Nanzen-ji es un recinto monástico y de templos de culto budista de la ciudad de Kioto, Japón. Situado en las laderas de la montaña Higashiyama que bordea el este de Kioto, fue fundado por el emperador Kameyama en 1291. Este monasterio ostenta la dirección de la escuela Rinzai del budismo Zen.​ El recinto de Nazen-ji está catalogado por el gobierno japonés como lugar de importancia histórica de Japón y esta en la lista de Patrimonio Cultural de Japón. Así mismo, los jardines del Hōjō pertenecen a la lista de Lugares de Belleza Escénica del país.​​"},{"page_url":"https://sv.wikipedia.org/wiki/Cranichis","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Cranichis_candida.jpg","page_title":"Cranichis","context_page_description":"Cranichis är ett släkte av orkidéer. Cranichis ingår i familjen orkidéer."},{"page_url":"https://eu.wikipedia.org/wiki/Cassanhas_de_Begonh%C3%A9s","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Cassagnes_Eglise_1.JPG","page_title":"Cassanhas de Begonhés","context_page_description":"Cassanhas de Begonhés Okzitaniako udalerri bat da. Administratiboki Frantziako Aveyron departamenduan dago, Okzitania eskualdean. 2013an 922 biztanle zituen."},{"page_url":"https://it.wikipedia.org/wiki/Torneo_di_Viareggio_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/600px_Grigio_bordato_di_Bianco.png","page_title":"Torneo di Viareggio 2016","context_page_description":"Il Torneo di Viareggio 2016 è la sessantottesima edizione del torneo calcistico internazionale riservato alle formazioni giovanili e organizzato dal CGC Viareggio.\\nLa finale dell'edizione 2016 si è tenuta allo Stadio Torquato Bresciani. Il torneo è stato vinto dalla Juventus, che ha sconfitto per 3-2 in finale il Palermo, alla sua prima finale nella storia della competizione."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A6%AC%E8%87%AA%E9%81%94Flair_Wagon","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Mazda_FLAIR_WAGON_HYBRID_XS_%28DAA-MM53S%29_front.jpg","page_title":"馬自達Flair Wagon","context_page_description":"馬自達Flair Wagon是2012年起由日本馬自達汽車公司委託鈴木汽車代工生產、貼上馬自達廠徽銘牌的輕型高頂旅行車，這款車是以鈴木Palette為基礎而開發出來的，僅在日本國內市場銷售。\\n除了鈴木Palette外，另一款兄弟車為日產Roox。這是繼第六代鈴木Alto、第五代馬自達Carol和日產Pino三兄弟車款以來，第二次出現三兄弟車款。"},{"page_url":"https://tr.wikipedia.org/wiki/Bosna_Kiril_alfabesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Povelja_Kulina_bana.jpg","page_title":"Bosna Kiril alfabesi","context_page_description":"Bosna Kiril alfabesi veya Bosna alfabesi, kiril alfabesinin Bosna-Hersek, orjinli bir tipi olan alfabedir. Bu yazı sistemi, Bosna bölgesi ve çevresinde yaygın olarak kullanılmıştır. Özellikle Hırvat bilim ve yazı çevresinde, bu alfabeyi belirtmede “Hırvat Kiril alfabesi” türünden kullanım da görülmüştür. Alfabenin kullanıldığı dönem 10-18. yüzyıldır.\\nTerim olarak bu yazı sistemi için özellikle Balkanlar’da birçok ad kullanılmıştır. “Bosančica” terimi en yaygın olanıdır. Diğer terimler harvacko pismo, bosanska ćirilica, bosanica şeklindedir. Hırvat bilim insanı Ćiro Truhelka, Bosančica terimini bilim dünyasına kazandıran kişidir."},{"page_url":"https://nl.wikipedia.org/wiki/Kyrksten","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Kyrksten-idrottsplats.jpg","page_title":"Kyrksten","context_page_description":"Kyrksten is een plaats in de gemeente Storfors in het landschap Värmland en de provincie Värmlands län in Zweden. De plaats heeft 280 inwoners en een oppervlakte van 31 hectare. De plaats ligt op een afstand van ongeveer 20 kilometer autorijden ten noordwesten van de stad Karlskoga. De plaats ligt aan de noord oever van het meer Alkvettern."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%A5%BF%E6%B4%8B%E8%8F%9C%E8%A1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Sai_Yeung_Choi_Street_South_near_Mong_Kok_Road.JPG","page_title":"西洋菜街","context_page_description":"西洋菜街是香港九龍油尖旺區的一條著名街道，位於彌敦道及長沙灣道以東，通菜街以西；南至登打士街開始，北至石硤尾聖方濟各天主堂及小學。"},{"page_url":"https://nl.wikipedia.org/wiki/Frans_Duynstee","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Debatavond_Nieuw-Guinea_in_Krasnopolski_Mr_Burger_en_professor_Duynstee%2C_Bestanddeelnr_913-2269.jpg","page_title":"Frans Duynstee","context_page_description":"Frans Jozef Ferdinand Marie Duynstee was een Nederlands hoogleraar staatsrecht en een politicus voor de KVP."},{"page_url":"https://de.wikipedia.org/wiki/Herbert_Capeller","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/HC-Beethoven.jpg","page_title":"Herbert Capeller","context_page_description":"Herbert Capeller war ein bayerischer Kunstmaler und Dentist, er schuf Ölbilder, Aquarelle und Gouachen."},{"page_url":"https://pl.wikipedia.org/wiki/Kabaret_Hlynur","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Hlynur.jpg","page_title":"Kabaret Hlynur","context_page_description":"Kabaret Hlynur – kabaret powiązany z tzw. zielonogórskim zagłębiem kabaretowym.\\nW skład zespołu wchodziło pięć osób. Grupa prezentowała skecze o tematyce społecznej oraz metafizycznej, zarówno obyczajowe, jak i absurdalne. Lubiła bawić się konwencjami filmowymi, telewizyjnymi czy literackimi.\\nNazwa pochodzi od imienia głównego bohatera filmu i książki „101 Reykjavik”. Hlynur w języku Islandzkim oznacza klon.\\nZ dniem 1 stycznia 2013 roku kabaret Hlynur zawiesił swoją działalność na czas nieokreślony."},{"page_url":"https://en.wikipedia.org/wiki/Brigham_Young_University_LGBT_history","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Turn_It_Off_Conversion_Therapy_Light_Switch.png","page_title":"Brigham Young University LGBT history","context_page_description":"Students identifying as LGBTQIA+ have a long, documented history at Brigham Young University, and have experienced a range of treatment by other students and school administrators over the decades. BYU is the largest religious university in North America and is the flagship institution of the educational system of The Church of Jesus Christ of Latter-day Saints. Historically, experiences for BYU students identifying as LGBTQIA+ have included being banned from enrolling due to their romantic attractions in the 60s, being required by school administration to undergo electroshock and vomit aversion therapies in the 70s, having nearly 80% of BYU students refusing to live with an openly homosexual person in a poll in the 90s, and a ban on coming out into the 2000s."},{"page_url":"https://fr.wikipedia.org/wiki/Khanat_de_Crim%C3%A9e","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Krimkhanat_um_1550.jpg","page_title":"Khanat de Crimée","context_page_description":"Le khanat de Crimée est un ancien État gouverné par les Tatars de Crimée de 1441 à 1783. Son nom originel était Qırım Yurtu. Parmi les khanats turcs issus de l'éclatement de la Horde d'or, le khanat de Crimée est celui qui a duré le plus longtemps.\\nLe khanat s'étendait sur environ 150 000 km² comprenant la Crimée et une vaste portion, plus ou moins étendue selon les époques, de la steppe pontique héritée des Coumans, au nord et autour de la mer Méotide et des embouchures du Dniestr, du Boug méridional, du Dniepr, du Don et du Kouban.\\nLorsque l'Empire turc prit le contrôle du pourtour de la mer Noire au XVᵉ siècle, le khanat devint son allié et son vassal : les Ottomans prirent le contrôle direct d'Azaq, de la côte sud de la Crimée, du Boudjak et du Yedisan, mais laissa au khanat le libre-usage, sans taxes, de ces deux derniers territoires, intégrés comme rayas au paşalık d'Özi jusqu'en 1783. Initialement tengriste, le khanat est passé progressivement à l'islam sous l'influence turque, mais comptait quelques minorités chrétiennes et juives.\\nLorsque l'Empire russe annexa le khanat de Crimée en 1783, seule la France émit une protestation."},{"page_url":"https://nl.wikipedia.org/wiki/Uttar_Pradesh","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/EidgahBahraich_03.jpg","page_title":"Uttar Pradesh","context_page_description":"Uttar Pradesh is een deelstaat van India, gelegen in het noorden van het land. De staat telt ruim 200 miljoen inwoners en is daarmee met voorsprong de meest bevolkte deelstaat van India en tevens ter wereld. De bestuurlijke en wetgevende hoofdstad van Uttar Pradesh is Lucknow; de rechterlijke hoofdstad is Prayagraj."},{"page_url":"https://war.wikipedia.org/wiki/Sauvagesia_racemosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Flickr_-_BioDivLibrary_-_n24_w1150_%281%29.jpg","page_title":"Sauvagesia racemosa","context_page_description":"An Sauvagesia racemosa in uska species han Magnoliopsida nga ginhulagway ni A. St.-hil.. An Sauvagesia racemosa in nahilalakip ha genus nga Sauvagesia, ngan familia nga Ochnaceae. Waray hini subspecies nga nakalista."},{"page_url":"https://de.wikipedia.org/wiki/Pfarrkirche_Waidegg","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Pfarrkirche_Waidegg_-_Hochaltar.jpg","page_title":"Pfarrkirche Waidegg","context_page_description":"Die Pfarrkirche Waidegg in der Gemeinde Kirchbach im Gailtal ist dem heiligen Thomas geweiht. Eine Kirche in Waidegg wurde urkundlich erstmals 1485 erwähnt."},{"page_url":"https://es.wikipedia.org/wiki/Ermita_de_San_Esteban_(Escobedo_de_Camargo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Ermita-de-San-Esteban-1.jpg","page_title":"Ermita de San Esteban (Escobedo de Camargo)","context_page_description":"La ermita de San Esteban está situada en el barrio San Esteban en la parte alta de Escobedo, localidad perteneciente al municipio de Camargo.\\nLa ermita poseyó un retablo que se encuentra en otra iglesia desconocida, de este retablo solo se conserva una estatua de San Esteban, titular de esta ermita. Cambien se conserva una imagen de San Isidro Labrador que se encuentra en la iglesia parroquial de San Pedro en Escobedo de Camargo."},{"page_url":"https://de.wikipedia.org/wiki/Feder_(Technik)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Safety_pin2.jpg","page_title":"Feder (Technik)","context_page_description":"Eine Feder ist ein i. d. R. metallisches technisches Bauteil, das sich im praktischen Gebrauch ausreichend elastisch verformen lässt. Die am meisten verwendete Feder ist die Schraubenfeder, ein in Schraubenform gewickelter Draht."},{"page_url":"https://pl.wikipedia.org/wiki/Ksienija_Sto%C5%82bowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/2014_Olympics_Ksenia_Stolbova_Fedor_Klimov_01.jpg","page_title":"Ksienija Stołbowa","context_page_description":"Ksieenija Andriejewna Stołbowa, ros. Ксения Андреевна Столбова – rosyjska łyżwiarka figurowa startująca w parach sportowych Fiodorem Klimowem, a następnie z Andriejem Nowosiołowem. Mistrzyni i wicemistrzyni olimpijska z Soczi, wicemistrzyni świata, 3-krotna wicemistrzyni Europy, zwyciężczyni finału Grand Prix, wicemistrzyni świata juniorów oraz 3-krotna mistrzyni Rosji. 12 lutego 2020 roku ogłosiła zakończenie kariery amatorskiej."},{"page_url":"https://simple.wikipedia.org/wiki/Kansas_City_International_Airport","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Barack_Obama_with_Jay_Nixon_%284800128016%29.jpg","page_title":"Kansas City International Airport","context_page_description":"Kansas City International Airport is a public airport. It is 15 miles northwest of downtown Kansas City in Platte County, Missouri. In 2018, 11,850,825 people used the airport. 2018 was the second busiest year in its history. Its largest carriers are Southwest Airlines and Delta Air Lines. Both of them have many flights every day in Terminal B."},{"page_url":"https://en.wikipedia.org/wiki/Great_Wall_Safe","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Great_Wall_Safe_China_2014-04-25.JPG","page_title":"Great Wall Safe","context_page_description":"The Great Wall Safe is a sport utility vehicle produced by the Chinese manufacturer Great Wall Motors from 2002 to 2009."},{"page_url":"https://de.wikipedia.org/wiki/Deadpool_(Film)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Brianna_Hildebrand_by_Gage_Skidmore.jpg","page_title":"Deadpool (Film)","context_page_description":"Deadpool ist ein US-amerikanischer Actionfilm mit satirischen Elementen. Die Comicverfilmung basiert auf der Comicfigur Deadpool des Marvel-Verlages.\\nRegie führte Tim Miller. Das Drehbuch schrieben Rhett Reese und Paul Wernick. Als Produzenten fungierten Simon Kinberg, Lauren Shuler Donner und Ryan Reynolds. Reynolds übernahm zudem die Hauptrolle des Films. In Nebenrollen sind Ed Skrein, Morena Baccarin, Brianna Hildebrand, Gina Carano sowie T. J. Miller zu sehen. Die Filmmusik komponierte der niederländische Filmkomponist Junkie XL.\\nEs handelt sich um den achten Teil der X-Men-Filmreihe. Der Film startete am 11. Februar 2016 in den deutschen Kinos."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A5%D1%83%D0%B0%D0%BD_%D0%A1%D1%8D%D0%B1%D0%B0%D1%82%D1%8B%D1%8F%D0%BD_%D0%AD%D0%BB%D1%8C%D0%BA%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Elcano.jpg","page_title":"Хуан Сэбатыян Элькана","context_page_description":"Хуан Сэбатыян дэль Кана, гішп. Juan Sebastián del Cano — гішпанскі мараплавец баскскага паходжаньня."},{"page_url":"https://sh.wikipedia.org/wiki/Ces%C3%A1ria_%C3%89vora","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Ces%C3%A1ria_%C3%89vora_2009.jpg","page_title":"Cesária Évora","context_page_description":"Cesária Évora bila je najpoznatija zelenortska pjevačica i simbol world muzike posljednih godina 20. vijeka."},{"page_url":"https://en.wikipedia.org/wiki/Husiatyn","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Synagogue_Husyatin_01.jpg","page_title":"Husiatyn","context_page_description":"Husiatyn is an urban-type settlement in the Ternopil Oblast of western Ukraine. Alternate spellings include Gusyatin, Husyatin, and Hsiatyn. Husiatyn is the administrative center of the Husiatyn Raion, and is located on the west bank of the Zbruch River. This river formed the old boundary between Austria-Hungary and the Russian Empire in the nineteenth century, and the boundary between the Republic of Poland and the Soviet Union during the inter-war period of the twentieth century."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B5%D1%87%D0%B5%D0%BD%D0%B5%D0%B6%D1%81%D0%BA%D0%B0%D1%8F_%D0%BB%D0%B5%D1%81%D0%BD%D0%B0%D1%8F_%D0%B4%D0%B0%D1%87%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Vingerjas.jpg","page_title":"Печенежская лесная дача","context_page_description":"Печенежская лесная дача — ландшафтный заказник местного значения площадью 5 292,0 га, образованный в 1984 году на территории Печенежского района Харьковской области Украины.\\nВ рамках заказника охраняется типичный ландшафт лесостепной зоны: возвышенные равнины с мощным антропогеновым покровом.\\nОтветственным за природоохрану заказника является Чугуево-Бабчанский гослесхоз.."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D9%8A%D8%AF%D8%AC%D9%84%D9%8A_(%D9%81%D9%8A%D8%B1%D8%AC%D9%8A%D9%86%D9%8A%D8%A7_%D8%A7%D9%84%D8%BA%D8%B1%D8%A8%D9%8A%D8%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Ridgeley_West_Virginia.jpg","page_title":"ريدجلي (فيرجينيا الغربية)","context_page_description":"ريدجلي ‏ هي بلدة تقع بولاية فيرجينيا الغربية في الولايات المتحدة. تبلغ مساحتها 0.78، وترتفع عن سطح البحر 213 م، بلغ عدد سكانها 675 نسمة في عام 2010 حسب إحصاء مكتب تعداد الولايات المتحدة وتصل الكثافة السكانية فيها 898.7 نسمة/كم²."},{"page_url":"https://cs.wikipedia.org/wiki/Sin-%C4%8Du","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/79/Hsinchu_City_Montage.png","page_title":"Sin-ču","context_page_description":"Sin-ču je město na úrovni okresu na Tchaj-wanu. Jeho sousedy jsou okres Sin-ču a okres Miao-li.\\nMěsto bylo napojené na historicky první železniční trať Tchaj-wanu. Ta se začala budovat roku 1887 a vedla sem z města Ťi-lung."},{"page_url":"https://fi.wikipedia.org/wiki/ISS:n_kokoonpano","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/STS-130_Payload_Changeout_Room.jpg","page_title":"ISS:n kokoonpano","context_page_description":"Tämä on luettelo ISS:n eli Kansainvälisen avaruusaseman kokoonpanon vaiheista. Kokoonpano alkoi marraskuussa 1998 ja saatiin päätökseen aseman rungon ja aurinkopaneelien osalta maaliskuussa 2009. Modulaariseen rakenteen ansiosta asemaa laajennetaan edelleen liittämällä siihen uusia moduuleja. Näitä moduuleja on aikataulutettu vuoteen 2016 saakka."},{"page_url":"https://en.wikipedia.org/wiki/Gakkel_Ridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Awi-Pillowlava_hg.jpg","page_title":"Gakkel Ridge","context_page_description":"The Gakkel Ridge is a mid-oceanic ridge, a divergent tectonic plate boundary between the North American Plate and the Eurasian Plate. It is located in the Eurasian Basin of the Arctic Ocean, between Greenland and Siberia, and has a length of about 1,800 kilometers. Geologically, it connects the northern end of the Mid-Atlantic Ridge with the Laptev Sea Rift.\\nThe existence and approximate location of the Gakkel Ridge were predicted by Soviet polar explorer Yakov Yakovlevich Gakkel, and confirmed on Soviet expeditions in the Arctic around 1950. The Ridge is named after him, and the name was recognized in April 1987 by SCUFN.\\nThe ridge is the slowest known spreading ridge on earth, with a rate of less than one centimeter per year. Until 1999, it was believed to be non-volcanic; that year, scientists operating from a nuclear submarine discovered active volcanoes along it. In 2001 two research icebreakers, the German Polarstern and the American Healy, with several groups of scientists, cruised to the Gakkel Ridge to explore it and collect petrological samples. Among other discoveries, this expedition found evidence of hydrothermal vents."},{"page_url":"https://eo.wikipedia.org/wiki/Rakonto_de_la_Vivo_de_Frederick_Douglass","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Sketchofdouglass.jpg","page_title":"Rakonto de la Vivo de Frederick Douglass","context_page_description":"Rakonto de la Vivo de Frederick Douglass estas memuaro kaj traktaĵo pri abolicio verkita de la fama oratoro kaj ekssklavo, Frederick Douglass. Oni ĝeneral konsideras ĝin la plej fama el nombro da rakontoj verkitaj de eksaj sklavoj dum la sama periodo.\\nKune ku La Kabano de Onklo Tom, la Rakonto de la Vivo de Frederick Douglass estis unu el la plej influaj literaturaĵoj fuelantaj la aboliciisman movadon de la frua 19-a jarcento en Usono."},{"page_url":"https://en.wikipedia.org/wiki/Visby_City_Wall","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Skytteglugg_i_Ringmuren_Visby.jpg","page_title":"Visby City Wall","context_page_description":"Visby City Wall is a medieval defensive wall surrounding the Swedish town of Visby on the island of Gotland. As the strongest, most extensive, and best preserved medieval city wall in Scandinavia, the wall forms an important and integral part of Visby World Heritage Site.\\nBuilt in two stages during the 13th and 14th century, approximately 3.44 km of its original 3.6 km still stands. Of the 29 large and 22 smaller towers, 27 large and 9 small remain. A number of houses that predate the wall were incorporated within it during one of the two phases of construction. During the 18th century, fortifications were added to the wall in several places and some of the towers rebuilt to accommodate cannons."},{"page_url":"https://pl.wikipedia.org/wiki/Opie%C5%84ka_miodowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Armillaria_mellea_Linden.jpg","page_title":"Opieńka miodowa","context_page_description":"Opieńka miodowa – gatunek grzybów z rodziny obrzękowcowatych, a także nazwa zbiorowa dla kompleksu drobnych gatunków wyodrębnionych w latach 70. XX wieku z wcześniej szeroko ujmowanego gatunku."},{"page_url":"https://pl.wikipedia.org/wiki/Horezu","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/ROU_VL_Horezu_CoA.jpg","page_title":"Horezu","context_page_description":"Horezu – miasto w Rumunii, w okręgu Vâlcea. Liczba mieszkańców to około 7 tys.\\nGłównym i niezwykle cennym zabytkiem miasta jest kompleks klasztorny z cerkwią św. Heleny i Konstantyna, wzniesiony w latach 1690 - 1697 z polecenia hospodara wołoskiego Konstantyna Brâncoveanu."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D1%82%D1%80%D1%8D%D0%BB%D1%8C%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BE%D0%BC%D0%BF%D0%BB%D0%B5%D0%BA%D1%81_%C2%AB%D0%94%D0%B2%D0%BE%D1%80%D0%B5%D1%86_%D0%BA%D0%BE%D0%BD%D0%B3%D1%80%D0%B5%D1%81%D1%81%D0%BE%D0%B2%C2%BB.JPG","page_title":"Стрэльна","context_page_description":"Стрэ́льна — пасёлак у Расіі, муніцыпальнае ўтварэнне ў складзе Петрадварцовага раёна горада федэральнага значэння Санкт-Пецярбурга. Размешчаны на паўднёвым беразе Фінскага заліва, на рэках Стрэлка і Кікенка. Насельніцтва станам на 2015 год складае 13 632 чал.\\nПраз Стрэльну праходзіць Пецяргофская дарога, а маршрут трамвая № 36, які заканчваецца ў ёй — спадчына ўнікальнай транспартнай лініі АРАНЭЛ - першага ў Расійскай імперыі праекта прыгарадных электрацягнікоў, які павінен быў звязаць Стрэльну з Нарвскай заставай. Таксама праз пасёлак праходзіць участак Балтыйскай лініі Акцябрскай чыгункі, па якой ідуць у тым ліку і прыгарадныя цягнікі з прыпынкам на станцыі Стрэльна."},{"page_url":"https://nl.wikipedia.org/wiki/Maria_Jos%C3%A9_van_Bragan%C3%A7a","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Carl_Theodor_und_Maria_Josepha_in_Bayern.jpg","page_title":"Maria José van Bragança","context_page_description":"Maria José van Bragança was een Portugese prinses.\\nZij was een dochter van koning Michaël I van Portugal en Adelheid van Löwenstein-Wertheim-Rosenberg.\\nOp 29 april 1874 trouwde ze met hertog Karel Theodoor in Beieren, die zeven jaar tevoren weduwnaar was geworden, na de dood van zijn eerste vrouw Sophie van Saksen.\\nHet echtpaar kreeg vijf kinderen:\\nSophie Adelheid, gehuwd met Hans Veit zu Törring-Jettenbach\\nElisabeth, gehuwd met koning Albert I van België\\nMarie Gabriëlle, gehuwd met kroonprins Rupprecht van Beieren\\nLodewijk Willem\\nFrans Jozef in Beieren\\nMaria José was de enige overgrootouder die de Belgische koningen Boudewijn en Albert II nog hebben gekend."},{"page_url":"https://en.wikipedia.org/wiki/Isuzu_Astra_Motor_Indonesia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Isuzu_Elf_003.JPG","page_title":"Isuzu Astra Motor Indonesia","context_page_description":"Isuzu Astra Motor Indonesia is a joint venture automobile and commercial vehicle manufacturer with headquarters in Jakarta, Indonesia. The company was founded in April 2008 and is the successor of the previous Isuzu manufacturer, Pantja Engine, founded in May 1974. The new company is jointly owned by Isuzu and the holding company Astra International, each holding a 44.94% share in the company, with the remaining stake of 10.12% belonging to the Indonesian Product Exhibition. Under the leadership of President Prijono Sugiarto, the company manufacturers up to 75,000 units a year. The majority of the products are for export to the markets of Thailand, the Philippines and China.\\nAfter nearly two years of construction, the new plant was opened in the summer of 1976. Isuzu Gemini was the entry-level models. In the commercial vehicle sector, it ranked the brand new model of Isuzu Elf and the Isuzu Forward, here ever since sold as the Isuzu Borneo. The first SUV was manufactured in 1980, Isuzu P'up, a sister model of the Japanese Isuzu Faster. The model soon became very popular and was especially successful as an export.\\nThe Isuzu Trooper, which since 1988 in Indonesia has been built."},{"page_url":"https://en.wikipedia.org/wiki/Clark_Peak_(Medicine_Bow_Mountains)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Clark_Peak_%28Medicine_Bow_Mountains%29_July_2016.jpg","page_title":"Clark Peak (Medicine Bow Mountains)","context_page_description":"Clark Peak is the highest summit of the Medicine Bow Mountains range of the Rocky Mountains of North America. The prominent 12,960-foot peak is located in the Rawah Wilderness of Routt National Forest, 6.3 miles north-northwest of Cameron Pass, Colorado, United States, on the drainage divide between Jackson and Larimer counties. Clark Peak is the highest point of Jackson County and the entire drainage basin of the North Platte River."},{"page_url":"https://es.wikipedia.org/wiki/Elecciones_presidenciales_de_Austria_de_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/NorbertHofer.jpg","page_title":"Elecciones presidenciales de Austria de 2016","context_page_description":"Las elecciones presidenciales de Austria de 2016 se realizaron el 24 de abril de ese año para elegir al sucesor del presidente Heinz Fischer quien no podía aspirar a un tercer mandato.​ La primera vuelta de la elección fue ganada por Norbert Hofer del Partido de la Libertad de Austria. Alexander Van der Bellen, un miembro de Los Verdes pero que en esta elección disputaba como independiente, llegó segundo. Como ninguno de ellos tuvo más del 50% de los votos, compitieron en una segunda vuelta programada para el 22 de mayo. Los candidatos de los dos partidos gobernantes, el Partido Socialdemócrata y el Partido Popular, llegaron en cuarto y quinto puesto respectivamente, detrás de la independiente Irmgard Griss quien fue la tercera más votada.\\nEsta sería la primera vez desde los tiempos de la Segunda Guerra Mundial que un presidente austriaco no es respaldado por ninguno de los dos partidos dominantes.​\\nEl 1 de julio, los resultados de la segunda vuelta de las elecciones fueron anuladas por el Tribunal Constitucional de Austria, lo que obligó a la repetición de la segunda vuelta que fue prevista para el 2 de octubre del mismo año, ​ pero luego se pospuso para el 4 de diciembre.​"},{"page_url":"https://lt.wikipedia.org/wiki/Michailas_Kala%C5%A1nikovas","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Mikhail_Kalashnikov_-_B.jpg","page_title":"Michailas Kalašnikovas","context_page_description":"Michailas Kalašnikovas – rusų ginklų konstruktorius, technikos mokslų daktaras, Generolas leitenantas."},{"page_url":"https://en.wikipedia.org/wiki/First_National_Bank_Center_(San_Diego,_California)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/FirstNationalBankCenter1SanDiegoApr09.jpg","page_title":"First National Bank Center (San Diego, California)","context_page_description":"One Columbia Place, originally named the Columbia Centre, is an office building in San Diego, California. It is the 18th tallest building in San Diego and is a prominent fixture in San Diego's skyline. It is topped by a flagpole flying the largest United States flag in the San Diego skyline.\\nIt has a height of 379 ft and is located in the Core district of Downtown San Diego. It occupies the full block between West A Street, West B Street, Columbia Street and State Street. It has 27 stories above ground and three below ground.\\nThe steel-and-glass building utilizes the modern architectural style and has a six-story atrium. It was built in 1982 by developer Doug Manchester. It was renovated in 1993 and 1997. In 2004 it was designated an Energy Star building."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%88%97%E6%94%AF%E6%95%A6%E5%A3%AB%E7%99%BB%E4%BA%B2%E7%8E%8B%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Josef_Johann_Adam_v_Liechtenstein.jpg","page_title":"列支敦士登亲王列表","context_page_description":"以下是列支敦斯登所有統治者的列表，列支敦斯登的統治者稱為「親王」。列支敦斯登家族的卡爾於1608年被神聖羅馬帝國皇帝封為親王，並成為神聖羅馬帝國諸侯。"},{"page_url":"https://fr.wikipedia.org/wiki/Joinville-le-Pont","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/FF_-_Les_beaux_sites_de_la_Marne_-_JOINVILLE-LE-PONT_-_Panorama_du_Pont.JPG","page_title":"Joinville-le-Pont","context_page_description":"Joinville-le-Pont est une commune française située dans le département du Val-de-Marne en région Île-de-France. La commune est créée en 1790, par démembrement de l’ancienne paroisse de Saint-Maur, sous le nom de La Branche-du-Pont-de-Saint-Maur, avant d'être renommée Joinville-le-Pont en 1831.\\nSes habitants sont appelés les Joinvillais."},{"page_url":"https://da.wikipedia.org/wiki/Tebusk","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Tea_plantation_with_road_and_trees.jpg","page_title":"Tebusk","context_page_description":"Tebusk er den plante, man laver grøn eller sort te af. Tidligere hed planten Thea bohea eller Thea viridis. Den er en stor busk eller et lille træ med en slank, kuplet vækstform.\\nVerdens ældste tetræ skal stå på Simao-egnen i Yunnan. Det regnes for 1.700 år gammelt, det er 20 m højt og har en stammetykkelse på 1 m."},{"page_url":"https://en.wikipedia.org/wiki/17th_Defense_Systems_Evaluation_Squadron","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Martin_RB-57E_55-4253_17th_Defense_Systems_Evaluation_Squadron.jpg","page_title":"17th Defense Systems Evaluation Squadron","context_page_description":"The 17th Defense Systems Evaluation Squadron is an inactive United States Air Force unit. It was last assigned to the 24th Air Division of Aerospace Defense Command at Malmstrom AFB, Montana. It was inactivated on 13 July 1979.\\nThe squadron was first activated during World War II at Wheeler Field, Territory of Hawaii. It provided gunnery training to fighter aircraft of Seventh Air Force until being inactivated in the post war reduction of the United States military.\\nThe squadron was again activated under Air Defense Command at Vincent Air Force Base, Arizona in 1955 as an element of the 4750th Air Defense Wing. It moved with the wing to MacDill AFB, Florida in 1959, where it was inactivated when ADC concentrated its fighter weapons training at Tyndall AFB, Florida."},{"page_url":"https://be.wikipedia.org/wiki/%D0%90%D0%BD%D1%83%D1%80%D0%B0%D0%B4%D1%85%D0%B0%D0%BF%D1%83%D1%80%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Isurumuniya_temple_03.jpg","page_title":"Анурадхапура","context_page_description":"Анурадхапу́ра — горад у Паўночна-Цэнтральнай правінцыі Шры-Ланкі, цэнтр аднайменнай акругі. Насельніцтва - 63208 чал., пераважна сінгалы - 91,42%."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%97%A5%E6%9C%AC%E8%88%AA%E7%A9%BA792%E8%99%9F%E7%8F%AD%E6%A9%9F%E4%BA%8B%E6%95%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/JA8048_DC-8-61_Japan_A-l_HKG_27OCT81_%285580803444%29.jpg","page_title":"日本航空792號班機事故","context_page_description":"日本航空792號班機由上海虹橋機場飛往東京成田機場，一架DC-8-61執行該班機於1982年9月17日在虹橋機場起飛後發生液壓故障，在返航虹橋機場時衝出跑道致使飛機受損，27人受傷但無人死亡。"},{"page_url":"https://gl.wikipedia.org/wiki/Joan_Salvat-Papasseit","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Omega-Joan-Salvat-Papasseit.jpg","page_title":"Joan Salvat-Papasseit","context_page_description":"Joan Salvat-Papasseit, nado en Barcelona o 16 de maio de 1894 e finado na mesma vila o 7 de agosto de 1924, foi un poeta catalán, máximo representante do futurismo na literatura catalá.\\nCoñecido como poeta de vangarda, desenvolveu tamén unha grande actividade como redactor de artigos de crítica social en castelán e catalán, en simpatía coas correntes anarquistas e socialistas da época. O seu estilo enérxico e impulsivo contrasta coa súa vida rutineira e de repouso por mor da súa precaria saúde, de feito morreu de tuberculose con 30 anos.\\nA súa vida mantívose esquecida durante anos, popularizándose a partir da década de 1960 grazas sobre todo aos artistas da Nova Cançó."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Sites_of_Special_Scientific_Interest_in_Suffolk","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Aldeburgh_Hall_Pit_5.jpg","page_title":"List of Sites of Special Scientific Interest in Suffolk","context_page_description":"Suffolk is a county in East Anglia. It is bounded by Norfolk to the north, Cambridgeshire to the west, Essex to the south and the North Sea to the east. With an area of 1,466 square miles, it is the eighth largest county in England, and in mid-2016 the population was 745,000. At the top level of local government is Suffolk County Council, and below it are seven borough and district councils: Babergh, Forest Heath, Ipswich, Mid Suffolk, St Edmundsbury, Suffolk Coastal and Waveney. Much of the coast consists of the estuaries of the Orwell, Stour, Alde, Deben and Blyth rivers, with large areas of wetlands and marshes. Agriculture and shipping play a major role in the county's economy.\\nIn England, Sites of Special Scientific Interest are designated by Natural England, a non-departmental public body which is responsible for protecting England's natural environment. Designation as an SSSI gives legal protection to the most important wildlife and geological sites. As of October 2017 there are 142 SSSIs in Suffolk, of which 109 are biological, 28 geological and 5 are designated under both criteria."},{"page_url":"https://es.wikipedia.org/wiki/Historia_de_la_aviaci%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/PlusUtraPalos.jpg","page_title":"Historia de la aviación","context_page_description":"La historia de la aviación se remonta al día en el que el hombre prehistórico se paró a observar el vuelo de las aves y de otros animales voladores. El deseo de volar está presente en la humanidad desde hace siglos, y a lo largo de la historia del ser humano hay constancia de intentos de volar que han acabado mal. Algunos intentaron volar imitando a los pájaros, usando un par de alas elaboradas con un esqueleto de madera y plumas, que colocaban en los brazos y las balanceaban sin llegar a lograr el resultado esperado.​\\nMuchas personas decían que volar era algo imposible para las capacidades de un ser humano. Pero aun así, el deseo existía y varias civilizaciones contaban historias de personas dotadas de poderes divinos que podían volar. El ejemplo más conocido es la leyenda de Ícaro y Dédalo, que encontrándose prisioneros en la isla de Minos se construyeron unas alas con plumas y cera para poder escapar. Ícaro se aproximó demasiado al Sol y la cera de las alas comenzó a derretirse, haciendo que se precipitara en el mar y muriera.​"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%84%9B%E5%92%8C%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/NRU-OD-N-Aiwo_Hotel.jpg","page_title":"愛和區","context_page_description":"愛和區- 諾魯共和國的一個行政區，位於該島的西部。平均海拔26公尺，最高海拔71米。愛和區是屬於愛和選舉區。"},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%9A%E0%B1%88%E0%B0%A8%E0%B0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Longji_terrace_-_03.JPG","page_title":"చైనా","context_page_description":"ఇతరవాడుకలు రిపబ్లిక్ ఆఫ్ చైనా లేదాతైవాన్\\nచైనా అని సాధారణంగా పిలువబడే చైనా ప్రజల గణతంత్రం తూర్పు ఆసియాలో అతిపెద్ద దేశం, ప్రపంచంలోని అతిపెద్ద దేశాలలో ఒకటి. 130 కోట్ల పైగా జనాభాతో ప్రపంచంలోని అతి పెద్ద జనాభా గల దేశంగా\\nచైనా ఉంది. చైనా రాజధాని నగరం బీజింగ్.అతిపెద్ద నగరం షాంఘై.చైనా ఏక పార్టీ పాలిత దేశం.\\nచైనాలో 22 భూభాగాలు ఉన్నాయి., వీటిలో 5 స్వయం ప్రతిపత్తి కలిగిన భూభాగాలు, నాలుగు డైరెక్ట్ కంట్రోల్డ్ మునిసిపాలిటీలు, రెండు స్వయంపాలిత భూభాగాలు ఉన్నాయి. పి.ఆర్.సిలో ఉన్న ఫ్రీ ఏరియా ఆఫ్ రిపబ్లిక్ ఆఫ్ చైనా భూభాగాలను రిపబ్లిక్ ఆఫ్ చైనా పాలనలో ఉన్నాయి. తైవాన్, కిన్మెన్, మత్సు, ఫ్యూజియన్, దక్షిణాసియా అధీనంలో ఉన్న ద్వీపాలు రాజకీయ స్థితి వివాదాస్పదంగా ఉంది."},{"page_url":"https://en.wikipedia.org/wiki/Andrews-Moore_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/AM_Front.jpg","page_title":"Andrews-Moore House","context_page_description":"The Andrews-Moore House is a historic plantation house located near Bunn, Franklin County, North Carolina."},{"page_url":"https://es.wikipedia.org/wiki/Rocknest_(Marte)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/PIA16232-MarsCuriosityRover-Tray-20121016.jpg","page_title":"Rocknest (Marte)","context_page_description":"Rocknest ​es un valle de arena en la superficie de Aeolis Palus, entre Peace Vallis y Aeolis Mons, en el cráter Gale en el planeta Marte. El parche fue encontrado por el rover Curiosity en el trayecto de Bradbury Landing a Glenelg Intrigue el 28 de septiembre de 2012. Las coordenadas \\"aproximadas\\" del sitio son: 4.59 ° S 137.44 ° E.\\nEl valle de arena está cuesta abajo de un grupo de rocas oscuras. La NASA determinó que el parche era la ubicación para el primer uso de la pala en el brazo del rover Mars Curiosity. El valle \\"Rocknest\\" mide aproximadamente 1,5 m por 5 m.\\nEl 7 de octubre de 2012, un misterioso \\"objeto brillante\\", descubierto en la arena de Rocknest, atrajo el interés científico. Se tomaron varias imágenes de primer plano del objeto y los científicos las interpretaciones preliminares sugieren que el objeto es \\"escombros de la nave espacial\\". No obstante, otras imágenes en la arena cercana han detectado otras \\"partículas brillantes\\". Actualmente se piensa que estos objetos recién descubiertos son \\"material nativo de Marte\\".\\nEl 17 de octubre de 2012 en \\"Rocknest\\", se realizó el primer análisis de difracción de rayos X del suelo marciano."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9F%D0%B0%D0%B1%D1%8F%D0%BD%D0%B8%D1%86%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bd/Pabianice_-_Aflofarm_-_01.jpg","page_title":"Пабянице","context_page_description":"Пабянѝце е град Централна Полша, Лодзко войводство. Административен център е на Пабянишки окръг, както и на селската Пабянишка община, без да е част от нея. Самият град е обособен в самостоятелна градска община с площ 32,99 км²."},{"page_url":"https://it.wikipedia.org/wiki/Mirella_Cristina","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Mirella_Cristina_daticamera_2018.jpg","page_title":"Mirella Cristina","context_page_description":"Mirella Cristina è una politica, avvocato e giornalista italiana."},{"page_url":"https://en.wikipedia.org/wiki/Poecilasthena_pulchraria","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Poecilasthena_pulchraria_1.jpg","page_title":"Poecilasthena pulchraria","context_page_description":"Poecilasthena pulchraria is a moth of the family Geometridae. It is found in Australia and New Zealand. It was first described by Edward Doubleday in 1843 and named Acidalia pulchraria.\\nThe green looping caterpillars feed on the flowers, developing fruits and older foliage of Astroloma species in Australia and on Leucopogon fasciculatus in New Zealand. They are green or brown marked with purplish brown and a broken white or cream lateral line."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B1%D9%86%D9%88_%DA%A9%D9%BE%DA%86%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Renault_Captur_1.5_dCi_Zen_2018_%2845819908642%29.jpg","page_title":"رنو کپچر","context_page_description":"رنو کپچر طراحی کانسپت یا مفهومی کپچر سال ۲۰۱۱ به سرپرستی لارنس ون دن آکر معرفی شد و نهایتاً سال ۲۰۱۳ در ژنو رو نمایی و سپس در آوریل ۲۰۱۳ به فروش رسید در اولین سال فروش خود بعد از جوک و داستر سومین پرفروش اروپا شد و بهترین خودرو در نمایشگاه ۲۰۱۳ در سئول با فروش ۱۰۰۰ دستگاه در کره در مدت ۷ دقیقه خودرو سال ۲۰۱۴ در کره انتخاب شد و در ۴ سال متوالی از سال ۲۰۱۴ تا ۲۰۱۷ پرفروشترین خودرو اروپا در کلاس خود قرار گرفت\\nکپچر به معنای «تسخیر» با حروف لاتین Captur با طول ۴۱۲۲ و عرض ۱۷۷۸ و ارتفاع ۱۵۶۷ و فاصله دو محور ۲۶۰۶ میلی‌متر در وایادولید اسپانیا تولید می‌شود\\nدر روسیه، این خودرو با طول ۴۳۳۳ و عرض ۱۸۱۳ و ارتفاع ۱۶۱۳ و فاصله دو محور ۲۶۷۴ میلی‌متر با همان ظاهر طراحی شده‌است که چهار چرخ متحرک بوده و با موتور و قطعات مکانیکی داستر به عنوان رنو کاپتور با حروف لاتین Kaptur از مارس ۲۰۱۶ تولید می‌شود. از همین مدل در برزیل از آغاز سال ۲۰۱۷ ارائه شده‌است، که به عنوان رنو کاپتور شناخته شده‌است و در نوامبر ۲۰۱۷ به هند نیز معرفی شد.\\nرنو کپچر در خارج از کشور با سه موتور بنزینی ۹۰۰ و ۱۲۰۰ و جدیداً با موتور ۱۳۰۰ سی سی به ترتیب با ۹۰ و ۱۲۰ و ۱۵۰ اسب بخار و با ۱۴۰ و ۲۰۵ و ۲۵۰ نیوتون متر گشتاور و دو مدل دیزلی نیز عرضه می‌شود."},{"page_url":"https://hu.wikipedia.org/wiki/Rudolfsheim-F%C3%BCnfhaus","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Wien_15_Westbahnhof_b.jpg","page_title":"Rudolfsheim-Fünfhaus","context_page_description":"A Rudolfsheim-Fünfhaus Bécs XV. kerülete. Rudolfsheim-Fünfhaus Penzing, Ottakring, Neubau, Mariahilf, Meidling, Hietzing, Ottakring, Neulerchenfeld és Penzing községekkel határos."},{"page_url":"https://de.wikipedia.org/wiki/A_Submarine_Pirate","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/A_Submarine_Pirate_1915.jpg","page_title":"A Submarine Pirate","context_page_description":"A Submarine Pirate ist ein US-amerikanischer Kurzspielfilm von 1915 von Syd Chaplin, der auch die Hauptrolle spielte."},{"page_url":"https://fr.wikipedia.org/wiki/Diplodocus_(chemin_de_fer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Diplodocus_P1070132.jpg","page_title":"Diplodocus (chemin de fer)","context_page_description":"Le Diplodocus, officiellement EPTVF, est une grue ferroviaire de l'armée française, dépendant de l'ancien 5ᵉ régiment de génie de Versailles, spécialisé dans les travaux de voies ferrées. Construit en 1958 et retiré du service en 1980, il pèse 317 tonnes pour 87 mètres de long.\\nLe Diplodocus, avec les quatre wagons l'accompagnant, fait l’objet d’un classement au titre objet des monuments historiques depuis le 8 décembre 2005."},{"page_url":"https://ro.wikipedia.org/wiki/Pusztaszer,_Csongr%C3%A1d","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/96/HUN_Pusztaszer_COA.jpg","page_title":"Pusztaszer, Csongrád","context_page_description":"Pusztaszer este un sat în districtul Kistelek, județul Csongrád, Ungaria, având o populație de 1.521 de locuitori."},{"page_url":"https://es.wikipedia.org/wiki/Pobladura_de_Yuso","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Iglesia_de_Pobladura_de_Yuso.jpg","page_title":"Pobladura de Yuso","context_page_description":"Pobladura de Yuso es una localidad española perteneciente al municipio de Castrocontrigo, en la provincia de León, en la Comunidad Autónoma de Castilla y León. Está situado en la comarca de La Valdería.\\nCuenta con una población de 33 habitantes, de los cuales 17 son varones y 16 son mujeres."},{"page_url":"https://nl.wikipedia.org/wiki/Jacob_van_Deventer_(cartograaf)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Oudenaarde%2C_map_by_Jacob_van_Deventer%2C_Version_Brussels.jpg","page_title":"Jacob van Deventer (cartograaf)","context_page_description":"Jacob van Deventer was een Nederlandse cartograaf."},{"page_url":"https://en.wikipedia.org/wiki/Wilgyth","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/CHOLSEY1.JPG","page_title":"Wilgyth","context_page_description":"Wilgyth of Cholsey was a 6th-century Catholic female saint from Anglo-Saxon England who was venerated locally in Berkshire."},{"page_url":"https://pl.wikipedia.org/wiki/Archiwum_%C5%9Al%C4%85skiej_Kultury_Muzycznej","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Archiwum_%C5%9Al%C4%85skiej_Kultury_Muzycznej_przy_Bibliotece_G%C5%82%C3%B3wnej_Akadmii_Muzycznej_w_Katowicach.jpg","page_title":"Archiwum Śląskiej Kultury Muzycznej","context_page_description":"Archiwum Śląskiej Kultury Muzycznej – archiwum działające przy Bibliotece Głównej Akademii Muzycznej im. Karola Szymanowskiego w Katowicach zajmujące się dokumentacją kultury muzycznej regionu śląskiego.\\nArchiwum Śląskiej Kultury Muzycznej powstało w 1968 roku dzięki inicjatywie Karola Musioła – długoletniego dyrektora Biblioteki Głównej Akademii Muzycznej w Katowicach, który interesował się kulturą muzyczną Śląska w kontekście jego wielokulturowej historii, a w czasie swojej działalności wielokrotnie wydobywał z zapomnienia muzyków urodzonych na Śląsku. Do podstawowych zadań Archiwum zadań należy gromadzenie, opracowywanie i udostępnianie pracownikom nauki i studentom silesiaków w różnych językach - polskim, czeskim i niemieckim: rękopisów i druków muzycznych, piśmiennictwa i dokumentów życia muzycznego w oryginałach lub reprodukcjach oraz nagrań dźwiękowych. Pracownicy zajmują się ponadto upowszechnianiem dawnej i współczesnej muzyki śląskiej, inicjowaniem badań naukowych, organizacją sympozjów i konferencji oraz prowadzą działalność wydawniczą.\\nZ racji swojego położenia większa część jego zbiorów dotyczy działalności muzycznej na Górnym Śląsku."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D9%88_%D8%A6%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Soo-Ae.jpg","page_title":"سو ئه","context_page_description":"پارک سو ئه بازیگر سینما و تلویزیون کره‌جنوبی است که بیشتر به‌خاطر بازی در نقش «بانو جانگ‌هوا» در درام تاریخی امپراتور دریا نامدار گشته‌است."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%9A%E0%AE%BF%E0%AE%B5%E0%AE%B2%E0%AE%BF%E0%AE%99%E0%AF%8D%E0%AE%95%E0%AE%AE%E0%AF%8D_%E0%AE%9A%E0%AE%BF%E0%AE%B5%E0%AE%BE%E0%AE%A9%E0%AE%A8%E0%AF%8D%E0%AE%A4%E0%AE%A9%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Prof.Sivalingam_Sivananthan.jpg","page_title":"சிவலிங்கம் சிவானந்தன்","context_page_description":"பேராசிரியர் சிவலிங்கம் சிவானந்தன் என்பவர் அமெரிக்கத் தமிழரும், கல்விமானும், அறிவியலாளரும், தொழிலதிபரும், சிகாகோ இலினொய் பல்கலைக்கழகத்தின் நுண்ணியற்பியல் ஆய்வுக்கூடத்தின் பணிப்பாளரும் ஆவார்."},{"page_url":"https://sk.wikipedia.org/wiki/Hrdza","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Rust_on_iron.jpg","page_title":"Hrdza","context_page_description":"Hrdza je červenohnedý povlak, ktorý vzniká na povrchu železných predmetov účinkom kyslíka vo vlhkom prostredí. Zložením ide o hydroxid a hydratovaný oxid železitý a železnatý.\\nHrdza je výsledkom procesu hrdzavenia, ktoré je druhom korózie. Na rozdiel od oxidov iných kovov netvorí hrdza súvislú vrstvu a nechráni tak železo pred ďalšou koróziou. Je porézna a postupne opadáva, čím opakovane odhaľuje čerstvý povrch. Proces tak môže pokračovať do hĺbky a dokáže nechránené železné a oceľové predmety aj celé konštrukcie, vystavené vode a vzdušnej vlhkosti úplne zničiť."},{"page_url":"https://en.wikipedia.org/wiki/Hiratsuka","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Hiratsuka_Tanabata_2008_daytime-1.jpg","page_title":"Hiratsuka","context_page_description":"Hiratsuka is a city located in Kanagawa Prefecture, Japan.\\nAs of April 1, 2017, the city has an estimated population of 257,877, with 109,020 households, and a population density of 3,800 persons per km². The total area is 67.88 km²."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%80%D0%B4%D0%BC%D0%BE%D1%80_(%D0%9E%D0%BA%D0%BB%D0%B0%D1%85%D0%BE%D0%BC%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Ardmore_ok5.jpg","page_title":"Ардмор (Оклахома)","context_page_description":"Ардмор — город в округе Картер, штат Оклахома, США. Центр округа и крупнейший город округа.\\nСвоё название город получил по одноимённой станции железной дороги Pennsylvania Main Line, а та в свою очередь названа была по названию ирландской деревни Ардмор."},{"page_url":"https://de.wikipedia.org/wiki/Tunzenberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Landgericht_Dingolfing-Apian_1568_von_Tafeln_11_und_15.jpg","page_title":"Tunzenberg","context_page_description":"Tunzenberg ist eine Gemarkung der Gemeinde Mengkofen im niederbayerischen Landkreis Dingolfing-Landau."},{"page_url":"https://fr.wikipedia.org/wiki/Juana_Romani","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Album_Mariani_%2C_Tome_2%2C_1896._A.jpg","page_title":"Juana Romani","context_page_description":"Ioanna Carolina Carlesi, plus connue sous le nom Juana Romani, née le 30 avril 1867 à Velletri, et morte le 13 juin 1923 à Suresnes, France, est une modèle et une artiste peintre italienne, active en France."},{"page_url":"https://en.wikipedia.org/wiki/Wong_Kar-wai","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Andy_Lau_%28cropped%29.jpg","page_title":"Wong Kar-wai","context_page_description":"Wong Kar-wai BBS is a Hong Kong film director. His films are characterised by nonlinear narratives, atmospheric music, and vivid cinematography involving bold, saturated colours. A pivotal figure of Hong Kong cinema, Wong has had a considerable influence on filmmaking with his trademark personal, unconventional approach. His films frequently appear on best-of lists domestically and internationally.\\nBorn in Shanghai in 1958, Wong moved to Hong Kong with his family when he was five. He began a career as a screenwriter for soap operas before transitioning to directing with his debut, the crime drama As Tears Go By. While As Tears Go By was fairly successful in Hong Kong, Wong moved away from the contemporary trend of crime and action movies to embark on more personal filmmaking styles. Days of Being Wild, his first venture into such direction, did not perform well at the box office. It however received critical acclaim, and won Best Film and Best Director at the 1991 Hong Kong Film Awards. His next film, Ashes of Time, was met with mixed reception because of its vague plot and atypical take on the wuxia genre."},{"page_url":"https://de.wikipedia.org/wiki/Amt_Ketzin","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d9/Ketzin-Havel_in_HVL.png","page_title":"Amt Ketzin","context_page_description":"Das Amt Ketzin war ein 1992 gebildetes Amt in Brandenburg, in dem fünf Gemeinden im damaligen Kreis Nauen zu einem Verwaltungsverbund zusammengefasst waren. Es wurde 2003 im Zuge der Gemeindereform in Brandenburg wieder aufgelöst, die Gemeinden wurden in die Stadt Ketzin eingegliedert. Ende 2002 hatte das Amt Ketzin 6504 Einwohner."},{"page_url":"https://en.wikipedia.org/wiki/Am%C3%A9d%C3%A9e_Lynen","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a1/Amedee_Lynen_La_vie_moderne_les_Sports%2C_vers_1900.jpg","page_title":"Amédée Lynen","context_page_description":"Amédée Ernest Lynen, who often signed his works Am. Lynen, was a Belgian painter, illustrator and writer. In 1880, he was one of the founders of the artistic group L'Essor after it had separated from the academy, and he co-founded its successor Pour l'Art in 1892. In 1895, he founded the \\"Compagnie du Diable-au-corps\\", an artistic association which organised evenings with theatre and poetry, and which existed at least until 1899. It also published a satirical newspaper, Le Diable au Corps. In 1903, two works on paper were bought by the Royal Museums of Fine Arts of Belgium. In 1930, a retrospective of his works was organised by the Cercle Artistique et Littéraire in the Vauxhall, Brussels."},{"page_url":"https://es.wikipedia.org/wiki/Horten","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Horten_Kommune.svg","page_title":"Horten","context_page_description":"Horten es una de las kommune de Noruega. Se sitúa en el interior del Fiordo de Oslo y en él se incluyen las ciudades de Borre, Åsgårdstrand, Skoppum y Nykirke."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AD%D8%B4%D8%B1%D9%87%E2%80%8C%D8%AE%D9%88%D8%A7%D8%B1_%D8%AF%D9%88_%D9%88%DB%8C%D9%86%D8%AA%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/De_Winton%27s_Shrew_area.png","page_title":"حشره‌خوار دو وینتون","context_page_description":"حشره‌خوار دو وینتون نام یک گونه از زیرخانواده حشره‌خوارهای دندان‌سرخ است."},{"page_url":"https://sk.wikipedia.org/wiki/Abdurrahm%C3%A1n_M%C3%B3mand","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Rahman_baba_-_pukhtoogle.jpg","page_title":"Abdurrahmán Mómand","context_page_description":"Abdurrahmán Mómand alebo Rahmán Bábá bol afganský básnik. Pochádzal z kmeňa Mómand a písal po paštsky. V jeho tvorbe dominovali mystické a ľúbostné motívy."},{"page_url":"https://tr.wikipedia.org/wiki/Townshend_Yasalar%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Charles_Townshend%2C_2nd_Viscount_Townshend.jpg","page_title":"Townshend Yasaları","context_page_description":"Townshend Yasaları, İngiliz maliye bakanı Charles Vere Ferrers Townshend tarafından 1767 yılında çıkarılan yasalardır.\\nŞiddetli tepkiler üzerine Damga Yasası'nın yürürlükten kaldırılmasından sonra Charles Townshend, İngilizlerin vergi yükünü azaltmayı amaçlayarak Townshend Yasaları ile önlem aldı. Bu yasada On Üç Koloni'nin ithal ettikleri çay, boya, cam, kumaş vb. mallara vergiler konuldu. Bu vergilerin asıl amacı geliri arttırmak olsa da Townshend politikaları, sömürge hükümetlerini yeniden şekillendirmenin bir yolu olarak gördü.\\nTownshend yasaları, sömürge valilerinin ve hakimlerinin maaşlarını ödemek için vergilerden elde edilen geliri kullanarak Amerikan hükümetinin İngiliz tacına sadakatini sağlamaktır. Bu yasa koloniler tarafından ağır bir mali yük olarak görüldü, Boston Çay Partisi gibi protesto ve boykotlarla tepki gösterdiler. İngiliz hükümeti 1769’da düzeni sağlamak ve işgal için Boston'a 2.000’den fazla İngiliz askeri gönderdi. Kolonilerin oluşturduğu askeri birlik ve İngiliz askerleri arasında fiilen savaş başlamış oldu. İngiliz Kralı III."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Landschaftsschutzgebiete_im_Rhein-Neckar-Kreis","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/LSG_Bergstra%C3%9Fe-Sued_Leimen_Urwald.jpg","page_title":"Liste der Landschaftsschutzgebiete im Rhein-Neckar-Kreis","context_page_description":"Im Rhein-Neckar-Kreis gibt es 39 Landschaftsschutzgebiete. Nach der Schutzgebietsstatistik der Landesanstalt für Umwelt, Messungen und Naturschutz Baden-Württemberg stehen 40.625,59 Hektar der Landkreisfläche unter Landschaftsschutz, das sind 38,26 Prozent."},{"page_url":"https://sl.wikipedia.org/wiki/Friedrich_Wilhelm_Bessel","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Bessel_crater_Apollo_15.jpg","page_title":"Friedrich Wilhelm Bessel","context_page_description":"Friedrich Wilhelm Bessel, nemški astronom in matematik, * 22. julij 1784, Minden, Vestfalija, Prusija, † 17. marec 1846, Königsberg, Prusija."},{"page_url":"https://pt.wikipedia.org/wiki/Guitarra_el%C3%A9trica","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/37/Les_Paul_Traditional.jpg","page_title":"Guitarra elétrica","context_page_description":"A guitarra elétrica é um instrumento musical pertencente à família das cordas, cujo som é sempre amplificado eletronicamente. É um Instrumento de cordas, ou seja, o som é produzido manualmente pela vibração das cordas como na guitarra acústica, porém é transformado em sinal elétrico devido a ação de captadores magnéticos.\\nOs sinais elétricos podem ser simplesmente amplificados e emitidos por um amplificador que converte os sinais elétricos em ondas sonoras, ou pode ser modificado antes de ser novamente convertido em som pelo amplificador\\nPor sua potência sonora e pela possibilidade de alteração eletrônica de diversas características de seu timbre, as guitarras elétricas são utilizadas principalmente no rock, música pop, blues e jazz, podendo ser encontradas ainda em outros gêneros musicais."},{"page_url":"https://pl.wikipedia.org/wiki/Nir_Dawid","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Nirdavid.jpg","page_title":"Nir Dawid","context_page_description":"Nir Dawid – kibuc położony w Samorządzie Regionu Emek ha-Majanot, w Dystrykcie Północnym, w Izraelu."},{"page_url":"https://de.wikipedia.org/wiki/Hermann_Simon_(Mediziner)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7c/Hermann-Simon.jpg","page_title":"Hermann Simon (Mediziner)","context_page_description":"Hermann Simon war ein deutscher Psychiater und Begründer der modernen Arbeitstherapie."},{"page_url":"https://sv.wikipedia.org/wiki/Adesmia_denticulata","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Adesmia_denticulata_Clos._by_pabloendemico_-_001.jpg","page_title":"Adesmia denticulata","context_page_description":"Adesmia denticulata är en ärtväxtart som beskrevs av Dominique Clos. Adesmia denticulata ingår i släktet Adesmia och familjen ärtväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://pt.wikipedia.org/wiki/Altolamprologus_compressiceps","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Altolamprologus_compressiceps_-_Karlsruhe_Zoo_01.jpg","page_title":"Altolamprologus compressiceps","context_page_description":"Altolamprologus compressiceps é uma espécie de peixe da família Cichlidae.\\nPode ser encontrada nos seguintes países: Burundi, República Democrática do Congo, Tanzânia e Zâmbia.\\nOs seus habitats naturais são: lagos de água doce.\\nEstá ameaçada por perda de habitat."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%AE%E0%A8%BE%E0%A8%B0%E0%A8%95_%E0%A8%95%E0%A9%88%E0%A8%B2%E0%A9%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Mark_E._Kelly.jpg","page_title":"ਮਾਰਕ ਕੈਲੀ","context_page_description":"ਮਾਰਕ ਐਡਵਰਡ ਕੈਲੀ ਇੱਕ ਸੇਵਾਮੁਕਤ ਅਮਰੀਕੀ ਪੁਲਾੜ ਯਾਤਰੀ, ਇੰਜੀਨੀਅਰ ਅਤੇ ਰਿਟਾਇਰਡ ਯੂ.ਐਸ. ਨੇਵੀ ਕਪਤਾਨ ਹੈ। ਉਹ ਸਾਬਕਾ ਕਾਂਗਰਸੀ ਔਰਤ ਗੈਬਰੀਐਲ ਗਿਫੋਰਡਸ ਦਾ ਪਤੀ ਹੈ, ਅਤੇ ਉਹ ਇੱਕ ਲੇਖਕ, ਰਾਜਨੀਤਕ ਕਾਰਕੁੰਨ ਅਤੇ ਐਰੋਸਪੇਸ ਕਾਰਜਕਾਰੀ ਅਤੇ ਸਲਾਹਕਾਰ ਹਨ।\\nਇੱਕ ਨੇਵਲ ਐਵੀਏਟਰ, ਕੇਲੀ ਨੇ ਖਾੜੀ ਯੁੱਧ ਦੇ ਦੌਰਾਨ ਮੁਹਿੰਮਾਂ ਦਾ ਸਫ਼ਰ ਤੈਅ ਕੀਤਾ। ਉਹ 1996 ਵਿੱਚ ਨਾਸਾ ਦਾ ਸਪੇਸ ਸ਼ਟਲ ਪਾਇਲਟ ਬਣਨ ਲਈ ਚੁਣਿਆ ਗਿਆ ਸੀ ਅਤੇ 2001 ਵਿੱਚ ਉਸ ਦਾ ਪਹਿਲਾ ਮਿਸ਼ਨ ਐੱਸਟੀਐਸ -108 ਦੇ ਪਾਇਲਟ ਵਜੋਂ ਸੀ। ਉਸਨੇ 2006 ਵਿੱਚ ਐਸਟੀਐਸ -12 ਨੂੰ ਪਾਇਲਟ ਕੀਤਾ ਅਤੇ 2011 ਵਿੱਚ ਐਸਟੀਐਸ -124 ਅਤੇ ਐਸਟੀਐਸ -134 ਨੂੰ ਕਮਾਂਡ ਕੀਤਾ। ਐੱਸਟੀਐੱਸ-134 ਉਨ੍ਹਾਂ ਦਾ ਆਖਰੀ ਮਿਸ਼ਨ ਸੀ ਅਤੇ ਸਪੇਸ ਸ਼ਟਲ ਐਂਡੀਅਵਰ ਦਾ ਆਖਰੀ ਮਿਸ਼ਨ ਸੀ।\\nਉਸ ਦੀ ਪਤਨੀ ਦੀ ਟਕਸਨ, ਅਰੀਜ਼ੋਨਾ ਵਿੱਚ 8 ਜਨਵਰੀ, 2011 ਨੂੰ ਕਤਲ ਕਰਨ ਦੀ ਕੋਸ਼ਿਸ਼ ਕੀਤੀ ਗਈ ਸੀ। ਗੋਲੀਬਾਰੀ ਤੋਂ ਬਾਅਦ ਛੇ ਲੋਕਾਂ ਦੀ ਮੌਤ ਹੋ ਗਈ, ਕੈਲੀ ਅਤੇ ਗੀਫੋਰਡ ਦੋਵੇਂ ਮੀਡੀਆ 'ਚ ਆ ਗਏ ਸਨ। ਉਸ ਦੀ ਪਤਨੀ ਦੀ ਗੋਲੀਬਾਰੀ ਕਾਰਨ ਇੱਕ ਵਿਆਪਕ ਰਾਸ਼ਟਰੀ ਸੰਵਾਦ ਬਣ ਗਿਆ ਜਿਸ ਵਿਚ ਇੱਕ ਪਤੀ ਦੇ ਕਰਤੱਵਾਂ ਤੋਂ ਲੈ ਕੇ ਸਵੀਕਾਰਯੋਗ ਸਿਧਾਂਤ ਪ੍ਰਣਾਲੀ ਹੈ।\\nਕੈਲੀ ਦਾ ਜੁੜਵਾ ਭਰਾ, ਸਕਾਟ ਕੇਲੀ ਵੀ ਇੱਕ ਪੁਲਾੜ-ਯਾਤਰੀ ਹੈ। ਸਪੇਸ ਵਿਚ ਸਫ਼ਰ ਕਰਨ ਵਾਲੇ ਕੈਲੀ ਭਰਾ ਇਕੋ-ਇਕ ਜੁੜਵਾ ਭਰਾ ਹਨ। 2015 ਵਿੱਚ, ਸਕਾਟ ਕੈਲੀ ਨੇ ਇੱਕ ਸਾਲ ਲਈ ਅੰਤਰਰਾਸ਼ਟਰੀ ਸਪੇਸ ਸਟੇਸ਼ਨ ਤੇ ਸਪੇਸ ਵਿੱਚ ਇੱਕ ਮਿਸ਼ਨ ਸ਼ੁਰੂ ਕੀਤਾ। ਉਹ ਸਪੇਸ ਵਿੱਚ 340 ਦਿਨ ਪਿੱਛੋਂ 1 ਮਾਰਚ 2016 ਨੂੰ ਧਰਤੀ 'ਤੇ ਪਰਤਿਆ ਸੀ।"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D1%8E%D0%B8%D1%82%D1%82%D0%BE%D0%BD,_%D0%9B%D1%83%D0%B8_(%D0%B4%D0%B8%D0%B7%D0%B0%D0%B9%D0%BD%D0%B5%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Famille-Vuitton_1888.jpg","page_title":"Вюиттон, Луи (дизайнер)","context_page_description":"Луи Вюитто́н – французский предприниматель и дизайнер, основатель дома моды Louis Vuitton."},{"page_url":"https://en.wikipedia.org/wiki/Tsarevitch_Ivan,_the_Firebird_and_the_Gray_Wolf","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Firebird.jpg","page_title":"Tsarevitch Ivan, the Firebird and the Gray Wolf","context_page_description":"\\"Tsarevich Ivan, the Firebird and the Gray Wolf\\" is a Russian fairy tale collected by Alexander Afanasyev in Russian Fairy Tales.\\nIt is Aarne-Thompson type 550, the quest for the golden bird/firebird. Others of this type include \\"The Golden Bird\\", \\"The Greek Princess and the Young Gardener\\", \\"The Bird 'Grip'\\", \\"How Ian Direach got the Blue Falcon\\", and \\"The Nunda, Eater of People\\"."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B0%D1%86%D1%96%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9_%D1%80%D0%B8%D0%BC%D1%81%D1%8C%D0%BA%D0%BE%D0%B3%D0%BE_%D0%BC%D0%B8%D1%81%D1%82%D0%B5%D1%86%D1%82%D0%B2%D0%B0_(%D0%9C%D0%B5%D1%80%D0%B8%D0%B4%D0%B0,_%D0%86%D1%81%D0%BF%D0%B0%D0%BD%D1%96%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Ceres_of_M%C3%A9rida_%28cropped%29.jpg","page_title":"Національний музей римського мистецтва (Мерида, Іспанія)","context_page_description":"Національний музей римського мистецтва — музей у місті Мерида, Іспанія, присвячений мистецтву Римської імперії на матеріалі розкопок у місті."},{"page_url":"https://en.wikipedia.org/wiki/Kiyomizu-dera","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Kiyomizu-dera%2C_Kyoto%2C_November_2016_-07.jpg","page_title":"Kiyomizu-dera","context_page_description":"Kiyomizu-dera, formally Otowa-san Kiyomizu-dera, is a Buddhist temple in eastern Kyoto. The temple is part of the Historic Monuments of Ancient Kyoto UNESCO World Heritage site.\\nThe place is not to be confused with Kiyomizu-dera in Yasugi, Shimane, which is part of the 33-temple route of the Chūgoku 33 Kannon Pilgrimage through western Japan, or the Kiyomizu-dera temple associated with the Buddhist priest Nichiren.\\nThe temple is currently covered entirely by semi-transparent scaffolding while it is undergoing restoration works in preparation for the 2020 Olympics."},{"page_url":"https://it.wikipedia.org/wiki/Honda_Super_Cub","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Chiba_Prefectural_Police_Honda_Super_Cub_110_JA07.jpg","page_title":"Honda Super Cub","context_page_description":"La Honda Super Cub od Honda Cub è una motocicletta monocilindrica 4 tempi Honda, con cilindrate da 49 a 124 cm³.\\nCostantemente in produzione dal 1958, con più di 60 milioni di esemplari nel 2008, 87 milioni nel 2014, e 100 milioni nel 2017, la Super Cub è il veicolo a motore più prodotto nella storia.\\nLe versioni comprendono C100, C50, C70, C90, C100EX e C70 Passport, oltre alla serie Honda Trail.\\nLa campagna pubblicitaria USA della Super Cub, You meet the nicest people on a Honda, ebbe un duraturo influsso sull'immagine Honda e sull'atteggiamento americano verso il motociclismo, divenendo una pietra miliare del marketing."},{"page_url":"https://nl.wikipedia.org/wiki/Spoorlijn_Keulen_-_Frankfurt","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/Main_08_2006_140.jpg","page_title":"Spoorlijn Keulen - Frankfurt","context_page_description":"De Spoorlijn Keulen - Frankfurt is een Duitse hogesnelheidslijn tussen Keulen en Frankfurt am Main geschikt voor een maximumsnelheid van 300 km/h."},{"page_url":"https://en.wikipedia.org/wiki/Volvox","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Mikrofoto.de-volvox-4.jpg","page_title":"Volvox","context_page_description":"Volvox is a polyphyletic genus of chlorophyte green algae in the family Volvocaceae. It forms spherical colonies of up to 50,000 cells. They live in a variety of freshwater habitats, and were first reported by Antonie van Leeuwenhoek in 1700. Volvox diverged from unicellular ancestors approximately 200 million years ago."},{"page_url":"https://pl.wikipedia.org/wiki/Supertramp","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Supertramp1971.jpg","page_title":"Supertramp","context_page_description":"Supertramp – angielski zespół rockowy prezentujący w swej twórczości elementy progresywnego rocka, hard rocka i soft rocka. Grupa powstała w 1969 roku w Londynie. Formacja nadal nagrywa i koncertuje. Zespół wypracował unikatowe, „eleganckie” brzmienie oparte na rozbudowanym instrumentarium: bardzo czystej i precyzyjnej grze akustycznych i elektrycznych instrumentów klawiszowych w połączeniu z drewnianymi instrumentami dętymi, melodyjnie grającej gitary elektrycznej i męskich śpiewów falsetem.\\nZespół zyskał przychylność krytyków tworząc łatwą w odbiorze odmianę rocka progresywnego, oraz komercyjny sukces tworząc przyjazne radiu utwory i sprzedając ponad 60 milionów płyt na całym świecie. Szczytem ich komercyjnego sukcesu był wydany w 1979 roku album Breakfast in America, który rozszedł się w ponad 20 milionach kopii, co czyni go jednym z najlepiej sprzedających się albumów na świecie."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%B5%D0%BA%D0%BE%D0%BB%D0%BD%D0%B8%D1%86%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/Prekolnitza.09.JPG","page_title":"Преколница","context_page_description":"Преколница — село в Болгарии. Находится в Кюстендилской области, входит в общину Кюстендил. Население составляет 117 человек."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9C%D0%B5%D0%B6%D0%B4%D1%83%D1%89%D0%B0%D1%82%D1%81%D0%BA%D0%B0_%D0%BC%D0%B0%D0%B3%D0%B8%D1%81%D1%82%D1%80%D0%B0%D0%BB%D0%B0_380","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/10/California_Interstate_380_cropped.svg","page_title":"Междущатска магистрала 380","context_page_description":"Междущатска магистрала 380, за кратко 380, е къса магистрала с източно-западна насоченост, дълга 2,70 км, разположена изцяло в Района на Санфранциския залив в щата Калифорния. Свързва магистрала 280 в Сан Бруно с магистрала 101 в близост до Международно летище Сан Франциско в Южен Сан Франциско. Подобно на 280, 380 не е свързана с магистрала 80, въпреки сходното име, макар магистрала 80 да е на 10-на километра северно от нея в близост до Сан Франциско. Магистрала 380 е създадена през 1964 г. Минава над Ел Камино Реал за който има два изхода, по един за всяка от посоките.\\nТази статия, свързана с окръг Сан Матео все още е мъниче. Помогнете на Уикипедия, като я редактирате и разширите."},{"page_url":"https://es.wikipedia.org/wiki/Kungur","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Kungur_asv2019-05_img07_Ice_Cave.jpg","page_title":"Kungur","context_page_description":"Kungur es una ciudad, en krai de Perm, en Rusia. Está situada en las orillas del río Sylva, al pie de los montes Urales a unos 100 kilómetros de la ciudad de Perm y unos 380 kilómetros de la ciudad de Ekaterimburgo. La ciudad atraviesa el ferrocarril más grande del mundo - el Transiberiano.\\nEl nombre de la ciudad se traduce del tártaro antiguo como \\"oscuro\\". Hay otra versión que el nombre proviene del nombre común de diez tribu húngaros \\"unugur\\", aunque los húngaros han abandonado este territorio en el siglo VIII rumbo a río Danubio."},{"page_url":"https://vi.wikipedia.org/wiki/K%C3%ADnh_hi%E1%BB%83n_vi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Digitalmikroskop_4626.jpg","page_title":"Kính hiển vi","context_page_description":"Kính hiển vi là một thiết bị dùng để quan sát các vật thể có kích thước nhỏ bé mà mắt thường không thể quan sát được bằng cách tạo ra các hình ảnh phóng đại của vật thể đó. Kính hiển vi có thể gấp độ phóng đại bình thường lên từ 40 - 3000 lần. Kỹ thuật quan sát và ghi nhận hình ảnh bằng các kính hiển vi được gọi là kỹ thuật hiển vi. Ngày nay, kính hiển vi có thể bao gồm nhiều loại từ các kính hiển vi quang học sử dụng ánh sáng khả kiến, cho đến các kính hiển vi điện tử, hay các kính hiển vi quét đầu dò, hoặc các kính hiển vi phát xạ quang... Kính hiển vi được sử dụng rộng rãi trong nhiều ngành như vật lý, hóa học, sinh học, khoa học vật liệu, y học và được phát triển không chỉ là công cụ quan sát mà còn là một công cụ phân tích mạnh."},{"page_url":"https://en.wikipedia.org/wiki/East_Asian_hip-and-gable_roof","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/59/Padmanabhapuram_Palace%2C_roof_works.jpg","page_title":"East Asian hip-and-gable roof","context_page_description":"The East Asian hip-and-gable roof consists of a hip roof that slopes down on all four sides and integrates a gable on two opposing sides. It is usually constructed with two large sloping roof sections in the front and back respectively, while each of the two sides is usually constructed with a smaller roof section.\\nThe style is thought to be Chinese in origin, and has spread across much of Asia. The original style and similar styles are found in the traditional architectures of India, Japan, Korea, Vietnam, Mongolia, Tibet, Nepal, Sri Lanka and Kalmykia. It also influenced the style of the bahay na bato of the Philippines."},{"page_url":"https://tr.wikipedia.org/wiki/%C4%B0dris_Jetu","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Driss_Jettou.jpg","page_title":"İdris Jetu","context_page_description":"İdris Jetu Fas eski başbakanı.\\nFizik-Kimya eğitimi görmüştür. 1993-1997 yılları arasında Sanayi ve Ticaret Bakanı, 1997-1998 yılları arasında Maliye, Sanayi, Ticaret ve Zanaat Bakanı, 2001-2002 yıllarında İçişleri Bakanı olarak görev yapmıştır. 7 Kasım 2002 - 15 Ekim 2007 tarihleri arasında ise Başbakan olmuştur. 9 Ağustos 2012 tarihi itibarıyla Sayıştay Birinci Başkanıdır."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D8%B1%D8%AC%D9%85%D8%A9_%D8%A7%D9%84%D8%AD%D9%88%D8%A7%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Subtitle-Example.svg","page_title":"ترجمة الحوار","context_page_description":"السطرجة [نحت كلمتي: سَطْرُ تَرْجَمَةٍ] ‏ أو الترجمة السمعية المرئية، هي نص مستمد من نسخة أو سيناريو لحوار أو تعليق في الأفلام والبرامج التلفزيونية وألعاب الفيديو وما إلى ذلك. عادةً ما تُعرض السطرجة في أسفل الشاشة، وقد تُعرض في أعلى الشاشة في حال وجود نص آخر معروض في أسفل الشاشة. قد تكون السطرجة شكلًا من أشكال الترجمة المكتوبة لحوار ما بلغة أجنبية، أو ترجمة مكتوبة لحوار ما بنفس اللغة، وقد تتضمن معلومات إضافية لمساعدة المشاهدين الصم أو الذين يعانون من صعوبة في السمع أو الذين لا يمكنهم فهم اللغة المنطوقة أو الذين لا يستطيعون فهم اللكنة في الحوار.\\nيُمكن دمج الطريقة المرمزة مع الفيديو مسبقًا أو فصلها عنه على شكل رسومات أو نص، بحيث يصبح من الممكن دمجهم وتركيبهم بواسطة المستقبِل. تُستخدم الترجمات السمعية المرئية المنفصلة في السطرجة لنسخ الدي في دي والبلو راي ونصوص المعلومات على التلفزيون/ بث الفيديو الرقمي، أو العرض النصي إي. آي. إيه-608 التي تبقى مخفية ما لم يطلبها المشاهد من قائمة التحكم أو جهاز التحكم عن بعد عن طريق اختيار الصفحة أو الخدمة ذات الصلة، إذ تحمل دومًا تمثيلات صوتية إضافية للمشاهدين الصم والذين يعانون من صعوبة في السمع."},{"page_url":"https://ca.wikipedia.org/wiki/Creu_de_terme_de_Montcort%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Creu_de_Montcort%C3%A8s_de_Segarra_%28cropped%29.jpeg","page_title":"Creu de terme de Montcortès","context_page_description":"La Creu de terme de Montcortès és una creu de terme de Montcortès, al municipi dels Plans de Sió, inclosa a l'Inventari del Patrimoni Arquitectònic de Catalunya."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%B3%A2%E6%96%AF%E5%B0%BC%E4%BA%9A%E5%92%8C%E9%BB%91%E5%A1%9E%E5%93%A5%E7%BB%B4%E9%82%A3%E5%AE%97%E6%95%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Ukrajinska_grkokatoli%C4%8Dka_crkva_Hrista_Carja.jpg","page_title":"波斯尼亚和黑塞哥维那宗教","context_page_description":"波斯尼亚和黑塞哥维那的宪法提供宗教自由，波赫政府普遍尊重这宗教信仰自由权利，在各民族聚集或所在的地区的宗教；地方法律也提供宗教团体全面的权利，54％的波赫穆斯林认为自己是“无宗派穆斯林”。\\n在2009年的盖洛普民意调查中，77％的波斯尼亚和黑塞哥维那受访者对“宗教是否是您日常生活中重要的一部分？”这一问题回答“是”，而21％的回答是否定的。\\n根据2017年皮尤研究中心的一项民意调查，31％的波赫穆斯林，10％的正教会基督徒和54％的天主教基督徒每周至少参加一次宗教仪式。"},{"page_url":"https://de.wikipedia.org/wiki/Dechtow","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/OPR_Dechtow_Gutshaus.jpg","page_title":"Dechtow","context_page_description":"Dechtow ist ein Ortsteil der Gemeinde Fehrbellin im Landkreis Ostprignitz-Ruppin in Brandenburg.\\nDas Dorf ist geprägt durch das Gut, seine Bauernhöfe, die Feldsteinkirche aus dem 15. Jahrhundert und Lindenalleen mit Kopfsteinpflaster. Es liegt im flachen Land zwischen Sand und Moor und ist ein Zuhause für 300 Menschen.\\nDurch den Ort führt die Landesstraße L 173; einen Kilometer nordöstlich verläuft die A 24."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%9A%D3%A9%D1%80%D1%88%D3%99%D0%BA_%D1%8F%D2%BB%D0%B0%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Ukrainian_pitcher_01.jpg","page_title":"Көршәк яһау","context_page_description":"Көршәк яһау — барлыҡҡа килгән осоронан балсыҡты утта яндырып, аш-һыу әҙерләү, ашау һәм шыйыҡ йә бөртөклө матдәләрҙе һаҡлау өсөн тәғәйенләнгән һауыттарҙы яһау һөнәре булған;. Хәҙерге ваҡытта көршәк эшләү сәнғәте — ҡалыплау ысулы менән көршәк түңәрәк әйләнешендә ялтырауыҡ иретмә һылатып һәм артабан балсыҡты көйҙөрөп эшкәртеү, уларҙы өйҙә ҡуллана торған әйберҙәргә, төҙөлөш материалдарына, төрлө декоратив тауарҙарына, сувенирҙарға, биҙәүестәргә, бер һүҙ менән атағанда — керамикаға әйләндереү.\\nКөршәк яһау технологияһы был йүнәлештәге етештереүҙең өс төп төрөн үҙ эсенә ала:\\nтөҙөлөш кирбесен етештереү;\\nтөрлө ябай биҙәүестәр һәм завод ихтыяжы өсөн кәрәкле булған нәмәләр"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B0%D1%80%D0%B4%D0%B0%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/03/Ghardaia_01.jpg","page_title":"Гардая","context_page_description":"Гарда́я — город на севере центральной части Алжира, административный центр одноимённых вилайета и округа. Население — 120 000 чел."},{"page_url":"https://en.wikipedia.org/wiki/List_of_castles_in_Greece","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Kastro.jpg","page_title":"List of castles in Greece","context_page_description":"This is a list of castles in Greece."},{"page_url":"https://es.wikipedia.org/wiki/Cant%C3%B3n_Eloy_Alfaro","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Esmeraldas_-_Eloy_Alfaro.png","page_title":"Cantón Eloy Alfaro","context_page_description":"El cantón Eloy Alfaro está ubicado al norte de la Provincia de Esmeraldas, en Ecuador. Su cabecera cantonal es la ciudad de Valdéz más conocida como Limones.\\nLas principales poblaciones son Borbón, Maldonado, Selva Alegre, Playa de Oro, Atahualpa, Zapallo Grande, San Francisco del Onzole, Santo Domingo del Onzole y Santa Lucía de Las Peñas. Estas poblaciones están distribuidas a lo largo de la cuenca del Río Santiago, donde confluyen además el Río Cayapas y el Río Onzole."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%91%A8%E6%96%B0%E7%A5%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/%E6%9D%AD%E5%B7%9E%E5%91%A8%E6%96%B0%E7%A5%A0_-_12.jpg","page_title":"周新祠","context_page_description":"周新祠，又名城隍廟，位於中國浙江省杭州市上城區吳山城隍閣景區內，為南宋紹興九年遷移而來，明代開始祭祀冤死任上的浙江按察使周新。現廟宇為修築城隍閣景區時重建。"},{"page_url":"https://fr.wikipedia.org/wiki/Bois_flott%C3%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ef/Driftwood_NZ.jpg","page_title":"Bois flotté","context_page_description":"Le bois flotté est du bois qui a été drossé sur la côte par l'action du vent, des courants ou des marées. L'appellation « bois flotté » implique un séjour de nombreux jours, semaines, mois ou années dans une étendue d'eau."},{"page_url":"https://gl.wikipedia.org/wiki/Nata_batida","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Bocaditos_de_crema-Pasteles.jpg","page_title":"Nata batida","context_page_description":"A nata batida ou crema batida é unha crema de leite que se bate enerxicamente até adquirir unha consistencia semisólida ou á que se lle engade ar ou gases inocuos. Diferénciase da crema chantillí en que esta sempre leva azucre e acostuma ir aromatizada, mentres que a nata batida non ten porque ser adozada. Contodo moitos autores considéranas sinónimos.\\nSe a nata ten un 30% ou máis de graxa pode ser mesturada con ar, de xeito que as burbullas de ar son capturadas nunha rede de pinguiñas de graxa e o coloide resultante adquire aproximadamente o dobre de volume da nata orixinal; porén, se o proceso de batido continúa as pingas de graxa péganse entre si destruíndo o coloide e formando manteiga e o líquido restante é soro de manteiga. Ás veces engádeselle azucre glas ao coloide, co fin de endurecer a mestura e reducir o risco de exceso de batido."},{"page_url":"https://xmf.wikipedia.org/wiki/%E1%83%90%E1%83%9A%E1%83%9B%E1%83%90%E1%83%AE%E1%83%90%E1%83%9C%E1%83%A3%E1%83%A0%E1%83%98_%E1%83%9B%E1%83%9D%E1%83%A1%E1%83%9D%E1%83%A4%E1%83%94%E1%83%9A%E1%83%98%E1%83%A8_%E1%83%A8%E1%83%99%E1%83%95%E1%83%98%E1%83%97%E1%83%98_%E1%83%A1%E1%83%90%E1%83%9B%E1%83%90%E1%83%9C%E1%83%AA%E1%83%90%E1%83%A0%E1%83%9D%E1%83%91%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/GreatWallNearBeijingWinter.jpg","page_title":"ალმახანური მოსოფელიშ შკვითი სამანცარობა","context_page_description":"ალმახანური მოსოფელიშ შკვითი სამანცარობა — პროექტი, ნამუშ ფარგალეფს 2007 წანაშ 7 კვირკვეს ჯოხოგიადჷ ”ახალი” მოსოფელიშ შკვითი სამანცარობა. ორგანიზაფილი ვასათარობო ორგანიზაციაშით New Open World Corporation."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_vierduizenders_in_de_Alpen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Weisshorn.jpg","page_title":"Lijst van vierduizenders in de Alpen","context_page_description":"Officiële lijst van de 82 bergen in de Alpen, meer dan 4000 m hoog, samengesteld door de Union Internationale des Associations d'Alpinisme UIAA."},{"page_url":"https://nl.wikipedia.org/wiki/Ampul_(mis)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/2006.10_Vinajeras.jpg","page_title":"Ampul (mis)","context_page_description":"Een ampul of buret is een glazen of metalen schenkkannetje dat tijdens de katholieke Mis wordt gebruikt om water en wijn in de miskelk te gieten. Ampullen komen steeds per paar voor.\\nZe zijn dikwijls van zilver en zijn veelal sluitbaar met een kapje. Vooral de barokke exemplaren vallen op door hun rijke versiering. Vaak is de ampul voor de wijn versierd met druivenranken, de ampul voor het water met golfjes, vissen of schelpen. De ampul die voor het water bestemd is, is ook vaak te herkennen aan de letter A en deze voor de wijn draagt dan de letter V. Bij de ampullen hoort doorgaans een zilveren lavaboblad, soms met noppen waarop de ampullen precies passen en dat in de H. Mis bij de handenwassing wordt gebruikt.\\nDe ampul met het water wordt in de Mis een derde maal gebruikt bij de ablutie.\\nIn de neogotiek kwamen glazen modellen in verguld koperen monturen in de mode. Door de breekbaarheid van dit materiaal is dit type ampul tegenwoordig zeldzaam en kostbaar."},{"page_url":"https://de.wikipedia.org/wiki/Alcatel","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Logo_office_Alcatel.jpg","page_title":"Alcatel","context_page_description":"Alcatel war ein französischer Hersteller von Systemen und Geräten für die Telekommunikation sowie nach eigenen Angaben Marktführer beim Hochgeschwindigkeitszugang zum Internet und bei optischen Netzen. Die Kunden von Alcatel waren Netzbetreiber, Internet Service Provider, Unternehmen und Privatkunden. Am 1. Dezember 2006 fusionierte Alcatel mit Lucent Technologies zu Alcatel-Lucent.\\nAls Markenname wird Alcatel auch heute noch für zahlreiche Produkte verwendet. Teilweise durch Alcatel-Lucent, teilweise aber auch durch Rechtsnachfolger oder Käufer ehemaliger Geschäftsbereiche. So steht hinter der Marke Alcatel One Touch, unter der weltweit Handys und Tabletcomputer vertrieben werden, seit 2005 der chinesische Hersteller TCL."},{"page_url":"https://nl.wikipedia.org/wiki/Conservenblik","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Boutappertcolljpb.jpg","page_title":"Conservenblik","context_page_description":"Een conservenblik is een gesloten cilindervormige of doosvormige metalen verpakking waarin voedsel zit. Doordat er geen lucht bij kan, blijft het voedsel na sterilisatie bij hoge temperatuur, lang houdbaar."},{"page_url":"https://en.wikipedia.org/wiki/Khandadhar_Falls,_Kendujhar","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Khandadhar_fall.jpg","page_title":"Khandadhar Falls, Kendujhar","context_page_description":"Khandadhar Falls is located in Kendujhar district in the Indian state of Odisha.\\nIt is a 500 ft high waterfall in the midst of a dense forest. It has a \\"smoke like\\" appearance created by the spraying of water as it cascades down the rock face."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%B0%D0%BD%D0%BD%D0%B0_(%D0%9E%D0%BA%D0%BB%D0%B0%D1%85%D0%BE%D0%BC%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Oil_pump_Hanna_Oklahoma_10-3-2006.jpg","page_title":"Ганна (Оклахома)","context_page_description":"Ганна — місто в США, в окрузі Макінтош штату Оклахома. Населення — 138 осіб."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%9E%9C%EB%93%9C%EB%A1%9C%EB%B2%84_%EB%A0%88%EC%9D%B8%EC%A7%80_%EB%A1%9C%EB%B2%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Range_Rover_front_20080331.jpg","page_title":"랜드로버 레인지 로버","context_page_description":"랜드로버 레인지 로버는 영국 랜드로버에서 제작한 럭셔리 대형 스포츠 유틸리티 자동차이다."},{"page_url":"https://en.wikipedia.org/wiki/Maassluis","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Maassluis_061.JPG","page_title":"Maassluis","context_page_description":"Maassluis is a city in the western Netherlands, in the province of South Holland. The municipality had a population of 32,768 in 2019 and covers 10.12 km² of which 1.63 km² water.\\nIt received city rights in 1811."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%9E%BA%E6%97%8B%E6%98%9F%E7%B3%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Spiral_structure_for_web.jpg","page_title":"螺旋星系","context_page_description":"螺旋星系是星系的類型之一，但哈伯在1936年最初的描述是星雲的領域，並且列在哈伯序列，成為其中的一部分。多數的螺旋星系包含恆星的平坦、旋轉盤面，氣體和塵埃，和中央聚集高濃度恆星，稱為核球的核心。這些通常被許多恆星構成的黯淡暈包圍著，其中許多恆星聚集在球狀星團內。\\n螺旋星系是以它們從核心延伸到星盤的螺旋結構命名。螺旋臂是恆星正在形成的區域，並且因為是年輕、炙熱的OB星居住的區域，所以比周圍明亮。\\n大約三分之二的螺旋星系都有附加的，形狀像是棒子的結構，從中心的核球突出，並且螺旋臂從棒的末端開始延伸。棒旋星系相較於無棒的表兄弟的比率可能在宇宙的歷史中改變，80億年前大約只有10%有棒狀構造，25億年前大約是四分之一，直到目前在可觀測宇宙已經超過三分之二有棒狀構造。\\n在1970年代，雖然很難從地球在銀河系中的位置很難觀察到棒狀結構，但我們的銀河系已經被證實為棒旋星系 。在銀河中心的恆星形成棒狀結構，最令人信服的證據來自最近的幾個調查，包括史匹哲太空望遠鏡。\\n包含不規則星系在內，現今宇宙中的星系有大約60%是螺旋星系。 它們大多是在低密度區域被發現，在星系團的中心則很罕見。"},{"page_url":"https://en.wikipedia.org/wiki/Malacosoma_incurva","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Malacosoma_incurvum_adult.jpg","page_title":"Malacosoma incurva","context_page_description":"Malacosoma incurva, the southwestern tent caterpillar moth, is a species of moth of the family Lasiocampidae. It was first described by Henry Edwards in 1882. It is found in south-western North America, including Arizona, New Mexico, Nevada and Utah.\\nThe wingspan is about 27 mm.\\nThe larvae feed on Populus fremontii, Salix and Prunus species."},{"page_url":"https://nl.wikipedia.org/wiki/Uranometria","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Bayer-1661-Cassiopeia.jpg","page_title":"Uranometria","context_page_description":"De Uranometria is een door de Duitse astronoom Johannes Bayer in 1603 vervaardigde atlas van de sterrenhemel. De volledige titel luidt \\"Uranometria: omnium asterismorum continens schemata, nova methodo delineata, aereis laminis expressa\\". Het was de eerste atlas die de gehele hemelbol in kaart bracht.\\nDe Uranometria bestaat uit 51 op koperplaten gegraveerde kaarten. De eerste 48 kaarten beelden de 48 \\"klassieke\\" sterrenbeelden, die door Ptolemaeus werden geïntroduceerd, af. Vervolgens is er een kaart die 12 sterenbeelden uit de zuidelijke hemelhalfrond afbeelden en 2 kaarten die de noordelijke en zuidelijke sterrenhemel in de vorm van een planisfeer laten zien.\\nDe Uranometria bevat de nauwkeurige posities van meer dan 1.200 sterren, grotendeels gebaseerd op de stercatalogus van de Deense astronoom Tycho Brahe en de Nederlandse zeevaarder Pieter Keyser. Het geheel is verfraaid met figuren die de sterrenbeelden als geheel weergeven. In de Uranometria introduceerde Bayer de nu nog steeds in gebruik zijnde methode om aan de helderste sterren van elk sterrenbeeld een griekse letter toe te kennen, bijvoorbeeld α Orionis voor Betelgeuze en β Orionis voor Rigel."},{"page_url":"https://cy.wikipedia.org/wiki/Thelma_Hulbert","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Artist_Eva_Cederstr%C3%B6m.jpg","page_title":"Thelma Hulbert","context_page_description":"Arlunydd benywaidd o'r Deyrnas Unedig oedd Thelma Hulbert.\\nGaned Tirzah Garwood yn y Deyrnas Unedig yn 1908.\\nBu'n briod i Eric Ravilious"},{"page_url":"https://fr.wikipedia.org/wiki/Matt_Dawson","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Matt_Dawson_UNICEF_cropped.jpg","page_title":"Matt Dawson","context_page_description":"Matthew James Sutherland Dawson, né le 31 octobre 1972 à Birkenhead, est un joueur de rugby à XV international anglais évoluant au poste de demi de mêlée. Il évolue douze saisons avec les Northampton Saints avant de rejoindre les London Wasps en 2004."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B0%8F%E5%9B%BD%E7%A5%9E%E7%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Okuni-jinja_%28Mori%29%2C_Hokotori-sha.jpg","page_title":"小国神社","context_page_description":"小國神社は、静岡県周智郡森町一宮にある神社。式内社、遠江国一宮。旧社格は国幣小社で、現在は神社本庁の別表神社。神紋は「右三つ巴」。\\n本宮山の南側の山麓に鎮座する。社名の「小国」は、出雲の「大国」に対する遠江の美称とする。境内は秋には紅葉の名所として有名である。"},{"page_url":"https://da.wikipedia.org/wiki/Davids_Kirke","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Davidskirken_Copenhagen_ship.jpg","page_title":"Davids Kirke","context_page_description":"Davids Kirke ligger i Koldinggade på Østerbro i Københavns Kommune."},{"page_url":"https://en.wikipedia.org/wiki/St_Mary%27s_Church,_Eccleston","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/St_Mary%27s_Church_Eccleston%2C_Old_Churchyard_-_old_Grovenor_family_gravesite1.JPG","page_title":"St Mary's Church, Eccleston","context_page_description":"St Mary's Church is in the village of Eccleston, Cheshire, England, on the estate of the Duke of Westminster south of Chester. The church is recorded in the National Heritage List for England as a designated Grade I listed building. It is an active Anglican parish church in the diocese of Chester, the archdeaconry of Chester and the deanery of Chester. Its benefice is combined with that of St Mary, Pulford. The Dukes of Westminster are buried in the adjacent Old Churchyard."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%86%D5%A1%D5%BF%D6%80%D5%AB%D5%B8%D6%82%D5%B4%D5%AB_%D5%A1%D5%BD%D5%AF%D5%B8%D6%80%D5%A2%D5%A1%D5%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Sodium_ascorbate.png","page_title":"Նատրիումի ասկորբատ","context_page_description":"Նատրիումի ասկորբատ, ասկորբինաթթվի նատրիումական աղ: Իրենից ներկայացնում է պինդ բյուրեղային սպիտակ կամ դեղնավուն, անհոտ փոշի: Բնության մեջ հանդիպում է ցիտրուսային մրգերում և շատ բանջարեղեններում l- էնանտիոմերների տեսքով: Կիրառություն ունի օծանելիքի և սննդի արտադրության մեջ, որպես՝ հակաօքսիդանտ, քանի որ ջրային լուծույթում արագորեն փոխազդում է մթնոլորտի թթվածնի և այլ օքսիդանտների հետ: Օգտագործվում է նաև որպես գույնի կայունացուցիչ և հանդիսանում է վիտամին C-ի աղբյուր:"},{"page_url":"https://fr.wikipedia.org/wiki/Nouvelle_D%C3%A9tente","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Reagan_and_Gorbachev_signing.jpg","page_title":"Nouvelle Détente","context_page_description":"La Nouvelle Détente est la période de la Guerre froide marquée par l'arrivée de Mikhaïl Gorbatchev à la tête du Parti communiste de l'Union soviétique en 1985, ce qui change radicalement les relations internationales notamment pour l’armement nucléaire. Cette nouvelle période de détente, qui succède à celle dite de la Guerre fraîche, a permis la résolution de plusieurs conflits, ce qui conduit à l'apogée de l'ONU.\\nInattendue, la nouvelle politique de Mikhaïl Gorbatchev conduit à l'éclatement de l'URSS et du Bloc communiste. Un souffle nouveau de démocratie gagne la majorité du tiers monde, les régimes communistes sont tombés : c'est la fin de la guerre froide."},{"page_url":"https://fr.wikipedia.org/wiki/Emilia_Hazelip","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Emilia_PC.jpg","page_title":"Emilia Hazelip","context_page_description":"Emilia Hazelip était une agronome et naturaliste espagnole pionnière de la permaculture en France."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%98%C3%A1d_v%C4%9Brnosti_vlasti","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Ordinul_%E2%80%9ECredin%C8%9B%C4%83_Patriei%E2%80%9D.jpg","page_title":"Řád věrnosti vlasti","context_page_description":"Řád věrnosti vlasti je státní vyznamenání Moldavské republiky. V hierarchii moldavských řádů se nachází na poslední místě."},{"page_url":"https://da.wikipedia.org/wiki/Yangjiang","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/ChinaGuangdongYangjiang.png","page_title":"Yangjiang","context_page_description":"Yangjiang er en by på præfekturniveau i den vestlige del af provinsen Guangdong ved Kinas kyst til det Sydkinesiske Hav. Befolkningen anslås til 2.628.000 indbyggere, og har et areal på 7.813,4 km². Den grænser mod vest til Maoming, mod nord til Yunfu, og i øst til Jiangmen."},{"page_url":"https://pl.wikipedia.org/wiki/Zbrojownik","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Malarmao2.JPG","page_title":"Zbrojownik","context_page_description":"Zbrojownik, okuwka – słabo poznany gatunek morskiej ryby skorpenokształtnej z rodziny Peristediidae. Został opisany przez Linneusza w Systema Naturae w 1758 pod nazwą Trigla cataphracta. Wcześniej zaliczany był do rodziny kurkowatych. Nie ma większego znaczenia gospodarczego."},{"page_url":"https://en.wikipedia.org/wiki/Shishman_Peak","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Shishman.jpg","page_title":"Shishman Peak","context_page_description":"Shishman Peak rises to over 800 m in the east extremity of Levski Ridge, Tangra Mountains, eastern Livingston Island in the South Shetland Islands, Antarctica. The peak overlooks Iskar Glacier and Bruix Cove to the north-northeast and Magura Glacier to the south. The peak is named after Czar Ivan Shishman of Bulgaria, 1371-1395 AD."},{"page_url":"https://ceb.wikipedia.org/wiki/Mullsj%C3%B6_(kapital_sa_munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Mullsj%C3%B6%2C_den_20_maj_2007%2C_bild_1.JPG","page_title":"Mullsjö (kapital sa munisipyo)","context_page_description":"Kapital sa munisipyo ang Mullsjö sa Sweden. Nahimutang ni sa munisipyo sa Mullsjö kommun ug lalawigan sa Jönköpings län, sa habagatang bahin sa nasod, 290 km sa habagatan-kasadpan sa Estokolmo ang ulohan sa nasod. 256 metros ibabaw sa dagat kahaboga ang nahimutangan sa Mullsjö, ug adunay 5,506 ka molupyo.\\nAng yuta palibot sa Mullsjö kay patag. Dunay mga 40 ka tawo kada kilometro kwadrado sa palibot sa Mullsjö medyo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Bankeryd, 15.8 km sa sidlakan sa Mullsjö. Hapit nalukop sa lasang nga sagolsagol ang palibot sa Mullsjö. Sa rehiyon palibot sa Mullsjö, mga lanaw talagsaon komon.\\nAng klima hemiboreal. Ang kasarangang giiniton 4 °C. Ang kinainitan nga bulan Hulyo, sa 15 °C, ug ang kinabugnawan Enero, sa -8 °C."},{"page_url":"https://sv.wikipedia.org/wiki/Sedum_torulosum","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Sedum_torulosum_1.jpg","page_title":"Sedum torulosum","context_page_description":"Sedum torulosum är en fetbladsväxtart som beskrevs av Robert Theodore Clausen. Sedum torulosum ingår i Fetknoppssläktet som ingår i familjen fetbladsväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://id.wikipedia.org/wiki/Plocaederus","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Plocaederus_bipartitus_MHNT_femelle.jpg","page_title":"Plocaederus","context_page_description":"Plocaederus adalah genus kumbang tanduk panjang yang tergolong famili Cerambycidae. Genus ini juga merupakan bagian dari ordo Coleoptera, kelas Insecta, filum Arthropoda, dan kingdom Animalia.\\nLarva kumbang dalam genus ini biasanya mengebor ke dalam kayu dan dapat menyebabkan kerusakan pada batang kayu hidup atau kayu yang telah ditebang."},{"page_url":"https://sl.wikipedia.org/wiki/Gove%C4%91ari","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/Gove%C4%91ari1.JPG","page_title":"Goveđari","context_page_description":"Goveđari so naselje na severozahodu otoka Mljeta, ki upravno spada pod občino Mljet; le-ta pa spada pod Dubrovniško-neretvansko županijo."},{"page_url":"https://nl.wikipedia.org/wiki/Suriname","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Rosebel_mining_4_big.jpg","page_title":"Suriname","context_page_description":"Suriname, officieel de Republiek Suriname, is een republiek aan de noordkust van Zuid-Amerika met als hoofdstad Paramaribo. Het land was van 1667 tot 1954 een kolonie van Nederland en daarna een land binnen het Koninkrijksverband. Op 25 november 1975 werd Suriname onafhankelijk. De Surinaamse bevolking bestaat uit meerdere etnische groepen waarvan er geen een absolute meerderheid vormt. De voertaal en officiële taal is het Nederlands, terwijl ook het Surinaams, oftewel Sranan, belangrijk is. Verder zijn er een aantal lokale en inheemse talen in gebruik.\\nDe republiek heeft een oppervlakte van 163.820 km², een kustlijn van 386 km en grenst aan Brazilië, Guyana en Frans-Guyana. Het heeft zowel met Guyana als met Frans-Guyana een grensgeschil. Het landschap bestaat uit moerassen en heuvellandschappen met in het zuiden en midden verschillende bergketens. Het land is grotendeels bedekt met tropisch regenwoud en wordt doorsneden door een aantal rivieren die van het zuiden naar het noorden lopen, zoals onder andere de rivier de Suriname."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%B3%D0%B0%D1%8F%D0%BD_(%D1%80%D0%B5%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Pinacanauan_River_%28Penablanca%2C_Cagayan%29.jpg","page_title":"Кагаян (река)","context_page_description":"Кагаян — самая длинная и широкая река Филиппинского архипелага. Она протекает по северо-восточной части острова Лусон, пересекая территорию провинций Исабела, Кагаян, Кирино и Нуэва-Виская. Длина реки составляет около 505 км."},{"page_url":"https://de.wikipedia.org/wiki/Kensington_(London)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Kensington_Buildings.JPG","page_title":"Kensington (London)","context_page_description":"Kensington ist ein Stadtteil im Westen Londons, der zum Stadtbezirk Kensington and Chelsea gehört. Direkt am westlichen Rand des Hyde Parks gelegen, bietet der Stadtteil mit seiner überwiegend viktorianischen Bebauung das gepflegte Bild eines aristokratischen, als „königlich“ geltenden Viertels. Es sind aber auch einige bodenständige Cafés, Pubs und Bars zu finden.\\nBerühmt ist der Stadtteil durch die direkte Nachbarschaft des Kensington Palace und aufgrund der sehr hohen Immobilienpreise einiger prominenter Luxusobjekte am Rande der Kensington Gardens und des Hyde Parks sowie durch Albertopolis, ein Museenviertel, in dem auch die Royal Albert Hall liegt.\\nIm Westen Kensingtons gibt es im Umfeld der mehrspurigen Hauptverkehrsstraße Westway einige Sozialbauten, darunter den durch ein Feuer im Juni 2017 bekannt gewordenen Grenfell Tower."},{"page_url":"https://de.wikipedia.org/wiki/Stadtmuseum_Amberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Amberg_-_Stadtmuseum_und_Arch%C3%A4ologisches_Museum_der_Oberpfalz.jpg","page_title":"Stadtmuseum Amberg","context_page_description":"Das Stadtmuseum Amberg ist das städtische Museum der Stadt Amberg. Seit 1989 ist es im „Baustadel“, einem Lagergebäude des 15./16. Jh., neu aufgestellt. In den Jahren 2001/02 erfuhr das Museum durch einen modernen Anbau eine bedeutende Vergrößerung. Es ist Teil der Nordbayerischen Industriestraße."},{"page_url":"https://en.wikipedia.org/wiki/Mausoleum_of_Galla_Placidia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Ravenna_1978_079.jpg","page_title":"Mausoleum of Galla Placidia","context_page_description":"The Mausoleum of Galla Placidia is a Late Antique Roman building in Ravenna, Italy, built between 425 and 450. It was added to the World Heritage List together with seven other structures in Ravenna in 1996. Despite its common name, the empress Galla Placidia was not buried in the building, a misconception dating from the thirteenth century; she died in Rome and was buried there, probably alongside Honorius in the Mausoleum of Honorius at Old Saint Peter's Basilica."},{"page_url":"https://nl.wikipedia.org/wiki/Sd.Kfz._2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Kettenkrad_TechnikmuseumSpeyer_Insideview.JPG","page_title":"Sd.Kfz. 2","context_page_description":"De Sd.Kfz. 2, ook bekend als de Kleines Kettenkraftrad HK 101 of kortweg Kettenkraftrad of Kettenkrad, was een Duits militair halfrupsvoertuig uit de Tweede Wereldoorlog. Het was een voertuig op rupsbanden met de voorkant van een motorfiets. Het voertuig werd gebruikt voor transport-doeleinden en als kabellegger."},{"page_url":"https://war.wikipedia.org/wiki/Aspius_aspius","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Aspius_aspius.jpg","page_title":"Aspius aspius","context_page_description":"An Aspius aspius in uska species han Actinopterygii nga syahan ginhulagway ni Linnaeus hadton 1758. An Aspius aspius in nahilalakip ha genus nga Aspius, ngan familia nga cyprinidae. Ginklasipika han IUCN an species komo diri gud kababarak-an. Waray hini subspecies nga nakalista."},{"page_url":"https://en.wikipedia.org/wiki/Symmetric_derivative","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Graphinversesqrt.png","page_title":"Symmetric derivative","context_page_description":"In mathematics, the symmetric derivative is an operation generalizing the ordinary derivative. It is defined as:\\nThe expression under the limit is sometimes called the symmetric difference quotient. A function is said to be symmetrically differentiable at a point x if its symmetric derivative exists at that point.\\nIf a function is differentiable at a point, then it is also symmetrically differentiable, but the converse is not true. A well-known counterexample is the absolute value function f(x) = |x|, which is not differentiable at x = 0, but is symmetrically differentiable here with symmetric derivative 0. For differentiable functions, the symmetric difference quotient does provide a better numerical approximation of the derivative than the usual difference quotient.\\nThe symmetric derivative at a given point equals the arithmetic mean of the left and right derivatives at that point, if the latter two both exist.\\nNeither Rolle's theorem nor the mean value theorem hold for the symmetric derivative; some similar but weaker statements have been proved."},{"page_url":"https://es.wikipedia.org/wiki/Calgary","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Alberta_Jubilee_Auditorium_2.jpg","page_title":"Calgary","context_page_description":"Calgary es la mayor ciudad de la provincia de Alberta, Canadá. Se encuentra ubicada en una región de colinas y altiplanicies, aproximadamente 80 km al este de las Montañas Rocosas. Tercera ciudad de Canadá en términos de población, contaba según el censo de 2011 con 1 096 833 habitantes.​ La población estimada de su área metropolitana era de 1 214 839 habitantes, lo que la convierte en la quinta mayor de Canadá. El Corredor Calgary-Edmonton es la región urbana más poblada después de Toronto y Vancouver.​ El gentilicio en inglés para los habitantes de Calgary es «Calgarian».​\\nLa economía de Calgary se centra sobre todo en la industria petrolífera, aunque la agricultura, el turismo y la alta tecnología también contribuyen al rápido desarrollo económico de la ciudad. Es igualmente un destino muy conocido por ser un lugar donde practicar el ecoturismo y deportes de invierno: cerca de la ciudad se sitúan importantes lugares de vacaciones y en 1988, Calgary se convirtió en la primera ciudad canadiense en acoger los Juegos Olímpicos de Invierno."},{"page_url":"https://pl.wikipedia.org/wiki/Kolej_gondolowa_na_Jaworzyn%C4%99_Krynick%C4%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Jaworzyna_Krynicka_Cableway_%2820%29.jpg","page_title":"Kolej gondolowa na Jaworzynę Krynicką","context_page_description":"Kolej gondolowa na Jaworzynę Krynicką – całoroczna kolej gondolowa z Krynicy-Zdroju na Jaworzynę Krynicką w Beskidzie Sądeckim. Funkcjonuje w ramach Stacji Narciarskiej Jaworzyna Krynicka. Kolej wybudował Girak Austria, a jej operatorem jest spółka Kolej Gondolowa Jaworzyna Krynicka S.A."},{"page_url":"https://en.wikipedia.org/wiki/Uniform_polyhedron_compound","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/UC14-20_octahedra.png","page_title":"Uniform polyhedron compound","context_page_description":"A uniform polyhedron compound is a polyhedral compound whose constituents are identical uniform polyhedra, in an arrangement that is also uniform, i.e. the symmetry group of the compound acts transitively on the compound's vertices.\\nThe uniform polyhedron compounds were first enumerated by John Skilling in 1976, with a proof that the enumeration is complete. The following table lists them according to his numbering.\\nThe prismatic compounds of {p/q}-gonal prisms UC₂₀ and UC₂₁ exist only when > 2, and when p and q are coprime. The prismatic compounds of {p/q}-gonal antiprisms UC₂₂, UC₂₃, UC₂₄ and UC₂₅ exist only when >, and when p and q are coprime. Furthermore, when = 2, the antiprisms degenerate into tetrahedra with digonal bases."},{"page_url":"https://it.wikipedia.org/wiki/Stephenie_Meyer","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Stephenie_Meyer_by_Gage_Skidmore.jpg","page_title":"Stephenie Meyer","context_page_description":"Stephenie Morgan Meyer è una scrittrice e produttrice cinematografica statunitense."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%BF%88%E5%85%8B%E5%B0%94%C2%B7%E9%98%BF%E7%89%B9%E9%87%91%E6%A3%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Michael_K._Atkinson_official_photo.jpg","page_title":"迈克尔·阿特金森","context_page_description":"迈克尔·凯文·阿特金森是一名美国律师，曾在美国司法部工作15年。2018年5月17日，他就任第二任美国情报界总监。\\n2019年，美国总统特朗普在电话中施压乌克兰总统泽连斯基，要求其调查拜登父子。但一匿名举报人将特朗普施压一事透露给阿特金森，阿特金森又将这些信息转交给美国国会。这些举动促使美国众议院开始调查特朗普，而在白宫阻止政府官员出席国会听证期间，阿特金森依然出席美国众议院情报委员会的闭门听证。最终美国众议院发起特朗普弹劾案。\\n2020年4月3日，特朗普告知美国参议院，他决定革除阿特金森职务，阿特金森将在30天后离职。"},{"page_url":"https://ru.wikipedia.org/wiki/Scania-Vabis","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Scania-Vabis_3291_Lasbil_1925.jpg","page_title":"Scania-Vabis","context_page_description":"Scania-Vabis — шведский производитель автотранспорта и бронетехники, образовавшаяся 18 марта 1911 года в результате слияния компаний Scania из Мальмё и Vabis из Сёдертелье."},{"page_url":"https://en.wikipedia.org/wiki/An_Ph%C3%BA_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Le_village_flottant_des_pisciculteurs_%28Chau_Doc%2C_Vietnam%29_%286620595609%29.jpg","page_title":"An Phú District","context_page_description":"An Phú is a district of An Giang Province in the Mekong Delta region of Vietnam and shares the international border with Cambodia. An Phú juts out at the western edge of Vietnam into Cambodia. As of 2003 the district had a population of 178,613. The district covers an area of 226 km². The district capital lies at An Phú town."},{"page_url":"https://fr.wikipedia.org/wiki/Saupiquet_(entreprise)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Publicit%C3%A9_Saupiquet_1882.JPG","page_title":"Saupiquet (entreprise)","context_page_description":"Saupiquet est une entreprise fondée à Nantes en 1891 et spécialisée dans les métiers de la conserve de poisson, en particulier de thon."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D1%80%D0%B3%D0%B8%D0%B5%D0%B2_%D0%9F%D0%BE%D1%81%D0%B0%D0%B4_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Sergpossad-station.jpg","page_title":"Сергиев Посад (станция)","context_page_description":"Се́ргиев Поса́д — железнодорожная станция Ярославского направления Московской железной дороги в одноимённом городе Сергиево-Посадского района Московской области. Входит в Московско-Курский центр организации работы железнодорожных станций ДЦС-1 Московской дирекции управления движением. По основному характеру работы является промежуточной, по объёму работы отнесена ко 2 классу.\\nСтанция была сооружена в 1862 году, электрификация проведена в 1933 г.\\nНа станции три пассажирские платформы — одна боковая, две островных. Переход между ними только по настилам, мостов и подземных переходов нет. Турникеты отсутствуют. В 2014 г. была проведена реконструкция боковой платформы с демонтажем железобетонных конструкций; теперь новая пассажирская платформа является сооружением из модулей, накрытых сплошным настилом. Бетонным является только основание платформы, все элементы конструкций выполнены из стеклокомпозитных материалов, а вместо асфальтового покрытия или тротуарной плитки применён сверхпрочный экологически чистый материал на основе стекловолокна и полиэфирных смол. В едином стиле из стеклокомпозитных материалов выполнены элементы платформы — ограждения, скамейки для пассажиров и др."},{"page_url":"https://en.wikipedia.org/wiki/Saint-Pierre-des-Jonqui%C3%A8res","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Saint-Pierre-des-Jonqui%C3%A8res_%28mare%29_1.jpg","page_title":"Saint-Pierre-des-Jonquières","context_page_description":"Saint-Pierre-des-Jonquières is a commune in the Seine-Maritime department in the Normandy region in northern France."},{"page_url":"https://pt.wikipedia.org/wiki/Silvia_Montefoschi","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Silvia_Montefoschi_-_em_comemora%C3%A7%C3%A3o_de_sua_morte.jpg","page_title":"Silvia Montefoschi","context_page_description":"Silvia Montefoschi foi uma médica, bióloga e psicanalista italiana. Após a \\"laurea\\" em Biologia obtida em Roma no pós segunda guerra mundial, Silvia Montefoschi se transfere em Napoli como pesquisadora na Estação Zoológica da cidade para continuar os estudos no âmbito das ciências biológicas, com particular ênfase em genética. De volta em Roma, em 1952 começa uma análise pessoal e depois didática com Ernst Bernhard, psicanalista judeu de origem alemã que fora aluno de Carl Gustav Jung, após sua formação anterior como analista com Freud. Poucos anos depois, Montefoschi obtém uma laurea em Medicina necessária naquela época na Itália para exercitar a profissão de psicanalista.\\nO sentido do encontro entre Bernhard e eu […] ficou claro para mim no final de nosso percurso juntos como aquele da staffetta onde o penúltimo corredor entrega o testemunho a quem deve levá-lo até a meta. Silvia Montefoschi, “Il vivente”, 1988.\\nDá assim início à prática clínica e logo em seguida é aceite como membro da Sociedade Internacional de Psicologia Analítica. Em 1962 funda, junto a Bernhard e a um grupo de seus alunos, a Associação Italiana de Psicologia Analítica."},{"page_url":"https://fr.wikipedia.org/wiki/Hvammstangi","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Hvammstangi.jpg","page_title":"Hvammstangi","context_page_description":"Hvammstangi est une localité islandaise de la municipalité de Húnaþing vestra située au nord de l'île, dans la région de Norðurland vestra. En 2011, le village comptait 582 habitants."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D6%80%D6%81%D5%A1%D5%AD%D5%AB_%D6%86%D5%AB%D5%A6%D5%AB%D5%AF%D5%A1%D5%A1%D5%B7%D5%AD%D5%A1%D6%80%D5%B0%D5%A1%D5%A3%D6%80%D5%A1%D5%AF%D5%A1%D5%B6_%D5%A2%D5%B6%D5%B8%D6%82%D5%A9%D5%A1%D5%A3%D5%AB%D6%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fc/Sarsang_reservoir_P1090881.JPG","page_title":"Արցախի ֆիզիկաաշխարհագրական բնութագիր","context_page_description":"ԼՂՀ-ն գտնվում է Հայկական լեռնաշխարհի հյուսիսարևելյան Եզրին՝ Փոքր Կովկասի հարավարևելյան մասում։ Տարածքում է Կուր-Արաքսի դաշտավայրի արևմտյան մասը։ Մակերևույթը հիմնականում լեռնային է՝ հյուսիս-արևմուտքից հարավ-արևելք ընդհանուր թեքությամբ։ Տարածքի միջին բարձրությունը ծովի մակերևույթից 1100 մ է, ամենաբարձր կետը Արիության լեռն է, ամենացածրը՝ Սև ջրի հովիտը ։ Բարձր լեռնագագաթներից է Մռավը ։ Մռավի հարավարևելյան կարճ, զառիթափ ու հողմահարված լանջերը հանրապետության տարածքում կտրտված են Թարթառ գետի վտակների խոր կիրճերով ու գետահովիտներով։ Լեռնաշղթայի բարձրադիր մասերում պահպանվել են ռելիեֆի սառցադաշտային ձևեր ։ Տարածքի արևմտյան մասում հյուսիս-արևմուտքից հարավարևելյան ձգվում է Արցախի լեռնաշղթան, որի արևելյան՝ Օխտնաղբյուր, Կուսանաց, Կաչաղակաբերդ, Շմանեկ, Ծավեն, Մարխաթուն և այլ լեռնաճյուղեր բաժանված են Կարկառ, Խաչեն, Խոնաշեն և այլ գետերի ու դրանց վտակների խոր հովիտներով։ Լեռնաշղթայի առավել բարձր գագաթների հարաբերական բարձրություն 500-600 մ է։ Հարավ-արևելքում ձգվում է Մեծ Քիրս լեռնաշղթան, որի հյուսիսային մասում է Ճաղատսարի լեռնանցքը, որտեղով անցնում է Ստեփանակերտ-Գորիս ավտոմայրուղին։ Լեռնաշղթայի արևելյան մասում է Շուշիի սարավանդը։ Տարածքում կան ռելիեֆի կարստային ձևեր ։"},{"page_url":"https://de.wikipedia.org/wiki/Unpen-ji","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Henromiti_02.jpg","page_title":"Unpen-ji","context_page_description":"Der Unpen-ji, mit den Go Kyogōzan und Senjuin ist ein Tempel der Shingon-Richtung des Buddhismus in Miyoshi. Wegen seiner hohen Lage – der Tempel liegt mit 911 m etwas unterhalb des 927 m hohen Unpenjiyama – wird er auch „Kōya von Shikoku“ genannt. Unmittelbar an der Grenze zur Präfektur Kagawa gelegen, ist er von dort über eine Seilbahn zu erreichen.\\nIn der traditionellen Zählung ist er der 66. Tempel des Shikoku-Pilgerwegs. Man steigt zu ihm hoch vom 65. Tempel, dem Sankaku-ji in der Präfektur Aichi, und steigt von ihm hinab zum 67. Tempel, dem Daikō-ji, auf einem Weg, der früher wegen seines starken Gefälles „Henro korogashi“ genannt wurde also etwa „Stolper-Pilgerweg“."},{"page_url":"https://ca.wikipedia.org/wiki/Premis_Oscar_de_1954","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Budd_Schulberg_by_David_Shankbone_%288101631819%29.jpg","page_title":"Premis Oscar de 1954","context_page_description":"Els Premis Oscar de 1954 foren presentats el 30 de març de 1955 en una cerimònia realitzada al RKO Pantages Theatre de Los Angeles i al NBC Century Theatre de Nova York.\\nLa cerimònia fou presentada per l'actor Bob Hope i l'actriu Thelma Ritter."},{"page_url":"https://en.wikipedia.org/wiki/Table_shuffleboard","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/92/TableShuffleboardPucks.jpg","page_title":"Table shuffleboard","context_page_description":"Table shuffleboard is a game in which players push metal-and-plastic weighted pucks down a long and smooth wooden table into a scoring area at the opposite end of the table. Shooting is performed with the hand directly, as opposed to deck shuffleboard's use of cue sticks."},{"page_url":"https://vi.wikipedia.org/wiki/M%C3%B9a_b%C3%A3o_B%E1%BA%AFc_%E1%BA%A4n_%C4%90%E1%BB%99_D%C6%B0%C6%A1ng_2020","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/ARB01_2020_track.png","page_title":"Mùa bão Bắc Ấn Độ Dương 2020","context_page_description":"Mùa bão Bắc Ấn Độ Dương 2020 là một sự kiện đang diễn ra trong chu kỳ hình thành bão nhiệt đới hàng năm. Mùa bão ở Bắc Ấn Độ Dương không có giới hạn chính thức, nhưng các cơ bão có xu hướng hình thành từ tháng 4 đến tháng 12, với hai đỉnh điểm vào tháng 5 và tháng 11. Những ngày này thường phân định thời kỳ mỗi năm khi hầu hết các cơn bão nhiệt đới hình thành ở phía bắc Ấn Độ Dương.\\nPhạm vi của bài viết này được giới hạn ở Ấn Độ Dương ở Bắc bán cầu, phía đông của Sừng châu Phi và phía tây bán đảo Malay. Có hai vùng biển chính ở Bắc Ấn Độ Dương - Biển Ả Rập ở phía tây tiểu lục địa Ấn Độ, viết tắt ARB của Cục Khí tượng Ấn Độ; và Vịnh Bengal ở phía đông, viết tắt BOB bởi IMD."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%83%D0%B0%D1%82%D1%83_%E2%80%94_%D0%A8%D0%B0%D1%80%D0%B0%D0%BD%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Poitou-Charentes_region_relief_location_map.jpg","page_title":"Пуату — Шаранта","context_page_description":"Пуату-Шаранта — бывший регион на западе Франции, соответствующий исторической области Пуату. С 1 января 2016 года является частью региона Новая Аквитания. Главный город — Пуатье. Население — 1 777 773 человек. Пуату славится козьими сырами, коньяком и выращиванием устриц."},{"page_url":"https://hu.wikipedia.org/wiki/Montereau_(Loiret)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Population_-_Municipality_code_45213.svg","page_title":"Montereau (Loiret)","context_page_description":"Montereau település Franciaországban, Loiret megyében. Montereau La Cour-Marigny, Les Bordes, Dampierre-en-Burly, Lorris, Le Moulinet-sur-Solin, Oussoy-en-Gâtinais, Ouzouer-sur-Loire és Varennes-Changy községekkel határos."},{"page_url":"https://fr.wikipedia.org/wiki/Ligne_3_du_tramway_de_Lyon","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/884_Citadis_402_TCL_-_Gare_Part-Dieu_Villette.jpg","page_title":"Ligne 3 du tramway de Lyon","context_page_description":"La ligne 3 du tramway de Lyon, plus simplement nommée T3, également appelée LEA, est une ligne de tramway de la métropole de Lyon ouverte le 5 décembre 2006 entre la gare de la Part-Dieu à Lyon et la zone industrielle de Meyzieu dans l'Est lyonnais. La ligne transporte quotidiennement 27 000 passagers en moyenne en 2010, près de 40 000 en 2016 et 50 000 en 2018. Depuis le 10 juin 2014, la ligne est prolongée, en semaine, d'une station vers l'extension du parc relais de Meyzieu.\\nD'une longueur de 14,6 kilomètres, en grande partie sur ballast, T3 relie ses deux terminus en 25 à 26 minutes grâce à une vitesse maximale de 70 km/h. 7 km se trouvent en bordure d'habitations et disposent d'un mur antibruit en pierre du Gard. L'infrastructure de la ligne est également utilisée par Rhônexpress pour la desserte de l'aéroport de Lyon Saint-Exupéry, ainsi que pour la desserte événementielle du Parc Olympique lyonnais."},{"page_url":"https://de.wikipedia.org/wiki/Rur","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Lerop_roer.jpg","page_title":"Rur","context_page_description":"Die Rur ist ein 164,5 km langer, südöstlicher und orographisch rechter Nebenfluss der Maas in Belgien, Deutschland und den Niederlanden; etwa 80 Prozent der Flussstrecke befinden sich auf deutschem Territorium."},{"page_url":"https://fr.wikipedia.org/wiki/Biblioth%C3%A8que_(meuble)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Rows_of_Bookshelves.jpg","page_title":"Bibliothèque (meuble)","context_page_description":"Une bibliothèque est un meuble comportant des étagères, généralement horizontales, servant à ranger des livres. Les étagères, qui peuvent être démontables pour ajuster la hauteur des rayons, peuvent recevoir d'autres objets que des livres. Dans les pièces consacrées au stockage exclusif de livres ou d'imprimés, les bibliothèques peuvent être fixées aux murs et/ou au plancher.\\nCertaines bibliothèques reposent sur un bureau ou un coffre ; elles peuvent comporter des portes ou des battants permettant de protéger les livres de la lumière ou des variations d'humidité : de telles portes sont le plus souvent ajourées pour permettre de lire les titres des volumes. On stocke généralement les livres de grand format empilés à plat. Les plus grands livres sont entreposés seuls sur une étagère, voire sur un lutrin.\\nLe mot français est un héritage direct du grec ancien βιβλιοθήκη, « dépôt de livres »."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%93%88%E4%BC%8A%E6%A2%85%C2%B7%E5%B8%95%E5%88%87%E7%A7%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Jaime_Pacheco.jpg","page_title":"哈伊梅·帕切科","context_page_description":"哈伊梅·莫雷拉·帕切科，前葡萄牙足球运动员，现为足球教练。\\n球员时期帕切科效力过葡超豪门波尔图以及里斯本竞技，在他执教博阿维斯塔时期帮助球队拿到了迄今为止唯一一次葡萄牙顶级联赛冠军。"},{"page_url":"https://eu.wikipedia.org/wiki/Fontaine-l%C3%A8s-Dijon","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Fontaine_l%C3%A8s_Dijon_01.JPG","page_title":"Fontaine-lès-Dijon","context_page_description":"Fontaine-lès-Dijon Frantziako udalerria da, Côte-d'Or departamenduan dagoena, Borgoina-Franche-Comté eskualdean. 2013an 8.957 biztanle zituen."},{"page_url":"https://sl.wikipedia.org/wiki/Nelson_Piquet","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Piquet_1991.jpg","page_title":"Nelson Piquet","context_page_description":"Nelson Piquet Souto Maior, brazilski dirkač formule 1, * 17. avgust 1952, Rio de Janeiro, Brazilija.\\nNelson Piquet Souto Maior, bolj znan kot Nelson Piquet, je upokojeni brazilski dirkač formule 1, trikratni svetovni prvak v sezonah 1981, 1983 in 1987. Spada v elitno druščino dirkačev s tremi ali več naslovi v zgodovini formule 1"},{"page_url":"https://zh.wikipedia.org/wiki/%E9%BB%83%E5%81%89%E6%B0%91_(%E6%92%AD%E9%9F%B3%E5%93%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Wong_Wai_Man.JPG","page_title":"黃偉民 (播音員)","context_page_description":"黃偉民，香港時事評論員，資深傳媒人，歷任香港主流報章媒體如明報，壹集團等，曾任香港商業電台一台台長，及《在晴朗的一天出發》及《高談偉論》主持。曾任香港數碼廣播有限公司播音員 數碼大家台《十級自由Phone》及《早晨八達通》前節目主持人，曾與鄺穎萱、游清源、盧覓雪、馬恩賜、王岸然、梁安琪、梁家權等合作。亦曾於電台分別擔任時事評論節目《前因後果》及輕談中國術數節目《週末飲冰室》主持人。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%BF%D0%B0%D0%BA%D0%BE%D0%B2%D0%BA%D0%B0_%D0%BA%D1%80%D1%83%D0%B3%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Snub_hexagonal_tiling_circle_packing.png","page_title":"Упаковка кругов","context_page_description":"В геометрии упаковка кругов — это изучение размещения кругов на заданной поверхности таким образом, что они не пересекаются и круги касаются друг друга. Соответствующая плотность упаковки η размещения — это доля занятой кругами поверхности. Можно обобщить упаковки кругов на более высокие размерности — она называется упаковкой шаров, которая, обычно, работает с одинаковыми сферами.\\nВ то время как окружности имеют относительно низкую максимальную плотность упаковки 0.9069 на евклидовой плоскости, эта плотность не минимальна. «Худшая» фигура упаковки плоскости не известна, хотя сглаженный восьмиугольник имеет плотность упаковки около 0.902414, что является наименьшей максимальной плотностью упаковки, известной для центрально-симметричных выпуклых фигур.\\nПлотность упаковки вогнутых фигур, таких как звёздчатые многоугольники, может быть произвольно малой.\\nВетвь математики, известная как «упаковка кругов», занимается геометрией и комбинаторикой упаковок кругов произвольного размера и из неё подымаются дискретные аналоги конформных отображений, римановых поверхностей и им подобные."},{"page_url":"https://en.wikipedia.org/wiki/Vilsteren","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Landhuis_familie_Cremers.jpg","page_title":"Vilsteren","context_page_description":"Vilsteren is a village in the municipality of Ommen in the Dutch province of Overijssel. It is situated just off the left bank of the Vecht in between Dalfsen and Ommen, about 17 kilometres east of the provincial capital of Zwolle.\\nThe village Vilsteren has a population of around 200. The statistical area \\"Vilsteren\\", which also can include the surrounding countryside, has a population of around 380."},{"page_url":"https://en.wikipedia.org/wiki/Battle_of_the_Lys_(1940)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Kortrijk_Leiemonument.JPG","page_title":"Battle of the Lys (1940)","context_page_description":"The Battle of the Lys was a major battle between Belgian and German forces during the German Invasion of Belgium of 1940 and the final major battle fought by Belgian troops before their surrender on 28 May. It was the bloodiest of the 18 Days' Campaign. The battle was named after the river Leie, where the battlefield was situated."},{"page_url":"https://sh.wikipedia.org/wiki/Zastava_Ju%C5%BEne_Koreje","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Flag_of_South_Korea.svg","page_title":"Zastava Južne Koreje","context_page_description":"Zastava Južne Koreje ili Taegukgi je usvojena 6. marta 1883. od strane tadašnjeg korejskog kralja Gojonga. Na bijeloj podlozi se nalazi crveno-plavi simbol yin-yanga i tri crne pruge na uglovima zastave.\\nSimbol na zastavi potiče iz Kineske knjige I Ching koja predstavlja filozofske ideje svemira: harmoniju, simetriju, balans i cirkulaciju. Dizajn je baziran i na tradicionalnoj upotrebi boja crvne, plave i žute, dok bijela podloga predstavlja čistoću naroda.\\nPruge označavaju:\\n||| Silu = nebo, proljeće, istok, vrlina\\n¦¦¦ Polje = zemlja, ljeto, zapad, pravda\\n|¦| Zračenje = sunce, jesen, jug, kurtoaziju,\\n¦|¦ Ždrijelo = mjesec, zima, sjever, znanje ili mudrost\\nZastava je predstavlja simbol otpora za vrijeme japanske vlasti, a nakon Drugog svjetskog rata su je ispočetka koristile i Sjeverna i Južna Koreja. Sjeverna Koreja je, kasnije, pod komunističkim uticajem, preuzela vlastitu zastavu."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D0%B1%D0%B8%D1%80%D1%81%D0%BA%D0%BE%D0%B5_%D0%B1%D0%B0%D1%80%D0%BE%D0%BA%D0%BA%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Cerkiew_Podwy%C5%BCszenia_Krzy%C5%BCa_Pa%C5%84skiego_w_Irkucku_07.JPG","page_title":"Сибирское барокко","context_page_description":"Сибирское барокко — самое общее обозначение храмовой архитектуры Сибири XVIII века. По состоянию на 1803 год в Сибири насчитывалось 115 каменных храмов. Подавляющее их большинство принадлежало к провинциальному варианту русского барокко, испытавшему влияние украинского барокко и ламаистского декора. Наибольшее число памятников сохранилось в Иркутске, Тобольске и Томске. Первоначальные интерьеры уцелели только в Крестовой церкви Иркутска.\\nСибирские церкви XVIII века, подобно большинству памятников московского узорочья и барокко, — бесстолпные. С западной стороны к ним примыкают трапезные с колокольнями. Для барочных памятников Сибири характерно стремление к живописному нагромождению последовательно уменьшающихся объёмов. Декоративная система отмечена оригинальными привнесениями, предположительно восточного происхождения."},{"page_url":"https://fr.wikipedia.org/wiki/Biarritz","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/Villa_belza.jpg","page_title":"Biarritz","context_page_description":"Biarritz est une commune française située dans le département des Pyrénées-Atlantiques en région Nouvelle-Aquitaine, dans le Sud-Ouest de la France. Bordée par l'océan Atlantique, la ville dispose d'une façade maritime longue de 4 kilomètres, dans le creux du golfe de Gascogne, à moins de 25 kilomètres de la frontière avec l'Espagne.\\nLa localité résulte de l'union de deux centres de peuplement ancien, l'un voué à l'agriculture et l'autre tourné vers les métiers marins. Ancienne paroisse de Bayonne, le quartier Saint-Martin s'en émancipe à une date encore inconnue, à la fin du XVIᵉ siècle ou au début du XVIIᵉ siècle. D'abord port de pêche à la baleine, la localité connaît un bouleversement économique au XIXᵉ siècle à l'avènement des bains de mer. Napoléon III et l'impératrice Eugénie en font leur lieu de villégiature et créent une résidence et son parc avec une cité nouvelle en prolongement. Grace à eux, le gotha et toute la belle société européenne fréquentent la station balnéaire. Cette activité ne faiblit pas durant le XIXᵉ siècle et le début du XXᵉ siècle jusqu'à la crise de 1929."},{"page_url":"https://en.wikipedia.org/wiki/Alurnus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Alurnus_ornatus.jpg","page_title":"Alurnus","context_page_description":"Alurnus is a genus of beetles in the family Chrysomelidae."},{"page_url":"https://de.wikipedia.org/wiki/Herzogtum_Aquitanien","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Stammtafel_der_Karolinger.jpg","page_title":"Herzogtum Aquitanien","context_page_description":"Das Herzogtum Aquitanien war eines der wichtigsten Feudalterritorien im mittelalterlichen Frankreich."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%82%D1%80%D0%B0%D1%81%D1%82%D0%BD%D0%B0%D1%8F_%D0%BD%D0%B5%D0%B4%D0%B5%D0%BB%D1%8F_%D0%B2_%D1%81%D0%BB%D0%B0%D0%B2%D1%8F%D0%BD%D1%81%D0%BA%D0%BE%D0%B9_%D1%82%D1%80%D0%B0%D0%B4%D0%B8%D1%86%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Voznesennij_agnets_bozhij.png","page_title":"Страстная неделя в славянской традиции","context_page_description":"Страстна́я неде́ля — следующая после Вербной, седьмая последняя неделя Великого поста, продолжительностью шесть дней; она начинается в понедельник и завершается в субботу, предшествующую пасхальному воскресенью. Согласно религиозным канонам все дни недели богослужения погружают верующих в события последних дней жизни Христа.\\nВ славянской традиции в течение всей недели шла подготовка к главному празднику: мыли столы, скамейки, лавки, окна, двери. Белили печь, а то и стены. Выскабливали, вымывали пол, вытряхивали половики, перемывали посуду. С четверга до субботы шло приготовление у печи и во дворе: хозяйки пекли пасхальные куличи, красили яйца, запекали мясо; мужчины ставили качели, заготавливали дрова на время праздника и др. Селяне старались быть немногословными. Как и в течение всего поста, избегали громкого уличного пения, не было уличных игр и хороводов. По поверьям болгар, за соблюдением традиций следили самовилы. Согласно славянским поверьям, перед Пасхой или после неё предки возвращаются на землю, где пребывают в течение некоторого времени."},{"page_url":"https://vi.wikipedia.org/wiki/Mi%E1%BB%81n_Trung_Th%C3%A1i_Lan","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Thailand_Central.png","page_title":"Miền Trung Thái Lan","context_page_description":"Miền Trung Thái Lan, hay Đồng bằng Trung Bộ Thái Lan/Đồng bằng sông Mê Nam, bao quát cả một vùng đồng bằng phù sa rộng lớn của sông Chao Phraya, Thái Lan. Vùng này được tách biệt khỏi Đông-Bắc Thái Lan bởi dãy núi Phetchabun, và các dãy núi khác phân chia biên giới tự nhiên với Myanma về phía Tây. Ở phía Bắc, những dãy núi này hạ độ cao thành các đồi của miền Bắc Thái Lan. Khu vực Trung bộ Thái Lan là trung tâm của Vương quốc Ayutthaya, và vẫn là khu vực trọng yếu của Thái Lan, có thủ đô Bangkok. Miền Trung Thái Lan có dân dân cư đông đúc nhất đất nước này."},{"page_url":"https://pt.wikipedia.org/wiki/Rietheim-Weilheim","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9e/Weilheimer_Rathaus.jpg","page_title":"Rietheim-Weilheim","context_page_description":"Rietheim-Weilheim é um município da Alemanha localizado no distrito de Tuttlingen, região administrativa de Freiburg, estado de Baden-Württemberg."},{"page_url":"https://de.wikipedia.org/wiki/Carlyle-Kreis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Carlyle_lill_circle2.svg","page_title":"Carlyle-Kreis","context_page_description":"Der Carlyle-Kreis ist ein spezieller Kreis im kartesischen Koordinatensystem, dessen Schnittpunkte mit der x-Achse mit den Schnittpunkten einer normierten quadratischen Funktion und der x-Achse übereinstimmen. Er kann damit zur geometrischen Konstruktion der Nullstellen einer normierten quadratischen Funktion verwandt werden."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%93%D0%BE%D0%BC%D0%B5%D0%BB%D1%8C%D1%81%D0%BA%D1%96_%D0%B4%D0%B7%D1%8F%D1%80%D0%B6%D0%B0%D1%9E%D0%BD%D1%8B_%D1%82%D1%8D%D1%85%D0%BD%D1%96%D1%87%D0%BD%D1%8B_%D1%9E%D0%BD%D1%96%D0%B2%D1%8D%D1%80%D1%81%D1%8B%D1%82%D1%8D%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/BLR_Gomel_Pavel_Sukhoi_State_Tech_Univ_1.jpg","page_title":"Гомельскі дзяржаўны тэхнічны ўнівэрсытэт","context_page_description":"Гомельскі дзяржаўны тэхнічны ўнівэрсытэт імя Паўла Сухога — вышэйшая навучальная ўстанова Гомелю, заснаваная ў кастрычніку 1968 году ў якасьці агульнатэхнічнага факультэту Беларускага політэхнічнага інстытуту. З 1994 г. мае асьпірантуру. З 27 чэрвеня 1995 г. носіць імя авіяканструктара Паўла Сухога. На 2015 г. бібліятэка налічвала 535 тыс. асобнікаў літаратуры. ВНУ мела 3 навучальныя корпусы і 3 студэнцкія інтэрнаты, лябараторны корпус цяжкага абсталяваньня."},{"page_url":"https://en.wikipedia.org/wiki/Marks,_Mississippi","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/30/Marks_MS_019.jpg","page_title":"Marks, Mississippi","context_page_description":"Marks is a city in Quitman County, Mississippi. As of the 2010 census, the city population was 1,735. It is the county seat of Quitman County."},{"page_url":"https://is.wikipedia.org/wiki/Broddgreni","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Picea_pungens_tree.jpg","page_title":"Broddgreni","context_page_description":"Broddgreni er sígrænt hægvaxta barrtré. Það vex í Klettafjöllum Norður-Ameríku en er einnig vinsælt garðtré. Tréð er fylkistré Colorado."},{"page_url":"https://en.wikipedia.org/wiki/T%C3%B8rskind_Gravel_Pit","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Torskind2.jpg","page_title":"Tørskind Gravel Pit","context_page_description":"Tørskind Gravel Pit is a former gravel pit converted to a sculpture park near Egtved, Vejle, Denmark.\\nThe sculptures were created by Robert Jacobsen and Jean Clareboudt over five years up to 1991 and feature steel, granite and timber."},{"page_url":"https://de.wikipedia.org/wiki/Transvestitenschein","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Faksimile-Transvestitenschein.png","page_title":"Transvestitenschein","context_page_description":"Ein umgangssprachlich so genannter Transvestitenschein war ein ab 1909 bis mutmaßlich in die 1950er Jahre ausgegebenes Dokument, das dem jeweiligen Besitzer ohne Furcht vor behördlicher oder polizeilicher Verfolgung gestattete, in der Öffentlichkeit gegengeschlechtliche Kleidung zu tragen."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/%C5%9Eotrile","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/26/Sotrile_jud_Prahova.png","page_title":"Şotrile","context_page_description":"Şotrile sī Romania Prahova Koān ê chi̍t ê chū-tī-thé."},{"page_url":"https://sv.wikipedia.org/wiki/Xinzo_de_Limia_(kommunhuvudort)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Mosteiro_do_Bon_Xes%C3%BAs_de_Trandeiras_-_Xinzo_de_Limia_-_Ourense.jpg","page_title":"Xinzo de Limia (kommunhuvudort)","context_page_description":"Xinzo de Limia är en kommunhuvudort i Spanien. Den ligger i provinsen Provincia de Ourense och regionen Galicien, i den nordvästra delen av landet, 400 km nordväst om huvudstaden Madrid. Xinzo de Limia ligger 625 meter över havet och antalet invånare är 10 161.\\nTerrängen runt Xinzo de Limia är platt österut, men västerut är den kuperad. Den högsta punkten i närheten är 689 meter över havet, 1,3 km öster om Xinzo de Limia. Runt Xinzo de Limia är det ganska glesbefolkat, med 48 invånare per kvadratkilometer. Xinzo de Limia är det största samhället i trakten. Trakten runt Xinzo de Limia består till största delen av jordbruksmark.\\nMedelhavsklimat råder i trakten. Årsmedeltemperaturen i trakten är 12 °C. Den varmaste månaden är augusti, då medeltemperaturen är 22 °C, och den kallaste är januari, med 2 °C. Genomsnittlig årsnederbörd är 1 280 millimeter. Den regnigaste månaden är januari, med i genomsnitt 177 mm nederbörd, och den torraste är augusti, med 18 mm nederbörd."},{"page_url":"https://en.wikipedia.org/wiki/Glo_Worm","image_url":"https://upload.wikimedia.org/wikipedia/en/1/1e/Original-glowworm-photo.jpg","page_title":"Glo Worm","context_page_description":"Glo Worm is a stuffed toy for young children, designed by Hasbro's Playskool division, and made in Pawtucket, Rhode Island. Introduced in 1982, the plush, pajamaed worm body contained a battery-powered device that when squeezed would light up the toy's vinyl head from within, creating a soft glow.\\nThe original toy, upon release, was such a success that Hasbro released a new Musical Glo Worm toy, a series of story books, night lights, videos and other merchandise that continued until the early 1990s. However, in late 2005, the product was criticized for harming children; its plastic head was softened with phthalates, which can be dangerous if swallowed by children."},{"page_url":"https://en.wikipedia.org/wiki/Veterans_Airport_of_Southern_Illinois","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/MWA_airport_seen_from_a_departing_plane.jpg","page_title":"Veterans Airport of Southern Illinois","context_page_description":"Veterans Airport of Southern Illinois is five miles west of Marion, in Williamson County, Illinois. The airport is owned by the Williamson County Airport Authority. It sees one airline, subsidized by the federal government's Essential Air Service program at an annual cost of $2,562,819 or $141 per passenger. On November 11, 2016 during the grand opening ceremony for the new terminal, the airport was renamed to \\"Veterans Airport of Southern Illinois\\" to honor veterans and better reflect the regional nature of the airport.\\nFederal Aviation Administration records say the airport had 3,631 passenger boardings in calendar year 2008, 3,399 in 2009 and 8,047 in 2010. The National Plan of Integrated Airport Systems for 2011–2015 categorized it as a non-primary commercial service airport.\\nIt is the tenth busiest of the 12 commercial airports in Illinois"},{"page_url":"https://en.wikipedia.org/wiki/Lanthanide","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/HoOxideSolution.jpg","page_title":"Lanthanide","context_page_description":"The lanthanide or lanthanoid series of chemical elements comprises the 15 metallic chemical elements with atomic numbers 57–71, from lanthanum through lutetium. These elements, along with the chemically similar elements scandium and yttrium, are often collectively known as the rare earth elements.\\nThe informal chemical symbol Ln is used in general discussions of lanthanide chemistry to refer to any lanthanide. All but one of the lanthanides are f-block elements, corresponding to the filling of the 4f electron shell; depending on the source, either lanthanum or lutetium is considered a d-block element, but is included due to its chemical similarities with the other 14. All lanthanide elements form trivalent cations, Ln³⁺, whose chemistry is largely determined by the ionic radius, which decreases steadily from lanthanum to lutetium.\\nThey are called lanthanides because the elements in the series are chemically similar to lanthanum. Both lanthanum and lutetium have been labeled as group 3 elements, because they have a single valence electron in the 5d shell. However, both elements are often included in discussions of the chemistry of lanthanide elements."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%BC%B5%E9%9B%AA%E8%8A%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/HK_TVB_Living_Up_Stars_Candy_Cheung_n_Suki_Chui_a.jpg","page_title":"張雪芹","context_page_description":"张雪芹，原名张晓岚，香港女演员，2010年凭处境剧《天天天晴》而为人认识，曾为香港无线电视合约艺员。2011年转投香港电视，现定居于美国洛杉矶。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%BE%D0%BB%D0%BE%D1%82%D0%BE%D0%B9_%D0%BE%D1%80%D1%91%D0%BB_(%D0%BA%D0%B8%D0%BD%D0%BE%D0%BF%D1%80%D0%B5%D0%BC%D0%B8%D1%8F,_2007)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Viktor_Sukhorukov.jpg","page_title":"Золотой орёл (кинопремия, 2007)","context_page_description":"Национальная премия «Золотой орёл» за 2006 год — кинопремия, присуждаемая в 2007 году Национальной Академией кинематографических искусств и наук России с целью поддержания отечественного кинематографа, сохранения культурной самобытности и основ национального кинопроизводства, поощрения и пропаганды лучших произведений российского и зарубежного киноискусства.\\nПремия «Золотой орёл» за 2006 год присуждается по итогам двух туров голосования действительных членов и членов-корреспондентов Академии.\\nТоржественная церемония вручения Национальной премии в области кинематографии «Золотой орёл» за 2006 год прошла 27 января 2007 года в Первом павильоне «Мосфильма».\\nЛауреаты премии «Золотой орёл» за 2006 год были определены накануне проведения торжественной Церемонии прямым тайным голосованием членов и членов-корреспондентов Академии."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%94%D7%93%D7%95%D7%AA_%D7%9E%D7%A9%D7%99%D7%97%D7%99%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/PikiWiki_Israel_447_Messianic_Jewish_Alliance_haifa_%D7%A7%D7%94%D7%99%D7%9C%D7%94_%D7%9E%D7%A9%D7%99%D7%97%D7%99%D7%AA_%D7%91%D7%99%D7%AA_%D7%97%D7%A1%D7%93%D7%90_%D7%97%D7%99%D7%A4%D7%94.JPG","page_title":"יהדות משיחית","context_page_description":"יהדות משיחית היא תנועה דתית המשלבת בין אמונה בישו לזהות יהודית. הזרם הוא ענף של הנצרות האוונגליסטית שנוסד בשנות ה-70, והושפע רבות מהתנועה \\"העברית הנוצרית\\" של המאה ה-19, שביקשה להקים כנסיות ייעודיות ליהודים מומרים בהן יוכלו לשמור על זהותם. היהודים המשיחיים תופשים את עצמם כחלק מן היהדות, סוברים שיהודי המצטרף אליהם איננו מתנצר או ממיר את דתו, ועומדים על כך שיהיה גוף יהודי נפרד בתוך כלל מאמיני ישו. כמה קבוצות מקרבם אף רואות עצמן כיורשות הכיתות היהודיות-נוצריות העתיקות, שפעלו בטרם התהוות הנצרות כדת השוללת את התורה ולא מצריכה גיור. שום קבוצה יהודית אחרת לא מכירה בלגיטימיות שלהם, והממסד היהודי רואה אותם כמעט באופן גורף כהונאה הפועלת בשירות המיסיון. גם בתוך המחנה האוונגליסטי יש מבקרים המאשימים אותם בהתייהדות ושוללים מהם לגיטימיות. אמונתם של המשיחיים זהה למעשה לזו של הנוצרים האוונגליסטים, כולל קבלת הברית הישנה והברית החדשה ככתבי קודש, וראיית ישו כבן האלוהים השותף בשילוש הקדוש, שהתגלם בבשר וכיפר על חטאי האנושות בקרבנו על הצלב. המאפיין המבדיל את היהודים המשיחיים מזרמים נוצריים סטנדרטיים הוא הדגשת מאפיינים מסוימים מן המסורת היהודית, בפרט חגים, מנהגים וסממנים הנפוצים בה."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%88%D1%83%D0%B3%D0%BE%D1%81%D0%BB%D0%B0%D0%B2%D0%B8%D1%98%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Flag_of_Yugoslavia_%281946-1992%29.svg","page_title":"Југославија","context_page_description":"Југославија е име што означува три различни но последователни политички ентитети што постоеја во поголемиот дел од 20. век на Балканскиот Полуостров, а во чии рамки спаѓаа јужнословенските земји, со исклучок на Бугарија.\\nПрвата Југославија е кралство формирано во 1918 како Кралство на Србите, Хрватите и Словенците, кое е преименувано во Кралство Југославија во 1929 и постои под тоа име сè до 1941 кога земјата беше окупирана од страна на Силите на Оската.\\nВтората Југославија е социјалистичка земја формирана веднаш по Втората светска војна, а од 1943 е позната како Демократска Федеративна Југославија, од 1945 како Федеративна Народна Република Југославија, а потоа од 1963 како Социјалистичка Федеративна Република Југославија. Во оваа форма таа Југославија останува сè до 1991 кога четири од шесте републики што ја формираат целосно се отцепуваат - Словенија, Хрватска, Македонија и Босна и Херцеговина.\\nТретата Југославија го носи името Сојузна Република Југославија и постои од 1992 до 2003 на територијата на Србија и Црна Гора. Во 2003, името Југославија официјално е укинато и земјата станува лабава унија наречена Србија и Црна Гора."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_in_Lauchhammer_gegossenen_Kunstwerke","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Friedrich_Ludwig_Jahn_Bueste_Weisswasser.jpg","page_title":"Liste der in Lauchhammer gegossenen Kunstwerke","context_page_description":"Die Liste der in Lauchhammer gegossenen Kunstwerke listet Kunstwerke auf, die in der Kunst- und Glockengießerei Lauchhammer seit ihrer Gründung gefertigt wurden. Sie erhebt keinen Anspruch auf Vollständigkeit."},{"page_url":"https://ceb.m.wikipedia.org/wiki/Monti_Ruju","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Villanova_Monteleone%2C_monte_Minerva_%2817%29.jpg","page_title":"Monti Ruju","context_page_description":"Bukid ang Monti Ruju sa Italya. Nahimutang ni sa lalawigan sa Provincia di Sassari ug rehiyon sa Sardegna, sa habagatan-kasadpang bahin sa nasod, 400 km sa kasadpan sa Rome ang ulohan sa nasod. 659 metros ibabaw sa dagat kahaboga ang nahimutangan sa Monti Ruju, o 140 ka metros sa ibabaw sa naglibot nga tereyn. Mga 3.8 ka kilometro ang gilapdon sa tiilan niini.\\nAng yuta palibot sa Monti Ruju kay kabungtoran. Sa habagatang-kasadpan, dagat ang pinakaduol sa Monti Ruju. Ang kinahabogang dapit sa palibot dunay gihabogon nga 792 ka metro ug 4.6 km sa habagatan sa Monti Ruju. Dunay mga 56 ka tawo kada kilometro kwadrado sa palibot sa Monti Ruju medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Alghero, 18.1 km sa amihanan-kasadpan sa Monti Ruju. Hapit nalukop sa kaumahan ang palibot sa Monti Ruju. Sa rehiyon palibot sa Monti Ruju, kabukiran, ug mga lapyahan talagsaon komon.\\nAng klima kasarangan. Ang kasarangang giiniton 16 °C. Ang kinainitan nga bulan Hulyo, sa 28 °C, ug ang kinabugnawan Pebrero, sa 6 °C. Ang kasarangang pag-ulan 808 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 142 milimetro nga ulan, ug ang kinaugahan Hulyo, sa 10 milimetro."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AB%E0%B5%8D%E0%B4%B0%E0%B4%BE%E0%B5%BB%E0%B4%B8%E0%B4%BF%E0%B4%B8%E0%B5%8D_%E0%B4%A4%E0%B5%8B%E0%B4%82%E2%80%8C%E0%B4%AA%E0%B5%8D%E0%B4%B8%E0%B5%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Francisthompson.jpg","page_title":"ഫ്രാൻസിസ് തോം‌പ്സൺ","context_page_description":"ഒരു ഇംഗ്ലീഷ് കവിയും തത്ത്വാന്വേഷിയും ആയിരുന്നു ഫ്രാൻസിസ് തോം‌പ്സൺ. സ്കൂൾ വിദ്യാഭ്യാസത്തിനു ശേഷം തുടങ്ങിയ വൈദ്യപഠനം പൂർത്തിയാക്കാതെ എഴുത്തുകാരനാകണമെന്ന ലക്ഷ്യത്തോടെ ലണ്ടണിലെത്തിയ തോം‌പ്സൺ, വഴിവാണിഭം ചെയ്തും തെരുവുകളിൽ അലഞ്ഞുതിരിഞ്ഞും കഴിയേണ്ട അവസ്ഥയിലാവുകയും കറുപ്പിന്‌ അടിമയായി തീരുകയും ചെയ്തു. ആ ജീവിതത്തിൽ നിന്ന് കവിയെ രക്ഷപെടുത്തിയത്, അദ്ദേഹത്തിന്റെ കവിതകളിൽ ചിലത് കാണാനിടയായ \\"മെറി ഇംഗ്ലണ്ട്\\" എന്ന കത്തോലിക്കാ മാസികയുടെ പ്രസാധകർ മേനൽ ദമ്പതിമാരാണ്‌. 1893-ൽ തോം‌പ്സന്റെ കവിതകളുടെ ആദ്യസമാഹാരം പ്രസിദ്ധീകരിച്ചതും അവരായിരുന്നു. പിൽക്കാലത്തും, വെയിൽസിലും സ്റ്റോറിംഗ്‌ടണിലും മറ്റും നിലതെറ്റിയവനും രോഗിയുമായി തോം‌പ്സൺ ജീവിച്ചെങ്കിലും, 1907-ൽ ക്ഷയരോഗബാധിതനായി മരിക്കുന്നതിനു മുൻപ് അദ്ദേഹം മൂന്നു കവിതാസമാഹാരങ്ങളും ഉപന്യാസങ്ങളും പ്രസിദ്ധീകരിച്ചിരുന്നു. ആദ്യസമാഹാരത്തിൽ ഉൾപ്പെടുത്തിയിരുന്ന സ്വർഗ്ഗത്തിലെ വേട്ടപ്പട്ടി എന്ന കവിതയാണ്‌ തോം‌പ്സന്റെ ഏറ്റവും പ്രസിദ്ധമായ രചന."},{"page_url":"https://da.wikipedia.org/wiki/Verdens_bedste_h%C3%A5ndboldspiller","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Arpad_%C5%A0terbik%2C_BM_Ciudad_Real_-_Handball_Spain_%2801%29.jpg","page_title":"Verdens bedste håndboldspiller","context_page_description":"Årets bedste håndboldspiller er en udmærkelse som blev etableret i 1984, og som tildeles en mandlig og en kvindelig håndboldspiller. Udmærkelsen bliver uddelt af IHF, og vinderne afgøres ved en afstemning i World Handball Magazine og af besøgende på IHF's hjemmeside.\\nTo danskere har modtaget prisen: Anja Andersen i 1997 samt Mikkel Hansen i 2011, 2015 og 2018.\\nIngen kåring af verdens bedste håndboldspillere for 2017. Det international håndboldforbund siger nemlig følgende omkring den beslutning til TV2 Sport:\\n“Desværre nåede antallet af stemmer, det vil sige den samlede deltagelse, i medieafstemningen og fanafstemningen, ikke tilstrækkeligt højt nok op til at lade disse to afgøre resultatet i sidste ende – i forhold til prisens betydning. Derfor er det blevet besluttet ikke at kåre årets spillere i 2017.”."},{"page_url":"https://en.wikipedia.org/wiki/Seimei_Shrine","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ca/Seimei_Shrine-3483.jpg","page_title":"Seimei Shrine","context_page_description":"Seimei Shrine is a Shinto shrine that is located in Kyoto, Japan. It is dedicated to the onmyōji, Abe no Seimei."},{"page_url":"https://fr.wikipedia.org/wiki/Oberf%C3%B6hring","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/M%C3%BCnchen_-_Stadtbezirk_13_%28Karte%29_-_Bogenhausen.png","page_title":"Oberföhring","context_page_description":"Oberföhring est un quartier de la ville allemande Munich, la capitale bavaroise.\\nOberföhring appartient au district 13 de Munich, Bogenhausen."},{"page_url":"https://hr.wikipedia.org/wiki/Manfred_von_Richthofen","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/RoteBaron.JPG","page_title":"Manfred von Richthofen","context_page_description":"Manfred Albrecht Freiherr von Richthofen, njemački pilot lovačkih aviona u Prvom svjetskom ratu."},{"page_url":"https://oc.wikipedia.org/wiki/Cast%C3%A8th_de_Benauja","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Arbis-Ch%C3%A2teau2-1863.png","page_title":"Castèth de Benauja","context_page_description":"Lo castèth de Benauja es un castèth situat dens la comuna d'Arbís, dens l'Entre Duas Mars, en Bordalés. Lo nom dau castèth de Benauja explica lo dau país de Benauja, o n'es explicat."},{"page_url":"https://es.wikipedia.org/wiki/Sesquiterpeno","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Syzygium_aromaticum_on_tree.jpg","page_title":"Sesquiterpeno","context_page_description":"Los sesquiterpenos o sesquiterpenoides son los terpenos de 15 carbonos. Como los monoterpenoides, muchos sesquiterpenoides están presentes en los aceites esenciales. Además muchos sesquiterpenoides actúan como fitoalexinas, compuestos antibióticos producidos por las plantas en respuesta a la aparición de microbios, y como inhibidores de la alimentación de los herbívoros oportunistas."},{"page_url":"https://pl.wikipedia.org/wiki/Akademia_Wychowania_Fizycznego_im._Bronis%C5%82awa_Czecha_w_Krakowie","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Stadion_AWF.jpg","page_title":"Akademia Wychowania Fizycznego im. Bronisława Czecha w Krakowie","context_page_description":"Akademia Wychowania Fizycznego im. Bronisława Czecha w Krakowie – uczelnia publiczna utworzona w Krakowie w 1950 roku."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Dal","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Dal_godshus.jpg","page_title":"Gare de Dal","context_page_description":"La gare de Dal a été mise en service en 1854 au moment de l'ouverture de la Hovedbanen. La gare se situe dans la commune d'Eidsvoll."},{"page_url":"https://fr.wikipedia.org/wiki/Christian_P%C3%B6mer","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Christian_Poemer_IMG_0356.jpg","page_title":"Christian Pömer","context_page_description":"Christian Pömer est un coureur cycliste et directeur sportif autrichien. Coureur durant les années 2000, il est directeur sportif de l'équipe Bora-Hansgrohe depuis 2013."},{"page_url":"https://pl.wikipedia.org/wiki/X_Japan","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/X_Japan_logo.svg","page_title":"X Japan","context_page_description":"X JAPAN – japoński zespół heavymetalowy nurtu visual kei, założony w 1982 roku, rozwiązany 30 września 1997, reaktywowany 4 czerwca 2007. Jeden z najbardziej wpływowych i najpopularniejszych japońskich zespołów rockowych w historii. Szacowany nakład ze sprzedaży wszystkich wydawnictw zespołu w samej Japonii sięgnął liczby 30 milionów egzemplarzy z oficjalnymi certyfikatami stowarzyszenia Recording Industry Association of Japan, nagradzającego artystów wyróżnieniami za sprzedaż płyt i singli. Czyni ich to jednymi z artystów z największą liczbą sprzedanych wydawnictw muzycznych w Japonii. Są japońskim zespołem metalowym, który sprzedał najwięcej płyt spośród wszystkich grup reprezentujących ów nurt w Japonii. Oprócz tego zespół może się poszczycić koncertem na scenie cieszącej się renomą goszczenia największych artystów światowej sceny muzycznej – na Madison Squere Garden w Nowym Jorku. Głównym zamysłem grupy było szokowanie publiczności wszelkimi możliwymi sposobami. Ich motto brzmiało: „Psychodeliczna Przemoc - Zbrodnia Wizualnego Szoku”. Twórczość grupy silnie inspirowana jest artystami takimi jak Iron Maiden, Sex Pistols, czy David Bowie."},{"page_url":"https://ca.wikipedia.org/wiki/Fernando_Sebasti%C3%A1n_Aguilar","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Card._Sebasti%C3%A1n_%2834385660763%29.jpg","page_title":"Fernando Sebastián Aguilar","context_page_description":"Fernando Sebastián Aguilar, C.M.F. Calataiud, 14 de desembre de 1929 - Màlaga, 24 de gener de 2019) és un teòleg espanyol Arquebisbe emèrit de Pamplona i Tudela des del 31 de juliol de 2007. El 12 de gener de 2014, en finalitzar la pregària de l'Àngelus, el Papa Francesc llegí la llista dels noms dels nous cardenals, entre els que apareixia el seu nom. Va ser proclamat el 22 de febrer de 2014, primer consistori a aquest efecte del papa Francesc, tot i que no tindrà dret a un eventual conclave en haver superat el límit legal dels 80 anys."},{"page_url":"https://en.wikipedia.org/wiki/Fashion_plate","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Fashionplate.jpg","page_title":"Fashion plate","context_page_description":"A fashion plate is an illustration demonstrating the highlights of fashionable styles of clothing. Traditionally they are rendered through etching, line engraving, or lithograph and then colored by hand. To quote historian James Laver, the best of them tend to \\"reach a very high degree of aesthetic value.\\"\\nFashion plates do not usually depict specific people. Instead they take the form of generalized portraits, which simply dictate the style of clothes that a tailor, dressmaker, or store could make or sell, or demonstrate how different materials could be made up into clothes. The majority can be found in ladies' fashion magazines which began to appear during the last decades of the eighteenth century. Used figuratively, as is often the case, the term refers to a person whose dress conforms to the latest fashions.\\nFashion plates are frequently used as primary source material for the study of historical fashions, although commentators warn that as they were high-end aspirational catalogues it should not be assumed that the majority of people dressed in the same way expressed by a plate."},{"page_url":"https://en.wikipedia.org/wiki/Cambs,_Germany","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Schule_Cambs_Panorama.jpg","page_title":"Cambs, Germany","context_page_description":"Cambs is a municipality in the Ludwigslust-Parchim district, in Mecklenburg-Vorpommern, Germany."},{"page_url":"https://de.wikipedia.org/wiki/Schw%C3%B6rhaus_(Ulm)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Ulm_-_Weinhof_um_1900_in_einem_Modell_im_Schw%C3%B6rhaus02.JPG","page_title":"Schwörhaus (Ulm)","context_page_description":"Das Schwörhaus in Ulm ist ein zu Beginn des 17. Jahrhunderts errichteter reichsstädtischer Repräsentationsbau. Nach mehrfacher Zerstörung und Wiederaufbau wird es heute als Haus der Stadtgeschichte Ulm vom Stadtarchiv Ulm genutzt. Von seinem Balkon aus legt am Schwörmontag der Ulmer Oberbürgermeister jährlich öffentlich Rechenschaft ab."},{"page_url":"https://cy.wikipedia.org/wiki/Pamplona","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Calle_Estafeta_de_Pamplona.JPG","page_title":"Pamplona","context_page_description":"Pamplona yw brifddinas cymuned ymreolaethol Navarra yn Sbaen. Yn hanesyddol, ystyrir Pamplona gan y mwyafrif fel prifddinas Gwlad y Basg.\\nSaif ar Afon Arga, ac yn 2006 roedd y boblogaeth yn 195,769. Yn y cyfnod Rhufeinig, tyfodd pentref Iruñea i fod yn ddinas Rufeinig \\"Pompaelo\\", wedi ei henwi ar ôl Pompeius Magnus, a'i sefydlodd yn 74 CC.. Cafodd ei chipio gan y Mwslimiaid yn yr 8g, ac yn 778 dinistriwyd y muriau gan Siarlymaen ychydig cyn Brwydr Ronsyfal. Yn ail hanner y 9g ffurfiwyd Teyrnas Pamplona.\\nMae Pamplona yn enwog am y Sanfermines, gŵyl sy'n cael ei chynnal rhwng 6 ac 14 Gorffennaf i anrhydeddu Sant Fermín, nawdd-sant Navarra. Y rhan enwocaf o'r ŵyl yw'r \\"rhedeg gyda'r teirw\\".\\nY ddinas yw diwedd ail ran y Camino de Santiago o Roncesvalles i Santiago de Compostela."},{"page_url":"https://fr.wikipedia.org/wiki/Ouvrage_de_Rimplas","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Caponni%C3%A8re_d%27entr%C3%A9e_de_l%27ouvrage_Maginot_de_Rimplas.JPG","page_title":"Ouvrage de Rimplas","context_page_description":"L'ouvrage de Rimplas, appelé dans un premier temps ouvrage de la Madeleine, est une fortification faisant partie de la ligne Maginot, située sur la commune de Rimplas dans le département des Alpes-Maritimes.\\nIl s'agit d'un gros ouvrage d'artillerie, situé à 1 102 mètres d'altitude et interdisant de ce sommet le passage par la vallée de la Tinée, couvrant les petits ouvrages de Fressinéa et de Valdeblore."},{"page_url":"https://en.wikipedia.org/wiki/Burger_King_legal_issues","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/Mattoon_Burger_King.jpg","page_title":"Burger King legal issues","context_page_description":"The legal issues of Burger King include several legal disputes and lawsuits involving the international fast food restaurant chain Burger King as both plaintiff and defendant in the years since its founding in 1954. These have involved almost every aspect of the company's operations. Depending on the ownership and executive staff at the time of these incidents, the company's responses to these challenges have ranged from a conciliatory dialog with its critics and litigants to a more aggressive opposition with questionable tactics and negative consequences. The company's response to these various issues has drawn praise, scorn, and accusations of political appeasement from different parties over the years.\\nA diverse range of groups have raised issues, such as People for the Ethical Treatment of Animals, over the welfare of animals, governmental and social agencies over health issues and compliance with nutritional labeling laws, and unions and trade groups over labor relations and laws. These situations have touched on the concepts of animal rights, corporate responsibility and ethics, as well as social justice."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%AA%D7%93%D7%A8%D7%9C%D7%AA_%D7%94%D7%A9%D7%99%D7%9C%D7%95%D7%A9_%D7%94%D7%A7%D7%93%D7%95%D7%A9_(%D7%90%D7%93%D7%99%D7%A1_%D7%90%D7%91%D7%91%D7%94)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Addis_Ababa_street_map_-_01.png","page_title":"קתדרלת השילוש הקדוש (אדיס אבבה)","context_page_description":"קתדרלת השילוש הקדוש היא קתדרלה אתיופית, המוקדשת לשילוש הקדוש, והשוכנת באדיס אבבה, בירת אתיופיה. הקתדרלה היא החשובה בעיר והשנייה בחשיבותה במדינה, לאחר כנסיית גבירתנו מרים מציון באקסום. היא גם המבנה הכנסייתי הגדול באתיופיה. הקתדרלה היא מקום מושבה של הארכידיוקסיה של אדיס אבבה, ובה נערכים טקסי ההסמכה של בכירי הכנסייה האורתודוקסית האתיופית."},{"page_url":"https://zh.wikipedia.org/zh-my/%E7%9B%88%E6%9A%89%E8%87%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Nob_Hill_Square_Level_1_%283%29.jpg","page_title":"盈暉臺","context_page_description":"盈晖台是一个位于香港九龙荔枝角湾景荔径8号的私人屋苑，邻近荔景山路，共有3座楼宇和一座名为盈晖荟的商场。盈晖台前临美孚新邨，远眺荔枝角公园，北面为九华径，西面邻近玛嘉烈医院及葵涌医院。\\n前荔园游乐场于1997年结业之后，长江实业及远东发展就在该处的南面兴建盈晖台，并于2002年落成。而荔枝角巴士总站则获安置于盈晖台基座。"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Uglegorsky_Ko%C4%81n","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Flag_of_Uglegorsky_rayon_%28Sakhalin_oblast%29.png","page_title":"Uglegorsky Koān","context_page_description":"Uglegorsky Koān sī Lō͘-se-a Sakhalin Chiu ê chi̍t ê koān.\\nPang-bô͘:Sakhalin Chiu"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D0%B0%D0%B5%D0%B2,_%D0%90%D0%BB%D0%B8%D0%B3%D0%B5%D0%B9%D0%B4%D0%B0%D1%80_%D0%9A%D0%B5%D1%80%D0%B8%D0%BC_%D0%BE%D0%B3%D0%BB%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/ru/e/e2/%D0%9C%D0%B5%D0%BC%D0%BE%D1%80%D0%B8%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%B4%D0%BE%D1%81%D0%BA%D0%B0_%D0%90%D0%BB%D0%B8%D0%B3%D0%B5%D0%B9%D0%B4%D0%B0%D1%80%D0%B0_%D0%9A%D0%B0%D1%80%D0%B0%D0%B5%D0%B2%D0%B0_%D0%B2_%D0%91%D0%B0%D0%BA%D1%83.jpg","page_title":"Караев, Алигейдар Керим оглы","context_page_description":"Алигейдар Керим оглы Караев или Али Гейдар Ага Керим оглы Караев — видный государственный, политический, партийный и военный деятель Азербайджанской ССР, ЗСФСР и СССР; публицист и редактор различных периодических изданий.\\nБудучи членом социал-демократической организации «Гуммет», вначале примыкал к её меньшевистскому, а затем к большевистскому течениям. Являлся депутатом парламентов Грузинской Демократической Республики и Азербайджанской Демократической Республики, а после смены власти и провозглашения Азербайджанской Советской Социалистической Республики, стал членом Азербайджанского Временного Революционного Комитета.\\nРуководил местными органами власти Бакинского района. Возглавлял народные комиссариаты труда и юстиции, по военным и морским делам Азербайджанской ССР. Являлся членом Президиумов ЦИК Азербайджанской ССР и ЦИК ЗСФСР. Был членом ЦИК СССР IV созыва.\\nОрганизатор, создатель Азербайджанской Красной армии. Был членом Реввоенсоветов XI Красной Армии, Каспийского флота, Отдельной Кавказской Армии, Кавказской Краснознамённой армии и СССР.\\nДо конца 1920-х годов он занимал ведущие позиции в Компартии Азербайджанской ССР — АКП."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_Armenias_fugler","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Sternula_albifrons_2_-_Little_Swanport.jpg","page_title":"Liste over Armenias fugler","context_page_description":"Denne listen over Armenias fugler inkluderer 365 arter.\\nRekkefølge er etter Clements-lista versjon v2015.\\nDe norske navnene følger Norske navn på verdens fugler.\\nStatus på lista:\\nS - Armensk sjeldenhet eller tilfeldig\\nX - Lokalt utryddet\\nNT - Nær truet etter IUCNs rødliste\\nVU - Sårbar etter IUCNs rødliste\\nEN - Sterkt truet etter IUCNs rødliste\\nCR - Kritisk truet etter IUCNs rødliste"},{"page_url":"https://pt.wikipedia.org/wiki/Cuenca_de_Pamplona","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Pamplona_oculta_larrazun_01.jpg","page_title":"Cuenca de Pamplona","context_page_description":"A Cuenca de Pamplona é uma comarca da comunidade foral de Navarra. É uma entidade sem carácter administrativo, delimitada segundo critérios físicos, que engloba a capital da comunidade, Pamplona, e a sua área metropolitana. Segundo a Zonificación Navarra 2000 é uma subzona constituída por 28 municípios com 587,29 km² que em 2010 tinha 338 902 habitantes. Juntamente com a comarca de Puente la Reina forma a Zona de Pamplona."},{"page_url":"https://simple.wikipedia.org/wiki/Jaak_Panksepp","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Jaak_Panksepp_paremal_%282004_detsember%29.JPG","page_title":"Jaak Panksepp","context_page_description":"Jaak Panksepp was an Estonian-born American neuroscientist, a psychobiologist, the Baily Endowed Chair of Animal Well-Being Science at Washington State University's College of Veterinary Medicine, and Emeritus Professor of the Department of Psychology at Bowling Green State University. He was born in Tartu, Estonia.\\nPanksepp created the term 'affective neuroscience', the name for the field that studies the neural mechanisms of emotion. He was known in the popular press for his research on laughter in non-human animals.\\nPanksepp died on April 17, 2017 from cancer at his home in Bowling Green, Ohio at the age of 73."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_W%C3%BCrzburg-Frauenland","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/1_Landratsamt_4.jpg","page_title":"Liste der Baudenkmäler in Würzburg-Frauenland","context_page_description":"In der Liste der Baudenkmäler in Frauenland sind die Baudenkmäler im Würzburger Stadtbezirk 06 Frauenland aufgelistet.\\nDiese Liste ist eine Teilliste der Liste der Baudenkmäler in Würzburg. Grundlage der Liste ist die Bayerische Denkmalliste, die auf Basis des bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt und aktualisiert wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CE%AF%CE%BB%CE%B9%CF%84%CF%83%CE%B1_%CE%A7%CF%81%CE%B5%CE%BC%CF%80%CE%B5%CE%BB%CE%B9%CE%AC%CE%BD%CE%BF%CE%B2%CE%B9%CF%84%CF%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/Milica_Ljubostinja1.jpg","page_title":"Μίλιτσα Χρεμπελιάνοβιτς","context_page_description":"Η Μίλιτσα Χρεμπελιάνοβιτς ήταν πριγκίπισσα της Σερβίας η σύζυγος του Σέρβου πρίγκιπα Λάζαρ και αγία της Σερβικής ορθόδοξης εκκλησίας."},{"page_url":"https://hu.wikipedia.org/wiki/Albano_di_Lucania","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Albano_di_Lucania_panorama.JPG","page_title":"Albano di Lucania","context_page_description":"Albano di Lucania község Olaszország Basilicata régiójában, Potenza megyében."},{"page_url":"https://lt.wikipedia.org/wiki/Skapi%C5%A1kis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Skapi%C5%A1kis%2C_ba%C5%BEny%C4%8Dia.JPG","page_title":"Skapiškis","context_page_description":"Skapiškis – miestelis Kupiškio rajono savivaldybėje, į rytus nuo Kupiškio, netoli Panevėžio–Daugpilio geležinkelio. Seniūnijos ir seniūnaitijos centras.\\nStovi Skapiškio Šv. Hiacinto bažnyčia, yra Skapiškio vidurinė mokykla, biblioteka, paštas, ambulatorija.\\nVakaruose telkšo Skapiškio ežeras, už 5 km į šiaurės rytus nuo Skapiškio yra Lėvens ištakos. Prie miestelio yra Mituvos ežeras, iš kurio išteka Mituva."},{"page_url":"https://nl.wikipedia.org/wiki/Don_Quichot_(boek)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Don_Quixote_6.jpg","page_title":"Don Quichot (boek)","context_page_description":"Don Quichot is de hoofdpersoon in de door Cervantes geschreven roman De vernuftige edelman Don Quichot van La Mancha. Deze roman bestaat uit twee delen: het eerste werd gepubliceerd in 1605, het tweede in 1615.\\nHet boek is een van de eerste geschreven romans in een moderne Europese taal. Het vertelt de komische reisavonturen van een oude edelman die denkt dat hij een dolende ridder is. Deze hoofdpersoon, Don Quichot, is het stereotype van de idealist, een dwaze held die zich met zijn goede bedoelingen maar onpraktische daden min of meer belachelijk maakt."},{"page_url":"https://da.wikipedia.org/wiki/Pantograf","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e3/Pantograph_etching_mechanism.JPG","page_title":"Pantograf","context_page_description":"En pantograf er et tegneredskab som anvendtes til at kopiere en tegning eller skrift.\\nDet er en mekanisme sammensat på en særlig måde, baseret på et parallelogram således at bevægelsen på et punkt giver samme bevægelse på et andet punkt. Hvis en linje tegnes på det første punkt, vil en forstørret kopi blive tegnet af en pen på det andet punkt."},{"page_url":"https://pl.wikipedia.org/wiki/Mcensk","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/%D0%A0%D0%B0%D0%B9%D0%BE%D0%BD_%22%D0%92%22.jpg","page_title":"Mcensk","context_page_description":"Mcensk – miasto w Rosji, w obwodzie orłowskim, nad rzeką Zuszą. Ludność 47 807.\\nPo raz pierwszy wspomniany w 1147 jako gród księstwa czernihowskiego. W 1238 zdobyty przez Mongołów. Od 1320 należał do Wielkiego Księstwa Litewskiego. Pod koniec XV w. dwukrotnie najeżdżany przez wojska moskiewskie. Od 1505 w składzie Wielkiego Księstwa Moskiewskiego, a od 1547 w Rosji. W 1778 uzyskał prawa miejskie.\\nW ostatnich latach caratu w Rosji w więzieniu w Mcensku byli osadzeni komuniści Bonifacy Obiedziński i Feliks Dzierżyński."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Philippe_de_Saint-Philippe-d%27Aiguille","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/St_Philippe_d%27Aiguille_%C3%A9glise_Modillons_1.JPG","page_title":"Église Saint-Philippe de Saint-Philippe-d'Aiguille","context_page_description":"L'église Saint-Philippe est une église catholique. située dans la commune de Saint-Philippe-d'Aiguille, dans le département de la Gironde, en France."},{"page_url":"https://es.wikipedia.org/wiki/Watlington_(Oxfordshire)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d8/Watlington_townhall1.jpg","page_title":"Watlington (Oxfordshire)","context_page_description":"Watlington es una localidad situada en el condado de Oxfordshire, en Inglaterra, con una población estimada a mediados de 2016 de 2435 habitantes.​\\nSe encuentra ubicada al noroeste de la región Sudeste de Inglaterra, cerca de la frontera con las regiones Midlands del Este y Midlands del Oeste, de la ciudad de Oxford —la capital del condado—, del río Támesis, y al noroeste de Londres."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A4%CE%BF%CE%BB%CE%B9%CE%AC%CF%84%CF%84%CE%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f3/Conveyor_system_of_AvtoVAZ.jpg","page_title":"Τολιάττι","context_page_description":"Το Τολιάττι, είναι πόλη της Ρωσίας στην Περιφέρεια της Σαμάρα. Βρίσκεται στον ποταμό Βόλγα και έχει πληθυσμό 719.632, σύμφωνα με την απογραφή του 2010. Αποτελεί τη μεγαλύτερη πόλη της Ρωσίας που δεν είναι διοικητικό κέντρο κάποιου ομοσπονδιακού υποκείμενου της χώρας. Στο Τολιάττι έχει την έδρα της η αυτοκινητοβιομηχανία AvtoVAZ, η οποία παράγει τα Lada."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A1%D1%8C%D0%BB%D1%96%D0%B7%D0%B3%D0%B0%D0%BD%D1%8C%D0%BD%D0%B5_%D0%B0%D1%81%D1%8B%D0%BD%D1%85%D1%80%D0%BE%D0%BD%D0%BD%D0%B0%D0%B3%D0%B0_%D1%80%D1%83%D1%85%D0%B0%D0%B2%D1%96%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Asynch_01.png","page_title":"Сьлізганьне асынхроннага рухавіка","context_page_description":"Сьлізганьне асынхроннага рухавіка — адносная рознасьць хуткасьцяў кручэньня ротара і магнітнага струменя, стваранага абмоткамі статара рухавіка зьменнага току.\\nдзе — хуткасьць кручэньня ротара асынхроннага рухавіка\\n— хуткасьць кручэньня магнітнага струменя, так званая сынхронная хуткасьць рухавіка.\\nдзе f — частасьць сеткі зьменнага току\\np — лік пар канцавосьсяў абмоткі статара.\\nЗ апошняй формулы відаць, што хуткасьць кручэньня рухавіка n практычна вызначаецца значэньнем яго сынхроннай хуткасьці, а апошняя пры стандартнай частасьці 50 Гц залежыць ад ліку пар канцавосьсяў: пры адной пары канцавосьсяў — 3000 аб/хв, пры дзьвюх парах — 1500 аб/хв, пры трох парах — 1000 аб/хв і г. д."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B1%DB%8C%DA%86%D8%A7%D8%B1%D8%AF_%DA%86%D8%A7%D9%88%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/FrancesFisherJaneSeymourRichardChavesSmall.jpg","page_title":"ریچارد چاوز","context_page_description":"ریچارد چاوز یک هنرپیشه اهل ایالات متحده آمریکا است."},{"page_url":"https://pl.wikipedia.org/wiki/Pa%C5%82ac_w_Koz%C5%82%C3%B3wce","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Koz%C5%82%C3%B3wka_Palace_-_Gallery_of_socrealism_-_05.JPG","page_title":"Pałac w Kozłówce","context_page_description":"Pałac w Kozłówce – zespół pałacowo-parkowy rodziny Zamoyskich, we wsi Kozłówka, która leży w północnej części województwa lubelskiego, 9 km na zachód od Lubartowa oraz ok. 2 km od dużej wsi Kamionka. Obecnie pałac jest siedzibą muzeum. Na południu miejscowości znajduje się Kozłowiecki Park Krajobrazowy. 16 maja 2007 roku zespół pałacowo-parkowy został wpisany na listę Pomników historii."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%9A%D1%80%D1%83%D0%B7%D0%B8%D0%BB%D0%B8%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/VistadeCRZ.jpg","page_title":"Крузилия","context_page_description":"Крузилия — Бразилиядағы муниципалитет, Минас-Жерайс штатында орналасқан. Оңтүстік және оңтүстік-батыс Минас-Жерайс мезорегионының құрамдас бөлігі болып табылатын Андреландия экономика-статистикалық микрорегионының құрамына кіреді.\\n2006 жылғы мәліметтер бойынша тұрғындарының саны 15 310 адамды құрайды. Алып жатқан жер аумағы 523,47 км² шамасында. Халық тығыздығы — 29,2 адам/км²."},{"page_url":"https://fr.wikipedia.org/wiki/Sceloporus_undulatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/EasternFenceLizard_Egg.png","page_title":"Sceloporus undulatus","context_page_description":"Sceloporus undulatus est une espèce de sauriens de la famille des Phrynosomatidae."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%A4%D7%A0%D7%95%D7%A8%D7%9E%D7%94_%D7%A9%D7%9C_%D7%91%D7%95%D7%A8%D7%91%D7%90%D7%A7%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Bourbaki_Panorama.jpg","page_title":"הפנורמה של בורבאקי","context_page_description":"הפנורמה של בורבאקי הוא ציור גדל-ממדים המוצג במעגל בתוך רוטונדה במרכז לוצרן שבשווייץ. נחשב לאחד השרידים הבודדים של סוגת אמנות ייחודית של הצגת תמונות פנורמה במעגל שרווחה במאה ה-19.\\nהציור, מעשי ידי הצייר השווייצרי אדואר קסטרה, נוצר לאורך שנת 1881 ומתאר את מפלתו של צבא המזרח הצרפתי בפיקודו של בורבאקי במלחמת צרפת–פרוסיה, עשר שנים קודם לכן.\\nהציור הוא עדות היסטורית באיכות תיעודית יוצאת דופן ונעשה על בסיס רישומים רבים שנוצרו במהלך המלחמה. הוא תיעוד חי של הפעולה ההומניטרית הראשונה של הצלב האדום השווייצרי, והנושא הבולט ואולי היחיד בו הוא סבלם העצום של החיילים והפצועים, שעברו את הגבול השווייצרי מורעבים וקפואים מקור. כדי להדגיש את הכאב, בחר קסטרה כמסגרת לציורו נוף חורפי לבן ועצוב, שטחים עצומים מכוסים שלג וטורים אינסופיים של חיילים.\\nהרוטונדה ובה הפנורמה של בורבאקי, נמצאת כיום בתוך קומפלקס מוזיאוני שהוקם סביבה בין השנים 1996–2000 וכלולים בו גם ספריית העיר לוצרן, מרכז ייעוץ סביבתי עירוני ופורום אקולוגי. קרן הפנורמה של בורבאקי, בעלת הקומפלקס ומי שמפעילה את המוזיאון, משכירה במתחם חמישה בתי קולנוע, מסעדה וחנויות, וכך נמנעת מהטלת עלויות התפעול על הקופה הציבורית."},{"page_url":"https://nl.wikipedia.org/wiki/Poldermolen_(Ophemert)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Molen_van_Wadenoijen%2C_fundament%2C_op_achtergrond_De_Steendert.jpg","page_title":"Poldermolen (Ophemert)","context_page_description":"De Poldermolen is een windmolen van het type grondzeiler. Hij is in 1888 gebouwd op de plaats van de in 1887 afgebrande molen aan de Lingedijk 131 in het dorp Wadenoijen in de Nederlandse provincie Gelderland. Vanwege de ongunstige ligging werd hij in 2010 verplaatst naar de Steendertse Uitweg in het natuurgebied De Steendert tussen Est en Ophemert. Hij heeft geen naam en wordt naar de functie poldermolen genoemd: hij werd gebruikt voor het bemalen van de dorpspolder.\\nDe molen is een houten achtkante poldermolen van het type grondzeiler op een gemetselde onderbouw, die thans op een betonnen fundering staat. Hij is uitgerust met een ijzeren scheprad dat een doorsnede heeft van 5,20 m en 40 cm breed is.\\nDe wiekenvorm is Oudhollands. De roeden hebben een lengte van 25 m. De ijzeren, geklonken potroeden zijn in 1992 vervangen door gelaste, stalen roeden. Het gevlucht wordt op de wind gezet met behulp van een kruirad. Op 27 oktober 2013 is tijdens het draaien een van de wieken afgebroken.\\nDe rietgedekte kap van de molen is voorzien van een zogenaamd Engels kruiwerk. De Vlaamse vang is voorzien van een vang- of wipstok.\\nDe gietijzeren bovenas uit 1867 is gegoten door de firma L.I."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9C%A8%EB%A6%AC_(%EB%B0%B4%EB%93%9C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Juli_%E2%80%93_Holsten_Brauereifest_2015_01.jpg","page_title":"율리 (밴드)","context_page_description":"율리는 독일의 록밴드이다."},{"page_url":"https://id.wikipedia.org/wiki/Kota_Bitung","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/LOGO_KOTA_BITUNG_SULAWESI_UTARA.png","page_title":"Kota Bitung","context_page_description":"Kota Bitung adalah salah satu kota di provinsi Sulawesi Utara. Kota ini memiliki perkembangan yang cepat karena terdapat pelabuhan laut yang mendorong percepatan pembangunan. Kota Bitung terletak di timur laut Tanah Minahasa. Wilayah Kota Bitung terdiri dari wilayah daratan yang berada di kaki gunung Dua Saudara dan sebuah pulau yang bernama Lembeh.\\nBanyak penduduk Kota Bitung yang berasal dari suku Sangir, sehingga kebudayaan yang ada di Bitung tidak terlepas dari kebudayaan yang ada di wilayah Nusa Utara tersebut. Kota Bitung merupakan kota industri, khususnya industri perikanan."},{"page_url":"https://id.wikipedia.org/wiki/Kota_Bitung","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/LOGO_KOTA_BITUNG_SULAWESI_UTARA.png","page_title":"Kota Bitung","context_page_description":"Kota Bitung adalah salah satu kota di provinsi Sulawesi Utara. Kota ini memiliki perkembangan yang cepat karena terdapat pelabuhan laut yang mendorong percepatan pembangunan. Kota Bitung terletak di timur laut Tanah Minahasa. Wilayah Kota Bitung terdiri dari wilayah daratan yang berada di kaki gunung Dua Saudara dan sebuah pulau yang bernama Lembeh.\\nBanyak penduduk Kota Bitung yang berasal dari suku Sangir, sehingga kebudayaan yang ada di Bitung tidak terlepas dari kebudayaan yang ada di wilayah Nusa Utara tersebut. Kota Bitung merupakan kota industri, khususnya industri perikanan."},{"page_url":"https://ja.wikipedia.org/wiki/ORTF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/GD-FR-Paris-Maison_de_la_Radio.jpg","page_title":"ORTF","context_page_description":"ORTFは、かつて存在したフランスの国営テレビ・ラジオ局である。"},{"page_url":"https://en.wikipedia.org/wiki/Bechtel","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Annotatedsmallcurtisjpg.jpeg","page_title":"Bechtel","context_page_description":"Bechtel Corporation is an American engineering, procurement, construction, and project management company, founded in San Francisco, California, and headquartered in Reston, Virginia. It is the largest construction company in the United States and the 11th-largest privately owned American company in 2018."},{"page_url":"https://lv.wikipedia.org/wiki/Krievijas_pils%C4%93tu_uzskait%C4%ABjums","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Coat_of_Arms_of_Shelehov_%28Irkutsk_oblast%29.png","page_title":"Krievijas pilsētu uzskaitījums","context_page_description":"Šajā uzskatījumā apkopotas Krievijas pilsētas. Pašlaik Krievijā ir 1097 pilsētas. Visvairāk pilsētu Krievijā ir izveitojušās Krievijas Eiropas daļā. Saskaņā ar 2010. gada Tautas skaitīšanas datiem Krievijā ir 1100 apmetnes ar pilsētas statusu.\\nKrievijas pilsētu skaita salīdzinājums pa gadiem:"},{"page_url":"https://it.wikipedia.org/wiki/Le%C8%9Bcani","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Letcani_jud_Iasi.png","page_title":"Lețcani","context_page_description":"Lețcani è un comune della Romania di 6.805 abitanti, ubicato nel distretto di Iași, nella regione storica della Moldavia.\\nIl comune è formato dall'unione di 4 villaggi: Bogonos, Cogeasca, Cucuteni, Lețcani.\\nLeţcani fa parte della Zona Metropolitana di Iași.\\nNel territorio di Leţcani si trova la riserva naturale chiamata Fânețele seculare Valea lui David, un'area protetta di circa 46 ettari.\\ne una chiesa, a suo modo, unica in Europa: \\"La chiesa rotonda\\". Questo perché le sue fondamenta hanno una forma circolare con due navate: il portico e l'altare."},{"page_url":"https://ca.wikipedia.org/wiki/Giannino_Castiglioni","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Piazzetta_IV_Novembre_Lierna_Como_Lake.jpg","page_title":"Giannino Castiglioni","context_page_description":"Giannino Castiglioni més conegut com a Gio Castiglioni Milà, 4 agost de 1884 - Lierna, 27 agost de 1971) va ser un dels arquitectes, urbanistes, escultors i artistes italians més importants del segle XX.\\nEntre les excel·lències de les escultures de Castiglioni, apareixen models d'escala:"},{"page_url":"https://fr.wikipedia.org/wiki/English_As_She_Is_Spoke","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/English_As_She_Is_Spoke_p.50.jpg","page_title":"English As She Is Spoke","context_page_description":"English As She Is Spoke est le titre sous lequel est connu O Novo guia da conversação em portuguez e inglez, un guide de conversation luso-anglais publié initialement en 1855 à Paris par l'un des plus grands éditeurs en langue portugaise de l'époque, Jean-Pierre Aillaud, sous la signature d'un grammairien portugais réputé, José da Fonseca, et d'un apparent inconnu, Pedro Carolino. Le livre, épuisé et recherché, est republié en 1869 par le seul Carolino, sous le titre de New Guide of the Conversation in Portuguese and English, mais ne devient célèbre qu'après la publication quasi simultanée, en 1883, d'English As She Is Spoke, une élégante anthologie anglaise de ce texte, et d'une réimpression américaine du New Guide de 1869, préfacée par Mark Twain.\\nCet ouvrage est notoire pour sa drôlerie involontaire, due au fait que son ou ses auteurs ne parlaient manifestement pas l'anglais. Il a fait l'objet de plusieurs rééditions au XXIᵉ siècle. Son titre est devenu une expression proverbiale, employée pour désigner des efforts maladroits pour maîtriser les subtilités de la langue anglaise."},{"page_url":"https://it.wikipedia.org/wiki/Mesoplodon_europaeus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Cetacea_range_map_Gervais_Beaked_Whale.png","page_title":"Mesoplodon europaeus","context_page_description":"Il mesoplodonte di Gervais è un cetaceo odontoceto della famiglia Ziphiidae. È la specie di mesoplodonte che si spiaggia più frequentemente sulle coste del Nordamerica. Si è spiaggiata anche in Sudamerica e in Africa."},{"page_url":"https://en.wikipedia.org/wiki/RMS_Olympic","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/RMS_Olympic_Passenger_List_1923.jpg","page_title":"RMS Olympic","context_page_description":"RMS Olympic was a British ocean liner and the lead ship of the White Star Line's trio of Olympic-class liners. Unlike the other ships in the class, Olympic had a long career spanning 24 years from 1911 to 1935. This included service as a troopship during the First World War, which gained her the nickname \\"Old Reliable\\". She returned to civilian service after the war, and served successfully as an ocean liner throughout the 1920s and into the first half of the 1930s, although increased competition, and the slump in trade during the Great Depression after 1930, made her operation increasingly unprofitable.\\nOlympic was the largest ocean liner in the world for two periods during 1911–13, interrupted only by the brief tenure of the slightly larger Titanic, before she was then surpassed by SS Imperator. Olympic also retained the title of the largest British-built liner until RMS Queen Mary was launched in 1934, interrupted only by the short careers of her slightly larger sister ships.\\nThe Olympic was withdrawn from service and sold for scrap in 1935; demolition was completed in 1937."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%85%D9%88%D9%86%DA%AF_%D9%BE%DA%BE%D9%84%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Cacahuates_Japoneses.jpg","page_title":"مونگ پھلی","context_page_description":"مونگ پھلی خاندان فے بیسی سے ہے۔ جسے عام طور پر بین، پی یا لیگیوم خاندان۔\\nمانا جاتا ہے کہ کہ مونگ پھلی کو پہلی مرتبہ ملک پپراگوے کی وادیوں میں کاشت کیا گیا۔ یہ سالانہ کاشت کیے جانے والا پودہ ہے۔ اس پودے کی اونچائی 30 تا 50 سینٹی میٹر ہے۔"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D8%B5%D9%86_%D8%A7%D9%84%D9%82%D8%B5%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Aznalc%C3%A1zar_%28Sevilla%29.PNG","page_title":"حصن القصر","context_page_description":"حِصْن القَصْر هي مدينة وبلدية بمقاطعة إشبيلية بمنطقة الأندلس ذاتية الحكم بإسبانيا. بلغ عدد سكانها 4.003 نسمة عام 2008."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%97%D7%99%D7%90%D7%9C_%D7%A9%D7%9E%D7%99","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/53/Shemi_Gahazi_1940.jpg","page_title":"יחיאל שמי","context_page_description":"יחיאל שמי היה פסל וצייר ישראלי. כחבר בקבוצת \\"אופקים חדשים\\", הוביל שמי את המעבר מפיסול פיגורטיבי לפיסול מופשט בברזל. על יצירתו זכה שמי בפרס ישראל לפיסול לשנת 1986."},{"page_url":"https://et.wikipedia.org/wiki/Rakvere_tuuleveski","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Rakvere_tuuleveski.jpg","page_title":"Rakvere tuuleveski","context_page_description":"Rakvere tuuleveski on Hollandi tüüpi tuuleveski, mis asub Rakveres. Tuuleveski on arvele võetud ehitismälestisena.\\nRakvere tuuleveski on 19. sajandi algul ehitatud neljakorruseline Hollandi tüüpi veski. Tänaseks on hävinud tuuliku pea, kallerei ja sisseseade."},{"page_url":"https://ca.wikipedia.org/wiki/Ahmari%C3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/El-Wad_point.png","page_title":"Ahmarià","context_page_description":"L'ahmarià és una cultura del paleolític superior que es va desenvolupar al llevant mediterrani vers el 46.000-42.000 BP. Se l'ha relacionat amb la cultura emirana, també llevantina, i les cultures aurinyacianes europees primerenques.\\nLa paraula \\"ahmarià\\" prové del jaciment arqueològic d'Erq al-Ahmar, d'Israel. Erq al-Ahmar és un abric situat al desert de Judea, al nord de la falla que forma la Mar Morta, que va explorar i excavar pel prehistoriador francès René Neuville el 1951. La categoria \\"ahmarià\\" no va ser generalment reconeguda com a cultura arqueològica fins a la dècada de 1980; anteriorment se la coneixia com a \\"Fase II del Paleolític Superior\\" o \\"Fase B de Ksar Akil\\"."},{"page_url":"https://en.wikipedia.org/wiki/List_of_tallest_buildings_in_Rochester,_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/FirstFederalPlaza.jpg","page_title":"List of tallest buildings in Rochester, New York","context_page_description":"This list of tallest buildings in Rochester ranks high-rise buildings in the U.S. city of Rochester, New York by height. The tallest building in the city is the Xerox Tower, which rises 443 feet and was completed in 1968."},{"page_url":"https://zh.wikipedia.org/wiki/Littoraria_irrorata","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Littoraria_irrorata.jpg","page_title":"Littoraria irrorata","context_page_description":"Littoraria irrorata为玉黍螺科之下的一个生活于北美洲大西洋海岸与墨西哥湾岸咸水沼泽的物种，从麻省到德萨斯州皆有其踪影。旧属中腹足目蝾螺属，今已重新分类为高腹足类支序玉黍螺总科玉黍螺属。\\n本物种是少数已知会透过培殖真菌来为自己提供营养的软体生物物种之一。"},{"page_url":"https://fr.wikipedia.org/wiki/B%C3%A9gonia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/2010._%D0%92%D1%8B%D1%81%D1%82%D0%B0%D0%B2%D0%BA%D0%B0_%D1%86%D0%B2%D0%B5%D1%82%D0%BE%D0%B2_%D0%B2_%D0%94%D0%BE%D0%BD%D0%B5%D1%86%D0%BA%D0%B5_%D0%BD%D0%B0_%D0%B4%D0%B5%D0%BD%D1%8C_%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B0_86.jpg","page_title":"Bégonia","context_page_description":"Les bégonias sont des plantes à fleurs du genre Begonia qui représente la quasi-totalité de la famille des Bégoniacées, avec plus de 1 800 espèces. Celles-ci sont la plupart du temps facilement reconnaissables à leurs feuilles asymétriques et aux fragiles fleurs à minuscule cœur jaune, parfois très dissemblables sur un même pied, selon qu'elles sont mâles ou femelles, puisque ce sont des plantes monoïques strictes ; tandis que les autres caractères apparaissent au contraire très variables d'une espèce à l'autre, tant la forme et la couleur du feuillage et des fleurs, que par le port ou la hauteur, qui s'échelonne de quelques centimètres à 3 ou 4 mètres. À ces espèces botaniques, il faut ajouter presque autant d'hybrides et de multiples cultivars horticoles.\\nLes bégonias sont principalement originaires des régions tropicales chaudes et humides d'Amérique du Sud et d'Amérique centrale, mais on trouve également des bégonias sauvages qui poussent en Afrique tropicale ou en Asie du Sud-Est."},{"page_url":"https://fr.wikipedia.org/wiki/C%C4%83be%C8%99ti","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Cabesti_jud_Bihor.png","page_title":"Căbești","context_page_description":"Căbești est une commune roumaine du județ de Bihor, en Transylvanie, dans la région historique de la Crișana et dans la région de développement Nord-Ouest."},{"page_url":"https://en.wikipedia.org/wiki/Marjoram","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Origanum_majorana_002.JPG","page_title":"Marjoram","context_page_description":"Marjoram is a somewhat cold-sensitive perennial herb or undershrub with sweet pine and citrus flavors. In some Middle Eastern countries, marjoram is synonymous with oregano, and there the names sweet marjoram and knotted marjoram are used to distinguish it from other plants of the genus Origanum. It is also called pot marjoram, although this name is also used for other cultivated species of Origanum."},{"page_url":"https://la.wikipedia.org/wiki/Fontaines-en-Duesmois","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Fontaines-en-Duesmois.jpg","page_title":"Fontaines-en-Duesmois","context_page_description":"Fontaines-en-Duesmois est commune Francicum 133 incolarum praefecturae Clivi Aurei in regione occidentali Burgundia."},{"page_url":"https://it.wikipedia.org/wiki/Storia_della_Catalogna","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Estelada_blava.svg","page_title":"Storia della Catalogna","context_page_description":"L'attuale territorio della Catalogna è stato occupato fin dal Medio Paleolitico. I Greci colonizzarono le coste della regione fino a quando, come il resto della penisola iberica, la Catalogna non divenne parte dell'Impero Romano, alla caduta del quale si insediarono i Visigoti. Successivamente, dal 718, i Califfato omàyyade conquistò la regione, che chiamarono, insieme alle altre parti della penisola iberica, al-Andalus. Tra il 760 e l'801, anno della conquista di Barcellona, l'Impero carolingio la strappò ai Mori. Durante il tardo medioevo, si cominciò a sviluppare, con una sempre più marcata indipendenza dall'impero carolingio, una cultura Catalana, sotto l'egemonia della contea di Barcellona, la principale tra le contee in cui era stata divisa.\\nCon il matrimonio tra Raimondo Berengario IV di Barcellona e Petronilla di Aragona la contea di Barcellona si unì dinasticamente al regno di Aragona, per cui la Catalogna divenne la base navale della Corona d'Aragona, mentre la Contea di Barcellona e le altre contee catalane adottarono un'entità politica comune conosciuta come Principato di Catalogna, che sviluppò un sistema istituzionale che limitava il potere reale."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%A1%D7%99_%D7%91%D7%99%D7%A8%D7%90%D7%95%D7%AA","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fb/Walraversijde53.jpg","page_title":"פסי ביראות","context_page_description":"פַּסֵי בֵּירָאוֹת היא תקנה הלכתית בהלכות ערובין המיועדת להתיר שאיבת מים מבאר ציבורית בשבת לבהמות עולי הרגל הנמצאים בדרכם לבית המקדש וחונים בשטח פתוח על ידי הקפת הבאר במחיצות מינימליות. כיום היתר זה אינו תקף היות שאין עלייה לרגל לבית מקדש. 'בֵּירָאוֹת' היא צורת ריבוי של 'בֵּירָא', בארמית 'באר'."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kirchengeb%C3%A4ude_in_Frankfurt_am_Main","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d0/Kalbach_Kirche.JPG","page_title":"Liste der Kirchengebäude in Frankfurt am Main","context_page_description":"Die Liste der Kirchengebäude in Frankfurt am Main enthält die Namen der etwa 180 christlichen Gotteshäuser in Frankfurt am Main, ihre Lage im Stadtgebiet und die Bauzeit. Weitergehende Informationen enthalten die Artikel der jeweiligen Kirchen. Außer den Kirchengebäuden sind auch Gemeindezentren mit Kirchsaal aufgeführt. Es gibt 77 evangelische, 67 katholische, etwa 25 weitere christliche Sakralbauten und neun inzwischen weltlich genutzte, ehemalige Gotteshäuser. Die unterschiedlichen Konfessionen sind vermerkt. Nähere Informationen enthält der Artikel Religionen in Frankfurt am Main. Eine weitere Tabelle enthält die abgegangenen Kirchen."},{"page_url":"https://fr.wikipedia.org/wiki/Jovan_Jovanovi%C4%87_Zmaj","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Jovan_Jovanovi%C4%87_Zmaj%2C_Novi_Sad.jpg","page_title":"Jovan Jovanović Zmaj","context_page_description":"Jovan Jovanović Zmaj est un poète lyrique du romantisme serbe. Il a été membre de l'Académie royale de Serbie."},{"page_url":"https://ro.wikipedia.org/wiki/Premiul_Oscar_pentru_cea_mai_bun%C4%83_actri%C8%9B%C4%83_%C3%AEn_rol_secundar","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Jolie.jpg","page_title":"Premiul Oscar pentru cea mai bună actriță în rol secundar","context_page_description":"Premiul Oscar pentru cea mai bună actriță în rol secundar este unul dintre premiile acordate actrițelor care lucrează în industria filmului în cadrul ceremoniei Premiilor Oscar. Premiul este acordat de Academy of Motion Picture Arts and Sciences și se decernează anual începând cu 1937."},{"page_url":"https://sv.wikipedia.org/wiki/Anicetus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Papa_Aniceto.jpg","page_title":"Anicetus","context_page_description":"Anicetus, född i Emesa i Syrien, död 16, 17 eller 20 april 166, 167 eller 168, var påve från omkring 157 fram till sin död. Han räknas som helgon i den romersk-katolska kyrkan, med 17 april som festdag."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Marburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Marburg_landgr%C3%A4fliche_Kanzlei_von_O.jpg","page_title":"Liste der Kulturdenkmäler in Marburg","context_page_description":"Die folgende Liste enthält die in der Denkmaltopographie ausgewiesenen Kulturdenkmäler auf dem Gebiet der Stadt Marburg, Landkreis Marburg-Biedenkopf, Hessen.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich zunächst an Stadtteilen und anschließend der Anschrift, alternativ ist sie auch nach der Bezeichnung oder der Bauzeit sortierbar.\\nGrundlage ist die Veröffentlichung der hessischen Denkmalliste, die auf Basis des Denkmalschutzgesetzes vom 5. September 1986 erstmals erstellt und seither laufend ergänzt wurde.\\nHinweis: Bisher ist im Rahmen der Denkmaltopographie nur der Band „Stadt Marburg II“ erschienen, der die Stadterweiterungen und Stadtteile ab dem 18. Jahrhundert enthält. Deshalb fehlen die Oberstadt und ihre ursprünglichen Vorstädte Ketzerbach, Grün und Weidenhausen.\\nDie Kulturdenkmäler der einzelnen Ortsteile sind in eigenen Listen enthalten:\\nListe der Kulturdenkmäler in Bauerbach\\nListe der Kulturdenkmäler in Bortshausen\\nListe der Kulturdenkmäler in Cappel\\nListe der Kulturdenkmäler in Cyriaxweimar\\nListe der Kulturdenkmäler in Dagobertshausen\\nListe der Kulturdenkmäler in Dilschhausen\\nListe der Kulturdenkmäler in Elnhausen"},{"page_url":"https://vi.wikipedia.org/wiki/Boten","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Boten-border.jpg","page_title":"Boten","context_page_description":"Boten là một thị trấn nhỏ nằm tại tỉnh Luangnamtha, Lào.\\nPhía bắc thị trấn là cửa khẩu Boten, thông thương sang tỉnh Vân Nam, Trung Quốc."},{"page_url":"https://ca.wikipedia.org/wiki/Albi_(Llenguadoc)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Albi_panorama_morning_Wikimedia_Commons.jpg","page_title":"Albi (Llenguadoc)","context_page_description":"Albi és una ciutat del departament del Tarn, a la regió de Migdia-Pirineus. Amb 51.199 habitants, és cap de la comarca de l'Albigès. Els seus habitants es diuen en català albigesos.\\nLa ciutat episcopal, situada al centre històric d'Albi, al voltant de la catedral, fou proclamada Patrimoni de la Humanitat per la Unesco el 2010."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%A7%D9%83_%D8%B1%D9%88%D8%B3%D9%8A_(%D9%83%D8%A7%D8%AA%D8%A8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Norilsk_02.jpg","page_title":"جاك روسي (كاتب)","context_page_description":"جاك روسي ‏ هو كاتب بولندي وفرنسي، ولد في 10 أكتوبر 1909 في فروتسواف في بولندا، وتوفي في 30 يونيو 2004 في باريس في فرنسا."},{"page_url":"https://pl.wikipedia.org/wiki/%C3%89triac","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Etriac_%C3%89glise_2012.JPG","page_title":"Étriac","context_page_description":"Étriac – miejscowość i gmina we Francji, w regionie Nowa Akwitania, w departamencie Charente.\\nWedług danych na rok 1990 gminę zamieszkiwało 175 osób, a gęstość zaludnienia wynosiła 18 osób/km²."},{"page_url":"https://es.wikipedia.org/wiki/Karl_Klasen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Hermann_Josef_Abs_-_mit_Klasen_und_Ulrich_12.4.1967.jpg","page_title":"Karl Klasen","context_page_description":"Karl Klasen fue un jurista alemán y fue presidente del Bundesbank de 1970 a 1977. Fue jefe conjunto de Deutsche Bank de 1967 a 1969.\\nDatos: Q1731927"},{"page_url":"https://en.wikipedia.org/wiki/Margaret_O%27Brien","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Jane-Eyre-1943-2.jpg","page_title":"Margaret O'Brien","context_page_description":"Margaret O'Brien is an American film, radio, television, and stage actress. Beginning a prolific career as a child actress in feature films for Metro-Goldwyn-Mayer at the age of four, O'Brien became one of the most popular child stars in cinema history and was honored with a Juvenile Academy Award as the outstanding child actress of 1944. In her later career, she appeared on television, on stage, and in supporting film roles."},{"page_url":"https://ca.wikipedia.org/wiki/Aur%C3%B3_negre","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Aur%C3%B3_negre_%28Acer_monspessulanum%29_acabat_de_n%C3%A9ixer_-_Santa_Perp%C3%A8tua_de_Gai%C3%A0.jpg","page_title":"Auró negre","context_page_description":"L'auró negre és una espècie d'arbre poc alt del gènere Acer originari del sud d'Europa, al llarg de la costa mediterrània."},{"page_url":"https://vi.wikipedia.org/wiki/Necyria_bellona","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Illustrations_of_new_species_of_exotic_butterflies_Erycina_%26_Necyria.jpg","page_title":"Necyria bellona","context_page_description":"The Bellona Metalmark là một loài bướm thuộc họ Riodinidae. Loài này có ở most của Nam Mỹ."},{"page_url":"https://nl.wikipedia.org/wiki/Phyllidia_carlsonhoffi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Phyllididae_-_Phyllidia_carlsonhoffi.jpg","page_title":"Phyllidia carlsonhoffi","context_page_description":"Phyllidia carlsonhoffi is een slakkensoort uit de familie van de Phyllidiidae. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1993 door Brunckhorst."},{"page_url":"https://pl.wikipedia.org/wiki/Zasilacz_komputera","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/PC-PowerSupply-Principle-Circuit.svg","page_title":"Zasilacz komputera","context_page_description":"Zasilacz komputera − urządzenie służące do przetwarzania napięcia przemiennego dostarczanego z sieci energetycznej na niskie stabilizowane napięcia stałe, niezbędne do pracy pozostałych komponentów komputera.\\nNiektóre zasilacze posiadają przełącznik zmieniający napięcie wejściowe pomiędzy 230 V i 115 V, inne mogą pracować w szerokim zakresie napięcia zasilania.\\nZasilacze komputerów są zasilaczami impulsowymi.\\nNajczęściej spotykane zasilacze komputerowe są zgodne ze standardem ATX. Standard określa kształt wtyczek, dostarczane napięcia, dopuszczalne natężenie prądu. Włączanie i wyłączenie zasilacza jest realizowane przez sygnał elektryczny z płyty głównej, co daje obsługę takich funkcji jak tryb czuwania, zdalne włączanie i wyłączanie komputera. Najnowsza wersja standardu ATX dla zasilaczy to 2.31."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A1%CE%BF%CE%B4%CF%8C%CF%80%CE%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Bulgaria_Gela_03.jpg","page_title":"Ροδόπη","context_page_description":"Η Ροδόπη είναι οροσειρά στη Νοτιοανατολική Ευρώπη με 83% της έκτασής της στη νότια Βουλγαρία και το υπόλοιπο στην Ελλάδα. Η ψηλότερη κορυφή της, Γκολιάμ Πέρελικ, είναι το έβδομο ψηλότερο βουνό της Βουλγαρίας. Η ψηλότερη κορυφή της στην Ελλάδα είναι η Δελημπόσκα. Η οροσειρά δίνει το όνομά της στη χερσαία οικοπεριοχή \\"Μεικτά δάση Ορους Ροδόπης\\", που ανήκει στο Μεγαοικοσύστημα \\"Εύκρατών δασών πλατύφυλλων και μεικτών\\" και στην Παλαιαρκτική οικοζώνη. Η περιοχή είναι ιδιαίτερα αξιοσημείωτη για τις καρστικές εκτάσεις της με τα βαθειά φαράγγια ποταμών, μεγάλα σπήλαια και ιδιόμορφα λαξευμένες μορφές, όπως το Φαράγγι Τρίγκραντ.\\nΣημαντικό μέρος των υδροηλεκτρικών πόρων της Βουλγαρίας βρίσκεται στις δυτικές περιοχές της οροσειράς. Υπάρχουν πολλές υδατοπτώσεις και φράγματα, που χρησιμοποιούνται για την παραγωγή ηλεκτρικής ενέργειας, άρδευση και ως τουριστικοί προορισμοί. Στην Ελλάδα υπάρχουν αντίστοιχα στον Ποταμό Νέστο τα φράγματα Θησαυρού και Πλατανόβρυσης. Η Ροδόπη έχει πλούσια πολιτιστική κληρονομιά, αρχαίες Θρακικές πόλεις, όπως το Περπερικόν, το Τατούλ και το Μπελίντας, και μεσαιωνικά κάστρα, εκκλησίες, μοναστήρια και γραφικά χωριά με παραδοσιακή αρχιτεκτονική του 18ου και 19ου αιώνα."},{"page_url":"https://tr.wikipedia.org/wiki/Tebriz","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Carpet_Bazaar_of_Tabriz.JPG","page_title":"Tebriz","context_page_description":"Tebriz, İran'da Doğu Azerbaycan Eyaleti'nin yönetim merkezi olan şehir. Tebriz İran'ın kuzey batısındaki en büyük şehirdir aynı zamanda bir Türk şehridir.\\nAynı zamanda eyaletin aynı isimli Tebriz şehristanı'nın da yönetim merkezi olan şehrin 2006 yılı resmî nüfusu 1,773,033\\nŞehir nüfusunun çoğunluğunu Azerbaycan Türkleri oluşturur. Halkın dili Azericedir. Nüfus açısından İran’ın Tahran, Meşhed ve İsfahan'dan sonra dördüncü en büyük şehridir. Sanayi bakımından İran’ın ikinci şehridir."},{"page_url":"https://eo.wikipedia.org/wiki/Man%C4%9Du%C5%9Drio","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Manjusri_Kumara_%28bodhisattva_of_wisdom%29%2C_India%2C_Pala_dynesty%2C_9th_century%2C_stone%2C_Honolulu_Academy_of_Arts.jpg","page_title":"Manĝuŝrio","context_page_description":"Manĝuŝrio estas bodisatvo asociita kun saĝo en Mahajano. En Tibeta budhismo, li estas ankaŭ yidam. Lia nomo signifas „Ĝentila Gloro“ en Sanskrito. Manĝuŝrio estas ankaŭ konata per sia pli kompleta nomo, Mañjuśrīkumārabhūta, laŭvorte, Manĝuŝrio, Ankoraŭ Junulo, aŭ tradukite, Princo Manĝuŝrio."},{"page_url":"https://de.wikipedia.org/wiki/Hannover","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Wangenheimpalais_building_Friedrichswall_Mitte_Hannover_Germany_04.jpg","page_title":"Hannover","context_page_description":"Hannover ist die Hauptstadt des Landes Niedersachsen. Der am Südrand des Norddeutschen Tieflandes an der Leine und der Ihme gelegene Ort wurde 1150 erstmals erwähnt und erhielt 1241 das Stadtrecht. Hannover war ab 1636 welfische Residenzstadt, ab 1692 Residenz Kurhannovers, ab 1814 Hauptstadt des Königreichs Hannover, nach dessen Annexion durch Preußen ab 1866 Provinzhauptstadt der Provinz Hannover und nach Auflösung Preußens im August 1946 wurde es Hauptstadt des Landes Hannover. Seit dessen Fusion mit den Freistaaten Braunschweig, Oldenburg und Schaumburg-Lippe im November 1946 ist Hannover niedersächsische Landeshauptstadt. Seit 1875 Großstadt, zählt es heute zu den 15 einwohnerreichsten Städten Deutschlands.\\nStadt und früherer Landkreis sind zu einem Kommunalverband besonderer Art, der Region Hannover, zusammengeschlossen, die der Metropolregion Hannover-Braunschweig-Göttingen-Wolfsburg angehört. Hannover ist ein europäisches Verkehrsdrehkreuz, denn in und bei Hannover kreuzen sich wichtige Straßen- und Schienenwege der Nord-Süd- und Ost-West-Richtung."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Terrell_County,_Texas","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Meyers_Springs_Pictograph_Site.JPG","page_title":"National Register of Historic Places listings in Terrell County, Texas","context_page_description":"This is a list of the National Register of Historic Places listings in Terrell County, Texas.\\nThis is intended to be a complete list of properties and districts listed on the National Register of Historic Places in Terrell County, Texas. There are four properties listed on the National Register in the county.\\nThis National Park Service list is complete through NPS recent listings posted November 15, 2019."},{"page_url":"https://it.wikipedia.org/wiki/Dassault_Rafale","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Rafale-060427-N-2959L-196.jpg","page_title":"Dassault Rafale","context_page_description":"Il Dassault Rafale è un aereo da caccia multiruolo francese prodotto dalla Dassault Aviation. È caratterizzato da un'ala a delta e da alette canard, ha una coppia di motori turbofan Snecma M88-2 montati nella sezione di coda e un'unica e ampia deriva. È stato progettato per essere utilizzato sia dall'aeronautica militare francese sia dall'aviazione di marina come aereo imbarcato, da qui il termine omnirole utilizzato dalla Dassault Aviation per definire il velivolo. È destinato anche all'esportazione, e molti paesi stranieri hanno dimostrato interesse verso il Rafale, tra cui l'India che nel 2012 è entrata in negoziazione esclusiva con Dassault Aviation per l'acquisto di 126 velivoli per un valore di circa 12 miliardi di dollari."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%92%D0%B5%D1%82%D1%80%D1%83%D0%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Wettrup_in_EL.svg","page_title":"Ветруп","context_page_description":"Ветруп општина је у њемачкој савезној држави Доња Саксонија. Једно је од 60 општинских средишта округа Емсланд. Према процјени из 2010. у општини је живјело 563 становника. Посједује регионалну шифру 3454059."},{"page_url":"https://fi.wikipedia.org/wiki/Rob_Lowe","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Rob_Lowe_2012_Shankbone_2.JPG","page_title":"Rob Lowe","context_page_description":"Robert Lowe on yhdysvaltalainen näyttelijä, joka parhaiten tunnetaan roolistaan televisiosarjassa West Wing. Hän näytteli myös vuoden 1983 elokuvassa Outsiders – kolmen jengi, joka perustuu S.E. Hintonin kirjaan.\\nLowe meni naimisiin vuonna 1991 Sheryl Berkoffin kanssa ja parilla on kaksi lasta, Edward Matthew ja John Owen.\\nHän kieltäytyi Greyn Anatomiassa yhden päähenkilön, Derek Shephardin roolista, jonka sittemmin sai Patrick Dempsey. Lowe näytteli presidenttiehdokasta sarjassa Perhesiteet."},{"page_url":"https://de.wikipedia.org/wiki/Korund","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Corundum-159465.jpg","page_title":"Korund","context_page_description":"Der Korund ist ein relativ häufig vorkommendes Mineral aus der Mineralklasse der Oxide und Hydroxide. Er kristallisiert im trigonalen Kristallsystem mit der chemischen Zusammensetzung Al₂O₃ und ist damit chemisch gesehen Aluminiumoxid.\\nKorund stellt das Referenzmineral für die Mohshärte 9 auf der bis 10 reichenden Skala nach Friedrich Mohs dar. Er entwickelt meist lange, prismatische oder säulen- bis tonnenförmige Kristalle, aber auch körnige Aggregate, die je nach Verunreinigung verschiedene Farben aufweisen können. In chemisch reiner Form ist Korund farblos. Bekannte Varietäten mit gleicher Zusammensetzung und Kristallstruktur sind der Rubin und der Saphir.\\nDie Oberflächen der durchscheinenden bis durchsichtigen Kristalle weisen einen glas- bis diamantartigen, oft etwas fettigen Glanz auf. Korund besitzt keine Spaltbarkeit, aber sehr vollkommene Absonderungen nach den Zwillingsflächen, die einen perlmuttartigen Glanz aufweisen. Aufgrund seiner Sprödigkeit bricht er wie Glas oder Quarz, wobei die Bruchflächen muschelig bis splitterig ausgebildet sind. Die größten bisher bekannten Korundkristalle erreichten eine Länge von etwa einem Meter und ein Gewicht von bis zu 152 kg."},{"page_url":"https://de.wikipedia.org/wiki/Gro%C3%9Fer_Wiesenknopf","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Sanguisorba_officinalis_flowerdiagram.png","page_title":"Großer Wiesenknopf","context_page_description":"Der Große Wiesenknopf, auch Groß-Wiesenknopf genannt, ist eine Pflanzenart aus der Gattung Wiesenknopf innerhalb der Familie der Rosengewächse. Sie ist in Eurasien weitverbreitet."},{"page_url":"https://fr.wikipedia.org/wiki/Rockwell_X-30","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/X-30_NASP_2.jpg","page_title":"Rockwell X-30","context_page_description":"Le X-30 NASP est un projet américain de lanceur orbital monoétage. Le programme est abandonné en 1993 avant la construction du premier prototype."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%82%A7%E3%83%AA%E3%83%BC%E3%83%BB%E3%83%9E%E3%83%AA%E3%82%AC%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Gerry_Mulligan_by_Erling_Mandelmann.jpg","page_title":"ジェリー・マリガン","context_page_description":"ジェリー・マリガンはアメリカのジャズ・ミュージシャン、作曲家、編曲家。ジャズ界では数少ないバリトン・サックス奏者であり、ピアニストとしても知られる。"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%DA%AF%D8%B3%E2%80%8C%DA%AF%DB%8C%D8%B1_%D9%86%D9%88%DA%A9%E2%80%8C%D9%BE%D9%87%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Myiagra_ruficollis_mimikae_3.jpg","page_title":"مگس‌گیر نوک‌پهن","context_page_description":"مگس‌گیر نوک‌پهن نام یک گونه از سرده مگس‌گیرهای نوک‌پهن است."},{"page_url":"https://ca.wikipedia.org/wiki/Harmen_Hals","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Harmen_hals-reunion_de_campesinos.jpg","page_title":"Harmen Hals","context_page_description":"Harmen Hals fou un pintor barroc neerlandès.\\nFill primogènit de Frans Hals i de la seva primera esposa, Anneke Harmensdr., va ser batejat el 2 de setembre de 1611. Com el seu germà Frans i els seus germanastres Johannes, Reynier i Nicolaes, es deuria haver format en el taller patern. Com els seus germans Johannes i Frans II, era bo per la música i la pintura. Consta que va formar part del gremi de Sant Lluc encara que es desconeix la data del seu ingrés. De 1642 a 1645 va residir a Vianen i va passar alguna temporada a Amsterdam, Gorinchem i Noordeloos. Va ser enterrat el 15 de febrer de 1669 en el cementiri de St. Anne de Haarlem.\\nPita escenes de gènere i algun retrat. En general, es tracta d'escenes festives protagonitzades per camperols a la fonda entregats a la música i al vi amb un nombre reduït de figures de gran grandària, a l'estil d'Adriaen Brouwer i Jan Miense Molenaer."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_monuments_de_les_Corts","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Est%C3%A0tua_exterior_C_de_Josep_Llimona_%28Palau_de_Pedralbes%29.jpg","page_title":"Llista de monuments de les Corts","context_page_description":"Llista de monuments del districte de les Corts inclosos en l'Inventari del Patrimoni Arquitectònic Català i en el catàleg de Patrimoni Arquitectònic de Barcelona."},{"page_url":"https://en.wikipedia.org/wiki/Tarkhun","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/TarkhunSogdianCoin.jpg","page_title":"Tarkhun","context_page_description":"Tarkhun was a Sogdian ruler of Samarkand from somewhere 705-707 to 710. After receiving the news of the capture of Bukhara by the Umayyad general Qutayba ibn Muslim in 709, Tarkhun sent envoys to the latter and acknowledged the authority of the Umayyad Caliphate. However, one year later, Tarkhun was overthrown by a local rebellion because of his pro-Muslim policy, and was succeeded by another Sogdian prince named Gurak, who had Tarkhun imprisoned. Tarkhun shortly after committed suicide. His two sons, however, managed to flee to the court of another Sogdian ruler named Divashtich at Panjikant, where they were treated honorably.\\nNote:\\nDuring the years of Shenlong, Ninieshishi died. And his son Tarkhun was put on the throne."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B8%D1%87-408","image_url":"https://upload.wikimedia.org/wikipedia/ru/2/24/Moskvitch-412-rear.jpg","page_title":"Москвич-408","context_page_description":"Москви́ч-408 — советский заднеприводный автомобиль II группы малого класса с кузовом типа «четырёхдверный седан». Существовали связанные модели с кузовами «пятидверный универсал» — «Москвич-426», и фургон — «Москвич-433», а также многочисленные модификации.\\nВыпускался в Москве на заводе МЗМА с августа-сентября 1964 года по декабрь 1975 года. С 1964 по 1967 год он был основной моделью завода, после чего его сменил в этой роли «Москвич-412», хотя и после этого они ещё долго выпускались параллельно. Также он выпускался в Ижевске с 1966 по 1967 год, там было собрано лишь около 4000 автомобилей этой модели, после чего Ижевский завод, в отличие от МЗМА-АЗЛК, полностью перешёл на выпуск модернизированной модели «Москвич-412».\\n«Москвич-408» — родоначальник третьего поколения автомобилей «Москвич». Существовала также «переходная» модель от второго поколения к третьему — «Москвич-403», которая сочетала кузов и двигатель предыдущего поколения с основными техническими элементами будущей модели «408», она выпускалась с 1962 по 1965 год, с какого-то момента параллельно с М-408."},{"page_url":"https://en.wikipedia.org/wiki/Bigg_Boss_(Hindi_season_8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Salman_Khan_BSE11.jpg","page_title":"Bigg Boss (Hindi season 8)","context_page_description":"Bigg Boss 8, which merged into Bigg Boss Halla Bol!, was the eighth season of the Indian reality television series Bigg Boss, which premiered on TV channel Colors from 21 September 2014 and concluded on 3 January 2015 with five final contestants. Bigg Boss is the Indian edition of Big Brother. Salman Khan returned as the host of the series for the fifth time and Snapdeal was chosen to be the new presenting sponsor after the end of Colors' five-year deal with Vodafone India for the series.\\nAfter the finale of season with five champions, Bigg Boss Halla Bol! a spin-off was launched on 4 January. It merged into the regular series and continued in the same house. Five contestants from previous seasons entered the house to compete with five crowned regular entrants of the season finale. Farah Khan was appointed as the new host as Salman bid adieu due to his filming schedule of Bajrangi Bhaijaan."},{"page_url":"https://ast.wikipedia.org/wiki/Hitoshi_Ashida","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/AshidaH_kao.png","page_title":"Hitoshi Ashida","context_page_description":"Hitoshi Ashida foi un políticu xaponés que trabayó como'l Primer Ministru de Xapón ente'l 10 de marzu y el 15 d'ochobre 1948. Foi una figura prominente nel escenariu políticu de la posguerra, pero foi forzáu a arrenunciar les sos responsabilidaes como líder tres un escándalu de corrupción qu'implicaba a dos ministros del so gabinete.\\nAsumió'l cargu de Primer Ministru en 1948, baxo un gobiernu de coalición de demócrates y socialistes. Mientres el so periodu al frente del gobiernu xaponés, Ashida fixo una enmienda al artículu 9 de la constitución xaponesa, lo cual sería un elementu clave que darréu dexaría la creación de les Fuercies d'Autodefensa de Xapón. Sicasí, el so gobiernu terminó a los siete meses de formase, al atopase que dos ministros del so gabinete fueron acusaos de corrupción nel escándalu de Showa Electric, y nun tuvo más opción que l'arrenunciu del gabinete."},{"page_url":"https://fr.wikipedia.org/wiki/Voie_verte_Trans-Ardennes","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Montherme1.JPG","page_title":"Voie verte Trans-Ardennes","context_page_description":"La voie verte Trans-Ardennes est une piste cyclable utilisant les anciens chemins de halage le long de la Meuse, de Givet à Mouzon. La partie de Givet à Charleville-Mézières a été ouverte en 2008. Elle a été élue « Piste cyclable Européenne 2010 » par le jury du salon néerlandais « Fiets en Wandelbeurs ». En 2016 cette voie verte a été prolongée de 38 km jusqu’à Remilly-Aillicourt, au sud de Sedan. Des travaux de prolongement de 9,7 km jusque Mouzon sont en cours. L'achèvement est prévu pour 2018 pour un total de 130 km."},{"page_url":"https://fr.wikipedia.org/wiki/Nordin_Amrabat","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Nabil_El_Zhar.jpg","page_title":"Nordin Amrabat","context_page_description":"Noureddine Amrabat — nom couramment retranscrit en français Nordin Amrabat — né le 31 mars 1987 à Naarden aux Pays-Bas, est un footballeur international marocain évoluant au poste d'ailier ou de milieu offensif avec le club d'Al-Nasr Riyad dans le championnat saoudien. Il possède également la nationalité néerlandaise.\\nFormé aux Pays-Bas dans le club amateur du HSV Zuidvogels, il passe quatre ans dans l'académie de l'Ajax Amsterdam, avant d'être formé au SV Huizen. Il fait ses débuts professionnels en deuxième division néerlandaise avec le FC Omniworld. Considéré comme l'un des plus grands joueurs de deuxième division, il est transféré au VVV-Venlo en Eredivisie avant de continuer sur sa lancée au PSV Eindhoven où il se révélera dans le championnat néerlandais. Il est transféré en 2011 au Kayserispor pendant une saison avant de rejoindre le Galatasaray SK. Avec ce dernier, il remporte le championnat de Turquie en 2013. Le joueur fera plusieurs passage dans plusieurs clubs européens tels que le Malaga CF, le Watford FC ou encore le CD Leganés.\\nQuant à sa carrière internationale, il est naturalisé Marocain en 2011 après avoir honoré sept sélections avec les Pays-Bas espoirs."},{"page_url":"https://pl.wikipedia.org/wiki/Agrostophyllinae","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Agrostophyllum_philippinense_by_Ronny_Boos.jpeg","page_title":"Agrostophyllinae","context_page_description":"Agrostophyllinae – podplemię roślin z rodziny storczykowatych. Obejmuje trzy rodzaje i 122 gatunki. Rośliny występują głównie na terenie Azji Południowo-Wschodniej. Kilka rodzajów występuje także na przykład na Madagaskarze, Nowej Zelandii oraz na wyspach Pacyfiku."},{"page_url":"https://pt.wikipedia.org/wiki/Tom_Keifer","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Tom_keifer.JPG","page_title":"Tom Keifer","context_page_description":"Tom Keifer, é o vocalista, compositor, guitarrista, saxofonista e tecladista do Cinderella."},{"page_url":"https://en.wikipedia.org/wiki/Wandsworth_Shield","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/British_Museum_Battersea_Shield.jpg","page_title":"Wandsworth Shield","context_page_description":"The Wandsworth Shield is a circular bronze Iron Age shield boss or mount decorated in La Tène style which was found in the River Thames at Wandsworth in London sometime before 1849. Another incomplete bronze shield mount, sometimes called the Wandsworth Mask Shield was found at the same time. Both shield mounts are now held at the British Museum. The bold repoussé decoration on the Wandsworth Shield, comprising two birds with outstretched wings and long trailing tail feathers, has led Barry Cunliffe, Emeritus Professor of European Archaeology at the University of Oxford, to consider the shield to be \\"among the masterpieces of British Celtic art\\"."},{"page_url":"https://eo.wikipedia.org/wiki/Historio_de_Unui%C4%9Dinta_Re%C4%9Dlando","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b5/Palmerston.jpg","page_title":"Historio de Unuiĝinta Reĝlando","context_page_description":"Unuiĝinta Reĝlando de Granda Britio kaj Norda Irlando estas okcidenteŭropa ŝtato komuniganta Anglion, Skotlandon, Kimrion, kiuj troviĝas sur la insulo Granda Britio, kaj Nordan Irlandon. Dum pli ol cent jaroj ĝi ensumigis ankaŭ tutan Irlandon.\\nTiu ĉi artikolo okupiĝas pri la historio de tiu ĉi ŝtata formacio."},{"page_url":"https://simple.wikipedia.org/wiki/Starstreak_(missile)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Starstreak_launcher_on_Dartmoor.jpg","page_title":"Starstreak (missile)","context_page_description":"Starstreak is a British short range surface-to-air missile. It is made by Thales Air Defence, in Belfast. It is also known as Starstreak High Velocity Missile, or Starstreak HVM. After it is launched, the missile travels at about Mach 3. Starstreak has been in service with the British Army since 1997.\\nStarstreak can be fired from a soldier's shoulder or from the Stormer armoured vehicle.\\nStarstreak can travel 1,500 metres minimum and 5,5000 metres maximum."},{"page_url":"https://de.wikipedia.org/wiki/CCD-Sensor","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Delta-Doped_Charged_Coupled_Devices_%28CCD%29_for_Ultra-Violet_and_Visible_Detection.jpg","page_title":"CCD-Sensor","context_page_description":"CCD-Sensoren sind lichtempfindliche elektronische Bauelemente, die auf dem inneren Photoeffekt beruhen. „CCD“ ist hierbei die Abkürzung des englischen charge-coupled device, das im CCD-Sensor verwendet wird.\\nUrsprünglich wurden 1969 CCDs für die Datenspeicherung entwickelt. Jedoch wurde schnell bemerkt, dass diese Bauelemente lichtempfindlich sind und es vergleichsweise einfach ist, ein zweidimensionales Bild zu erfassen. Bereits 1970 wurde ein solcher CCD-Sensor gebaut, und durch die folgende Miniaturisierung in der Elektronik wurden schon 1975 die ersten CCDs mit einer für Fernsehkameras ausreichenden Anzahl an Bildpunkten hergestellt. Seit ca. 1983 werden CCD-Sensoren als Bildsensoren in der Astronomie und der Satellitenfernerkundung eingesetzt.\\nZweidimensionale CCD-Array-Sensoren werden in Videokameras und Digitalkameras, eindimensionale CCD-Zeilensensoren in Faxgeräten, Spektrometern und Scannern eingesetzt. In den Kameras von Smartphones und Tablets findet man hingegen normalerweise CMOS-Sensoren.\\nFür die Erfindung des CCD-Sensors wurden Willard Boyle und George E."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%AF%86%E8%98%87%E9%87%8C%E5%B7%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/St_Louis_night_expblend.jpg","page_title":"密蘇里州","context_page_description":"密蘇里州是美國第24個州，一般被劃分在中西部地區之內。州鳥是東藍鴝，州歌「密蘇里華爾茲」，州花為山楂花。"},{"page_url":"https://cs.wikipedia.org/wiki/Olympus_E-420","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Olympus_E-420_%28back%29.jpg","page_title":"Olympus E-420","context_page_description":"Olympus E-420 je kompaktní digitální zrcadlovka systému 4/3 standard firmy Olympus se snímačem o rozlišení 10 mpix. Fotoaparát podporuje objektivy Zuiko Digital.\\nPředstavena byla v březnu roku 2008 jako nástupce modelu Olympus E-410. Má nižší hmotnost a v době svého představení byl jednou z nejmenších DSLR vůbec.\\nE-420 používá systém Supersonic Wave Filter vyvinutý společností Olympus pro odstranění prachu a nečistot z povrchu snímače a technologii „živého náhledu“ scény na displeji. Přístroj může používat paměťové karty CompactFlash I/II, Microdrive nebo xD."},{"page_url":"https://pl.wikipedia.org/wiki/Lista_najwy%C5%BCszych_ratuszy","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Torontos_Old_City_Hall_2009.jpg","page_title":"Lista najwyższych ratuszy","context_page_description":"Lista najwyższych ratuszy – przez wieki budowle ratuszowe były świeckim odpowiednikiem kościołów zaliczając się do najbardziej prestiżowych budowli miejskich; ich zewnętrzna architektura, jeśli chodzi o wieże, często nawiązywała do sakralnej. Najwyższe wieże ratuszowe na świecie:"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%8A%80%E5%AD%94%E9%AF%9B%E5%B1%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Poromitra_unicornis.jpg","page_title":"犀孔鯛屬","context_page_description":"犀孔鯛屬為輻鰭魚綱奇鯛目大鱗鯛科的一屬魚類。"},{"page_url":"https://ms.wikipedia.org/wiki/Pekan_Cina,_Liverpool","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4a/Chinese_Arch%2C_Liverpool_-_scan01.jpg","page_title":"Pekan Cina, Liverpool","context_page_description":"Pekan Cina adalah kawasan Liverpool yang merupakan rumah etnik kepada masyarakat Cina tertua di Eropah. Terletak di selatan pusat bandar, Chinatown mempunyai banyak perniagaan Cina, seperti restoran dan pasaraya Cina, dan kemudahan untuk masyarakat Cina. Kawasan ini juga terkenal dengan senibina gaya Cina; dengan paifang di Nelson Street menjadi gerbong terbesar dan berkembar seumpamanya di luar China."},{"page_url":"https://ceb.wikipedia.org/wiki/Lasioglossum_semicaeruleum","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Lasioglossum_semicaeruleum.jpg","page_title":"Lasioglossum semicaeruleum","context_page_description":"Espesye sa buyog nga una nga gihulagway ni Cockerell ni adtong 1895 ang Lasioglossum semicaeruleum. Ang Lasioglossum semicaeruleum sakop sa kahenera nga Lasioglossum sa kabanay nga Halictidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://en.wikipedia.org/wiki/Xylosandrus_compactus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/5007016-PPT.jpg","page_title":"Xylosandrus compactus","context_page_description":"Xylosandrus compactus is a species of ambrosia beetle. Common names for this beetle include black twig borer, black coffee borer, black coffee twig borer and tea stem borer. The adult beetle is dark brown or black and inconspicuous; it bores into a twig of a host plant and lays its eggs, and the larvae create further tunnels through the plant tissues. These beetles are agricultural pests that damage the shoots of such crops as coffee, tea, cocoa and avocado."},{"page_url":"https://eu.wikipedia.org/wiki/Sudeteak","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Checoslovaquia1928-1938SinR%C3%ADos.svg","page_title":"Sudeteak","context_page_description":"Sudeteak Bohemia eta Silesia eskualdeen arteko mendikatea da. Gailurrik garaiena Sněžka mendia da, Txekiar Errepublika eta Poloniaren arteko mugan.\\nBaso ustiakuntza, nekazaritza, meatzaritza eta oihalgintza dira ekonomia jarduerak, beirazko eta portzelanazko lanekin batera. Txekiako printzeek XII. eta XIV. mendeetan eskulangileak eta meatzariak ekarri zituzten Alemaniatik eta han kokarazi. Harrezkero, txekiarren eta alemaniarren arteko gatazkak ugari izan dira Bohemiako historian.\\nSudeteetako alemaniarrak deitu izan dira Bohemiako, Moraviako eta Silesiako alemaniarrak, sudete deituak. Hitler-ek aginpidea eskuratuz gero, bertako germaniarrek autonomia lortu zuten eta, Konrad Heinlein buru zutela, 1938an beren lurraldea Alemaniaren mende gera zedin eskatu zuten. Urte hartako irailaren 29an, Munich-en Alemaniak, Italiak, Britainia Handiak eta Frantziak sinaturiko itunek gatazka ekarri zuten eta lurralde hura Alemaniaren mende geratu zen. 1945ean Potsdam-go itunen arabera, lurralde horiek Txekoslovakiari itzuli zitzaizkion eta Sudeteak egotzi zituzten handik."},{"page_url":"https://ca.wikipedia.org/wiki/Alfre_Woodard","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Alfre_Woodard_-_2019_02.jpg","page_title":"Alfre Woodard","context_page_description":"Alfre Woodard és una actriu i productora estatunidenca."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AE%D9%88%D8%A7%D9%86_%D9%84%D9%88%D8%A8%D9%8A%D8%B2_%D8%B3%D8%A7%D9%86%D8%B4%D9%8A%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Juan_L%C3%B3pez_Sanchez.jpg","page_title":"خوان لوبيز سانشيز","context_page_description":"خوان لوبيز سانشيز ‏ هو نقابي وسياسي إسباني، ولد في 16 يناير 1900 في بوياس في إسبانيا، وتوفي في 1972 في مدريد في إسبانيا. انتخب."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B1%D1%80%D0%B5%D1%83-%D0%B8-%D0%9B%D0%B8%D0%BC%D0%B0,_%D0%96%D0%BE%D0%B7%D0%B5_%D0%98%D0%BD%D0%B0%D1%81%D0%B8%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Jos%C3%A9_In%C3%A1cio_de_Abreu_e_Lima.jpg","page_title":"Абреу-и-Лима, Жозе Инасиу","context_page_description":"Жозе Инасиу Рибейру ди Абреу-и-Лима — военный и политический деятель из Бразилии, историк, журналист и писатель. Известен как генерал Абреу-и-Лима — один из сподвижников Симона Боливара в Войне за независимость испанских колоний в Латинской Америке."},{"page_url":"https://ca.wikipedia.org/wiki/Tetr%C3%A0edre","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Regular_tetrahedron_diagram.png","page_title":"Tetràedre","context_page_description":"Un tetràedre o tetraedre és un políedre que té quatre cares. Amb aquest nombre de cares ha de ser forçosament un políedre convex i les cares han de ser forçosament triangulars. En cadascun dels quatre vèrtexs es troben tres cares i té sis arestes. Hom pot considerar, també, que un tetràedre és una piràmide de base triangular.\\nSi les quatre cares del tetràedre són triangles equilàters, forçosament iguals entre si, el tetràedre es denomina regular. [Etimologia: Segle XVI: del grec tetraedron, tetra, 'quatre' i edron, 'cara']\\nEl tetràedre és el més simple de tots els políedres convexos, i l'únic que té menys de 5 cares. Com tots els políedres convexos, un tetràedre es pot doblegar a partir d'un full de paper. Admet dos d'aquests desenvolupaments plans.\\nEl tetràedre és el cas tridimensional del concepte més general d'un símplex euclidià.\\nDonat un tetràedre qualsevol, existeix una esfera que passa per tots els vèrtexs del tetràedre, i una altra esfera que és tangent a les cares del tetràedre."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A9%E3%83%A0%E3%82%BB%E3%82%B9%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Ramses_Station%2C_Cairo_01.JPG","page_title":"ラムセス駅","context_page_description":"ラムセス駅は、エジプトの首都カイロにあるエジプト鉄道のターミナル駅。駅名は古代エジプト王朝時代のファラオでアブ・シンベル神殿を建てるなどしたラムセス2世に由来し、1955年にはナセルによって駅前の広場にラムセス2世像が建てられた。\\nもともと当駅はミスル駅と呼ばれ、1856年にカイロとアレキサンドリアを結ぶ鉄道路線の終着駅として建設された。現在の駅舎は1892年に新たに建設されたもので、1955年に改築されている。また最近の駅前広場の整備を含む再改築は2013年末頃に完成し、一部共用を開始している。なおラムセス2世像は2006年8月25日に当駅前からナイル川を越えてギザへ移転され、現在はピラミッド地区のレマイヤ広場北側に建設中の大エジプト博物館敷地内、リングロード沿いに設置されている。\\n駅前には10月6日高架道が横断しているが、元々は市内側からの高架道は当駅前が終点であった。その後ヘリオポリス方面に延長されたが、メトロ2号線の駅躯体工事の際にはこの延長部分の橋脚が障害となり難工事となった。また、路面電車であるヘリオポリストラムの駅も現在の位置に移動した。駅の南北、およびインババ方面ホームとは駅構内の地下通路で連絡している。一方、メトロ1、2各線のショハーダ駅入り口は当駅正面の敷地外にあるため、連絡には駅建物を出る必要がある。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AC%D9%81%D8%AA%E2%80%8C%D8%B4%D8%AF%D9%86_%DA%AF%D9%84%DB%8C%D8%B3%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Glaser-Kupplung.png","page_title":"جفت‌شدن گلیسر","context_page_description":"جفت‌شدن گلیسر گونه‌ای از واکنش جفت‌شدن است که طی آن دو مولکول یکسان شامل گروه عاملی آلکین با جفت شدن تشکیل یک ترکیب متقارن شامل دو گروه آلکین را می‌دهد. این واکنش در حضور ترکیبات مس(I) مانند مس(I) کلرید و مس(I) برمید و یک عامل اکسنده صورت می‌گیرد. واکنش در محلولی از آب یا الکل صورت می‌گیرد. واکنش گلیسر نخستین بار در سال ۱۸۶۹ میلادی توسط کارل آندریاس گلیسر کشف و معرفی گردید.\\nدر سال ۱۸۸۲ میلادی شیمیدان آلمانی آدولف فون بایر موفق شد به وسیله این واکنش رنگ نیل را از سینامیک اسید تولید کند."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%84%D9%82%D8%AF%D9%8A%D8%B3%D8%A9_%D8%B5%D9%88%D9%81%D9%8A%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Hagia_Sophia_Mars_2013.jpg","page_title":"القديسة صوفيا","context_page_description":"القديسه صوفيا هي قديسه قبطيه مصريه،اشتهرت في العالم كله واتبنى لها كاتدرائيه عظيمه على اسمها هى كاتدرائية ايا صوفيا في عهد الامبراطور قسطنطين بالقسطنطينيه اتنقل جسدها لتتبارك القسطنطينيه بالقديسه وكانت الكاتدرائيه مقر لبطريركيه القسطنطينيه لاكن فى العهد العثمانى اتحولت لمسجد إسلامي وبعدها اتحولت الكاتدرئيه حاليا لمتحف باسم آجيا صوفيا او ايا صوفيا اللى معناها القديسة صوفيا في اسطنبول."},{"page_url":"https://ro.wikipedia.org/wiki/Channes","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e3/Map_commune_FR_insee_code_10079.png","page_title":"Channes","context_page_description":"Channes este o comună în departamentul Aube din nord-estul Franței. În 2009 avea o populație de 126 de locuitori."},{"page_url":"https://et.wikipedia.org/wiki/Sovetskaja_Gavan","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Flag_of_Sovietskaya_Gavan.gif","page_title":"Sovetskaja Gavan","context_page_description":"Sovetskaja Gavan on linn Venemaal Habarovski krais Jaapani mere rannikul.\\nAsula rajati 1853. aastal ja kandis esialgu nime Konstantinovski post. Alates 1856. aastast oli asula nimi Imperatorskaja Gavan. 1923–1930 oli asula nimi Znamenskoje. Praeguse nime sai Sovetskaja Gavan 1930. aastal ja linnaõigused 1941. aastal.\\nSovetskaja Gavan on sadamalinn, seal paiknevad laevaremonditehased."},{"page_url":"https://fr.wikipedia.org/wiki/Johann_Ender","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Ender_Az_MTA_alleg%C3%B3ri%C3%A1ja.jpg","page_title":"Johann Ender","context_page_description":"Johann Nepomuk Ender, né le 4 novembre 1793 à Vienne et mort le 16 mars 1854 dans cette même ville, est un peintre et graveur sur cuivre autrichien. Il est le frère jumeau de Thomas Ender et le père d'Eduard Ender, tous les deux peintres."},{"page_url":"https://en.wikipedia.org/wiki/Astrocaryum_aculeatissimum","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Astrocaryum_aculeatissimum.jpg","page_title":"Astrocaryum aculeatissimum","context_page_description":"Astrocaryum aculeatissimum is a palm native to Atlantic Coast restingas vegetation, which is an ecosystem of Atlantic Forest biome in Brazil. This plant has a commercial value because it has useful fibers which may be used to make production of brooms.\\nThe trunk of the tree is covered by rings of very sharp spines, believed by some biologists to have evolved as protection against the extinct Megatherium Giant Ground Sloth."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B8%D0%BF%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%8F_%D1%84%D0%BE%D1%80%D0%BC_%D0%B4%D1%80%D0%B5%D0%B2%D0%BD%D0%B5%D0%B3%D1%80%D0%B5%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D1%85_%D1%81%D0%BE%D1%81%D1%83%D0%B4%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Lekan%C3%ADs_-_MASP_330-320_BC.JPG","page_title":"Типология форм древнегреческих сосудов","context_page_description":"Типология форм древнегреческих сосудов представляет большое разнообразие. Форма древнегреческих сосудов соответствовала прикладному назначению и менялась почти до бесконечности, в зависимости от места и времени производства и личного вкуса производителя. Тем не менее некоторые формы были особенно распространёнными и любимыми и составляли особые разряды, имевшие каждый своё особое наименование. Античные писатели сохранили номенклатуру греческих сосудов, однако показания этих авторов столь неопределённые и путаные, что, основываясь на них и проверяя их по сохранившимся экземплярам, нельзя было прояснить многие детали. Несмотря на все это, благодаря трудам Панофки и работам других исследователей, названия большинства форм определены окончательно."},{"page_url":"https://de.wikipedia.org/wiki/Jo_Ambros","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Joambros.jpg","page_title":"Jo Ambros","context_page_description":"Jo Ambros ist ein deutscher Jazzmusiker und Gitarrist.\\nJo Ambros lernte Gitarre bei Philipp Konowski und hat an den Hochschulen für Musik in Würzburg und bei Werner Acker an der Musikhochschule Stuttgart Jazz- und Popularmusik studiert. Vom Deutschen Akademischen Austauschdienst erhielt er ein Stipendium für New York. Im Jahr 2001 war er Stipendiat der Kunststiftung Baden-Württemberg. Auf Einladung der Gesellschaft für Neue Musik Köln trat er im Rahmen des Wettbewerbs „Live und Elektronik“ mit dem Ensemble Modern auf. Des Weiteren spielt er zu surrealen Stummfilme mit den Schlagzeuger Jogi Nestel Live-Musik.\\nNeben Konzerten mit Helen Schneider, Marcia Haydée, Giora Feidman, Les McCann oder den Pointer Sisters, arbeitete er auch an Hörspielen, an Soundinstallationen mit der bildenden Künstlerin Eva Paulitsch und im Theaterbereich. 2004 erschien seine Solo-CD \\"wanderlust\\". Er ist auch auf den CDs „Reality Music“ von Torsten Krills frimfram collective zu hören. Mit dem dänisch-deutschen Jazz-Quartett mold spielte er 2002 die CD „republic of“ ein. Weitere CDs entstanden mit David Orlowsky's Klezmorim."},{"page_url":"https://hu.wikipedia.org/wiki/Nagypest%C3%A9nyi_reform%C3%A1tus_templom","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Biserica_Reformata_din_Pesteana.jpg","page_title":"Nagypestényi református templom","context_page_description":"A nagypestényi református templom műemlékké nyilvánított templom Romániában, Hunyad megyében. A romániai műemlékek jegyzékében a HD-II-m-A-03404 sorszámon szerepel."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%DB%8C%D9%86%D8%A7%D9%85%DB%8C%E2%80%8C%D8%A2%DB%8C%D8%B2%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Flag_of_Minamiaizu_Fukushima.JPG","page_title":"مینامی‌آیزو","context_page_description":"می‌نامی‌آیزو یک منطقهٔ مسکونی در ژاپن است که در استان فوکوشیما واقع شده‌است. می‌نامی‌آیزو ۸۸۶٫۵۲ کیلومتر مربع مساحت و ۱۶٬۵۱۶ نفر جمعیت دارد."},{"page_url":"https://fr.wikipedia.org/wiki/Pascal_Quignard","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Pascal_Quignard_le_5_avril_2013.jpg","page_title":"Pascal Quignard","context_page_description":"Pascal Quignard, né le 23 avril 1948 à Verneuil-sur-Avre, est un écrivain français. Il a été lauréat du prix Goncourt 2002 pour Les Ombres errantes, publié chez Grasset.\\nPar ailleurs violoncelliste, il a fondé le Festival d'opéra et de théâtre baroques de Versailles. L'un de ses livres les plus connus est certainement le court roman Tous les matins du monde, adapté au cinéma dès l'année de son édition par Alain Corneau."},{"page_url":"https://en.wikipedia.org/wiki/Christiaan_Huygens","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Adriaen_Hanneman_-_Constantijn_Huygens_and_his-five-children.png","page_title":"Christiaan Huygens","context_page_description":"Christiaan Huygens FRS, also spelled Huyghens, was a Dutch physicist, mathematician, astronomer and inventor, who is widely regarded as one of the greatest scientists of all time and a major figure in the scientific revolution. In physics, Huygens made groundbreaking contributions in optics and mechanics, while as an astronomer he is chiefly known for his studies of the rings of Saturn and the discovery of its moon Titan. As an inventor, he improved the design of the telescope with the invention of the Huygenian eyepiece. His most famous invention, however, was the pendulum clock in 1656, which was a breakthrough in timekeeping and became the most accurate timekeeper for almost 300 years. Huygens was an outstanding mathematician and, because he was the first to transfer mathematical inquiry to describe unobservable physical phenomena, he has been called the first theoretical physicist and the founder of modern mathematical physics.\\nIn 1659, Huygens was the first to derive geometrically the now standard formulae for the centripetal force and centrifugal force in his work De vi centrifuga. The formulae played a central role in classical mechanics."},{"page_url":"https://eo.wikipedia.org/wiki/Mikl%C3%B3s_Izs%C3%B3_(skulptisto)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Kisk%C5%91r%C3%B6s_Pet%C5%91fi_Izs%C3%B3.JPG","page_title":"Miklós Izsó (skulptisto)","context_page_description":"Miklós Izsó [miklOŝ iĵO], laŭ hungarlingve kutima sinsekvo Izsó Miklós estis hungara skulptisto, altlerneja instruisto. Li estis fondinto de la hungara ĝenroskulptado, signifa figuro de la 19-a jarcenta hungara nacia skulptoarto levanta ĝin al la eŭropa nivelo.\\nMiklós Izsó naskiĝis la 9-an de septembro 1831 en Disznóshorvát, li mortis la 29-an de majo 1875 en Budapeŝto."},{"page_url":"https://ca.wikipedia.org/wiki/Ternant_(Costa_d%27Or)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/Map_commune_FR_insee_code_21625.png","page_title":"Ternant (Costa d'Or)","context_page_description":"Ternant és un municipi francès, situat al departament de la Costa d'Or i a la regió de Borgonya - Franc Comtat. L'any 2007 tenia 96 habitants."},{"page_url":"https://ht.wikipedia.org/wiki/Haleburg_(Alabama)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Haleburg_Alabama.JPG","page_title":"Haleburg (Alabama)","context_page_description":"Haleburg (Alabama) se yon vil Etazini. Li sitye nan leta Alabama.\\nChèf-lye li se Henry."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%80%D5%A1%D5%BE%D5%A5%D6%80%D5%AA%D5%B8%D6%82%D5%A9%D5%B5%D5%A1%D5%B6_%D5%B0%D5%A1%D5%B5%D5%AF%D5%A1%D5%AF%D5%A1%D5%B6_%D5%B6%D5%B7%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Khachkar_from_Old_Djugha_1602_img_6950.jpg","page_title":"Հավերժության հայկական նշան","context_page_description":"Հավերժության հայկական նշան, հնագույն ազգային խորհրդանիշ և հայ ժողովրդի ազգային ինքնության խորհրդանշան։\\nՀավերժության նշանը հնագույն ազգային խորհդանիշ է և հանդիպում է հայ իրականությունում բազմապիսի դրսևորումներով։ Այն ծագում է սվաստիկայից և ունի հստակ հայկական մեկնաբանություն։ Այն ներկայացվում է որպես մի կետից ծագող աջ կամ ձախ պտույտ ունեցող կոր թևերով պատկեր ։ Ամենահին ներկայացումները հայտնաբերվել են հայկական բարձրավանդակի ժայռապատկերներում որպես Արեգակի պատկեր՝ անիվի կամ սվաստիկայի տեսքով։\\nՆշանը խորհրդանշում է լավի ու բարու մաղթանք, արև, կյանք, կրակ, կայծակ, պտղաբերություն և ծննդաբերություն, առաջընթաց և զարգացում։ Աջ և ձախ պտույտներին վերագրվում են ակտիվ և պասսիվ իմաստներ ու կարող են օգտագործվել այդ իմաստները նշելու համար։ Օրինակ, աջ պտույտի հավերժության նշանով զարդարված մանկական օրորոցը նախատեսվում է տղաների, իսկ ձախ պտույտի դեպքում՝ աղջիկների համար։ Հնարավոր են ինչպես երկչափ, այնպես էլ տարածական իրականացումներ։\\nՀավերժության նշանը որպես գրանշան ներառված է ArmSCII հիմնօրինակում և գրանշանների ցանկը սկսվում է հենց նրանով։ Հայկական տառատեսակների համակարգչային հավաքածուներում հավերժության հայկական գրանշանն օգտագործվում է 1987 թվականից՝ ArmSCII-ի գործարկման պահից ի վեր։"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D8%A7%D9%86%D8%AA%D9%88_%D8%A3%D9%86%D8%AA%D8%A7%D9%88_(%D8%A7%D9%84%D8%B1%D8%A3%D8%B3_%D8%A7%D9%84%D8%A3%D8%AE%D8%B6%D8%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Coastline_Santo_Antao.JPG","page_title":"سانتو أنتاو (الرأس الأخضر)","context_page_description":"سانتو أنتاو أكبر جزيرة من جزر جمهورية الرأس الأخضر، اسم الجزيرة يعني بالبرتغالية \\"القديس أنتونيوس\\"."},{"page_url":"https://nl.wikipedia.org/wiki/Provinciale_weg_340","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Aanleg_verbinding_N340_en_A28.jpg","page_title":"Provinciale weg 340","context_page_description":"De provinciale weg N340 is een provinciale weg tussen Zwolle en Ommen. De straatnaam van de N340 tussen de A28 en Varsen is Hessenweg. De huidige N340 buigt vanaf Varsen af naar Ommen. Het trace van de oude Hessenweg loopt enkele kilometers ten noorden van Ommen langs om bij Hoogengraven weer op de voormalige N34 aan te sluiten.\\nTot 1993 was de N340 een onderdeel van de Rijksweg 34. Na de invoering van de Wet herverdeling wegenbeheer is het gedeelte tussen Zwolle en Ommen overgedragen aan de provincie Overijssel en omgenummerd tot N340.\\nDe weg is uitgevoerd als tweestrooksweg en er geldt een maximale snelheid van 80 km/h. Inhalen is niet toegestaan."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D0%BA%D0%B8%D0%B7_%D0%B4%D0%B5_%D0%A1%D0%B0%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Firma-D.A.F.-Sade.png","page_title":"Маркиз де Сад","context_page_description":"Донасье́н Альфо́нс Франсуа́ де Сад, часто именуемый как марки́з де Сад — французский аристократ, политик, писатель и философ. Был проповедником идеи абсолютной свободы, которая не была бы ограничена ни нравственностью, ни религией, ни правом. Основной ценностью жизни считал утоление стремлений личности.\\nПо его имени сексуальное удовлетворение, получаемое путём причинения другому человеку боли и/или унижений, получило название «садизм»."},{"page_url":"https://nn.wikipedia.org/wiki/Chumphon-fylket","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Chumphon_typhoon_damage_4.jpg","page_title":"Chumphon-fylket","context_page_description":"Chumphon er eit fylke i Thailand. Fylkeshovudstaden er Chumphon.\\nInnbyggartalet er 498 294."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BE%D1%80%D0%BE%D0%BA%D0%BE,_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D0%B8%D0%B9_%D0%A1%D0%B5%D0%BC%D1%91%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/EST3954-%D0%9F%D0%B0%D0%BD%D0%BE.jpg","page_title":"Сороко, Григорий Семёнович","context_page_description":"Григорий Семёнович Сороко — музыкант, дирижёр, общественный деятель.\\nС 1979 года — директор УО «Молодечненский государственный музыкальный колледж имени М. К. Огинского». Художественный руководитель и главный дирижёр Заслуженного любительского коллектива Республики Беларусь симфонического оркестра Молодечненского музыкального колледжа имени М. К. Огинского.\\nЗаслуженный деятель культуры Республики Беларусь, Лауреат специальной премии Президента Республики Беларусь, кавалер ордена Франциска Скорины, почётный гражданин города Молодечно и района."},{"page_url":"https://en.wikipedia.org/wiki/465th_Air_Refueling_Squadron","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/F-105s_465_TFS_DF-ST-86-12883.JPEG","page_title":"465th Air Refueling Squadron","context_page_description":"The 465th Air Refueling Squadron is a United States Air Force Reserve squadron, assigned to the 507th Operations Group, 507th Air Refueling Wing, stationed at Tinker Air Force Base, Oklahoma. The squadron operates the KC-135R aircraft conducting aerial refueling missions."},{"page_url":"https://es.wikipedia.org/wiki/Equus_(obra)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Royal_National_Theatre_London_SouthBankCentre02.jpg","page_title":"Equus (obra)","context_page_description":"Equus es una obra de teatro escrita en 1973 por Peter Shaffer. Relata la historia de un psiquiatra que intenta tratar a un joven adolescente que padece una patológica fascinación sexual y religiosa por los caballos.​\\nShaffer se inspiró para escribir esta obra cuando oyó sobre un crimen que involucraba a un adolescente que cegó a seis equinos. Construyó un relato ficticio sobre lo que pudo haber causado el incidente, sin conocer ningún detalle del crimen. Esta obra es esencialmente una historia detectivesca que recurre a varios principios del psicoanálisis y la psicopatología.​"},{"page_url":"https://fr.wikipedia.org/wiki/Architecture_romane","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/StavkirkeGolPlan.png","page_title":"Architecture romane","context_page_description":"L'architecture romane est le premier grand style créé au Moyen Âge en Europe après le déclin de la civilisation gréco-romaine. Son développement est pleinement établi vers 1060 mais les premiers signes de mutation sont différents suivant les régions et il n'y a pas de consensus sur une date des débuts qui vont du VIᵉ au XIᵉ siècle. L'architecture gothique est le style qui lui succède progressivement à partir du XIIe siècle.Le dynamisme monastique, de profondes aspirations religieuses et morales, la spiritualité des routes de pèlerinages dans une Europe rendue à la paix président à la naissance de l'art roman et contribuent à en faire un style vraiment neuf et doué d'une profonde originalité. La volonté de libérer l'Église de la tutelle de pouvoirs séculiers, les croisades, la reconquête chrétienne en Espagne avec l'effondrement du califat de Cordoue, la disparition du mécénat royal ou princier font de l'art roman l'art de toute la chrétienté médiévale.\\nL'architecture romane s'est développée sur un vaste espace qui s'étend depuis la moitié nord de l'Espagne jusqu'à l'Irlande, l'Écosse et la moitié de la Scandinavie."},{"page_url":"https://pl.wikipedia.org/wiki/Zak%C5%82ad_Si%C3%B3str_Mi%C5%82osierdzia_%C5%9Bw._Wincentego_%C3%A0_Paulo_w_Warszawie","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Korytarz2.JPG","page_title":"Zakład Sióstr Miłosierdzia św. Wincentego à Paulo w Warszawie","context_page_description":"Zakład Sióstr Miłosierdzia św. Wincentego à Paulo – zespół klasztorny znajdujący się przy ul. Tamka 35 w Warszawie. Został ufundowany w XVII wieku przez Marię Ludwikę Gonzagę, żonę króla Jana Kazimierza."},{"page_url":"https://id.wikipedia.org/wiki/Powiat_Mi%C5%84sk","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Mazowsze_Mi%C5%84ski.png","page_title":"Powiat Mińsk","context_page_description":"Powiat Mińsk adalah sebuah powiat di Polandia. Ibu kotanya adalah Mińsk Mazowiecki. Powiat ini letaknya ada di provinsi Mazowia dan pada tahun 2005 memiliki penduduk 139.961 jiwa."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%92%D0%B5%D0%BD%D0%B5%D1%80%D0%B0_1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Venera_1_%28a%29_%28Memorial_Museum_of_Astronautics%29.JPG","page_title":"Венера 1","context_page_description":"Венера 1 е автоматичен космически апарат, изстрелян от СССР на 12 февруари 1961 г. 00:34:36 стандартно време с цел изследване на Венера, и първият от поредицата апарати Венера. Теглото на апарата е 643,5 kg. Състои се от цилиндричен отсек с диаметър от 1,05 m и отсек с форма на купол с обща височина от 2,035 m. Апаратът е херметизиран до налягане от 1,2 атмосфери с азот. Вентилатори във вътрешността на апарата осигуряват циркулация и на азота, предпазвайки от прегряване. Към цилиндричния отсек са монтирани два слънчеви панела, захранващи сребърно-цинкова батерия. Комуникация с наземния контрол се осъществява посредством двуметрова мрежеста параболична антена, изпращаща данни по канал със честота от 922,8 MHz. За изпращане на нискочестотни сигнали в близост до Земята се използва 2,4 метрова стреловидна антена. Допълнителни телеметрични данни се изпращат посредством антени, монтирани върху слънчевите панели.\\nОборудването включва магнетометър монтиран на стрела, два детектора на слънчев вятър, детектор на микрометеорити, гайгеров брояч и детектор на космически лъчи. Към единия от слънчевите панели е прикрепен термометър, измерващ температурата на пробни покрития."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%BB%D0%B1%D0%B5%D1%80%D0%B8%D0%BA%D0%BE_I_%D0%A7%D0%B8%D0%B1%D0%BE-%D0%9C%D0%B0%D0%BB%D0%B0%D1%81%D0%BF%D0%B8%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Palazzo_Cybo-Malaspina%2C_Massa_%281%29.jpg","page_title":"Алберико I Чибо-Маласпина","context_page_description":"Алберико I Чибо-Маласпина от фамилията Маласпина е херцог на Маса и Карара и от 1568 г. маркграф на Карара.\\nТой е вторият син на Лоренцо Чибо, граф на Ферентило, гувернатор на Сполето, и съпругата му Рикиарда Маласпина, дъщеря на Антонио Алберико II Маласпина, маркиз на Маса, синьор на Карара, и на Лукреция д'Есте, дъщеря на Сигисмондо д'Есте. Брат е на маркиз Джулио. Племенник е на Джовани Батиста, от 1530 г. епископ на Марсилия. Правнук е на папа Инокентий VIII.\\nАлберико се жени през февруари 1552 г. в Рим за Елизабета дела Ровере, третата дъщеря на Франческо Мария I дела Ровере, херцог на Урбино, и съпругата му Елеонора Гонзага. След нейната смърт той се жени на 16/17 февруари 1563 г. в Рим за Изабела ди Капуа, дъщеря на херцога на Термоли Фердинандо ди Капуа.\\nТой е погребан в църквата Сан Франческо в Маса. Последван е през 1623 г. от внук му Карло I Чибо-Маласпина."},{"page_url":"https://en.wikipedia.org/wiki/Freundlich-Sharonov_Basin","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Freundlich-Sharonov_basin_GRAIL_gravity.jpg","page_title":"Freundlich-Sharonov Basin","context_page_description":"The Freundlich-Sharonov Basin is a Pre-Nectarian impact basin on the far side of the moon. It is named after the younger craters Freundlich near the northwest margin and Sharonov near the southwest margin. It lies east of Mare Moscoviense basin and northwest of Korolev basin.\\nThe basin is not obvious on lunar photographs, although it was discovered from analysis of Lunar Orbiter photographs. At the center is the small mare Lacus Luxuriae, just south of the oblique crater Buys-Ballot.\\nAlso at the center is a mass concentration, or gravitational high. The mascon was first identified by Doppler tracking of the Lunar Prospector spacecraft.\\nOther craters within the basin include Anderson, Virtanen, Zernike, Dante, and the smaller Šafařík. Morse and Spencer Jones are at the margins."},{"page_url":"https://es.wikipedia.org/wiki/Boulton_y_Watt","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Grazebrook_Beam_Engine.jpg","page_title":"Boulton y Watt","context_page_description":"Boulton and Watt fue una de las primeras empresas británicas de ingeniería en el negocio del diseño y fabricación de máquinas de vapor marinas y estacionarias. Fundada en 1775 en los alrededores de Birmingham como una asociación entre el fabricante inglés Matthew Boulton y el ingeniero escocés James Watt, la empresa tuvo un papel importante en la Revolución Industrial y se convirtió en un importante productor de máquinas de vapor en el siglo XIX."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B1%D9%8A%D9%83%D9%89_%D9%85%D9%88%D8%B1%D8%AA%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Ricky_Morton_May_2014.jpg","page_title":"ريكى مورتون","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nريكى مورتون مصارع محترف من امريكا."},{"page_url":"https://sv.wikipedia.org/wiki/Brickv%C3%A4vning","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Lautanauha_weaving.jpg","page_title":"Brickvävning","context_page_description":"Brickvävning är en textil teknik för att framställa band. Banden blir stadiga och slitstarka och har exempelvis brukats till hängslen, bälten och tömmar. Brickvävda strumpeband, bälten och hängslen ingår i många svenska och nordiska folkdräkter. De används också för att sätta upp varpen i varptyngda vävar."},{"page_url":"https://da.wikipedia.org/wiki/Bl%C3%A5b%C3%A6rsorter","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Vaccinium_corymbosum0.jpg","page_title":"Blåbærsorter","context_page_description":"Der findes et stort antal blåbærsorter, sorter, som er udviklet ud fra flere arter og underarter i slægten Bølle. Efter den første halvdel af det 20. århundrede har man fremavlet flere end 100 sorter. Blåbær tilhører Lyng-familien. De dyrkede blåbærsorter stammer ikke, som man ellers ofte tror, fra den hjemlige art af blåbær, hvis frugter farver mund og læber blå, når man spiser dem, men fra nordamerikanske arter. De farvende anthocyaner findes i frugtskallen på de næsten runde, blå bær, hvis frugtkød er hvidt. Dyrkede blåbær har betydning som markedsfrugt over hele verden, men før de blev kendt som frugtbuske, var blåbærsorterne indført som prydplanter i europæisk havedyrkning på grund af deres dekorative høstfarver."},{"page_url":"https://nl.wikipedia.org/wiki/Verdedigingstoren","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Fuenfgratturm1.JPG","page_title":"Verdedigingstoren","context_page_description":"Een verdedigingstoren of weertoren is een toren bij een kasteel, weermuur, hek of palissade en is bedoeld om een vijand te zien naderen en/of de aanval af te weren."},{"page_url":"https://zh.wikipedia.org/wiki/2020%E5%B9%B4%E4%B8%AD%E8%8F%AF%E6%B0%91%E5%9C%8B%E7%B8%BD%E7%B5%B1%E9%81%B8%E8%88%89%E6%B0%91%E6%84%8F%E8%AA%BF%E6%9F%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/%E5%AE%8B%E6%A5%9A%E7%91%9C%E5%8F%83%E5%89%8D%E5%90%84%E5%AA%92%E9%AB%94%E4%B9%8B%E7%B8%BD%E7%B5%B1%E6%B0%91%E8%AA%BF%E8%B6%A8%E5%8B%A2%E7%B7%9A.png","page_title":"2020年中華民國總統選舉民意調查","context_page_description":"2020年中華民國總統選舉民意調查是針對2020年中華民國總統選舉選前多項民調紀錄列表。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BE%D0%B4%D0%BD%D0%BE%D0%B4%D0%BE%D0%BB%D1%8C%D0%BD%D1%8B%D1%85_%D1%80%D0%B0%D1%81%D1%82%D0%B5%D0%BD%D0%B8%D0%B9,_%D0%B7%D0%B0%D0%BD%D0%B5%D1%81%D1%91%D0%BD%D0%BD%D1%8B%D1%85_%D0%B2_%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D1%83%D1%8E_%D0%BA%D0%BD%D0%B8%D0%B3%D1%83_%D0%A2%D1%8E%D0%BC%D0%B5%D0%BD%D1%81%D0%BA%D0%BE%D0%B9_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Stipa_joannis.jpg","page_title":"Список однодольных растений, занесённых в Красную книгу Тюменской области","context_page_description":"В списке указаны однодольные растения, включённые в Красную книгу Тюменской области издания 2004 года. Колонки таблицы КкТО, КкРФ, КкСCCP и МСОП означают, соответственно, статус указанного вида в Красной книге Тюменской области, Красной книге России, Красной книге СССР и в Красном списке МСОП. В случае, если в той или иной Красной книге какой-либо из описываемых видов отсутствует, то есть не отнесён ни к одной из указанных категорий, то соответствующая ячейка списка оставлена незаполненной. Все виды поделены на 6 категорий в Красной книге Тюменской области, на 6 категорий в Красной книге России и Красной книге СССР и на 9 в списке МСОП. Категории имеют следующие обозначения:\\nВсего в список однодольных растений Красной книги Тюменской области включено 80 видов, из них 63 вида помещены на основные страницы и 17 видов указаны в приложении, в списке редких и уязвимых видов.\\nПо принятому постановлению Администрации Тюменской области от 09.03.2005 № 33-ПК «О порядке ведения Красной книги Тюменской области», Красная книга должна переиздаваться с актуализированными данными не реже, чем каждые 15 лет."},{"page_url":"https://hu.wikipedia.org/wiki/Teor%C3%A9ma_(film)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Teorema_1.jpg","page_title":"Teoréma (film)","context_page_description":"A Teoréma 1968-ban készült színes, olasz filmdráma. Pier Paolo Pasolini egyik legismertebb és legjelentősebb alkotása a bemutató idején nagy botrányt kavart Olaszországban. A rendező így foglalta össze műve lényegét: „A Teoréma Isten létének botrányos demonstrációja.” Mivel a filmben feltűnően kevés a beszéd, a szavaknak jelentős súlya van. A nyomasztó hangulatot főleg a zene és a költői képek kölcsönhatása teremti meg. A film mozaikos szerkesztésű, nincsen pontosan meghatározva az egyes történések között eltelt idő."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_im_Hamburger_Bezirk_Hamburg-Mitte","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Klingberg_1_%28Hamburg-Altstadt%29.ajb..jpg","page_title":"Liste der Kulturdenkmäler im Hamburger Bezirk Hamburg-Mitte","context_page_description":"Dies ist eine veraltete Liste. Maßgeblich sind die Listen der Kulturdenkmäler in Hamburg nach dem Hamburger Denkmalschutzgesetz vom 5. April 2013, die wegen ihrer Größe nach Stadtteilen aufgeteilt sind.\\nDie folgende Liste enthält die in der Denkmalliste ausgewiesenen Denkmäler auf dem Gebiet der Freien und Hansestadt Hamburg, Bezirk Hamburg-Mitte.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich an den Stadtteilen und ist alternativ nach Denkmallistennummer, Straße oder Beschreibung sortierbar.\\nBasis ist die Denkmalliste des Denkmalschutzamtes Hamburg. Diese enthält alle Objekte, die rechtskräftig nach dem Hamburger Denkmalschutzgesetz unter Denkmalschutz stehen oder zumindest zeitweise standen. Darüber hinaus führt das Denkmalschutzamt eine noch umfangreichere Liste der erkannten Denkmäler mit den als schutzwürdig erkannten Objekten, für die das Gesetz bereits Auflagen bei Veränderungen bis zu einer möglichen Unterschutzstellung vorsieht."},{"page_url":"https://en.wikipedia.org/wiki/U.S._national_banks_of_Hawaii","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/US-NBN-HI-Honolulu-5550-1882BB-10-1-B.jpg","page_title":"U.S. national banks of Hawaii","context_page_description":"The first bank established in the Kingdom of Hawaii was Bishop & Co., founded by Charles Reed Bishop and William A. Aldrich in 1858. Almost 25 years later, Spreckels & Co. was founded by Claus Spreckels in partnership with William G. Irwin in 1884. The Kingdom opened the Hawaiian Postal Savings Bank on July 1, 1886. By 1895 the Yokohama Specie Bank opened a branch in Honolulu and the merchant importer/exporter Hackfeld & Co. went into banking. Following the annexation of Hawaii in July 1898, plans were set in motion to establish the First American Bank of Hawaii backed by investors in New York and California. A prospectus soliciting stock subscriptions was released on May 8, 1899, and the bank opened for business on September 5, 1899. The founding board of directors included Cecil Brown, B.F. Dillingham, M.P. Robinson, Bruce Cartwright, and G.W. Macfarlane. Additional officers included W.G. Cooper, E.M. Boyd, and George F. McLeod. The expressed purpose for founding the bank was to eventually convert it into a National Bank under the National Bank Act. On April 30, 1900 a special act of Congress extended the National Banking Act to include the Territory of Hawaii."},{"page_url":"https://en.wikipedia.org/wiki/Parc_des_F%C3%A9lins","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Acinonyx_jubatus_01_by_Line1.jpg","page_title":"Parc des Félins","context_page_description":"Parc des Félins is a zoological park in France dedicated to the breeding and conservation of wild members of the cat family. It is located in the commune of Lumigny-Nesles-Ormeaux in Seine-et-Marne, about 53.6 km southeast of Paris.\\nThe park covers an area of 60 hectares. Of the 41 recognized species of felines in the world, the park has 30 different species and subspecies, with a total of 140 cats.\\nThe park opened to the public on October 14, 2006. Originally, the majority of the animals came from the Parc d'Aulneau, which was deemed too small to house this many animals."},{"page_url":"https://fr.wikipedia.org/wiki/Institut_Warburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Heilwigstra%C3%9Fe_116_%28Hamburg-Eppendorf%29.Tafel.20480.ajb.jpg","page_title":"Institut Warburg","context_page_description":"L'Institut Warburg est un centre de recherche qui fait partie de l'université de Londres, School of Advanced Study ; il est spécialisé dans l'étude des influences de l'Antiquité classique sur la civilisation occidentale."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Stadskanaal_(plaats)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Julianapark_Stadskanaal.jpg","page_title":"Lijst van rijksmonumenten in Stadskanaal (plaats)","context_page_description":"De plaats Stadskanaal telt 44 inschrijvingen in het rijksmonumentenregister, hieronder een overzicht."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BE%D0%B1%27%D1%94%D0%BA%D1%82%D1%96%D0%B2_%D0%A1%D0%B2%D1%96%D1%82%D0%BE%D0%B2%D0%BE%D1%97_%D1%81%D0%BF%D0%B0%D0%B4%D1%89%D0%B8%D0%BD%D0%B8_%D0%AE%D0%9D%D0%95%D0%A1%D0%9A%D0%9E_%D0%B2_%D0%90%D1%84%D1%80%D0%B8%D1%86%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Aapravasi_Ghat_latrines.jpg","page_title":"Список об'єктів Світової спадщини ЮНЕСКО в Африці","context_page_description":"Цей список містить об'єкти Світової спадщини ЮНЕСКО в Африці за винятком «Арабських країн».\\nУ списку станом на 2015 рік налічується 89 об'єктів. Разом це становить 8,63% від загальної кількості об'єктів Світової спадщини ЮНЕСКО.\\n48 об'єктів внесені до списку за культурними критеріями, причому 8 з них визнані шедеврами людського генія, 37 об'єктів включені за природними критеріями, 26 з них визнані природним феноменом виняткової краси і естетичної важливості і ще 4 об'єктів включені за змішаними критеріями. 17 об'єктів зі списку знаходяться під загрозою.\\nУ наведеній таблиці об'єкти розташовані за країною, а далі у хронологічному порядку їх внесення до списку Світової спадщини."},{"page_url":"https://en.wikipedia.org/wiki/UTS_Vicki_Sara_Building","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Corridor_and_entrance_to_Super_Labs.JPG","page_title":"UTS Vicki Sara Building","context_page_description":"The UTS Vicki Sara Building, also known as the Science Faculty Building, is the building housing the Faculty of Science and the Graduate School of Health in the University of Technology Sydney in New South Wales, Australia. It is the third building to be opened under the plan for $154 million worth of structures designed by Durbach Block Jaggers in association with BVN Architecture constructed by Richard Crookes Constructions. The building is located in the City Campus at 67 Thomas St, Ultimo. It was completed in October 2014 and opened for teaching in February 2015. The building has eight levels that provide spaces for over 1200 staff and students. Three of these floors are distinguished for its state of art teaching, learning and research facilities, which have been located underground.\\nThe organic form of the building is inspiredby the shapes of grove of trees. The undulatory form of the building is inflected by 700 multicoloured coloured, box-like openings piercing the glossy off-white surface of the façade. Considerably, the external cladding has been crafted from more than 75% recycled glass."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9B%BC%E8%B0%B7%E5%A4%A7%E7%9C%BE%E9%81%8B%E8%BC%B8%E7%B3%BB%E7%B5%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Bkk_masstransit_2020_clear_version_english_wiki-01.png","page_title":"曼谷大眾運輸系統","context_page_description":"曼谷大众运输系统，是一个位于泰国曼谷的集体运输系统。"},{"page_url":"https://nl.wikipedia.org/wiki/Orde_van_de_Glorie_(Tunesi%C3%AB)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/NichanIftikharGroup.jpg","page_title":"Orde van de Glorie (Tunesië)","context_page_description":"De Nishan al-Iftikhar werd door Mustafa Pasha-Bey, de bey van Tunis, in 1835 gesticht. In 1843 gaf Ahmad Pasha-Bey de ridderorde vier graden. Nog later werden zes graden ingesteld.\\nGrootlint of San'f al-Akbar. Een met diamanten versierde zilveren decoratie aan een breed lint over de rechterschouder. Op de linkerborst werd een grote zilveren ster gedragen. Deze ster had een zilveren of zwart medaillon.\\nGrootofficier of San'f al-A'anal. De Grootofficier droeg alleen een zilveren ster op de linkerborst.\\nCommandeur of San'f al-Tani. Een groen en rood geëmailleerde ster aan een lint om de hals.\\nOfficier of San'f al-Talet. De officier droeg een zilveren ster aan een lint met een rozet.\\nRidder der Eerste Klasse of San'f al-Raba'a.\\nRidder der Tweede Klasse of San'f al-Khamis.\\nRidder der Derde Klasse of San'f al-Sadis.\\nMuhammad as-Sadiq Pasha-Bey schafte de ongebruikelijke zesde graad af en verving deze in februari 1861 door gouden en zilveren medailles. Men kende de orde aan personen van beide geslachten toe voor verdienste op allerlei gebied.\\nHet lint was geel met twee rode strepen aan iedere zijde."},{"page_url":"https://et.wikipedia.org/wiki/Or%C5%A1a","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/Kutein.jpg","page_title":"Orša","context_page_description":"Orša on linn Valgevenes Viciebski oblastis, Orša rajooni halduskeskus. Linn asub Dnepri jõe ääres, 180 kilomeetri kaugusel riigi pealinnast Minskist. Elanike arv aastal 2006 oli 140 300, aastal 2009 aga 117 225.\\nEsmakordselt mainitud kroonikas 1067. aastal.\\nOrša linnale alluvad administratiivselt ka Barańi linn ja Balbasava alev.\\nAastal 2017 oli linn oma negatiivse iibe poolest Valgevenes esikohal."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%BE%D0%BB%D0%BE%D1%82%D0%B0%D1%8F_%D0%BB%D0%B8%D1%85%D0%BE%D1%80%D0%B0%D0%B4%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Atlinlake.jpg","page_title":"Золотая лихорадка","context_page_description":"Золотая лихорадка — неорганизованная массовая добыча золота на новооткрытых месторождениях, которая характеризуется стихийным наплывом старателей и хищническими методами добычи.\\nНовые месторождения золота с возможностью добычи золота шлиховым методом привлекают большое число людей, которые стекаются в регион, создавая лагеря старателей. Такой наплыв стимулирует развитие экономики региона, поскольку происходящие события вынуждают реагировать на потребности в продуктах питания, товарах, жилье, оборудовании. Однако относительно лёгкая добыча золота прекращается через несколько лет, уступая место механизированным методам, которые доступны только компаниям. Порождённые золотой лихорадкой населённые пункты при этом часто становятся городами-призраками.\\nЗолотые лихорадки начались в середине XIX века и продолжаются в разных точках земного шара до сих пор. Основными периодами считаются калифорнийская, австралийская, южноафриканская, клондайкская и аляскинская золотые лихорадки."},{"page_url":"https://sv.wikipedia.org/wiki/Acrocercops_panacivagans","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Acrocercops_panacivagans.JPG","page_title":"Acrocercops panacivagans","context_page_description":"Acrocercops panacivagans är en fjärilsart som först beskrevs av Watt 1920. Acrocercops panacivagans ingår i släktet Acrocercops och familjen styltmalar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://nl.wikipedia.org/wiki/Saint-Cyr-du-Gault","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/13/Map_commune_FR_insee_code_41205.png","page_title":"Saint-Cyr-du-Gault","context_page_description":"Saint-Cyr-du-Gault is een gemeente in het Franse departement Loir-et-Cher en telt 195 inwoners. De plaats maakt deel uit van het arrondissement Blois."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%85%B6%E6%87%89%E7%BE%A9%E5%A1%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/%E8%8A%B1%E5%B1%8B%E6%85%B6%E6%87%89%E4%BF%A1%E6%BF%83%E7%94%BA.jpg","page_title":"慶應義塾","context_page_description":"慶應義塾は、日本の学校法人。福澤諭吉が1858年に中津藩江戸藩邸で開いた蘭学塾が起源。シンボルマークは、ペンマーク。"},{"page_url":"https://fr.wikipedia.org/wiki/Pic_du_Midi_de_Bigorre","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Pic_du_Midi_du_Bigorre.jpg","page_title":"Pic du Midi de Bigorre","context_page_description":"Le pic du Midi de Bigorre est situé dans les Hautes-Pyrénées, et atteint une altitude de 2 876 mètres. Il est connu entre autres pour la présence d'un observatoire astronomique et d'un relais de télévision, installés à son sommet.\\nCe site touristique fait partie du regroupement de stations N'PY."},{"page_url":"https://it.wikipedia.org/wiki/Nomascus_siki","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Southern_White-cheeked_Gibbon_area.png","page_title":"Nomascus siki","context_page_description":"Il gibbone dal ciuffo meridionale è un primate appartenente alla famiglia degli Ilobatidi."},{"page_url":"https://ro.wikipedia.org/wiki/Aldeburgh","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/MootHallAldeburgh2005.JPG","page_title":"Aldeburgh","context_page_description":"Aldeburgh este un oraș în comitatul Suffolk, regiunea East, Anglia. Orașul se află în districtul Suffolk Coastal."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%A3%A8%E5%9D%8A%E5%9F%8E%E5%B8%82%E5%8D%9A%E7%89%A9%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Mill_City_Museum-20070704.jpg","page_title":"磨坊城市博物館","context_page_description":"磨坊城市博物馆是位于美国明尼阿波利斯的一座历史博物馆。"},{"page_url":"https://en.wikipedia.org/wiki/Gy%C3%B6ngy%C3%B6s_District","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/95/Eglise_Szent_Bertalan_de_Gy%C3%B6ngy%C3%B6s.jpg","page_title":"Gyöngyös District","context_page_description":"Gyöngyös is a district in central-western part of Heves County. Gyöngyös is also the name of the town where the district seat is found. The district is located in the Northern Hungary Statistical Region. This district is a part of Mátra Mountains geographical region."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D1%83%D1%80%D0%B8%D0%BA%D0%B0%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Suricata_suricatta_006.jpg","page_title":"Сурикат","context_page_description":"Сурика́т або англ. Meerkat — хижий ссавець з родини мангустових, єдиний представник монотипового роду Suricata. Мешкає в пустелі Калахарі, що у Південній Африці. Сурикати зустрічаються в таких країнах, як-от: Ангола, Ботсвана, Намібія, ПАР. Середня тривалість життя цих тварин становить 12—14 років."},{"page_url":"https://pl.wikipedia.org/wiki/War%C4%99%C5%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/War%C4%99%C5%BC_Panorama.jpg","page_title":"Waręż","context_page_description":"Waręż – wieś na Ukrainie w obwodzie lwowskim, w rejonie sokalskim.\\nPrywatne miasto duchowne lokowane w 1538 roku położone było w XVI wieku w województwie bełskim.\\nDo 17 września 1939 leżał w woj. lwowskim, a do 15 lutego 1951 w woj. lubelskim jako siedziba gminy Waręż.\\nMiejscowość liczy niespełna 900 mieszkańców."},{"page_url":"https://ceb.wikipedia.org/wiki/Stereopsis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Stereopsis_humphreyi_56449.jpg","page_title":"Stereopsis","context_page_description":"Henero sa mga uhong ang Stereopsis. Ang Stereopsis sakop sa kabanay nga Meruliaceae.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://eo.wikipedia.org/wiki/Nakamatsu_Yoshiro","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Nakamatsu.jpg","page_title":"Nakamatsu Yoshiro","context_page_description":"NAKAMATSU Yoshiro, estas japana inventisto, fama kiel registrinto de pli ol 3000 inventojn. Alinome D-ro. NakaMats.\\nLi estas konata kiel elpensinto de la mola disko por la komputilo. Tamen fakte en 1979 IBM kontraktis kun li pri lia patento\\"Nakabizon\\" registrita en 1952 kiu povus koncerni al mola disko, kiam IBM vendis molan diskon en Japanio. Oni miskomprenis la kontrakton, kaj konsideris lin inventinto."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B4%D9%87%D8%B1%D8%B3%D8%AA%D8%A7%D9%86_%D9%84%D8%A7%D8%B1%D9%86%D8%B3%D8%8C_%D8%AF%D8%A7%DA%A9%D9%88%D8%AA%D8%A7%DB%8C_%D8%AC%D9%86%D9%88%D8%A8%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Lawrence_county_south_dakota_courthouse.jpg","page_title":"شهرستان لارنس، داکوتای جنوبی","context_page_description":"شهرستان لارنس، داکوتای جنوبی یک سکونتگاه مسکونی در ایالات متحده آمریکا است که در داکوتای جنوبی واقع شده‌است."},{"page_url":"https://fr.wikipedia.org/wiki/Mise_au_tombeau_de_Combefa","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/70/MTombCombea_gr_droite.jpg","page_title":"Mise au tombeau de Combefa","context_page_description":"La Mise au tombeau de Combefa est un ensemble de statues en calcaire polychrome du XVᵉ siècle, représentant trois scènes de la Passion du Christ. Elles ont été réalisées pour la chapelle du château de Combefa, et se trouve aujourd'hui dans la chapelle de l'hôpital Saint-Jacques de Monestiés dans le dêpartement français du Tarn."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%B1%B1%E9%99%BD%E6%9C%AC%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Special_rapid_services_on_on_t%C5%8Dkaid%C5%8D_main_line_225_100.jpg","page_title":"山陽本線","context_page_description":"山阳本线是一条连结兵库县神户市中央区的神户站至福冈县北九州市门司区的门司站，沿濑户内海行走的铁路线。除本线外，也设有通称“和田岬线”的兵库站－和田岬站间的支线。神户站－下关站间与和田岬线由西日本旅客铁道、下关站－门司站间由九州旅客铁道管辖。一般略称山阳线。\\n另外，广义上山阳新干线的新神户站至小仓站的路段也包括山阳本线，但此条目只记载在来线的山阳本线的概要与沿革等。新干线参见“山阳新干线”，而在来线的部分地域详细资料参见以下条目。\\nJR神户线\\n山阳本线"},{"page_url":"https://ceb.wikipedia.org/wiki/Hypsiboas_crepitans","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Rana_platanera_-_Hypsiboas_crepitans.jpg","page_title":"Hypsiboas crepitans","context_page_description":"Espesye sa baki nga una nga gihulagway ni Maximilian zu Wied-Neuwied ni adtong 1824 ang Hypsiboas crepitans. Ang Hypsiboas crepitans sakop sa kahenera nga Hypsiboas sa kabanay nga Hylidae. Giklaseklase sa IUCN ang espesye sa kinaminosang kalabotan. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://de.wikipedia.org/wiki/Monica_560","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Monica_1973_seitlich.JPG","page_title":"Monica 560","context_page_description":"Der Monica 560 war ein französischer Sportwagen, der zwischen 1967 und 1975 in wenigen Exemplaren hergestellt wurde. Das Auto ist ein ausgesprochener Exot, um den sich zahlreiche Mythen ranken."},{"page_url":"https://gl.wikipedia.org/wiki/Alfa_(letra)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Alpha_uc_lc.svg","page_title":"Alfa (letra)","context_page_description":"Nome da primeira letra do alfabeto grego; equivale ao /a/. Minúscula α, maiúscula Α. Adoita transcribirse como a. O seu nome provén do da primeira letra do alfabeto fenicio ’alef. Como signo numérico representaba o un. En maiúscula serve tamén para designar o primeiro canto da Ilíada de Homero e en minúscula o primeiro da Odisea.\\nA letra α é usada como símbolo para:\\nEn Física, o coeficiente de dilatación ou coma nome para unha partícula resultado da desintegración atómica;\\nEn Relixión, representación do principio de todo\\nEn Fisioloxía, motoneurona que innerva as fibras extrafusais dos músculos."},{"page_url":"https://de.wikipedia.org/wiki/Strau%C3%9Fenfeder","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Sir_Christopher_Hatton_from_NPG_%282%29_cropped.jpg","page_title":"Straußenfeder","context_page_description":"Straußenfedern sind die Federn des Afrikanischen Straußes. Insbesondere werden darunter die weißen Schwanzfedern der Hähne und die ebenfalls weißen Handschwingen an den Flügelspitzen von Straußen beiderlei Geschlechts verstanden. Diese waren lange Zeit als schmückendes Accessoire begehrt und galten als die „vorzüglichsten Schmuckfedern“."},{"page_url":"https://fr.wikipedia.org/wiki/Palais_du_Soleil_Kumsusan","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Kim_Il-sung_Mausoleum.jpg","page_title":"Palais du Soleil Kumsusan","context_page_description":"Le palais du Soleil Kumsusan, anciennement palais-mémorial de Kumsusan et palais présidentiel de Kumsusan, parfois appelé mausolée de Kim Il-sung, est un monument sépulcral situé au nord-est du centre-ville de Pyongyang, capitale de la Corée du Nord, et renfermant la dépouille de Kim Il-sung, fondateur de la République populaire démocratique de Corée. À sa mort en 1994, son fils et successeur Kim Jong-il décide de transformer l'ancien palais présidentiel en mausolée.\\nL'édifice est situé dans une zone isolée de Pyongyang et est seulement accessible aux étrangers, les jeudis et dimanches sur les circuits touristiques officiels organisés par le gouvernement. Parmi les mausolées existants dédiés à des dirigeants communistes, Kumsusan est le plus vaste.\\nLe corps embaumé de l'ancien président y est exposé à l'intérieur d'un sarcophage en verre clair. Sa tête reposant sur un oreiller de style coréen et il est couvert par le drapeau du Parti du travail de Corée."},{"page_url":"https://fr.wikipedia.org/wiki/Bollor%C3%A9_Bluebus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Le_Mulet_bus.jpg","page_title":"Bolloré Bluebus","context_page_description":"Bluebus est une gamme d'autobus urbains fabriquée et commercialisée par le groupe français Bolloré sous la marque Blue Solutions depuis fin 2015 ayant comme particularité d'être entièrement électrique. Trois véhicules font actuellement partie de cette gamme dont la version articulée qui est en phase d'essai. Il sont fabriqués dans une usine près de Quimper en Bretagne."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%BE%D0%B1%D0%BB%D1%96%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/McDonnell_XF-85_Goblin_USAF.jpg","page_title":"Гобліни","context_page_description":"Го́бліни — злі, неохайні і потворні міфічні істоти або духи в англійському фольклорі, які мають спільні риси з іншими персонажами нижчої міфології, зокрема близькі до бісів, гномів, фей. Їх змальовують як маленьких чи великих м'язистих антропоморфних істот з вузькими жовтими очима із вертикальною зіницею, довгими вухами, гострими борідками, кривими жовтими іклами та пазурами і волохатою головою, що формою нагадує кінську. У фентезі часто зображуються зеленошкірими та довгоносими. Мешкають вони групами в лісах і, найчастіше, в гірських печерах. Ними могли ставати деякі померлі люди.\\nГоблінами також часто називають інших міфічних істот, що близькі до них вдачею, як у вигляді узагальнення, так і під час перекладів з інших мов. Близькими до цих створінь, яких відносять до чорних ельфів дроу, є кобольди, які також проживають у печерах і займаються різними витівками, хобгобліни і брауні, які виступають в Англії домовиками і мають схожі звички, уельськими коблінау, скандинавськими тролями, японськими каппа, грецькими каллікантзароями, англійськими паками і редкепами, що теж виступають лихими потворами у європейському фольклорі."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%88%B4_%EC%97%90%EB%B9%84%EB%84%A4%EC%9D%B4%EC%85%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Jetcraft_Aviation_%28VH-TOQ%29_ATR_42-300_at_Sydney_Airport.jpg","page_title":"툴 에비네이션","context_page_description":"툴 에비네이션은 오스트레일리아의 화물 항공사로 퀸즐랜드주 브리즈번에 본부를 두고 있으며, 1989년에 제트 에비네이션으로 설립되었다. 2007년에 경영난으로 인해 파산 신청을 했으며 이후 오스트레일리아의 물류 기업인 툴 글로벌 익스프레스에 인수되어 현재에 이르고 있다."},{"page_url":"https://fr.wikipedia.org/wiki/Manolo_Hugu%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Mujer_sentada_-_Manolo_Hugu%C3%A9.jpg","page_title":"Manolo Hugué","context_page_description":"Manuel Hugué dit « Manolo », de son nom complet Manuel Martínez i Hugué est un sculpteur, peintre, graveur et dessinateur espagnol d'origine catalane, né à Barcelone le 29 avril 1872 et mort le 17 novembre 1945 à Caldes de Montbui."},{"page_url":"https://war.wikipedia.org/wiki/Stelis_serrulata","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Masdevallia_infracta_-_Acianthera_bragae_%28as_Physosiphon_pubescens%29_-_Stelis_serrulata_%28as_Physosiphon_serrulatus%29_-_Flora_Brasiliensis_3-4-77.jpg","page_title":"Stelis serrulata","context_page_description":"An Stelis serrulata in uska species han Liliopsida nga syahan ginhulagway ni João Barbosa Rodrigues, ngan ginhatag han pagkayana nga asya nga ngaran ni Alec M. Pridgeon och Mark W. Chase. An Stelis serrulata in nahilalakip ha genus nga Stelis, ngan familia nga Orchidaceae. Waray hini subspecies nga nakalista."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%88%DB%8C%DA%98%D9%86%DB%8C%D8%AA%D8%B3%D9%87_(%D9%87%D8%A7%D9%88%D9%84%DB%8C%D8%AA%D8%B4%DA%A9%D9%88%D9%81_%D8%A8%D8%B1%D9%88%D8%AF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/V%C4%9B%C5%BEnice%2C_small_chapel.jpg","page_title":"ویژنیتسه (هاولیتشکوف برود)","context_page_description":"ویژنیتسه (هاولیتشکوف برود) چک اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. دنیز سوُلاری سَویه‌سیندن ۴۴۵ متر یۇکسک‏لیکده یئر آلیب. سوْن نۆفوس ساییمی اساسيندا ۴۱۵ نفر ایمیش و ویسوچینا اوستانیندا یئرلشیب. بۆتون چک‌دا اوْلدوغو کیمی، بۇ شهرده آنا دیلی چک دیلی دیر."},{"page_url":"https://az.wikipedia.org/wiki/Kazan_Kremli","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Annunciationcathedral.jpg","page_title":"Kazan Kremli","context_page_description":"Kazan Kremli — Kazan şəhərinin ən qədim hissəsi, şəhərin tarixini əks etdirən memarlıq, tarixi və arxeoloji abidələr kompleksi.\\nKremlin ərazisində üç müxtəlif dövrlərə aid yaşayış yerləri mövcüd olub. Birinci yaşayış yeri XII—XIII əsrlərə, ikincisi XIV—XV əsrlərə, üçüncüsü isə XV—XVI əsrlər siddir. Həmçinin Kreml ağ daşdan salınmış qaladan, tarixi-memmrlıq və mədəni əhəmiyyətli bir sıra məbəd və binadan ibarətdir.\\nTatarıstan Respublikasının Prezidentinin igamətgahı də məhz Kazan Kremlində yerləşir.\\nKremlin ərazisi onun yerləşdiyi təpənin formasını təkrarlıyan düzbucaq şəklindədir və şimal-qərbdən, Kazanka çayından, cənub-şərq, 1 May meydanına qədər uzanır. Volqa və Kazanka çaylarını sol sahilində yerləşir.\\n2000-ci ildən etibarən YUNESKO-nun Ümumdünya irsinə daxildir.\\nKremlin ərazisində yerləşən ən qədim tarixi memarlıq abidə Blaqoveşenskiy kilsəsidir."},{"page_url":"https://en.wikipedia.org/wiki/List_of_monuments_in_Prizren","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Shtepia_e_Shuaip_Pashes.JPG","page_title":"List of monuments in Prizren","context_page_description":"Prizren along with its historical values contributes to not only the city itself, but the entire territory of Kosovo.\\nNumerous data that have remained from the past suggest that this area has been inhabited since ancient times. Among the most valuable assets of Prizren are material values that are inherited from past centuries. Thanks to the suitable geographical position, Prizren is a woven together place where civilizations and different cultures meet. This list includes historical, cultural, religious and natural monuments of the municipality of Prizren, which are listed by the government of the Republic of Serbia, Republic of Kosovo, Municipality of Prizren, International NGOs and Local NGOs."},{"page_url":"https://en.wikipedia.org/wiki/Michigan_Wolverines_men%27s_track_and_field","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Ralph_Craig.jpg","page_title":"Michigan Wolverines men's track and field","context_page_description":"The Michigan Wolverines men's track and field team is the intercollegiate track and field program representing the University of Michigan. The school competes in the Big Ten Conference in Division I of the National Collegiate Athletic Association.\\nMichigan men's track and field athletes have won 43 NCAA individual event championships, 14 Olympic gold medals, 57 Big Ten Conference team championships, and one NCAA team championship.\\nThe team has had 11 coaches in 109 years from 1901 to 2009. The team is currently coached by head coach Fred LaPlante and associate head coach Ron Warhurst."},{"page_url":"https://az.wikipedia.org/wiki/Fizika_%C3%BCzr%C9%99_Nobel_m%C3%BCkafat%C4%B1_laureatlar%C4%B1n%C4%B1n_siyah%C4%B1s%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Henry_Kendall_by_Tom_Frost_crop.jpg","page_title":"Fizika üzrə Nobel mükafatı laureatlarının siyahısı","context_page_description":"Fizika üzrə Nobel mükafatı — İsveç Kral Elmlər Akademiyası tərəfindən fizikanın müxtəlif sahələri üzrə elm adamlarına təqdim olunan illik mükafat. Bu mükafat Alfred Nobelin 1895-ci ildəki vəsiyyəti əsasında təsis edilmiş beş Nobel mükafatından biridir, hansı ki, fizika sahəsi üzrə insanlığa əlamətdar töhfələr verənlərə təqdim olunur. Nobelin vəsiyyətinə əsasən, mükafat Nobel Fondu tərəfindən idarə olunur və Royal İsveç Elmlər Akademiyası tərəfindən seçilmiş beş üzvdən ibarət komitə tərəfindən verilir. Mükafat Stokholmda 10 dekabr - Alfred Nobelin ölüm ildönümü ilə bağlı illik mərasimdə təqdim olunur. Laureatlar bir medal, bir diplom və illər ərzində dəyişən miqdarda pul mükafatı alırlar."},{"page_url":"https://en.wikipedia.org/wiki/Kyllinga","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Starr_030807-0056_Kyllinga_nemoralis.jpg","page_title":"Kyllinga","context_page_description":"Kyllinga is genus of flowering plants in the sedge family known commonly as spikesedges. They are native to tropical and warm temperate areas of the world, especially tropical Africa. These sedges vary in morphology, growing to heights from 2 centimeters to a meter and sometimes lacking rhizomes. They are closely related to Cyperus species and sometimes treated as part of a more broadly circumscribed Cyperus.\\nThe genus was named for the 17th century Danish botanist Peder Lauridsen Kylling.\\nSpecies include:\\nKyllinga brevifolia\\nKyllinga coriacea\\nKyllinga erecta\\nKyllinga exigua\\nKyllinga gracillima\\nKyllinga melanosperma\\nKyllinga nemoralis\\nKyllinga odorata\\nKyllinga planiculmis\\nKyllinga polyphylla\\nKyllinga pumila\\nKyllinga squamulata\\nKyllinga tibialis\\nKyllinga triceps\\nKyllinga vaginata"},{"page_url":"https://en.wikipedia.org/wiki/The_Favourite","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Hatfield_House.jpg","page_title":"The Favourite","context_page_description":"The Favourite is a 2018 period black comedy film directed by Yorgos Lanthimos, and written by Deborah Davis and Tony McNamara. It is a co-production of studios based in the United Kingdom, Ireland, and the United States. Set in early 18th century Great Britain, the film's plot examines the relationship between two cousins, Sarah, Duchess of Marlborough and Abigail Masham, who are vying to be Court favourite of Queen Anne. Principal photography lasted from March to May 2017, taking place at Hatfield House in Hertfordshire and at Hampton Court Palace.\\nThe Favourite premiered on 30 August 2018 at the 75th Venice International Film Festival, where it won the Grand Jury Prize and the Volpi Cup for Best Actress for Colman. It was theatrically released in the United States on 23 November 2018 by Fox Searchlight Pictures, and in the United Kingdom and Ireland on 1 January 2019. The film became a box office success, grossing $95 million worldwide on a $15 million budget.\\nThe Favourite was praised for the performances of the three leads, and it received numerous awards and nominations, including ten Academy Award nominations, tying Roma for the most nominations of that year."},{"page_url":"https://de.wikipedia.org/wiki/Luftsportger%C3%A4t","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Gyrocopter_L%C3%B6chgau_2010.JPG","page_title":"Luftsportgerät","context_page_description":"Die Luftsportgeräte umfassen eine Gruppe von Fluggeräten, bei denen die Sportausübung als Hauptverwendungszweck angesehen werden kann. Als Luftsportgeräte gelten Ultraleichtflugzeuge, Tragschrauber und Leichte Luftsportgeräte mit einer Leermasse von unter 120 kg. Zu den Leichten Luftsportgeräten zählen die Hängegleiter, Gleitschirme, Fallschirme, Trikes und Motorschirme.\\nHistorisch gesehen handelt es sich überwiegend um neuere Luftfahrtgeräte, die aufgrund der schnellen technischen und sportlichen Weiterentwicklungen teilweise nicht in luftrechtliche Definitionen passen oder denen solche oft nicht gerecht werden. Dies führt länder- wie geräteabhängig zu unterschiedlichen rechtlichen Stellungen von Luftsportgeräten und deren Piloten: Einige Länder versuchen, ihr Luftrecht anzupassen und fassen dabei beispielsweise verschiedene Luftsportgeräte zu einer eigenen Klasse innerhalb der Luftfahrzeuge zusammen, während in anderen Ländern „altes Recht“ angewendet oder Luftsportgeräte rechtlich gar nicht eingeordnet werden."},{"page_url":"https://cv.wikipedia.org/wiki/%D3%B2%D1%85%D0%BB%C4%95%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Bromus_kalmii.jpg","page_title":"Ӳхлĕм","context_page_description":"ӳхлĕм - тырă йышне кĕрекен нумай çул ӳсекен курăксен йăхĕ. Литературăра 100-400 тĕс пирки пĕлтереççĕ, анчах хальхи таксономи 160-170 тĕс уйăрать. Выльăх валли утă хатерлеме анлă усă кураççĕ."},{"page_url":"https://fr.wikipedia.org/wiki/Chronologie_des_techniques_d%27%C3%A9clairage","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Lampe_a_graisse_-_Lascaux.jpg","page_title":"Chronologie des techniques d'éclairage","context_page_description":"L'éclairage est l'ensemble des moyens qui permettent à l'homme de doter son environnement des conditions de luminosité qu'il estime nécessaires à son activité ou son agrément. Une chronologie des techniques d'éclairage s'attache éventuellement à décrire :\\nles mutations technologiques attachées à l’évolution des sources d'approvisionnement en énergie ;\\nl'évolution technique des lampes et luminaires ;\\nles transformations qui se sont effectuées au sein de certaines typologies :\\nl'éclairage domestique,\\nl'éclairage public,\\nles phares et les signalisations lumineuses en général,\\nl'éclairage des théâtres et salles de spectacle."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D1%80%D0%B4%D0%B5%D0%BD_%D0%9B%D1%8C%D0%B2%D0%B0_%D0%B8_%D0%A1%D0%BE%D0%BB%D0%BD%D1%86%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Militair_Kleinood_van_de_Orde_van_de_Leeuw_en_de_Zon_IIIe_Klasse_Perzie_1890.jpg","page_title":"Орден Льва и Солнца","context_page_description":"Орден Льва и Солнца — персидский орден, учреждённый Фетх Али-шахом в 1808 году. За основу орденского знака взята звезда, аналогичная звезде ордена Почётного легиона Франции.\\nОрден был широко известен в Российской империи, так как связи с Персией были очень тесными. Орден для иностранцев был очень доступным — его получали русские чиновники и военные при поездках в Персию. Купцы, торговавшие с Персией, могли купить патент у персидского консула. Персидские подданные награждались этим орденом редко.\\nЗнаки ордена, присуждаемые иностранцам, отличались от знаков персидских подданных. На знаках иностранцев лев изображен мирным, лежащим на фоне восходящего солнца. Причём ленты были зелёного цвета. На знаках персидских подданных лев изображен стоящим с мечом в лапе. Орденская лента могла быть голубого, красного и белого цвета.\\nВ 1939 году орден Льва и Солнца был упразднён шахом Мохаммедом Резой Пехлеви. Ему на смену пришёл орден Хомаюн."},{"page_url":"https://it.wikipedia.org/wiki/Ex_chiesa_di_San_Giovanni_Battista_in_Correzzo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Ex_Chiesa_di_San_Giovanni_Battista_in_Correzzo_Retro.jpg","page_title":"Ex chiesa di San Giovanni Battista in Correzzo","context_page_description":"La chiesa di San Giovanni Battista è un ex edificio religioso che sorge a Correzzo, frazione di Gazzo Veronese, in provincia di Verona.\\nDopo l'ultimazione della moderna parrocchiale, inaugurata nel 1967, il tempio viene chiamato dalla popolazione \\"Ciesa Vecia\\", ovvero chiesa vecchia."},{"page_url":"https://hu.wikipedia.org/wiki/Pseudocreobotra_wahlbergi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Pseudocreobotra_wahlbergii_03.jpg","page_title":"Pseudocreobotra wahlbergi","context_page_description":"A Pseudocreobotra wahlbergi a rovarok osztályának fogólábúak rendjébe, ezen belül a Hymenopodidae családjába tartozó faj."},{"page_url":"https://vi.wikipedia.org/wiki/Rudolf_Schuster","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Rudolf_Schuster_2011.jpg","page_title":"Rudolf Schuster","context_page_description":"Rudolf Schuster là Tổng thống Slovakia từ năm 1999 đến 2004. Ông được bầu vào ngày 29 tháng 5 năm 1999 và tấn phong vào ngày 15 tháng 6. Trong cuộc bầu cử tổng thống tháng 4 năm 2004, trong đó ông tìm cách tái đắc cử, Schuster đã bị đánh bại. Ông chỉ nhận được 7,4% phiếu bầu, với ba ứng cử viên khác nhận được nhiều hơn thế. Ông đã kế nhiệm bởi Ivan Gašparovič."},{"page_url":"https://eu.wikipedia.org/wiki/Maramure%C5%9F_konderria","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Actual_Maramures_county_CoA.png","page_title":"Maramureş konderria","context_page_description":"Maramureș konderria Errumaniako Nord-Vest eskualdeko konderrietako bat da. Bere hiriburua Baia Mare da. 6.304 kilometro koadro ditu eta 516.562 biztanle zituen 2006an."},{"page_url":"https://ceb.wikipedia.org/wiki/Myrmoteras","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Myrmoteras_iriodum_casent0003210_profile_1.jpg","page_title":"Myrmoteras","context_page_description":"Henero sa mga holmigas ang Myrmoteras. Ang Myrmoteras sakop sa kabanay nga holmigas."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B5%E3%83%9F%E3%83%A5%E3%82%A8%E3%83%AB%E3%83%BB%E3%83%89%E3%82%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Secretary_of_Defense_Caspar_W._Weinberger_-_Samuel_K._Doe.jpg","page_title":"サミュエル・ドウ","context_page_description":"サミュエル・カニオン・ドウはリベリアの軍人、政治家。同国大統領を務めた。民族主義を基盤とした独裁と政治的反対者への苛烈な抑圧をその政治運営の特徴とした。姓はドゥ、ドエ、ドーとも表記する。"},{"page_url":"https://nl.wikipedia.org/wiki/Odrzechowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Odrzechowa_-_Ko%C5%9Bci%C3%B3%C5%8201.jpg","page_title":"Odrzechowa","context_page_description":"Odrzechowa is een plaats in het Poolse district Sanocki, woiwodschap Subkarpaten. De plaats maakt deel uit van de gemeente Zarszyn en telt 1400 inwoners."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D1%96%D0%B9%D1%86%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%B0_%D1%80%D0%B8%D0%B1%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Betta_fusca_Paarung_1.jpg","page_title":"Бійцівська рибка","context_page_description":"Бетта, або бійцівська рибка — це великий рід барвистих прісноводних окунеподібних рибок родини Осфронемові.\\nНазва роду походить від місцевої малайської назви його видів — ikan betah.\\nПершою описаною бійцівською рибкою була Panchax pictum Valenciennes з острова Ява, але сам рід Betta був утворений пізніше. Це зробив Пітер Блікер 1850 року, встановивши типовим видом для нового роду B. trifasciata, також з Яви. Згодом, 1879 року, він же визначив, що це один і той самий вид риб, і він має називатись B. picta.\\nБійцівські рибки утворюють найбільший рід лабіринтових риб. Більшість відомих нині видів Betta були описані, починаючи з 1980-х рр. Описи нових видів постійно з'являються на сторінках наукових, а іноді й акваріумних видань. Селекціонери стали розводити цих рибок і зробили їх доступними для любителів та спеціалістів. Це, в свою чергу, спонукало науковців для роботи в цій галузі.\\nBetta є одним з найвідоміших родів прісноводних риб, головним чином завдяки популярності лише одного з його представників — сіамської бійцівської рибки. Цей вид є дуже популярним серед любителів акваріумів завдяки своїй красивій зовнішності."},{"page_url":"https://fr.wikipedia.org/wiki/Sanctuary_(s%C3%A9rie_t%C3%A9l%C3%A9vis%C3%A9e)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Dunne-Tapping.jpg","page_title":"Sanctuary (série télévisée)","context_page_description":"Sanctuary ou Le Sanctuaire au Québec est une série télévisée canadienne en huit webisodes et 59 épisodes de 42 minutes créée par Damian Kindler et diffusée entre le 3 octobre 2008 et le 30 décembre 2011 sur Sci Fi Channel / Syfy aux États-Unis, et au Canada sur The Movie Network et Movie Central pour la première saison puis sur Space.\\nEn France, la série a été diffusée à partir du 17 mars 2009 sur Syfy Universal et le 25 août 2009 sur NRJ 12 ; au Québec depuis le 24 août 2009 sur Ztélé, et en Belgique sur Plug RTL."},{"page_url":"https://et.wikipedia.org/wiki/Kolinda_Grabar-Kitarovi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Kolinda_Grabar-Kitarovi%C4%87ile_%2834771463620%29.jpg","page_title":"Kolinda Grabar-Kitarović","context_page_description":"Kolinda Grabar-Kitarović on Horvaatia poliitik, diplomaat. 11. jaanuaril 2015 võitis ta Horvaatia presidendivalimised ning oli 15. veebruarist 2015 kuni 18. veebruarini 2020 Horvaatia president.\\nTa sündis Rijekas, kuid kasvas üles Los Alamoses. Ta on lõpetanud Zagrebi ülikooli filosoofiateaduskonna inglise ja hispaania keele ja kirjanduse alal.\\nTa on olnud Horvaatia eurointegratsiooniminister, Horvaatia välisminister, Horvaatia saadik USA-s ja ÜRO peasekretäri abi avaliku diplomaatia küsimustes."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9E%D1%80%D1%82%D0%B5%D0%BD%D0%B0%D1%83","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Weinanbau-ortenau.jpg","page_title":"Ортенау","context_page_description":"Ортенау е историческа територия в Горнорейнската долина и предпланинската зона на Шварцвалд в Баден-Вюртемберг, Германия.\\nОртенау има дължина от 70 км дължина с главен град Офенбург.\\nОртенау се казва първо Мортенау, и е среновековно гау-графство в Херцогство Швабия."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B8%AD%E5%9B%BD%E4%BA%BA%E6%B0%91%E8%A7%A3%E6%94%BE%E5%86%9B%E6%80%BB%E6%94%BF%E6%B2%BB%E9%83%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Xu_Liqing.jpg","page_title":"中国人民解放军总政治部","context_page_description":"中國人民解放軍總政治部，標準簡稱總政治部，亦簡稱總政，是中國人民解放軍已撤銷的一個政治工作機關。\\n總政治部負責中國人民解放軍的宣傳、思想政治、青年、組織、紀律工作，並負責保衛及對外聯絡工作。\\n總政治部前身是1930年創建的中共中央軍委總政治部，1954年正式改稱現名。2016年1月，在深化國防和軍隊改革中，決定撤銷總政治部。拆分為中央軍事委員會政治工作部、紀律檢查委員會、政法委員會等三個部門。"},{"page_url":"https://en.wikipedia.org/wiki/Tiffany_Weimer","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Tiffany_Weimer_071517_02.jpg","page_title":"Tiffany Weimer","context_page_description":"Tiffany Marie Weimer is an American soccer forward, who plays for FC Nordsjælland."},{"page_url":"https://en.wikipedia.org/wiki/Crawley","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Goff%27s_Park_House%2C_Crawley%2C_Winter_Scene.jpg","page_title":"Crawley","context_page_description":"Crawley is a large town and borough in West Sussex, England. It is 28 miles south of London, 18 miles north of Brighton and Hove, and 32 miles north-east of the county town of Chichester. Crawley covers an area of 17.36 square miles and had a population of 106,597 at the time of the 2011 Census.\\nThe area has been inhabited since the Stone Age, and was a centre of ironworking in Roman times. Crawley developed slowly as a market town from the 13th century, serving the surrounding villages in the Weald. Its location on the main road from London to Brighton brought passing trade, which encouraged the development of coaching inns. A rail link to London opened in 1841.\\nGatwick Airport, nowadays one of Britain's busiest international airports, opened on the edge of the town in the 1940s, encouraging commercial and industrial growth. After the Second World War, the British Government planned to move large numbers of people and jobs out of London and into new towns around South East England. The New Towns Act 1946 designated Crawley as the site of one of these."},{"page_url":"https://ca.wikipedia.org/wiki/Operaci%C3%B3_Entebbe","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Entebbe-international-airport-2009-003.jpg","page_title":"Operació Entebbe","context_page_description":"L'Operació Entebbe fou una missió de rescat d'ostatges duta a terme per les Forces de Defensa d'Israel a l'aeroport d'Entebbe a Uganda el 4 juliol 1976. Una setmana abans, el 27 de juny, una aeronau d'Air France amb 248 passatgers va ser segrestada per terroristes palestins i simpatitzants, i prengué rumb a Entebbe, prop de Kampala, la capital d'Uganda. Poc després de l'aterratge tots els passatgers no jueus van ser alliberats.\\nLes accions de les FDI es van basar en la informació subministrada per l'agència d'intel·ligència israeliana, el Mossad. L'operació es va planejar a conseqüència del segrest per part de l'organització militant Cèl·lules Revolucionàries i el Front Popular per a l'Alliberament de Palestina, al costat de l'amenaça dels segrestadors de matar els ostatges si no es complien les seves exigències d'alliberament de presos. El pla també incloïa preparació contra una eventual resistència armada per part de les tropes ugandeses.\\nL'operació de rescat es va executar a la nit, quan van ser transportats per via aèria 100 comandos d'elit israelians a més de 2.500 km de distància fins a Uganda."},{"page_url":"https://en.wikipedia.org/wiki/Charles_Duncan_McIver","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/Charles_Duncan_McIver.jpg","page_title":"Charles Duncan McIver","context_page_description":"Charles Duncan McIver was the founder and first president of the institution now known as The University of North Carolina at Greensboro.\\nHe was born 1860 in Lee County, North Carolina and graduated from UNC-Chapel Hill, where he was a member of the Dialectic and Philanthropic Societies, in 1881. McIver became a teacher in Durham and Winston North Carolina until 1889 when he and Edwin A. Alderman were chosen by the Office of the Superintendent of Public Instruction to hold teacher institutes across the state.\\nAs crusaders for women′s education, McIver and Alderman first drew up a plan for a state-supported teachers′ college in 1886. In 1891, they advocated for a new bill focused on a teachers′ college specifically for women. The North Carolina legislature passed this bill, and issued a charter for a ″Normal and Industrial School for White Girls″ on February 18, 1891.\\nMcIver was chosen to be the first president of the State Normal and Industrial School, which opened to students on October 5, 1892. In addition to serving as president, he also taught many of the courses in the pedagogy department. His initial salary was $2250 per year.\\nMcIver was married to Lula V."},{"page_url":"https://pt.wikipedia.org/wiki/Bas%C3%ADlica_de_Santa_Clara","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/332AssisiSChiara.jpg","page_title":"Basílica de Santa Clara","context_page_description":"A Basílica de Santa Clara é um templo católico da Itália, localizado em Assis e dedicado a Santa Clara de Assis, fundadora da ordem das Clarissas. Foi construído a partir de um projeto de Filippo Campello, e recebeu as relíquias de Santa Clara em 1260.\\nNesta basílica se encontra, em uma cripta de vidro, o corpo de Santa Clara, encontrado intacto no século XI e o crucifixo de São Damião original.\\nConstruída entre 1257 e 1265 em estilo gótico italiano, a Basílica domina a área com a simplicidade de sua fachada geométrica."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%83%A7%E3%83%BC%E3%82%B86%E4%B8%96_(%E3%82%A4%E3%82%AE%E3%83%AA%E3%82%B9%E7%8E%8B)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Special_Film_Project_186_-_Buckingham_Palace_2.jpg","page_title":"ジョージ6世 (イギリス王)","context_page_description":"ジョージ6世は、グレートブリテンおよび北アイルランド連合王国ならびに海外自治領の国王。また、最後のインド皇帝にして、最初のイギリス連邦元首 でもあった。"},{"page_url":"https://uk.wikipedia.org/wiki/7,62%C3%9754_%D0%BC%D0%BC_R","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/59/76254Rvariety.jpg","page_title":"7,62×54 мм R","context_page_description":"\uFEFF7,62×54 мм R — унітарний гвинтівковий набій з гільзою із закраїною, що виступає розмірністю 7,62×53,72 мм, загальна максимальна довжина патрона становить 77,16 мм, а куля має діаметр 7,62 мм та енергією 3990 Дж."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%9A%D1%83%D1%80%D0%B8%D1%82%D0%B8%D0%B1%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/%27JardimBotanico.BotanicalGarden.CuritibaParanaBrasilBrazil.JPG","page_title":"Куритиба","context_page_description":"Куритиба - Бразилин гӀала."},{"page_url":"https://fr.wikipedia.org/wiki/Feng_Chun-kai","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Fourmies_-_Grand_Prix_de_Fourmies%2C_6_septembre_2015_%28B207%29.JPG","page_title":"Feng Chun-kai","context_page_description":"Feng Chun-kai est un coureur cycliste taïwanais, membre de l'équipe Bahrain-McLaren."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%84%E0%B8%99%E0%B8%AD%E0%B8%B1%E0%B8%A5%E0%B8%A5%E0%B9%8C_%E0%B8%A1%E0%B8%B1%E0%B8%81%E0%B8%81%E0%B8%B4%E0%B8%99%E0%B8%99%E0%B9%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/1-Niall_McGinn.jpg","page_title":"ไนอัลล์ มักกินน์","context_page_description":"ไนอัลล์ มักกินน์ เป็นนักฟุตบอลชาวไอร์แลนด์เหนือผู้เล่นให้กับแอเบอร์ดีนในสกอตติชพรีเมียร์ชิป ก่อนหน้านี้เขาเคยเล่นให้กับดังกานอนสวิฟต์, แดร์รีซิตี, เซลติก, เบรนต์ฟอร์ด และควังจู สโมสรในเกาหลีใต้ เขาลงเล่นนัดแรกให้กับทีมชาตินอร์เทิร์นไอร์แลนด์ใน ค.ศ. 2008 และเป็นส่วนหนึ่งของทีมชาติชุดลุยศึกฟุตบอลชิงแชมป์แห่งชาติยุโรป 2016 โดยทำประตูได้ในนัดที่เอาชนะยูเครน 2–0"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D9%84%D9%8A%D9%85%D9%86%D8%AA%D9%8A_%D8%B1%D9%88%D8%B3%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Clemente_Russo_Rio2016.jpg","page_title":"كليمنتي روسو","context_page_description":"كليمنتي روسو ‏ هو ملاكم إيطالي، مثّل بلاده في الألعاب الأولمبية الصيفية في دورات 2004 و2008 و2012."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A2%D0%B5%D0%B4%D0%B8_%D0%9C%D0%B5%D0%B7%D0%B0%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/2018-02-22_Entrainement_excel-73_Teddy_Mezague.jpg","page_title":"Теди Мезаг","context_page_description":"Мелонца Теди Уилям Мезаг е френски футболист, който играе на поста централен защитник. Състезател на Берое."},{"page_url":"https://ro.wikipedia.org/wiki/L%C3%A9az","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Map_commune_FR_insee_code_01209.png","page_title":"Léaz","context_page_description":"Léaz este o comună în departamentul Ain din estul Franței."},{"page_url":"https://en.wikipedia.org/wiki/Suaeda_pulvinata","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Suaeda_pulvinata.JPG","page_title":"Suaeda pulvinata","context_page_description":"Suaeda pulvinata is an endemic seepweed from Mexico. It lives in the shores of Lake Texcoco and Lake Totolcingo. It lives underwater as an aquatic plant for half of the year and in dry land as a terrestrial plant for the other half due to the changing levels of the lakes that it inhabits. It is a perennial flat herb with prostrate stems. Its leaves and inflorescences are green to reddish in color.\\nThis species is important for people that live in the states of Puebla and Tlaxcala, as it is an edible vegetable. The dish that is prepared using this species is known as romeritos.\\nIt has been found in molecular phylogenetic studies that this taxon is monophyletic. Due to differences in its phylogenetic position in its nuclear ITS tree and its chloroplast rpl32-trnL tree, it is thought this species is the result of hybridization of ancestral species of Suaeda.\\nThe first scientific collector who found this plant was Efraim Hernandez Xolocotzi. Later, it was cited by Guadalupe Ramos in her university degree thesis. However, she misidentified it for S. nigra. It was in 2013 that Ernesto Alvarado Reyes and Hilda Flores Olvera noticed it was a different species."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Bucheneck","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Soultz_Ch%C3%A2tBucheneck_09.JPG","page_title":"Château de Bucheneck","context_page_description":"Le château de Bucheneck est un monument historique situé à Soultz-Haut-Rhin, dans le département français du Haut-Rhin."},{"page_url":"https://no.wikipedia.org/wiki/Neiden_kirke","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Neiden_kirke_01.jpg","page_title":"Neiden kirke","context_page_description":"Neiden kirke er en langkirke i fra 1902 i Sør-Varanger kommune, Troms og Finnmark fylke. Den er tegnet av arkitekt Karl Norum."},{"page_url":"https://no.wikipedia.org/wiki/Klaverkonsert_nr._1_(Tsjajkovskij)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Piano_Concerto_No._1_%28Tchaikovsky%29.png","page_title":"Klaverkonsert nr. 1 (Tsjajkovskij)","context_page_description":"Klaverkonsert nr. 1 i b-moll, op. 23, er en konsert for klaver og orkester skrevet av den russiske komponisten Pjotr Tsjajkovskij mellom november 1874 og februar 1875. Den er en av Tsjajkovskijs aller mest kjente komposisjoner og blant de mest kjente klaverkonsertene som noensinne er skrevet.\\nVerket består av tre satser:\\nAllegro non troppo e molto maestoso — Allegro con spirito\\nAndantino semplice — Prestissimo\\nAllegro con fuoco"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D1%96%D0%B2%D0%BE%D0%B1%D0%B5%D1%80%D0%B5%D0%B6%D0%BD%D0%B0_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D1%96%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/%D0%9A%D0%B0%D1%81%D1%81%D1%8B_%D0%BB%D0%B5%D0%B2%D0%BE%D0%B1%D0%B5%D1%80%D0%B5%D0%B6%D0%BD%D0%B0%D1%8F.jpg","page_title":"Лівобережна (станція метро)","context_page_description":"«Лівобере́жна» — 9-та станція Київського метрополітену. Розташована на Святошинсько-Броварській лінії між станціями «Гідропарк» і «Дарниця». Відкрита 5 листопада 1965 року."},{"page_url":"https://en.wikipedia.org/wiki/University_of_Tours","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Polytech_Tours_Portalis.jpg","page_title":"University of Tours","context_page_description":"The University of Tours, till 18 December 2017 François Rabelais University of Tours, is a public university in Tours, France. The university was formerly named after the French writer François Rabelais, and was founded in 1969. It is the largest university in the Centre-Val de Loire region. As of July 2015 it is a member of the regional university association Leonardo da Vinci consolidated University."},{"page_url":"https://en.wikipedia.org/wiki/Ankit_Trivedi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Harsh_Chhaya%2C_Ankit_Trivedi_and_Abhishek_Jain.png","page_title":"Ankit Trivedi","context_page_description":"Ankit Trivedi is a Gujarati language poet, writer, columnist, and emcee from Gujarat, India. His significant works include Gazal Purvak and Geet Purvak. The Indian National Theater in Mumbai awarded him the 2008 Shayda Award for his contribution to Gujarati ghazal. He has received the Takhtasinh Parmar Prize literary award, Yuva Gaurav Puraskar award, and the Yuva Puraskar award. He edited Gazalvishwa, a Gujarati ghazal poetry journal, from 2006 to 2007."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%83%A0%E6%99%AE%E5%9B%BE%E5%BD%A2%E8%AE%A1%E7%AE%97%E5%99%A8%E5%AF%B9%E6%AF%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/HP39g%2B.jpg","page_title":"惠普图形计算器对比","context_page_description":"图形计算器是能够绘制图表和解决复杂问题的一类手持计算器。有许多公司生产图形计算器，惠普是一家主要制造商。\\n下表比较常规和技术信息精选的常见和不常见的惠普图形计算器。"},{"page_url":"https://fr.wikipedia.org/wiki/D._C._Thomson_%26_Co.","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/DC_Thomson_Dundee_Meadowside_south_east_face_alt_%28post_refurb%29_%28corrected%29.jpg","page_title":"D. C. Thomson & Co.","context_page_description":"D. C. Thomson & Co. est un éditeur de presse britannique basé à Dundee, en Écosse, depuis sa fondation par David Coupar Thomson en 1905. Il publie des journaux, des magazines et des revues de bande dessinée pour enfants."},{"page_url":"https://zh.wikipedia.org/zh-my/%E9%9B%86%E5%90%88%E4%BD%8F%E5%AE%85","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Gillsonroom.jpg","page_title":"集合住宅","context_page_description":"集合住宅是有多个住宅单元，具有共同基地和共同空间或设备，或共同持分土地产权、公共设施的建筑物。符合条件的公寓、公寓大厦、透天厝、透天独栋、别墅社区、住宅大厦及住商大楼等皆可属之。在台湾适用《公寓大厦管理条例》。中国大陆依据《物业管理条例》进行管理。\\n集合住宅最早可以追溯到古罗马时期中下阶层罗马人所居住的贫民住宅——因苏拉。中国代表性建筑有福建土楼。最早的公营住宅是伦敦郡议会所规划的Boundary Estate。\\n在台湾、香港、澳门、新加坡等人口密度高的地方，以及各国都市区经常可以看到各种集合住宅。物业管理单位有权决定居住单位经营、销售、出租的方式。文化及与法律制度等因素影响了各国住宅自有率和集合住宅主要的运作模式。欧洲的租屋比例高，尤以瑞士、德国、奥地利为最。德语表示集合住宅的词Mietshaus意思即为“出租公寓”。瑞士、德国政府强力保障干预市场，限制租金调整、要求房东义务，且不得片面终止合约。相较瑞士的43%住宅自有率，日本为61%，台湾85%，新加坡、中国大陆则在90%以上。"},{"page_url":"https://en.wikipedia.org/wiki/William_Cohen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/U.S._Secretary_of_Defense_William_Cohen_in_South_Korea%2C_January_1998.jpg","page_title":"William Cohen","context_page_description":"William Sebastian Cohen is an American politician, lawyer and author from the U.S. state of Maine. A Republican, Cohen served as both a member of the United States House of Representatives and Senate, and as Secretary of Defense under Democratic President Bill Clinton.\\nDescribed as \\"a Republican moderate from Maine, something of a maverick centrist\\" by David Halberstam, Cohen had very good working relations with President Clinton and National Security Adviser Sandy Berger and \\"almost ideal\\" collaboration with the Joint Chiefs of Staff; however, he often clashed with Secretary of State Madeleine Albright, whom he saw as \\"a grandstander, too outspoken on policy matters and too eager to use military force\\"."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B5%D0%BD%D0%B4%D0%B5%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%B7%D0%BE%D0%B4%D0%B8%D0%B0%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Eclipse-lunaire-du-zodiaque-de-denderah.jpg","page_title":"Дендерский зодиак","context_page_description":"Дендерский зодиак — древнеегипетский астрономический барельеф в храмовом комплексе Хатхор в Дендере. Находился на потолке пронаоса часовни, посвящённой Осирису. Содержит изображения 12 знаков зодиака.\\nСтроительство часовни было начато в поздний период Птолемеев; её пронаос был добавлен при императоре Тиберии. Это позволило Шампольону датировать рельеф греко-римским периодом, однако большинство его современников относили его к Новому царству.\\nДанный рельеф, который Джон Х. Роджерс характеризовал как «единственную полную карту древнего неба, которую мы имеем», предположительно служил основой, на которой были построены более поздние астрономические системы. Сейчас зодиак находится во Франции, в Лувре."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%B8%E0%B5%8D%E0%B4%95%E0%B4%BE%E0%B5%BC%E2%80%8C%E0%B4%A1%E0%B5%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Indus_at_Skardu_%281%29.jpg","page_title":"സ്കാർ‌ഡു","context_page_description":"പാകിസ്താന്റെ നിയന്ത്രണത്തിലുള്ളതും ഔദ്യോഗികമായി ഇന്ത്യക്ക് അവകാശപ്പെട്ടതുമായ ഗിൽഗിത്-ബാൾട്ടിസ്ഥാൻ മേഖലയിലെ ഒരു അധിനിവേശ നഗരമാണ് സ്കാർ‌ഡു. ഇത് സ്കാർ‌ഡു ജില്ലയുടെ തലസ്ഥാനമായി പ്രവർത്തിക്കുന്നു. സിന്ധു, ഷിഗാർ നദികളുടെ സംഗമസ്ഥാനത്ത് 10 കിലോമീറ്റർ വീതിയും 40 കിലോമീറ്റർ നീളമുള്ള സ്കാർഡു താഴ്വരയിൽ സമുദ്രനിരപ്പിൽനിന്ന് ഏകദേശം 2,500 മീറ്റർ ഉയരത്തിലാണ് ഈ നഗരം സ്ഥിതിചെയ്യുന്നത്. സമീപത്തുള്ള കാരക്കോറം പർവതനിരയിലെ നയൻ തൌസന്റേർസിലേയ്ക്കുള്ള ഒരു പ്രധാന കവാടമാണ് ഈ നഗരം. കാരക്കോറം പർവതനിരയെ ഹിമാലയത്തിൽനിന്ന് വേർതിരിക്കുന്ന സിന്ധു നദിയോരത്താണ് ഈ നഗരം നിലനിൽക്കുന്നത്."},{"page_url":"https://de.wikipedia.org/wiki/Birte_Wentzek","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/2015-03-02-Sepp_Schauer%2C_Birte_Wentzek_6364.jpg","page_title":"Birte Wentzek","context_page_description":"Birte Wentzek ist eine deutsche Schauspielerin."},{"page_url":"https://ca.wikipedia.org/wiki/Th%C3%A9%C3%A2tre_des_Folies-Dramatiques","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Th%C3%A9%C3%A2tre_des_Folies-Dramatiques_on_the_rue_de_Bondy_1905_-_Chauveau_1999_p242.jpg","page_title":"Théâtre des Folies-Dramatiques","context_page_description":"El Théâtre des Folies-Dramatiques és un antic teatre parisenc construït al Boulevard du Temple l'any 1830 al lloc de l'antic Ambigu destruït pel foc el 1827. El seu primer director va ser el dramaturg Leopold Chandezon.\\nEs va convertir en una meca de melodrama sota l'empenta de Frédérick Lemaître, es va traslladar en 1862 a la rue de Bondy i aviat s'especialitza en l'opereta. Charles Lecocq ofereix La Fille de Madame Angot en 1873, Robert Planquette Les Cloches de Corneville en 1877, Jacques Offenbach La Fille du tambour-major en 1879 i André Messager La Béarnaise en 1887.\\nEl 1930, el teatre es va transformar en cinema.\\nTota l'obra Frédérick o l'avinguda del crim d'Eric-Emmanuel Schmitt té lloc al Teatre dels folies dramàtics, a l'escenari, darrere de les escenes, a casa, als vestidors."},{"page_url":"https://be.wikipedia.org/wiki/%D0%90%D0%B1%E2%80%99%D1%8F%D0%B4%D0%BD%D0%B0%D0%BD%D0%BD%D0%B5_%D0%94%D1%83%D0%BD%D0%B0%D0%B9%D1%81%D0%BA%D1%96%D1%85_%D0%BA%D0%BD%D1%8F%D1%81%D1%82%D0%B2%D0%B0%D1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Kiseleff.jpg","page_title":"Аб’яднанне Дунайскіх княстваў","context_page_description":"Аб'ядна́нне Дуна́йскіх кня́стваў — працэс стварэння дзяржавы Румынія з 1858 па 1861 год, які заключаўся ў аб'яднанні Дунайскіх княстваў у адзіную дзяржаву. Скончыўся ўзнікненнем Аб'яднанага княства Валахіі і Малдавіі. Узнікненне новай дзяржавы прызнана Асманскай імперыяй у 1861 годзе. Стварэнне новай дзяржавы дазволіла заяродзіцца на правядзенні ліберальных рэформаў і фарміраванні нацыянальнай эканомікі, што дало штуршок развіццю Румыніі ў цэлым.\\nУ Румыніі падзея вядома пад назвай Малое аб'яднанне. Таксама выядзяляецца Вялікае аб'яднанне, калі ў склад дзяржавы увашлі Трансільванія Бесарабія і Букавіна."},{"page_url":"https://pt.wikipedia.org/wiki/Daniel_Mudau","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/DanielMudau1995.jpg","page_title":"Daniel Mudau","context_page_description":"Daniel Mudau é um ex-futebolista profissional sul-africano que atuava como atacante."},{"page_url":"https://sco.wikipedia.org/wiki/Petr%C3%B3polis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/RiodeJaneiro_Municip_Petropolis.svg","page_title":"Petrópolis","context_page_description":"Petrópolis, elknamit The Imperial Ceety o Brazil, is a ceety in the state o Rio de Janeiro, at a distance o 68 km frae the state caipital."},{"page_url":"https://he.wikipedia.org/wiki/%D7%92%D7%99%D7%9C%D7%99%D7%95%D7%A0%D7%99%D7%AA_%D7%96%D7%99%D7%9B%D7%A8%D7%95%D7%9F_-_%D7%AA%D7%91%D7%99%D7%91_1960","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Israel_Block_1960_TAVIV_part_17.jpg","page_title":"גיליונית זיכרון - תביב 1960","context_page_description":"גיליונית זיכרון - תביב 1960 הונפקה על ידי דואר ישראל לרגל תערוכת הבולים הארצית \\"תביב\\", שהתקיימה בתל אביב בחודש אוקטובר 1960. בפריט בולאי זה נכללו חידושים רבים, עיצוביים וטכניים כאחד. השירות הבולאי שילב בעיצוב הגיליונית קטע מתוך תחריט עתיק, המתאר את המצעד המפואר שיזמה הקהילה היהודית של העיר פראג בשנת 1741."},{"page_url":"https://el.wikipedia.org/wiki/%CE%94%CE%B9%CE%AC%CE%BD%CF%85%CF%83%CE%BC%CE%B1_%CE%9B%CE%B1%CF%80%CE%BB%CE%AC%CF%82%E2%80%93%CE%A1%CE%B1%CE%BD%CF%84%CE%B6%E2%80%93%CE%9B%CE%B5%CE%BD%CF%84%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Relativistic_precession.svg","page_title":"Διάνυσμα Λαπλάς–Ραντζ–Λεντς","context_page_description":"Στην κλασική μηχανική, το διάνυσμα Λαπλάς-Ραντζ-Λεντς είναι ένα διάνυσμα που χρησιμοποιείται κυρίως για να περιγράψει το σχήμα και τον προσανατολισμό της τροχιάς ενός αστρονομικού σώματος γύρω από ένα άλλο, όπως ένας πλανήτης περιστρέφεται γύρω από ένα αστέρι. Για δύο σώματα που αλληλεπιδρούν με νευτώνεια βαρύτητα, το LRL διάνυσμα είναι μια σταθερά της κίνησης, πράγμα που σημαίνει ότι είναι το ίδιο χωρίς να έχει σημασία που υπολογίζεται στην τροχιά, ισοδύναμα, το LRL διάνυσμα λέγεται ότι πρέπει να διατηρηθεί. Γενικότερα, το LRL διάνυσμα διατηρείται σε όλα τα προβλήματα στα οποία αλληλεπιδρούν δύο σώματα ωθούμενα από μια κεντρική δύναμη που μεταβάλλεται ως το αντίστροφο τετράγωνο της απόστασης μεταξύ τους. Τέτοια προβλήματα ονομάζονται προβλήματα Κέπλερ.\\nΤο άτομο του υδρογόνου είναι ένα πρόβλημα Κέπλερ, δεδομένου ότι περιλαμβάνει δύο φορτισμένα σωματίδια που αλληλεπιδρούν σύμφωνα με το νόμο του Κουλόμπ της ηλεκτροστατικής, μια άλλη κεντρική δύναμη του αντίστροφου τετράγωνου. Το διάνυσμα LRL ήταν απαραίτητο στην πρώτη κβαντική μηχανική παράγωγη του φάσματος του ατόμου του υδρογόνου, πριν από την ανάπτυξη της εξίσωσης Σρέντινγκερ."},{"page_url":"https://fr.wikipedia.org/wiki/Lac_Cold_Boiling","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Cold_Boiling_Lake%2C_Lassen_Volcanic_NP.jpg","page_title":"Lac Cold Boiling","context_page_description":"Le lac Cold Boiling est un lac américain dans le comté de Shasta, en Californie. Il est situé à 2 266 mètres d'altitude au sein du parc national volcanique de Lassen."},{"page_url":"https://vi.wikipedia.org/wiki/S%C3%B4ng_Chuluut","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/ChuluutCanyon.JPG","page_title":"Sông Chuluut","context_page_description":"Sông Chuluut hay Chuluutyn gol là một con sông chảy trong thung lũng của dãy núi Khangai tại miền trung Mông Cổ qua các aimag Arkhangai và Khovsgol. Nó là một chi lưu của sông Ideriin gol, với chiều dài 415 km và chiều rộng tại cửa sông để đổ vào Ideriin gol là 80 m, độ sâu tối đa đạt 3 m. Nó bị đóng băng từ tháng 11 năm trước tới tháng 4 năm sau."},{"page_url":"https://fi.wikipedia.org/wiki/Renault_Clio","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/2008_Renault_Clio_Dynamique_DCI_86_1.5_Front.jpg","page_title":"Renault Clio","context_page_description":"Renault Clio on Renault’n vuodesta 1990 lähtien valmistama pieni automalli, joka korvasi Renault 5:n. Se on jatkuvasti ollut Euroopassa yksi luokkansa myydyimmistä autoista. Japanissa Clioa markkinoidaan nimellä Renault Lutecia, sillä Honda omistaa Japanissa oikeudet Clio-nimeen. Maissa, joissa sedanit ovat perinteisesti olleet hatchback-malleja suositumpia, on myyty Clion neliovista porrasperäversiota useilla eri mallinimillä."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Harlingen_(stad)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Harlingen%2C_Noorderhaven_72.jpg","page_title":"Lijst van rijksmonumenten in Harlingen (stad)","context_page_description":"De stad Harlingen telt 517 inschrijvingen in het rijksmonumentenregister, hieronder een compleet overzicht."},{"page_url":"https://eu.wikipedia.org/wiki/Montereale","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Montereale_%28panorama%29.jpg","page_title":"Montereale","context_page_description":"Montereale Italiako udalerri bat da. L'Aquilako probintzian kokatuta dago, Abruzzo eskualdean. 2.483 biztanle ditu, 104,42 kilometro koadroko azaleran banatuta."},{"page_url":"https://nn.wikipedia.org/wiki/%C3%81ndros_by","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Andros_town.JPG","page_title":"Ándros by","context_page_description":"Ándros by er ein by og ein tidlegare kommune sentralt på øya Ándros i øygruppa Kykladane i periferien Dei sørlege egeiske øyane i Hellas. Ándros by inngår frå 2011 som ei kommunaleining i kommunen Ándros i periferieininga Ándros.\\nVed folketeljinga i 2011 hadde kommunaleininga Ándros by 3 901 innbyggjarar, medan tettstaden med same namn hadde 1 428 innbyggjarar."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Denkm%C3%A4lern_und_Pavillons_im_Karlsbader_Stadtwald","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Kapli%C4%8Dka_U_obrazu_%282%29.jpg","page_title":"Liste von Denkmälern und Pavillons im Karlsbader Stadtwald","context_page_description":"Die Liste von Denkmälern und Pavillons im Karlsbader Stadtwald beinhaltet die wichtigsten Bauten, die in der Zeit von 1790 bis 2000 im Karlsbader Stadtwald errichtet wurden.\\nEin Teil dieser Bauten steht unter Denkmalschutz. Außerdem werden die wichtigsten Kur- und Wanderwege aufgeführt."},{"page_url":"https://pt.wikipedia.org/wiki/Metropolitano","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Tokyo_metro_1000_series_lcd_display_01.png","page_title":"Metropolitano","context_page_description":"O metropolitano, também chamado de metro ou metrô, é um tipo de transporte público de alta capacidade geralmente encontrado em áreas urbanas. Ao contrário de ônibus ou bondes, os metrôs são ferrovias elétricas que operam em uma via de passagem exclusiva, que não pode ser acessada por pedestres ou outros veículos de qualquer espécie e que geralmente é separada em túneis ou em vias férreas elevadas.\\nServiços modernos de metrô são fornecidos em linhas designadas entre estações, geralmente usando várias unidades elétricas em trilhos, embora alguns sistemas usem pneus de borracha guiados, levitação magnética ou monotrilho. As estações normalmente possuem plataformas altas, sem degraus dentro dos trens, o que exige trens feitos sob medida para minimizar os intervalos entre o trem e a plataforma. Eles são tipicamente integrados a outros tipos de transportes públicos. No entanto, alguns sistemas de metrô têm interseções de nível entre uma linha e uma estrada ou entre duas linhas de metrô.\\nO primeiro sistema de metrô do mundo foi o Metropolitan Railway, que era parcialmente subterrâneo e foi inaugurado como uma ferrovia convencional em 1863, mas agora faz parte do metrô de Londres."},{"page_url":"https://sk.wikipedia.org/wiki/Tr%C3%A9glamus","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Treglamus.jpg","page_title":"Tréglamus","context_page_description":"Tréglamus je francúzska obec, ktorá sa nachádza v departemente Côtes-d’Armor, v regióne Bretónsko."},{"page_url":"https://en.wikipedia.org/wiki/Saint-Michel-de-Bellechasse","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/%C3%89glise_St-Michel-de-Bellechasse.jpg","page_title":"Saint-Michel-de-Bellechasse","context_page_description":"Saint-Michel-de-Bellechasse is a municipality of about 1,800 people about 20 km east of Lévis, in Bellechasse Regional County Municipality in the Chaudière-Appalaches region of Quebec, Canada. It is a mostly rural community, and it was chosen as one of the Most Beautiful Villages of Quebec in Quebec. Route 281 passes through it."},{"page_url":"https://fi.wikipedia.org/wiki/Muammar_Gaddafi","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Moatassem_Kadhafi.jpg","page_title":"Muammar Gaddafi","context_page_description":"Muammar Gaddafi, koko nimeltään Muammar bin Mohammad bin Abdussalam bi Humayd bin Abu Manyar bin Humayd bin Nayil al Fuhsi Gaddafi, oli Libyan johtaja 1969–2011. Hänellä ei ollut virallista virkaa tai asemaa, mutta häntä kunnioitettiin vallankumouksen veljellisenä johtajana ja ohjaajana virallisissa valtion tiedotuksissa. Gaddafi nousi 2009 Afrikan unionin puheenjohtajaksi. Helmikuun puolessa välissä 2011 alkoivat Libyassa mielenosoitukset, jotka johtivat sisällissotaan Gaddafia vastaan. Elokuun loppupuolella Gaddafi syrjäytettiin kapinallisten valloitettua maan pääkaupungin Tripolin ja Gaddafin hallintokorttelin.\\nVäliaikaishallinto kertoi 20. lokakuuta saaneensa Gaddafin kiinni Sirtessä ja hänen kuolleen kiinniottotilanteessa saamaansa päähän kohdistuneeseen laukaukseen."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D8%AF%D9%89_%D8%A7%D9%88%D8%A8%D8%B1%D8%A7%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Eddie_O%27Brien_1969.jpg","page_title":"ادى اوبراين","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nادى اوبراين كان لاعب بيسبول من امريكا."},{"page_url":"https://de.wikipedia.org/wiki/Salanoia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Alaotra_carnivore_credit_Fidimalala_Bruno_Ralainasolo.jpg","page_title":"Salanoia","context_page_description":"Salanoia ist eine Gattung der Madagassischen Raubtiere. Sie besteht aus zwei Arten kleiner Raubtiere, dem Schlichtmungo und dem 2010 beschriebenen Salanoia durrelli."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0_%E2%80%9E%D0%A1%D0%B2._%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%E2%80%9C_-_%D0%89%D1%83%D0%B1%D0%BE%D1%82%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0_%E2%80%9E%D0%A1%D0%B2._%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%E2%80%9C_-_%D0%89%D1%83%D0%B1%D0%BE%D1%82%D0%B5%D0%BD_09.jpg","page_title":"Црква „Св. Никола“ - Љуботен","context_page_description":"Свети Никола — македонска православна црква во скопското село Љуботен. Датира од средновековниот период."},{"page_url":"https://de.wikipedia.org/wiki/R%C3%B6merweg","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Bildstock_Lausebuche.jpg","page_title":"Römerweg","context_page_description":"Der Römerweg ist ein vorgeschichtlicher Fernweg, der von Bonn in nordöstlicher Richtung das Sauerland geradlinig durchzieht und auf den Briloner Hochebenen endet. Bis zum Ausbau der Bundesstraßen war er eine wichtige Handelsstraße, auf welcher der Fernhandel florierte.\\nDen Namen „Römerweg“ trägt er zu Unrecht, denn Bewegungen römischer Truppen sind hier nicht nachweisbar. Der Aufbau der Straße ist mit römischen Transportwegen nicht zu vergleichen. Er führt völlig unbefestigt, nicht wie bei Römerstraßen üblich, über die Höhen und Täler des Sauerlandes."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Loschwitz_(A%E2%80%93L)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Chopinstra%C3%9Fe_10_Loschwitz.jpg","page_title":"Liste der Kulturdenkmale in Loschwitz (A–L)","context_page_description":"Die Liste der Kulturdenkmale in Loschwitz umfasst sämtliche Kulturdenkmale der Dresdner Gemarkung Loschwitz. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Dresden.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen.\\nAufgrund der hohen Anzahl der Kulturdenkmale wurde die alphabetisch nach Adressen geordnete Liste in folgende zwei Teillisten untergliedert:\\nListe der Kulturdenkmale in Loschwitz (A–L)\\nListe der Kulturdenkmale in Loschwitz\\nDiese Teilliste enthält alle Kulturdenkmale von A bis L."},{"page_url":"https://de.wikipedia.org/wiki/Geschwister-Scholl-Schule_Konstanz","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Geschwister-Scholl-Schule_Konstanz_2019.jpg","page_title":"Geschwister-Scholl-Schule Konstanz","context_page_description":"Die Geschwister-Scholl-Schule Konstanz ist die größte Schule in Konstanz. Sie wurde 1976 als kooperative Gesamtschule gegründet und wird seit 1986 als Schulverbund aus Gymnasium, Realschule und Werkrealschule weitergeführt. Weiterhin sind alle Schularten durch eine Orientierungsstufe, die die Klassen 5 und 6 umfasst, miteinander verbunden. Die Schüler können zwischen den Schwerpunkten im naturwissenschaftlichen, sprachlichen, sportlichen oder musischen/künstlerischen Bereich wählen.\\nDie Geschwister-Scholl-Schule ist zudem die größte Schule in Konstanz, Träger ist die Stadt Konstanz und stellt durch ihre Schulform der kooperativen Gesamtschule in Baden-Württemberg eine Rarität dar.\\nUrsprünglich bestand an der Schule auch ein Hauptschulzweig. Zum Schuljahr 2010/2011 wurde dieser Zweig zu einer Werkrealschule ausgebaut."},{"page_url":"https://pl.wikipedia.org/wiki/Miasta_Cypru","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Cyprus_CIA-WF_2010_map.png","page_title":"Miasta Cypru","context_page_description":"Według danych oficjalnych pochodzących z 2011 roku na Cyprze było ponad 40 miast. Stolica kraju Nikozja oraz miasto Limassol liczyły ponad 100 tys. mieszkańców; 4 miasta z ludnością 10÷100 tys. oraz reszta miast poniżej 10 tys. mieszkańców."},{"page_url":"https://zh.wikipedia.org/zh-tw/GIMP","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/Gimp_2.8RC1.jpg","page_title":"GIMP","context_page_description":"GIMP是一個自由及開放原始碼的點陣圖圖像編輯器，用於圖像相片潤飾及編輯、自由繪圖、調整大小、裁剪、相片蒙太奇、裝換圖像格式以及其他專業任務。\\nGIMP始於1995年，使用GPLv3+，可執行於GNU/Linux、MS Windows、macOS等平台，其原生檔案格式的副檔名是.xcf。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Pfarrkirchen_im_M%C3%BChlkreis","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Pfarrkirchen_-_Mesnerhaus.jpg","page_title":"Liste der denkmalgeschützten Objekte in Pfarrkirchen im Mühlkreis","context_page_description":"Die Liste der denkmalgeschützten Objekte in Pfarrkirchen im Mühlkreis enthält die 8 denkmalgeschützten, unbeweglichen Objekte der Gemeinde Pfarrkirchen im Mühlkreis in Oberösterreich."},{"page_url":"https://azb.wikipedia.org/wiki/%DA%A9%D8%A7%D9%86%DA%86%DB%8C%DB%8C%D8%A7%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Anchuruli%2C_Idukki_Dam.JPG","page_title":"کانچییار","context_page_description":"کانچییار\\nهیندوستان اؤلکه‌سینین کرالا ایالتینده بیر کند دیر. بۇ کندین اۆز اؤلچومو ۶۴٫۶۵ کیلومتر موربّع دیر. بۇ کنده مالایالم دیلی و اینگیلیس دیلی دانیشیلیر."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%87%D8%B1%D8%B3%D8%AA_%DA%A9%D9%84%DB%8C%D8%B3%D8%A7%D9%87%D8%A7%DB%8C_%D8%A7%D8%B1%D9%85%D9%86%DB%8C_%D8%AF%D8%B1_%D8%AA%D8%B1%DA%A9%DB%8C%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Ani_Cathedral_model_by_Toros_Toramanian.png","page_title":"فهرست کلیساهای ارمنی در ترکیه","context_page_description":"فهرست کلیساهای ارمنی در ترکیه، از سده ۳ تا سده ۱۹.\\nهمزمان با نسل‌کشی ارمنی‌ها و اخراج آنان از سرزمین آبا و اجدادی خود در منطقهٔ شرق ترکیه فعلی در سال‌های ۱۹۱۵ و۱۹۱۶ م، نه تنها اموال قربانیان به تاراج رفت، بلکه کلیهٔ کلیساها و دیرها، که غیر از بناهای مذهبی، مراکز علمی و فرهنگی ارمنیان به‌شمار می‌آمدند و در آن‌ها آثار فرهنگی ارزشمندی وجود داشت، غارت شدند و بیش از بیست هزار نسخه کتاب‌های دست‌نویس که قدمتی چندین صدساله و گاهی بیش از هزار سال داشتند نیز از میان رفتند.\\nبعد از وقایع آن سال‌ها بناهای تاریخی، همچون خانه‌های متروکهٔ ارمنیان برای یافتن گنج‌های پنهان کندوکاو شدند، زیرا روستاییان ترک و کرد منطقه این باور را داشتند که ارمنیان با هدف بازگشت به خانهٔ خود کلیهٔ اموال قیمتی را در خانه‌هایشان پنهان کرده‌اند؛ لذا تخریب‌های انجام شده در این دورهٔ زمانی چندان گسترده و سازمان یافته نبود که باعث محو بناها شود.\\nبا اشغال ارمنستان توسط ارتش سرخ شوروی در سال ۱۹۲۰م و سقوط نخستین جمهوری ارمنستان با کمک ترکیه، پیمان دوستی بین شوروی و ترکیه به امضا رسید که به پیمان مسکو معروف گردید و طی آن مناطقی از غرب ارمنستان شامل قارص، ساری‌قمیش، آرداهان، اولتی و سورمالو به ترکیه واگذار گردید.\\nدر این مناطق تعداد زیادی کلیسا و دیر وجود داشت که تا آن زمان هنوز سالم و فعال بودند."},{"page_url":"https://de.wikipedia.org/wiki/Carl_Ludwig_Wimmel","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/B%C3%B6rse_Hamburg_1860.jpg","page_title":"Carl Ludwig Wimmel","context_page_description":"Carl Ludwig Wimmel war ein deutscher Architekt und erster Baudirektor Hamburgs. Mit seinen dem Klassizismus verpflichteten Bauten prägte er das Stadtbild Hamburgs im 19. Jahrhundert entscheidend mit; zu seinen bekanntesten noch erhaltenen Bauwerken zählen unter anderem das Krankenhaus in St. Georg und die Hamburger Börse."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D0%B7%D0%B0%D1%85%D0%B8_%D0%B2_%D0%A0%D0%BE%D1%81%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Kazakh_language_in_the_Russian_Empire_%281897%29.svg","page_title":"Казахи в Росії","context_page_description":"За даними перепису 1989 року в Росії проживало близько 1 мільйона казахів. За даними перепису 2002 року чисельність казахів становить менше 650 тисяч чоловік.\\nКазахи є корінним народом що проживають в Росії і проживає на своїх історичних землях в наступних областях:\\nАстраханська область,\\nОренбурзька область,\\nОмська область,\\nСаратовська область,\\nВолгоградська область,\\nЧелябінська область,\\nСамарська область,\\nКурганська область,\\nТюменська область,\\nРеспубліка Алтай,\\nНовосибірська область."},{"page_url":"https://fr.wikipedia.org/wiki/Biodiversit%C3%A9_marine_des_lagons_de_La_R%C3%A9union","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Centropyge_acanthops_R%C3%A9union.JPG","page_title":"Biodiversité marine des lagons de La Réunion","context_page_description":"L'île de La Réunion est un département d'outre-mer français situé dans le sud-ouest de l'océan Indien.\\nC'est une île volcanique relativement jeune en forme caractéristique de cône, dont la base se situe directement sur le plancher océanique, ce qui explique son isolement. Sa jeunesse est la cause de la faible surface occupée par les formations coralliennes, âgées de 8 000 ans, se présentant pour la plupart sous la forme de récifs frangeants.\\nCes formations délimitent des « lagons » peu profonds dont le plus grand ne dépasse pas 500 m de large, pour 1 à 2 m de fond environ. Ces lagons, qui forment une ceinture récifale discontinue de 25 km de long pour une surface totale de 12 km², sont situés sur la côte ouest et sud-ouest de l’île.\\nLes plus importants sont ceux de L’Hermitage, St Leu, L'Étang-Salé et St Pierre.\\nMais il existe aussi des plates-formes récifales attenantes à ces lagons ou isolées, de taille plus modeste et dont la barrière est souvent rocailleuse.\\nLes platiers sont étroits et les tombants en arrière des barrières coralliennes plongent rapidement à des profondeurs importantes."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%8E%9C%ED%83%81%EC%8A%A4_*ist_DS2","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Pentax_%2Aist_DS2.jpg","page_title":"펜탁스 *ist DS2","context_page_description":"펜탁스 *ist DS2 는 펜탁스에서 2005년 8월 발표한 유효화소 610만화소의 APS-C 사이즈 CCD센서를 채용하고 있는 입문자용 디지털 SLR기종이다.\\n펜탁스 *ist DS의 후속작인 *ist DS2는 2.5\\"로 증가한 LCD의 크기를 제외하면 *ist DS와 사양이 동일하며, 후속작인 펜탁스 K100D와도 CCD 시프트식의 손떨림 방지 기능과 뷰파인더 크기의 변화를 제외하고는 큰 사양의 변화는 없다.\\n삼성 GX-1S는 로고를 제외하고 같은 기종이다."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%80%9F%E9%9C%B8%E9%99%B81000","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Subaru1000_01.jpg","page_title":"速霸陸1000","context_page_description":"斯巴鲁1000为日本斯巴鲁重工业于1966年至1969年间推出的紧凑型轿车，这是该公司第一款紧凑型轿车，更是首度搭载水平对置四缸发动机的前轮驱动车。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BD%D0%B4_(%D0%9D%D0%B8%D0%B6%D0%BD%D0%B8%D0%B9_%D0%A0%D0%B5%D0%B9%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Sand_StMaterne_01.JPG","page_title":"Санд (Нижний Рейн)","context_page_description":"Санд — коммуна на северо-востоке Франции в регионе Гранд-Эст, департамент Нижний Рейн, округ Селеста-Эрстен, кантон Эрстен. До марта 2015 года коммуна административно входила в состав упразднённого кантона Бенфельд.\\nПлощадь коммуны — 6,35 км², население — 1137 человек с тенденцией к стабилизации: 1140 человек, плотность населения — 179,5 чел/км²."},{"page_url":"https://sh.wikipedia.org/wiki/%D0%A0%D0%B0%D1%82%D0%B0%D1%80%D0%B8_(%D0%9E%D0%B1%D1%80%D0%B5%D0%BD%D0%BE%D0%B2%D0%B0%D1%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Ratari%2C_Ulica%2C_01.jpg","page_title":"Ратари (Обреновац)","context_page_description":"Ратари је насеље у градској општини Обреновац у граду Београду. Према попису из 2011. било је 596 становника."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9D%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D0%BD%D0%B0_%D0%B0%D1%80%D0%B5%D0%BD%D0%B0_%E2%80%9E%D0%A2%D0%BE%D1%88%D0%B5_%D0%9F%D1%80%D0%BE%D0%B5%D1%81%D0%BA%D0%B8%E2%80%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/SStandPhilipIIArena.jpg","page_title":"Национална арена „Тоше Проески“","context_page_description":"Национална арена „Тоше Проески“ — повеќенаменски стадион во Скопје за разни спортови, кој најчесто се користи за фудбалски натпревари. На него играат фудбалските клубови ФК Работнички и ФК Вардар, како и фудбалската репрезентација на Македонија.\\nМоменталниот максимален капацитет на арената изнесува над 33.000. Владата на Република Македонија официјално го преименувала стадионот во февруари 2009 година со името Национална арена „Филип Втори“, но во ноември 2016 година стадионот бил преименуван во Телеком Арена по потпишаниот договор со Македонски Телеком. Во септември 2017 година, договорот за името Телеком Арена бил раскинат и старото име Филип Втори, било вратено.\\nПрвичното име на стадионот e „Градски стадион Скопје“, па поради тоа е познат и под прекарот „градски“. Јужната трибина e проектиранa од архитектите на „Бетон“ Драган Крстев и Тодорка Мавкова уште во 1977 година."},{"page_url":"https://ur.wikipedia.org/wiki/%DA%A9%D9%88%D8%B1%D9%86%D9%88%D8%A7%D9%84%D8%8C_%D9%BE%D9%86%D8%B3%D9%84%D9%88%D8%A7%D9%86%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Cornwall%2C_PA_Keystone_Marker.jpg","page_title":"کورنوال، پنسلوانیا","context_page_description":"کورنوال، پنسلوانیا ریاستہائے متحدہ امریکا کا ایک borough of Pennsylvania جو لیبانن کاؤنٹی، پنسلوانیا میں واقع ہے۔"},{"page_url":"https://en.wikipedia.org/wiki/Pourrain","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Pourrain-FR-89-%C3%A9glise-26.jpg","page_title":"Pourrain","context_page_description":"Pourrain is a commune in the Yonne department in Bourgogne-Franche-Comté in north-central France."},{"page_url":"https://eu.wikipedia.org/wiki/Paul_Pen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/El_brillo_de_las_luci%C3%A9rnagas.jpg","page_title":"Paul Pen","context_page_description":"Paul Pen, idazle eta telebista-gidoigile espainiarra da. Fnacek Talentu Berria bezala izendatu zuen 2011an El aviso liburua argitaratu eta gero.; El País egunkariaren Babelia gehigarriak ere bikain bezala agurtu zuen ref>http://elpais.com/diario/2011/08/06/babelia/1312589560_850215.html</ref>. Dagoeneko, eleberri hori alemanieraz eta italieraz irakur daiteke. 2013an El brillo de las luciérnagas, bere bigarren eleberria kaleratu zuen. Biak ala biak zinemarako prestatzen ari dira Morena Fils konpainiaren eskutik. Jorge Gerrikaetxebarria ari da El aviso liburuaren gidoia prestatzen. Alberto Marini, bestetik, El brillo de las luciérnagas eleberriarena egiten ari da. Haren liburuak thriller moduko eleberriak dira. Roald Dahlen eta Stephen Kinen eragina onartu ditu."},{"page_url":"https://de.wikipedia.org/wiki/Wendel_Bollman","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Bollman%E2%80%99s_original_patent_drawing.png","page_title":"Wendel Bollman","context_page_description":"Wendel Bollman war ein US-amerikanischer autodidaktischer Bauingenieur, der den Bau von eisernen Eisenbahnbrücken durch die Entwicklung des Bollman-Trägers im großen Stil in den USA einführte.\\nAnn B. Bollman and Thomas Bollman, die Eltern von Wendel Bollman, waren deutsche Einwanderer. Thomas Bollman war Bäcker und hatte sein Geschäft an der Ecke Water St und Grant St in der Nähe der heutigen Grand Street Station. Er kämpfte in der Verteidigung der Stadt bei der Schlacht von Baltimore."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A1%94%E6%9E%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Tallinna_vanalinn.jpg","page_title":"塔林","context_page_description":"塔林是波罗的海最内部的芬兰湾滨的爱沙尼亚共和国的首都。旧称列巴尔，沙俄时代名为列威利，前苏联时代名为塔林。人口约42万。旧城是列入世界遗产名录的“塔林历史城区”。\\n2011年当选欧洲文化之都。位于爱沙尼亚北海岸，离北方对岸的芬兰首都赫尔辛基约80公里。"},{"page_url":"https://fi.wikipedia.org/wiki/Kenjutsu","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/Nito_web.jpg","page_title":"Kenjutsu","context_page_description":"Kenjutsu tarkoittaa perinteistä japanilaista miekankäyttötaitoa ja on osa-alue japanilaisessa bujutsussa. Erilaisia koulukuntia on ollut satoja. Koulukuntaa tarkoittava sana ryū on suomeksi \\"virta\\" ja ryūha sananmukaisesti käännettynä \\"virran haarauma\\". Sillä tarkoitetaan, että useat koulukunnat ovat syntyneet perustajansa soveltaessa jo olemassa olevia kenjutsu-oppeja ja liittäneet niihin omia oivalluksiaan tai käytännön taistelun esiin tuomia ideoita ja toimintatapoja. Ylipäätään ryūhan tarkoitus on siirtää olemassa olevaa perinnettä eteenpäin, ei kehittää sitä. Tästä seuraa koulukuntien haarautuminen aina, kun luovat ja oivaltavat mestarit ovat liittäneet opetukseen uutta tekniikkaa. Tällöin on muodostunut kokonaan uusi ainutkertainen perinne, uusi ryūha."},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%A1%97%E5%BD%B1%E6%B3%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/XRL_WKT_%2821%29.JPG","page_title":"街影法","context_page_description":"街影法，是港英政府在1969年香港《建筑物规例》中加入的街影建筑要求，确保街道日照和空气流通，不过此限制于1987年便取消。"},{"page_url":"https://fr.wikipedia.org/wiki/Gisors","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Gisors_%C3%A9glise.JPG","page_title":"Gisors","context_page_description":"Gisors est une commune française située dans le département de l'Eure, en région Normandie.\\nCette cité ancienne située à la lisière du Vexin normand témoigne par son patrimoine architectural de la lutte acharnée entre souverains Capétiens et Plantagenêt durant une partie du Moyen Âge. Élément important du paysage urbain, son château fort se dresse depuis lors sur une éminence dominant la ville. Principal lieu touristique de l'agglomération, il est également au centre de diverses légendes ayant trait à l'ordre du Temple.\\nLes habitants de Gisors sont appelés les Gisorsiens et les Gisorsiennes."},{"page_url":"https://es.wikipedia.org/wiki/Orquesta_de_la_Polic%C3%ADa_de_Israel","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Israel_Police_Band_2010.jpg","page_title":"Orquesta de la Policía de Israel","context_page_description":"La Orquesta de la Policía de Israel es la orquesta musical de la policía israelí, participa en las ceremonias policiales, así como las ceremonias oficiales del Estado, en eventos municipales y en diversas celebraciones comunitarias. La banda de música de la policía palestina se fundó en 1921. La banda de la policía de Israel, se formó poco después del establecimiento del Estado de Israel en el territorio del Mandato Británico de Palestina. Aubrey Silver, un músico judío de Londres, fue maestro de la banda desde 1921 hasta su muerte en 1944. Naphtali Grabow ocupó ese mismo cargo desde 1944 hasta 1961. Menashe Lev fue el director de la orquesta en 2008. El director actual es Michael Gurevich.\\nDatos: Q6588215\\nMultimedia: Israeli Police Orchestra"},{"page_url":"https://tl.wikipedia.org/wiki/Pagsabog_sa_Beirut_ng_2020","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Beirutnorth.jpg","page_title":"Pagsabog sa Beirut ng 2020","context_page_description":"Ang Pagsabog sa Beirut ng 2020 o 2020 Beirut explosions, ay naganap noong Agosto 4, 2020) 6:08:18 ay binulabog ng mga pagsabog ang daugan sa kapitlyong Beirut sa Lebanon, nag-iwan ito ng 181+ na utas at mahigit 6, 000+ ang mga sugatan at ilang pang katawan ang nawawala, Saad ng Direktor Heneral ng \\"Lebanese General Security\\" sabi ay ang pangunahing pagsabog ay naka lagay sa 2, 750 ng tonelada ng ammonium nitrate at ito ay nakumpiska sa pamilihan ng daugnan maka lipas ang anim na taon sa oras ng pagsabog."},{"page_url":"https://es.wikipedia.org/wiki/Tarot_(adivinaci%C3%B3n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Jean_Dodal_Tarot_trump_15.jpg","page_title":"Tarot (adivinación)","context_page_description":"El tarot es una baraja de naipes a menudo utilizada como medio de consulta e interpretación de hechos, sueños, ​ percepciones o estados emocionales que constituye, además, un tipo de cartomancia. Sus orígenes datan al menos del siglo XIV. La técnica se basa en la selección de cartas de una baraja especial, que luego son interpretadas por un lector, según el orden o disposición en que han sido seleccionadas o repartidas. La baraja de tarot está compuesta por 78 cartas, divididas en arcanos mayores los cuáles son 22 y menores que son 56. La palabra «arcano» proviene del latín arcanum, que significa \\"misterio\\" o \\"secreto\\"."},{"page_url":"https://en.wikipedia.org/wiki/2013_in_the_sport_of_athletics","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Luzhniki_Inside_View_B_Stand.jpg","page_title":"2013 in the sport of athletics","context_page_description":"In 2013, the foremost competition in athletics was the 2013 World Championships in Athletics in Moscow. The International Association of Athletics Federations will hold two other global level competitions this year: the 2013 IAAF World Cross Country Championships and the 2013 World Youth Championships in Athletics. The IAAF World Cross Country Championships will return after its move to a biennial format.\\nThe Diamond League enters its fourth year as the foremost seasonal track and field series."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Weiler-Simmerberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Simmerberg_Brauhaus.JPG","page_title":"Liste der Baudenkmäler in Weiler-Simmerberg","context_page_description":"Auf dieser Seite sind die Baudenkmäler der schwäbischen Gemeinde Weiler-Simmerberg zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://de.wikipedia.org/wiki/Christian_VII._(D%C3%A4nemark_und_Norwegen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Christian_VII_u._Caroline_Mathilde_%E2%80%93_Residenzmuseum_Celle.JPG","page_title":"Christian VII. (Dänemark und Norwegen)","context_page_description":"Christian VII. war König von Dänemark und Norwegen von 1766 bis 1808 und Herzog von Schleswig und Holstein. Er stammte aus dem Haus Oldenburg. Christian VII. galt als geistesgestört. Der Nachwelt bekannt ist er vor allem wegen der Affäre um seinen Leibarzt Johann Friedrich Struensee."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%85%E0%AE%B5%E0%AE%BF%E0%AE%A8%E0%AE%BE%E0%AE%9A%E0%AE%BF_%E0%AE%85%E0%AE%B5%E0%AE%BF%E0%AE%A8%E0%AE%BE%E0%AE%9A%E0%AE%BF%E0%AE%AF%E0%AE%AA%E0%AF%8D%E0%AE%AA%E0%AE%B0%E0%AF%8D_%E0%AE%95%E0%AF%8B%E0%AE%AF%E0%AE%BF%E0%AE%B2%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Avinashi_avinashiappar_temple6.jpg","page_title":"அவிநாசி அவிநாசியப்பர் கோயில்","context_page_description":"அவிநாசி அவிநாசியப்பர் கோயில் பாடல் பெற்ற தலங்களில் கொங்கு நாட்டுத் தலங்களில் ஒன்றாகும். சுந்தரர் பாடல் பெற்ற இத்தலம் கோவை மாவட்டத்தில் அமைந்துள்ளது. இத்தலத்தில் முதலையுண்ட பாலகனைச் சுந்தரர் பதிகம் பாடி மீட்டார் என்பது தொன்நம்பிக்கை.\\nஅம்பாளின் கோயில் அவினாசியப்பருக்கு வலது புறம் உள்ளது பொதுவாக மற்ற கோயில்களில் இல்லாத சிறப்பு ஆகும். இக்கோவிலின் தேர்த்திருவிழா மிகவும் புகழ்பெற்றது. இத்தேர் தென்னிந்தியாவின் மிகப்பெரிய தேர்களில் ஒன்றாகும். மேலும் இத்தேர் இதன் சிற்ப வேலைகளுக்காக பெயர் பெற்றது."},{"page_url":"https://fr.wikipedia.org/wiki/Arad_(Roumanie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Arad_cultural_center.jpg","page_title":"Arad (Roumanie)","context_page_description":"Arad est une ville de l'Ouest de la Roumanie, en Transylvanie, chef-lieu du județ homonyme. En 2002, la population de la ville était de 172 824 habitants.\\nArad une ville moderne, un centre industriel et un carrefour de communications, qui possède de nombreux édifices remarquables."},{"page_url":"https://sv.wikipedia.org/wiki/Protea_welwitschii","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Protea_welwitschii00.jpg","page_title":"Protea welwitschii","context_page_description":"Protea welwitschii är en tvåhjärtbladig växtart som beskrevs av Adolf Engler. Protea welwitschii ingår i släktet Protea och familjen Proteaceae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_M%C3%B6mbris","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Hohl_Fachwerkkapelle_Sachsenh%C3%A4user_Stra%C3%9Fe_1_%2801%29.png","page_title":"Liste der Baudenkmäler in Mömbris","context_page_description":"Auf dieser Seite sind die Baudenkmäler des unterfränkischen Marktes Mömbris zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 15. April 2020 wieder und enthält 86 Baudenkmäler."},{"page_url":"https://en.wikipedia.org/wiki/List_of_monarchs_of_Persia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Coin_of_Achaemenid_Empire_%28Xerxes_II_to_Artaxerxes_II%29.jpg","page_title":"List of monarchs of Persia","context_page_description":"Earlier monarchs in the area of modern-day Iran are listed in:\\nList of rulers of the pre-Achaemenid kingdoms of Iran\\nMinor dynasties and vassal monarchs can be found in:\\nList of rulers of Parthian sub-kingdoms\\nIslamic dynasties of Iran"},{"page_url":"https://bs.wikipedia.org/wiki/Ahemenidsko_Carstvo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Farvahar001.JPG","page_title":"Ahemenidsko Carstvo","context_page_description":"Ahemenidsko carstvo ili ponekad Perzijsko Veliko Kraljevstvo bilo je prvo Perzijsko Carstvo koje je od 550. do 330. p. n. e. obuhvatalo prostor Velikog Irana, odnosno druga iranska carska dinastija. Na vrhuncu svoje moći iransko Kraljevstvo se protezalo na 10,7 miliona km², što ga je činilo najvećim carstvom u historiji antike. Također, carstvo je u to doba obuhvatalo oko 46% svjetske populacije.\\nPerzijsko veliko kraljevstvo osnovao je Kir Veliki koji ga je proširio na veći dio azijskog dijela Bliskog istoka, dok su ga njegovi nasljednici Kambiz II i Darije I proširili i na Afriku odnosno Evropu, što ga je činilo prvim carstvom koje se protezalo na tri kontinenta. Teritorija carstva osim Irana obuhvatao je dijelove današnje Indije i Pakistana, područja Srednje Azije, Male Azije, Trakije, veći dio obala Crnog mora, Mesopotamije, sjever Arapskog poluostrva, Levant, Siriju, te sjeveroistočni dio Afrike uključujući Egipat, Libiju, Sudan i Etiopiju."},{"page_url":"https://ar.wikipedia.org/wiki/STAU1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/PBB_GE_STAU1_207320_x_at_fs.png","page_title":"STAU1","context_page_description":"STAU1‏ هوَ بروتين يُشَفر بواسطة جين STAU1 في الإنسان."},{"page_url":"https://de.wikipedia.org/wiki/Joseph_Pschorr_(Brauer,_1770)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Muc_Ruhmeshalle_W44_Joseph_Pschorr.jpg","page_title":"Joseph Pschorr (Brauer, 1770)","context_page_description":"Joseph Pschorr war ein deutscher Unternehmer und eine „Brauerei-Ikone“."},{"page_url":"https://de.wikipedia.org/wiki/Bj%C3%B6rlanda_och_Torslanda","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Aerial_photo_of_Gothenburg_2013-10-27_037.jpg","page_title":"Björlanda och Torslanda","context_page_description":"Björlanda och Torslanda ist ein Tätort in der schwedischen Provinz Västra Götalands län sowie der historischen Provinz Bohuslän. Er erstreckt sich etwa zehn Kilometer westlich bis nordwestlich des Zentrums der Provinzhauptstadt Göteborg auf der Insel Hisingen, die zwischen dem Fluss Göta älv und seinem rechten Arm Nordre älv bei deren Mündung in das Kattegat liegt.\\nDer Tätort wurde 2015 erstmals vom Statistiska centralbyrån ausgewiesen. Er umfasst das faktisch durchgehend bebaute Gebiet im westlichen Teil der Insel Hisingen, das vom Tätort Göteborg durch den Seehafen Göteborg an der Nordseite der Mündung des Göta älv, anschließende Gewerbegebiete und das ausgedehnte Gelände des Volvo-Werkes Torslanda getrennt ist und wurde aus den zuvor eigenständigen Tätortern Torslanda, Hjuvik, Kvisljungeby, Björlanda, Låssby und Trulsegården sowie den dazwischen liegenden Gebieten gebildet."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D8%B3%D8%AA%D9%81%D8%A7%D9%86_%D9%BE%DB%8C%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Steve-peace.jpg","page_title":"استفان پیس","context_page_description":"استفان پیس یک هنرپیشه، فیلم‌نامه‌نویس، تهیه‌کننده، و سیاست‌مدار اهل ایالات متحده آمریکا است.\\nوی تهیه‌کننده فیلم‌هایی همجون حمله قاتل گوجه‌ای و بازگشت قاتل گوجه‌ای بوده است."},{"page_url":"https://fr.wikipedia.org/wiki/Maschinenpistole_38","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/MP38-03.jpg","page_title":"Maschinenpistole 38","context_page_description":"À la veille de la Seconde Guerre mondiale, l'armée allemande eut besoin d'une arme compacte mais fournissant une puissance de feu supérieure à un simple pistolet pour armer ses troupes parachutistes, ses équipages de chars et de transport : le Maschinenpistole 38 ou couramment appelé le MP 38 était né. Cette arme eut d'emblée un tel succès que l'armée s'en dota pour l'ensemble de ses troupes."},{"page_url":"https://en.wikipedia.org/wiki/Chiba_New_Town_Ch%C5%AB%C5%8D_Station","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Chiba_Newtown_Ch%C5%AB%C5%8D_Sta.building_%282013.02%29.jpg","page_title":"Chiba New Town Chūō Station","context_page_description":"Chiba New Town Chūō Station is a railway station in Inzai, Chiba, Japan."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0%D1%80%D0%BE%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%A0%D0%BE%D0%BC%D0%B0%D0%BD_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%BE%D0%B2%D0%B8%D1%87","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/Voynarovskyy.jpg","page_title":"Войнаровський Роман Васильович","context_page_description":"Войнаровський Роман Васильович — український футболіст, півзахисник «Зірки». Виступав за сімферопольську «Таврію». Автор одного з найшвидших голів в історії футболу — 31 серпня 2008 року в грі за «Кримтеплицю» проти «Фенікса-Іллічовця» в першій лізі забив уже на 4 секунді зустрічі."},{"page_url":"https://fr.wikipedia.org/wiki/Si%C3%A8ge_de_Foua_et_Kafraya","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Arrival_of_residents_of_Al-Fu%27ah_and_Kfrya_to_Aleppo_by_tasnimnews.com01.jpg","page_title":"Siège de Foua et Kafraya","context_page_description":"Le siège de Foua et Kafraya a lieu du 28 mars 2015 au 19 juillet 2018, pendant la guerre civile syrienne. Situés au nord-est d'Idleb, Foua et Kafraya sont deux villages chiites duodécimains défendus par des milices locales qui se retrouvent encerclés et assiégés par les rebelles après leur victoire à la bataille d'Idleb en mars 2015."},{"page_url":"https://en.wikipedia.org/wiki/Baskaran_Kandiah","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Baskaran_Kandiah_%28Karan%29.jpg","page_title":"Baskaran Kandiah","context_page_description":"Baskaran Kandiah is the co-founder and Director of Lebara Group, a European telecoms company with operations in six countries. He is also the Chairman of London Tamil Media, the holding company of IBC Tamil, a popular Tamil TV channel based out of London, UK. He also owns Dick Holdings B.V, registered in Netherlands.He also recently bought TamilWin, LankaSri, CineUlagam, Manitham websites and own fair share of Tamil Media empire."},{"page_url":"https://cs.wikipedia.org/wiki/Kostel_Nejsv%C4%9Bt%C4%9Bj%C5%A1%C3%AD_Trojice_(%C4%8Cesk%C3%BD_Brod)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/%C4%8Cesk%C3%BD_Brod%2C_pomn%C3%ADk_%C3%BApravy_sad%C5%AF_1928.jpg","page_title":"Kostel Nejsvětější Trojice (Český Brod)","context_page_description":"Kostel Nejsvětější Trojice v Českém Brodě v Jiráskových sadech byl postaven roku 1560 jako hřbitovní kostel v renesančním slohu. Má jednolodní půdorys s trojbokým presbytářem, je orientovaný, ale s výraznou odchylkou k severu. Na jihozápadním průčelí, vlevo od vchodu, je zbudována renesanční kamenná kazatelna, která má boky vyzdobené reliéfy a z vrchu je zakrytá stříškou, jíž podpírají čtyři sloupy. Autorem kazatelny je Wolf Schulthess z Plavna, jenž ji vytvořil roku 1585. U kostela navíc stojí nízká čtyřboká zvonice s dřevěným patrem.\\nHřbitov okolo kostela zanikl po roce 1898, kdy vznikl nový městský hřbitov, a roku 1928 byla dokončena úprava okolí na park.\\nKostel se zvonicí je chráněn jako nemovitá kulturní památka České republiky. Patří místnímu sboru Českobratrské církve evangelické, který v něm slouží své bohoslužby. Z původního interiéru se nic nezachovalo, vybavení je soudobé. Varhany a zvon pocházející z poloviny 19. století byly přeneseny z rušeného kostela ve Kšelích."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B4%D5%A5%D5%B6%D5%AB%D5%A5%D5%AC_%D4%B9%D5%A1%D5%B4%D5%B4%D5%A5%D5%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Bluemet_Tammet.jpg","page_title":"Դենիել Թամմեթ","context_page_description":"Դանիել Թամմեթը անգլիացի էսսեիստ, նովելիստ և թարգմանիչ է: Նրա 2006 թվականին գրված հուշագրությունը\` «Մի կապույտ օր աշխարհ եկած», որը պատմում է իր կյանքի մասին, մասնավորավես\` իր հիվանդությունների մասին 2008 թվականին ճանաչվել է որպես «Լավագույն գիրք երիտասարիտասարդների համար» Ամերիկայի Գրական Ասոցիացիայի կողմից: Նրա երկրորդ գիրքը\` «Գրկելով վայրի երկիքնը» 2009 թվականին Ֆրանսիայում համարվել է համար մեկ բեսթսելլեր: Նրա երրորդ գիրքը\` «Թվերի մեջ մտածելով», հրատարակվել 2012 թվականի Օգոստոսի 16-ին Մեծ Բրիտանիայում, իսկ առաջին նովելը տպագրվել է Ֆրանսիայում և Քումբետում 2016 թվականին: Թամմեթի գրքերը տպագրված են ավելի քան 20 լեզուներով:"},{"page_url":"https://tr.wikipedia.org/wiki/Ibaraki","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/H-II-GTV.jpg","page_title":"Ibaraki","context_page_description":"Ibaraki prefektörlüğü, Japonya'nın prefektörlüklerinden biridir. Prefektörlük Kantō bölgesinde yer almaktadır. Yüzölçümü 6,095.58 km² olan prefektörlüğün nüfusu 1 Eylül 2010 tarihi itibarı ile 2,964,141'dir. Prefektörlüğün merkezi Mito şehridir."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D8%A8%D9%84_%D9%85%D8%A7%D8%AA%D8%A7%D8%AC%D8%A7%D9%84%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Cim_matagalls.JPG","page_title":"جبل ماتاجالس","context_page_description":"ماتاجالس هوا جبل فى اسبانيا."},{"page_url":"https://it.wikipedia.org/wiki/Xavier_Daramy","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/XavierDaramy.JPG","page_title":"Xavier Daramy","context_page_description":"Xavier Daramy è un ex hockeista su ghiaccio francese."},{"page_url":"https://fr.wikipedia.org/wiki/Famille_royale_britannique","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Princess_Charlotte_of_Cambridge_in_2019_%28cropped%29.jpg","page_title":"Famille royale britannique","context_page_description":"La famille royale britannique regroupe les personnes liées de près à la monarchie britannique. Il n'y a pas de définition stricte de qui est membre, ou de qui n'est pas membre de la famille royale, et différentes listes de membres peuvent être établies, selon l’événement. Il existe cependant deux listes principales :\\nLes membres de la famille royale ayant droit à la qualification de Sa Majesté ou de Son Altesse Royale.\\nLes membres de la famille royale, n'ayant pas droit à la qualification d'altesse royale"},{"page_url":"https://es.wikipedia.org/wiki/NGC_7510","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/NGC_7510_map.png","page_title":"NGC 7510","context_page_description":"NGC 7510 es un cúmulo abierto situado en la constelación de Cefeo visible con telescopios de aficionado.\\nSe halla a entre 3​ y 3,5​ kiloparsecs del Sol según diversos autores -lo que lo sitúa en el borde exterior del brazo de Perseo de la Vía Láctea-, y es un cúmulo muy joven con una edad estimada en 10 millones de años​ y que incluye entre sus miembros a una posible estrella Be.​"},{"page_url":"https://af.wikipedia.org/wiki/FIFA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Michel_Platini_in_Wroclaw_by_Klearchos_Kapoutsis_wide_crop.jpg","page_title":"FIFA","context_page_description":"Die Internasionale Federasie vir Voetbal Assosiasie, algemeen bekend as FIFA, is die internasionale beheerliggaam vir sokker. Hulle hoofkantoor is in Zürich, Switserland, en die huidige president is Gianni Infantino. FIFA is verantwoordelik vir die organisasie en beheer van die hoof voetbalgeleenthede, onder andere die FIFA Sokker-Wêreldbeker, wat sedert 1930 aangebied word.\\nFIFA het 209 assosiasie lede – 16 meer as die Verenigde Nasies."},{"page_url":"https://en.wikipedia.org/wiki/Terebridae","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Strioterebrum_plumbeum_001.jpg","page_title":"Terebridae","context_page_description":"The Terebridae, commonly referred to as auger shells or auger snails, is a group or family of small to large predatory marine gastropods in the superfamily Conoidea.\\nThese gastropods have extremely high spired shells with numerous whorls, and the common name refers to the resemblance of their shells to rock drill-type drill bits.\\nThere are more than 400 known Recent species worldwide."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%B0%D0%B3%D0%BE_%D0%9A%D0%BE%D1%83%D1%82%D1%96%D0%BD%D1%8C%D0%B9%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Gago_Coutinho_e_Sacadura_Cabral.jpg","page_title":"Гаго Коутіньйо","context_page_description":"Га́го Коуті́ньйо — португальський географ, картограф, військово-морський офіцер, історик і льотчик. Піонери авіації Гаго Коутіньйо та Сакадура Кабрал першими здійснили переліт через Південну Атлантику з березня по червень 1922 року з Лісабона до Ріо-де-Жанейро."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Monuments_historiques_in_Stra%C3%9Fburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Biblioth%C3%A8que_nationale_et_universitaire_de_Strasbourg.jpg","page_title":"Liste der Monuments historiques in Straßburg","context_page_description":"Die Liste der Monument historique in Straßburg verzeichnet alle klassifizierten und eingetragenen Monuments historiques in der elsässischen Stadt Straßburg."},{"page_url":"https://nl.wikipedia.org/wiki/Anaa","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Anaa_en_Tuamotu.png","page_title":"Anaa","context_page_description":"Anaa, Nganaa-nui of Ara-ura is een atol in de Tuamotu-archipel, in Frans-Polynesië. Anaa is deel van de Îles Raevski. Anaa is tevens een bestuurlijke entiteit, een Polynesische gemeente waaronder ook de atollen Faaite, Motutunga en Tahanea vallen."},{"page_url":"https://nv.wikipedia.org/wiki/Zahal%C3%A1nii_%C5%82ib%C3%A1h%C3%ADg%C3%AD%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Mimus_gundlachii_-Ciego_de_Avila_Province%2C_Cuba-8.jpg","page_title":"Zahalánii łibáhígíí","context_page_description":"Zahalánii łibáhígíí éí tsídii tsídígíí dah yikahjí atah yisdzoh. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Mimus gundlachi\\" deiłníigo dayózhí."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AE%E0%A6%BE%E0%A6%A8%E0%A6%BF_%E0%A6%87%E0%A6%A8_%E0%A6%A6%E0%A7%8D%E0%A6%AF_%E0%A6%AC%E0%A7%8D%E0%A6%AF%E0%A6%BE%E0%A6%82%E0%A6%95_%E0%A6%B2%E0%A7%8D%E0%A6%AF%E0%A6%BE%E0%A6%A1%E0%A6%BE%E0%A6%B0_%E0%A6%AE%E0%A7%8D%E0%A6%AF%E0%A6%BE%E0%A6%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/CMPunkMoneyInTheBank.JPG","page_title":"মানি ইন দ্য ব্যাংক ল্যাডার ম্যাচ","context_page_description":"মানি ইন দ্য ব্যাংক ল্যাডার ম্যাচ হল পেশাদার কুস্তির পদন্নোতি ডাব্লিউডাব্লিউই কর্তৃক আয়োজিত ল্যাডার ম্যাচ। প্রথম দিকে রেসলম্যানিয়াতে মানি ইন দ্য ব্যাংক লেডার ম্যাচ অনুষ্ঠিত হত, পরে মানি ইন দ্য ব্যাংক প্রতি-দর্শনে-পরিশোধ প্রতিষ্ঠার মাধ্যমে রেসলম্যানিয়া থেকে বিচ্ছিন্ন করা হয়। ২০০৫ সালের রেসলম্যানিয়া ২১ এ প্রথমবারের মত মানি ইন দ্য ব্যাংক ল্যাডার ম্যাচ অনুষ্ঠিত হয়। সেই ম্যাচে র এর সেরা সুপারস্টাররা অংশগ্রহণ করে। সেই ম্যাচে বিজয়ী ছিলেন এজ। ২০০৬ থেকে ২০১০, এমআইটিবি ম্যাচ, সকল ডাব্লিউডাব্লিউই ব্রান্ডে মুক্ত ছিল, রেসলম্যানিয়া ছিল মানি ইন দ্য ব্যাংক ল্যাডার ম্যাচের প্রধান অবলম্বন। ২০১০ সালে দ্বিতীয় এবং তৃতীয় মানি ইন দ্য ব্যাংক অনুষ্ঠিত হয় যখন মানি ইন দ্য ব্যাংক প্রতি-দর্শনে-পরিশোধ অনুষ্ঠান শুরু হয়। এটি রেসলম্যানিয়া থেকে ভিন্ন হয়, এই নতুন আয়োজনে দুই ধরনের ল্যাডার ম্যাচ হয়– দুইটি চুক্তি ছিল, যথাক্রমে ডাব্লিউডাব্লিউই চ্যাম্পিয়নশীপ এবং ওয়ার্ল্ড হেভিওয়েট চ্যাম্পিয়নশীপ।\\nবার্ষিক মানি ইন দ্য ব্যাংক প্রতি-দর্শনে-পরিশোধ আয়োজন প্রতিষ্ঠার পূর্বে কুস্তিগীররা এই চুক্তি ব্যবহার করে যেকোন ওয়ার্ল্ড হেভিওয়েট চ্যাম্পিয়নশীপের ম্যাচ খেলার দাবি করতে পারে।\\nপ্রতি-দর্শনে-পরিশোধ প্রতিষ্ঠার পর থেকে এই চুক্তি দিয়ে অন্য যেকোন চ্যাম্পিয়নশীপ অংশগ্রহণ করা যায়।"},{"page_url":"https://en.wikipedia.org/wiki/Thomas_Woolston_(architect)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/1-3_Hampden_Grove%2C_Beeston.jpg","page_title":"Thomas Woolston (architect)","context_page_description":"Thomas Woolston was an architect and builder."},{"page_url":"https://fr.wikipedia.org/wiki/Chapelle_des_J%C3%A9suites_de_Cambrai","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/93/Fa%C3%A7ade_Chapelle_des_J%C3%A9suites_Cambrai_%28d%C3%A9tail1%29.JPG","page_title":"Chapelle des Jésuites de Cambrai","context_page_description":"La chapelle des Jésuites est une église désaffectée au culte de style baroque se trouvant sur la place du Saint-Sépulcre à Cambrai. Construite de 1679 à 1692, en annexe d’un collège jésuite, elle est classée comme monument historique en 1920."},{"page_url":"https://en.wikipedia.org/wiki/Bangladesh%E2%80%93Myanmar_relations","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Bangladesh_Myanmar_Locator.png","page_title":"Bangladesh–Myanmar relations","context_page_description":"The neighbouring countries of Bangladesh and Myanmar had a generally cordial relationship under the Burmese military junta although the presence of over 270,000 Rohingya refugees in Bangladesh often served as a major irritant. The civil society and political class of Bangladesh often voiced solidarity for Myanmars pro-democracy struggle. However, Bangladesh has sought greater trade and road and rail networks with Myanmar to boost the economic relations between the two countries."},{"page_url":"https://pnb.wikipedia.org/wiki/%DA%AF%D9%86%D8%A8%D8%AF_%D8%B3%D9%84%D8%B7%D8%A7%D9%86%DB%8C%DB%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Soltaniyeh_dome_by_Mardetanha_6375.JPG","page_title":"گنبد سلطانیہ","context_page_description":"گنبد سلطانیہ ایران دے صوبہ زنجان دے تاریخ شہر سلطانیہ وچ واقع اک عمارت اے جو اپنے خوبصورت گنبد تے اُس دے فن تعمیر دے لحاظ تو‏ں مشہور ا‏‏ے۔2005ء تو‏ں ایہ یونیسکو عالمی ثقافتی ورثہ دا حصہ ا‏‏ے۔"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D1%8E_%D0%A3%D1%82%D0%BE%D1%87%D0%BA%D0%B8%D0%BD%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Utochkin_monument_commemorative_plaque.jpg","page_title":"Памятник Сергею Уточкину","context_page_description":"Памятник Сергею Уточкину — бронзовый памятник пионеру российской авиации Сергею Уточкину, установленный в Одессе по адресу улица Дерибасовская, 22."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%96%E3%83%AB%E3%82%AC%E3%83%AA%E3%82%A2%E3%81%AE%E9%83%BD%E5%B8%82%E3%81%AE%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Harmanli_chitalishte.jpg","page_title":"ブルガリアの都市の一覧","context_page_description":"ブルガリアの都市の一覧では、すべての都市・町を人口でソートした一覧である。うち、州都は太字で表記する。資料は、ブルガリア全国統計研究所 and the Bulgarian Academy of Sciences.のデータを使用した。\\nブルガリアで最大の都市はソフィア市の約120万人であり、最小はメルニクの約250人である。最小の町は必ずしも全ての村よりも大きいわけではない。中には5000人規模の村も存在し、それはここに表記されている町の多くよりも多いこともある。"},{"page_url":"https://fr.wikipedia.org/wiki/Volkswagen_Tiguan","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/VW_Tiguan_Allspace_Comfortline_4MOTION_%28II%29_%E2%80%93_Frontansicht%2C_10._Mai_2018%2C_D%C3%BCsseldorf.jpg","page_title":"Volkswagen Tiguan","context_page_description":"La Tiguan est une voiture de la catégorie des SUV compacts produite par le constructeur automobile allemand Volkswagen depuis 2007 et sa commercialisation a démarré à l'automne 2007. Cette voiture a remporté le volant d'or dans la catégorie des SUV.\\nEn janvier 2018, Volkswagen annonce avoir franchi le cap de cinq millions de Tiguan produits depuis 2007, avec deux générations."},{"page_url":"https://de.wikipedia.org/wiki/Caroline_Dolehide","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Dolehide_RG18_%2811%29_%2842978898471%29.jpg","page_title":"Caroline Dolehide","context_page_description":"Caroline Dolehide ist eine US-amerikanische Tennisspielerin."},{"page_url":"https://it.wikipedia.org/wiki/Titolo_di_citt%C3%A0_in_Romania","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Bustul_lui_Ion_Nistor_din_Vicovu_de_Sus.jpg","page_title":"Titolo di città in Romania","context_page_description":"Lista di città e comuni della Romania ordinati in base ai censimenti del 2002 e del 2011.\\nLa lista include sia municipiu che oraș."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%BE%A1%E5%B6%BD%E5%B1%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Hida_Mountains_and_Ninoike_from_Mount_Ontake_%28wide%29.jpg","page_title":"御嶽山","context_page_description":"御嶽山は、長野県木曽郡木曽町・王滝村と岐阜県下呂市・高山市にまたがり、東日本火山帯の西端に位置する標高3,067 mの複合成層火山である。大きな裾野を広げる独立峰である。\\n2014年9月27日に7年ぶりに噴火。山頂付近にいた登山客が巻き込まれ、1991年雲仙普賢岳の火砕流による犠牲者数を上回る事態となった。"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Plouguerneau","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Bretagne_plouguerneau.jpg","page_title":"Plouguerneau","context_page_description":"Plouguerneau sī ūi-tī Hoat-kok Bretagne tōa-khu Finistère séng ê chi̍t ê commune."},{"page_url":"https://sv.wikipedia.org/wiki/Hverager%C3%B0i","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Iceland2009-Oct-Hverager%C3%B0i.JPG","page_title":"Hveragerði","context_page_description":"Hveragerði är en ort i Suðurland i Island. Den ligger vid landets ringväg och floden Varmá flyter genom orten. Befolkningen uppgick till 2 657 i januari 2019. Hveragerði utgör sedan 1946 en egen kommun, Hveragerðisbær.\\nDet omgivande området ingår i vulkanen Hengills område, och är geotermiskt aktivt. Området drabbas av ständiga mindre jordskalv. Orten är känd för sina växthus, som värms upp av varmvatten från vulkanens heta källor. Nära kyrkan finns en het källa vid namn Sandhólshver, som skapades under jordbävningen 1896. Inne i orten finns ett inhägnat område fyllt av heta källor och fumaroler.\\nSöder om orten finns hamnen Þorlákshöfn, som tidigare var huvudsaklig färjehamn på fastlandet för färjan från Västmannaöarna. Sedan 2010 har denna som huvudhamn ersatts av Landeyjahöfn längre österut."},{"page_url":"https://de.wikipedia.org/wiki/Dom_St._Peter_(Osnabr%C3%BCck)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Hauptorgel_Dom_St._Peter_%28Osnabr%C3%BCck%29.png","page_title":"Dom St. Peter (Osnabrück)","context_page_description":"Der römisch-katholische Dom St. Peter in Osnabrück ist die Kathedrale des Bistums Osnabrück. Der Dom ist ein spätromanisches Bauwerk und prägt seit seiner Entstehung die Silhouette der Stadt.\\nHauptpatron ist Sankt Peter."},{"page_url":"https://de.wikipedia.org/wiki/Marina_de_Van","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6b/Tournage_de_Ne_te_retourne_pas_de_Marina_de_Van.jpg","page_title":"Marina de Van","context_page_description":"Marina Nives de Van ist eine französische Filmregisseurin, Drehbuchautorin und Filmschauspielerin."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A1%CE%BF%CE%B2%CE%AD%CF%81%CF%84%CE%BF%CF%82_%CE%BF_%CE%99%CF%83%CF%87%CF%85%CF%81%CF%8C%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Robert_le_Fort.jpg","page_title":"Ροβέρτος ο Ισχυρός","context_page_description":"Ο Ροβέρτος ο ισχυρός ή Ροβέρτος Δ΄ του Βορμς μέλος του Οίκου των Ροβερτιδών ήταν Μαρκήσιος της Βρετάνης και ο πρώτος Κόμης του Ανζού. Ο Ροβέρτος Δ΄ ήταν γιος του Ροβέρτου Γ΄ του Βορμς αν και η πατρότητα του είναι για πολλούς ασαφής. Ο Ροβέρτος ο Ισχυρός ήταν πατέρας των βασιλέων της Γαλλίας Ροβέρτου Α΄ και Όντο ή Εύδη Α΄, ήταν ο προπάππος του Ούγου Καπέτου γενάρχη της δυναστείας των Καπετιδών της Γαλλίας."},{"page_url":"https://it.wikipedia.org/wiki/Linee_di_Nazca","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Maria_reiche_nazca.jpg","page_title":"Linee di Nazca","context_page_description":"Le linee di Nazca sono geoglifi, linee tracciate sul terreno, del deserto di Nazca, un altopiano arido che si estende per una ottantina di chilometri tra le città di Nazca e di Palpa, nel Perù meridionale. Le oltre 13.000 linee vanno a formare più di 800 disegni, che includono i profili stilizzati di animali comuni nell'area."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%AA%E0%A9%8B%E0%A8%A4%E0%A8%BE%E0%A8%B2%E0%A8%BE_%E0%A8%AA%E0%A9%88%E0%A8%B2%E0%A9%87%E0%A8%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Potala_2.jpg","page_title":"ਪੋਤਾਲਾ ਪੈਲੇਸ","context_page_description":"ਪੋਤਾਲਾ ਪੈਲੇਸ ਲਹਾਸਾ, ਚੀਨ ਵਿੱਚ ਸਥਿਤ ਹੈ। ਇਹ ਮਾਰਪੋ ਰੀ ਪਹਾੜੀ ’ਤੇ ਬਣਿਆ ਹੋਇਆ ਹੈ ਅਤੇ ਲਹਾਸਾ ਦੀ ਘਾਟੀ ਤੋਂ 130 ਮੀਟਰ ਦੀ ਉਚਾਈ ’ਤੇ ਹੈ। ਇਹ ਤਿੱਬਤ ਵਿੱਚ ਸਭ ਤੋਂ ਵੱਡੀ ਇਮਾਰਤੀ ਰਚਨਾ ਹੈ। ਇਸ ਦਾ ਨਿਰਮਾਣ 1645 ਵਿੱਚ ਪੰਜਵੇਂ ਦਲਾਈਲਾਮਾ ਸਮੇਂ ਸ਼ੁਰੂ ਹੋਇਆ ਅਤੇ 1648 ਵਿੱਚ ਵਾਈਟ ਪੈਲੇਸ ਦਾ ਨਿਰਮਾਣ ਪੂਰਾ ਹੋਇਆ। ਚੌਦਵੇਂ ਦਲਾਈਲਾਮਾ ਦੇ ਭਾਰਤ ਵਿੱਚ ਆ ਕੇ ਸ਼ਿਆਸੀ ਸ਼ਰਨ ਲੈਣ ਤੋਂ ਪਹਿਲਾਂ ਇਹ ਮਹਿਲ ਤਿੱਬਤੀ ਰੂਹਾਨੀ ਆਗੂ ਦਲਾਈਲਾਮਾ ਦੀ ਰਿਹਾਇਸ਼ ਰਿਹਾ ਹੈ।"},{"page_url":"https://en.wikipedia.org/wiki/Anna_H%C3%BCbler","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Huebler_Burger.jpg","page_title":"Anna Hübler","context_page_description":"Ana Hübler was a German pair skater, born in Munich. She was an Olympic champion and two-time World champion with skating partner Heinrich Burger.\\nHübler and Burger were the first World champions and the first Olympic champions in pairs figure skating. They never became European champions, because the European championships did not include a pairs competition until 1930.\\nThey skated for the club Münchener EV.\\nHübler was the first female German Olympic champion.\\nAfter retiring from figure skating, Hübler became a singer and actress. She later owned a department store."},{"page_url":"https://de.wikipedia.org/wiki/Conon_de_B%C3%A9thune","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Blason_Conon_de_B%C3%A9thune.svg","page_title":"Conon de Béthune","context_page_description":"Conon de Béthune war ein Ritter und Trouvère.\\nConon wurde als 10. Sohn des Robert V., Herr von Béthune, im damals flandrischen Artois geboren. Er war ein Vetter des Trouvères Huon d'Oisi und auch Schüler in dessen Künsten. Von Seiten seiner Großmutter her war er mit den Grafen des flandrischen Hennegaus verwandt. Sein Erscheinen am französischen Königshof um 1180 ist wohl daher auf die Hochzeit der damals 10-jährigen Isabella von Hennegau mit dem französischen König Philipp II. zurückzuführen.\\nDer anfänglich wegen seines schlechten Französisch und seines pikardischen Dialekts etwas verspottete, nahm im Gefolge von König Philipp II. am Dritten Kreuzzug teil, den er in seinem berühmten Kreuzzugslied 1188 herbeigewünscht hatte. Sein Vater starb hier 1191 bei der Belagerung von Akkon.\\nAm Vierten Kreuzzug nahm er als Gefolgsmann und enger Vertrauter des Grafen Balduin von Hennegau und Flandern, der im Laufe des Kreuzzugs zum Lateinischen Kaiser von Konstantinopel aufstieg, teil. Conon unterhandelte mit Venedig über den Schiffstransport und hatte nach der Eroberung von Konstantinopel wichtige Ämter, wie das des Gouverneurs von Adrianopel, inne."},{"page_url":"https://de.wikipedia.org/wiki/Sender_Ravensburg_(Wilhelmskirch)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Horgenzell_Wilhelmskirch_mit_Sender.jpg","page_title":"Sender Ravensburg (Wilhelmskirch)","context_page_description":"Der Sender Ravensburg war ein Rundfunksender für Mittelwelle, den die Media Broadcast zur Ausstrahlung des Deutschlandfunks im Landkreis Ravensburg in Baden-Württemberg betrieb. Er befand sich einen knappen Kilometer nordöstlich von Wilhelmskirch, einem Ortsteil der Gemeinde Horgenzell, auf einer Höhenlage von 581 m ü. NN und ist nicht zu verwechseln mit dem Fernsehsender Ravensburg auf dem nahegelegenen Berg Höchsten.\\nDie Anlage wurde am 23. August 1951 in Betrieb genommen und gehörte bis 1964 dem damaligen Südwestfunk, der dort auf der Frequenz 1538 kHz sein erstes Hörfunkprogramm mit einer Sendeleistung von 20 kW ausstrahlte. Zusammen mit den Standorten Bad Dürrheim und Reutlingen bildete der Sender ein Gleichwellennetz.\\nAm 30. September 1962 nahm der Südwestfunk für die damalige Deutsche Bundespost einen weiteren Sender zur Verbreitung des Deutschlandfunks auf der Frequenz 755 kHz mit einer Sendeleistung von 20 kW in Betrieb. Beide Programme wurden mittels einer Weiche über dieselbe Antennenanlage ausgestrahlt."},{"page_url":"https://sk.wikipedia.org/wiki/Arfeuille-Ch%C3%A2tain","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1d/Map_commune_FR_insee_code_23005.png","page_title":"Arfeuille-Châtain","context_page_description":"Arfeuille-Châtain je francúzska obec, ktorá sa nachádza v departemente Creuse, v regióne Limuzínsko."},{"page_url":"https://eu.wikipedia.org/wiki/Casaletto_Spartano","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Casaletto_Spartano_pos_SA.png","page_title":"Casaletto Spartano","context_page_description":"Casaletto Spartano Italiako udalerri bat da. Salernoko probintzian kokatuta dago, Campania eskualdean. 1.376 biztanle ditu, 86,57 kilometro koadroko azaleran banatuta."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Berlin-Hermsdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Stolperstein_Olafstr_8-10_%28Hermd%29_Elise_Hartmann.jpg","page_title":"Liste der Stolpersteine in Berlin-Hermsdorf","context_page_description":"Die Liste der Stolpersteine in Berlin-Hermsdorf enthält die Stolpersteine im Berliner Ortsteil Hermsdorf im Bezirk Reinickendorf, die an das Schicksal der Menschen erinnern, die im Nationalsozialismus ermordet, deportiert, vertrieben oder in den Suizid getrieben wurden. Die Spalten der Tabelle sind selbsterklärend. Die Tabelle erfasst insgesamt 29 Stolpersteine und ist teilweise sortierbar; die Grundsortierung erfolgt alphabetisch nach dem Familiennamen."},{"page_url":"https://de.wikipedia.org/wiki/Gemeinden_des_Kantons_Freiburg","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/Karte_Gemeinden_des_Kantons_Freiburg_farbig_1976.png","page_title":"Gemeinden des Kantons Freiburg","context_page_description":"Der Kanton Freiburg umfasst 133 politische Gemeinden. Hauptort ist Freiburg. Bezirkshauptorte sind fett hervorgehoben."},{"page_url":"https://en.wikipedia.org/wiki/Queensland_Railways_1720_class","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/1723_Bi-Centennial_Livery_-_040288_-_Moolabin.jpeg","page_title":"Queensland Railways 1720 class","context_page_description":"The 1720 class are a class of diesel locomotives built by Clyde Engineering, Eagle Farm for Queensland Railways between 1966 and 1970."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_Kadani","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Kada%C5%88%2C_%C4%8Cechova_161.JPG","page_title":"Seznam kulturních památek v Kadani","context_page_description":"Tento seznam nemovitých kulturních památek ve městě Kadaň v okrese Chomutov vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://cs.wikipedia.org/wiki/Ond%C5%99ejn%C3%ADk_(Podbeskydsk%C3%A1_pahorkatina)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/Ondrejnik_masiv.jpg","page_title":"Ondřejník (Podbeskydská pahorkatina)","context_page_description":"Ondřejník je třetí nejvyšší vrchol stejnojmenného geomorfologického okrsku Ondřejník i celé Podbeskydské pahorkatiny. Tyčí se 3 km západně od Frýdlantu nad Ostravicí a necelé 4 km severně od Skalky."},{"page_url":"https://en.wikipedia.org/wiki/Human_voice","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Gray1204.png","page_title":"Human voice","context_page_description":"The human voice consists of sound made by a human being using the vocal tract, such as talking, singing, laughing, crying, screaming, shouting, yelling etc. The human voice frequency is specifically a part of human sound production in which the vocal folds are the primary sound source.\\nGenerally speaking, the mechanism for generating the human voice can be subdivided into three parts; the lungs, the vocal folds within the larynx, and the articulators. The lungs, the \\"pump\\" must produce adequate airflow and air pressure to vibrate vocal folds. The vocal folds then vibrate to use airflow from the lungs to create audible pulses that form the laryngeal sound source. The muscles of the larynx adjust the length and tension of the vocal folds to ‘fine-tune’ pitch and tone. The articulators articulate and filter the sound emanating from the larynx and to some degree can interact with the laryngeal airflow to strengthen or weaken it as a sound source.\\nThe vocal folds, in combination with the articulators, are capable of producing highly intricate arrays of sound. The tone of voice may be modulated to suggest emotions such as anger, surprise, fear, happiness or sadness."},{"page_url":"https://pl.wikipedia.org/wiki/Generalissimus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Gilbert_Stuart_Williamstown_Portrait_of_George_Washington.jpg","page_title":"Generalissimus","context_page_description":"Generalissimus – w niektórych państwach tytuł nadawany generałowi lub marszałkowi pełniącemu obowiązki naczelnego wodza, zwłaszcza na czas wojny, związany z szerokimi pełnomocnictwami. Nadawany też dowodzącym armiami sojuszniczymi, a także w wielu wypadkach w przeszłości osobom z rodzin królewskich i działaczom państwowym jako stopień honorowy.\\nZwykle jest to tytuł najwyższy w hierarchii wojskowej, wyższy niż marszałek. Spotykany w niektórych armiach w czasach współczesnych, w Polsce nienadawany."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9F%D0%B0%D1%98%D0%B0%D0%BA%D0%BE%D0%B2%D0%B8%D0%B4%D0%BD%D0%B8_%D0%BC%D0%B0%D1%98%D0%BC%D1%83%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Ateles-fusciceps_54724770b.jpg","page_title":"Пајаковидни мајмуни","context_page_description":"Пајаковидните мајмуни образуваат фамилија на широконосни мајмуни. Фамилијата вклучува околу 30 современи видови, распространети исклучиво во Новиот свет."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%85%A8%E6%97%A5%E6%9C%AC%E5%A5%B3%E5%AD%90%E3%83%97%E3%83%AD%E3%83%AC%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Kaoru_Ito.JPG","page_title":"全日本女子プロレス","context_page_description":"全日本女子プロレスは、かつて存在した日本の女子プロレス団体。"},{"page_url":"https://en.wikipedia.org/wiki/Grade_I_listed_buildings_in_Buckinghamshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Parish_Church_of_St_Peter%2C_Stoke_Goldington_-_geograph.org.uk_-_249488.jpg","page_title":"Grade I listed buildings in Buckinghamshire","context_page_description":"There are approximately 372,905 listed buildings in England and 2.5% of these are Grade I. This page is a list of these buildings in the county of Buckinghamshire, by district."},{"page_url":"https://nl.wikipedia.org/wiki/Senhor_do_Bonfim_(gemeente)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Bandeira_Senhor_do_Bonfim.jpg","page_title":"Senhor do Bonfim (gemeente)","context_page_description":"Senhor do Bonfim is een gemeente in de Braziliaanse deelstaat Bahia. De gemeente telt 76.113 inwoners."},{"page_url":"https://da.wikipedia.org/wiki/One_Last_Tour","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/SHM_-_One_Last_Tour.jpeg","page_title":"One Last Tour","context_page_description":"One Last Tour var en koncertturné af Swedish House Mafia, der udspillede sig fra 16. november 2012 til 24. marts 2013.\\nUndervejs på turnéen kom gruppen forbi Danmark i Forum København den 26. november 2012."},{"page_url":"https://lt.wikipedia.org/wiki/Senoji_perk%C4%97la","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Senoji_perk%C4%97la_Klaip%C4%97doje_4.JPG","page_title":"Senoji perkėla","context_page_description":"Senoji perkėla – perkėla Lietuvos uostamiestyje Klaipėdoje."},{"page_url":"https://tr.wikipedia.org/wiki/HTC_Gene","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Htc_p3400i.jpg","page_title":"HTC Gene","context_page_description":"HTC Gene, Şubat 2007 yılında HTC tarafından üretilen bir Windows Mobile sistemli Cep bilgisayarı modelidir. 200 MHz TI OMAP 850 işlemci kullanıyor. HTC Gene P3400i için Microsoft Windows Mobile 6.0 Professional ve HTC Gene P3400 işletim sistemi için Microsoft Windows Mobile 5.0 Pocket PC'yi çalıştırıyor. 65K renkleri ve 2 megapiksel kameralı TFT dayanıklı dokunmatik ekran içerir. Bu telefonun taşıyıcıya bağlı isimleri Dopod D600'ü içerir. Aynı zamanda cihazlar farklı ROM güncellemeleri ile Windows Mobile 6.1 ve Windows Mobile 6.5 sürümlerine yükseltilebilir."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%9B%E0%B8%A5%E0%B8%B2%E0%B8%94%E0%B8%B2%E0%B8%9A%E0%B8%A5%E0%B8%B2%E0%B8%A7%E0%B8%A2%E0%B8%B2%E0%B8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Fisheries_capture_of_Clupea_bentincki.png","page_title":"ปลาดาบลาวยาว","context_page_description":"ปลาดาบลาวยาว เป็นปลาทะเลชนิดหนึ่ง ในอันดับปลาหลังเขียว\\nจัดเป็นปลาดาบลาวชนิดหนึ่ง มีลำตัวเรียวยาวและมีทรวดทรงแบนมาก ปากมีลักษณะเฉียงขึ้นข้างบน มีฟันเขี้ยวคู่หน้าใหญ่และคมมากเขี้ยวคู่นี้จะยื่นเลยริมฝีปาก ครีบหางเว้าลึกครีบหลังมีรอยแต้มสีดำลำตัวสีน้ำเงินเข้มปนเหลือง ท้องเป็นสันคม\\nมีความยาวประมาณ 30-50 เซนติเมตร และยาวที่สุด 100 เซนติเมตร พบกระจายพันธุ์ตามปากอ่าว, ชายทะเล หรือพื้นที่ ๆ เป็นน้ำกร่อย ตั้งแต่ชายฝั่งแอฟริกาตะวันออกจนถึงหมู่เกาะโซโลมอน, ทะเลแดง, ทะเลญี่ปุ่น, ตอนเหนือและตอนใต้ของออสเตรเลีย รวมถึงตองงา ในน่านน้ำไทยพบทั้งอ่าวไทยและทะเลอันดามัน\\nเป็นปลาที่ล่าเหยื่อบนผิวน้ำกินเป็นอาหาร เช่น ลูกปลาขนาดเล็กและกุ้งขนาดเล็ก จัดเป็นปลาที่มีความสำคัญทางเศรษฐกิจชนิดหนึ่ง สามารถนำไปแปรรูปเป็นลูกชิ้น หรือทอดมันได้\\nโดยที่ชื่อวิทยาศาสตร์ว่า คำว่า Chirocentrus มาจากภาษากรีก cheir หมายถึง \\"มือ\\" และ kentron หมายถึง \\"หนาม\\" และ Dorab มาจากภาษาอาหรับคำว่า darrab ซึ่งน่าจะแปลงมาจากคำว่า durubb ซึ่งหมายถึง ปลาทองในภาษาอาหรับ และคำว่า lisan หมายถึง \\"ลิ้น\\""},{"page_url":"https://ca.wikipedia.org/wiki/Oregon_(Wisconsin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Oregonpolice.jpg","page_title":"Oregon (Wisconsin)","context_page_description":"Oregon és una població dels Estats Units a l'estat de Wisconsin. Segons el cens del 2000 tenia una població de 7.514 habitants."},{"page_url":"https://en.wikipedia.org/wiki/Chris_Fehn","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Slipknot_13.jpg","page_title":"Chris Fehn","context_page_description":"Christopher Michael Fehn, or known by his number #3, is an American musician, best known as a former percussionist of the Grammy Award-winning heavy metal band Slipknot. He was also the bassist for Will Haven."},{"page_url":"https://vi.wikipedia.org/wiki/%E1%BA%A4n_%C4%90%E1%BB%99_thu%E1%BB%99c_Ph%C3%A1p","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/Eug%C3%A8ne_Delacroix_-_La_libert%C3%A9_guidant_le_peuple.jpg","page_title":"Ấn Độ thuộc Pháp","context_page_description":"Ấn Độ thuộc Pháp, chính thức là Établissements français dans l'Inde, là một thuộc địa của Pháp bao gồm các khu vực địa lý tách biệt trên tiểu lục địa Ấn Độ. Các tài sản ban đầu được Công ty Đông Ấn thuộc Pháp mua lại vào đầu nửa sau của thế kỷ 17, và de facto được sáp nhập vào Cộng hòa Ấn Độ vào năm 1950 và 1954. Các cơ sở của Pháp bao gồm Pondichéry, Karikal và Yanaon trên Bờ biển Coromandel, Mahé trên bờ biển Malabar và Chandernagor ở Bengal. Ấn Độ thuộc Pháp cũng bao gồm một số loges tại thị trấn khác, nhưng sau năm 1816, loges′ có tầm quan trọng ít thương mại và các thị trấn mà họ đã gắn liền đến dưới chính quyền Anh.\\nĐến năm 1950, tổng diện tích đo được là 510 km², trong đó 293 km² thuộc về lãnh thổ của Pondichéry. Năm 1936, dân số thuộc địa có tổng cộng 298.851 người, trong đó 63% sống trên lãnh thổ Pondichéry."},{"page_url":"https://en.wikipedia.org/wiki/Western_Gulf_coastal_grasslands","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Texas_bluebonnets_%28Lupinus_texensis%29%2C_Attwater_Prairie_Chicken_National_Wildlife_Refuge%2C_Colorado_County%2C_Texas%2C_USA_%2829_March_2019%29.jpg","page_title":"Western Gulf coastal grasslands","context_page_description":"The Western Gulf coastal grasslands are a subtropical grassland ecoregion of the southern United States and northeastern Mexico. It is known in Louisiana as the \\"Cajun Prairie\\", Texas as \\"Coastal Prairie,\\" and as the Tamaulipan pastizal in Mexico."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8A%E3%83%90%E3%83%A9%E5%B7%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Javier3.jpg","page_title":"ナバラ州","context_page_description":"ナバラ州またはナファロア州は、スペインの自治州である。一県一州の自治州であり、ナバラ県単独で構成される。州都はパンプローナ。スペイン語では第2音節にアクセントがあるため、ナバーラ州とも表記される。\\n中世のこの地域にはナバラ王国が存在し、スペイン帝国に併合された後も副王領として一定の自治権を得ていた。歴史的にはバスク地方の一部ではあるものの、フランコ体制後の民政移管期にはバスク州への合流を望まず、1982年にナバラ県単独でナバラ州が発足した。歴史的背景が考慮されて大きな自治権を得ており、スペインの全17自治州のうち課税自主権が認められているのはナバラ州とバスク州のみである。国家公用語であるスペイン語に加えて、一部地域では地域言語のバスク語も公用語に指定されている。"},{"page_url":"https://de.wikipedia.org/wiki/Australopithecus_sediba","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/The_Malapa_valley.jpg","page_title":"Australopithecus sediba","context_page_description":"Australopithecus sediba ist eine Art der ausgestorbenen Gattung Australopithecus, die vor rund zwei Millionen Jahren im Gebiet des heutigen Südafrika lebte. „Das rekonstruierte Skelett zeigt viele affenähnliche, aber auch einige ‚moderne‘, der Gattung Homo zuzuordnende Merkmale. So konnte Australopithecus sediba gut klettern, aber auch aufrecht auf zwei Beinen gehen, wenn auch wohl sehr wackelig.“ Die genaue Position von Australopithecus sediba im Stammbaum der Hominini und damit seine Verwandtschaft mit dem anatomisch modernen Menschen ist noch ungeklärt."},{"page_url":"https://en.wikipedia.org/wiki/List_of_battleships_of_the_United_States","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/USS_Texas_BB-35.jpg","page_title":"List of battleships of the United States","context_page_description":"The United States Navy began the construction of battleships with USS Texas in 1892, but the first battleship under that designation would be USS Indiana. Texas and USS Maine, commissioned three years later, were part of the New Navy program of the late 19th century, a proposal by then Secretary of the Navy William H. Hunt to match Europe's navies that ignited a years-long debate that was suddenly settled in Hunt's favor when the Brazilian Empire commissioned the battleship Riachuelo. In 1890, Alfred Thayer Mahan's book The Influence of Sea Power upon History was published and significantly influenced future naval policy—as an indirect of its influence on Secretary Benjamin F. Tracy, the Navy Act of June 30, 1890 authorized the construction of \\"three sea-going, coast-line battle ships\\" which became the Indiana class. The Navy Act of July 19, 1892 authorized construction of a fourth \\"sea-going, coast-line battle ship\\", which became USS Iowa. Despite much later claims that these were to be purely defensive and were authorized as \\"coastal defense ships\\", they were almost immediately used for offensive operations in the Spanish–American War."},{"page_url":"https://pt.wikipedia.org/wiki/T%C3%BAmulo_de_Ferdusi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Tomb_of_Ferdowsi.png","page_title":"Túmulo de Ferdusi","context_page_description":"O Túmulo de Ferdusi é um conjunto de túmulos compostos por uma base de mármore branco e um edifício decorativo erguido em homenagem ao poeta persa Ferdusi, localizado em Tus, no Irão, na província de Coração Razavi. Foi construído no início dos anos 30, sob o Reza Shah, e usa principalmente elementos da arquitectura aquemênida para demonstrar a rica cultura e história do Irão. A construção do mausoléu, bem como o seu design estético, é um reflexo do status cultural e geopolítico do Irão na época."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%88%A5%E5%BA%9C%E9%A7%85_(%E7%A6%8F%E5%B2%A1%E7%9C%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Entrance_No.3_of_Befu_Station_%28Fukuoka_Municipal_Subway%29.jpg","page_title":"別府駅 (福岡県)","context_page_description":"別府駅は、福岡県福岡市城南区別府二丁目にある福岡市地下鉄七隈線の駅。駅番号はN10。\\n駅のシンボルマークは空港線・箱崎線のシンボルマークをデザインした西島伊三雄が2001年に死去したため、それ以前に描かれていた原案を元に、息子で同じくグラフィックデザイナーの西島雅幸が完成させた。モチーフは別府大橋跨線橋と雲を「べ」の字の形にデザインしたもの。駅識別カラーは DIC-641で、福大前駅・次郎丸駅と共通。"},{"page_url":"https://cs.wikipedia.org/wiki/Donald_Trump","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/President_Donald_Trump_and_PM_Theresa_May_Joint_Press_Conference%2C_January_27%2C_2017.jpg","page_title":"Donald Trump","context_page_description":"Donald John Trump je americký republikánský politik,\\n45. prezident Spojených států, podnikatel a bývalá televizní osobnost. Do Bílého domu nastoupil roku 2017 ve věku 70 let jako nejstarší a zároveň nejbohatší zvolený prezident, a stal se také prvním mužem v úřadu bez předchozí zkušenosti s politickou či armádní funkcí. Je jeden z pěti amerických prezidentů, které nezvolila většina voličů, a jediný, jehož popularita nikdy nepřekročila 50 %.\\nPřed vstupem do úřadu působil jako předseda a generální ředitel společnosti The Trump Organization, která se zabývá obchodováním s nemovitostmi. Provozuje také mnoho hotelů, kasin a golfových hřišť po celém světě. Díky své reality show The Apprentice na stanici NBC se stal i mediálně známým.\\nV prvních měsících svého úřadování Trump zvrátil některé z kroků svého předchůdce Baracka Obamy. Odstoupil od dohody o transpacifickém partnerství, Íránské jaderné smlouvy a od Pařížské dohody o boji proti klimatickým změnám. Také částečně zastavil postupné oteplování americko-kubánských vztahů. Jmenoval konzervativního soudce Neila Gorsucha jako devátého člena Nejvyššího soudu."},{"page_url":"https://en.wikipedia.org/wiki/Gustave_Vogt","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Gustave_Vogt.jpg","page_title":"Gustave Vogt","context_page_description":"Gustave Vogt was a French oboist and composer."},{"page_url":"https://simple.wikipedia.org/wiki/Deaths_in_September_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Prince_Buster_%28cropped%29.jpg","page_title":"Deaths in September 2016","context_page_description":"The following is a list of notable deaths in September 2016. Names under each date are reported in alphabetical order by last name or pseudonym. Deaths of non-humans are reported here also if notable.\\nEach listing of a death must have a source. If no reference is included, the death notice will be removed. The following are the requirements of adding a name to the list in its order: name, age, nationality, what the person is known for, cause of death and most importantly a source."},{"page_url":"https://fi.wikipedia.org/wiki/Kytkent%C3%A4rima","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Leuchterklemme_75dpi.jpg","page_title":"Kytkentärima","context_page_description":"Kytkentärima on sähkötekninen liitin, jolla liitetään yhteen sähköjohtoja ruuviliitoksin.\\nTavallisin kytkentäriman käyttökohde ovat valaisinliitännät. Tällöin kytkentärimasta voidaan käyttää nimitystä valaisinliitin. Valaisimien kytkemisessä liittimiä on kuitenkin korvannut valaisinpistorasia.\\nKytkentärimoja on posliinisia ja muovisia, ja eri kokoisia. Muoviset liittimet myydään tavallisesti katkaistavana liitinrimana, jossa on 10–12 osaa. Kytkentärimalla liitetään useimmiten johtoja, joiden poikkipinta-ala on 1,5–6 mm². Mikäli liitin on rakenteeltaan johtoon nähden liian iso, ei sillä kannata kytkeä kovin ohutta johdinta, koska liitos voi jäädä huonoksi, vaikka ruuvin kiristäisikin tiukasti."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8F%A3%E7%B4%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Lipsticks.jpg","page_title":"口紅","context_page_description":"口紅，是一種主要使用於嘴唇上並可以增加嘴脣的色澤或改變嘴脣的顏色的化妝品。口紅是彩妝中重要的化妝品之一；主要成份包含了蠟、油和食用色素。最初的口紅是膏狀，與現今的唇蜜相似，子彈型的口紅是在第一次世界大戰時才發明的。\\n許多化妝品廠商會以顏色或流行的名稱來為口紅命名，第一個不以口紅顏色為名而以號碼行銷的品牌是伊夫·聖羅蘭。"},{"page_url":"https://de.wikipedia.org/wiki/Ante_Trumbi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Portrait_of_Ante_Trumbi%C4%87.jpg","page_title":"Ante Trumbić","context_page_description":"Ante Trumbić war ein kroatischer Politiker in Österreich-Ungarn, im SHS-Staat und in Jugoslawien. Bis zum Ausbruch des Ersten Weltkriegs trat er für die Vereinigung der kroatischen Länder innerhalb der Donaumonarchie ein. 1915 gründete er im Pariser Exil das Jugoslawische Komitee, das die Gründung eines gemeinsamen Staats von Serben, Kroaten und Slowenen anstrebte. In der ersten Regierung des SHS-Staats war er Außenminister. Seit 1921 war er in der Opposition. In seinen letzten Lebensjahren war Trumbić ein erklärter Gegner der Königsdiktatur unter Alexander I."},{"page_url":"https://hr.wikipedia.org/wiki/Vlado_Simcich_Vava","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Rijecki_novi_val_150208_4c.jpg","page_title":"Vlado Simcich Vava","context_page_description":"Vlado Simcich Vava, riječki gitarist, autor, producent, najpoznatiji po činjenici da je bio članom grupe Laufer u njihovu najintenzivnijem razdoblju od 1993. pa do razlaza 1996. godine, kada su i objavljeni svi nosači zvuka."},{"page_url":"https://fr.wikipedia.org/wiki/Furane","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/Furan-CRC-MW-3D-vdW.png","page_title":"Furane","context_page_description":"Le furane, encore écrit furanne, est un composé chimique de formule brute C₄H₄O. C'est un composé hétérocyclique appartenant à la classe des métalloles, constitué d'un cycle aromatique à cinq atomes, dont un atome d'oxygène. Il se présente sous la forme d'un liquide incolore très volatil. Possédant une réactivité différente de celle du benzène, il est utilisé comme réactif ou précurseur en chimie organique."},{"page_url":"https://ceb.wikipedia.org/wiki/T%C4%83%C8%99nad","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/View_in_Tasnad_2.JPG","page_title":"Tășnad","context_page_description":"Kapital sa munisipyo ang Tășnad sa Romaniya. Nahimutang ni sa munisipyo sa Oraș Tășnad ug lalawigan sa Satu Mare, sa amihanan-kasadpang bahin sa nasod, 400 km sa amihanan-kasadpan sa Bucharest ang ulohan sa nasod. 177 metros ibabaw sa dagat kahaboga ang nahimutangan sa Tășnad, ug adunay 9,466 ka molupyo.\\nAng yuta palibot sa Tășnad kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 221 ka metro ug 2.4 km sa habagatan sa Tășnad. Dunay mga 43 ka tawo kada kilometro kwadrado sa palibot sa Tășnad medyo gamay nga populasyon. Tășnad ang kinadak-ang lungsod sa maong dapit. Hapit nalukop sa kaumahan ang palibot sa Tășnad.\\nAng klima hemiboreal. Ang kasarangang giiniton 10 °C. Ang kinainitan nga bulan Hulyo, sa 22 °C, ug ang kinabugnawan Enero, sa -4 °C. Ang kasarangang pag-ulan 907 milimetro matag tuig. Ang kinabasaan nga bulan Hunyo, sa 119 milimetro nga ulan, ug ang kinaugahan Nobiyembre, sa 48 milimetro."},{"page_url":"https://pt.wikipedia.org/wiki/Aleksandr_Yerokhin","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Aleksandr_Yerokhin_2016.jpg","page_title":"Aleksandr Yerokhin","context_page_description":"Aleksandr Yuryevich Yerokhin - em russo, Александр Юрьевич Ерохин - é um futebolista Russo que atua como meio-campo. Atualmente, joga pelo Zenit."},{"page_url":"https://en.wikipedia.org/wiki/East_Ledang","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/East_Ledang.jpg","page_title":"East Ledang","context_page_description":"East Ledang is a township in Iskandar Puteri, Johor Bahru District, Johor, Malaysia. Developed by UEM Sunrise Berhad, it has Townhouses, Link Duplexes, Twin Villas and Bungalows.\\nNearby towns include Bukit Indah and Gelang Patah"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A2%D8%B1%D8%AC%D9%88%D8%B3_%D8%B3%D9%88%D8%A7%D8%B1%D9%8A%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Braga_tren_%287%29.jpg","page_title":"آرجوس سواريس","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nآرجوس سواريس لاعب كورة قدم من برازيل."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_het_Entrepotdok","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Amsterdam_-_Vianen_en_Warmenhuizen.JPG","page_title":"Lijst van rijksmonumenten in het Entrepotdok","context_page_description":"Een overzicht van de 57 rijksmonumenten in het Entrepotdok in Amsterdam."},{"page_url":"https://pl.wikipedia.org/wiki/Jeleni_Stawek","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Jeleni_Stawek_Hruba_Turnia.jpg","page_title":"Jeleni Stawek","context_page_description":"Jeleni Stawek – mały stawek znajdujący się w Dolinie Kaczej, w słowackiej części Tatr Wysokich. Jeleni Stawek nie jest pomierzony, nie prowadzą do niego żadne znakowane szlaki turystyczne.\\nJeleni Stawek jest jednym z trzech stawów znajdujących się w Dolinie Kaczej, jest spośród nich najmniejszy i najbardziej wysunięty na północ. Leży na tarasie nazywanym Jelenią Łąką, około 200 m na północny zachód od największego zbiornika wodnego doliny – Zielonego Stawu Kaczego. Nieco na wschód od Jeleniego Stawku przepływa Kaczy Potok wypływający z Zielonego Stawu Kaczego.\\nW okolicy stawu położona była koleba, którą urządził w 1948 r. taternik z Zakopanego, Paweł Vogel – przyniesiono tam nawet piecyk, dzięki czemu przez cały rok możliwe w niej było schronienie dla kilku osób. Żartobliwie kolebę nazywano „Hotel Vogel”."},{"page_url":"https://ca.wikipedia.org/wiki/Nevil_Maskelyne","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Maskelyne_Nevil.jpg","page_title":"Nevil Maskelyne","context_page_description":"Nevil Maskelyne va ser un astrònom anglès, va ser el cinquè \\"Astrònom Reial\\" i director de l'Observatori Astronòmic de Greenwich. Era el tercer fill del matrimoni entre Edmund Maskelyne, oriünd de Purton i Elizabeth Booth.\\nSegons expliquen els seus biògrafs l'observació de l'eclipsi solar de l'any 1748 el va impressionar tant que va decidir dedicar-se a l'astronomia i es va graduar en el setè lloc en el Trinity College, Universitat de Cambridge, l'any 1754 dedicant-se des d'aquest moment a ampliar els seus coneixements astronòmics.\\nVa conèixer l'astrònom James Bradley el 1755, que el va iniciar en l'observació. A causa de les seves especials aptituds en l'any 1761 va ser comissionat per la Royal Society per a efectuar delicades observacions del trànsit del planeta Venus sobre el disc solar, per a això es va desplaçar fins a l'illa de Santa Helena; durant les setmanes del trajecte marítim va realitzar experiments per determinar la longitud per mitjà d'observacions lunars."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E9%AC%A5%E7%8D%B8%E6%A3%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Dou_shou_qi_board.png","page_title":"鬥獸棋","context_page_description":"斗兽棋是一种版图游戏，采用阶级吃子规则。"},{"page_url":"https://es.wikipedia.org/wiki/Oxera","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Oxera_puchella.jpg","page_title":"Oxera","context_page_description":"Oxera es un género de plantas con flores con 60 especies​ pertenecientes a la familia de las lamiáceas, ​ anteriormente se encontraba en las verbenáceas.\\nEs nativo del suroeste del Pacífico."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_op_de_Zeedijk_(Amsterdam)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Zeedijk_20.JPG","page_title":"Lijst van rijksmonumenten op de Zeedijk (Amsterdam)","context_page_description":"Een overzicht van de 70 rijksmonumenten op de Zeedijk in Amsterdam."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%96%E3%83%AC%E3%83%B3%E3%83%8F%E3%82%A4%E3%83%A0%E3%81%AE%E6%88%A6%E3%81%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Battle_of_Blenheim_-_Penetration%2C_1730%2C_13_August_1704.png","page_title":"ブレンハイムの戦い","context_page_description":"ブレンハイムの戦いは、スペイン継承戦争における戦闘の一つで、1704年8月13日にバイエルン選帝侯国・フランス連合軍とイングランド・オーストリア同盟軍が現在のドイツ・バイエルン州に位置するドナウ川流域のブリントハイムで争い、イングランド・オーストリア同盟軍が勝った戦いである。イングランド・オーストリア同盟軍総司令官のマールバラ公ジョン・チャーチルがフランス軍相手に大勝利した戦いとして知られている。"},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%A8%E0%B4%BE%E0%B4%AF%E0%B5%8D%E0%B4%95%E0%B5%8D%E0%B4%95%E0%B4%B3%E0%B5%81%E0%B4%9F%E0%B5%86_%E0%B4%AA%E0%B4%9F%E0%B5%8D%E0%B4%9F%E0%B4%BF%E0%B4%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Chihuahua1_bvdb.jpg","page_title":"നായ്ക്കളുടെ പട്ടിക","context_page_description":"dog ]"},{"page_url":"https://de.wikipedia.org/wiki/Br%C3%BCnlasberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/2010-07-13_Aue_Br%C3%BCnlasberg_-Angela_M._Arnold_fec_793_VS-Seniorenheim.jpg","page_title":"Brünlasberg","context_page_description":"Brünlasberg ist ein Wohngebiet im Ortsteil Aue der Großen Kreisstadt Aue-Bad Schlema im sächsischen Erzgebirgskreis. Das ehemals selbstständige Dorf wurde 1937 nach Aue eingemeindet. Der Ort erhielt seinen Namen vom gleichnamigen Berg."},{"page_url":"https://no.wikipedia.org/wiki/Stubben_(Vika)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Aker_Brygge_map_1900.jpg","page_title":"Stubben (Vika)","context_page_description":"Stubben var en veistump i det området som nå kalles Aker Brygge. Den gikk som en fortsettelse av Dokkveien til Munkedamsveien på sørsiden av jernbanelinjen. Gatenavnet ble etterhvert bortregulert, og veiløpet ble senere en del av Dokkveien, som i en årrekke inngikk i E18 mens denne gikk over Rådhusplassen. I dag er Dokkveiens løp lagt om, og deler av det gamle løpet er elbilparkering."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BB%D0%B0%D0%B1%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Kathedrale_Santa_Isabel.jpg","page_title":"Малабо","context_page_description":"Мала́бо — столиця Екваторіальної Гвінеї, на острові Біоко Атлантичного океану. Адміністративний центр провінції Біоко. Населення — 30 тисяч жителів. Порт в затоці Біафра — експорт какао, кави, фруктів. Міжнародний аеропорт. Лісопильні, деревообробні, харчовосмакові підприємства, виробництво пальмової олії і мила. Засноване в 1827 англійцями як поселення Порт-Кларенс. У 1843—1968 адміністративний центр Іспанської Гвінеї. До 1973 року — Са́нта-Ізабе́л."},{"page_url":"https://fi.wikipedia.org/wiki/Kyproksen_edustajainhuone","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Cyprus_2016.png","page_title":"Kyproksen edustajainhuone","context_page_description":"Edustajainhuone on Kyproksen tasavallan parlamentti eli ylin lakia säätävä elin. Sen jäsenet valitaan viisivuotisille kausille.\\nKyproksen edustajainhuone perustettiin maan itsenäistyttyä vuonna 1960, ja ensimmäiset vaalit järjestettiin 31. heinäkuuta 1960. Edustajien määrä oli alun perin 50. Vuodesta 1985 edustajia on 80. Edustajanpaikoista 56 on varattu kyproksenkreikkalaisille ja 24 kyproksenturkkilaisille. Vuodesta 1974 lähtien turkkilaisten paikat ovat täyttämättä."},{"page_url":"https://lv.wikipedia.org/wiki/V-2_ra%C4%B7ete","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/V2_engine.jpg","page_title":"V-2 raķete","context_page_description":"V-2 jeb A4 - pirmā ballistiskā raķete. V-2 bija pirmais cilvēku radītais objekts, kas lidojis kosmosā. Raķeti konstruējuši vācu inženieri Vernera fon Brauna vadībā. Vācija V-2 izmantoja Otrā pasaules kara beigās, lai bombardētu Lielbritānijas un Beļģijas pilsētas. Tā kā līdz tam laikam vēl neviena valsts raķešbūvē nebija tikusi tik tālu kā Vācija, tad pēc kara V-2 kā prototipu izmantoja ASV, PSRS un citas valstis, lai attīstītu savas raķešu tehnoloģijas."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D0%B8%D1%81,_%D0%92%D0%B8%D0%BB%D0%BB%D0%B5%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Portrait_of_Willem_Maris_by_Floris_Arntzenius.jpg","page_title":"Марис, Виллем","context_page_description":"Виллем Марис, известный также как Венцель Марис — голландский художник — импрессионист, младший сын в семье художников Марис. Входил в число живописцев Гаагской школы."},{"page_url":"https://vi.wikipedia.org/wiki/Cassiculus_venustus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Cassiculus_venustus_%28card_mount%29.jpg","page_title":"Cassiculus venustus","context_page_description":"Cassiculus venustus là một loài bọ rùa bản địa New Zealand, được tìm thấy ít nhất ở Đảo Bắc. Loài này có ở New Zealand flax and Toetoe, reportedly eating the mealybugs that live there. Danh pháp có hiệu lực của loài này nay là Hoangus venustus. Nó có màu đen và vàng, đầu nó màu vàng mỗi bên với màu đen chạy xuống dưới phía giữa. Nó có 4 đốm màu cam ở khu vực đen này. Nó có kích thước dài 4 mm từ mũi đầu đến cuối bụng."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A4%D1%96%D0%BB%D1%96%D0%BF%D0%BF_I_%D0%90%D1%80%D0%B0%D0%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Bust_of_emperor_Philippus_Arabus_-_Hermitage_Museum.jpg","page_title":"Філіпп I Араб","context_page_description":"Марк Юлій Філіпп, також відомий як Філіпп Араб; 204–249 — імператор Стародавнього Риму з 244 по 249 роки.\\nФіліпп носив також титули перемоги: Persicus Maximus та Parthicus Maximus з 244 р.; Carpicus Maximus та Germanicus Maximus з 247 р."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%9A%E0%B8%A3%E0%B8%AD%E0%B8%81%E0%B9%82%E0%B8%84%E0%B8%A5%E0%B8%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/Broccoli-leaf-big.jpg","page_title":"บรอกโคลี","context_page_description":"บรอกโคลี หรือ กะหล่ำดอกอิตาลี จัดอยู่ในผักตระกูลกะหล่ำ มีชื่อทางวิทยาศาสตร์ว่า Brassica oleracea var. italica อยู่ในตระกูล Cruciferae บรอกโคลีเป็นผักที่ปลูกเพื่อ บริโภคส่วนของดอกอ่อน และก้าน"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%95%E3%83%AA%E3%82%AB%E5%8F%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Africa.NileMap.01.png","page_title":"アフリカ史","context_page_description":"本項ではアフリカ史、すなわちアフリカ大陸の歴史について解説する。"},{"page_url":"https://de.wikipedia.org/wiki/Fundy-Nationalpark","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/Fundy_NP_New_Brunswick_1.jpg","page_title":"Fundy-Nationalpark","context_page_description":"Der kanadische Fundy-Nationalpark befindet sich an der Bay of Fundy in der Nähe des Dorfes Alma in der Provinz New Brunswick. Im Park gibt es sowohl Seeküste als auch Küstenwälder, das Parkgelände umfasst ein Gebiet von 206 km². Der Park wird von der New Brunswick Route 114 durchquert.\\nDer Fundy-Nationalpark stellt gleichzeitig auch das Kerngebiet eines Biosphärenreservats der UNESCO, welches 2007 eingerichtet wurde, dar. Das Gebiet wurde 2011 auch in vollem Umfang als Dark Sky Preserve ausgewiesen. Bei dem Park handelt es sich um ein Schutzgebiet der IUCN-Kategorie II.\\nBei Ebbe kann man den Meeresboden erreichen, der sich bei Flut mehr als neun Meter unter der Wasseroberfläche befindet. Über einen Holzweg sind auch der Wald und das Sumpfgebiet zugänglich. Mehr als 20 Wasserfälle befinden sich auf dem Parkgelände.\\nIm 19. Jahrhundert befand sich auf dem Parkgelände ein Sägewerk, das Holz für die nahegelegene Stadt Saint John und für den Export produzierte. Nachdem die im Gebiet liegenden Wälder gefällt waren, wurde es von den Menschen verlassen; im Jahre 1948 wurde es schließlich zu Neubraunschweigs erstem Nationalpark."},{"page_url":"https://az.wikipedia.org/wiki/Fransis_Veber","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Francis_Veber_2012.jpg","page_title":"Fransis Veber","context_page_description":"Fransis Veber — Fransa kinorejissoru və ssenaristi."},{"page_url":"https://de.wikipedia.org/wiki/Schifffahrtsgesellschaft_des_Vierwaldst%C3%A4ttersees","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/MS_Cirrus_Luzern_April_2013.jpg","page_title":"Schifffahrtsgesellschaft des Vierwaldstättersees","context_page_description":"Die Schifffahrtsgesellschaft des Vierwaldstättersees ist ein schweizerisches konzessioniertes Unternehmen, das Schifffahrt auf dem Vierwaldstättersee betreibt. Die SGV ist die grösste Binnenreederei der Schweiz und verfügt über einen eigenen Schiffbaubetrieb. Sitz der Aktiengesellschaft ist Luzern. Ihr Ursprung lässt sich auf das Jahr 1836 zurückführen, als die erste Dampfschiffgesellschaft des Vierwaldstättersees gegründet wurde. 1870 fusionierte diese Gesellschaft mit später gegründeten Konkurrenzgesellschaften zum heutigen Unternehmen. Während der Transitverkehr von Personen und Waren zum Gotthardpass ursprünglicher Anlass der Gründung einer Dampfschiffgesellschaft war, gewann der touristische Verkehr auf dem See in den folgenden Jahrzehnten immer stärker an Bedeutung und stellt seit Eröffnung der Gotthardbahn 1882 den ganz überwiegenden Anteil. Die SGV betreibt heute eine Flotte von fünf historischen Raddampfern und 15 Motorschiffen und ist in das Tarifsystem des öffentlichen Personenverkehrs in der Schweiz eingebunden.\\n2018 wurde das Unternehmen neu als SGV Holding AG mit den drei Tochtergesellschaften SGV AG, Shiptec AG und Tavolago AG strukturiert."},{"page_url":"https://en.wikipedia.org/wiki/Rotary_International","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/The_last_Polio_victim_Painting.jpg","page_title":"Rotary International","context_page_description":"Rotary International is an international service organization whose stated purpose is to bring together business and professional leaders in order to provide humanitarian service and to advance goodwill and peace around the world. It is a non-political and non-religious organization open to all. There are over 35,000 member clubs worldwide, with a membership of 1.2 million individuals, known as Rotarians."},{"page_url":"https://en.wikipedia.org/wiki/List_of_threatened_species_of_the_Philippines","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Cacatua_haematuropygia_-Palawan%2C_Philippines-8.jpg","page_title":"List of threatened species of the Philippines","context_page_description":"This is a list of threatened plant and animal species in the Philippines as classified by the International Union for Conservation of Nature. It includes Vulnerable, Endangered, Critically Endangered, and recently Extinct species. It excludes Near Threatened, Data Deficient, and prehistoric species."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BE%D0%BB%D0%BD%D1%86%D0%B5%D0%B2%D0%BE_(%D1%8D%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%BE%D0%B4%D0%B5%D0%BF%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Solncevo_metro_depot_%2829553479467%29.jpg","page_title":"Солнцево (электродепо)","context_page_description":"«Со́лнцево» — электродепо Московского метрополитена, обслуживающее Солнцевскую линию и первый участок Большой кольцевой линии. Располагается рядом со станцией «Солнцево» и является одним из крупнейших электродепо столицы. Введено в эксплуатацию 30 августа 2018 года.\\nВ депо осуществляется техническое обслуживание, ремонт и ночной отстой поездов. Площадь зданий депо — 85 тысяч м². Вместимость — 40 поездов на ночной отстой и 10 поездов на одновременный ремонт. Имеется соединительный путь со станцией Солнечная Киевского направления Московской железной дороги."},{"page_url":"https://it.wikipedia.org/wiki/Grattacieli_del_Texas","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/EnterprisePlazaHoustonTX.JPG","page_title":"Grattacieli del Texas","context_page_description":"Il Texas è il secondo stato più grande degli USA, oltre che il secondo per popolazione, e tre delle città più grandi superano il milione di abitanti. Sono presenti 34 grattacieli che superano i 180 m di altezza, 21 dei quali costruiti durante gli anni '80."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%A7%D7%A1_%D7%94%D7%99%D7%99%D7%A1%D7%98%D7%99%D7%A0%D7%92%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Sir_Max_Hugh_Macdonald_Hastings.jpg","page_title":"מקס הייסטינגס","context_page_description":"מקס יו מקדונלד הייסטינגס הוא היסטוריון בריטי שכתב רבות על מלחמת העולם השנייה בפרט ועל המאה ה-20 בכלל. הייסטינגס הוא חבר האגודה המלכותית לספרות וחבר באגודה המלכותית להיסטוריה."},{"page_url":"https://de.wikipedia.org/wiki/B%C3%BCcherverbrennung_von_Ephesus","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Multi_eorum_qui_fuerant_curiosa_sectati_..._-_A._Faldoni%2C_inv._LCCN92516376.jpg","page_title":"Bücherverbrennung von Ephesus","context_page_description":"Die Bücherverbrennung von Ephesus ist eine im Neuen Testament erzählte Begebenheit."},{"page_url":"https://en.wikipedia.org/wiki/H%C3%B6dingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Wappen_Hoedingen.png","page_title":"Hödingen","context_page_description":"Hödingen is a village and a former municipality in the Börde district in Saxony-Anhalt, Germany. Since 1 January 2010, it is part of the town Oebisfelde-Weferlingen."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Oberransch%C3%BCtz","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Oberransch%C3%BCtz14b2.JPG","page_title":"Liste der Kulturdenkmale in Oberranschütz","context_page_description":"Die Liste der Kulturdenkmale in Oberranschütz enthält die Kulturdenkmale im Döbelner Ortsteil Oberranschütz.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%90%8A%E6%96%AF%C2%B7%E4%BF%9D%E7%BE%85","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/26/Les_Paul.jpg","page_title":"萊斯·保羅","context_page_description":"莱斯·保罗，生于威斯康星州沃基肖市，原名Lester William Polsfuss。美国音乐家及发明家。莱斯·保罗以在吉他方面的精湛技巧而著称，他对电吉他突破性的革新彻底改变了流行音乐的影响。他于1941年研制出第一把实心电吉他，并且发明了各种录制人声和乐器的新方法，从而一手改变了音乐的方向，有电吉他之父之称。他被老家威斯康辛州的乡亲们称为“沃基肖的奇才”。"},{"page_url":"https://sv.wikipedia.org/wiki/Carl_Gustaf_Qvarnstr%C3%B6m","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Carl_Gustaf_Qvarnstrom.jpg","page_title":"Carl Gustaf Qvarnström","context_page_description":"Carl Gustaf Qvarnström, född 23 mars 1810 i Stockholm, död där 5 mars 1867, var en svensk skulptör och målare."},{"page_url":"https://fr.wikipedia.org/wiki/R%C3%A9da_Johnson","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/Reda_Johnson_Coventry.jpg","page_title":"Réda Johnson","context_page_description":"Réda Johnson, né le 21 mars 1988 à Marseille, est un footballeur international béninois qui évolue au poste de défenseur à Eastleigh."},{"page_url":"https://en.wikipedia.org/wiki/YOG%E2%80%9342","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Yog42a-140.jpg","page_title":"YOG–42","context_page_description":"USS YOG-42 was a gasoline barge built by Concrete Ship Constructors, in National City, California. She was launched on March 23, 1943. Acquired by the United States Navy on May 23, 1943. She was assigned to the Asiatic-Pacific Theater, and survived the war. Re-designated YOGN-42 in May 1946, she was struck from the Naval Register on August 15, 1949. Sometime the next year, she was intentionally beached on the north coast of Lanai, Hawaiian Islands."},{"page_url":"https://fr.wikipedia.org/wiki/Ligue_am%C3%A9ricaine","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Teams_of_the_American_League_%282350728586%29.jpg","page_title":"Ligue américaine","context_page_description":"La Ligue américaine est l'une des deux ligues de la Ligue majeure de baseball aux États-Unis et au Canada. La ligue est créée en 1893 sous le nom de Western League et regroupe des franchises autour de la région des Grands Lacs. En 1900, elle prend son nom actuel et se proclame comme ligue majeure en 1901. Depuis 1903, le champion de la Ligue rencontre le champion de la Ligue nationale lors des Séries mondiales après la saison régulière. Après la saison 2018, les équipes de la Ligue américaine ont gagné 66 des 114 Séries mondiales.\\nLes actuels champions de la Ligue américaine de baseball sont les Astros de Houston.\\nAujourd'hui, la grande différence entre les deux ligues est la règle du frappeur désigné mise en place en 1973."},{"page_url":"https://es.wikipedia.org/wiki/Gustav_von_Hugo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/GustavvonHugo.jpg","page_title":"Gustav von Hugo","context_page_description":"Gustav von Hugo fue un importante jurista alemán, y uno de los fundadores de la escuela histórica del derecho, junto con Friedrich Karl von Savigny y Bernhard Windscheid.\\nNació en Lörrach, ciudad perteneciente al antiguo Estado de Baden. Cursó el gymnasium en Karlsruhe, entrando posteriormente, en 1782, en la Universidad de Göttingen. Cursó estudios de derecho durante tres años, y más tarde, conseguiría el doctorado en la Universidad de Halle, en 1788.\\nEse mismo año, volvería a la Universidad de Göttingen como profesor auxiliar, para obtener la titularidad plena en 1792. Cabe destacar que sería el profesor del príncipe de Anhalt-Dessau, Leopoldo I, lo que le daría gran prestigio y aceleraría aún más su carrera como docente. Además, sería amigo de los Hermanos Grimm, conservándose gran cantidad de cartas que nos muestran a Hugo como una persona sincera y abierta.\\nEntre 1828 y 1829 escribiría \\"Beiträge zur civilistischen Bucherkenntniss der letzten vierzig Jahre\\", donde analizaría el método de enseñanza del derecho romano por entonces seguido en las universidades alemanas."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%BE%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Rhone_bassin_topo.png","page_title":"Рона","context_page_description":"Ро́на или Рода́н — река в Швейцарии и Франции. Длина — 812 км, площадь бассейна — 95 590 км². Средний расход воды — 1780 м³/с."},{"page_url":"https://en.wikipedia.org/wiki/Gastrodia_elata","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Gastrodia_elata_1.JPG","page_title":"Gastrodia elata","context_page_description":"Gastrodia elata is a saprophytic perennial herb in the family Orchidaceae. It is found in Nepal, Bhutan, India, Japan, North Korea, Siberia, Taiwan, and China.\\nThe herb is used in traditional Chinese medicine and Sichuan cuisine. It is one of the three orchids listed in the earliest known Chinese Materia Medica. Medicinally, it is used for 'calming the liver' and for treating headaches, dizziness, tetanus, and epilepsy. According to \\"Nutrition Review,\\" \\"Gastrodia root has been shown to exert novel pain relief and inflammatory-mediating activities, as well as in vivo and in vitro inhibitory activity on nitric oxide production.\\""},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D0%BF%D1%83%D1%81_%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%BE%D0%B9_%D0%BF%D0%B5%D1%85%D0%BE%D1%82%D1%8B_%D0%A1%D0%A8%D0%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/AH-1Z_HMLA-303_in_flight_2008.jpg","page_title":"Корпус морской пехоты США","context_page_description":"Корпус морской пехоты США или Морская пехота США — род сил в составе Военно-морских сил США (ВМС США). Подчиняется Главному управлению ВМС США."},{"page_url":"https://en.wikipedia.org/wiki/Night_and_Day_(Woolf_novel)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Night_and_Day_%28Virginia_Woolf%29.JPG","page_title":"Night and Day (Woolf novel)","context_page_description":"Night and Day is a novel by Virginia Woolf first published on 20 October 1919. Set in Edwardian London, Night and Day contrasts the daily lives and romantic attachments of two acquaintances, Katharine Hilbery and Mary Datchet. The novel examines the relationships between love, marriage, happiness, and success.\\nDialogue and descriptions of thought and actions are used in equal amount, unlike in Woolf's later book, To the Lighthouse. There are four major characters, Katharine Hilbery, Mary Datchet, Ralph Denham, and William Rodney. Night and Day deals with issues concerning women's suffrage, if love and marriage can coexist, and if marriage is necessary for happiness. Motifs throughout the book include the stars and sky, the River Thames, and walks. Also, Woolf makes many references to the works of William Shakespeare, especially As You Like It."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Bad_Wildungen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Stolpersteine_Rieka_Jungheim_Bad_Wildungen.jpg","page_title":"Liste der Stolpersteine in Bad Wildungen","context_page_description":"Die Liste der Stolpersteine in Bad Wildungen enthält Stolpersteine, die im Rahmen des gleichnamigen Kunst-Projekts von Gunter Demnig in Bad Wildungen verlegt wurden. Mit ihnen soll an die Opfer des Nationalsozialismus erinnert werden, die in Bad Wildungen lebten und wirkten."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%87%91%E8%9E%8D%E9%AB%98%E6%96%B0%E5%8D%80%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Financial_Hi-Tech_Zone_Station_Platform_1_for_2019_07.jpg","page_title":"金融高新區站","context_page_description":"金融高新區站是廣佛地鐵一號線的車站，位於佛山市南海區海八路桂瀾路口東南側地塊內的地底。車站在2010年11月3日啟用。\\n本站與位於附近的夏南車輛段接軌。同時本站目前為佛山市位處最北和最東的地鐵站。"},{"page_url":"https://sv.wikipedia.org/wiki/Anonychomyrma_murina","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/Anonychomyrma_murina_casent0003185_label_1.jpg","page_title":"Anonychomyrma murina","context_page_description":"Anonychomyrma murina är en myrart som först beskrevs av Carlo Emery 1911. Anonychomyrma murina ingår i släktet Anonychomyrma och familjen myror. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://el.wikipedia.org/wiki/%CE%94%CE%AE%CE%BC%CE%BF%CF%82_%CE%93%CE%B1%CF%8D%CE%B4%CE%BF%CF%85","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/Kinotita_Gavdou.png","page_title":"Δήμος Γαύδου","context_page_description":"Ο Δήμος Γαύδου βρίσκεται επί της νήσου Γαύδος στα νότια του νομού Χανίων. Έδρα του είναι το Καστρί. Σύμφωνα με την απογραφή του 2011 ο Δήμος έχει συνολικά 152 κατοίκους και έκταση 32.424 στρέμματα. Το 2001 ο Δήμος είχε συνολικά 98 κατοίκους."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Sheridan_County,_Wyoming","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/EBF_Bridge_over_Powder_River.jpg","page_title":"National Register of Historic Places listings in Sheridan County, Wyoming","context_page_description":"This is a list of the National Register of Historic Places listings in Sheridan County, Wyoming. It is intended to be a complete list of the properties and districts on the National Register of Historic Places in Sheridan County, Wyoming, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in a map.\\nThere are 27 properties and districts listed on the National Register in the county, 1 of which is a National Historic Landmark.\\nThis National Park Service list is complete through NPS recent listings posted August 14, 2020."},{"page_url":"https://en.wikipedia.org/wiki/%C5%A0enkovec","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/%C5%A0enkovec_%28Me%C4%91imurje%29_-_opskrbni_centar.jpg","page_title":"Šenkovec","context_page_description":"Šenkovec is a municipality in Međimurje County, Croatia, located just outside the county seat, Čakovec.\\nThe municipality includes two villages – Šenkovec and Knezovec. In the 2011 census, the two villages were populated by a total of 2,879 people, most of whom are Croats. The seat of the municipality is in Šenkovec, a suburban village located approximately 2 kilometers to the north-west from the centre of Čakovec. The main road between Čakovec and Mursko Središće goes through the village.\\nThe village of Šenkovec has its own elementary school and kindergarten, as well as a sports hall and library. The pulmonology department of the Čakovec County Hospital is located in the Ksajpa neighbourhood of Šenkovec. There are two chapels in the municipality – the Holy Trinity Chapel in Šenkovec and the Saint Florian Chapel in Knezovec. The old Saint Jelena Chapel in Šenkovec is a listed building."},{"page_url":"https://eu.wikipedia.org/wiki/Las_Vegas_Raiders","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Charles_Woodson_2014_2.JPG","page_title":"Las Vegas Raiders","context_page_description":"Las Vegas Raiders, hasieran Oakland Raiders, AEBtako Nevada estatuko Las Vegas hirian egoitza duen amerikar futbol talde profesional bat da. NFL liga profesionalean jokatzen du. 1960an sortu zen eta etxeko partiduak O.co Coliseum estadioan jokatzen ditu."},{"page_url":"https://hu.wikipedia.org/wiki/Castiglione_d%E2%80%99Orcia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/CastiglionedOrciaPanorama2.jpg","page_title":"Castiglione d’Orcia","context_page_description":"Castiglione d’Orcia település Olaszországban, Toszkána régióban, Siena megyében. Lakosainak száma 2323 fő. Castiglione d’Orcia Abbadia San Salvatore, Montalcino, Pienza, Radicofani, San Quirico d’Orcia, Seggiano és Castel del Piano községekkel határos."},{"page_url":"https://es.wikipedia.org/wiki/Barrio_Soldati","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Conjunto_Soldati_2017-07-11_at_14.55.58.jpeg","page_title":"Barrio Soldati","context_page_description":"El Barrio Soldati es un conjunto habitacional que se encuentra en el barrio de Villa Soldati, en la ciudad de Buenos Aires, Argentina.\\nLa construcción del barrio fue planificada por la Secretaría de Vivienda, dependiente del Ministerio de Bienestar Social de la Nación, financiada por el Banco Hipotecario Nacional. El proyecto elegido en 1972 por concurso fue el del Estudio STAFF, formado por los arquitectos Ángela Bielus, Jorge Goldemberg y Olga Wainstein-Krasuk.​ Las empresas constructoras participantes fueron Aslan y Ezcurra S.A., Dycasa S.A. y Petersen, Thiele y Cruz S.A.​ Aunque originalmente se había dividido el proyecto en 7 licitaciones, finalmente fueron adjudicadas todas al mismo equipo. Fue finalizado en 1978."},{"page_url":"https://en.wikipedia.org/wiki/Noachis_quadrangle","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Scalloped_Terrain_at_Peneus_Patera.JPG","page_title":"Noachis quadrangle","context_page_description":"The Noachis quadrangle is one of a series of 30 quadrangle maps of Mars used by the United States Geological Survey Astrogeology Research Program. The Noachis quadrangle is also referred to as MC-27.\\nThe Noachis quadrangle covers the area from 300° to 360° west longitude and 30° to 65° south latitude on Mars. It lies between the two giant impact basins on Mars: Argyre and Hellas. The Noachis quadrangle includes Noachis Terra and the western part of Hellas Planitia.\\nNoachis is so densely covered with impact craters that it is considered among the oldest landforms on Mars—hence the term \\"Noachian\\" for one of the earliest time periods in martian history.\\nIn addition, many previously buried craters are now coming to the surface, where Noachis' extreme age has allowed ancient craters to be filled, and once again newly exposed.\\nMuch of the surface in Noachis quadrangle shows a scalloped topography where the disappearance of ground ice has left depressions.\\nThe first piece of human technology to land on Mars landed in the Noachis quadrangle. The Soviet's Mars 2 crashed at 44.2°S 313.2°W. It weighed about one ton. The automated craft attempted to land in a giant dust storm."},{"page_url":"https://fr.wikipedia.org/wiki/Pont_de_la_Puce","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Colombes.Pont_de_la_Puce.Rue_de_Paris.jpg","page_title":"Pont de la Puce","context_page_description":"Le pont de la Puce est un pont routier qui franchit la ligne de Paris-Saint-Lazare au Havre entre Colombes et La Garenne-Colombes."},{"page_url":"https://fr.wikipedia.org/wiki/Abell_383","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Abell_383.jpg","page_title":"Abell 383","context_page_description":"Abell 383 est un amas de galaxies situé à environ 2,5 milliards d'années-lumière de la Terre dans la constellation de l'Éridan.\\nAbell 383 est l'un des amas observés par le relevé astronomique Cluster Lensing and Supernova survey with Hubble. Cet amas a notamment permis d'observer des effets de lentille gravitationnelle sur la supernova Tibère, ce qui a notamment permis de quantifier certains aspects de la matière noire."},{"page_url":"https://fr.wikipedia.org/wiki/Banquet_%C3%A9trusque","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Etruscan_symposium_sarcophagus.jpg","page_title":"Banquet étrusque","context_page_description":"Le banquet étrusque est un thème récurrent de l'iconographie de l'art étrusque funéraire en plus d'être un fait de leur vie quotidienne."},{"page_url":"https://de.wikipedia.org/wiki/Wildensteiner_Altar","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Hochaltar_Sankt_Martin_Fl%C3%BCgel-innen-links.jpg","page_title":"Wildensteiner Altar","context_page_description":"Der Wildensteiner Altar des Meisters von Meßkirch ist ein kleiner Hausaltar, der 1536 für Gottfried Werner von Zimmern und seine Ehefrau Apollonia von Henneberg geschaffen wurde. Benannt ist er nach der Burg Wildenstein, in der er aber wahrscheinlich nie dauerhaft aufgestellt war. Eine Kopie des Altars wurde 1873 im Rahmen der Renovierung der Burg angefertigt und befindet sich seither in der dortigen Burgkapelle. Der Aufstellungsort der Kopie wurde in den Namen des Originals übertragen, das in der Staatsgalerie Stuttgart ausgestellt ist.\\nSeit 1955 steht er in der Liste national wertvollen Kulturguts.\\nDas Werk entstand im zeitlichen Zusammenhang des Großauftrags des Stifters der Vergrößerung und Neugestaltung der Stiftskirche Sankt Martin in seiner Residenzstadt Meßkirch. Nach Beendigung des Bauernkrieges und in einer Zeit, als sich im benachbarten Herzogtum Württemberg und in den Reichsstädten die Reformation etablierte, kann dies als altgläubiges Bekenntnis interpretiert werden.\\nDer Wildensteiner Altar trägt, im Gegensatz zu den Arbeiten an den Altarbildern, die oft Werkstattcharakter haben, individuellere künstlerische Züge."},{"page_url":"https://nl.wikipedia.org/wiki/Petershagen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/M%C3%BChle_D%C3%B6hren3.jpg","page_title":"Petershagen","context_page_description":"Petershagen is een gemeente in de Duitse deelstaat Noordrijn-Westfalen, gelegen in de Kreis Minden-Lübbecke. Het stadje met de 28 bijbehorende dorpen telt in totaal 25.168 inwoners."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%BE%D9%8A%D8%AA_%DA%A4%D8%A7%D9%86_%D8%AF%D9%8A%D8%B1_%D8%B3%D8%A7%D9%86%D8%AF%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Tweede_Kamer_mediadebat_l_mediawoordvoerder_Hermans_%28VVD%29%2C_r_CDA_college_va%2C_Bestanddeelnr_933-7473.jpg","page_title":"پيت ڤان دير ساندين","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nپيت ڤان دير ساندين كان سياسى من مملكة نيديرلاند."},{"page_url":"https://de.wikipedia.org/wiki/Zemendorf-St%C3%B6ttera","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Zemendorf-St%C3%B6ttera_-_Zemendorf%2C_Mausoleum_Rothermann_%2801%29.jpg","page_title":"Zemendorf-Stöttera","context_page_description":"Zemendorf-Stöttera ist eine Gemeinde mit 1275 Einwohnern im Burgenland im Bezirk Mattersburg in Österreich.\\nDer ungarische Ortsname der Gemeinde ist Zemenye-Selegd."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A3%E0%B8%B1%E0%B8%90%E0%B8%9B%E0%B8%A3%E0%B8%B0%E0%B8%AB%E0%B8%B2%E0%B8%A3%E0%B9%83%E0%B8%99%E0%B8%9B%E0%B8%A3%E0%B8%B0%E0%B9%80%E0%B8%97%E0%B8%A8%E0%B9%84%E0%B8%97%E0%B8%A2_%E0%B8%9E.%E0%B8%A8._2549","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/BKK24090602.jpg","page_title":"รัฐประหารในประเทศไทย พ.ศ. 2549","context_page_description":"รัฐประหารในประเทศไทย พ.ศ. 2549 เกิดในคืนวันที่ 19 กันยายน พ.ศ. 2549 โดยคณะปฏิรูปการปกครองในระบอบประชาธิปไตยอันมีพระมหากษัตริย์ทรงเป็นประมุข ซึ่งมีพลเอก สนธิ บุญยรัตกลินเป็นหัวหน้าคณะ โค่นรักษาการนายกรัฐมนตรี ดร. ทักษิณ ชินวัตร นับเป็นรัฐประหารในรอบ 15 ปี รัฐประหารครั้งนี้เกิดขึ้นก่อนการเลือกตั้งเป็นการทั่วไปในเดือนต่อมา หลังจากการเลือกตั้งทั่วไปที่มีกำหนดจัดในเดือนเมษายนถูกสั่งให้เป็นโมฆะ นับเป็นจุดเปลี่ยนสำคัญในวิกฤตการณ์ทางการเมืองที่ดำเนินมานับแต่เดือนกันยายน พ.ศ. 2548 คณะรัฐประหารยกเลิกการเลือกตั้งซึ่งกำหนดจัดในเดือนตุลาคม ยกเลิกรัฐธรรมนูญ สั่งยุบรัฐสภา สั่งห้ามการประท้วงและกิจกรรมทางการเมือง ยับยั้งและตรวจพิจารณาสื่อ ประกาศใช้กฎอัยการศึก และจับกุมสมาชิกคณะรัฐมนตรีหลายคน\\nพลเอก สนธิ บุญยรัตกลิน แถลงสาเหตุเมื่อวันที่ 21 กันยายน และให้คำมั่นว่าจะฟื้นฟูรัฐบาลระบอบประชาธิปไตยภายในหนึ่งปี อย่างไรก็ตาม คณะปฏิรูปการปกครองในระบอบประชาธิปไตยอันมีพระมหากษัตริย์ทรงเป็นประมุขประกาศว่า หลังจากการเลือกตั้งและการตั้งรัฐบาลประชาธิปไตยแล้ว คณะปฏิรูปการปกครองจะเปลี่ยนไปอยู่ในรูปแบบของคณะมนตรีความมั่นคงแห่งชาติ ซึ่งยังไม่มีการอธิบายบทบาทที่มีต่อการเมืองไทยในอนาคต"},{"page_url":"https://eo.wikipedia.org/wiki/Vrbov","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/de/Vrbov_1.JPG","page_title":"Vrbov","context_page_description":"Vrbov, hungare Ménhárd, germane Menhardsdorf estas vilaĝo kaj municipo en Slovakio."},{"page_url":"https://ast.wikipedia.org/wiki/Capsicum_pubescens","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Rocoto.jpg","page_title":"Capsicum pubescens","context_page_description":"Capsicum pubescens ye una planta del xéneru Capsicum que'l so frutu ye conocíu como rocoto, locoto —del quechua rukutu o luqutu—, pimientu, chile de cera, chile pumar o perón, utilizáu como condimento picante na cocina llatinoamericana, especialmente la boliviana y peruana. El color del frutu puede variar dende'l colloráu, verde naranxal o mariellu. Comercializar nel so estáu natural nos mercaos mexicanos, arxentinos, chilenos, bolivianos y peruanos, como tamién en pasta y en polvu.\\nYe un frutu relativamente picante: el so rangu na escala Scoville allugar ente 100.000 SHU a 200.000 SHU."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D9%8A%D9%86_%D9%83%D8%A7%D9%85%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Dean_kamen.jpg","page_title":"دين كامين","context_page_description":"دين. إل. كامين ‏ هو اميركي مبتكر و مخترع من نيو هامبشاير.ولد في لونغ آيلاند، نيويورك، وقال انه حضر معهد البوليتكنيك ورسستر، ولكن إنسحب قبل التخرج بعد خمس سنوات من البحوث المتقدمة خاصة بمضخة تسريب المخدرات AutoSyringeAutoSyringe مضخة إنسولين. انه هو ابن جاك كامين، الرسام في مجلة جنون، وايرد ساينس الهزلية وغيرها من منشورات إى سى كوميكس."},{"page_url":"https://pl.wikipedia.org/wiki/Forbach_(Francja)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Forbach_ch%C3%A2teau_Barrabino.jpg","page_title":"Forbach (Francja)","context_page_description":"Forbach – miejscowość i gmina we Francji, w regionie Grand Est, w departamencie Mozela.\\nWedług danych na rok 1990 gminę zamieszkiwało 27 076 osób, a gęstość zaludnienia wynosiła 1659 osób/km².\\nW mieście znajduje się stacja kolejowa Gare de Forbach."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_presidenten_van_Peru","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Guillermo_Billinghurst_3.jpg","page_title":"Lijst van presidenten van Peru","context_page_description":"De president van Peru is het democratisch gekozen staatshoofd van Peru. De president wordt officieel aangeduid als de President van de Republiek.\\nDe president vertegenwoordigt de republiek tijdens officiële internationale aangelegenheden. Verder wijst hij de premier van Peru aan en benoemt hij de ministers van het kabinet van Peru.\\nEen volle ambtstermijn duurt vijf jaar en het aantal termijnen is beperkt tot twee. De huidige president is sinds 23 maart 2018 de onafhankelijke Martín Vizcarra. Hij volgde de tussentijds afgetreden president Pedro Pablo Kuczynski op. Als aanvoerder van zijn partij Peruanos Por el Kambio, won Kuczynski op 5 juni 2016 zeer nipt de tweede stemronde van de presidentsverkiezingen van zijn rivale Keiko Fujimori, dochter van voormalig president Alberto Fujimori. De wisseling van de regering en de eedaflegging van de nieuwe president vindt normaal gesproken plaats op 28 juli, de nationale feestdag waarop de onafhankelijkheid van Spanje wordt gevierd.\\nIn het verleden waren de presidenten militairen uit de Peruviaanse krijgsmacht die hebben gestreden voor de onafhankelijkheid van het land en in de Salpeteroorlog tegen Chili."},{"page_url":"https://en.wikipedia.org/wiki/Cascadia_College","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Cascadia_Logo.png","page_title":"Cascadia College","context_page_description":"Cascadia College, is an American community college located in Bothell, Washington on a shared campus with the University of Washington Bothell. Established in 2000, Cascadia was built to serve the cities of Bothell, Woodinville, Kirkland, Kenmore, Duvall, Carnation, Sammamish, Redmond and other smaller communities within the greater Seattle area.\\nThe 128 acre campus is situated at 18345 Campus Way, along Beardslee Boulevard, just northwest of the intersection of Interstate 405 and State Route 522.\\nCascadia offers two-year associate degrees, two bachelor's degree programs in Sustainable Practices and Mobile Apps Development, and continuing education courses, and professional and technical training. Cascadia gained accreditation in 2006 from the Northwest Commission on Colleges and Universities.\\nIn September 2014, the Board of Trustees of the former Cascadia Community College voted to change the school's name to Cascadia College."},{"page_url":"https://ro.wikipedia.org/wiki/Gr%C3%A2nari,_Bra%C8%99ov","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Josephinische_Landaufnahme_pg208.jpg","page_title":"Grânari, Brașov","context_page_description":"Grânari, mai demult Mucundorf, Mochendorf, Grănari este un sat în comuna Jibert din județul Brașov, Transilvania, România.\\nSatul Grânari, în prezent locuit în majoritate de populație maghiară, a fost menționat pentru prima oară în anul 1289."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%A1%E3%83%AA%E3%82%AB%E7%A9%BA%E8%BB%8D%E8%88%AA%E7%A9%BA%E5%85%B5%E9%81%BA%E7%94%A3%E5%8D%9A%E7%89%A9%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/F-16_at_Lackland_Air_Force_Base.jpg","page_title":"アメリカ空軍航空兵遺産博物館","context_page_description":"アメリカ空軍航空兵遺産博物館は、テキサス州ベア郡サンアントニオのラックランド空軍基地の敷地内にある、アメリカ空軍に関する博物館。"},{"page_url":"https://en.wikipedia.org/wiki/1997_Namibia_mid-air_collision","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Flugzeugabsturz1997.jpg","page_title":"1997 Namibia mid-air collision","context_page_description":"On 13 September 1997, a German Air Force Tupolev Tu-154M observation aircraft and a United States Air Force C-141B Starlifter transport aircraft were destroyed in a mid-air collision while cruising at 35,000 feet off the coast of Namibia. All 33 people on board both aircraft were killed. At the time of the collision, the Tupolev was flying on a southerly route from Niamey, Niger, to Cape Town, South Africa, while the C-141 was heading northwest from Windhoek, Namibia, to Ascension Island.\\nNeither aircraft was equipped with TCAS collision avoidance systems, and although both crews had filed a flight plan, the German aircraft was not in contact with Namibian air traffic control and controllers were unaware of its presence in Namibian airspace. Furthermore, the Tupolev was flying at the wrong altitude, according to its flight plan and to the semicircular rule.\\nThe subsequent US Air Force inquiry concluded that the German crew was responsible for the accident, citing pilot error and inadequate air traffic control that contributed to the fatal lack of separation."},{"page_url":"https://fr.wikipedia.org/wiki/Classe_Athenic","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Ionic.jpg","page_title":"Classe Athenic","context_page_description":"La classe Athenic est une classe de trois paquebots-mixtes britanniques de la White Star Line mis en service en 1901 et 1902. Elle est composée de l'Athenic, du Corinthic et de l'Ionic. Conçus pour transporter plusieurs centaines de passagers, ils disposent également de nombreuses cales réfrigérées destinées à embarquer de la viande de mouton. Ces installations sont nécessaires sur la ligne qui leur est attribuée, la Nouvelle-Zélande, qui est exploitée par la White Star de façon conjointe avec la Shaw, Savill & Albion Line.\\nDurant leur première décennie de service, les navires de classe Athenic connaissent un grand succès et sont rejoints en 1911 par le Zealandic. La Première Guerre mondiale ne modifie pas le service de l'Athenic et du Corinthic, utilisés pour ravitailler le Royaume-Uni en viande, tandis que l'Ionic est réquisitionné et sert de transport de troupes durant le conflit. Les trois navires poursuivent ensuite une carrière commerciale sans histoires durant les années 1920.\\nFin 1927, l'Athenic est retiré du service et cédé à une compagnie norvégienne qui le transforme en baleinier. Il poursuit cette carrière sous divers pavillons jusqu'en 1962."},{"page_url":"https://uk.wikipedia.org/wiki/SEAT","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Seat_850_Spider_vl_blue_TCE.jpg","page_title":"SEAT","context_page_description":"SEAT S.A. — іспанська компанія з виробництва легкових автомобілів, що входить до складу концерну VAG. Штаб-квартира розташована в Барселоні, Іспанія."},{"page_url":"https://pl.wikipedia.org/wiki/Jan_Wn%C4%99k","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Jan_Wnek_Model.jpg","page_title":"Jan Wnęk","context_page_description":"Jan Wnęk – cieśla, rzeźbiarz. Domniemany konstruktor pierwszego na świecie sterowalnego, załogowego statku powietrznego cięższego od powietrza, na którym odbył co najmniej kilka lotów w latach 1865–1869. Miłośnicy jego sztuki nadali mu przydomki: Wit Stwosz z Powiśla i Mistrz zapatrzony w gotyk. Ludzie pamiętający o jego osiągnięciach konstruktorskich i wyczynach lotniczych mówili o nim: Ikar znad Dunajca, Chłopski Ikar lub Polski Leonardo da Vinci. Jego sukcesy jako pioniera lotnictwa nie są jednak uznawane przez część historyków, ze względu za brak dostatecznie silnych dowodów."},{"page_url":"https://es.wikipedia.org/wiki/Pole_position","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Pole_position_markings_N%C3%BCrburgring.jpg","page_title":"Pole position","context_page_description":"La pole position, primera posición, ​ o simplemente pole, es el término que se utiliza en ciertas modalidades de automovilismo y motociclismo en circuito para designar el primer lugar en la parrilla de salida de una carrera. La frase tiene su origen en la hípica, donde el primer corredor salía desde el lugar más próximo a los postes interiores."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%83%A5%E3%82%BF%E3%82%A4%E3%83%B3%E3%83%8F%E3%82%A4%E3%83%A0%E3%83%BB%E3%82%A2%E3%83%B3%E3%83%BB%E3%83%87%E3%82%A2%E3%83%BB%E3%83%A0%E3%83%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Klosterkelter_Steinheim_Murr.jpg","page_title":"シュタインハイム・アン・デア・ムル","context_page_description":"シュタインハイム・アン・デア・ムル はドイツ連邦共和国バーデン＝ヴュルテンベルク州ルートヴィヒスブルク郡に属す市である。本市はシュトゥットガルト地域およびシュトゥットガルト大都市圏周縁地域に含まれる。\\nシュタインハイムは、ホモ・スタインハイメンシスの発掘地である。ホモ・スタインハイメンシスは、およそ25万年前と推定される先史時代のヨーロッパで3番目に古い人類である。"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9F%D1%80%D1%8F%D0%BF%D0%BE%D1%80%D0%B5%D1%86_%D0%B8_%D0%B3%D1%83%D1%81%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Berkovitsa-HMIV-Ivan-Vazov-Pryaporets-gusla-3rd-edition-1895.jpg","page_title":"Пряпорец и гусла","context_page_description":"„Пряпорец и гусла“ е първата стихосбирка на Иван Вазов. Издадена е под псевдонима му Пейчин в Румъния през 1876 г.\\nПовечето от стихотворенията в стихосбирката са написани в Сопот, а останалите – в Букурещ. Произведенията са създадени като бунтовнически песни, повечето от които излизат в стихосбирката. За създаването им Вазов се е повлиял от новите революционни идеи и от книжката „Песни и стихотворения от Ботьова и Стамболова“ на Христо Ботев и Стефан Стамболов.\\nСтихосбирката „Пряпорец и гусла” е издадена изцяло на собствени разноски на автора. Разпространявана е и продавана от търговеца Д. В. Манчов. Вазов не получава пари от продажбата ѝ.\\nТогава поетът ползва псевдонима Пейчин, подсказан му от Манчов. Предпочел е подписването с псевдоним, за да не излага на риск от преследване баща си и братята си в Османската империя.\\nСборникът включва следните стихотворения:\\n„Борът“\\n„Сиромахкиня“\\n„Новонагласената гусла“\\n„Отмъстител“\\n„Волентиринът“\\n„Пряпорец“\\n„Панагюрските въстаници“\\n„Свобода или смърт“\\n„Радецки“\\n„Де е България?“"},{"page_url":"https://tt.wikipedia.org/wiki/%D2%AE%D0%BB%D0%B5%D0%BC%D1%81%D0%B5%D0%B7_%D0%BF%D0%BE%D0%BB%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/%D0%A8%D0%B5%D1%81%D1%82%D0%B2%D0%B8%D0%B5_%D1%80%D0%B5%D0%B3%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B9_%D0%BF%D0%B0%D1%82%D1%80%D0%B8%D0%BE%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%B9_%D0%BE%D0%B1%D1%89%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%BE%D0%B9_%D0%BE%D1%80%D0%B3%D0%B0%D0%BD%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D0%B8_%C2%AB%D0%91%D0%B5%D1%81%D1%81%D0%BC%D0%B5%D1%80%D1%82%D0%BD%D1%8B%D0%B9_%D0%BF%D0%BE%D0%BB%D0%BA%C2%BB_-_1.jpg","page_title":"Үлемсез полк","context_page_description":"Үлемсез полк - Русиядә һәм Бөек Ватан сугышында катнашканнар башка илләрендә Җиңү көненә багышланган уза торган чара. Чараның катнашучылары Бөек Ватан сугышында катнашкан туганнар фотосурәтләрен күтәреп баралар.\\n\\"Үлемсез полк\\" чарасында һәрбер кеше катнаша ала, ирекле рәвештә Бөек Ватан сугышында катнашкан туганнар турында хәтерне саклау максатыннан уздырыла.\\nБеренче мәртәбә \\"Үлемсез полк\\" чарасы Тум шәһәрендә 2012 елда уза.\\n2013 елда чара Русиянең 120 шәһәрендә уза, 2014 елда - 500 шәһәрдә 7 илдә.\\n2015 елда \\"Үлемсез полк\\" чарасы 15 илдә уза, Мәскәүдә чарада 500 мең артык кеше катнаша, бөтен Русиядә 15 миллион чамалап кеше катнаша.\\n2015 елда Татарстан Җөмһүриятендә 50 мең артык кеше \\"Үлемсез полк\\" чарасында катнашты, шул исәптән 35 мең укучы һәм студент.\\n2015 елда \\"Үлемсез полк\\" чарасы Австрия, Азәрбайҗан, Беларус, Алмания, Израил, Ирландия, Казакъстан, Кыргызстан, Монголия, Норвегия, АКШ, Украина илләрендә, ДХҖ һәм ЛХҖ танылмаган дәүләтләрендә узды."},{"page_url":"https://es.wikipedia.org/wiki/Ocean%C3%ADa_(1984)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/INGSOC_logo.png","page_title":"Oceanía (1984)","context_page_description":"Oceanía es el nombre de uno de los tres superestados en que se divide la Tierra en la novela distópica de ciencia ficción del escritor británico George Orwell, 1984. Los otros dos son Eurasia y Asia Oriental"},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A1%D0%B0%D1%80%D0%B6%D0%B5-%D0%BB%D0%B5-%D0%BB%D0%B5-%D0%9C%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Sarg%C3%A9-les-Le-Mans.jpg","page_title":"Сарже-ле-ле-Ман","context_page_description":"Сарже-ле-ле-Ман — Францин гӀала-коммуна, лаьтта Луаран латтанаш регионехь. Коммунан департамент — Сарта. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://de.wikipedia.org/wiki/An_der_Untertrave","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/HL_Damals_%E2%80%93_HR_a_d_Untertrave.jpg","page_title":"An der Untertrave","context_page_description":"An der Untertrave ist eine Straße der Lübecker Altstadt."},{"page_url":"https://fr.wikipedia.org/wiki/Route_nationale_40_(Argentine)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/77/167_-_Torres_del_Paines_-_Janvier_2010.JPG","page_title":"Route nationale 40 (Argentine)","context_page_description":"La route nationale 40 est une importante voie routière d'Argentine qui traverse le pays du nord au sud, depuis La Quiaca à la frontière bolivienne dans la province de Jujuy jusqu'au cap Virgenes à l'extrême sud de la Patagonie. C'est la route la plus longue du pays. Elle court parallèlement à la Cordillère des Andes en reliant les parcs nationaux les plus importants et traverse plusieurs des régions touristiques et des attraits principaux du territoire. Actuellement ce trajet mythique a été promu comme produit touristique national. La route commence en Patagonie au niveau de la mer et s'étend sur environ 5 000 km, traversant 20 parcs nationaux, 18 cours d'eau importants, reliant 27 cols andins. Elle culmine à 4 895 mètres au niveau du col d'Abra del Acay dans la province de Salta."},{"page_url":"https://pt.wikipedia.org/wiki/Ilha_de_Hornos","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Caphorn1.en.svg","page_title":"Ilha de Hornos","context_page_description":"A ilha de Hornos é uma ilha desabitada do sul do Chile pertencente ao arquipélago das ilhas Hermite, na Terra do Fogo. É famosa por conter o Cabo Horn. É a mais meridional das ilhas costeiras do Chile, e mais a sul, mas afastadas, ficam as ilhas Diego Ramírez."},{"page_url":"https://fi.wikipedia.org/wiki/Rocroi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Rocroi.JPG","page_title":"Rocroi","context_page_description":"Rocroi on kunta Ardennesin departementissa Champagne-Ardennen hallintoalueella Ranskassa. Kunnassa oli 2 420 asukasta vuoden 1999 väestönlaskennassa. Rocroin pinta-ala on 50 neliökilometriä."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BA%D0%B0%D1%84%D0%B0%D0%BD%D0%B4%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/EVAtion_-_GPN-2000-001087.jpg","page_title":"Скафандр","context_page_description":"Скафа́ндр — спеціальне спорядження, призначене для ізоляції людини від зовнішнього середовища — від тиску або вакууму, температури, випромінювань.\\nНормобаричний скафандр — спорядження, призначене для глибоководних робіт під час яких пілот скафандра продовжує знаходитися при звичайному атмосферному тиску, що виключає негативні прояви декомпресії, азотне, кисневе та інші отруєння.\\nІнші види скафандрів — космічні, пожежоізоляційні, авіаційні тощо."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B1%B1%E8%B0%B7%E7%90%83%E5%A0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/The_Valley_East_Stand.jpg","page_title":"山谷球場","context_page_description":"山谷球場是位於英格蘭大倫敦內倫敦格林威治區查爾頓的一個可容27,111座位的體育場，主要用於足球競賽，現時是查爾頓競技足球會的主場球場。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BF%D0%BF%D0%B5%D0%BD%D0%B4%D0%B8%D1%86%D0%B8%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/X-ray_showing_fecalith_which_has_caused_appendicitis.jpg","page_title":"Аппендицит","context_page_description":"Аппендици́т — воспаление червеобразного отростка слепой кишки разной степени выраженности. Одно из наиболее частых заболеваний брюшной полости, требующих хирургического лечения."},{"page_url":"https://cs.wikipedia.org/wiki/Krom%C4%9B%C5%99%C3%AD%C5%BE-Oskol","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Krom%C4%9B%C5%99%C3%AD%C5%BE-Oskol%2C_%C5%BEelezni%C4%8Dn%C3%AD_zast%C3%A1vka.jpg","page_title":"Kroměříž-Oskol","context_page_description":"Kroměříž-Oskol je železniční zastávka ve východní části města Kroměříž na trati číslo 305 Kroměříž – Zborovice v km 1,617. Na této trati je realizována i příměstská osobní doprava na zastávkách Kroměříž, Kroměříž-Oskol a Kotojedy. V Kroměříži spoje navazují na trať číslo 303 Kojetín – Valašské Meziříčí."},{"page_url":"https://es.wikipedia.org/wiki/Cabana_(Pallasca)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/30/Ubicaci%C3%B3n_Cabana_Per%C3%BA.JPG","page_title":"Cabana (Pallasca)","context_page_description":"Cabana, fundada como Santiago de Cabana es una ciudad del centro-norte del Perú, capital de la Provincia de Pallasca, ubicada en la zona norte del departamento de Ancash. Su fundación como municipalidad data del 2 de enero de 1857, sin embargo su origen se remonta a la época preíncaica.\\nDesde el 30 de octubre de 1901 ostentaba el Título de Villa y Capital de la Provincia de Pallasca, situación que cambió en el año 1914 al elevarse al Título de Ciudad Capital. La zona urbana de la ciudad de Cabana cuenta con más de treinta manzanas, dividida en cuatro barrios: Huayumaca, Pacchamaca, Trujillo y San Jerónimo. En las cercanías de la ciudad de Cabana se encuentran los anexos. Estos son: San Martín, La Florida, Huambo y Aija."},{"page_url":"https://it.wikipedia.org/wiki/Porta_automatica","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/China_Television_Building_auto_door_and_stairs_20100531.jpg","page_title":"Porta automatica","context_page_description":"La porta automatica è una porta scorrevole elettrica che si apre al passaggio di una persona per richiudersi poco dopo."},{"page_url":"https://pt.wikipedia.org/wiki/23_de_dezembro","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Emperor_Akihito_of_Japan.jpg","page_title":"23 de dezembro","context_page_description":"23 de dezembro é o 357.º dia do ano no calendário gregoriano. Faltam 8 para acabar o ano."},{"page_url":"https://cs.wikipedia.org/wiki/Hugo_II._Logothetti","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Jugendbild_Hugo-Logothetti_und-Geschwister-1880.jpg","page_title":"Hugo II. Logothetti","context_page_description":"Hugo Wladimir Emanuel Karl Borromäus Franz de Paula Johannes Nepomuk hrabě Logothetti byl rakousko-uherským diplomatem a posledním zástupcem habsburského mocnářství v Teheránu."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D1%83%D1%81%D1%82%D0%B0%D0%B2%D0%BE_%D0%9A%D1%83%D0%B5%D1%80%D1%82%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Gustavo_Kuerten2.jpeg","page_title":"Густаво Куертен","context_page_description":"Ґуста́во «Ґуґа́» Куерте́н — бразилійський тенісист, триразовий чемпіон Ролан-Гарросу, колишня перша ракетка світу.\\nНародився 10 вересня 1976 року в місті Флоріанополіс, Бразилія.\\nКуертен очолював світовий рейтинг 43 тижні. Загалом за кар'єру він здобув 20 титулів в одиночному та 8 — в парному розрядах.\\nУ травні 2008 року після поразки в першому колі відкритого чемпіонату Франції, завершив свою 12-ти річну професійну кар'єру. У 2009 році розпочав написання автобіографічної книжки. Видання книги очікується в 2010 - 2011 роках. За словами автора в книзі будуть цікаві історії з життя спортсмена."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%BE%D0%BC%D0%B0%D0%BD_%D0%9A%D0%B5%D1%81%D0%B0%D1%80%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Francisco_de_Zurbar%C3%A1n_048.jpg","page_title":"Роман Кесарійський","context_page_description":"Святий Роман Кесарійський — християнський святий, пам'ять якого вшановується 1 грудня. Загинув під час Діоклетіанового переслідування.\\nСвятий Роман був дияконом у місті Кесарії Палестинській в кінці III ст. Коли за правління імператора Діоклетіана почалося переслідування християн, Роман проживав у місті Антіохії і заохочував вірних не відступати від святої віри.\\nПобачивши одного разу, що деякі ув'язнені християни готові поклонитися божкам, щоб звільнитися від жорстоких тортур, він голосно почав закликати їх до витривалості і вірності Христові до кінця. За це погани засудили Романа на спалення живцем, але сильна злива загасила вогонь. Тоді погани вирвали йому язика, але він далі без язика продовжував виразно говорити, закликаючи усіх християн до стійкості і мужності. Роман загинув мученицькою смертю від жахливих мук 304 року."},{"page_url":"https://es.wikipedia.org/wiki/Arquitectura_neog%C3%B3tica","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Church_Saint_Ouen%2B.jpg","page_title":"Arquitectura neogótica","context_page_description":"El revival gótico o neogótico fue un movimiento artístico historicista, principalmente arquitectónico y decorativo, que comenzó a finales de la década de 1740 en el Reino Unido. Su impulso creció a finales del siglo XVIII y principios del siglo XIX, ​ cuando admiradores cada vez más serios y eruditos de los distintos periodos del gótico intentaron revivir la arquitectura gótica medieval, en contraste con los estilos neoclásicos en boga en ese momento. Por su común rechazo al racionalismo neoclásico, fue un estilo vinculado al Romanticismo, y por sus implicaciones políticas y la recuperación de un supuesto estilo nacional, con el nacionalismo. Como arquitectura historicista fue una reelaboración del lenguaje arquitectónico propio del arte gótico medieval con formas más o menos genuinas, incluidos los patrones decorativos, los acabados, el uso de ventanas con lancetas y las molduras acampanadas. A mediados del siglo XIX, se estableció como el estilo arquitectónico preeminente en el mundo occidental. Los que lo consideraban una desvirtuación del estilo gótico original, lo denominaron peyorativamente «pseudogótico»."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A3%A8%EB%93%9C%EB%B9%84%ED%9E%88_%EB%AE%90%EB%9F%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Bundesarchiv_Bild_183-H30223%2C_Ludwig_M%C3%BCller.jpg","page_title":"루드비히 뮐러","context_page_description":"루드비히 뮐러 독일의 신학자이며 \\"독일의 기독교인\\"의 지도층의 회원이었다. 독일 복음주의교회에서 'Reich 주교'로 임명되었다.\\n그는 개신교 목사로 나찌의 회원이었다. 그 당시 독일의 사회주의당인 나찌는 로마 가톨릭이 아닌 프로테스탄트교회의 연합체를 구성하여 그들 중의 대표로 루드비히 뮐러를 임명하였다. 그를 대표로 만들면서 자연스럽게 모든 기독교인들이 히틀러를 따르게 되었다. 1933년 7월에 기독교에서 이루어진 선거에서 그는 대표로 선출되었다. 그가 선출된 이후 나찌는 독일의 기독교를 더 이상 성경을 믿는 기독교가 아닌, 아리안족중심의 기독교로 전향시켰다. 그 당시, 기독교로 전향했던 유대인들은 더 이상 기독교인 아닌 유대인으로 분류되어 교회에서 퇴출되었다. 성경에서 구약은 사라졌고, 모든 유대인들은 성경에서 사라졌다. 그는 성경의 하나님을 도용해, 독일에게 특별한 법을 하나님이 주셨고, 이 법은 독일인들에게만 적용되며, 하나의 하나님, 하나의 나라, 하나의 레히, 하나의 교회를 위해 전쟁을 해야 한다고 주장했다."},{"page_url":"https://en.wikipedia.org/wiki/Mono_people","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Photograph_with_text_of_a_Mono_couple_living_near_Northfork%2C_California._This_is_from_a_survey_report_of_Fresno_and..._-_NARA_-_296289_%28cropped%29.jpg","page_title":"Mono people","context_page_description":"The Mono are a Native American people who traditionally live in the central Sierra Nevada, the Eastern Sierra, the Mono Basin, and adjacent areas of the Great Basin. They are often grouped under the historical label \\"Paiute\\" together with the Northern Paiute and Southern Paiute - but these three groups, although related within the Numic group of Uto-Aztecan languages, do not form a single, unique, unified group of Great Basin tribes.\\nToday, many of the tribal citizens and descendants of the Mono tribe inhabit the town of North Fork in Madera County. People of the Mono tribe are also spread across California in: the Owens River Valley; the San Joaquin Valley and foothills areas, especially Fresno County; and in the San Francisco Bay Area."},{"page_url":"https://de.wikipedia.org/wiki/Chicomecoatl","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Chicomecoatl_2.jpg","page_title":"Chicomecoatl","context_page_description":"Chicomecoatl war in der aztekischen Mythologie die Göttin der Erde, des Lebensunterhalts und des Maises."},{"page_url":"https://ceb.wikipedia.org/wiki/Scaptius","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Scaptius_pseudoprumala.JPG","page_title":"Scaptius","context_page_description":"Henero sa mga alibangbang ang Scaptius. Ang Scaptius sakop sa kabanay nga Arctiidae.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://nl.wikipedia.org/wiki/De_Hontheim","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Montquintin_JPG01.jpg","page_title":"De Hontheim","context_page_description":"De Hontheim was een Zuid-Nederlandse adellijke familie."},{"page_url":"https://et.wikipedia.org/wiki/M%C3%BChlwald","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Location_of_M%C3%BChlwald_%28Italy%29.png","page_title":"Mühlwald","context_page_description":"Mühlwald on vald Lõuna-Tiroolis Põhja-Itaalias, paiknedes umbes 60 km Bolzanost kirdes, Austria piiri ääres."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A7%86%E5%B8%83%E9%AD%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Tetraodon_mbu_2.jpg","page_title":"姆布魨","context_page_description":"姆布鲀，俗称为皇冠河豚或皇冠狗头，为辐鳍鱼纲鲀形目四齿鲀亚目四齿鲀科的其中一种，为热带淡水鱼，分布于非洲坦干伊喀湖及刚果河流域，体长可达67公分，栖息在底层水域，生活习性不明，有毒性。"},{"page_url":"https://en.wikipedia.org/wiki/Third_Dynasty_of_Ur","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Lament_for_ur_%28cropped%29.JPG","page_title":"Third Dynasty of Ur","context_page_description":"The Third Dynasty of Ur, also called the Neo-Sumerian Empire, refers to a 22nd to 21st century BC Sumerian ruling dynasty based in the city of Ur and a short-lived territorial-political state which some historians consider to have been a nascent empire.\\nThe Third Dynasty of Ur is commonly abbreviated as Ur III by historians studying the period. It is numbered in reference to previous dynasties, such as the First Dynasty of Ur, but it seems the once supposed Second Dynasty of Ur never existed.\\nThe Third Dynasty of Ur was the last Sumerian dynasty which came to preeminent power in Mesopotamia. It began after several centuries of control by Akkadian and Gutian kings. It controlled the cities of Isin, Larsa, and Eshnunna and extended as far north as Upper Mesopotamia. The dynasty corresponded to a Sumerian renaissance following the fall of the First Dynasty of Ur."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8C%97%E7%99%BD%E5%B7%9D%E5%AE%AE%E8%83%BD%E4%B9%85%E8%A6%AA%E7%8E%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Yoshihisa_Kitasirakawanomiya.jpg","page_title":"北白川宮能久親王","context_page_description":"北白川宮能久親王は、日本の皇族。陸軍軍人。幼名は満宮。最後の輪王寺宮として知られる。\\n伏見宮邦家親王の第9王子。生母は堀内信子。幕末に活躍した山階宮晃親王と久邇宮朝彦親王の弟で、仁孝天皇の猶子にもなっているため、孝明天皇の義弟、明治天皇の義理の叔父に当たる。"},{"page_url":"https://ro.wikipedia.org/wiki/Radu_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/BasarabIArges.jpg","page_title":"Radu I","context_page_description":"Radu I, domn al Țării Românești între cca. 1377 - cca. 1383, este fiul lui Nicolae Alexandru, frate și succesor al lui Vladislav I, identificat de mulți istorici cu legendarul Radu Negru, voievod mitic al începuturilor statului medieval Țara Românească, fondator al instituțiilor acestui stat și prim legiuitor. Discuția despre Radu I rămâne deschisă căci, pe baza argumentelor de ordin istoric, nu se pot formula concluzii clare.\\nAsociat la tron probabil începând din 1372, conform părerii unor istorici, Radu I își începe domnia ca singur stăpânitor după 9 iulie 1374 când avem ultima mențiune documentară despre fratele său ca fiind în viață. Din nefericire nu s-au păstrat documente interne care să ateste domnia sa, însă există câteva referiri externe, în principal acte ale Regatului Maghiar și o cronică italiană contemporană, precum și o pisanie târzie, o inscripție pe zidurile Bisericii Domnești de la Curtea de Argeș și o importantă cantitate de monede emise de voievod.\\nRelațiile cu regalitatea maghiară sunt în continuare încordate, ajungându-se la conflicte armate. Detaliile acestor lupte ne sunt neclare."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Sexey-aux-Forges","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Sexey_Forges_eglise.JPG","page_title":"Sexey-aux-Forges","context_page_description":"Sexey-aux-Forges sī ūi-tī Hoat-kok Lorraine toā-khu Meurthe-et-Moselle koān ê chi̍t ê commune."},{"page_url":"https://ca.wikipedia.org/wiki/Medalla_de_la_Federaci%C3%B3_Gimn%C3%A0stica_Espanyola","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/600px_Bianco_con_bande_Rosse_laterali.png","page_title":"Medalla de la Federació Gimnàstica Espanyola","context_page_description":"La Medalla de la Federació Gimnàstica Espanyola, també esmentada simplement com Medalla de la Federació o\\nMedalla de l'Ajuntament, fou una competició futbolística que es celebrà a Barcelona entre els mesos de febrer i juny de 1902. La primera edició utilitzà el sistema de lliga i la segona edició el d'eliminatòries."},{"page_url":"https://vi.wikipedia.org/wiki/Kirishima,_Kagoshima","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Inukainotaki.jpg","page_title":"Kirishima, Kagoshima","context_page_description":"Kirishima là một thành phố thuộc tỉnh Kagoshima, Nhật Bản."},{"page_url":"https://da.wikipedia.org/wiki/John_Flamsteed","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/John_Flamsteed_%28Gem%C3%A4lde%29.jpg","page_title":"John Flamsteed","context_page_description":"John Flamsteed var en engelsk astronom.\\nFlamsteed var uddannet til præst, men blev ved Sacroboscos bog De sphaera ført til astronomien, kom 1670 i forbindelse med Newton i Cambridge og fik 1674 i opdrag at beregne månens kulminationstid for deraf at udlede tiden for floden; herved kom han med i den af Karl II nedsatte kommission til bedømmelse af den af Le Sieur de Saint-Pierre i forslag bragte metode til bestemmelse af længden til søs ved månedistancer. Da Flamsteed stærkt hævdede nødvendigheden af nyere stjernekataloger og bedre månetabeller, gav dette stødet til grundlæggelsen af observatoriet i Greenwich. I 1675, hvis første direktør Flamsteed blev med titlen Astronomer Royal. Samme år trådte han ind i den gejstlige stand og blev præst i Burstow i Surrey. Lige til sin død arbejdede Flamsteed ivrig mod det stillede mål, først med de simple instrumenter, han havde benyttet i Derby, fra 1689 med en efter hans forslag konstrueret murkvadrant.\\nResultatet af hans talrige observationer er nedlagt i den første moderne stjernekatalog Historia coelestis britannica og Atlas coelestis. Flamsteeds øvrige mindre arbejder er trykte i Philosophical Transactions of the Royal Society."},{"page_url":"https://nl.wikipedia.org/wiki/Sandra_Eggermont","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Sandra_Eggermont.JPG","page_title":"Sandra Eggermont","context_page_description":"Sandra Eggermont is een Nederlandse golfprofessional."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D9%86%D8%A7%D8%AF%D9%82_%D9%88%D9%85%D9%86%D8%AA%D8%AC%D8%B9%D8%A7%D8%AA_%D8%B4%D9%8A%D8%B1%D8%A7%D8%AA%D9%88%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1a/Sheraton_Ankara.jpg","page_title":"فنادق ومنتجعات شيراتون","context_page_description":"فنادق ومنتجعات شيراتون ‏ هي أكبر وثاني أقدم علامة تجارية تابعة لشركة ستاروود للفنادق والمنتجعات في العالم."},{"page_url":"https://pt.wikipedia.org/wiki/Urera_baccifera","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Urera_baccifera.jpg","page_title":"Urera baccifera","context_page_description":"Urera baccifera é uma espécie de planta florífera da família Urticaceae que possuem diversos nomes, tais como ortiga brava, pringamoza, mala mujer, chichicaste, nigua, guaritoto, ishanga, manman guêpes, e urtiga bronca."},{"page_url":"https://sv.wikipedia.org/wiki/Stenamma_wheelerorum","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Stenamma_wheelerorum_casent0104797_dorsal_1.jpg","page_title":"Stenamma wheelerorum","context_page_description":"Stenamma wheelerorum är en myrart som beskrevs av Roy R. Snelling 1973. Stenamma wheelerorum ingår i släktet Stenamma och familjen myror. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://id.wikipedia.org/wiki/Rusia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Rs-map.png","page_title":"Rusia","context_page_description":"Federasi Rusia, umumnya disebut Rusia, adalah sebuah negara berdaulat yang membentang dengan luas di sebelah timur Eropa dan utara Asia. Dengan wilayah seluas 17.125.200 km², Rusia adalah negara terluas di dunia. Wilayahnya mencakup seperdelapan luas daratan bumi, penduduknya menduduki peringkat kesembilan terbanyak di dunia dengan jumlah sekitar 146 juta jiwa. Wilayahnya membentang sepanjang Asia Utara dan sebagian Eropa timur, Rusia memiliki 11 zona waktu dan wilayahnya terdiri dari berbagai tipe lingkungan dan tanah. Dari barat laut sampai ke tenggara, Rusia berbatasan dengan Norwegia, Finlandia, Estonia, Latvia, Lituania dan Polandia, Belarusia, Ukraina, Georgia, Azerbaijan, Kazakhstan, China, Mongolia, dan Korea Utara. Negara ini berbatasan laut dengan Jepang di Laut Okhotsk dan negara bagian Alaska, Amerika Serikat di Selat Bering.\\nSejarah negara ini berawal dari Bangsa Slav Timur yang eksis di Eropa antara abad ke-3 hingga abad ke-8 SM. Ditemukan dan dipimpin oleh pasukan elit Varangia dan keturunannya, negara abad pertengahan Rus muncul sekitar abad ke-9."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E8%81%96%E6%89%98%E9%87%8C%E5%B0%BC%E7%81%AB%E5%B1%B1%E5%8F%A3","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Santorini_view_from_plane.jpg","page_title":"聖托里尼火山口","context_page_description":"聖托里尼火山口係希臘南部嘅一座火山口，距離克里特120公里，成個火山口浸喺愛琴海海底，露出水面嘅地就係聖托里尼。"},{"page_url":"https://en.wikipedia.org/wiki/Fernando_Atzori","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Fernando_Atzori_1964.jpg","page_title":"Fernando Atzori","context_page_description":"Fernando Atzori is a retired Italian flyweight boxer who won an Olympic gold medal in 1964. In the final, he defeated Artur Olech of Poland despite suffering an eye injury. After the Olympics he turned professional and won a European title in 1967. Atzori defended it nine times before losing it in 1972. He then regained it and lost again in 1973. Atzori retired from the ring in 1975."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1922","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Stanley_Founding_of_Congo_Free_State_225_Mons_del_Commune.jpg","page_title":"Lijst van personen overleden in 1922","context_page_description":"Dit is een lijst van personen die overleden zijn in 1922.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Moosthenning","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Moosthenning-Moosstra%C3%9Fe-4.jpg","page_title":"Liste der Baudenkmäler in Moosthenning","context_page_description":"Auf dieser Seite sind die Baudenkmäler der niederbayerischen Gemeinde Moosthenning zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%82%D9%85%DB%8C%D9%86%D8%A7_%D8%AF%D9%86%D8%A8%D9%88%D9%88%DB%8C%D8%AA%D8%B3_(%D8%B3%DB%8C%D9%84%D8%B3%DB%8C%D8%A7%D9%86)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/43/POL_Gumna_COA.png","page_title":"قمینا دنبوویتس (سیلسیان)","context_page_description":"قمینا دنبوویتس (سیلسیان) لهیستان‌دا بیر یاشاییش منطقه‌سی‌دیر 42.48 کیلومتر موربّع ساحه‌سی وار. و سیلسیان اوستانیندا یئرلشیر."},{"page_url":"https://de.wikipedia.org/wiki/Burschenschaft_der_Bubenreuther","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Haus.Bubenruthia.jpg","page_title":"Burschenschaft der Bubenreuther","context_page_description":"Die Burschenschaft der Bubenreuther ist eine farbentragende, fakultativ schlagende Studentenverbindung des „Roten Verbandes“ an der Friedrich-Alexander-Universität Erlangen-Nürnberg in der Neuen Deutschen Burschenschaft. Sie ist eine der größten und ältesten Burschenschaften Deutschlands."},{"page_url":"https://sv.wikipedia.org/wiki/Pens%C3%A9er","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Tr%C3%A4dg%C3%A5rdspens%C3%A9er.jpg","page_title":"Penséer","context_page_description":"Penséer är en av de vanligaste sommarblommorna i svenska trädgårdar och på våra kyrkogårdar. De är ursprungligen hybrider mellan olika arter ur Viola-släktet, främst styvmorsviol och storblommiga violarter. Penséer är en violväxtart som beskrevs av Helmut Gams, Nauenb. och Buttler och ingår i släktet violer, och familjen violväxter."},{"page_url":"https://cs.wikipedia.org/wiki/Ana_Bagration-Gruzinsk%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Anna_Bagration-Gruzinsky.jpg","page_title":"Ana Bagration-Gruzinská","context_page_description":"Ana Nugzaris asuli Bagration-Gruzinsky je královská princezna z dynastie Bagrationů."},{"page_url":"https://pl.wikipedia.org/wiki/Szprotawa","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e4/Szprotawa_koszary.jpg","page_title":"Szprotawa","context_page_description":"Szprotawa – miasto w województwie lubuskim, w powiecie żagańskim, siedziba gminy miejsko-wiejskiej Szprotawa. Położone nad Bobrem i Szprotawą.\\nWedług danych GUS z 31 grudnia 2019 r. Szprotawa liczyła 11 711 mieszkańców.\\nMiasto jest ośrodkiem przemysłowo-usługowym. Zlokalizowany jest tu m.in. przemysł betoniarski, metalowy i spożywczy."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B9%D9%84%D8%A7%D9%82%D8%A7%D8%AA_%D8%A5%D8%B3%D8%B1%D8%A7%D8%A6%D9%8A%D9%84_%D9%88%D9%85%D9%8A%D8%A7%D9%86%D9%85%D8%A7%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/16_-_Levi_Eshkol_and_U_Nu.jpg","page_title":"علاقات إسرائيل وميانمار","context_page_description":"إن علاقات إسرائيل وميانمار تشير إلى العلاقات الثنائية بين إسرائيل وميانمار. وقد أقامت الدولتان روابط دبلوماسية في عام 1953. ولدى إسرائيل سفارة في يانغون، ولميانمار سفارة في تل أبيب. وتتمتع الدولة اليهودية بصداقة مع ميانمار منذ زمن طويل، وهي من بين البلدان الأولى في آسيا التي تعترف باستقلال إسرائيل وتقيم علاقات دبلوماسية مع الدولة الفتية. وهناك تعاون كبير بين البلدين، لا سيما في مجالي الزراعة والتعليم."},{"page_url":"https://en.wikipedia.org/wiki/Yesarizade_Mustafa_Izzet_Efendi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Hilye_Yesarizade_Mustafa_Izzet_Efendi.JPG","page_title":"Yesarizade Mustafa Izzet Efendi","context_page_description":"Yesarizade Mustafa Izzet Efendi was an Ottoman calligrapher."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%8A%D8%A7%D8%AF%D8%B1_%D9%88%D8%A7%D8%AF%D9%8A_%D8%A7%D9%84%D8%B3%D9%8A%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Bayader_Wadi_Al_Seer%2C_Amman%2C_Jordan_22.jpg","page_title":"بيادر وادي السير","context_page_description":"بيادر وادي السير منطقة أردنية تتبع مدينة عمان، وهي تتبع لواء وادي السير في محافظة العاصمة. تقع في الجزء الغربي من العاصمة، إلى الجنوب الغربي من صويلح. كانت من ضمن وادي السير التي كانت مستقلة قبل أن تصبح جزء من عمان.وهي من الأحياء القديمة في الأردن التي كانت مأهولة بالسكان"},{"page_url":"https://sv.wikipedia.org/wiki/Rasmus_Rasmussen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/RasmusOlaiRasmussen.jpg","page_title":"Rasmus Rasmussen","context_page_description":"Rasmus Rasmussen, också känd som Rasmus Olai Rasmussen, född 1862 i Molde, död 1932 i Oslo, var en norsk skådespelare. Han var Det norske teatrets första teaterchef, senare var han även teaterchef för Trondhjems Nationale Scene. Rasmussen var verksam som skådespelare vid Den Nationale Scene under många år, och sjöng även i operor och operetter."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%9D%99%E5%AE%89%E5%AF%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Jingansi340x256.jpg","page_title":"静安寺","context_page_description":"静安寺は中華人民共和国の上海市静安区南京西路1686番に位置する仏教寺院。現在の姿から想像することは困難であるが、その歴史は3世紀の三国時代に由来し、江南地域の悠久の歴史に影響を与えた名刹の1つである。空海も遣唐使として訪れている。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A4%87%E6%88%98%E3%80%81%E5%A4%87%E8%8D%92%E3%80%81%E4%B8%BA%E4%BA%BA%E6%B0%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/1967-05_%E6%8A%93%E9%9D%A9%E5%91%BD%E4%BF%83%E7%94%9F%E4%BA%A7%E6%B5%B7%E6%8A%A5.jpg","page_title":"备战、备荒、为人民","context_page_description":"備戰、備荒、為人民，是指文化大革命時期的一個著名口號。"},{"page_url":"https://cs.wikipedia.org/wiki/Grindelwald","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/4980_-_Grindelwald_-_View_from_Im_D%C3%BCrrenbergli.JPG","page_title":"Grindelwald","context_page_description":"Grindelwald je obec v kantonu Bern ve Švýcarsku, která spadá pod Interlaken. Obec se nachází ve výšce 1 034 m n. m. v Alpách."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%9A%E0%B8%A3%E0%B8%A3%E0%B8%88%E0%B8%B8%E0%B8%A0%E0%B8%B1%E0%B8%93%E0%B8%91%E0%B9%8C%E0%B8%8A%E0%B8%99%E0%B8%B4%E0%B8%94%E0%B8%AD%E0%B9%88%E0%B8%AD%E0%B8%99%E0%B8%82%E0%B8%99%E0%B8%B2%E0%B8%94%E0%B9%83%E0%B8%AB%E0%B8%8D%E0%B9%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7e/FIBC_on_trailer.JPG","page_title":"บรรจุภัณฑ์ชนิดอ่อนขนาดใหญ่","context_page_description":"บรรจุภัณฑ์ชนิดอ่อนขนาดใหญ่ หรือ บิ๊กแบ็ก หรือ บัลก์แบ็ก เป็นบรรจุภัณฑ์มาตรฐานขนาดใหญ่สำหรับเก็บและขนส่งผลิตภัณฑ์แห้งที่ไหลได้ ตัวอย่างเช่น ทราย ปุ๋ย และพลาสติกเม็ดเล็ก ๆ\\nบิ๊กแบ็กพบทำจากพอลีเอทีลีนหรือพอลีโพรพีลีนสานหนามากที่สุด มีทั้งแบบเคลือบผิวและไม่เคลือบผิว มักมีขนาดเส้นผ่านศูนย์กลางประมาณ 110 เซนติเมตร และมีความสูงหลายขนาดตั้งแต่ 100 ถึง 200 เซนติเมตร ปกติรับน้ำหนักได้ประมาณ 1,000 กิโลกรัม แต่บรรจุภัณฑ์ที่ใหญ่กว่าสามารถเก็บได้มากกว่านั้น บิ๊กแบ็กเฉลี่ยที่ทำขึ้นเพื่อขนส่งของหนักหนึ่งตันมีน้ำหนักระหว่าง 5-7 ปอนด์\\nบรรจุภัณฑ์ชนิดอ่อนขนาดใหญ่นิยามว่าเป็น intermediate bulk container ที่มีตัวทำมาจากเส้นใยยืดหยุ่น มีคุณสมบัติ ไม่สามารถถือได้ด้วยมือเมื่อบรรจุแล้ว, ตั้งใจใช้กับการขนส่งวัตถุแข็งในรูปผง เกล็ดหรือเม็ดเล็ก ๆ, ไม่ต้องการการบรรจุเพิ่มเติม, ออกแบบมาเพื่อให้ยกขึ้นโดยจับส่วนบนสุดโดยอุปกรณ์อย่าง lift loop หรือ strap"},{"page_url":"https://pt.wikipedia.org/wiki/Tan_Wee_Kiong","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/68/Yonex_IFB_2013_-_Quarterfinal_-_Hoon_Thien_How_-_Tan_Wee_Kiong_vs_Lee_Yong-dae_-_Yoo_Yeon-seong_07.jpg","page_title":"Tan Wee Kiong","context_page_description":"Tan Wee Kiong é um jogador de badminton malaio, medalhista olímpico e especialista em duplas."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%A1%8F%E6%88%90%E5%9D%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/HK_%26_Kln_Chiu_Chow_Public_Association.jpg","page_title":"顏成坤","context_page_description":"颜成坤，CBE，JP，香港企业家和政治家，中华汽车有限公司创办人，1933年6月至1998年8月拥有香港岛的巴士专营权。此外，他于1951年获香港政府委任为立法局非官守议员，其后于1959年至1961年任该局首席非官守议员，以及在1959年至1961年兼任行政局非官守议员。\\n颜成坤早年受教于皇仁书院和上海圣约翰大学，1920年接手家族的人力车业务。看好巴士业务前景的他随后联同商人黄耀南于1923年成立中巴，是九龙地区第三家巴士公司。1933年夺得专营权后，中巴由九龙迁往港岛，战后业务在他主导下快速扩展，在20世纪八十年代高峰期的巴士路线超过100条，车队数目过千，每年乘搭人次断以亿计，堪称“中巴王国”。1981年，百利保集团企图狙击中巴股权，但最终为颜成坤所击退。\\n在中巴业务以外，颜成坤热心参与社会事务，他早于1931年至1932年当选为东华三院合并后的首任主席，其后又于1939年至1940年出任保良局主席。战后，他于1946年获委任为市政局非官守议员，1951年晋升为该局首席非官守议员，1953年因公务繁忙请辞。作为香港的潮州侨领，颜成坤在行政立法两局任职期间还身兼多项公职，直到六十年代以后才淡出政坛。另一方面，热衷于体育事工的他曾于二战前后连任南华体育会主席和会长合共八届，并且于1935年担任中华民国第六届全国运动会香港区代表总领队，以及于1936年以中华民国国家足球队教练身份前赴德国柏林参与第11届奥林匹克运动会。\\n然而，踏入20世纪八十年代，颜成坤对中巴的家族式管治被指保守脱节，巴士服务水平下降和劳资纠纷等问题，更引起舆论批评，促使港府于1993年和1995年分别把26条和14条巴士路线交由城巴有限公司接办，其后进一步于1998年2月宣布终止中巴专营权，中巴的专利巴士服务遂于同年8月底告终，而新的专营权则由新世界第一巴士服务有限公司夺得。颜成坤虽然自1933年以来一直担任中巴主席和监理，但由于年事已高、健康倒退，所以在九十年代中期已把业务交由子女打理。事实上，颜家手持不少车厂和员工宿舍土地，早已把目光投到地产发展，因此自专营权告终后，中巴实际上已经由一家巴士公司变成一家纯以地产为核心业务的企业。"},{"page_url":"https://br.wikipedia.org/wiki/Michael_D._Higgins","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Michael_D._Higgins_2006.jpg","page_title":"Michael D. Higgins","context_page_description":"Michael Daniel Higgins, a vez graet Michael D. Higgins anezhañ dre vras, ganet d'an 18 a viz Ebrel 1941 e Luimneach, a zo ur politikour iwerzhonat. Prezidant Strollad al Labour eo, ha ministr an Arzoù, ar Sevenadur hag ar Gouezelegva eo bet eus 1993 da 1997. Dilennet eo bet da Brezidant Republik Iwerzhon da-geñver votadeg miz Here 2011. Ur skrivagner eo ivez."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AE%D9%81%D8%A7%D8%B4_%D8%AC%D9%86%DA%AF%D9%84%DB%8C_%D8%A8%D8%B2%D8%B1%DA%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/GreaterNoctule.JPG","page_title":"خفاش جنگلی بزرگ","context_page_description":"خفاش جنگلی بزرگ یا نکتیول بزرگ گونه‌ای خفاش با جثه بزرگ و طول ساعد بلند است که در اروپا، بلاروس، اوکراین و بخش‌های محدودی از شمال غرب ایران زندگی می‌کند."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Denkmale_und_Standbilder_der_Stadt_Bremen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Arstener-Gedenkstaette_K.Effern_img-01.jpg","page_title":"Liste der Denkmale und Standbilder der Stadt Bremen","context_page_description":"In dieser Liste der Denkmale und Standbilder der Stadt Bremen sind die Denkmale, Statuen, Standbilder, Ehrenmale und Skulpturen der Freien Hansestadt Bremen aufgeführt. Einige von ihnen wurden im Laufe der Jahrzehnte von ihrem ursprünglichen Aufstellungsort entfernt, umgestellt, umgestaltet oder sogar zerstört. Dies ist unter dem Vorsatz Status vermerkt.\\nBrunnen werden ausdrücklich nicht aufgelistet. Diese sind in der Liste der Brunnen der Stadt Bremen zusammengefasst.\\nDenkmalgeschützte Gebäude sind in den Listen der Kulturdenkmäler der jeweiligen Stadt- und Ortsteile aufgeführt.\\nDie Liste erhebt keinen Anspruch auf Vollständigkeit, wird aber fortlaufend ergänzt. Geordnet sind die einzelnen Werke zur besseren Übersicht nach ihrem Aufstellungsdatum, gegliedert in Jahrhundert und Jahr und eventuell noch feingliedriger in Monat und Tag. Sind zwei Denkmäler gleichzeitig errichtet worden, sind sie in alphabetischer Reihenfolge aufgeführt.\\nIst das Datum der Einweihung unbekannt, wird das Werk entweder unten an die Liste angefügt oder einigermaßen sinnvoll eingefügt.\\nDas kunsthistorisch und stadtgeschichtlich wichtigste Werk ist zweifelsohne der Bremer Roland auf dem Marktplatz."},{"page_url":"https://es.wikipedia.org/wiki/Argenton-Ch%C3%A2teau","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Argenton-Ch%C3%A2teau_Eglise_Saint-Gilles_ext%C3%A9rieur.JPG","page_title":"Argenton-Château","context_page_description":"Argenton-Château era una comuna francesa, que estaba situada en el departamento de Deux-Sèvres, de la región de Nueva Aquitania, que en 2006 pasó a ser una comuna asociada de la comuna de Argenton-les-Vallées.​​"},{"page_url":"https://pt.wikipedia.org/wiki/%C4%8Cakov_(Bo%C3%AAmia_Central)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Vlkov_%28%C4%8Cakov%29%2C_roubenn%C3%A9_staven%C3%AD.JPG","page_title":"Čakov (Boêmia Central)","context_page_description":"Čakov é uma comuna checa localizada na região da Boêmia Central, distrito de Benešov."},{"page_url":"https://br.wikipedia.org/wiki/Diwazh","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/30/Confluent_de_la_Divatte_et_de_la_Loire_au_fond_La_Varenne.JPG","page_title":"Diwazh","context_page_description":"An Diwazh a zo ur stêr eus gevred Bro-Naoned, adstêr d'al Liger war e lez kleiz. War un darn vat eus e red e ra an Diwazh ar vevenn etre Breizh ha Bro-C'hall. 28 km eo hed ar stêr. Eieniñ a ra e Le Puisey-Doré e Bro-C'hall, a-raok antren buan e Breizh ha dispartiañ kumunioù Beuzid-an-Doured ha Kerravaot, goude e ra ar vevenn etre Breizh ha Bro-C'hall betek he c'hember gant al Liger, etre Chapel-Baz-Meur ha La Varenne."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D8%A8%DB%8C%D8%AC%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/AbidjanLogo.png","page_title":"آبیجان","context_page_description":"آبیجان بزرگ‌ترین شهر و پایتخت پیشین کشور ساحل عاج است.\\nاین شهر سومین شهر بزرگ فرانسوی‌زبان پس از پاریس و کینشاسا به‌شمار می‌آید.\\nآبیجان تا سال ۱۹۸۳ پایتخت ساحل عاج بود که از آن سال به بعد شهر یاموسوکرو به عنوان پایتخت این کشور انتخاب شد.\\nآبیجان در کرانه خلیج گینه واقع شده و در حدود ۲٫۸۰۰٫۰۰۰ نفر جمعیت دارد. جمعیت آبیجان و حومه در حدود ۵ میلیون نفر برآورد می‌شود.\\nصنایع شهر بیشتر مربوط به بخش چوب، نساجی و قهوه هستند و این شهر دارای یک پالایشگاه بزرگ و یک بندر بزرگ نیز هست.\\nآبیجان در سال ۱۹۳۴ پایتخت ساحل عاج که در آن زمان مستعمره فرانسه بود شد. جمعیت آن از ۶۵ هزار نفر در سال ۱۹۵۰ به شدت رشد کرد و به سطح کنونی رسید.\\nدر این شهر هم‌چنان فرانسویان زیادی سکونت دارند که بسیاری از منصب‌های مهم را در امور اقتصادی بر عهده دارند. ساکنان اروپایی شهر بیشتر در شبه جزیره زندگی می‌کنند و تمرکز سکونت جمعیت آفریقایی در روستاهای عظیم ترشویل و آجام است."},{"page_url":"https://it.wikipedia.org/wiki/Daphnia_pulex","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Daphnia_pulex.png","page_title":"Daphnia pulex","context_page_description":"Daphnia pulex Leydig, 1860 è un piccolo crostaceo cladocero planctonico, appartenente al genere Daphnia. Ha una distribuzione subcosmopolita: la specie si trova nelle Americhe, in Europa e in Australia.\\nÈ un organismo modello utilizzato in studi di ecologia genomica come indicatore comportamentale."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D8%A7%DA%A9%D9%88_%D8%AA%D9%88%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Paco_Tous_-_Seminci_2016.jpg","page_title":"پاکو توس","context_page_description":"پاکو توس هنرپیشه اهل اسپانیا است. او بیشتر به خاطر بازی در مجموعه‌های تلویزیونی سرقت پول و مردان پاکو و فیلم آلاتریست شناخته می‌شود."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%96%D0%B2%D0%B4%D0%B5%D0%BD%D0%BD%D0%BE-%D0%A1%D1%85%D1%96%D0%B4%D0%BD%D0%B0_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D1%96%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/MosMetro_Yugo-Vostochnaya_%282020-01%29_-_stairs_in_vestibule_1.jpg","page_title":"Південно-Східна (станція метро)","context_page_description":"Південно-Східна — станція Некрасовської лінії Московського метрополітену. Розташована у районі Вихіно-Жулебино. Відкрита 27 березня 2020 у складі дільниці Лефортово — Косино."},{"page_url":"https://es.wikipedia.org/wiki/Notagogus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Notagogus_denticulatus.jpg","page_title":"Notagogus","context_page_description":"Notagogus es un género extinto de peces osteíctios prehistóricos de la familia Macrosemiidae, del orden Macrosemiiformes.​ Este género marino fue descrito científicamente por Louis Agassiz en 1843."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D0%BE%D0%B1%D0%B5%D0%B9%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2_%D0%BF%D0%B5%D1%80%D0%B5%D1%83%D0%BB%D0%BE%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Wiki_korobeinikov_14.jpg","page_title":"Коробейников переулок","context_page_description":"Коробе́йников переу́лок — улица в центре Москвы в Хамовниках между Пречистенской набережной и Остоженкой. Здесь располагаются посольства Хорватии и Кот-д’Ивуара."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_im_K%C3%B6lner_Stadtteil_Altstadt-Nord","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Stolpersteine_K%C3%B6ln%2C_Samuel_Kaufmann_%28St.-Apern-Str._29-31%29.jpg","page_title":"Liste der Stolpersteine im Kölner Stadtteil Altstadt-Nord","context_page_description":"Die Liste der Stolpersteine im Kölner Stadtteil Altstadt-Nord führt die vom Künstler Gunter Demnig verlegten Stolpersteine im Kölner Stadtteil Altstadt-Nord auf.\\nDie Liste der Stolpersteine beruht auf den Daten und Recherchen des NS-Dokumentationszentrums der Stadt Köln, zum Teil ergänzt um Informationen und Anmerkungen aus Wikipedia-Artikeln und externen Quellen. Ziel des Kunstprojektes ist es, biografische Details zu den Personen, die ihren freiwillig gewählten Wohnsitz in Köln hatten, zu dokumentieren, um damit ihr Andenken zu bewahren.\\nAnmerkung: Vielfach ist es jedoch nicht mehr möglich, eine lückenlose Darstellung ihres Lebens und ihres Leidensweges nachzuvollziehen. Insbesondere die Umstände ihres Todes können vielfach nicht mehr recherchiert werden. Offizielle Todesfallanzeigen aus den Ghettos, Haft-, Krankenanstalten sowie den Konzentrationslagern können oft Angaben enthalten, die die wahren Umstände des Todes verschleiern, werden aber unter der Beachtung dieses Umstandes mitdokumentiert."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%83%84%EC%82%B0%EC%88%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/E7886-Bishkek-Soda-water-machine.jpg","page_title":"탄산수","context_page_description":"탄산수는 청량 음료의 한 가지이다. 탄산수는 이산화 탄소의 포화 수용액으로써, 청량음료나 의약품, 혹은 실험 따위에 쓰이고 있다.\\n주요 성분인 물에 무기 염류와 탄산 가스를 원료로 투입한 것이다. 주로 감미료나 향료 따위를 넣은 것도 있다. 탄산수 제조기를 쓰면 일반인도 쉽게 사이다 같은 탄산수를 만들 수 있다. 탄산수 제조기는 10만원대부터 고가의 제품까지 다양하게 분포되어 있다."},{"page_url":"https://pt.wikipedia.org/wiki/Festival_Eurovis%C3%A3o_da_Can%C3%A7%C3%A3o_1976","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Eurovision_Song_Contest_1976_rehearsals_-_Austria_-_Waterloo_%26_Robinson_3.png","page_title":"Festival Eurovisão da Canção 1976","context_page_description":"O Festival Eurovisão da Canção 1976 foi o 21º Festival Eurovisão da Canção e realizou-se a 3 de abril de 1976 em Haia, nos Países Baixos. Corry Brokken foi a apresentadora, tornando-se assim na primeira ex-participante a viver a experiência de apresentar o Festival Eurovisão da Canção. O concurso foi ganho pelo grupo Brotherhood of Man que representou o Reino Unido, com a canção \\"Save Your Kisses for Me\\", que se converteu num grande êxito, vendendo seis milhões de exemplares, sendo o tema vencedor de Eurovisão mais vendido até hoje."},{"page_url":"https://fr.wikipedia.org/wiki/G%C3%A9rard_Oury","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/G%C3%A9rard_Oury_en_1984.jpg","page_title":"Gérard Oury","context_page_description":"Max-Gérard Houry Tannenbaum, dit Gérard Oury, né le 29 avril 1919 à Paris et mort le 19 juillet 2006 à Saint-Tropez, est un réalisateur, scénariste et acteur français. Il a réalisé dix-sept longs-métrages.\\nEn tant que réalisateur, ses plus grands succès sont Le Corniaud, La Grande Vadrouille et Les Aventures de Rabbi Jacob, tous portés par Louis de Funès. Il est le scénariste de tous ses films à l'exception de Fantôme avec chauffeur. Il a été également l'auteur et le metteur en scène d'une unique pièce de théâtre.\\nRéalisateur de grands succès populaires, il est honoré à la fin de sa carrière d'un César d'honneur en 1993, décerné en l'honneur de l'ensemble du cinéma comique français, d'une entrée à l'Académie des beaux-arts en 1998, au fauteuil de René Clément, et d'une rétrospective consacrée à son œuvre au festival de Cannes 2001."},{"page_url":"https://en.wikipedia.org/wiki/History_of_live_action_role-playing_games","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Dados_4_a_20_caras_trans.png","page_title":"History of live action role-playing games","context_page_description":"Live action role-playing games, known as LARPs, are a form of role-playing game in which live players/actors assume roles as specific characters and play out a scenario in-character. Technically, many childhood games may be thought of as simple LARPs, as they often involve the assumption of character roles. However, the scope of this article concerns itself mainly with LARPing in a technical sense: the organized live-action role-playing games whose origins are closely related to the invention of tabletop role-playing games in America in the 1970s.\\nLive-action role playing appears to have been \\"invented\\" several times by different groups relying on local ideas and expertise. Sometimes such groups were inspired by reports of LARPs elsewhere. Such a multifarious process has led to an extremely diverse range of LARP practices and histories. By the 1980s, LARPs had spread to many countries and organizations, and different styles of play had been developed. During the 1990s, Mind's Eye Theatre was the first published LARP system to achieve popular status. Also during the 1990s, the hobby began to attract critical and academic analysis."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%BF%9E%E9%94%81%E8%B6%85%E5%B8%82%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Selgros_locations.PNG","page_title":"连锁超市列表","context_page_description":"連鎖超市列表，列舉跨國性以及各主要國家的連鎖超級市場。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B7%D9%88%D8%A8%D9%88%D9%84%D9%88%D8%AC%D9%8A%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/M%C3%B6bius_strip.jpg","page_title":"طوبولوجيا","context_page_description":"في الرياضيات، الطوبولوجيا أو التوبولوجيا ‏ كلمة يونانية هي دراسة المجموعات المتغيرة التي لا تتغير طبيعة محتوياتها. مما دفع بعض علماء الرياضيات والهندسة إلى تسميتها الهندسة المطاطية.\\nتهتم الطوبولوجيا بدراسة الخصائص المكانية المنحفظة وفق التشوهات ثنائية الاستمرار، هذه الخصائص تعرف عادة باللامتباينات الطوبولوجية، تأسس هذا الفرع من الرياضيات في بدايات القرن العشرين آخذا في تطوره من عام 1925 إلى 1975 حيث شهد نضوجه وتشكله اختصاصا متكاملا.\\nيمكن القول على سبيل التبسيط أن هذا العلم يهتم بالخصائص الرياضية التي لا تتأثر عند التحول من فضاء رياضي إلى آخر. كذلك يمكن القول أن الطوبولوجيا هو العلم الذي يهتم بدراسة الخصائص الطوبولوجية التي تنتقل من فراغ إلى فراغ آخر بواسطة التشاكل. لفهم معنى كلمة التشاكل فإنه يقال عن دالة ما أنها تشكل تشاكلا إذا كانت دالة مستمرة والصورة العكسية لها أيضاً مستمرة وشاملة ومتباينة."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%98%81%ED%98%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Aisin-Gioro_P%C7%94ji%C3%A9_and_Lady_Hiro_Saga_1937_wedding_photo.jpg","page_title":"혁현","context_page_description":"아이신 교로 이후완은 청 제국의 황족 종실이고 청 제국 제8대 황제 도광제의 서자이며 청 제국 제9대 황제 함풍제의 이복 동생이다. 자는 푸안이며 호는 구사당주인, 퇴잠주인이다."},{"page_url":"https://no.wikipedia.org/wiki/Egil_Holmboe","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Normannafolket._Ausstellung_Skansen._%288612612361%29.jpg","page_title":"Egil Holmboe","context_page_description":"Egil Anker Morgenstjerne Holmboe var en norsk politiker og byråkrat for Nasjonal samling, det nasjonalistiske og fascistiske partiet som samarbeidet med de tyske nazistene som okkuperte Norge under andre verdenskrig 1940–1945. Etter krigen emigrerte han til Island og tok navnet Egil Fálkason da han ble tildelt islandsk statsborgerskap i 1955.\\nHolmboe var i norsk utenrikstjeneste før krigen, blant annet som norsk konsul i Reykjavík. Han dro tilbake til Norge i 1939. Holmboe var medlem av partiet Nasjonal Samling, og ble under okkupasjonen av Norge innsatt av nazi-myndighetene som såkalt ministerialråd i Innenriksdepartementet. Han var Knut Hamsuns tolk da forfatteren besøkte Hitler i Berghof i 1943.\\nHolmboe ble i landssvikoppgjøret etter krigen dømt til seks års tvangsarbeid. I 1953 flyttet han til Island, og i 1955 fikk han islandsk statsborgerskap. Hans andre kone var islandske Sheila, datter av museumsdirektøren Matthias Thordarson. Han arbeidet senere på den amerikanske militærbasen på Keflavík internasjonale lufthavn."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%A8%D7%90%D7%A7_(%D7%A9%D7%9C%D7%99%D7%98_%D7%A4%D7%95%D7%9C%D7%A0%D7%99)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Krak.PNG","page_title":"קראק (שליט פולני)","context_page_description":"קרָאק היה נסיך פולני אגדי, מייסדה של קרקוב והשליט של שבט הלחיטים. מיוחסת לו גם בנייתו של טירת ואוול הגותית שבקרקוב.\\nקראק מוזכר לראשונה בכרוניקה Chronica seu originale regum et principum Poloniae, טקסט לטיני משנת 1190 המתאר את ההיסטוריה הפולנית. בכתב נאמר שקראק הביס את הצבא הרומי אשר תקף מהדרום.\\nההיסטוריון הפולני י' בנשקביץ מצביע על שורשי השם במילה \\"קראקולה\\", שמשמעותה \\"מטה השופט\\", וצורות שונות שלה היוו את הבסיס לשמות רוסיים וצ'כיים. לעומת זאת, היסטוריונים אחרים מציעים אטימולוגיה שונה לשם, וטוענים כי השם \\"קראק\\" פירושו הוא עץ האלון, אשר נחשב לעץ קדוש והוא סמל לאילן יוחסין.\\nבמשך שנים האמינו כי קראק קבור בתוך תל הנושא את השם \\"תל קראק\\", שקוטרו 50 מטרים ואשר הוקם בין המאה השמינית לעשירית לספירה כחלק המרכזי של אתר קבורה. בחפירות ארכאולוגיות שהתבצעו במקום בשנות ה-30 של המאה ה-20 לא נמצאה עדות לקבר במקום.\\nהראשון שהעלה על הכתב את האגדה על קראק ועל בתו הנסיכה ואנדה היה ההיסטוריון הפולני וינצנטי קדלובק, שחי במאות ה-12 וה-13.\\nקיים דמיון רב בין האגדה על קראק לאגדה הצ'כית על השליט קרוֹק ובתו ליבושה, הנחשבת למייסדת של פראג."},{"page_url":"https://en.wikipedia.org/wiki/Elisa_Rigaudo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/ElisaRigaudo_01.JPG","page_title":"Elisa Rigaudo","context_page_description":"Elisa Rigaudo is an Italian race walker from Cuneo.\\nShe won eight medals, seven of these at senior level, at the International athletics competitions."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%8B%89%E6%96%AF%E7%BB%B4%E5%8A%A0%E6%96%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/The_Smith_Center_for_the_Performing_Arts_%26_DISCOVERY_Children%27s_Museum.jpg","page_title":"拉斯维加斯","context_page_description":"拉斯维加斯，简称赌城，是美国内华达州人口最多的城市，也是内华达州克拉克县的县治，有着以赌博业为中心庞大的旅游、购物、度假产业，是世界知名的度假地之一。2005年人口普查局的官方数字为591,536人。2005年，此城的都会区人口为1,912,654人。"},{"page_url":"https://sv.wikipedia.org/wiki/Kalkh%C3%A4llsfly","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Athetis_gluteosa_-_%D0%A1%D0%BE%D0%B2%D0%BA%D0%B0_%D1%80%D0%B0%D1%81%D0%BF%D0%BB%D1%8B%D0%B2%D1%87%D0%B0%D1%82%D0%B0%D1%8F_%2841074528072%29.jpg","page_title":"Kalkhällsfly","context_page_description":"Kalkhällsfly, Athetis gluteosa är en fjärilsart som beskrevs av Georg Friedrich Treitschke 1835. Kalkhällsfly ingår i släktet Athetis och familjen nattflyn, Noctuidae. Enligt den finländska rödlistan är arten starkt hotad, EN, i Finland. Enligt den svenska rödlistan är arten nära hotad, NT, i Sverige. Arten förekommer på Gotland, norra Öland och i ett mindre område i Medelpad samt tillfälligtvis även funnen i Småland. I Finland föerkommer arten på några spridda lokaler från södra kusten norr ut till Pirkanmaa och norra Karelen. Artens livsmiljö är torra områden med gles vegetation så som hedskog, luckig tallskog eller alvarmark. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BE%D0%BC_%D0%9C%D0%BE%D0%BD%D1%82%D0%B3%D0%BE%D0%BC%D0%B5%D1%80%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/01/Angleterre_1087.png","page_title":"Дом Монтгомери","context_page_description":"Монтгомери — один из знатных английских, французских и вероятно шотландских родов."},{"page_url":"https://de.wikipedia.org/wiki/Rata_Blanca","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Rata_Blanca_6365.jpg","page_title":"Rata Blanca","context_page_description":"Rata Blanca ist eine Heavy-Metal-Band aus Argentinien. Sie wurde 1987 in Buenos Aires gegründet und zählt zu den bekanntesten, einflussreichsten und kommerziell erfolgreichsten Bands des Landes."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_M%C3%BCnsterhausen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/M%C3%BCnsterhausen_St._Peter_und_Paul_106.JPG","page_title":"Liste der Baudenkmäler in Münsterhausen","context_page_description":"Auf dieser Seite sind die Baudenkmäler des schwäbischen Marktes Münsterhausen zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDie Liste gibt den Fortschreibungsstand vom 4. Juni 2019 wieder und umfasst vierzehn Baudenkmäler."},{"page_url":"https://sv.wikipedia.org/wiki/Gulkronad_amazon","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Amazona_ochrocephala_in_Venezuela-3.jpg","page_title":"Gulkronad amazon","context_page_description":"Gulkronad amazon är en fågel i familjen västpapegojor inom ordningen papegojfåglar."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B0%D0%B7%D0%B5%D0%BD%D0%B2%D1%96%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Bazainville_Mairie.jpg","page_title":"Базенвіль","context_page_description":"Базенві́ль — муніципалітет у Франції, у регіоні Іль-де-Франс, департамент Івлін. Населення — 1442 осіб.\\nМуніципалітет розташований на відстані близько 55 км на захід від Парижа, 35 км на захід від Версаля."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B2%A9%E7%A3%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Yosemite_20_bg_090404.jpg","page_title":"岩磐","context_page_description":"岩磐，也稱岩基、岩盤。是大塊侵入性火成岩岩體。岩磐的面積通常大於100平方公里，並由深部冷卻的岩漿形成在地殼中。 岩磐幾乎總是由長英質或中性岩石如花崗岩、石英蒙脫石或閃長岩組成。\\n儘管岩磐看起來很均勻，但實際上它們是具有復雜地質歷史和成分結構。它們由不同種類、不規則尺寸火成岩體組成。各個岩體都是從岩漿凝固的，該岩漿從地殼底部附近的部分熔融區向地表移動時形成了岩磐。"},{"page_url":"https://es.wikipedia.org/wiki/Protestas_en_Hong_Kong_de_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/2014%E5%B9%B4%E9%A6%99%E6%B8%AF%E5%A4%A7%E5%B0%88%E5%AD%B8%E7%94%9F%E7%BD%B7%E8%AA%B2.jpg","page_title":"Protestas en Hong Kong de 2014","context_page_description":"Las protestas en Hong Kong, llamadas también por la prensa occidental Revolución de los Paraguas​ o Primavera Asiática, ​​ comenzaron el 22 de septiembre de 2014, con una movilización organizada por el movimiento Occupy Central with Love and Peace y el consejo estudiantil Scholarism. Los integrantes de estos movimientos tomaron las calles principales de Hong Kong, región administrativa especial de la República Popular China, para demandar que se retire la reforma electoral del Congreso Nacional del Pueblo. En la actualidad este congreso solo permite votar a dos o tres candidatos seleccionados por un comité compuesto por 1200 personas con capacidad de elección, en su mayoría afines a los criterios de la política del Gobierno chino.​"},{"page_url":"https://en.wikipedia.org/wiki/List_of_bees_of_Israel","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Ceratina_mating_2.JPG","page_title":"List of bees of Israel","context_page_description":"Israel is home to about 1100 described species of bees. A partial list is given below, with around 850 species as of 2014. Bee taxonomy and nomenclature are in accordance with the Discover Life website."},{"page_url":"https://es.wikipedia.org/wiki/Manduca_rustica","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Manduca_rustica_calapagensis_MHNT_CUT_2010_0_408_Isla_Santa_Cruz%2C_Academy_Bay_Galapagos_Ecuador%2C_female_dorsal.jpg","page_title":"Manduca rustica","context_page_description":"Manduca rustica es una polilla de la familia Sphingidae."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Museumsbahnen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Kl%C3%BCtz_Kaffeebrenner.jpg","page_title":"Liste von Museumsbahnen","context_page_description":"Dies ist eine Liste von Bahnstrecken, die regelmäßig saisonal oder an bestimmten Wochentagen als Museumseisenbahn oder Museumsstraßenbahn betrieben werden und deren Infrastruktur vorwiegend zu diesem Zweck unterhalten wird."},{"page_url":"https://en.wikipedia.org/wiki/Brazilian_Army","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/CML.png","page_title":"Brazilian Army","context_page_description":"The Brazilian Army is the land arm of the Brazilian Armed Forces. The Brazilian Army has fought in several international conflicts, mostly in South America during the 19th century. In the 20th century, it fought on the Allied side in World War I and World War II. Aligned with the Western Bloc, during the time of military dictatorship in Brazil from 1964 to 1985, it also had active participation in the Cold War, in Latin America and Southern Portuguese Africa, as well as taking part in UN peacekeeping missions worldwide since the late 1950s.\\nDomestically, besides having faced several rebellions throughout these two centuries, with support of local political and economic elites, it also ended the monarchy and imposed on the rest of society its political views and economic development projects during the periods that it ruled the country: 1889–94, 1930–50, and 1964–85."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D1%80%D0%B5%D0%B6%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%B7%D0%B0%D0%BC%D0%BE%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Bereszhany_2.jpg","page_title":"Бережанский замок","context_page_description":"Бережа́нский замок — замок в городе Бережаны Тернопольской области."},{"page_url":"https://it.wikipedia.org/wiki/Gustave_Sandras","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Gustave_Sandras%2C_champion_olympique_du_concours_g%C3%A9n%C3%A9ral_de_gymnastique_en_1900.jpg","page_title":"Gustave Sandras","context_page_description":"Gustave Sandras è stato un ginnasta francese, campione olimpico negli esercizi combinati di ginnastica alla II Olimpiade.\\nGli esercizi combinati furono l'unico evento di ginnastica che si disputò alle Olimpiadi di Parigi del 1900. Vi presero 134 concorrenti, in larga parte francesi; gli stranieri in gara furono 25. Sandras si classificò al primo posto con 302 punti. La vittoria nel corcorso olimpico gli valse il titolo di campione del mondo, la medaglia d'oro e una statuetta in bronzo rappresentante Atalanta nel momento in cui si ferma per raccogliere la mela d'oro gettata da Ippomene."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%95%D1%80%D0%BD%D1%81%D1%82_(%D0%A8%D0%B0%D1%83%D0%BC%D0%B1%D1%83%D1%80%D0%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Ernst_von_Schaumburg.jpg","page_title":"Ернст (Шаумбург)","context_page_description":"Ернст фон Холщайн-Шаумбург е от 1601 г. управляващ граф на Шаумбург и Холщайн-Пинеберг. През 1619 г., след плащане на голям заем на император Фердинанд II, е издигнат на княз.\\nТой е най-малкият от петте синове на граф Ото IV от Шаумбург и Холщайн и втората му съпруга Елизабет Урсула, дъщеря на херцог Ернст I фон Брауншвайг-Люнебург.\\nСлед смъртта на майка му той расте под опекунството на полубрат му граф Адолф XIV от Холщайн-Шаумбург. По финансови причини той отива да живее в Детмолд в двора на зет му граф Симон VI цур Липе и следва право от 1584 до 1586 г. в Хелмщет.\\nНа 11 септември 1597 г. граф Ернст фон Холщайн-Шаумбург се жени в дворец Вилхелмсбург в Шмалкалден за Хедвиг, дъщеря на ландграф Вилхелм IV от Хесен-Касел и Сабина от Вюртемберг. Те живеят в Захсенхаген, където Ернст престорява водния дворец.\\nНа 2 юли 1601 г. след смъртта на управляващия му брат Адолф и наследниците му, Ернст поема общото управление на графствата Холщайн и Шаумбург. Планува да премести управлението от Щатхаген в Бюкебург.\\nТой умира бездетен и е последван от далечния му братовчед Йобст Херман, едлер господар на Гемен."},{"page_url":"https://da.wikipedia.org/wiki/Senja","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Okshornan_Senja.JPG","page_title":"Senja","context_page_description":"Senja er en ø, og efter kommunereformen i Norge 2020 en kommune, der ligger i Troms og Finnmark fylke. Kommunen har 15.025 indbyggere, og omfatter de tidligere kommuner Berg, Torsken, Tranøy og Lenvik.\\nDen er Norges næststørste ø med et areal på 1.586,3 km². Befolkningstyngdepunktet er langs Gisundet på indersiden af øen. Her ligger også den største by, Silsand. Det største fiskeleje er Gryllefjord i Torsken kommune, som om sommeren har færgeforbindelse med Andøya i Vesterålen."},{"page_url":"https://ca.wikipedia.org/wiki/Estatueta_de_Ganimedes","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Statue_de_Ganym%C3%A8de_retrouv%C3%A9e%2C_Tunisie_janvier_2017.jpg","page_title":"Estatueta de Ganimedes","context_page_description":"L'estatueta de Ganimedes és una escultura de marbre datada dels segles iv i v. Es va descobrir al lloc arqueològic de Cartago, Tunísia, per un equip d'arqueòlegs nord-americans a finals dels 70 com a part de l'operació principal de la Unesco «Per salvar Cartago». Representa Ganimedes al costat de Zeus, que ha assumit l'aparença d'una àguila. Un gos i una cabra endormiscada complementen el grup escultòric.\\nRecuperada en fragments, la figureta ha estat acuradament restaurada i exhibida en un petit museu del lloc, el Museu Paleocristià de Cartago. «Malgrat el seu petit volum, el grup escultòric és molt expressiu» i es troba en un «increïble bon estat» d'acord amb els estudis d'Elaine K. Gazda:[1] «Una troballa sense precedents» al jaciment de Cartago;[2] aquesta escultura també és emblemàtica de la qualitat de les obres que circularen per l'Àfrica romana durant l'antiguitat tardana.\\nLa seua història més recent, quan la furtaren al 2013 del lloc de conservació, és testimoniatge de les amenaces al patrimoni històric i arqueològic dels estats afectats per la primavera àrab, i també demostra els mitjans insuficients de les autoritats responsables de la conservació del patrimoni."},{"page_url":"https://fr.wikipedia.org/wiki/Colonne_de_justice_de_Tr%C3%A9granteur","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Colonne_de_justice_%28Tr%C3%A9granteur%29_5660.JPG","page_title":"Colonne de justice de Trégranteur","context_page_description":"La colonne de justice de Trégranteur constitue probablement le reste de fourches patibulaires, à Guégon dans le Morbihan."},{"page_url":"https://es.wikipedia.org/wiki/Domusnovas","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Domusnovas.JPG","page_title":"Domusnovas","context_page_description":"Domusnovas es un municipio de Italia de 6.489 habitantes en la provincia de Cerdeña del Sur, región de Cerdeña.\\nEstá ubicado en la subregión de Sulcis-Iglesiente, en el valle del río Cixerri, sobre la ladera del monte Marganai. Su origen se remonta probablemente al siglo XII. La economía está basada principalmente en la agricultura, y aunque los yacimientos mineros han tenido un fuerte impacto en el pasado, actualmente se encuentran abandonados."},{"page_url":"https://vi.wikipedia.org/wiki/V%C6%B0%E1%BB%9Dn_qu%E1%BB%91c_gia_Sanjay_Gandhi","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Kanheri_Interiors_04.jpg","page_title":"Vườn quốc gia Sanjay Gandhi","context_page_description":"Vườn quốc gia Borivali, tên chính thức là Vườn quốc gia Sanjay Gandhi, là một vườn quốc gia hiếm hoi nằm trong địa giới một thành phố. Vườn quốc gia này nằm ở rìa phía Bắc của ngoại ô thành phố Mumbai, Ấn Độ. Khu vườn quốc gia này có một diện tích 104 kilômét vuông và được bao bọc 3 phía bởi một trong những thành phố đông dân nhất thế giới. Đây có lẽ là khu vườn quốc gia được nhiều người viếng thăm nhất châu Á với 2 triệu khách mỗi năm. Đây cũng là công viên lớn nhất thế giới nằm trong thành phố.\\nBên trong khu vườn quốc gia này, Các hang động Kanheri có niên đại 2400 năm đã được khắc chạm trên các mỏm đá. Vườn quốc gia này phong phú về hệ động thực vật."},{"page_url":"https://es.wikipedia.org/wiki/Clemente_de_Dunblane","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Dublane_Cathedral_-_David_Octavius_Hill_%281821%29.jpg","page_title":"Clemente de Dunblane","context_page_description":"Clemente de Dunblane fue un fraile dominico del siglo XIII y primer obispo de su orden en Gran Bretaña e Irlanda. En 1233 fue elegido para liderar la maltrecha diócesis de Dunblane, en Escocia y conseguir que el obispado de Dunblane fuera financieramente viable. Esta misión implicó muchas negociaciones con las autoridades seculares y otras poderosas instituciones religiosas, que habían adquirido el control de los ingresos que normalmente habrían correspondido por derecho de la diócesis de Clemente. Las negociaciones fueron difíciles, obligando a Clemente a visitar la curia papal en Roma. A pesar de no alcanzar todos sus objetivos, Clemente logró salvar el obispado de su reubicación en la abadía de Inchaffray. También recuperó ingresos suficientes para comenzar a trabajar en la nueva catedral de Dunblane.\\nSe enfrentó a un reto similar en el empobrecido obispado de Argyll en los años 1240. Se le encargó la tarea de restaurar la viabilidad de la diócesis y el nombramiento de un nuevo obispo. Su trabajo le llevó a crear una estrecha relación con el rey Alejandro II de Escocia."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Kochel_am_See","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Bahnhofstra%C3%9Fe_12_Kochel.JPG","page_title":"Liste der Baudenkmäler in Kochel am See","context_page_description":"In der Liste der Baudenkmäler in Kochel am See sind die Baudenkmäler der oberbayerischen Gemeinde Kochel am See und deren Ortsteile aufgelistet. Grundlage ist die Veröffentlichung der Bayerischen Denkmalliste, die auf Basis des Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt und seither laufend ergänzt wurde."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D0%B5%D0%B2%D1%8B%D0%B5_%D1%81%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D1%8B_%D0%B1%D1%83%D0%B4%D1%83%D1%89%D0%B5%D0%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/MGV_Chassis.png","page_title":"Боевые системы будущего","context_page_description":"Боевые системы будущего или FCS — программа коренного перевооружения и реорганизации американской армии, официально начатая в 2003 году для воплощения концепции сетецентрических боевых действий. В рамках программы планировалось фундаментальным образом переоснастить вооружённые силы США передовой боевой и транспортной техникой, включая беспилотные и робототехнические средства. При этом, все компоненты поля боя в глобальном масштабе связывались в единую высокопроизводительную сеть, допускающую управление ими в режиме реального времени. При разработке боевых единиц системы FCS они изначально проектировались как встроенные элементы этой сети, а не как отдельные образцы вооружений. По идеологии создателей FCS, основная ставка при ведении боевых действий делалась на технологическое и информационное превосходство над вероятным противником.\\nПрограмма была закрыта в 2009 году, а большая часть наработанного материала передана для использования в проект Brigade Combat Team Modernization."},{"page_url":"https://gl.wikipedia.org/wiki/Villacarriedo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Panoramica_villacarriedo.jpg","page_title":"Villacarriedo","context_page_description":"{{Cidade\\n|bandeira =\\n|escudo = Escudo de Villacarriedo.svg\\n|situación = [[Ficheiro:Villacarriedo Mapa.svg\\n|país = España\\n|bandeirapaís =\\n|división 1 = Comunidade Autónoma\\n|nome división 1 = Cantabria\\n|división 2 = Comarca\\n|nome división 2 = Valles Pasiegos\\n|altitude = 211\\n|superficie = 50,74\\n|poboación = 1.765 hab.\\n|densidade = 34,79 hab./km²\\n|xentilicio = Carredano/a\\n|código postal = 39640\\n|alcalde = Ángel Sainz Ruiz\\n|sitio web = www.aytovillacarriedo.org\\n}}\\nVillacarriedo, en montañés Villacarrieu, é un concello da comunidade autónoma de Cantabria. Limita polo norte con Saro e Villafufre, polo sur con Vega de Pas e Selaya, polo oeste con Santiurde de Toranzo e polo leste con San Roque de Riomiera. Encóntrase na comarca do Pas-Miera e polas súas terras atravesa o río Pisueña, principal afluente do río Pas."},{"page_url":"https://ja.wikipedia.org/wiki/T-40_(%E6%88%A6%E8%BB%8A)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/T40kub1.jpg","page_title":"T-40 (戦車)","context_page_description":"T-40は第二次世界大戦におけるソ連の水陸両用戦車である。"},{"page_url":"https://hr.wikipedia.org/wiki/Crkva","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/The_Zagreb_Chatedral_2.jpg","page_title":"Crkva","context_page_description":"Crkva je građevina namijenjena za religijske službe, najčešće u kršćanskom bogoslužju."},{"page_url":"https://cs.wikipedia.org/wiki/1960%E2%80%931969","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/10_Soviet_Invasion_of_Czechoslovakia_-_Flickr_-_The_Central_Intelligence_Agency.jpg","page_title":"1960–1969","context_page_description":"Roky 1960–1969, souhrnně zvané 60. léta 20. století, jsou obdobím určitého uvolnění v politice i v kultuře, které se projevuje mimo jiné:\\npolitickým osamostatněním mnoha bývalých evropských kolonií\\nkulturní a společenskou revoltou mládeže, rozčarovanou konzumním způsobem života svých rodičů\\npřestavba evropských zemí a jiných území poničených 2. světovou válkou je převážně dokončena, sanace dluhů pokračuje\\npokračuje rovnováha moci světa bipolárně rozděleného mezi dvě supervelmoci, USA a SSSR\\nStudená válka mezi nimi pomalu nabírá na intenzitě\\nstejně jako jaderné zbrojení a\\ndobývání vesmíru\\nválky a konflikty:\\nzažehnuta válka ve Vietnamu, která po svém skončení od poloviny následující dekády zanechá v myslích Američanů „syndrom“\\nŠestidenní válka z roku 1967 dala jasné obrysy vzájemnému vztahu Izraele a okolních arabských zemí na Blízkém východě a jejich válce.\\nInvaze vojsk Varšavské smlouvy do Československa potlačila liberalizaci režimu v Československu a uvrhla zemi do éry normalizace.\\nrůst objemu dopravy\\nSpojené státy jsou největším producentem ropy na světě, ale začínají se objevovat, zkoumat a připravovat nová ropná naleziště na Blízkém východě\\nhnutí hippies\\nsexuální revoluce"},{"page_url":"https://it.wikipedia.org/wiki/Settimana_santa_di_Taranto","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Posta1.jpg","page_title":"Settimana santa di Taranto","context_page_description":"I riti della Settimana santa di Taranto sono degli eventi che si svolgono nella città a partire dalla Domenica delle palme. Questi riti della Settimana santa risalgono all'epoca della dominazione spagnola nell'Italia meridionale. Furono introdotti a Taranto dal patrizio tarantino don Diego Calò, il quale nel 1703, commissiono a Napoli le statue di Gesù morto e dell'Addolorata. Durante il periodo illuminista nel 1765 il patrizio tarantino Francesco Antonio Calò, erede e custode della tradizione della processione dei Misteri del Venerdì santo, donò alla Confraternita del Carmine le due statue che componevano la suddetta processione e la prima volta fu il Venerdì Santo 4 aprile 1765, attribuendole l'onore e l'onere di organizzare e perpetrare quella tradizione cominciata nel 1703."}]`),L={name:"App",components:{PoemCard:M},data(){return{searchQuery:"",visibleCount:4,poemsData:P,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},F={class:"search-container"},T={class:"card-container"},I={key:0,class:"empty-state"},G=["disabled"],R={key:0},H={key:1};function K(a,e,s,m,o,r){const d=h("PoemCard");return t(),n("section",null,[e[4]||(e[4]=i("div",{class:"top-banner"},[i("div",{class:"top-banner-title"},[i("div",{class:"top-banner-title-text"},"🤔AI Techniques🧠")])],-1)),i("div",F,[e[3]||(e[3]=i("span",{class:"search-icon"},"🔍",-1)),_(i("input",{type:"text",class:"search-input","onUpdate:modelValue":e[0]||(e[0]=l=>o.searchQuery=l),placeholder:"Search..."},null,512),[[k,o.searchQuery]]),o.searchQuery?(t(),n("button",{key:0,class:"clear-search",onClick:e[1]||(e[1]=l=>o.searchQuery="")}," ✕ ")):p("",!0)]),i("div",T,[(t(!0),n(w,null,b(r.displayedPoems,(l,c)=>(t(),f(d,{key:c,poem:l},null,8,["poem"]))),128)),r.displayedPoems.length===0?(t(),n("div",I,' No results found for "'+u(o.searchQuery)+'". ',1)):p("",!0)]),r.hasMorePoems?(t(),n("button",{key:0,class:"load-more-button",disabled:o.isLoading,onClick:e[2]||(e[2]=(...l)=>r.loadMore&&r.loadMore(...l))},[o.isLoading?(t(),n("span",H,"Loading...")):(t(),n("span",R,"See more"))],8,G)):p("",!0)])}const N=g